INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(1, '040411100468', 'PERANCANGAN DAN IMPLEMENTASI SISTEM DATABASE \r\nTERDISTRIBUSI MENGGUNAKAN ORACLE STUDI KASUS \r\nSIAKAD UNIVERSITAS TRUNOJOYO', 'Budi Setyono M.T', 'Hermawan S.T', 'Sistem  informasi  akademik  (SIAKAD) merupakan  sistem  informasi  yang  berfungsi  menangani pengelolaan  dan  penyajian  data-data  akademik,  yang  oleh pihak  fakultas  SIAKAD  dianggap  sangat  penting  dalam memberikan  pelayanan  mahasiswa  yang  membutuhkan informasi akademik. Di Universitas Trunojoyo telah tersedia SIAKAD,  namun  masih  menggunakan  database  terpusat. Sistem seperti ini memberikan kelebihan yaitu perawatannya mudah  selain  itu  juga  membutuhkan  sedikit  biaya,  namun sistem  tersebut  juga  berpotensi  mengahadapi  kendala-kendala  yaitu  dalam  proses  transaksi  data  karena  padatnya jaringan yang menuju database SIAKAD, kelambatan dalam pemrosesan  respon  query  dikarenakan  data  yang  tersimpan semakin besar dan pemrosesan semakin kompleks, dan  juga memiliki kelemahan dalam hal ketersediaan data. Untuk  itu sistem  seperti  ini  memerlukan  pengembangan  sistem database  yang  lebih  baik  dengan  menggunakan  sistem databases  terdistribusi  pada  masing-masing  fakultas  yang dapat  dijadikan  solusi  bagi  permasalahan  di  atas.  Karena dalam basisdata terdistribusi terdapat keuntungan yang tidak dimiliki oleh basisdata  terpusat yaitu pengawasan distribusi, reability,  availability,  kecepatan  dalam  pemrosesan  query dan otonomi local', 'A.Ubaidillah S.Kom', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/040411100468'),
(2, '040411100476', 'APLIKASI KONTROL DAN MONITORING JARINGAN KOMPUTER BERBASIS MOBILE', 'Drs. Budi Soesilo, MT', 'Koko Joni, ST', 'Berjalannya koneksi jaringan komputer dengan lancar dan tanpa gangguan merupakan harapan seluruh penggunanya,\r\nterutama pihak yang bertanggung jawab pada bidang itu, yakni administrator jaringan. Namun tidak selamanya koneksi\r\njaringan dapat berjalan dengan lancar tanpa adanya gangguan. Kenyataan di lapangan terutama pada jaringan komputer skala\r\nbesar, berpotensi besar terjadi gangguan atau bahkan kerusakan koneksi jaringan komputer.\r\nHal ini rata - rata disebabkan banyaknya penggunaan serta padatnya traffic data dalam jaringan komputer itu sendiri.\r\nOleh karena itu untuk menjaga bahkan meningkatkan kualitas layanan koneksi jaringan maka diperlukan adanya akses kontrol\r\ndan monitoring pada level administrator jaringan secara real-time berbasis mobile, yang dapat mengatur dan mengetahui\r\ninformasi tentang koneksi jaringan dan dapat diakses setiap saat.\r\nPihak administrator jaringan dituntut untuk terlebih dahulu mengetahui adanya gangguan atau bahkan terputusnya\r\nkoneksi jaringan walaupun administrator tidak berada di tempat kontrol dan monitoring, Dengan adanya sistem kontrol dan\r\nmonitoring berbasis mobile, diharapkan dapat membantu tugas administrator dalam mengontrol dan memantau jaringan serta\r\ndalam mengambil kebijakan atas node – node yang terkoneksi pada jaringan yakni memanajemen koneksi, port dan bandwidth\r\nsetiap saat dan secara mobile. agar dengan segera dapat melakukan pembenahan ketika terjadi gangguan jaringan sebelum\r\npemakai jaringan (klien) melakukan pengaduan atas adanya gangguan.\r\nKata Kunci : Administrator Jaringan, Koneksi Jaringan, Akses Kontrol dan Monitoring.', 'M. Basith Ardianto,', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/040411100476'),
(3, '040411100480', 'RANCANG BANGUN APLIKASI PROXY SERVER UNTUK\r\nENKRIPSI KODE HTML MENGGUNAKAN\r\nALGORITMA BLOWFISH', 'Drs. Budi Soesilo, M.T', 'Hermawan, ST, MT', 'Web server adalah sebuah perangkat lunak server yang berfungsi\r\nmenerima permintaan HTTP atau HTTPS dari web client dan\r\nmengirimkan jawaban dalam bentuk halaman-halaman web yang\r\numumnya berbentuk dokumen HTML. Dokumen HTML yang dikirim\r\nmerupakan dokumen yang dibentuk dari bahasa markup yang plaintext.\r\nArtinya, dokumen berisi kode-kode HTML murni tanpa proses enkripsi.\r\nTujuan dari penelitan ini adalah membuat sebuah aplikasi proxy\r\nserver yang menerima permintaan HTTP dari web client dan\r\nmeneruskannya ke web server. Kemudian aplikasi ini akan menerima\r\nrespon dari server dan melakukan proses enkripsi pada dokumen HTML\r\nterlebih dahulu. Sehingga dokumen HTML yang dikirim kepada web\r\nclient sudah berbentuk dokumen HTML yang terenkripsi. Web client\r\ndisini bisa berupa aplikasi seperti Internet Explorer, Mozilla Firefox,\r\natau Opera. Aplikasi-aplikasi tersebut biasa dikenal dengan sebutan web\r\nbrowser.\r\nKetika web browser menerima dokumen HTML yang terenkripsi\r\ndari aplikasi proxy server, maka JavaScript Engine yang ada di web\r\nbrowser akan melakukan proses dekripsi sekaligus rendering sehingga\r\ndokumen akan ditampilkan sesuai dengan aslinya. Namun apabila kode\r\ndari dokumen HTML tersebut dilihat melalui menu view source yang\r\nada di web browser akan didapatkan dokumen HTML yang tetap\r\nterenkripsi.', 'Akhmad Suyandi, S.Kom', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/040411100480'),
(4, '040411100509', 'PENDETEKSIAN MINUTIAE PADA SIDIK JARI MENGGUNAKAN CROSSING NUMBER', 'Dr. Arif Muntasa, S.Si.,M.T', 'Rima Tri Wahyuningrum, S.T.,M.T', 'PENDETEKSIAN MINUTIAE PADA SIDIK JARI\r\nMENGGUNAKAN CROSSING NUMBER\r\n\r\n\r\nABSTRAK\r\n\r\nBerbagai penelitian tentang citra sidik jari, telah banyak dilakukan. Mulai dari pendeteksian, pengklasifikasian sampai dengan pengenalan pola sidik jari. Hal ini dikarenakan keunikan yang dimiliki oleh sidik jari yang dapat dijadikan sebagai pengenalan identitas seseorang.\r\nSalah satu fitur dalam pengenalan sidik jari adalah kesamaan letak minutiae pada sidik jari seseorang. Minutiae didefinisikan sebagai titik-titik akhir dan titik-titik awal percabangan dari garis-garis alur (ridge) yang memberikan informasi yang unik dari suatu sidik jari [7]. Secara umum minutiae terbagi menjadi dua macam yaitu minutiae termination yang merupakan tempat ridge berakhir dan minutiae bifurcation yang merupakan tempat ridge memisah atau bercabang.Pada penelitian ini membahas tentang bagaimana mendeteksi letak minutiae pada sidik jari dengan menggunakan metode Crossing Number dengan menggunakan dua skenario pada proses binaryzation. Skenario pertama menggunakan nilai treshold = nilai mean piksel citra, dan skenario kedua menggunakan nilai treshold = 80. Langkah pertama dalam penelitian ini yaitu dengan memasukkan citra sidik jari (load image). Selanjutnya dilakukan grayscaling, binaryzation, thinning, dan block filter. Langkah terakhir, deteksi minutiae melalui ekstraksi minutiae dengan menggunakan crossing number. Dari hasil uji coba diperoleh Pendeteksian minutiae termination menggunakan skenario kedua lebih baik dibandingkan dengan skenario pertama dengan rata-rata akurasi 96,22%. Sedangkan untuk pendeteksian minutiae bifurcation, skenario pertama lebih baik dibandingkan dengan skenario kedua dengan rata-rata akurasi 46,28%. \r\n\r\nKata kunci : minutea, minutiae bifurcation, minutiae termination, crossing number.\r\n', 'Yanto Erwanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/040411100509'),
(5, '050411100538', 'SISTEM INFORMASI GEOGRAFIS PEMETAAN WILAYAH BERDASARKAN TINGKAT KESEJAHTERAAN DI KABUPATEN BANGKALAN MENGGUNAKAN METODE FUZZY MAMDANI', 'Bain Khusnul Khotimah.,S.T.,M.Kom', 'Firli Irhamni, S.T., M.Kom.', 'Menurut pemetaan yang dilakukan oleh Tim Nasional Percepatan Penanggulangan Kemiskinan (TNP2K) pada tahun 2011, kabupaten-kabupaten di pulau Madura memiliki masalah kemiskinan dan merupakan wilayah dengan prioritas 1 dan 2 dalam penanganan kerentanan pangan. Oleh karena itu penulis membuat sistem informasi geografis pemetaan wilayah berdasarkan tingkat kesejahteraan menggunakan metode Fuzzy Mamdani. Metode ini mengatasi keterlibatan objek yang memiliki ketidakpastian di dalam Sistem informasi geografis. Tahapan proses perhitungannya adalah: pembentukan himpunan fuzzy, aturan fungsi implikasi, komposisi aturan dan defuzzyfikasi (nilai z), yang kemudian akan diimplementasikan kedalam pemetaan, sehingga informasi dapat diperolah dengan cepat dan efisien. Dari uji coba yang dilakukan sistem Kec. Tragah dan Kec. Galis, tingkat kesejahteraannya kurang (pemetaan berwarna merah), dengan nilai “Kesejahteraan (Z)” (Z = 0,0). Sedangkan untuk Kec. Kamal (Z = 62,2), Kec. Tanah Merah (Z = 57,1), Kec. Modung (Z = 61,50), Kec. Arosbaya (Z = 61,4), Kec. Sepuluh (Z = 56,7), Kec. Klampis (Z = 65,00), Kec. Konang (Z = 63,7), Kec. Geger (Z = 55,7), Kec. Labang (Z = 56,6), Kec. Blega (Z = 55,9), Kec. Kwanyar (Z = 60,4), Kec. Burneh (Z = 56,10), Kec. Socah (Z = 60,8), Kec. Tanjung Bumi (Z = 57,7)dan Kec. Kokop (Z = 57,4) tingkat kesejahteraannya sedang (pemetaan berwarna kuning), Kec. Bangkalan (Z = 68,5) tingkat kesejahteraanya tinggi (pemetaan berwarna hijau).\r\n\r\nKata Kunci: Sistem Informasi Geografis, Fuzzy Mamdani, Tingkat Kesejahteraan\r\n', 'Hendriatno', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100538'),
(6, '050411100558', 'ANALISA DATA ANTARAN POS EXPRESS MENGGUNAKAN\r\nMETODE RADIAL BASIS FUNCTION NEURAL NETWORK (RBF-NN)\r\nSTUDY PT. POS INDONESIA SURABAYA', 'Bain Khusnul Khotimah.,S.T.,M.Kom', 'Firli Irhamni, S.T., M.Kom.', 'PT. Pos Indonesia (Persero) merupakan salah satu perusahaan yang bergerak di bidang komunikasi. Saat ini,\r\nsalah produk pelayanan PT. Pos Indonesia (Persero) adalah produk Pos Express.  Produk  Pos  Express ini\r\ndiharapkan dapat diminati masyarakat dan dapat tetap bertahan bahkan  semakin menunjukkan keunggulan PT.\r\nPos Indonesia (Persero). Untuk  itu perlu dilakukan  analisis untuk melihat pola perkembangan, kemajuan  yang\r\ntelah ditunjukkan, bahkan untuk melihat dan memperoleh informasi, berupa peramalan  dalam waktu ke depan\r\nterhadap produk Pos Express yang masuk  ke kantor Mail  Processing Center  (MPC) Surabaya. Dalam  hal  ini\r\nanalisis yang dilakukan adalah peramalan jumlah produk Pos Express dengan menggunakan Metode RBF-NN\r\n(Radial Basic function neural  network).  Hasil  analisa  pada  ujicoba  yang  dilakukan  menghasilkan  nilai  yang\r\ncukup optimal, salah satunya pada percobaan 2 inputan dengan hasil peramalan pada epoch ke-60  yang\r\nmemperoleh hasil MSE : 0.124497 dan MAPE : 15.058923 dengan hasil ramal yang berjumlah 2587.9966.\r\nKata kunci: Peramalan , Jaringan Syaraf Tiruan (JST), Radial Basis Function neural network (RBF-NN).', 'siti murtasiyah warda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100558'),
(7, '050411100566', 'RANCANG BANGUN APLIKASI ENKRIPSI  SMS MENGGUNAKAN METODE RC4 BERBASIS PLATFORM ANDROID', 'Moh. Kautsar Sophan, S.Kom., M.MT', 'BAIN KHUSNUL KHOTIMAH, S.T., M.Kom', 'Perkembangan teknologi informasi beberapa dekade ini telah membuat perubahan yang sangat pesat. Dengan adanya teknologi informasi ini maka penyampaian informasi jarak jauh pun semakin mudah. Salah satu teknologi telekomunikasi yang menjanjikan kecepatan dalam penyampaian adalah Sort Message Service (SMS), dengan menggunakan teknologi SMS pengguna dapat bertukar pesan dengan orang lain secara cepat dan mudah. \r\nPada   tugas   akhir   ini   dikembangkan   sebuah   aplikasi   pada   telepon   selular   untuk memodifikasi pesan SMS menjadi cipherteks agar isi informasi dari SMS tersebut tidak diketahui oleh orang lain. Untuk pengiriman SMS sistem mengenkripsi pesan menjadi cipherteks menggunakan key yang diinputkan oleh pengirim kemudian mengirimkan ke nomor tujuan. Untuk penerimaan SMS sistem mendekripsi cipherteks menjadi plainteks menggunakan  key  yang  diinputkan  oleh  penerima  kemudian  menampilkan  pesan  asli kepada penerima. Aplikasi ini dapat dimanfaatkan oleh seseorang yang ingin mengirimkan suatu informasi rahasia kepada orang lain melalui SMS tanpa takut informasi dari pesan tersebut akan diketahui oleh orang lain.\r\nMetode yang digunakan sistem dalam mengenkripsi dan mendekripsi pesan adalah metode enkripsi RC4 dan implementasinya menggunakan bahasa pemrograman Java SE Development Kit 7 dengan tools Application Programing Intervace (API) android SDK.\r\n\r\nKata kunci: sort message service (SMS), enkripsi, dekripsi, RC4, Android.\r\n', 'Mohamad Eko Sudarmono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100566'),
(8, '050411100572', 'Sistem Pendukung Keputusan Rehabilitasi Bangunan Bersejarah Dengan Menggunakan Metode Fuzzy Analytical Hierarchy Process (F-AHP) Berbasis Spasial.', 'Mula\'ab. S. Si,. M. Kom', 'Riza Alfita. S. T,. M. T', 'Bangunan bersejarah merupakan salah satu peninggalan cagar budaya kota lama yang banyak mengandung cerita pada jaman perang kemerdekaan dahulu yang perlu dilestarikan dan nilai tambah untuk kepariwisataan kota surabaya. Karakteristiknya selalu mengalami penurunan kondisi yang diindikasikan dengan terjadinya kerusakan pada fisik bangunannya. Untuk mempertahankan kondisi bangunan sesuai dengan umur rencana yang telah direncanakan, maka selama masa bangunan tersebut berdiri perlu kegiatan rehabilitasi berupa pemeliharaan dan pembangunan berdasarkan tingkat kerusakan bangunan yang termasuk dalam evaluasi analisis multi kriteria.\r\nNamun sehubungan dengan keterbatasan anggaran, maka perlu dibuat prioritas berdasarkan berbagai kriteria dalam penanganan bangunan melalui mekanisme perencanaan pembangunan daerah. Penelitian menggunakan metode Fuzzy Analytical Hierarchy Process (FAHP) yang dikembangkan oleh Thomas L Saaty. Prioritas rehabilitasi bangunan akan ditampilkan melalui MapServer yang setiap letak bangunannya yang mengindikasikan rusak sedang, dan rusak berat.\r\n\r\nKata Kunci: Bangunan bersejarah, Analisis Multi Kriteria, Fuzzy AHP, MapServer.', 'Endra Budi Arief', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100572'),
(9, '050411100614', 'Sistem Pendukung Keputusan Penentuan Prioritas Produk Unggulan Daerah Dengan Menggunakan Metode F-AHP Studi Kasus Kabupaten Bangkalan', 'Mula\'ab. S. Si,. M. Kom', 'Riza Alfita. S. T,. M. T', 'Persaingan produk unggulan daerah semakin ketat seiring dengan terus meningkatnya laju pertumbuhan industri dan teknologi. Persaingan ini mengakibatkan setiap industri harus lebih jeli dalam merumuskan strategi kebijakan. Pengambilan keputusan untuk menentukan prioritas produk unggulan daerah yang sesuai dengan kebutuhan dan kemampuan diperlukan suatu keputusan yang akurat dan efektif agar tidak salah memilih dan meminimalisir kerugian baik dari segi biaya maupun waktu.\r\nDalam penelitian ini digunakan metode Fuzzy Analytic Hierarchy Process (FAHP) yang memiliki kelebihan dimana perkiran skala yang digunakan bersifat tidak tunggal. Maka Fuzzy AHP biasa digunakan untuk mengurangi faktor subyektivitas pada kriteria atau sub kriteria yang ada. Dengan menggunakan metode ini, diharapkan dapat dikembangkan software sistem pendukung keputusan yang dapat digunakan oleh suatu instansi, karena instansi cukup memilih beberapa barang yang akan menjadi alternatif pemilihan dan memberikan nilai bobot pada perbandingan alternatif dan kriterianya, adapun kriteria tersebut adalah omset, tenaga kerja, target pasar, asal bahan baku, badan usaha.\r\n\r\nKata Kunci: sistem pendukung keputusan, produk unggulan, metode FAHP.', 'Setia Kurniawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100614'),
(10, '050411100616', 'Berhitung Mudah dengan Jarimatika Berbasis Multimedia', 'Ari kusumaningsih, S.T., M.T.', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Keterampilan berhitung adalah salah satu ketrampilan dasar yang perlu dikuasai oleh anak. Begitu pentingnya ketrampilan berhitung ini, sehingga orang tua secara sadar maupun tidak seringkali ‘memaksa’ anak untuk segera menguasai berhitung dengan baik. Begitu bersemangatnya orang tua dalam mendorong anak agar pandai berhitung, acap kali kemudian menjadi kurang proporsional. Orang tua mulai panik kalau anaknya dinilainya terlambat menguasai ketrampilan berhitung. Apalagi bila orang tua melihat anak-anak yang sebaya sudah banyak yang menguasai ketrampilan berhitung dengan baik. Kepanikan bisa berkembang menjadi kejengkelan, kemarahan, dan sebagainya.\r\nJarimatika merupakan salah satu cara melakukan operasi hitung. Jika kita melakukan latihan berhitung secara berulang-ulang bersamadengan anak-anak, tidak perlu kuatir anak pasti menguasai ketrampilan ini dengan baik. Karena jarimatika memiliki beberapa kelebihan yaitu, Jarimatika memberikan visualisasi proses berhitung yang membuat anak mudah melakukannya, gerakan jari-jari tangan akan menarik minat anak,  jarimatika relatif tidak memberatkan memori otak saat digunakan, alatnya tidak perlu dibeli, tidak akan pernah ketinggalan, atau terlupa dimana menyimpannya\r\nSebagai hasil uji coba aplikasi ini, penulis melakukan kuisioner, dan hasilnya adalah dari 35 siswa di lingkungan SDN Mlajah 2 Bangkalan,  kemampuan berhitungnya bertambah baik, di bandingkan dengan sebelum menggunakan aplikasi jarimatika.', 'Handayani Firdauzi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100616'),
(11, '050411100651', 'RANCANG BANGUN SISTEM INFORMASI PEMETAAN TANAMAN PERTANIAN DI KABUPATEN BANGKALAN', 'HUSNI,S.Kom., M.T.', 'DIANA RAHMAWATI, S.T., M.T.', 'Kabupaten Bangkalan memiliki lahan pertanian seluas kurang lebih 98.683,38 Ha atau sekitar 79,03 % dari luas kabupaten Bangkalan seluruhnya. Lahan tersebut terdiri atas sawah teknis seluas 1.956,49 Ha tegal seluas 71.751,98 Ha, lahan kering mencapai 77.999,63 Ha yang tersebar di setiap kecamatan dengan topografi datar hingga berbukit. Namun demikian pembangunan pertanian mengalami hambatan karena selain kesuburan tanah rendah sebagian besar pembangunan pertanian masih tradisional  tanpa memerhatikan aspek kesesuaian lahan dan tanaman. Dalam tugas akhir ini dikembangkan sistem informasi pemetaan tanaman pertanian di kabupaten Bangkalan berbasis lahan. Penentuan jenis tanaman pada sistem berpedoman  pada hasil analisa kriteria kesesuaian jenis lahan dan jenis  tanaman dengan menggunakan metode matching dari Dinas Pertanian dan Peternakan Balai Penyuluhan Pertanian (BPP)  kabupaten Bangkalan. Data yang diperoleh diolah menjadi data spasial atau peta lokasi tanaman dengan memanfaatkan Google Maps sebagai aplikasi pemetaannya. Aplikasi Google Maps dipilih karena lebih memudahkan dalam mengetahui dan menentukan lokasi secara lebih detail. Penerapan aplikasi sistem informasi ini dapat membantu  pengguna khususnya petani dalam perencanaan dan pemilihan jenis tanaman yang sesuai untuk dikembangkan pada setiap kecamatan sehingga dapat meningkatkan produktivitas, kuantitas dan kualitas pertanian di kabupaten Bangkalan. \r\n	\r\nKata kunci: 	Kabupaten Bangkalan, Sistem Informasi, Google Maps, Lahan dan Tanaman.\r\n', 'RIDHA MARISTA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100651'),
(12, '050411100652', 'PERANCANGAN SISTEM DETEKSI PLAGIARISME KARYA ILMIAH BERBAHASA INDONESIA MENGGUNAKAN ALGORITMA WINNOWING FINGERPRINT', 'HERMAWAN, S.T, M.KOM', 'FIKA HASTARITA R, S.T, M.ENG', 'Pada era teknologi informasi ini banyak hal yang seharusnya baik mejadi disalah gunakan, salah satunya adalah plagiarisme. Plagiarisme merupakan masalah penting, terutama dalam lingkungan akademisi, dimana terjadi penjiplakan karya tulis ilmiah yang makin marak sekarang ini. Salah satu cara untuk mengurangi plagiarisme yaitu dengn membangun sebuah sistem deteksi plagiarisme. Adapun algoritma yang digunanak dalam proses deteksi plagiarisme yaitu dengan menggunakan algoritma winnowing. Dokumen yang akan dibandingkan diproses dan mendpatkan fingerprint dari dokumen tadi, dimana fingerprint tersebut berupa ekumpulan nilai hash. Fingerprint yang sama antara dokumen yang dibandingkan kemiripannya merupakan kunci dari penghitungan nilai similarity-nya. Hasil penghitungan kemiripan antar 2 dokumen dengan 2 gram menghasilkan similarity mencapai 75,56%, sedangkan dengan percobaan dengan 10 gram, beberapa dokumen tidak mendapatkan kemiripan, yaitu dengan nilai 0%. Dari hasil uji coba sistem deteksi plagiarisme menggunakan algoritma winnowing fingerprint, nilai similarity-nya bergantung pada besarnya nilai gram, basis dan window dari sistem tersebut. Semakin kecil nilai gram, maka hasil dari similarity semakin besar.', 'FERI OKTO SINAGA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100652'),
(13, '050411100660', 'RANCANG BANGUN APLIKASI MULTIMEDIA PEMBELAJARAN TEKNOLOGI INFORMASI DAN KOMUNIKASI (TIK) UNTUK SISWA MTs NEGERI SURABAYA 1 BERBASIS LTSA', 'Yeni Kustiyahningsih, S.Kom., M.Kom.', 'Sri Herawati, S.Kom., M.T.', 'Perkembangan  teknologi  informasi  dan  komunikasi  (TIK)  telah  memberikan pengaruh  terhadap  dunia  pendidikan  khususnya  dalam  proses  pembelajaran. Komunikasi sebagai media pendidikan  dilakukan dengan menggunakan media-media  komunikasi  seperti  telepon,  komputer,  internet,  e-mail,  dsb.  Interaksi antara guru dan siswa tidak hanya dilakukan melalui hubungan tatap muka tetapi juga  dilakukan  dengan  menggunakan  media-media  tersebut.  Guru  dapat memberikan layanan tanpa harus berhadapan langsung dengan siswa. Demikian pula siswa dapat memperoleh  informasi dalam  lingkup yang  luas dari berbagai sumber melalui cyber space atau  ruang maya dengan menggunakan komputer atau internet. Hal yang paling mutakhir adalah berkembangnya apa yang disebut“cyber teaching” atau pengajaran maya, yaitu proses pengajaran yang dilakukan dengan menggunakan  internet.\r\nLTSA (IEEE 1484) adalah suatu standar internasional sistem pembelajaran yang dikembangkan berdasarkan IEEE 1484 Learning Standards Committee (LTSC) oleh Farance Incorporational, divisi Edutool. LTSA merupakan arsitektur tingkat tinggi yang berfokus pada masalah teknologi pembelajaran, pelatihan berbasis komputer, sistem pendukung performasi elektronik, instruksi berbantuan komputer, dan lain-lain. Dapat juga diartikan sebagai suatu kerangka   kerja   untuk  mengetahui   sistem  yang   ada   dan   yang   akan   dibangun.\r\nDalam tugas akhir ini dibuat sebuah aplikasi multimedia pembelajaran interaktif yang di dalamnya memuat tentang teknologi  informasi  dan  komunikasi  (TIK). Aplikasi ini dikembangkan dengan menggunakan PHP sebagai web programming dan My SQL sebagai database server.', 'Mohammad Zuhdi Arief Setiawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100660'),
(14, '050411100662', 'Kalibrasi Kamera dengan Menggunakan Metode Tsai', 'Eza Rahmanita, ST., MT', 'Meidya Koeshardianto, S.Si., MT', 'Teknik kalibrasi sangat berpengaruh terhadap perkembangan computer vision karena setiap proses dalam teknik kalibrasi sangat diperlukan untuk pengolahan lanjutan berbagai macam proses vision. Dengan dilakukannya kalibrasi, proses vision akan menjadi lebih mudah. Dalam prosesnya teknik kalibrasi dilakukan untuk menentukan parameter yang dapat dilakukan untuk proses vision selanjutnya diantaranya rekonstruksi 3D. Penelitian ini mencoba mengangkat kembali teknik kalibrasi kamera klasik yang sangat popular, yaitu teknik kalibrasi kamera dengan menggunakan algoritma Tsai. Sebagai simulasi, hasil parameter yang akan didapat akan digunakan untuk melakukan pengukuran tinggi obyek dengan aplikasi dan kemudian dibandingkan dengan tinggi obyek secara real. Dari hasil ujicoba, didapatkan hasil bahwa tahapan proses kalibrasi kamera dengan metode Tsai berhasil dilakukan. Kemudian data parameter yang didapat, dilakukan simulasi dengan ujicoba sebanyak 5 skenario dengan masing-masing skenario dilakukan dengan 2 percobaan. Hasil yang didapat dari hasil pengukuran dengan aplikasi ternyata masih jauh dari hasil pengukuran secara nyata. Galat relative yang didapat dari perhitungan dengan aplikasi rata-rata hanya 50.6% dari perhitungan secara nyata. Hasil ini disebabkan karena proses pengambilan data awal dengan spesifikasi yang terbatas.\n\nKata kunci : kalibrasi kamera, algoritma tsai, computer vision', 'Bima Iffan Hakim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100662'),
(15, '050411100676', 'SISTEM PENDUKUNG KEPUTUSAN PENERIMAAN MAHASISWA BARU di STKIP PGRI BANGKALAN\r\nMENGGUNAKAN DECISION TREE C4.5', 'HERMAWAN, ST., M.KOM', 'BUDI DWI SATOTO., ST., M.KOM', 'Banyaknya calon mahasiswa baru yang mendaftar sebagai mahasiswa di STKIP PGRI Bangkalan membuat para panitia penerima mahasiswa baru kesulitan untuk menentukan peserta yang lulus dan diterima menjadi mahasiswa STKIP PGRI Bangkalan. Keputusan yang diambil secara konvensional selama ini dirasa kurang efektif dalam penentuan penerimaan mahasiswa baru, dibutuhkan suatu sistem yang dapat memberikan suatu pertimbangan dalam mengambil keputusan dalam hal penerimaan mahasiswa baru sehingga waktu yang dibutuhkan dalam penentuan penerimaan mahasiswa baru lebih efektif dan dengan hasil yang maksimal tentunya. Adapun penilaian calon mahasiswa baru didasarkan beberapa kriteria antara lain  Nilai ujian nasional,	nilai tes masuk STKIP PGRI Bangkalan, dan pendapatan orang tua.\r\nDibutuhkan perangkat lunak pendukung keputusan untuk pengambilan keputusan dalam penerimaan mahsiswa baru untuk mendukung kinerja panitia penerimaan mahasiswa baru dengan metode pengambilan keputusan yang tepat dalam hal ini adalah algoritma Decision Tree C4.5. Perangkat lunak yang dibangun ditujukan untuk membantu pengambilan keputusan pemecahan masalah multikriteria dalam kasus penerimaan mahasiswa baru di STKIP PGRI Bangkalan - Bangkalan Madura.\r\nBerdasarkan analisa pada penelitian ini diperoleh hasil bahwa sebanyak 165 mahasiswa baru dinyatakan lulus dengan nilai Unas >20, 10 mahasiswa dinyatakan lulus dengan perhitungan nilai ujian masuk > 20 dan 25 mahasiswa dinyatakan tidak lulus untuk atribut nilai ujian masuk <20\r\n', 'ARYO ANDRI OKTARIO PRAMUDIA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100676'),
(16, '050411100693', 'Desain game komputer adaptive testing untuk mempelajari matematika berbasis rpg', 'Arik Kurniawati, S.Kom.,M.Kom', 'Ari Kusumaningsih, ST.,MT', 'perkembangan industri games semakin cepat dan tujuan pengembangannya pun tidak hanya untuk hiburan semata. kebanyakan anak-anak berpikir kalau pelajaran matematika', 'kudsiyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/050411100693'),
(17, '060411100723', 'Sistem Pemilihan Supplier di Apotek Menggunakan Metode Fuzzy Analytical Network Process (FANP)', 'Firli Irhamni, ST., M.Kom.', 'Diana Rahmawati, S.T, M.T.', 'Kegiatan yang dilakukan di apotek yaitu transaksi penjualan obat kepada konsumen dan pembelian obat dari supplier. Karena suplier yang datang banyak, maka pihak apotek harus memilih suplier yang tepat, supaya usaha apotek dapat berjalan lancar. Untuk menyelesaikan permasalaha n di atas, pada penelitian ini dilakukan pendekatan Fuzzy Analytical Network Process (FANP) untuk memilih supplier obat terbaik untuk apotek. Penggunaan fuzzy bertujuan untuk mengakomodasi sifat samar dalam pengambilan keputusan untuk memberikan pertimbangan yang dapat mengatasi ketidakpastian didalam kriteria-kriteria kualitatif. Metode FANP dapat digunakan untuk menyelesaikan permasalahan pengambilan keputusan yang terdapat hubungan saling mempengaruhi antar kriteria dalam suatu level tertentu. Proses penghitungan FANP terhadap 5 supplier apotek Yakersuda yaitu Kallista, APL, AAM, Parit Padang dan Barito memperoleh hasil akhir bahwa terdapat 4 supplier yang mempunyai target sesuai dengan penilaian dari tiap kriteria dari perbandingan semua alternatif. Kriteria yang terpilih yaitu kualitas obat, ketepatan waktu, ketepatan jumlah, pengemasan, sistem komunikasi dan kerjasama, prosedur pembayaran, frekuensi pengiriman dan harga obat. Supplier yang terpilih yaitu Kallista, APL, AAM dan Barito dengan nilai bobot secara berturut-turut 3,19;3,19;3,19 dan 3,11. Hasil pemilihan tersebut memperoleh nilai prosentase sebesar 80% dari hasil verifikasi uji sistem.\r\nKata kunci: Sistem Pendukung Keputusan, Apotek, Perangkingan Supplier, Fuzzy Analytical Network Process (FANP)\r\n', 'Erwanto Indra Sasmita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100723'),
(18, '060411100741', 'Pencarian String Menggunakan Algoritma Boyer Moore Pada Dokumen', 'Eza Rahmanita, S.T., M.T.', 'Meydia Koeshardianto, S.Si., M.T.', 'Proses pencarian merupakan salah satu kegiatan penting dalam pemrosesan data. Proses pencarian dapat menghabiskan waktu jika ruang pencariannya besar, karena', 'Puspita Ika Putri Editya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100741'),
(19, '060411100742', 'PENGENALAN POLA TULISAN TANGAN HURUF ALPHABET DENGAN MENGGUNAKAN ALGORITMA CHAIN CODE \r\nDAN k-NEAREST NEIGHBOR\r\n', 'Bain Khusnul Khotimah, ST.,M.Kom', 'Mula’ab, S.Si, M.Kom', 'Pengenalan  pola  tulisan  tangan  adalah  sebuah  teknik dimana  input data yang berupa lembaran kertas hasil scan menggunakan scanner dan  menghasilkan  gambar  pada  komputer  yang  dikenali  sebagai  angka-angka biner, angka-angka biner  inilah yang kemudian diproses lebih lanjut dengan menggunakan algoritma  tertentu  menjadi  karakter  sehingga  dapat  dikenali  dan  diolah  menjadi informasi. Tentunya banyak sekali orang yang sudah mengenal tentang huruf alphabet  yang terdiri dari A sampai Z. Kelemahan dalam mengenali huruf adalah jika huruf yang dikenali sulit dan ada yang terhapus,  maka orang tersebut akan mencoba untuk mengenalinya dengan benar. Dan pada penelitian ini akan dibangun sebuah sistem pengenalan pola huruf alphabet menggunakan algoritma Chain Code dan k-Nearest Neighbor. Algoritma Chain code menggunakan metode yang melakukan penelusuran pixel-pixel pada objek dengan panduan arah mata angin. Dengan menggunakan arah  mata  angin  memiliki  keakuratan  akan pengenalan objek yang lebih baik. Setiap lekukan dapat dikenali sehingga penjejakan tepi mendekati objek aslinya. Yang  dapat menghasilkan vektor ciri berisi informasi berupa fitur kode chain code pembentuk huruf. Hasil yang akan diinputkan dalam proses klasifikasi menggunakan k-Nearest Neighbor(KNN). Metode ini tangguh terhadap data uji yang noise serta efektif jika menggunakan data uji yang besar\r\n', 'DENNY ANDRIE', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100742'),
(20, '060411100744', 'IMPLEMENTASI PENJUALAN LAPTOP DENGAN SISTEM REKOMENDASI BERBASIS FUZZY ANALYTIC NETWORK PROCESS (FANP)', 'Rika Yunitarini, ST., MT.', 'Yeni Kustiyahningsih, M.Kom', 'Kegiatan yang dilakukan di toko surya yaitu transaksi penjualan barang kepada pembeli. Karena laptop banyak jenis dan merek, maka pihak toko sering membantu memilih laptop yang di inginkan pembeli supaya sesuai dengan yang di inginkan. Untuk menyelesaikan permasalahan di atas, pada penelitian ini dilakukan pendekatan Fuzzy Analytical Network Process (FANP) untuk memilih laptop yang sesuai dengan pembeli. Penggunaan fuzzy bertujuan untuk mengakomodasi sifat samar dalam pengambilan keputusan untuk memberikan pertimbangan yang dapat mengatasi ketidakpastian didalam kriteria-kriteria kualitatif. Metode FANP dapat digunakan untuk menyelesaikan permasalahan pengambilan keputusan yang terdapat hubungan saling mempengaruhi antar kriteria dalam suatu level tertentu. Kriteria yang dapat di pilih adalah Harga, Layar, Processor, Kapasitas memori, Type memori, Harddisk, Bluetooth, dan Webcam.', 'Rony Gunawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100744'),
(21, '060411100754', 'Sistem Peramalan Jumlah Balita Gizi Buruk Menggunakan Metode Backpropagation With Error Modification', 'Firli Irhamni, S.T., M.Kom.', 'Bain Khusnul Khotimah, S.T., M.Kom.', 'Sistem pendataan mengenai balita penderita gizi buruk di Dinas Kesehatan Bangkalan masih dilakukan secara manual dan belum dapat memprediksi berapa jumlah balita penderita gizi buruk pada masa yang akan datang. Di dinas tersebut dibutuhkan suatu sistem peramalan yang mampu memprediksi jumlah balita penderita gizi buruk agar dapat dilakukan antisipasi dan mengambil keputusan dengan lebih efektif dan efisien untuk menanggulangi kasus tersebut. Untuk membangun sistem peramalan tersebut digunakan metode Backpropagation. Pada metode Backpropagation untuk mendapatkan nilai error yang kecil dibutuhkan proses pelatihan bobot yang cukup lama dan kurang efisien terhadap waktu. Untuk mengatasi hal tersebut maka dikembangkanlah metode Backpropagation With Error Modification, perhitungan nilai error dimodifikasi dengan memberikan sedikit fungsi baru. Metode Backpropagation menghasilkan MSE = 0,5833 dengan parameter hidden layer sebanyak 12, iterasi sebanyak 1000, momentum dengan nilai 0,1, learning rate dengan nilai 1 dan toleransi error = 0,0001. Sedangkan metode Backpropagation With Error Modification menghasilkan MSE = 0,1666 dengan parameter hidden layer sebanyak 12, iterasi sebanyak 1000, momentum dengan nilai 0,1, learning rate dengan nilai 1 dan toleransi error = 0,0001. Berdasar pada hasil MSE kedua metode tersebut, metode Backpropagation With Error Modification menunjukkan performa yang lebih baik dibanding metode Backpropagation sebelumnya.', 'Mohammad Indra Kusuma', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100754'),
(22, '060411100755', 'RANCANG BANGUN MANAJEMEN PEMBELAJARAN DAN TES TOEFL BERBASIS MOBILE', 'Hermawan S.T.,M.Kom', 'Andharini Dwi Cahyani S.Kom.,M.Kom', 'Penggunaan teknologi mobile saat ini sangat marak, disamping keunggulannya dapat mudah bawa dibawa kemana-mana, teknologi mobile sekarang sangat mudah untuk dieksplorasi, terbukti dengan adanya smartphone yang mempunyai banyak layanan yang dapat bermanfaat bagi para penggunanya. Toefl (Test Of English As A Foreign Languange) sangat dibutuhkan dalam menghadapi kemajuan teknologi saat ini, Kurang besarnya minat masyarakat dalam belajar bahasa inggris dan mengikuti tes-tes Toefl yang ada, berpengaruh pada kemajuan teknologi.  Android  merupakan  subset  perangkat  lunak  untuk perangkat  mobile  yang  meliputi  sistem  operasi, middleware,  dan  aplikasi  inti  yang  di  release  oleh Google. Android SDK adalah  tools  API (Application Programming Interface)  yang digunakan untuk memulai membuat aplikasi pada platform Android dengan menggunakan bahasa pemrograman Java. Eclipse adalah sebuah IDE (Integrated Development Environment) yang digunakan dalam  coding  aplikasi Android nantinya. Salah satu pemanfaatan teknologi mobile yaitu dengan membuat media pembelajaran dan tes TOEFL baik soal berupa teks dan audio dengan menggunakan  teknologi Android, tentunya berbasis mobile. Dengan tes TOEFL, pembelajaran test dan kelebihan listening menu di dalam aplikasi ini, diharapkan akan dapat membatu meningkatkan pemahaman pengguna mengenai tes TOEFL.\r\n\r\nKata Kunci: tes TOEFL, ANDROID, Java , Mobile, SDK\r\n', 'Susanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100755'),
(23, '060411100756', 'PEMANFAATAN SISTEM INFORMASI GEOGRAFIS UNTUK MEMPREDIKSI LAJU EROSI\r\nLAHAN PADA DAERAH ALIRAN\r\nSUNGAI DENGAN METODE\r\nUSLE', 'MULA\'AB, S.Si , M.Kom', 'FIRDAUS SOLIHIN , S.Kom , M.Kom', 'Erosi tanah merupakan kejadian alami yang ada dibumi ini, akan tetapi karena pengaruh manusia kejadian erosi menjadi lebih besar dari keadaan alaminya. Erosi merupakan salah satu penyebab kerusakan tanah terbesar di Indonesia. Erosi dapat megakibatkan longsor, penurunan kesuburan tanah, sedimentasi dan sebagainya. Melihat kondisi yang demikian diperlukan suatu teknologi yang bisa digunakan untuk memprediksi daerah yang rentan terhadap bahaya erosi. Dengan memanfaatkan Sistem Informasi Geografis (SIG) dan menggunakan metode Universal Soil Loss Equation (USLE) dapat digunakan untuk memprediksi besarnya erosi tanah yang terjadi. Dengan beberapa variabel yang digunakan dalam metode ini adalah erosivitas hujan, erosibilitas tanah, panjang dan kemiringan lereng, pengelolaan tanaman dan konservasi tanah. Dari penelitian ini akan didapatkan sebuah peta yang menunjukkan adanya erosi tanah di Daerah Aliran Sungai (DAS) Bengawan Solo yang berbasis Sistem Informasi Geografis dan digunakan sebagai alat untuk mengetahui dan memonitor daerah yang rentan terhadap erosi sehingga dapat dimanfaatkan untuk pengendalian serta penanggulangan erosi tanah didaerah aliran sungai tersebut.', 'ABDULLAH KAMIL', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100756'),
(24, '060411100761', 'DESAIN SISTEM E-VOTING PEMILIHAN REKTOR MENGGUNAKAN BLIND SIGNATURE', 'Moh. Kautsar Sophan, S.Kom., M.M. ', 'Bain Khusnul Khotimah, S.T, M.Kom', 'Pemilihan Rektor merupakan agenda rutin yang dilaksanakan lima tahun sekali oleh Universitas Trunojoyo untuk menentukan Rektor periode berikutnya, pemilihan rektor saat ini masih dilakukan dengan cara manual, kendala yang dihadapi adalah terjadinya kecurangan dan tidak efisien. Pada penelitian ini dirancang protokol dan simulasi sistem e-voting pada pemilihan rektor. Fungsi-fungsi pada sistem ini disesuaikan dengan skema e-voting yang harus memenuhi beberapa kriteria, yaitu Eligibility, Unreusability, Anonymity, Accuracy, Fairness, Vote and Go, dan Public Verifiability. Protokol ini akan digunakan  untuk sistem pendaftaran pemilih, validasi pemilih, sistem pemilihan, dan sistem perhitungan suara. Untuk menjaga kerahasiaan pilihan pemilih, sistem e-voting ini menggunakan algoritma blind signature. Hasil dari penelitian ini adalah sebuah sistem e-voting berbasis web yang menggunakan otentikasi finger print untuk mencegah terjadinya pemilihan kolektif. Hasil penelitian ini berdasarkan kusioner kepuasan pengguna yang disebar kepada responden dapat disimpulkan baik dan menunjukkan bahwa e-voting dapat mempercepat proses perhitungan suara dan meminimalisir kesalahan perhitungan yang dapat terjadi jika dilakukan secara manual oleh manusia. \r\n\r\nKata kunci: E-voting, fingerprint, web, pemilihan umum, blind signature.\r\n', 'Hanifudin Sukri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100761'),
(25, '060411100762', 'Klasifikasi Tingkat Kesejahteraan Masyarakat Di Kabupaten Bangkalan Menggunakan Metode \r\nFuzzy K-Means Dan Indeks Davies Bouldin', 'Bain Khusnul Khotimah. S.T.,M.Kom ', 'Aeri Rachmad S.T, M.T', 'Indonesia memiliki kelebihan angkatan kerja yang tinggi, sementara penyerapan tenaga kerja di dalam negeri terbatas, sedangkan permintaan tenaga kerja khususnya dari negara Timur Tengah dan Asia Pasifik cukup banyak sehingga menyebabkan terjadinya migrasi tenaga kerja terhadap negara-negara tersebut. Tingkat pengangguran itu dipengaruhi oleh skill dan unskill sedangkan tingkat kesejahteraan dipengaruhi oleh pendidikan, usia produktif, kesehatan, luas daerah, jumlah penduduk dan lapangan kerja. Pada penelitian ini dilakukan perhitungan tingkat kesejahteraan menggunakan metode Fuzzy K-Means sebagai pengelompokan untuk mengetahui tingkat kesejahteraan masyarakat. Sedangkan Indeks Davies Bouldin digunakan untuk akurasi data hasil agar memperoleh nilai akhir yang mendekati kenyataan yang sebenarnya di lapangan. Dengan diimplementasikannya Sistem Klasifikasi ini dapat membantu kinerja perhitungan lebih cepat dan terotomatisasi dimasa akan datang, sehingga tingkat kesejahteraan masyarakat dapat diketahui dengan mudah.\r\nHasil Clustering data pada tahun 2008 menggunakan 50 iterasi dengan cluster 2, 4 dan 6 ( 0.883, 2.457 dan 4.379), tahun 2009 menggunakan 50 iterasi dengan cluster 2, 4 dan 6 (0.907, 2.828 dan 4.446) dan tahun 2010 menggunakan 50 iterasi dengan cluster 2, 4 dan 6 (0.908, 2.373 dan 4.379). Dapat disimpulkan semakin banyak jumlah klaster yang digunakan maka semakin tinggi juga nilai IDB walaupun menggunakan nilai terasi yang berbeda-beda. Jangka waktu tidak berpengaruh terhadap nilai IDB  karena berdasarkan penelitian ini nilai DBI pada tahun 2008 sampai 2010 tidak menunjukkan perubahan yang signifikan', 'Misbahul Fadil', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100762'),
(26, '060411100765', 'PEMANFAATAN\r\n MICROSOFT SPEECH APPLICATION PROGRAMMING INTERFACE  PADA APLIKASI \r\nPENERJEMAH BAHASA INGGRIS KE DALAM BENTUK STRUCTURED QUERY LANGUAGE \r\nDENGAN PENGGUNAAN NATURAL LANGUAGE PROCESSING', 'Bain Khusnul Khotimah, ST.,M.Kom.', 'Ari Kusumaningsih, ST., MT.', 'Perintah dengan menggunakan suara memungkinkan pengguna\r\ndapat mengakses isi database dengan mengucapkan perintah melalui\r\nperalatan masukan audio tanpa harus menggunakan cara konvensional.\r\nPenggunaan program database dalam pengoperasiannya, diperlukan\r\npemahaman pada struktur SQL (Structured Query Language).\r\nKemudahan bisa dirasakan bagi pengguna awam karena sistem\r\npengaksesan database disertai dengan pengembangan NLP (Natural\r\nLanguage Processing).\r\nPerintah dengan suara menggunakan piranti masukan audio\r\nseperti mikrofon dan mesin pengenal ucapan. Ketika pengguna\r\nmengucapkan perintah melalui mikrofon, mesin pengenal ucapan akan\r\nmenerjemahkan dari ucapan ke teks. Dari teks akan diterjemahkan\r\nkedalam bentuk perintah SQL untuk pengaksesan database. Penelitian\r\nini memanfaatkan Teknologi Pengenalan Suara Automatis pada\r\nMicrosoft Speech Aplication Programming Interface. Perintah suara\r\nyang diucapkan menggunakan sintaksis bahasa alami, yaitu bahasa\r\nInggris. Dengan proses NLP menggunakan metode Top Down Parse.\r\nMasalah yang dihadapi dalam menggunakan pengenalan\r\nucapan adalah noise juga perlu untuk berbicara sejelas mungkin. Dalam\r\npengaplikasiannya dilakukan suatu uji coba pengenalan ucapan\r\nsebanyak 12 kali pengucapan perintah dan diperoleh hasil keakuratan\r\nsebesar 33% sedangkan inputan kalimat bahasa alami yang berhasil\r\nditerjemahkan dalam bentuk SQL sebanyak 67%.', 'Anisa Kahfiyatul Nur Aziza', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100765'),
(27, '060411100772', 'ANALISA VALIDITAS PENERIMA BEASISWA MENGGUNAKAN METODE ANALYTIC NETWORK PROCESS DAN TOPSIS', 'Bain Khusnul K., S.T., M.Kom.', 'Firli Irhamni, S.T., M.Kom.', 'Beasiswa adalah pemberian berupa bantuan keuangan yang diberikan kepada perorangan yang bertujuan untuk digunakan demi keberlangsungan pendidikan yang ditempuh. Program beasiswa diadakan untuk meringankan beban mahasiswa dalam menempuh masa studi kuliah khususnya dalam masalah biaya. Fakultas Teknik Universitas Trunojoyo memiliki program beasiswa yang harus diberikan kepada yang berhak menerima. Diantaranya Beasiswa Bantuan Belajar Mahasiswa (BBM), Beasiwa Peningkatan Prestasi Akademik (PPA) dan setiap jenis beasiswa memiliki kriteria atau faktor bobot yang berbeda. Tetapi dalam melakukan seleksi beasiswa tentu akan mengalami kesulitan karena banyaknya pemohon, banyaknya kriteria dan masih menggunakan cara manual yang mengakibatkan kurang efektifnya keputusan. Untuk membantu dalam menetapkan seseorang yang layak menerima beasiswa maka dibutuhkan sistem pendukung keputusan. Metode yang digunakan dalam penelitian ini adalah Analytic Network Process (ANP) dan Technique Order Preference by Similarity To Ideal Solution (TOPSIS). Pada penelitian ini akan diangkat suatu kasus yaitu menganalisa validitas alternatif terbaik penerima beasiswa berdasarkan kriteria-kriteria yang telah ditentukan dengan menggunakan metode ANP kemudian dicari solusi pengurutan dengan menggunakan metode TOPSIS. Berdasarkan hasil uji coba sistem, terdapat perbedaan selisih hasil rekomendasi dari sistem terhadap data aktual pemenang beasiswa PPA jurusan informatika, yaitu 78,57%. Sedangkan selisih hasil rekomendasi dari sistem terhadap data aktual pemenang beasiswa BBM jurusan informatika, yaitu 80,95%.\r\n\r\nKata kunci: ANP, TOPSIS, MCDM, pengambilan keputusan multi kriteria, seleksi beasiswa.\r\n', 'Hilmi Fairuz Abadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100772'),
(28, '060411100773', 'SIMULASI LAMPU LALU LINTAS PADA SEBUAH PERSIMPANGAN JALAN DENGAN MEMANFAATKAN CITRA CCTV MENGGUNAKAN GABOR FILTER DAN FUZZY LOGIC\r\n', 'Dr. Indah Agustien S, S.Kom, M.Kom.', 'Bain Khusnul Khotimah, ST.,M.Kom.', 'Kemacetan lalu lintas merupakan masalah yang hampir terjadi diseluruh negara. Muncul masalah baru dalam penentuan lama nyala lampu lalu lintas. CCTV merupakan peralatan monitoring yang cukup popular akhir-akhir ini. Akan tetapi, kegunaan CCTV sebatas monitoring secara manual. Tidak ada proses otomatisasi pengaturan lalu lintas berdasarkan gambar yang dihasilkan CCTV. Dibutuhkan sistem yang memanfaatkan gambar yang diambil menggunakan CCTV pada persimpangan jalan untuk mengatur lalu lintas. Dalam proses pengenalan obyek pada citra CCTV terdapat 2 tahap utama dalam simulasi lalu lintas, yaitu identifikasi keadaan jalan dengan metode gabor filter untuk mengetahui kepadatan jalan dilanjutkan dengan penentuan cycle time menggunakan Metode Mamdani dengan variabel fuzzy keadaan jalan, waktu, dan hari. Pada uji coba skenario 1 dengan variabel waktu pukul 06.00, variabel hari senin, dan variabel keadaan jalan 400. Dengan dengan cycle time pendek [0-15] menghasilkan nyala lampu 10 detik. Artinya tingkat keramaian pada mencapai 66,7%. Pada uji coba skenario 2 menggunakan variabel waktu pukul 09.41.45, variabel hari selasa, dan variabel keadaan jalan 488. Dengan cycle time pendek [0-15] menghasilkan nyala lampu 11 detik. Artinya tingkat keramaian mencapai 73,3%.', 'Ahmad Afwan Arin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100773'),
(29, '060411100774', 'DESAIN DAN IMPLEMENTASI INFRASTUKTURE AS A SEVICE CLOUD COMPUTING MENGGUNAKAN PROXMOX', 'Hermawan S.T., M.Kom', 'Firdaus Solihin. S.Kom.,M.Kom', 'Kebutuhan akan sumber daya teknologi di bidang software dan hardware semakin besar, sedangkan investasi akan sumber daya tersebut membutuhkan waktu, biaya, dan tenaga yang tidak mungkin didapat dalam waktu yang singkat. Solusinya adalah dengan menggunakan teknologi cloud computing Infrastructure as a Service. IaaS cloud computing adalah teknologi yang memberikan sumberdaya teknologi informasi dasar, yang meliputi media penyimpanan, processing power, memory, sistem operasi, dan kapasitas jaringan yang dapat digunakan oleh pengguna  cloud client. Dengan teknologi ini pengguna dapat memenuhi semua kebutuhan sumber daya komputasi tanpa mengorbankan waktu, biaya dan tenaga, dikarenakan pengguna hanya meminta layanan yang dibutuhkan kepada penyedia cloud. Pada penelitian ini, diimplementasikan  cloud computing  dengan menggunakan  proxmox yang merupakan  operating sistem  open source dengan kemampuan Infrastructure as a Service  (IaaS). Infrastructure as a Service dalam proxmox menggunakan teknologi virtual server sehingga utilitas dari hardware server menjadi maksimal. Server proxmox saat menjalankan virtual machine secara bersama dengan sistem operasi windows xp, mampu menjalankan 17 virtual machine sekaligus, sedangkan saat menjalankan sistem operasi ubuntu 9.10 mampu menjalankan 18 virtual machine sekaligus. Dan saat menjalankan ftp server server proxmox mampu menjalankan 10 virtual machine sekaligus.', 'AHMAD RUDHIYUL HAQ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100774'),
(30, '060411100779', 'Pencocokan Obyek Wajah Menggunakan metode SIFT\r\n(Scale Invariant Feature Transform)', 'Eza Rahmanita, ST., MT.', 'Meidya Koeshardianto, S.Si., MT.', 'Pengenalan obyek merupakan penelitian yang menggabungkan konsep citra digital, pengenalan pola, matematika, dan statistik. Pengenalan obyek berarti memberikan klasifikasi terhadap obyek, benda atau bentuk tertentu yang terdapat pada suatu citra digital. Pengenalan obyek umumnya terdiri dari deteksi dan pengenalan. Pada deteksi, komputer mencari dan mengidentifikasi komponen-komponen penting pada suatu citra digital untuk mengetahui ada atau tidaknya obyek yang ingin dikenali pada citra tersebut. Identifikasi wajah adalah salah satu tahap praproses yang sangat penting di dalam sistem pengenalan wajah yang digunakan untuk sistem biometric sebagai proses identifikasi autentik seseorang berdasarkan ciri-ciri yang sesuai dengan citra wajah. Namun dalam penerapan fungsi citra tersebut dibutuhkan keakuratan. Untuk itu diperlukan aplikasi pencocokan obyek wajah guna memberikan informasi identifikasi wajah sebagai bukti autentik seseorang. Aplikasi pencocokan wajah ini menggunakan metode Scale Invariant Feature Transform (SIFT) untuk pendeteksian keypoint. Jumlah keypoint dapat berubah berdasarkan nilai threshold yang ditentukan. Nilai threshold 0,1 pada beberapa citra masukan jumlah keypoint yang berkesesuaian bernilai 0, sehingga tidak dapat dilakukan proses pencocokan obyek wajah. Pada nilai threshold 0,8 jumlah keypoint yang berkesesuaian bernilai sedang dan dapat menunjukan hasil yang diperlihatkan pada result matching. Sedangkan pada nilai threshold 0,9 jumlah keypoint yang berkesesuaian semakin banyak ditemukan, hal ini dapat diproses pada registrasi keypoint dan dapat ditunjukan pada result matching.\r\n\r\nKata kunci: Object Recognition, keypoint, SIFT, result matching\r\n', 'Jerri Agus Wahyudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100779');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(31, '060411100783', 'Sistem Vision Cerdas Menggunakan Hand Gesture Recognition', 'Eza Rahmanita, S.T., M.T.', 'Meidya Koeshardianto, S.Si., M.T.', 'Interaksi merupakan langkah awal dalam mengoperasikan komputer, yang menghubungkan antara manusia dan komputer dengan karakteristik tertentu untuk mencapai suatu tujuan tertentu dengan menjalankan sebuah sistem yang bertopengkan sebuah antarmuka (interface). Salah satu faktor interaksi yang berpengaruh terhadap perkembangan teknologi saat ini adalah visi komputer (Computer Vision) yang bersifat alami. Dengan adanya interaksi yang bersifat alami, user dapat lebih mudah berinteraksi dengan komputer tanpa bersentuhan langsung dengan perangkat keras seperti mouse, pointer atau keyboard.\r\nPada penelitian ini dirancang sebuah sistem vision cerdas yang dapat mengoperasikan komputer tanpa bersentuhan langsung dengan mouse, pointer atau keyboard, dimana sistem ini beroperasi untuk fungsi Next dan Previous Slide pada Microsoft Power Point dengan cara menangkap gerakan tangan (Hand Gesture) melalui kamera berdasarkan warna kulit tangan yang terdeteksi menggunakan algoritma skin detection, proses ini mengacu pada tracking gerak tangan yang diwakili oleh 1 titik acuan pada tangan, dengan memanfaatkan perbedaan warna kulit dalam format YCrCb. \r\nKata kunci : Computer Vision,  Color Space, Skin Detection\r\n', 'Mohammad Akrom', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100783'),
(32, '060411100784', 'Rancang Bangun Sistem Pencarian Terdistribusi Pada E-jurnal Berbasis WeB Service Menggunakan Rest', 'Hermawan S.T., M.Kom.', 'Andarini Dwi C S.Kom., M.Kom.', 'Pada era modern ini kebutuhan akan internet semakin tinggi mengikuti perkembangan zaman. Namun masih banyaknya ketidak akuratan data e-jurnal yang sesuai dengan keyword yang diinputkan oleh user mengindikasikan akan diperlukannya suatu pencarian terdistribusi pada e-jurnal sebagai sarana untuk mempermudah pencarian. Untuk itu  dapat dikembangkan sistem pencarian berbasis web service menggunakan Representational State Transfer (REST) guna pengoptimalan layanan yang dibutuhkan. Web Service merupakan suatu sistem yang menyediakan pelayanan berupa XML dan digunakan untuk aplikasi sistem yang terdistribusi secara heterogen baik dari sistem operasi sampai model object. Web service mendefinisikan suatu fungsi tertentu yang dapat diakses oleh aplikasi yang lain melalui internet dengan menggunakan protokol-protokol yang menjadi standart internet. Berdasarkan dari hasil pengujian sistem, didapatkan nilai minimal cosine similarity terbaik dengan treshold 0,1. Dengan nilai presentase rata-rata precision 58,6 %, nilai presentase rata-rata recall nya mencapai 92,4 % dan nilai rata-rata presentase f-measure nya adalah 65,5 %. Hasil dari pengujian efektifitas sistem pada masyarakat, dapat dikatakan bahwa aplikasi ini sangat membantu dan cukup baik diterima oleh user, dengan presentase sangat baik 34,4 % , baik 56 %, cukup baik 9,6 % .', 'Eko Firmanto Abfiadin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100784'),
(33, '060411100790', 'Deteksi dan Estimasi Jarak Obyek Menggunakan Stereo Vision Dengan Metode Haar Like Feature', 'Dr. Indah Agustien S, S.Kom., M.Kom', 'Faikul Umam, S.Kom., M.T', 'Perkembangan  teknologi pada bidang computer vision begitu pesat. Berawal dari fungsi kamera sebagai alat penangkap obyek menjadi alat deteksi. Adapun penelitian ini bukan hanya memfungsikan kamera sebagai alat deteksi melainkan menjadikan alat pengukur jarak obyek menggunakan dua kamera yang telah dikalibrasi sehingga disebut dengan Stereo Vision. Dua kamera yang terkalibrasi itu diilhami oleh organ penglihatan manusia. Metode yang digunakan dalam penelitian adalah algoritma haar dalam mendeteksi wajah yang dibangun dengan bahasa pemerograman C# dan image processing EmguCV.  Setelah deteksi wajah maka akan ditemukan disparitas dari kedua gambar yang diambil oleh masing-masing kamera karena adanya sudut pandang berbeda. Untuk mengukur jarak diperlukan nilai disparity gambar, baseline sebagai jarak pemisah antar kamera dan focal lenght sebuah kamera. Proses deteksi dan estimasi jarak  wajah ke kamera berdasarkan sampel menghasilkan 96% tingkat keberhasilan. Dalam deteksi wajah hanya dikhususkan pada deteksi wajah dengan posisi lurus kedepan terhadap kamera (frontal face). Intensitas cahaya ruangan dan besar kecilnya wajah tidak berpengaruh dalam pendeteksian pengukuran jarak pada aplikasi ini. Dengan adanya aplikasi ini, kamera bertambah fungsi sebagai alat deteksi dan pengkur jarak yang ekonomis\r\n\r\nkatakunci : Stereo Visison, Haar Like Feature, Cascade Frontal Face, Face Detection, Computer Vision', 'Moh. Sholeh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100790'),
(34, '060411100791', 'DESIGN AND IMPLEMENTATION OF ENCRYPTED FILESYSTEM BASED ON FUSE FRAMEWORK ON LINUX OPERATING SYSTEM USING BLOWFISH ALGORITHM', 'Dwi Kuswanto, S.Pd., MT.', 'Iwan Santosa, ST., MT.', 'Dalam suatu sistem operasi, filesystem merupakan salah satu komponen yang memiliki peranan penting dalam proses penyimpanan dan pengaksesan data. Pada umumnya filesystem yang terdapat di sistem operasi Linux menyimpan data dalam bentuk data asli (plain text) yang aksesnya hanya dibatasi oleh access control. Keamanan data pada filesystem ini dapat ditingkatkan dengan mengimplementasikan enkripsi yang akan secara otomatis mengubah data asli menjadi data acak (cipher text). Proses enkripsi akan menjamin data yang tersimpan hanya dapat dibaca oleh pengguna yang memiliki kunci dekripsi. Dalam penelitian ini telah berhasil dikembangkan suatu filesystem berbasis framework FUSE yang mengenkripsi data menggunakan algoritma Blowfish.\r\nHasil uji coba membuktikan bahwa performa filesystem yang dikembangkan dalam penelitian ini mengalami penurunan performa rata-rata sebesar 37,86% dibandingkan dengan filesystem standar Ext4 yang umum digunakan di Linux. Kecepatan penulisan file ke hard disk semakin menurun jika file yang dituliskan secara bersamaan meningkat dalam jumlah maupun ukurannya. Di sisi lain, filesystem yang dikembangkan juga terbukti dapat melindungi data pengguna melalui prose enkripsi.', 'Rotua Halomoan Damanik', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100791'),
(35, '060411100792', 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI JURUSAN DENGAN MENGGUNAKAN METODE AHP DAN SAW', 'FIKA HASTARITA RACHMAN,S.T., M.Eng.', 'BAIN KHUSNUL KHOTIMAH, S.T., M.Kom.', 'Beragam jurusan yang ada pada SMKN 1 Buduran Sidoarjo yaitu jasa boga, busana butik, akomodasi perhotelan serta kecantikan rambut, seringkali membuat kesulitan calon siswa untuk memilih jurusan yang sesuai dengan bakat minatnya.  Akibatnya tidak sedikit dari mereka yang kurang mampu mengikuti pelajaran. Sedangkan kriteria yang dibutuhkan antara lain penampilan, komunikasi, pengetahuan umum dan bakat minat. Sehingga dibutuhkan suatu sistem pendukung keputusan yang mampu menghitung perhitungan nilai, kemampuan, serta minat yang dimiliki siswa untuk membantu menentukan jurusan yang tepat. Penelitian ini mengimplementasikan metode Analytical Hierarchy Process (AHP) dan Simple Additive Weighting (SAW). Metode AHP dapat menyelesaikan keputusan yang kompleks dengan struktur alternatif  ke dalam kerangka hierarki. Hierarki didefinisikan sebagai suatu representasi dari sebuah permasalahan yang komplekdalam suatu struktur multi level dimana level pertama adalah tujuan (goal), yang diikuti level faktor, kriteria (atributes), subkriteria (sub-atributes) dan alternatif. Sedangkan metode SAW dikenal dengan metode penjumlahan terbobot. Konsep dasar metode SAW adalah mencari penjumlahan terbobot dari rating kinerja pada setiap alternatifpada semua atribut. Sistem ini dapat membantu calon peserta didik dalam merekomendasikan jurusan yang sesuai dengan kemampuan dan minat siswa dengan tingkat kesesuaian 85%.\r\nKata kunci : sistem pendukung keputusan, AHP, SAW, rekomendasi jurusan\r\n', 'LEILY AULA RAHMAWATI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100792'),
(36, '060411100801', 'PENGEMBANGAN MESIN PENCARIAN ANTIPLAGIASI PADA \r\nSIM JURNAL MAHASISWA MENGGUNAKAN ALGORITMA \r\nWINNOWING FUZZY K-MEANS', 'Hermawan S.T.,M.Kom', 'Andharini Dwi Cahyani S.Kom.,M.Kom', 'ABSTRAK\r\nPenjiplakan merupakan masalah yang sering muncul dan semakin berkembang terutama dalam bidang pendidikan. Banyak karya tulis yang sebagian bahkan seluruh isinya dibuat dengan menjiplak dari karya tulis orang lain. Untuk mengatasi masalah tersebut, salah satunya solusinya adalah dengan dibuatnya aplikasi yang dapat mengelompokan dokumen dan mendeteksi penjiplakan pada dokumen tersebut. Pada tugas akhir ini dibuat aplikasi yang dapat mendeteksi penjiplakan antar dokumen yaitu dengan membandingkan antar dokumen. Dalam melakukan pendeteksian penjiplakan dokumen digunakan algoritma Winnowing. Algoritma winnowing ini berfungsi untuk melakukan proses dokumen fingerprint, yaitu dengan merubah teks menjadi sekumpulan nilai - nilai hash. Nilai hash ini yang akan digunakan untuk mendeteksi tingkat kesamaan antar dokumen. Dalam hal pengelompokan dokumen dipergunakan algoritma fuzzy k-means. Dari hasil uji coba aplikasi ini dapat diambil kesimpulan bahwa semakin besar nilai n-gram, basis, dan window maka semakin kecil hasil prosentase kemiripan antar dokumen yaitu dengan menghasilkan sebesar 4.17%, dan sebaliknya semakin kecil nilai n-gram, basis, dan window maka semakin besar  prosentase kemiripan antar dokumen yaitu dengan menghasilkan prosentase 98.49%. Pada perhitungan nilai f-measure dipengaruhi oleh keakuratan data yang diproses.\r\nKata Kunci : deteksi penjiplakan, cluster, f-measure', 'ilham wibisono aziz', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100801'),
(37, '060411100810', 'Pengembangan Aplikasi Pendeteklsi Plagiarisme Dengan Metode Latent Semantik Index', 'Hermawan S.T, M.Kom', 'Fika Hastarita R S.T, M.Eng', 'Pendeteksian plagiarisme dilakukan untuk mendeteksi plagiarisme  terhadap karya ilmiah . Metode Latent Semantik Index adalah salah satu dari beberapa metode yang merupakan search engine untuk meningkatkan kualiatas pencarian. Metode ini dipilih untuk membantu permasalahan tersebut.Metode Latent Semantik Index atau disingkat LSI mengunakan tahapan untuk mendapatkan nilai similarity antara dokumen satu dengan dokumen lainnya. Tahap yang harus dilalui dengan Singular Value Decompotition (SVD) untuk mereduksi atau mendekomposisi matriks dokumen. SVD biasa digunakan dalam menyelesaikan kuadrat linear terkecil tak terbatas, perkiraan dimensi atau rank matriks dan analisa hubungan secara kanonik. Perhitungan similarity menggunakan cosine similarity untuk mendapatkan kesamaan antar dokumen. Threshold nilai antara 0 sampai dengan 1, dengan nilai 0,410 sampai  mendekati atau mencapai angka 1 maka dokumen tersebut sama atau plagiarisme.', 'Pan Gani Ginting', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100810'),
(38, '060411100818', 'APLIKASI CITRA MOSAIC PANORAMIC MENGGUNAKAN METODE SIFT (SCALE INVARIANT FEATURE TRANSFORM)', 'Eza Rahmanita, ST, MT', 'Meidya Koeshardianto, S.Si, MT', 'Sebuah citra banyak diterapkan dalam berbagai aspek kehidupan, misalnya dalam bidang kedokteran untuk mengetahui bagian dalam tubuh manusia atau mendeteksi penyakit, dalam bidang geologi untuk memetakan suatu wilayah tertentu, dan lain sebagainya. Oleh karena itu dibutuhkan suatu tampilan citra yang dapat merepresentasikan suatu obyek. Namun batasan luas citra sering menjadi kendala dalam penerapan fungsi maupun manfaat citra itu sendiri. Untuk itu diperlukan aplikasi penggabungan citra atau mosaic panoramic yang dapat memperluas tampilan citra, sehingga dapat lebih bermanfaat untuk memberikan informasi suatu obyek tertentu. Pada penelitian ini menggunakan metode Scale Invariant Feature Transform (SIFT) untuk pendeteksian keypoint. Jumlah keypoint dapat berubah berdasarkan nilai threshold yang ditentukan. Dari 20 pasang citra yang diteliti, nilai threshold 0.1 pada 12 citra masukan jumlah keypoint yang berkesesuaian bernilai 0, sehingga tidak dapat dilakukan proses mosaic panoramic. Pada nilai threshold 0.6 jumlah keypoint yang berkesesuaian bernilai sedang dan dapat menghasilkan citra hasil mosaic panoramic. Sedangkan pada nilai threshold 0.9 jumlah keypoint yang berkesesuaian pada 14 pasang citra masukan atau 70% dari jumlah citra masukan semakin banyak ditemukan, sehingga  dapat dilakukan proses mosaic panoramic dan menghasilkan citra hasil mosaic panoramic yang lebih baik.\r\n\r\nKata Kunci:  Mosaic Panoramic, SIFT (Scale Invariant Feature Transform), Keypoint\r\n', 'Gendra Budiarti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100818'),
(39, '060411100824', 'APLIKASI CITRA MOSAIK PANORAMIK MENGGUNAKAN METODE WATERSHED', 'Eza Rahmanita, S.T.,M.T.', 'Meidya Koeshardianto, S.Si.,M.T.', 'Citra digital banyak dimanfaatkan dalam berbagai aspek kehidupan,oleh karena itu membutuhkan tampilan citra yang yang dapat merepresentasikan objek yang terdapat dalam citra tersebut. Salah satu permasalahan yang ada saat melakukan pengambilan gambar (citra) adalah kemampuan untuk mengambil gambar yang sangat luas sehingga gambar harus diambil beberapa kali yang menyebabkan gambar atau objeknya menjadi terpisah-pisah. Untuk mengatasi permasalahan ini diperlukan proses penggabungan citra. Dan dalam penelitian ini akan digunakan metode Watershed. Dalam metode ini terlebih dahulu ditentukan titik korespondensi pada masing-masing citra kandidat, kemudian daerah hasil korespondensi tersebut akan disegmen menggunkan metode Watershed dan hasil segmentasinya digunakan untuk mencari Region cut sebagai acuan penggabungan citra. Proses penggabungan citra ini dsebut dengan mosaic panoramik. Hasil dari penelitian ini menunjukkan citra panorama yang ideal dapat dperoleh dengan menggunakan citra masukan yang mempunyai kesamaan obyek dan titik korespondensi dipilih pada obyek yang sama diantara dua citra masukan tersebut.\r\n\r\nKata kunci :Citra Panorama, MosaikPanoramik, Metode watershed\r\n', 'Sri Rahma Puspa Sari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100824'),
(40, '060411100826', 'Pengenalan Komponen Motor Otomotif Berbasis Role Playing Game (RPG) Dengan Algoritma Simple Rules', 'Arik Kurniawati S.Kom., M.T', 'Ari Kusumaningsih, S.T., M.T', 'Dalam tugas akhir ini, penulis menerapkan konsep game edukasi berbasis RPG atau Role Playing Game dengan tema Pengenalan Komponen Motor Otomotif Berbasis RPG Dengan Algoritma Simple Rules. Game ini dirancang khusus dengan tujuan utama penyampaian materi edukasi yang disajikan dalam bentuk skenario game petualangan.\r\nGame ini ditujukan untuk siswa Sekolah Menengah Kejuruan Teknik Otomotif Kelas X, dengan harapan game ini bisa menjadi alternatif media pembelajaran bagi siswa sehingga siswa dapat tertarik dan lebih mudah untuk memahami. Penulis menggunakan software untuk mendesain game yang bernama Game Maker, dengan engine ini game dapat dimainkan pada perangkat Komputer.\r\nHasil kuesioner yang diambil dari persentase responden terbanyak, ternyata mendapat respon yang cukup baik, dengan persentase tingkat kesulitan bermain sebanyak 50% mengatakan mudah, tingkat keberhasilan menjadi media pembelajaran sebanyak 45% mengatakan berhasil, tingkat kesukaan bermain pada game sebanyak 45% mengatakan suka, keberhasilan penyampaian materi ajar pada game sebanyak 65% mengatakan berhasil, tingkat efektifitas fitur game dalam membantu memainkan game sebanyak 40% mengatakan membantu, pengaruh game dalam memotivasi belajar komponen motor otomotif sebanyak 40% mengatakan termotivasi, jadi dapat dikatakan game ini sudah berhasil.\r\n', 'Moch. Akhlul Ilmil Hoir', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100826'),
(41, '060411100830', 'Sistem Informasi Manajemen Beasiswa Fakultas Teknik Universitas Trunojoyo dengan menggunakan Metode F--AHP', 'Bain Khusnul Khotimah', 'Hermawan', 'Sesuai dengan peraturan yang telah ditentukan oleh pihak pemberi beasiswa terhadap penerima beasiswa, maka diperlukan kriteria-kriteria untuk menentukan siapa yang akan terpilih untuk menerima beasiswa. Pembagian beasiswa dilakukan oleh beberapa lembaga untuk membantu seseorang yang kurang mampu ataupun berprestasi selama menempuh studi. Untuk membantu penentuan dalam menetapkan seseorang yang layak menerima beasiswa maka dibutuhkan Multiple Criteria Decision Making (MCDM) untuk mempertimbangkan nilai terbesar dalam memperoleh factor kompleks yang berdasarkan pada asumsi sifat subyektifnya lebih banyak. \r\nFuzzy Analytic Hierarchy Process (FAHP) merupakan penggabungan metode Analitic Hierarchy Proses dengan pendekatan Fuzzy yang relatif terbaru yang cocok dengan permasalahan yang berhubungan dengan sistem saling ketergantungan, dan ini sangat efisien dan relevan jika sistem di gunakan serta di berlakukan di fakultas teknik universitas trunojoyo dengan beberapa faktor kriteria dan subkriteria serta skala perbandingan berpasangan yang di ajukan oleh stakeholder, untuk menganalisa validitas penerima beasiswa. \r\nBerdasarkan hasil uji coba sistem, terdapat perbedaan selisih hasil rekomendasi dari sistem, terhadap data aktual, dan dari beberapa beasiswa yang ada, beasiswa magang  yang dapat di analisa dengan perolehan 70,58 %.\r\n\r\nKata kunci : FAHP, Pengambilan keputusan multi kriteria, seleksi beasiswa.\r\n', 'Handika Akbar Rijal', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100830'),
(42, '060411100831', 'APLIKASI SISTEM PENDUKUNG KEPUTUSAN DALAM PENENTUAN BEASISWA BIDIK MISI DENGAN PERBANDINGAN METODE ANALITYCAL HIERARCY PROCESS (AHP) DAN ELIMINATION AND CHOICE TRANSLATION REALETY (ELECTRE)\r\n	(Studi K', 'RIZA ALFITA, S.T, M.T', 'YENI KUSTIYAHNINGSIH, S.Kom, M.Kom', 'Pemerataan dalam akses ke perguruan tinggi jenjang pendidikan menengah, sampai saat ini masih merupakan masalah di negara ini. Banyak lulusan jenjang pendidikan menengah yang berprestasi dan merupakan calon mahasiswa potensial tidak dapat melanjutkan ke jenjang pendidikan tinggi karena berasal dari kalangan keluarga yang kurang mampu secara ekonomi, menghadapi kendala seperti inilah program terbaru yang dikelola DIKTI adalah berupa solusi beasiswa bidik misi. Dengan perbandingan antara Metode Analitycal Hierarcy Process (AHP), untuk menyusun suatu struktur hierarchy, menentukan nilai prioritas kriteria dan Elimination and Choice Translation Realety (Electre) digunakan pada kondisi dimana alternatif yang kurang sesuai dengan kriteria dieleminasi, dan alternatif yang sesuai dapat dihasilkan. Berdasarkan uji coba dengan menggunakan data bidik misi tahun 2011, telah dapat dibuat suatu sistem pengambilan keputusan dalam prosentase ketepatan antara sistem dengan kondisi real, untuk metode  AHP 83.1 % dan metode Electre 49.01 %.\r\nKeyword : AHP, Electre, Bidik Misi, Consistency,  Kriteria dan Nilai Prioritas.\r\n', 'ARDIANSYAH ZULKARNAIN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100831'),
(43, '060411100850', 'PENGELOMPOKAN TINGKAT KESEHATAN MASYARAKAT KABUPATEN BANGKALAN MENGGUNAKAN METODE FUZZY C-MEANS BERBASIS SIG', 'Bain Khusnul Khotimah, ST.,M.Kom.', 'Andharini Dwi Cahyani, S.Kom.,M.Kom.', 'Sistem informasi kesehatan merupakan suatu pengelolaan informasi di seluruh tingkat pemerintah secara sistematis dalam rangka penyelengggaraan pelayanan kepada masyarakat. Penelitian ini dilakukan untuk mengembangkan model sistem informasi pengelompokan tingkat kesehatan masyarakat berdasarkan sistem informasi geografis (GIS) untuk mendukung rencana peningkatan kesehatan di Kabupaten Bangkalan. Dengan melakukan maping pengelompokan tingkat kesehatan masyarakat ke dalam beberapa cluster agar informasi yang disajikan lebih mudah dipahami dan lebih informatif.\r\nDalam penelitian ini, teknik clustering digunakan untuk mengelompokan data-data kecamatan dengan beberapa latar belakang. Kecamatan yang memiliki atribut-atribut di cluster menjadi 4 cluster menggunakan metode Fuzzy C-means (FCM).\r\nDalam mengelompokkan tingkat kesehatan masyarakat dengan menggunakan metode Fuzzy C-means (FCM), untuk mengkatagorikan tingkat kesehatan masyarakatnya, tentunya ada kriteria-kriteria kesehatan masyarakat yang memiliki nilai yang tidak pasti. Oleh karena itu, untuk mengelompokkan tingkat kesehatan masyarakat ke dalam beberapa cluster, perlu adanya analisa lebih lanjut pada cluster tersebut untuk mendapatkan hasil yang lebih sesuai. Data yang telah diolah tersebut disajikan dalam bentuk peta dengan daerah yang bergradasi warna sesuai wilayah.', 'Sandra Lisa Sasmita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100850'),
(44, '060411100862', 'IMPLEMENTASI ALGORITMA ENKRIPSI AES UNTUK APLIKASI SMS BERBASIS SISTEM OPERASI GOOGLE ANDROID', 'Cucun Very Angkoso, ST., M.T', 'Moch. Kautsar Sophan, S.Kom., M.MT', 'Pengiriman informasi Short Message Service (SMS) merupakan sesuatu hal yang di butuhkan pada masa modern, Layanan SMS memiliki kerentanan dalam keamanan data. Kelemahan layanan SMS salah satunya disebabkan pada pengguna standard pengkodingan yang universal, SMS dibangun dengan sistem bahasa program yang sejenis dengan bahasa program hardware seperti komputer dan ponsel dapat menerjemahkan semua data dalam frekuensi tertentu yang terbuka. Untuk menjamin keamanan dan kerahasiaan informasi saat pengiriman, dilakukan proses enkripsi dan dekripsi terhadap informasi yang akan dikirimkan. Enkripsi dilakukan pada saat pengiriman dengan cara mengkonversi informasi asli menjadi informasi sementara sedangkan dekripsi dilakukan pada saat penerimaan dengan cara mengkonversi informasi sementara menjadi informasi asli. Jadi informasi yang dikirimkan selama proses pengiriman adalah data informasi sementara, sehingga informasi asli tidak dapat diketahui oleh pihak yang tidak berkepentingan. Informasi asli hanya dapat diketahui oleh penerima dengan menggunakan kunci rahasia. Dari  50 sample hasil Pengujian sistem  di peroleh akurasi 40% menggunakan plaintext dan key valid 128bit menghasilkan 100% output chipertext dan plaintext yang sama, 60% menggunakan plaintext dan key tidak valid  menghasilkan 100% output chipertext dan plaintext yang berbeda dengan menggunakan metode Advanced Encryption Standard.', 'Awang Maristyono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100862'),
(45, '060411100870', 'SistemRekomendasi Kelayakan Kredit kepemilikan sepedaMotordenganMenggunakan MetodeFuzzy Analytical Hierarchy Process (FAHP) dan Multi-Attribute Utility Theory (MAUT)', 'Bain Khusnul Khotimah, ST., M.Kom', 'Yeni Kustiyahningsih, M.Kom', 'Banyaknya masyarakat yang ingin memiliki sepeda motor tetapi tidak memiliki dana yang cukup untuk membeli sepeda motor secara tunai tentunya akan sangat membutuhkan suatu cara untuk memiliki sepeda motor tetapi dengan sistem pembayaran secara kredit. Dealer Yamaha TRISAKTI MOTOR Bangkalan yang bukan hanya menjual produknya secara cas/kontan tetapi mereka juga bergerak dibidang asuransi yang bertujuan sebagai salah satu bagian fokus bisnis dibidang sektor otomotif berninat melakukan pemberian kredit sepeda motor kepada konsumen melalui pemanfaatan dana dari bagian laba perusahaan.\r\nPadapenelitian ini akan diangkat suatu kasus yaitu mencari alternative terbaik berdasarkan kriteria - kriteria yang telah ditentukan dengan pendekatan metode Fuzzy Analytic Hierarchy Process (FAHP). Metode ini dipilih karena pengambilan keputusan dengan mempertimbangkan beberapa alternative dan criteria pada situasi yang bersifat Fuzzy. Perangking hasil pembobotan dari metode FAHP menggunakan metode Multi-Attribute Utility Theory (MAUT). Perangkingan melalui perbandingan berpasangan antara alternative pada kriteria yang sesuai untuk Menentukan kelayakan kredit sepeda motor. Sistem ini menggunakan bahasa pemrograman PHP dan aplikasi basis data yang digunakan padasistem informasi ini adalah MySQL. Dengan adanya aplikasi ini diharapkan dapat mengatasi kekurangan yang ada pada aplikasi terdahulu khususnya di dalam kemudahan pengubahan isi halaman website secara dinamis.\r\n', 'Faisol Akbar Firdaus', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/060411100870'),
(46, '070411100007', 'Gerak Pekerja Pada Game Real Time Strategy Menggunakan Finite State Machine', 'Kurniawan Eka P, S.Kom., Msc', 'Arik Kurniawati, S.Kom., M.T.', 'Gerak pekerja ada pada game yang memiliki genre RTS (Real-Time Strategy). Gerak pekerja memiliki berbagai macam gerak. Oleh sebab itu dibutuhkan sebuah pendekatan konsep AI  untuk mendesain perilaku pekerja tersebut. Perilaku karakter tersebut harus ditambahi dengan AI (Artifical intelegent) agar perilakunya menjadi lebih hidup dan realistis.\r\nDalam penelitian ini AI yang digunakan adalah Finite State Machine. Finite State Machine digunakan untuk menentukan gerak pekerja terhadap parameter-parameter yang digunakan sebagai dasar gerak yang akan dilakukan . Selanjutnya akan disimulasikan pada game RTS dengan menggunakan game engine.\r\nHasil yang di peroleh dalam penelitian ini adalah penerapan metode Finite State machine untuk menentukan gerak pekerja berdasarkan parameter jumlah harta, prajurit, kondisi bangunan, dan stockpile (jumlah resources yang di bawa). \r\n\r\nKata kunci : Game, Real-Time Strategy, Gerak Pekerja, Finite State Machine.\r\n', 'Adi Chandra Laksono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100007'),
(47, '070411100009', 'PERBANDINGAN PENGGUNAAN GRAY LEVEL CO-OCURRENCE MATRIX  DAN GRAY LEVEL RUN LENGHT MATRIX  UNTUK PENGENALAN SENYUM', 'Cucun Very Angkoso S.T., M.T.', 'Rima Tri Wahyuningrum S.T., M.T.', 'Senyum merupakan salah satu fitur biometrik yang dapat dijadikan sebagai bukti autentik dari seseorang. Salah satu bentuk penerapan pengenalan pola ini adalah mengetahui senyum seseorang sehingga nantinya senyum tersebut dapat dikenali oleh komputer dan disimpan dalam database. Penelitian ini bertujuan mengembangkan penelitian yang sebelumnya yaitu pengenalan pola wajah. Sistem pengenalan ini ada dua tahapan, tahap pertama menghitung ekstraksi fitur pada gambar wajah menggunakan Gray level Co-Occurrence Matrix dan Gray Level Run Lenght Matrix untuk menghasilkan pola senyum, tahap kedua menghitung jarak kemiripan menggunakan Manhattan Distance yaitu semakin rendah nilai jarak suatu citra maka semakin tinggi tingkat kemiripannya. Tugas Akhir ini melakukan uji coba pada 201 gambar foto wajah dalam basis data yang dibagi menjadi tiga kelas yaitu diam, senyum, dan tawa untuk dilakukan ekstraksi fitur menggunakan Gray Level Run leght Matrix dan Gray level Co-Occurrence Matrix, serta menghitung  jarak kemiripan menggunakan Manhattan Distance. Setelah didapat nilai hasil pengukuran jarak kemiripan terhadap ketiga kelas, nilai tersebut dirata – rata untuk mendapatkan hasil yang diinginkan. Hasil yang diperoleh memiliki kemiripan  yang cukup tinggi dengan akurasi terbaik mencapai 100% pada GLCM dan 71% pada GLRM', 'ADIK PRAS', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100009'),
(48, '070411100017', 'SEGMENTASI PEMBULUH DARAH RETINA PADA CITRA FUNDUS MENGGUNAKAN OPERASI MORFOLOGI', 'Dr. Arif Muntasa S.Si., M.T.', 'Dr. Indah Agustien S.Kom., M.Kom.', 'Segmentasi adalah suatu proses untuk mengekstraksi atau menampilkan objek tertentu pada citra sehingga obyek tersebut terlihat lebih dominan. Pada penelitian Tugas Akhir ini  proses segmentasi menggunakan Operasi Morfologi yang diantaranya adalah Morfologi Bottom-Hat, Morfologi Dilasi, dan Morfologi Opening. Dalam penelitian ini ada dua tahapan proses segmentasi pembuluh darah retina pada citra fundus ini, yakni : tahapan Preprocessing dan tahapan Segmentasi. Untuk tahapan Preprocessing sendiri terdapat beberapa proses diantaranya : konversi citra RGB ke Green Channel agar mendapatkan komposisi saturasi yang tepat, perbaikan citra menggunakan Contrast Limited Adaptive Histogram Equalization (CLAHE) yaitu dengan meningkatkan nilai kontras pada citra Green Channel, kemudian ada proses filtering citra menggunakan 2D-Gaussian Filter yang berfungsi untuk memperjelas obyek pada citra. Untuk tahap kedua yaitu segmentasi citra yang terdiri dari beberapa proses diantaranya : Morfologi Bottom-Hat, Thresholding, Binerisasi, Adaptive Median Filter, Dilasi, Opening, dan perhitungan akurasi menggunakan Balanced Accuracy. Dari hasil uji coba yang dilakukan pada 20 citra Digital Retinal Image for Vessel Extraction (DRIVE) diperoleh hasil akhir segmentasi pembuluh darah pada retina dengan akurasi sebesar 85,97%. Operasi Morfologi terbukti dapat menghasilkan citra hasil segmentasi  yang cukup baik dengan akurasi yang tinggi.', 'AKHMAD NUVAIL', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100017'),
(49, '070411100019', 'SISTEM PERAMALAN TINGKAT PENGANGGURAN WILAYAH BANGKALAN MENGGUNAKAN ALGORITMA BACKPROPAGATION', 'Ba\'in Khusnul Khotimah, S.T., M.Kom.', 'Firli Irhamni, S.T., M.Kom.', 'Kabupaten Bangkalan Mempunyai jumlah penduduk tahun 2010 sebanyak 906.761 yang diikuti dengan jumlah pengangguran yang cukup tinggi, tentunya pengangguran menjadi masalah sosial yang harus diperhatikan.  Berdasarkan permasalahan tersebut maka perlu adanya sistem peramalan sehingga bisa menekan angka pengangguran di Kabupaten Bangkalan. Sistem ini dibuat menggunakan Algoritma Backpropagation yang mampu melakukan penyesuaian bobot penghubung sehingga dapat dijadikan solusi untuk menentukan jumlah pengangguran. Jaringan-jaringan dilatih dengan menggunakan beberapa variabel masukan yaitu : data tahun 2006-2010. Setelah Sistem peramalan dengan menggunakan Algoritma Backpropagation ini melalui proses uji coba didapatkan nilai konfigurasi parameter terbaik ialah konfigurasi lerning rate sebesar 0.7 toleransi error 0.1, maksimal epoch 50 dan hidden layer 14.  Parameter tersebut dipilih menjadi parameter terbaik karena menghasilkan jumlah iterasi yang memiliki nilai akurasi error terbaik saat sistem melakukan pengujian yaitu didapatkan MSE sebesar 37206,6 dan MAPE sebesar 1,34% yang mana diperoleh jumlah pengangguran di Kabupaten Bangkalan pada tahun 2010 adalah 24.637 jiwa. Sedangkan pendataan jumlah pengangguan tahun 2010 yang dilakukan oleh BPS Kabupaten Bangakalan adalah 25008 jiwa.\r\n	\r\nKata Kunci: Peramalan, Algoritma Backpropagation, Pengangguran.\r\n', 'ALI IMRON ZAMZAMI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100019'),
(50, '070411100023', 'Visualisasi Proses Terjadinya Hujan Berbasis Second Life', 'Arik Kurniawati,S.Kom, M.Kom.', 'Dr.Indah Agustien Siradjuddin, S.Kom, M.Kom.      ', 'ABSTRAK\r\nPerkembangan teknologi masa kini telah memungkinkan manusia untuk merasakan suatu pengalaman yang nyata tanpa perlu adanya dunia luar atau materi. Teknologi ini sering disebut teknologi virtual reality. Teknologi virtual reality dapat diterapkan di berbagai bidang salah satunya adalah didalam dunia pembelajaran. Didalam penelitian ini akan membuat suatu pembelajaran mengenai proses terjadinya hujan yang dikemas didalam simulasi virtual reality. Tujuan utama dari pengembangan virtual reality adalah untuk menirukan alam nyata ke dalam dunia maya semakin membuat kedekatan imitasi animasi realitas ke dalam dunia maya. Kehadiran teknologi virtual reality ini dimanfaatkan semaksimal mungkin dalam kehidupan sehari-hari. Didalam Penelitian ini ditetapkan perilaku yang menjadi objek adalah kegiatan proses terjadinya hujan. Kegunaan Second Life sebagai platform untuk menghidupkan konsep dalam pembelajaran proses terjadinya hujan menjadi 3 dimensi karena Second Life sangat memadai untuk memvisualisasikan sebuah bentuk 3D dan Second Life merupakan Platform yang sangat mendukung untuk membuat suatu pembelajaran. Hasil uji coba visualisasi terhadap responden mendapatkan suatu pembelajaran visualisasi proses hujan dengan cara yang berbeda dan menarik dan mudah dimengerti. \r\n\r\nKata kunci: Virtual Reality (VR), Multimedia Proses Hujan, Second Life \r\n', 'Anggit Pratama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100023'),
(51, '070411100024', 'RANCANGBANGUNSISTEMINFORMASI\r\nAKADEMIKSEKOLAHBERBASIS WEB\r\n (STUDIKASUS: SMK NEGERI 6 SURABAYA)', 'Dr. Arif Muntasa, M.T', 'Moch. Kautsar Sophan. S.Kom., M.MT.', 'Pelayanan guru terhadap siswa dan kepada pihak pihak terkait (walikelas dan bidang Kurikulum) dalam pengumpulan penilaian semester dan tahunan masih bersifat manual dan lambat. Sebagai solusi yang tepat maka aplikasi web sistem akademik sekolah dibangun untuk mengatasi permasalahan yang dihadapi oleh segenap stakeholder sekolah.. Dengan adanya aplikasi website ini, pihak kurikulum,wali kelas serta guru dapat menyelesaikan waktu dalam penyerahan nilai raport kepada siswa. Dan juga tidak membatasi aktivitas guru dalam melakukan tugasnya terlebih pada saat pengumpulan nilai siswa-siswi.\r\nKata kunci : website, stakeholder, sistem akademik sekolah, kurikulum ', 'Anton Leonard Sihombing', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100024'),
(52, '070411100027', 'Sistem Pendukung Keputusan Pariwisata Unggulan di Jawa Timur Dengan Visualisasi Geografi Menggunakan Metode FAHP dan MAUT', 'Bain Khusnul Khitimah', 'Rima Tri Wahyuningrum', 'Dinas Kebudayaan dan Pariwisata Provinsi Jawa Timur memiliki tujuan yang harus dicapai yang erat kaitannya dengan pemerataan pengetahuan masyarakat mengenai obyek-obyek wisata di seluruh Jawa Timur. Pencapaian tujuan tersebut dapat dilakukan dengan pemanfaatan sumber daya yang dimiliki secara optimal. Prosedur yang ada selama ini belum ada software penetapan obyek wisata unggulan  secara khusus. Untuk itu, perlu dibuat sebuah sistem pendukung keputusan. Salah satu metode yang cocok dalam penelitian ini adalah metode Fuzzy Anayitical Hierarchy Process (FAHP) dan Multi Attribute Utility Theory (MAUT). Metode ini mampu menyeleksi dan mencari alternatif terbaik dari sejumlah pilihan berdasarkan kriteria yang telah ditetapkan dengan mencari nilai pembobotan untuk setiap kriteria beserta perangkingannya. Selain membantu kinerja admin, juga berpengaruh terhadap masyarakat sebagai user yang bisa menggunakan sistem mengingat berwisata merupakan kebutuhan jasmani yang penting tanpa kita sadari karena dapat menghilangkan penat akibat beraktivitas seharian. Hasil penelitian ini mampu menyeleksi pariwisata unggulan dengan perangkingan obyek wisata terbaik sesuai penilaian sistem berdasarkan prioritas kriteria yang telah ditetapkan. Dari hasil uji coba sistem menunjukkan nilai akurasi dalam sistem pendukung keputusan pariwisata unggulan sebesar 80%.\r\n\r\n\r\nKata Kunci: Sistem Pendukung Keputusan, Fuzzy Analitical Hirarcy Process, Multi Attribute  Utility Theory, Pariwisata Unggulan\r\n', 'Ayu Imawati Yahya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100027'),
(53, '070411100028', 'Pengenalan Pola Mata dan Hidung untuk Penentuan Jender Menggunakan Gray Level Run Lenght Matrix', 'Cucun Very Angkoso, S.T., M.T', 'Rima Tri Wahyuningrum, S.T., M.T', 'Pengertian jenis kelamin adalah merupakan suatu akibat dari dimorfisme seksual. Telah dilakukan penelitian di Jepang bahwa burung gagak dapat membedakan jenis kelamin sebuah individu. Salah satu bentuk penerapan penentuan jenis kelamin (Jender) ini adalah mengetahui bentuk mata dan hidung seseorang sehingga bentuk mata dan hidung tersebut dapat dikenali oleh komputer dan disimpan dalam database. Pada penelitian Tugas Akhir terdapat dua tahapan, yaitu tahapan pertama menghitung ekstraksi fitur mata dan hidung menggunakan Gray Level Run Length Matrix untuk menghasilkan pola mata dan hidung. Tahap kedua menghitung jarak kemiripan menggunakan Euclidean Distance, yaitu semakin rendah nilai jarak suatu citra maka akan semakin tinggi tingkat kemiripannya. Penelitian Tugas Akhir ini dilakukan uji coba pada 200 gambar mata dan hidung didalam database yang akan dibagi menjadi dua kelas yaitu laki - laki dan perempuan untuk dilakukan ekstraksi fitur menggunakan Gray Level Run Length Matrix dan hasil ekstraksi fitur akan dilakukan pengukuran jarak kemiripan menggunakan metode Euclidean Distance. Setelah didapat nilai hasil pengukuran jarak kemiripan terhadap kedua kelas, nilai tersebut akan dirata – rata untuk mendapatkan hasil yang diinginkan. Dari hasil uji coba perbandingan rata – rata nilai hasil pengukuran Euclidean Distance diperoleh akurasi sebesar 75% pada 20 data uji coba dan 180 dengan jumlah citra yang ditampilkan adalah 5.', 'Bagus Imansyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100028'),
(54, '070411100029', 'RANCANG BANGUN APLIKASI INTRUSION PREVENTION SYSTEM PADA JARINGAN BERBASIS PROTOKOL TCP/IP MENGGUNAKAN SNORT DAN IPTABLES', 'Meidya Koeshardianto, S.Si., M.T', 'Eza Rahmanita, S.T., M.T', 'Dalam setiap perusahaan tentunya memiliki data penting berkaitan dengan kegiatan bisnis mereka yang perlu dijaga dan diamankan dari orang yang tidak berhak mengaksesnya. Seringkali  muncul aksi ilegal yang mencoba merusak server bahkan sampai mencuri data perusahaan bisa mengakibatkan kesalahan fatal terhadap kelancaran kegiatan bisnis perusahaan disebabkan data yang tidak valid lagi. Menyikapi masalah tersebut, maka diperlukannya sistem monitoring keamanan yang mampu mengamankan server dari tindakan penyusupan. Intrusion Prevention System (IPS) merupakan solusi yang mampu memberikan keamanan pada jaringan server dari tindakan penyusupan. IPS ini mengembangkan Snort sebagai fungsi pendeteksi yang dikombinasikan dengan IPTables Firewall sebagai pencegah adanya penyusupan. IPS ini juga dilengkapi dengan user interface BASE (Basic Analysis and Security Engine)  dan manajemen rule sehingga memudahkan admin untuk memonitor sistem keamanan dari tindakan penyusupan ke jaringan server. Snort akan membuat alert ketika terdeteksi adanya serangan yang disimpan dalam log Snort dan memerintahkan IPTables untuk melakukan drop terhadap alamat penyerang. Kemudian detail serangan bisa dilihat pada tampilan user interface BASE. Dari hasil pengujian, didapatkan bahwa Snort dan IPTables telah bekerja dengan baik menjadi IPS yang mampu memberikan respon secara cepat ketika terdeteksi adanya serangan. Waktu tanggap rata-rata kurang dari 5 detik, dari awal serangan sampai terdeteksinya alert.', 'BAHRUL ULUM', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100029'),
(55, '070411100031', 'SISTEM PEROLEHAN CITRA BERBASIS ISI BERDASARKAN TEKSTUR MENGGUNAKAN METODE GABOR FILTER DAN EUCLIDEAN DISTANCE', 'Dr. ARIF MUNTASA, S.Si., MT', 'FITRI DAMAYANTI, S.Kom., M.kom.', 'Saat ini pencarian citra berbasis teks sudah tidak efektif lagi karena adanya penilaian subjektif dari pengguna dalam merepresentasikan suatu citra. Karena itu diperlukan suatu sistem yang dapat menangani pencarian citra menggunakan query berupa citra atau disebut Sistem Perolehan Citra berbasis Isi (SPCI) atau Content Based Image Retrieval (CBIR). Dengan hal yang seperti ini pada CBIR meskipun ada yang memodifikasi atau merubah nama filenya, tidaklah membuat image searching menjadi rancu karena hal ini tidak didasarkan atas teks atau nama dari sebuah file melainkan berdasarkan ciri baik warna, bentuk maupun tekstur. \r\n Dalam  penelitian  Tugas Akhir ini menggunakan ciri tekstur sebagai proses pencarian kemiripan dari delapan kelas citra yang  berbeda yaitu: bangunan, bus, dinosaurus, gajah, gunung, kuda, mawar, dan pantai sebagai objek perolehan citra berbasis isi. Sistem dibangun dengan proses utamanya yaitu ekstraksi fitur tekstur dengan menggunakan metode Gabor Filter. Sehingga dari hasil ekstraksi fitur dilakukan pengukuran kemiripan dengan feature vector citra yang sudah diekstraksi terlebih dahulu yang tersimpan dalam database dengan menggunakan metode Euclidean Distance. Citra query dan citra database yang dipergunakan sebanyak 200 citra dengan delapan kelas citra didalamnya. \r\nDari uji coba aplikasi menggunakan pengukuran kemiripan Euclidean Distance dengan nilai threshold=0,02 diperoleh akurasi rata-rata presisi sebesar 0.46 pada data pelatihan 190 dan data uji coba 10 dengan ukuran kernel 3x3 dan jumlah citra yang ditampilkan sebanyak 15 citra termirip dengan citra query dan pengenalan terbaik pada kelas bangunan yaitu dengan akurasi presisi 60% .\r\n\r\nKata Kunci: Tekstur, Sistem Perolehan Citra Berbasis Isi, Gabor Filter, Euclidean Distance.\r\n', 'BASIR QIYAM JULIANDI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100031'),
(56, '070411100034', 'GAME EDUKASI MATEMATIKA SEKOLAH DASAR KELAS 3 DENGAN MENGGUNAKAN METODE ADAPTIVE LEARNING', 'ARIK KURNIAWATI,ST.,MT.', 'ANDHARINI DWI CAHYANI,S.Kom.,M.Kom.', 'Pengembangan  media pembelajaran interaktif dengan pola pendidikan game dapat meningkatkan motivasi belajar siswa. Game berbasis flash \"Game Edukasi Matematika Sekolah Dasar Kelas 3 Dengan Menggunakan Metode Adaptive Learning\" menjadi salah satu media dalam pendidikan. Dengan sistem komputerisasi, membuat belajar lebih interaktif dalam memberikan dasar matematika untuk siswa muda terutama sekolah dasar. Pada game multitasking ini pengguna dapat bermain dan belajar. Pada game ini juga bersifat adaptif yaitu dapat menyesuaikan level sesuai dengan kemampuan pengguna. Dari seluruh implementasi yang dilakukan didapatkan bahwa metode adaptive learning untuk game edukasi matematika ini berjalan dengan baik. Multitasking pada game edukasi ini membuat siswa kurang konsentrasi pada soal-soal yang ditampilkan. Siswa cenderung pada permainannya. Berdasarkan hasil uji coba yang dilakukan didapat 90,4% responden menyatakan tertarik pada game ini karena skenario game yang dibuat menarik dengan animasi dan gambar latar yang disukai anak-anak.', 'CIRA MULDAYAZIS', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100034'),
(57, '070411100036', 'ONTOLOGY SEMANTIC WEB UNTUK PENCARIAN TUGAS AKHIR PADA SISTEM INFORMASI TUGAS AKHIR(SIMTAK)', 'Firdaus Solihin S.kom,.M.kom', 'Kurniawan Eka P. S.kom,.M.sc', 'Kebutuhan pencarian data pada internet yang cepat dan tepat saat ini menjadi faktor penting para pengguna layanan internet. Sistem Informasi Tugas Akhir (SIMTAK) yang digunakan di Fakultas Teknik Universitas Trunojoyo Madura juga membutuhkan pencarian data yang tepat dan cepat berdasarkan konteks. Sistem pencarian yang dipakai saat ini adalah pencarian database dimana masih belum mampu memberikan hasil pencarian yang sesuai dengan konteks atau keywords yang diinputkan. Untuk memiliki kebenaran dalam sistem kecerdasan, pengetahuan perlu ditangkap, diproses, digunakan kembali, dan disampaikan. Ontologi mendukung semua tugas ini. Ontologi adalah spesifikasi dari konseptualisasi. Semantik web adalah sebuah abstrak representasi pada World Wide Web (WWW) yang berbasiskan pada sebuah standar yang didefinisikan menggunakan Resource Description Framework (RDF) dan Ontology Web Language (OWL) ide dasarnya adalah untuk membawa web memiliki definisi dan link data sehingga dapat digunakan lebih efektif untuk mencari, otomasi, integrasi dan reuse informasi pada berbagai aplikasi. Semantik web didefinisikan sebagai sekumpulan teknologi, dimana memungkinkan komputer memahami arti dari sebuah informasi berdasarkan metadata, yaitu informasi mengenai isi informasi seperti judul, pengarang, modifikasi tanggal pada halaman web, dan hak cipta pada halaman web. Dengan menggunakan semantik web, pencarian tugas akhir ini mampu memberikan hasil berdasarkan persamaan makna kata pada keyword yang diinputkan oleh user.\r\nKata Kunci : Mesin pencari, Semantic web, Tugas akhir.\r\nABSTRACT', 'Daniyar Bagus Prasetya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100036'),
(58, '070411100037', 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI MENU DIET BAGI PASIEN RAWAT INAP MENGGUNAKAN METODE HARRIS BENEDICT DAN EUCLIDEAN (Studi Kasus : RSUD Dr. H. Moh. Anwar Sumenep)\r\n', 'Haryanto ST, MT', 'Firli Irhamni ST, M. Kom', 'Pelayanan makanan bagi pasien rawat inap di Rumah Sakit mempunyai tujuan untuk memberikan menu diet yang sesuai dengan syarat gizi minimal dan sesuai dengan penyakit yang diderita pasien. \r\nSampai saat ini menu yang disediakan pihak rumah sakit kurang memperhatikan kebutuhan kalori pasiennya per individu. Sehingga mengakibatkan penyediaan makanan kepada pasien tidak sesuai dengan kebutuhan kalori perhari dari pasien. Oleh karena itu dibuatlah sistem pendukung keputusan untuk rekomendasi menu diet pasien sebagai alat bantu dalam penyediaan menu makanan bagi pasien\r\nMetode yang digunakan yaitu metode Harris Benedict untuk perhitungan total kalori pasien dan metode Euclidean untuk perankingannya, maka diharapkan aplikasi sistem pendukung keputusan yang dibuat ini mampu untuk merekomendasikan menu diet kepada pasien beserta penjelasan mengenai kebutuhan kalori perhari untuk asupan makanan perhari dan makanan yang harus dibatasi.\r\n\r\nKata kunci :  Sistem Pendukung Keputusan, Harris Benedict dan Euclidean\r\n', 'Desy Mariana S. Kom', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100037'),
(59, '070411100041', 'Sistem Peramalan Penjualan Menggunakan Metode Jaringan Syaraf Tiruan Dengan Algoritma Backpropagation', 'Fika Hastarita', 'Bain Khusnul Khotimah', 'Produk Olahraga merupakan salah satu bagian penting dalam organ-organ seorang atlit. Peningkatan jumlah penjualan produk yang tidak terduga menyebabkan kesulitan dalam pelayanan yang terbaik kepada konsumen. Demikian juga sebaliknya, apabila terjadi penurunan jumlah penjualan produk,maka akan menyebabkan inventorydi gudang. Oleh karena itu diperlukan sistem peramalan yang mampu meramalkan penjualan produk pada periode berikutnya. Sistem peramalan ini menggunakan metode Jaringan Syaraf Tiruan dengan algoritma Backpropagation dengan momentum untuk meramalkan jumlah penjualan produk pada bulan berikutnya. Data yang telah tersimpan dihitung menggunakan epoh dan learning rate yang berbeda. Dari hasil uji coba system, maka dapat disimpulkan bahwa  dengan menggunakan semua data sebagai data training dan menggunakan learning rate 0.8 dan dengan epoh 18 akan menghasilkan tingkat kesalahan 56827.343. hasil ini menunjukkan hasil terbaik dari beberapa skenario ujicoba sistem, namum belum menunjukkan hasil terbaik dari skenario yang lain dengan meningkatkan epoch supaya mendapatkan hasil yang lebih baik.\r\n\r\nKata kunci : Peramalan, Jaringan Syaraf Tiruan, Backpropagation, Momentum, Penjualan Produk Olahraga.\r\n', 'Dimas Taufany Putra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100041'),
(60, '070411100042', 'PENGEMBANGAN VIRTUAL CLASS UNTUK PEMBELAJARAN INTERAKTIF MATA PELAJARAN MATEMATIKA SISWA SMP BERBASIS SECOND LIFE', 'Arik Kurniawati,S.Kom, M.Kom', 'Dr. Indah Aguestien S', 'Internet berkembang dengan cepat beberapa tahun belakangan ini. Banyak hal yang dapat dilakukan dengan internet dari bergabung dengan situs jejaring sosial, bermain games online, belanja melalui shop online, download dan browsing info-info yang dibutuhkan. Bukan hanya itu dunia pendidikan juga ikut meramaikan dunia internet, seperti pembelajaran jarak jauh, virtual class, games pendidikan dan lain-lain. Dalam tugas akhir ini membangun aplikasi virtual class matematika untuk siswa SMP berbasis second life. Tujuan utama dari tugas akhir ini adalah untuk membuat suatu media pembelajaran dengan menerapkan teknologi yang ada yaitu, mata pelajaran yang virtual class matematika berbasis second life. Virtual Class ini dibuat secara online dengan menggunakan Second Life. Aplikasi virtual class ini terbagi dari 6 bab materi mata pelajaran matematika, khususnya untuk siswa SMP kelas VII. Didalam virtual class ini terdapat soal evaluasi untuk setiap babnya.Jika nilai evaluasi kurang dari KKM (Kriteria Kelulusan Minimal) maka siswa wajib melakukan pendalaman materi dan evaluasi ulang. Disini KKM nya menggunakan KKM mata pelajaran matematika untuk siswa VII SMP Negeri 1 Tulangan, yaitu dengan Nilai 75. Kendala dari uji coba aplikasi ini adalah kurangnya koneksi internet yang kuat, karena Aplikasi bersifat online dan memperlukan konekasi internet yang lumayan tinggi\r\n\r\nKata Kunci :  Internet, Virtual Class, Second Life, matematika\r\n\r\n', 'Dwi Adi Permana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100042'),
(61, '070411100049', 'PENJADWALAN PRODUKSI ROKOK MENGGUNAKAN METODE SHORTEST PROCESSING TIME UNTUK MENDUKUNG PENERAPAN SUPPLY CHAIN MANAGEMENT', 'Ba’in Khusnul Khotimah, ST., M.Kom.', 'Yeni Kustiyahningsih, S.kom., M.kom.', 'Dalam pola supply chain management terdapat aktivitas penjadwalan produksi. Perubahan penjadwalan pada produksi merupakan hal yang sering terjadi untuk memenuhi permintaan konsumen, Penjadwalan produksi merupakan salah satu fungsi dari pengawasan produksi yang mempunyai peranan yang cukup penting dalam  memaksimalkan pendapatan penjualan, dan meminimalkan biaya produksi, dan proses produksi akan berjalan dengan efisien. Sedangkan proses produksi berjalan dengan efisien, maka proses supply chain management mengalir dengan lancar. Permasalahan yang ada di perusahaan rokok gudang alam, tidak adanya penjadwalan produksi pada perusahaan tersebut, dan pihak sales tidak tahu kapan barang akan dikirim. Dan pihak pemesan atau agen tidak mengetahui kapan barangnya bisa diterima, sehingga proses supply chain management tidak berjalan dengan baik. Dalam penelitian ini, diadakan   pengalokasian bahan-bahan baku dan bahan-bahan pembantu, serta kelengkapan pengolahan  di setiap instalasi atau fasilitas yang telah ditentukan untuk menunjang proses supply chain berjalan dengan baik. Hasil dari penjadwalan meliputi jumlah produk yang dihasilkan dan pengolahan pada produk tersebut, terutama pada bagian yang didahulukan dalam proses produksi untuk melakukan penjadwalan produksi rokok. Yang pada pengurutannya menggunakan metode shortest processing time, menghasilkan penjadwalan produksi rokok yang meminimalisir keterlambatan sesuai dengan permintaan konsumen.\r\n\r\nKata Kunci: Penjadwaln produksi, Shortest Processing Time, supply chain management\r\n', 'Erwin Andriyansyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100049');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(62, '070411100050', 'DETEKSI COREPOINT SIDIK JARI MENGGUNAKAN METODE GEOMETRY OF REGION TECHNIQUE (GR)', 'Dr. Indah Agustien, S.Kom., M.Kom', 'Fitri Damayanti, S.Kom., M.Kom', 'Sidik jari adalah salah satu karakteristik fisik manusia yang saat ini banyak digunakan untuk identifikasi manusia, karena sidik jari mempunyai karakteristik yang tidak dapat berubah kecuali jika luka atau rusak akibat kecelakaan. Sidik jari sangat diperlukan untuk berbagai kasus tindak kriminal, seperti pencurian, kecurangan administrasi. Sehingga adanya proses pendeteksian sidik jari dapat memudahkan pihak-pihak yang berwajib untuk menangani beberapa kasus tersebut. Proses pendeteksian ini di lakukan dalam program komputer dengan melakukan beberapa tahap perhitungan. Penentuan titik tengah atau yang biasa di kenal dengan Corepoint adalah sebuah proses awal yang sangat berperan penting dalam proses identifikasi manusia. Terdapat dua cara untuk menentukan Corepoint atau titik tengah sidik jari yaitu secara manual dan otomatis. Secara manual dapat di lakukan dengan kasat mata. sedangkan secara otomatis dapat di tentukan dengan menggunakan suatu sistem. Pada Tugas Akhir ini untuk menentukan Corepoint sidik jari secara otomatis digunakan metode Geometry Of Region Technique (GR).Citra yang digunakan pada Tugas Akhir diperoleh dari “database FVC-2002 fingerprint-bitmaps”. Hasil uji coba sistem yang terbaik untuk deteksi Corepoint sidik jari menggunakan metode Geometry Of Region Technique (GR) dengan M0=50 dan V0=50 pada proses normalisasi dan menggunakan ukuran blok 3 x 3 pixel. Hasil akurasi sistem yang didapatkan sebesar 70%.\r\nKata Kunci : Sidik jari, Corepoint, Geometry Of Region Technique (GR), Normalisasi', 'Erwina Safitri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100050'),
(63, '070411100064', 'IMPLEMENTASI PENJADWALAN MATA PELAJARAN (Studi Kasus: SMPN 1 Konang)', 'SIGIT SUSANTO PUTRO,S.Kom.,M.Kom.', 'BAIN KHUSNUL KHOTIMAH,S.T.,M.Kom.', 'Penjadwalan mata pelajaran di sekolah merupakan masalah yang kompleks. Dalam permasalahan tersebut terdapat beberapa variabel yang harus dipertimbangkan supaya mendapatkan jadwal yang baik. Di dalam penyusunan jadwal mata pelajaran ini terdapat sangat banyak hal yang perlu diperhatikan, serta banyak kemungkinan-kemungkinan yang selayaknya dicoba untuk menemukan penjadwalan yang terbaik. Implementasi Penjadwalan Mata Pelajaran Studi Kasus SMPN 1 Konang dibuat untuk membantu pihak sekolah dalam membuat jadwal mata pelajaran. Dalam membuat jadwal pelajaran banyak hal yang menjadi pertimbangan, misalnya mata pelajaran, hari, guru, serta waktu. Pembuatan jadwal mata pelajaran di SMPN 1 Konang masih dilakukan secara manual. Tugas Akhir ini bertujuan untuk mempermudah dan mempercepat proses membuat jadwal mata pelajaran. Untuk mencapai tujuan tersebut maka digunakan aplikasi FET time tables. Aplikasi FET time tables mempermudah dalam memasukkan data mata pelajaran, guru, ruang kelas, waktu belajar serta batasan-batasan. Dari hasil penelitian yang dilakukan menggunakan aplikasi FET Time Tables mampu membuat jadwal dengan cepat serta mampu membuat beberapa jadwal sekaligus . Semoga adanya aplikasi FET Time Tables ini diharapkan bisa mempermudah dan mempercepat dalam pembuatan penjadwalan mata pelajaran di sekolah.', 'FIRMAN HIDAYAT', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100064'),
(64, '070411100066', 'IMPLEMENTASI PENJADWALAN MATA PELAJARAN SMPN 1 AMBUNTEN', 'Sigit Susanto Putro,S.Kom.,M.Kom.', 'Bain Khusnul Khotimah,S.T.,M.Kom.', 'Implementasi Penjadwalan Mata Pelajaran SMPN 1 Ambunten dibuat untuk membantu pihak sekolah bersangkutan yaitu asisten kurikulum. Asisten kurikulum dapat mengubah data dari penjadwalan mata pelajaran per-tahun, serta membuat jadwal ulangan maupun jadwal yang lain.Karena di dalam sekolah SMPN 1 Ambunten ini memungkinkan Asisten Kurikulum untuk mengubah data dari  penjadwalan, tapi masih menggunakan tabel di word ataupun excel. Sedangkan tujuan dari  Penelitian ini adalah untuk membantu mempercepat Asisten Kurikulum dalam melakukan penjadwalan. \r\nPenelitian ini bertujuan untuk membantu memperlancar tugas dari asisten kurikulum SMPN 1 Ambunten untuk menggerjakan penjadwalan. Dalam menyusun penjadwalan asisten kurikulum menggunakan aplikasi aSc TimeTables, karena sebelumnya masih manual menggunakan Microsoft word dan microsoft excel. Dan dalam penelitian ini menggunakan data penerapan kurikulum yang dipakai pada tahun 2013 - 2014.\r\nAgar tujuan ini berhasil sesuai yang diinginkan maka digunakan aplikasi aSc TimeTables. Aplikasi aSc TimeTables memiliki kelebihan mudah dan cepat dalam memasukkan data semua mata pelajaran, kelas, ruang kelas, guru dan kontrak guru. aSc TimeTables memperhatikan beban kerja pengajar, serta memudahkan verifikasi jadwal. Dalam penerapan aplikasi banyak sekali keuntungan, seperti gampang menggenerate tinggal menunggu proses loading dari generate.\r\n\r\nKata Kunci : Implementasi, Penjadwalan, Asc Time Table\r\n', 'Fravasta F. Pratama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100066'),
(65, '070411100067', 'DISASTER MANAGEMENT SYSTEM MENGGUNAKAN ALGORITMA GENETIKA BERBASIS ANDROID', 'M. Kautsar Sophan,S.Kom,M.MT', 'Riza Alfita, S.T, M.T', 'Penyusunan dan pembuatan aplikasi Disaster Management untuk Tsunami khususnya di kabupaten Lumajang dibuat untuk membantu tim penyelamat dalam proses evakuasi bencana tsunami. Dalam aplikasi yang telah dirancang tersebut, pengguna (SAR) dapat mengetahui informasi-informasi penting tentang kota Lumajang, khususnya tata letak posko-posko bencana alam yang ada dan juga dapat memberikan masukan berupa posisi SAR saat ini sehingga aplikasi dapat membentuk rute yang dapat dilewati oleh tim SAR. Tujuan dari Tugas Akhir ini adalah untuk membatu dalam memenuhi kebutuhan tim SAR dalam hal informasi rute dan tata letak posko yang ada di kota Lumajang. Agar tujuan ini berhasil dan sesuai dengan yang di inginkan maka aplikasi yang dibuat di bandingkan dengan aplikasi yang telah banyak orang kenal (Google Map). Google Map digunakan sebagai pembanding antara hasil rute yang dibentuk oleh aplikasi, dengan hasil rute yang dibentuk oleh Google Map. Dari proses pembandingan, didapatkan hasil rute yang hampir sama antara aplikasi yang dibuat dengan Google Map, akan tetapi didapatkan nilai jarak yang berbeda. Hal ini dikarenakan sistem yang dibuat menggunakan Algoritma Genetika sebagai penentu rute dan untuk perhitungan jarak menggunakan Haversine. Sedangkan Google Map menggunakan algoritma-nya sendiri dalam proses perhitungan jaraknya. Hasil dari jarak yang didapatkan oleh aplikasi, jarak tempuh dari Posko Kunir ke RSUD Lumajang berjarak 10.81 km. Sedangkan oleh Google Map didapatkan jarak sebesar 15.4 km.\r\n', 'Hadi Wiranata Rachman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100067'),
(66, '070411100069', 'RANCANG BANGUN SISTEM PERAMALAN DISTRIBUSI BERAS MENGGUNAKAN METODE EXPONENTIAL SMOOTHING', 'fika hastarita. S.T., M.Eng', 'bain khusnul khotimah, S.T., M.Kom', 'Salah satu komponen penting yang menunjang operasi perusahaan beras adalah \r\nkegiatan memprediksi jumlah beras yang dibutuhkan konsumen. Dengan prediksi \r\nyang baik dapat dibuat rencana kerja perusahaan lebih efektif dan efisien.  Proses \r\npendistribusian juga harus tepat agar tidak terjadi penumpukan beras di gudang yang \r\nmegakibatkan kwalitas beras menurun.  Selain itu  pemasukan beras  dan distribusi \r\nberas juga harus seimbang supaya terjadi keseimbangn dalam proses distribusi beras. \r\nPenelitian ini  mengidentifikasi pola distribusi beras  di BULOG kabupaten \r\nPamekasan. agar  mendapatkan metode peramalan yang terbaik berdasarkan pola data \r\npendistribusian beras. Selain itu sistem yang di buat juga mampu mendapatkan hasil \r\nperamalan  periode selanjutnya  sehingga dapat menjadi acuan dalam perencanaan \r\nstrategi pendistribusian yang  diterapkan di Bulog  Kabupaten  Pamekasan.  Dalam \r\nproses pendistribusian  beras  Penentuan metode  exponential smooting  sebagai \r\nperamalan yang terbaik  dengan menggunakan data sebelumnya sebagai parameter \r\nmasukan  dilakukan dengan  cara mengukur tingkat kesalahan  peramalan  dari \r\npenerapan  metode tersebut  dan di ketahui peramalan terbaik berada di  alpha  0.1 \r\ndengan mengidentifikasi nilai Square Error  (SE) dan Percentage Error  (PE). Dapat \r\ndiketahui melalui pencarian nilai rata-rata kesalahan sebesar 3.8%, yaitu menghitung \r\nMean Square Error (MSE) dan Mean Absolute Percentage Error (MAPE). \r\n \r\n Kata kunci:  Peramalan Pendistribusian, Exponential Smoothing, Mean Error (MSE) \r\nMean Absolute Percentage Error (MAPE) ', 'hendra pramana putra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100069'),
(67, '070411100070', 'SISTEM PENDUKUNG KEPUTUSAN OPTIMASI PENJADWALAN MATAKULIAH UNTUK PENGGUNAAN RUANGAN KULIAH BERSAMA DI UNIVERSITAS TRUNOJOYO MADURA MENGGUNAKAN ALGORITMA  \r\nGENETIKA', 'Mulaab, S.Si., M.Kom', 'Firli Irhamni, ST., M.Kom', 'Penjadwalan  kuliah  di  Perguruan  Tinggi  merupakan  masalah yang  kompleks.  Dalam  permasalahan tersebut  terdapat  beberapa variabel  yang  harus  dipertimbangkan  supaya  mendapatkan  jadwal  yang \r\noptimal. Di dalam penyusunan jadwal kuliah ini terdapat sangat banyak kemungkinan  yang  selayaknya  dicoba  untuk  menemukan  penjadwalan yang  terbaik.  Karena  itu  dibutuhkan  metode  optimasi  yang  dapat diterapkan  untuk  mengerjakan  penjadwalan  mata  kuliah  ini.  Metode yang  dapat  digunakan  untuk  menyelesaikan  permasalahan  tersebut adalah  dengan  menggunakan  Algoritma  Genetika.  Tugas  Akhir  ini \r\nbertujuan  untuk  membuat  suatu  sistem  yang  dapat  membuat  jadwal matakuliah  secara  otomatis  dan  hasilnya  optimal.  Dari  hasil  penelitian yang  dilakukan  algoritma  genetika  mampu  membuat  jadwal  dengan \r\noptimal  yang  dibuktikan  dari  nilai  fitness  yang memiliki  nilai  1  secara otomatis  jadwal  yang  dibentuk  akan  optimal.  Semoga  adanya  aplikasi ini  diharapkan  bisa  mempermudah  didalam  pembuatan  penjadwalan \r\nmatakuliah dengan mudah dan cepat. \r\n \r\nKata Kunci: Algoritma Genetika, Optimasi,  Penjadwalan.', 'Heri Supriyanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100070'),
(68, '070411100072', 'PENGENALAN TULISAN TANGAN HURUF ALFABET\r\nDENGAN METODE MODIFIED DIRECTION FEATURE (MDF)\r\nDAN LEARNING VECTOR QUANTIZATION (LVQ)', 'Fitri Damayanti S.Kom., M.Kom', 'Kurniawan Eka Permana S.Kom., M.Sc.', 'Pengenalan tulisan tangan merupakan topik penelitian yang sangat populer saat ini. Para peneliti telah banyak melakukan usaha-usaha untuk membuat sistem pengenalan tulisan tangan otomatis dengan berbagai teknik yang berbeda. Penelitian ini membahas pengembangan sistem pengenalan tulisan tangan offline yang menggunakan pencirian lokal dari karakter-karakter tulisan tangan. Salah satu faktor penentu dalam pengenalan tulisan tangan adalah model atau bentuk tulisan tangan dari penulis yang mampu dikenali. Tiap penulis pasti memiliki gaya menulis atau bentuk tulisan tangan yang berbeda. Metode yang digunakan untuk pengenalan pola tulisan tangan pada penelitian ini adalah Modified Direction Feature (MDF) untuk proses ekstraksi fitur dan Learning Vector Quantization (LVQ) untuk proses klasifikasi. Proses ekstraksi fitur pada metode MDF dilakukan dengan cara penentuan arah garis dan posisi  dari tiap-tiap piksel. Sedangkan untuk proses pelatihan data menggunakan  metode Learning Vector Quantization (LVQ), metode ini akan menghasilkan bobot yang akan digunakan untuk proses pengenalan citra huruf tulisan tangan. Dari uji coba yang dilakukan pada sistem, hasil terbaik untuk pengenalan citra huruf tulisan tangan diperoleh dengan jumlah data pelatihan sebanyak 260 citra dan data uji coba sebanyak 52 citra. Hasil akurasi sistem yang didapatkan sebesar 71,15 %.\r\n\r\nKata Kunci: Tulisan Tangan, Modified Direction Feature, Learning Vector Quantization', 'Hilyati Safitri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100072'),
(69, '070411100079', 'RANCANG BANGUN APLIKASI PEMILIHAN TEKNIK REKAYASA KEBUTUHAN MENGGUNAKAN METODE SELF ORGANIZING MAP BERBASIS EUCLIDEAN DISTANCE DAN CANBERRA DISTANCE MATRIX', 'Firli Irhamni S.T, M.Kom', 'Budi Dwi Satoto S.T, M.Kom', 'Penyusunan Sistem Pendukung Keputusan pemilihan teknik rekayasa kebutuhan dibuat untuk membantu pengembang perangkat lunak dalam membangun sebuah proyek perangkat lunak. Pemilihan teknik rekayasa kebutuhan umumnya berdasarkan pada pilihan system dan analis yang bersangkutan daripada berdasarkan karakteristik teknik rekayasa kebutuhan yang sesuai pada proyek perangkat lunak tersebut. Untuk dapat menghasilkan perangkat lunak yang baik maka proses evaluasi dan pemilihan teknik rekayasa kebutuhan merupakan salah satu tahap yang sangat penting dalam sebuah proyek pengembangan perangkat lunak.\r\n	Didalam SPK ini dilakukan proses pemilihan antara teknik rekayasa kebutuhan dan kriteria atribut project yang diinginkan oleh pengembang perangkat lunak. Selanjutnya dilakukan proses clustering menggunakan metode Self Organizing Map (SOM). Parameter yang digunakan dalam adalah distance matrix karena paling tepat digunakan untuk menangani data multi dimensional. Euclidean dan Canberra adalah jenis distance matrix yang lazim digunakan karena tingkat akurasinya yang baik untuk menangani kasus data riil.\r\nHasil akhir yang diperoleh yaitu membandingkan hasil clustering menggunakan metode SOM berbasis Euclidean Distance dan Canberra Distance matrix. Sehingga menghasilkan teknik rekayasa kebutuhan yang efisien, obyektif dan sesuai dengan karakteristik proyek perangkat lunak.\r\nKata Kunci : Sistem Pendukung Keputusan, Teknik Rekayasa Kebutuhan, Clustering, Self Organizing Map, Canberra Distance matrix', 'Lia Fransiska', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100079'),
(70, '070411100080', 'Sistem Pendukung Keputusan Penerimaan Siswa Baru Menggunakan Metode AHP (Analytical Hiearchy Process)', 'Fika Hastarita Rachman S.Kom., M.Eng', 'Andharini Dwi Cahyani S.Kom., M.Kom', 'Kegiatan seleksi penerimaan siswa baru di Madrasah Ibtidaiyah Negeri Model Kamal Bangkalan yang telah berjalan masih memiliki kendala, yaitu lamanya proses memilih peserta dari hasil dipertimbangkan menjadi hasil diterima. Proses ini membutuhkan ketelitian dan kehati-hatian sebab peserta yang dipilih harus berkualitas sehingga memenuhi jumlah daya tampung yang ada. Proses ini merupakan penilaian subyektif dari seorang koordinator seleksi penerimaan siswa baru yang dilakukan secara manual. Oleh karena itu untuk memudahkan dan membantu pihak sekolah dalam kegiatan pemilihan penerimaan siswa baru didalam memilih peserta dari hasil dipertimbangkan menjadi diterima sebagai siswa maka perlu dibangun sebuah sistem pendukung keputusan yang terkomputerisasi yang dapat membantu proses penerimaan siswa dengan AHP. Analytical Hirearchy Process (AHP) digunakan untuk perhitungan bobot kriteria. Dari bobot kriteria yang sudah didapat maka dilakukan proses pengurutan peserta yang akan menentukan alternatif yang optimal, yaitu peserta terbaik. Dari hasil analisa diperoleh data perangkingan yang dihasilkan dari tiga kriteria yaitu tes, jarak rumah kesekolah dan usia\r\nKata kunci: Penerimaan siswa baru, SPK, AHP\r\n\r\n', 'Lucia Dwi Agustin Nilla Indra Sakti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100080'),
(71, '070411100081', 'IMPLEMENTASI PERFORMANCE PRISM \r\nUNTUK SISTEM PENGUKURAN KINERJA PERUSAHAAN', 'BAIN KHUSNUL KHOTIMAH, S.T., M.Kom.', 'Khamdi Mubarok, S.T., M.Eng.', 'Pengukuran kinerja adalah proses di mana organisasi menetapkan parameter hasil untuk dicapai oleh program, investasi, dan akusisi yang dilakukan. Dalam pengukuran kinerja perusahaan diperlukan indikator yang jelas sehingga bisa diketahui peningkatan atau penurunan indeks produktivitas yang menjadi tolak ukur perusahaan dalam mengukur kinerjanya. Pengukuran kinerja salah satunya diterapkan pada PT. Preshion Engineering Plastec Surabaya supaya  tetap  dapat menguasai  pasar  dan  mempertahankan  pelanggannya. Dengan menggunakan Performance Prism, metode ini mempertimbangkan semua kebutuhan dan keinginan dari semua stakeholder yang nantinya akan dijadikan dasar untuk menyusun Key Performance Indicators (KPI) kemudian KPI tersebut dibobotkan dengan ANP selanjutnya dilakukan scoring dengan Objective Matrix (OMAX) untuk mengetahui indeks produktivitas dari kinerja perusahaan. Hasil dari penelitian ini adalah dalam mengevaluasi kinerja PT Preshion Engineering Plastec Surabaya didapatkan 6 stakeholder dengan 19 subkriteria atau KPI. Dari 19 KPI tersebut, KPI Profit Growth  mendapatkan bobot normal paling tinggi yaitu 0,05307 dan KPI jumlah rapat bobotnya paling rendah yaitu 0,05262. Indeks produktivitas perusahaan pada tahun 2010 mengalami penurunan sebesar 0,29642 dari tahun 2009. Ini diakibatkan sebanyak 15 KPI pencapaiannya dibawah target. Namun untuk tahun 2011 indeks produktivitas perusahaan mengalami kenaikan dari tahun 2010 sebesar 0,420018.', 'Luhur Priyantoko Aji', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100081'),
(72, '070411100082', 'Sistem  Informasi Perekomendasian Beasiswa Bagi Siswa Berprestasi Menggunakan Metode Simple Additive Weighting\r\n(studi kasus: SMP Yayasan Pendidikan Sunan Dalem)\r\n', 'Moch. Kautsar Sophan, S.Kom.,M.MT.', 'Rika Yunitarini, ST., MT ', 'ABSTRAK\r\n\r\nPemilihan perekomendasian beasiswa untuk siswa terbaik secara periodik menjadi suatu proses yang lama dan rumit. Keputusan seseorang salah karena proses perekomendasian beasiswa berdasarkan nilai raport, dan nilai non akademis. Oleh karena itu diperlukan sistem pendukung keputusan untuk proses pemilihan beasiswa. Sistem pendukung keputusan ini, dapat menentukan nilai perhitungan terhadap semua kriteria. Sistem ini menggunakan metode Simple Additive Weighting (SAW). Metode ini merupakan suatu metode yang mencari penjumlahan terbobot. Pada studi kasus di sekolah Yayasan Sunan Dalem Desa Gumeno ini, terdapat 5 (lima) kriteria yaitu nilai raport, nilai Bahasa Inggris, Prestasi luar sekolah, Ekstrakulikuler dan Kepribadian, setiap alternatif (beasiswa murid) memiliki kriteria-kriteria tersebut. \r\nDalam hal menentukan Perekomendasian beasiswa terbaik dilakukan dengan cara menjumlahan bobot dari rating kinerja pada setiap alternatif untuk semua atribut. Nilai yang lebih besar akan mengindikasikan bahwa alternatif lebih terpilih. Pada kasus tersebut metode SAW ini dapat menentukan siswa terbaik berdasarkan nilai tertinggi. Dengan demikian sistem ini mampu menangani perhitungan penilaian penerimaan beasiswa terbaik di SMP Yayasan Pendidikan Sunan Dalem Desa Gumeno sehingga (misal manajer guru/kepala sekolah) tidak mengalami kesulitan dalam menentukan siapa saja siswa yang direkomdasikan oleh sistem untuk mendapatkan beasiswa dengan nilai yang terbaik.\r\n\r\nKata kunci: Beasiswa, Simple Additive Weigting, Rapot, Prestasi', 'M Agus Firmansyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100082'),
(73, '070411100083', 'PERANCANGAN SISTEM INFORMASI PERENCANAAN PRODUKSI DAN PERSEDIAAN BAHAN BAKU TINTA MENGGUNAKAN METODE EOQ \r\n(ECONOMIC ORDER QUANTITY)\r\n(Studi Kasus Di PT Inktech Indahmulya)\r\n', 'Yeni Kustiyahningsih, S.Kom., M.Kom.', 'Heri Awalul Ilhamsyah, ST., MT.', 'Penelitian ini membahas tentang perancangan sistem informasi perencanaan produksi dan persediaan bahan baku tinta menggunakan metode EOQ (Economic Order Quantity) di PT. Inktech Indahmulya. Selama ini dalam menjalankan rencana produksi yang ada masih menggunakan perencanaan produksi secara sederhana dan didasarkan pengalaman produksi periode-periode sebelumnya, sehingga perusahaan belum mengetahui apakah rencana produksi yang diterapkan sudah optimal. Untuk dapat menentukan jumlah persediaan barang secara tepat, diperlukan pengetahuan untuk mengetahui berapa jumlah barang yang dibutuhkan tiap periode dengan melakukan peramalan. Metode peramalan yang digunakan adalah metode single exponential smoothing dan metode single moving average, metode ini digunakan untuk melakukan peramalan kebutuhan bahan baku pada periode selanjutnya. Hasil penelitian ini mengkonfirmasikan  untuk menentukan jumlah tinta PMG yang harus diproduksi konsisten menggunakan metode peramalan single exponential smoothing dengan nilai MSE berada pada 0,1. Nilai tersebut digunakan untuk menentukan jumlah material produksi yang dibutuhkan dengan menggunakan metode Economic Order Quantity (EOQ). Dari hasil uji coba sistem ini didapatkan hasil biaya persediaan terendah dan jumlah kebutuhan bahan baku yang  diperlukan untuk periode selanjutnya.', 'M. Arif Rahman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100083'),
(74, '070411100084', 'Penerapan Regular Expression Untuk Mengelompokkan Niche Blog', 'Firdaus Solihin S.Kom., M.Kom', 'Bain Khusnul Khotimah S.T., M.Kom', 'Internet merupakan kebutuhan pokok bagi banyak orang di era informasi. Informasi yang terdapat di internet sangat banyak. Search engine merupakan sistem yang mampu melakukan pencarian dan pengambilan informasi berdasarkan kata kunci yang dimasukkan oleh pengguna. Blog merupakan salah satu penyumbang informasi yang notabene dibuat oleh para blogger. Jumlah blogger di Indonesia semakin bertambah, berbanding lurus dengan jumlah informasi di internet. Dari kondisi tersebut diperlukan mekanisme mempercepat proses pengambilan informasi dari pemilahan blog berdasarkan kategori yang telah ditentukan sebelumnya. Web crawler aplikasi yang berfungsi mengambil informasi yang diperlukan dengan cara menjelajahi halaman situs blog kemudian disimpan dalam database. Proses pengambilan halaman web dilakukan pengecekan bahasa menggunakan regular expression dan daftar stopword untuk tujuh kategori yang ditentukan berdasarkan niche blog : tips dan trik komputer, kuliner nusantara, sepak bola, petualangan indonesia, kesehatan Ibu dan anak, handphone dan gadget, fashion wanita. Niche blog adalah aktivitas blogging yang dilakukan oleh para blogger untuk membuat blog bertopik spesifik. Dengan mengaplikasikan konsep web crawler, penelitian ini mampu menentukan niche blog sesuai dengan tujuh kategori yang telah ditentukan dengan mengujikan 10 kata kunci dan daftar stopword. Dari hasil ujicoba, dapat diambil kesimpulan penggunaan 3 kunci mendapatkan hasil paling maksimal.\r\nKeywords: Niche Blog, Regular Expression, Web Crawler, Search Engine\r\n ', 'Muhammad Darul Mukhlasin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100084'),
(75, '070411100086', 'SISTEM PAKAR DIAGNOSA PENYAKIT GAGAL JANTUNG MENGGUNAKAN METODE BAYESIAN NETWORK', 'Mula\'ab, S.Si., M.Kom.', 'Firli Irhamni, ST., M.Kom.', 'Penyakit Gagal jantung adalah pembunuh nomer satu pada negara yang sedang berkembang. Seperti halnya di Indonesia dan negara-negara asia pada umumnya, di Amerika pun  penyakit jantung pernah menjadi pembunuh nomer satu. Di seluruh dunia, jumlah penderita penyakit ini terus bertambah. Ketiga  kategori penyakit ini tidak lepas  dari gaya  hidup  yang kurang sehat yang banyak dilakukan seiring dengan berubahnya pola hidup.  Faktor-faktor pemicu serangan \r\njantung  ialah  rokok,  mengonsumsi  makanan  berkolest erol  tinggi,  kurang  gerak,  malas berolahraga, stres, dan kurang istirahat.Seiring kemajuan teknologi dibuatlah sistem yang bisa mendiagnosa  penyakit-penyakit  tersebut.  Sistem  ini  yang  nanti  akan  menggantikan  pakar aslinya  dalam  penentuan diagnosa  penyakit.  Sehingga  dengan  sistem  ini  nanti   diharapkan pasien  bisa  mendapatkan  pelayanan  lebih  cepat  dan  akurat.  Sistem  pakar  ini  menggunakan \r\nmetode  Bayesian Network  sebagai acuannya.  Dalam metode ini menggunakan struktur gejala yang saling berkaitan untuk mendiagnosa penyakit. Struktur tersebut ditentukan oleh seorang pakar dibidang jantung. Kemudian ditentukan nilai probabilitas dari setiap gejala berdasarkan keterkaitan antara gejala. Setelah didapatkan semua baru semua nilai dibandingkan dan diambil nilai  terbaik  sebagai  hasil  diagnosa.  Dalam  pengaplikasiannya  sistem  ini  memiliki  akurasi \r\nsampai lebih dari 80%.', 'M. Khoirul Mahmudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100086'),
(76, '070411100092', 'Perancangan Sistem Informasi Badan Kepegawaian Daerah ( BKD ) Bangkalan Sebagai Sub sistem dari E-Government Bangkalan Menggunakan TOGAF ADM ', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Yeni Kustiyaningsih, S.Kom., M.Kom.', 'Kantor Badan Kepegawaian kota Bangkalan adalah instansi pemerintahan yang bergerak di bidang pelayanan kepegawaian. Untuk meningkatkan kualitas pelayanan maka perlu adanya sebuah sistem informasi yang mampu memonitoring dan membantu proses kinerja dari dinas tersebut. Oleh karena itu dalam penelitian  ini dibahas bagaimana menerapkan  Architecture Enterprise BKD Bangkalan dengan menggunakkan metode TOGAF ADM dan mengimplementa sikannya kedalam sebuah implementasi aplikasi Enterprise yang akan dibentuk menjadi satu keterpaduan dengan  E-government Bangkalan. TOGAF ADM memiliki empat komponen utama: arsitektur bisnis, arsitektur data, arsitektur teknologi dan arsitektur aplikasi. Intinya TOGAF digunakan untuk membuat Architecture Enterprise dari semua aspek tersebut. Dalam penelitian ini akan dibahas tentang perancangan sistem arsitektur Sistem informasi BKD Bangkalan sebagai sub-sistem dari E-government Bangkalan dengan menggunakan TOGAF ADM tujuannya agar dapat menghasilkan sistem aplikasi administrasi kantor Badan Kepegawaian Daerah  Bangkalan, membuat Blue Print, serta memperbaiki efisiensi, kenyamanan, serta aksesibilitas pelayanan terhadap publik agar  lebih baik. \r\n\r\nKata Kunci: Arsitektur interprise, TOGAF ADM, Arsitektur bisnis, Arsitektur data, Arsitektur aplikasi, Arsitektur teknologi\r\n', 'MALIKUL HAMZAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100092'),
(77, '070411100096', 'SISTEM INFORMASI PEMETAAN PEMILIHAN AREA LAHAN UNTUK PENGELOLAAN SUMBER AIR DENGAN METODE ELECTRE\r\n(Studi Kasus : Kabupaten Sumenep)', 'MULA’AB, S.Si, M.Kom', 'FIRMAN FARID MUHSONI, S.Pi. M.Sc', 'ABSTRAK\r\n\r\nKondisi keterbatasan sumber daya air di Kabupaten Sumenep saat ini dapat menjadi kendala dalam pengembangan wilayah yang nantinya berdampak pada perubahan guna lahan, peningkatan kebutuhan air sangat meningkat dikarenakan perkembangan penduduk dan kegiatan sosial-ekonomi yang bermunculan dan berkembang pesat pasca selesainya proyek pembangunan jembatan Suramadu. Atas dasar tersebut, maka penelitian ini perlu dilakukan untuk memilih lahan yang ada sehingga nantinya dapat digunakan untuk pengelolaan sumber air. Penelitian ini bertujuan untuk menentukan pemilihan area paling sesuai untuk menetapkan lahan guna kepentingan pengelolaan sumber air. Metode yang digunakan dalam penelitian ini adalah metode electre, yang mana metode ini merupakan metode pengambilan keputusan yang nantinya di implementasikan kedalam sistem informasi berbasis website sehingga dalam penggunaannya menjadi lebih mudah untuk dipahami dan di operasikan. Dalam sistem informasi tersebut dilengkapi penggunaan google maps sehingga dapat lebih mempermudah user dalam mendapatkan info dari sebuah area lahan yang diseleksi.\r\n\r\nKata Kunci : electre, lahan, sistem informasi, google maps.\r\n', 'MIFTAHOL ARIFIN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100096'),
(78, '070411100102', 'ANALISIS PERAMALAN PENJUALAN PRODUK ASESORIS KOMPUTER MENGGUNAKAN METODE EXPONENTIAL SMOOTHING (ES) DAN ORDINARY LEAST SQUARE (OLS)', 'Mula’ab, S.Si., M.Kom.', 'Yeni Kustiyahningsih, S.Kom., M.Kom.', 'Dengan prediksi yang baik, dapat dibuat rencana kerja perusahaan lebih efektif dan efisien. Semakin banyak orang menggunakan Komputer  maka jumlah permintaan konsumen pada Asesoris komputer secara otomatis penjualannya juga akan meningkat. Oleh karena itu dibutuhkan sistem yang dapat memprediksi jumlah penjualan tiap minggunya agar perusahaan mendapatkan keuntungan yang maksimal. Untuk meramalkan pejualan Asesoris komputer Digunakanlah metode peramalan Single Exponential Smoothing (SES) dan metode Oldinary Least Square (OLS). Hasil peramalan tersebut akan dihitung  dan dibandingkan menggunakan Mean Square Error (MSE) untuk mendapatkan hasil error yang terkecil dan peramalan terbaik. Dari beberapa hasil tes perhitungan peramalan yang telah dilakukan dapat diambil kesimpulan bahwa proses peramalan penjualan asesoris komputer menggunakan metode Single Exponential Smoothing (SES) dan Oldinary Least Square (OLS) cukup baik diterapkan untuk studi kasus di SKY DISK Surabaya. Dengan mendapatkan rata-rata MSE sebesar 5257.5 dan rata-rata MAPE sebesar 0.9463%.', 'Moh. Hasbi Ash Shiddieqy', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100102'),
(79, '070411100104', 'SISTEM PENENTU CALON PENERIMA BEASISWA IKSASS RAYON BANGKALAN MENGGUNAKAN METODE SMARTER DAN FORWARD CHAINING', 'Achmad Ubaidillah, Ms.,S.T.,M.T', 'Fika Hastarita Rachman, S.T., M.Eng', 'Beasiswa  indentik  dengan  penghargaan yang  diberikan  kepada  pelajar/santri  berprestasi dalam  studi  yang  ditempuhnya.  IKSASS dalam  menumbuhkan  dan  meningkatkan semangat  santri  untuk  berprestasi dilakukan  dengan  memberikan  penghargaan  berupa  beasiswa  tiap  semester. Proses  seleksi  calon penerima beasiswa di Ikatan Santri Alumni Salafiyah Syafiiyah (IKSASS) Rayon Kabupaten Bangkalan dilengkapi  dengan  berbagai  kriteria. Seperti ekonomi keluarga, tanggungan keluarga, status orang tua dan lain-lain. Hal tersebut perlu  diperhatikan  dalam  perhitungan  penilaian  terhadap  kriteria  dan harus benar-benar relevan karena pada dasarnya akan berpengaruh pada hasil akhirnya. Dengan menggunakan Sistem Pendukung keputusan, calon penerima beasiswa menggunakan metode SMARTER inferensi Forward Chaining yang akan dibuat, hasil yang  didapat  telah  memenuhi  kriteria  yang  diinginkan  pihak IKSASS. Selain itu penggunaaan Forward Chaining efektif digunakan untuk mengantisipasi kesamaan hasil perankingan. Sehingga proses seleksi calon penerima beasiswa IKSASS rayon bangkalan tepat sasaran.\r\n\r\nKata kunci : sistem pendukung keputusan, Simple Multi-Atribute Rating  Technique Exploiting Rank (SMARTER), Forward Chaining.\r\n', 'Moh Rudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100104'),
(80, '070411100109', 'EKSTRAKSI FITUR BERBASIS TWO DIMENSIONAL LINEAR DISCRIMINANT ANALYSIS  UNTUK PENGENALAN WAJAH', 'Dr. Arif Muntasa, S.Si.,M.T', 'Fitri Damayanti, S.Kom.,M.kom', 'Sistem pengenalan wajah adalah suatu sistem untuk mengenali identitas diri dari seseorang melalui wajah manusia. Teknologi ini mengidentifikasi bagian tubuh manusia yang unik dan tetap seperti wajah manusia. Hal khusus di bidang identifikasi dan pengenalan wajah manusia memanfaatkan pengolahan dan juga analisis citra wajah, yang akan berperan penting dalam proses pengenalan wajah manusia. Sistem ini dapat di manfaatkan dalam suatu sistem keamanan di bidang biometrika. Pada penelitian ini telah di bangun suatu perangkat lunak pengenalan citra wajah manusia menggunakan metode Two Dimensional Linear Discriminant Analysis (2DLDA) untuk menentukan karakteristik dari wajah manusia. Sedangkan pada tahap pengklasifikasian digunakan metode Angular Separation untuk mengukur kemiripan antara data pelatihan (training) dan data uji coba (testing). Melalui proses testing gambar wajah ini dapat di ketahui identitas diri dari seseorang. Dari uji coba aplikasi menggunakan klasifikasi Angular Separation di peroleh akurasi pengenalan benar sebesar  94.5%, pada  lima pose citra wajah pelatihan  dan lima pose citra wajah uji coba (testing) dengan jumlah data masing - masing dua ratus citra wajah manusia yang di ambil dari database ORL dengan menggunakan sepuluh eigen.\r\n\r\nKata kunci : Sistem pengenalan wajah, Two Dimensional Linear Discriminant Analysis, Angular Separation.\r\n', 'Muhammad Choirur Rozi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100109'),
(81, '070411100113', 'SISTEM PERAMALAN PENJUALAN OBAT MENGGUNAKAN METODE JST ALGORITMA BACKPROPAGATION DENGAN INISIALISASI BOBOT AWAL  NGUYEN WIDROW', 'Bain Khusnul Khotimah,ST.,M.Kom.', 'Haryanto, S.T., M.T.', 'ABSTRAK\r\nObat merupakan salah satu kebutuhan penting dalam rumah sakit. Selama ini, kebutuhan pengumpulan data obat adalah masalah yang sering dihadapi oleh Farmasi yang memiliki kewenangan dalam pengadaan obat-obatan di rumah sakit Syarifah Ambami Rato Ebu Kabupaten Bangkalan. Dalam rangka menjamin ketersediaan obat perlu untuk mempersiapkan kebutuhan obat sesuai dengan jumlah yang dibutuhkan. Dalam rangka memenuhi tingkat kebutuhan obat tersebut,  perlu untuk meramalkan masa depan terkait jumlah ketersediaan obat yang dibutuhkan dengan menggunakan data sebelumnya.Data tersebut digunakan  bertujuan untuk menentukan nilai kesalahan dan keakuratan pelatihan dari metode yang digunakan. Dalam penelitian ini, metode yang akan digunakan untuk memprediksi kebutuhan obat adalah Jaringan Syaraf Tiruan menggunakan algoritma Backpropagation dengan inisialisasi bobot awal Nguyen Widrow. Dengan penambahan metode Nguyen Widrow ini, sistem mampu memecahkan masalah yang terjadi dalam Backpropagation standar yang lambat untuk mencapai konvergensi. Dari pengujian yang dilakukan dengan 3 Skenario yaitu perubahan Epoch, Learning rate dan Momentum, serta perubahan Jumlah input layer dan Hidden layer  pada nama obat ACLAM 500 MG KAPLET/BTL 1 didapatkan hasil parameter terbaik untuk melakukan peramalan yaitu dengan jumlah epoch 30 nilai Learning Rate 0.9 dan Momentum 0.8 serta jumlah input layer 4 dan Hidden layer 4 yang menghasilkan MSE (Mean Seaquare Error) 0, 003.\r\n\r\nKata Kunci: Peramalan, Jaringan Syaraf Tiruan, Backpropagation, Nguyen Widrow, kebutuhan obat.\r\n', 'Naimah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100113'),
(82, '070411100114', 'SISTEM PEROLEHAN CITRA BERBASIS ISI MENGGUNAKAN\r\nGRAY LEVEL DIFFERENCE METHOD BERDASARKAN\r\nCIRI TEKSTUR PADA POLA BATIK\r\n', 'Fitri Damayanti, S.Kom., M.Kom', 'Rima Tri Wahyuningrum, S.T., M.T', 'Batik adalah kerajinan yang memiliki nilai seni tinggi dan telah menjadi bagian dari budaya Indonesia sejak lama. Batik di Indonesia mempunyai beragam jenis tekstur batik, warna batik, dan pola batik yang mencerminkan asal usul daerah dari batik tersebut. Saat ini pencarian citra berbasis teks sudah tidak efektif lagi karena adanya penilaian subjektif dari pengguna dalam merepresentasikan suatu citra. Karena itu diperlukan suatu sistem yang dapat menangani pencarian citra menggunakan query berupa citra atau disebut Sistem Perolehan Citra berbasis Isi (SPCI) atau Content Based Image Retrieval (CBIR). Penelitian  ini menggunakan ciri tekstur sebagai proses pencarian kemiripan dari delapan kelas citra batik yang  berbeda yaitu: Cirebon, Bali, Bangkalan, Pamekasan, Sumenep, Yogyakarta, Solo, dan Pekalongan sebagai objek perolehan citra berbasis isi. Sistem dibangun dengan proses utamanya yaitu ekstraksi fitur tekstur dengan menggunakan metode Gray Level Difference Method (GLDM) menggunakan empat arah utama. GLDM menghitung perbedaan mutlak antara sepasang derajat keabuan yang terpisah oleh jarak dan arah tertentu. Hasil ekstraksi fitur dilakukan pengukuran jarak kemiripan menggunakan metode Euclidean Distance. Dari uji coba aplikasi menggunakan pengukuran kemiripan Euclidean Distance dengan nilai threshold=7 diperoleh akurasi presisi sebesar  61%  pada data pelatihan 168 dan data uji coba 32 dengan 10 citra yang ditampilkan. ', 'Nansy Lovitasari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100114'),
(83, '070411100119', 'Pengenalan Tulisan Tangan Carakan Jawa Secara Real Time  Dengan Menggunakan Dominant Point', 'Fitri Damayanti, S.Kom., M.Kom', 'Rima Tri Wahyuningrum, ST, MT', 'Pengenalan tulisan tangan adalah salah satu cabang dari pengenalan pola. Carakan merupakan tulisan yang cukup kompleks dan memiliki karakteristik yang lebih unik dibandingkan dengan tulisan latin, apalagi bila ditulis dengan tulisan tangan. Faktor yang menyebabkan proses pengenalan tulisan carakan sulit untuk dilakukan adalah variasi bentuk tulisan carakan dan memiliki kemiripan antar huruf. Hal ini memungkinkan adanya kesalahan dalam proses klasifikasi. Pada penelitian ini dibangun sistem pengenalan tulisan tangan secara real time dimana proses ekstraksi ciri menggunakan metode Dominant Point untuk mendapatkan ciri pada setiap karakter masukan. Metode ini pada dasarnya sistem akan membaca arah goresan pena yang didasarkan pada kumpulan titik. Pada proses klasifikasi serta pengenalan karakter menggunakan Fine Classification. Pada proses ini, pengenalan dilakukan dengan tiga tahap yaitu penilaian prakandidat, menyeleksi kandidat, lalu pencocokan karakter. Proses ini yang membuat sistem dengan cepat melakukan proses pengenalan. Dari uji coba yang dilakukan pada sistem, hasil terbaik untuk pengenalan citra huruf tulisan tangan carakan diperoleh dari data pelatihan sebanyak 600 citra pada data uji coba skenario ke 3 dengan akurasi sebesar 90%. Sedangkan hasil terendah diperoleh dari data pelatihan sebanyak 200 citra pada data uji coba skenario ke 1 dengan akurasi sebesar 40%. Hasil akurasi rata-rata dari sembilan skenario adalah sebesar 67,67%.\r\n\r\nKata kunci: Handwriting Recognition, Carakan, Dominant Point,  Fine Classification.', 'Nining Latifah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100119'),
(84, '070411100120', 'PEMANFAATAN TOGAF ADM UNTUK PERANCANGAN SISTEM INFORMASI DINAS PERINDUSTRIAN & PERDAGANGAN SEBAGAI SUB SISTEM ARSITEKTUR E-GOVERNMENT KABUPATEN BANGKALAN', 'M. Kautsar Sophan, S.Kom., M. MT.', 'Yeni Kustiyahningsih S.Kom., M.Kom.', 'Penyusunan Sistem Informasi Dinas Perindustrian & Perdagangan (DISPERINDAG) Kabupaten Bangkalan dibuat untuk meningkatkan kualitas pelayanan dan membantu proses kinerja dari dinas tersebut. Salah satu faktor pendorong pemanfaatan sistem informasi yang lebih baik adalah semakin meningkatnya kebutuhan fungsi pelayanan yang dijalankan. Tujuan dari penerapan Arsitektur Enterprise adalah menciptakan keselarasan antara bisnis dan teknologi informasi bagi kebutuhan instansi, penerapan arsitektur enterprise tidak terlepas dari bagaimana sebuah instansi merencanakan dan merancang arsitektur enterprise tersebut. TOGAF ADM merupakan metodologi yang lengkap, banyak instansi yang tidak memahami secara jelas tentang tahapan – tahapan dari metodologi tersebut diterjemahkan ke dalam aktivitas perancangan Arsitektur Enterprise. Tahapan dalam perancangan Arsitektur Enterprise sangatlah penting dan akan berlanjut pada tahapan berikutnya yaitu rencana implementasi. TOGAF ADM memiliki empat komponen utama: arsitektur bisnis, arsitektur data, arsitektur teknologi dan arsitektur aplikasi. Pada intinya TOGAF digunakan untuk membuat Arsitektur Enterprise dari semua aspek tersebut yang menghasilkan model dan kerangka dasar dalam mengembangkan sistem informasi yang terintegrasi untuk mendukung kebutuhan Dinas Perindustrian & Perdagangan sesuai dengan Peraturan Bupati Bangkalan Nomor 38 Tahun 2010 Tentang Uraian Tugas Jabatan Struktural pada Dinas Perindustrian dan Perdagangan.', 'Norman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100120'),
(85, '070411100121', 'Pengelompokkan Data BBM Time Series Dengan Menggunakan Fuzzy C-Means', 'Bain Khusnul Khotimah, ST, M.Kom', 'Mula\'ab S.SI, M.Kom', 'ABSTRAK\r\nPencatatan laporan mengenai pemesanan, penjualan, harga, tingkat, persediaan dan lain sebagainya adalah komponen dari sistem informasi yang penting dan paling dasar yang digunakan oleh para manajer perusahaan. Karena dengan hal ini para manajer pemasaran dapat menemukan masalah yang penting yaitu dengan cara menganalisisnya. Penelitian ini membahas penerapan algoritma Fuzzy C-Means, dalam penelitian yang dilaksanakan di Depot Pertamina Camplong bertujuan untuk mengidentifikasikan pola dari data penjualan BBM. Pengujian dilakukan pada dua jenis BBM, yaitu BBM jenis Premium dan BBM jenis Solar.Clustering merupakan metode pengelompokan suatu objek kedalam sejumlah kelompok (cluster) yang sesuai. Prinsip clustering adalah meminimumkan kesamaan antar anggota satu cluster dan memaksimalkan kesamaan antar anggota cluster yang berbeda. Fuzzy C-Means merupakan teknik pengclusteran dimana tiap-tiap data ditentukan oleh derajat keanggotaannya. Semakin besar nilai derajat keanggotaan data dalam suatu cluster maka semakin besar pula data tersebut menjadi anggota cluster tersebut.Hasil clustering kemudian diproses atau dievaluasi menggunakan Sum Squared Error (SSE) diaman sebelumnya harus diketahui niai pusat cluster guna mengetahui cluster yang mana yang memiliki nilai error yang terkecil. \r\n\r\nKata Kunci : Pengelompokkan data, Fuzzy C-Means(FCM), Sum Squared Error (SSE)\r\n', 'Novie Safitri Hardi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100121'),
(86, '070411100124', 'SISTEM PENENTUAN STATUS GIZI PASIEN RAWAT INAP\r\nMENGGUNAKAN METODE NAÏVE BAYES CLASSIFIER\r\n(STUDI KASUS : RSUD DR. H. SLAMET\r\nMARTODIRDJO PAMEKASAN)', 'Diana Rahmawati, ST.M.T', 'Firli Irhamni, ST.M.Kom', 'Di Indonesia masalah perkembangan gizi adalah masalah yang\r\nperlu perhatian lebih. Jika seseorang tidak mengetahui tentang status\r\ngizinya, maka tidak akan dapat mengontrol berapa banyak jumlah gizi\r\nyang dibutuhkan dalam tubuh. Dalam penelitian ini dirancang aplikasi\r\nsistem pendukung keputusan yang digunakan untuk menentukan status\r\ngizi pasien dan memberikan solusi makanan pada pasien sesuai riwayat\r\npenyakit yang di derita pasien. Sistem yang dirancang ini berbasis Web,\r\ndan memudahkan pihak admin atau ahli gizi rumah sakit dalam\r\npenentuan status gizi pasien. Diharapkan dengan adanya aplikasi ini\r\ndapat memberikan efisien dan efektifitas kinerja setiap pihak.\r\nMetode yang digunakan dalam penelitian ini menggunakan\r\nNaïve Bayes Classifier (NBC). Metode terbaru yang di gunakan untuk\r\nmemprediksi probabilitas.Metode Naïve bayes Classifier melakukan\r\nproses penentuan perhitungan probabilitas status gizi. Dimana dicari\r\nnilai probabilitas terbesar yang kemudian menjadi kesimpulan\r\npenentuan status gizi.\r\nMetode ini dapat diterapkan dalam studi kasus Sistem\r\nPenentuan Status Gizi Pasien dengan hasil akurasi terbesar 92%.\r\nKata Kunci : Naïve Bayes Classifier, Sistem Pendukung Keputusan,\r\nStatus Gizi, Web', 'Nur Anggraeni', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100124'),
(87, '070411100126', 'RANCANG BANGUN GAME PERAWATAN SAPI KARAPAN MENGGUNAKAN METODE FUZZY LOGIC', 'Arik Kurniawati, S.Kom., M.T.', 'Kurniawan Eka Permana, S.Kom., MSc.', 'Perkembangan game yang semakin pesat, memberikan berbagai alternative bagi peminatnya. Mulai dari bentuk game, cerita maupun media penyajian. Keberadaan game yang menggambarkan budaya Indonesia khususnya daerah kepulauan seperti Madura terhitung sedikit, sehingga dapat dirasa semakin lunturnya kebudayaan Indonesia bagi anak bangsa. Adanya peminat game yang semakin banyak dapat digunakan sebagai sarana pengenalan budaya asli Madura. Sebuah aplikasi game tentang olahraga yang sangat digemari di pulau Madura tersebut seperti Kerapan Sapi adalah sangatlah penting. Untuk itu perlu dibangun aplikasi game kerapan sapi sebagai upaya pelestarian budaya bangsa khususnya pulau Madura. Dengan upaya pembuatan game budaya maka dibangun  game perawatan sapi karapan menggunakan metode logika fuzzy (fuzzy logic), dengan menginputkan parameter kekuatan dan kesehatan sapi karapan untuk menentukan harga jual sapi karapan dalam sebuah game perawatan sapi karapan.\r\nKata kunci : game, kerapan sapi, perawatan sapi kerapan, budaya madura.', 'NURRACHMAT', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100126'),
(88, '070411100128', 'SISTEM PEROLEHAN CITRA BERBASIS ISI\r\nMENGGUNAKAN GRLM BERDASARKAN CIRI TEKSTUR PADA POLA BATIK\r\n', 'Mula\'ab . S.Si ,. M,.Kom', 'Bain Khusnul Khotimah .S.T,. M.,Kom', 'Batik merupakan seni yang paling penting dalam kehidupan masyarakat Indonesia. Keanekaragaman batik datang dari beberapa wilayah dan provinsi sehingga menyimbolkan karakteristik ciri pola batik yang berbeda-beda dari masing-masing daerah tempat batik tumbuh dan berkembang. Tugas akhir ini telah berhasil membuat suatu Sistem Perolehan Citra berbasis Isi (SPCI) dengan ciri tekstur yang bertujuan untuk mengetahui ciri dari pola batik tersebut. SPCI merupakan metode atau teknik pencarian gambar citra yang mirip (similar) dengan melakukan perbandingan antara citra query dengan citra yang ada dalam basis data. Pada penelitian  ini menggunakan ciri tekstur sebagai proses pencarian kemiripan dari delapan wilayah citra batik yang  berbeda yaitu: Cirebon, Bali, Bangkalan, Pamekasan, Sumenep, Yogyakarta, Solo, dan Pekalongan sebagai obyek perolehan citra berbasis isi. Sistem dibangun dengan proses utamanya yaitu ekstraksi fitur tekstur dengan menggunakan metode Gray Level Run Length Matrix (GLRM). GLRM dilakukan dengan membuat rangkaian pasangan nilai (i,j) pada setiap baris piksel dengan arah tertentu. Hasil ekstraksi fitur selanjutnya dilakukan pengukuran jarak kemiripan menggunakan metode Euclidean Distance. Dari uji coba aplikasi menggunakan pengukuran kemiripan Euclidean Distance dengan nilai threshold=145 diperoleh akurasi presisi sebesar  0.53  pada data pelatihan 184 dan data uji coba 16 dengan jumlah citra yang ditampilkan 10. \r\n\r\nKata Kunci: Tekstur, Sistem Perolehan Citra berbasis Isi, Gray Level Run Length Matrix, Euclidean Distance\r\n', 'Priagung Safara Dila', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100128'),
(89, '070411100129', 'ANALISIS DAN PENERAPAN ALGORITMA PARTICLE SWARM OPTIMIZATION PADA OPTIMASI PENJADWALAN MATA KULIAH DI JURUSAN TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO MADURA', 'Bain Khusnul Hotimah S.T., M.Kom.', 'Arik Kurniawati, S.Kom, M.T.', 'Penjadwalan mata kuliah di program studi Teknik Informatika Universitas Trunojoyo Madura dilakukan pada setiap pergantian semester. Beberapa faktor yang mendukung penjadwalan mata kuliah antara lain dosen, mahasiswa, mata kuliah, serta jumlah ruang dan waktu yang tersedia. Permasalahan optimasi penjadwalan merupakan masalah yang sudah umum dan telah dipelajari dalam waktu yang lama, namun perlu dicari metodologi atau pendekatan teknis dan sampai saat ini telah berkembang beberapa solusi alternatif yang ditawarkan. Dalam penelitian ini digunakan algoritma Particle Swarm Optimized (PSO) utnuk melakukan optimasi pada jadwal kuliah. Karena algoritma PSO memiliki tool-tool yang cukup handal dengan penggunaan yang cukup mudah. Hasil penelitian menunjukkan bahwa algoritma Particle Swarm Optimiztion dapat diterapkan  dengan lebih baik pada optimasi penjadwalan mata kuliah dengan memaksimalkan penggunaan parameter-parameter dari algoritma Particle Swarm Optimiztion yaitu apabila nilai w besar maka untuk mengoptimalkan nilai velocity gunakan nilai kecil pada c1 dan c2, begitu juga sebaliknya bila nilai w kecil maka gunakan nilai besar pada c1 dan c2.', 'Qomarul Haryadi Irfan Rifa\'i', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100129'),
(90, '070411100133', 'Deteksi Manusia Menggunakan Histogram of Oriented Gradients dan Naïve Bayes Classifier', 'Dr. Indah Agustien, S.Kom., M.Kom', 'Ari Kusumaningsih, S.T, M.T', 'Deteksi manusia merupakan  suatu aplikasi yang berfungsi untuk mendeteksi objek manusia dalam sebuah citra. Beberapa keuntungan yang dapat diambil dari kajian ini, yaitu penerapan pada video pengawasan. Namun, dalam video pengawasan manusia yang dideteksi dalam keadaan bergerak. Sedangkan aplikasi ini, hanya mendeteksi atau menemukan objek manusia dari background sebuah citra. Sehingga dalam proses pembuatan aplikasi ini diperlukan perhitungan – perhitungan khusus untuk mendapatkan hasil yang baik. Penelitian ini menggunakan dua tahap yaitu proses ekstraksi fitur dan klasifikasi. Proses ekstraksi fitur menggunakan metode Histogram Of Oriented Gradients (HOG). Pada prinsipnya HOG menggunakan histogram untuk memperoleh ekstraksi fitur tersebut, dengan  beberapa langkah diantarnya yaitu konversi citra, gradient compute dan normalisasi. Sedangkan pada metode Naive Bayes Classifier ini di gunakan untuk proses pengklasifikasian atau pencocokan citra. Sehingga pada hasil akhir dapat diketahui kelas citra yang telah diuji. Berdasarkan uji coba aplikasi menggunakan perhitungan distribusi gaussian probabilitas pada naive bayes classfier dengan nilai threshold = 12,13,14 dan 15 pada skenario 1, 2 dan 3 diperoleh rata – rata akurasi sebesar 68,65%.\r\n\r\nKata kunci : Histogram Of Oriented Gradient, Naive Bayes Classifier\r\n', 'R.A. Uluwiyah Nur Oktavianis ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100133');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(91, '070411100135', 'MEDIA PEMBELAJARAN INTERAKTIF UNTUK TOPIK SORTING \r\n(ALGORITMA INSERTION SORT DAN MERGE SORT)\r\n', 'Yonathan Ferry Hendrawan, S.T., M.IT.', 'Dr.Indah Agustien Siradjuddin, S.Kom., M.Kom.', 'Multimedia merupakan perpaduan antara berbagai media yang berupa teks, gambar, grafik, sound, animasi, video, interaksi, dan lain lain yang dikemas menjadi file digital, digunakan untuk menyampaikan pesan kepada publik. Media  pembelajaran  interaktif merupakan segala  sesuatu yang menyangkut Software  dan Hardware yang  dapat  digunakan  sebagai  perantara untuk  menyampaikan  isi  materi  ajar  dari  sumber  belajar  ke  pembelajar  dengan metode  pembelajaran  yang  dapat  memberikan  respon  balik  terhadap  pengguna dari apa yang telah diinputkan kepada media tersebut. Kualitas  media  pembelajaran  dapat  dinilai  melalui  ukuran-ukuran  dan  metode-metode tertentu. Tujuan penelitian ini adalah membuat sebuah media pembelajaran sorting yang dapat diputar pada komputer. Perangkat lunak yang digunakan untuk mengimplementasikan sistem menggunakan Flash dan diaplikasikan pada media pembelajaran Sorting serta pada materi pengantar algoritma. Dengan menggunakan skenario sebelum video dan program dibuat sehingga perancangan media pembelajaran ini terstruktur dan sistematis. Inteface yang dibuat berisi menu pilihan materi tentang algoritma dan Sorting serta Video pembelajaran yang dapat menambah dan membantu pemahaman materi algoritma serta sorting yang didalamnya mencakup materi Insertion Sort dan Merge sort. Dalam video tersebut juga dilengkapi animasi sebagai contoh sesuai materi pembelajaran yang dibuat.\r\nKata Kunci :	Media Pembelajaran, Video, Flash, Sorting\r\n', 'Rahmat Aidil Fitri Rysa', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100135'),
(92, '070411100136', 'SISTEM PERAMALAN KEBUTUHAN OBAT MENGGUNAKAN METODE JARINGAN SYARAF TIRUAN ALGORITMA  BACKPROPAGATION DENGAN FUNGSI LYAPUNOV', 'Bain Khusnul Khotimah, S.T.,M.Kom.', 'Haryanto, S.T.,M.T.', 'Obat merupakan salah satu kebutuhan penting dalam rumah sakit. Selama ini, kebutuhan pengumpulan data obat adalah masalah yang sering dihadapi oleh Farmasi yang memiliki kewenangan dalam pengadaan obat-obatan di rumah sakit Dr H. Slamet Martodirdjo Pamekasan. Dalam rangka menjamin ketersediaan obat perlu untuk mengatasi kebutuhan obat sesuai dengan jumlah yang dibutuhkan. Dalam rangka memenuhi tingkat kebutuhan untuk obat perlu untuk meramalkan masa depan pasokan obat dengan menggunakan data sebelumnya sebagai data untuk menentukan nilai kesalahan pelatihan metode yang digunakan. Dalam penelitian ini, metode yang akan digunakan untuk memprediksi kebutuhan obat adalah Jaringan Syaraf menggunakan algoritma Backpropagation dengan penambahan fungsi Lyapunov. Dengan penambahan fungsi ini, mampu memecahkan masalah yang terjadi dalam Backpropagation standar sering lambat untuk mencapai konvergensi.\r\nDari uji coba yang dilakukan dengan 3 Skenario didapatkan hasil parameter terbaik untuk melakukan peramalan pada nama obat Ambroxol dengan  nilai (?) sebesar 13, learning rate 0.4 dan epoch=125 memperoleh  nilai MAPE  2.7% .  Obat Bisoprolol Tab 5mg dengan nilai (?) sebesar 2,  learning rater  0.5 dan epoch 150 memperoleh nilai MAPE  2,94089%.  Obat Cefixime Caps 100mg dengan  nilai (?) sebesar 4, learning rate   0.2  dan epoch 100  memperoleh nilai MAPE  1,10466%.\r\n', 'Rahmatina Hidayati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100136'),
(93, '070411100137', 'Analisa Pemilihan Alat Kontrasepsi Dengan Menggunakan Metode Naive Bayes', 'Firli Irhamni', 'Muhammad Ali Syakur', 'KB adalah singkatan dari Keluarga Berencana. Menurut Kamus besar Bahasa Indonesia (1997), KB adalah “Gerakan untuk membentuk keluarga yan sehat dan sejahtera dengan mengatur kehamilan”. Dengan kata lain KB adalah perencanaan jumlah keluarga. Pengaturan bisa dilakukan dengan penggunaan alat-alat kontrasepsi atau penanggulangan kehamilan seperti pil, suntik, IUD, dan sebagainya. Jumlah anak di anggap ideal adalah dua anak.Dalam proses penentuan pemilihan alat kontrasepsi tersebut memerlukan  Metode peramalan yang digunakan dalam sistem ini adalah metode Naïve bayes classifer untuk menghitung jumlah ketepatan dalam menentukan pilihan alat kontrasepsi. Aplikasi sistem pendukung keputusan dengan Naïve bayes classifer dapat dijadikan solusi untuk menentukan alat kontrasepsi, Nilai konfigurasi parameter untuk sistem pendukung keputusan dengan menggunakan Naïve bayes classifer.\r\n\r\nKata Kunci : Alat Kontrasepsi, Sistem Pendukung Keputusan,  Naïve bayes classifer\r\n', 'Ratih Marcelina', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100137'),
(94, '070411100142', 'Rancang Bangun Aplikasi Kamus Indonesia Madura Berbasis Android', 'Cucun Very Angkoso, S.T.,M.T.', 'Fika Hastarita Rachman, ST., M.Eng.', 'Kamus pada perangkat selular lebih praktis dibandingkan dengan kamus cetak konvensional, karena pengguna dapat menerima informasi dengan cepat dimana saja tanpa adanya batasan ruang dan waktu. Kamus dapat memberikan informasi dan juga dapat dijadikan suatu media untuk belajar memahami istilah atau arti kata bahasa asing ataupun bahasa suatu daerah sehingga menambah pengetahuan dan wawasan.\r\nMadura sebagai salah satu daerah di Indonesia yang memiliki adat bahasa yang khas. Selain itu, keaneka ragam budaya yang ada di Madura menjadi daya tarik wisatawan untuk berkunjung ke Pulau Madura. Ketrampilan berbahasa sangat dibutuhkan untuk mempermudah berkomunikasi dengan masyarakat madura. \r\nPenulis menggunakan Android sebagai platform media aplikasi ini karena android berbasis open source. Kebutuhan akan informasi sangat penting dan semakin luas pengetahuan pengguna akan bahasa daerah khususnya bahasa Madura dapat terpenuhi serta tidak terbatas ruang dan waktu karena kamus Madura ini diimplementasikan pada perangkat selular yang menggunakan sistem operasi Android versi 2.3 Ginggerbread. Aplikasi kamus mobile bahasa Indonesia Madura berbasis android ini dirancang agar pengguna dapat menambah wawasan dan mengetahui kata-kata dasar bahasa Madura dengan mengakses langsung dari perangkat selular mereka tanpa harus mencari pada kamus cetak konvensional atau menggunakan kamus online.\r\n\r\nKata kunci : Android, Kamus, Indonesia – Madura\r\n', 'Rizky Ardiyansyah Putra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100142'),
(95, '070411100143', 'APLIKASI METODE FUZZY ANALYTIC NETWORK PROCESS (FANP) UNTUK MENDUKUNG KEPUTUSAN PROSES PROMOSI JABATAN DI PT. SURYA MADISTRINDO PAMEKASAN', 'Diana Rahmawati, S.T, M.T', 'Budi Dwi Satoto, S.T, M.Kom', 'Perusahaan pemerintah maupun swasta mempunyai tujuan yang harus dicapai. Pencapaian tujuan perusahaan dapat dilakukan dengan pemanfaatan sumber daya yang dimiliki secara optimal, salah satu sumber daya tersebut adalah sumber daya manusia yang dimiliki oleh perusahaan. Sesuai dengan peraturan yang telah ditetapkan PT. Surya Madistrindo Pamekasan dalam melakukan proses promosi jabatan, maka diperlukan kriteria-kriteria seperti aspek kapasitas intelektual, aspek sikap kerja, dan aspek perilaku yang masing-masing mempunyai sub kriteria tersendiri. Metode yang digunakan adalah metode Fuzzy Analytic Network Process (FANP). Metode FANP sendiri digunakan untuk mencari bobot prioritas kepentingan dari seluruh kriteria dan sub kriteria yang telah ditetapkan dan sebagai proses perangkingan atas bobot kriteria masing-masing data karyawan. Pembobotan diperoleh dari hasil kuesioner yang dilakukan oleh pimpinan perusahaan. Proses perangkingan dilakukan dengan cara mengalikan nilai bobot dari kriteria ke tiap-tiap sub kriteria sehingga mampu menyeleksi karyawan yang berhak menduduki jabatan yang tersedia berdasarkan kriteria-kriteria yang ditentukan. Dari hasil uji coba dalam menyelesaikan studi kasus proses promosi jabatan karyawan menghasilkan nilai akurasi sebesar 80%.\r\n\r\n\r\nKata kunci 	: 	Sistem Pendukung Keputusan, Promosi Jabatan,  Fuzzy Analytic Network Process (FANP)\r\n', 'Robiatul Adawiyah, S.Kom', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100143'),
(96, '070411100144', 'Klasifikasi Dokumen Web Berita Universitas Menggunakan k-NN (K-Nearest Neighbor) ', 'firdaus solihin, S. kom., M. Kom', 'Hermawan, S.T., M.Kom', 'Jumlah dokumen berita di situs web universitas semakin banyak dan up-to-date. Kebutuhan pengunjung akan informasi tersebut semakin tinggi, sedangkan di sisi lain pengguna membutuhkan penemuan informasi yang cepat dan akurat. Penelitian ini menggunakan metode cosine similarityuntuk menghitung kemiripan antar dokumen. Selain itu agar pencarian dokumen mudah ditemukan, maka dokumen diklasifikasikan berdasarkan pada kelas-kelas yang sudah ditentukan sebelumnya (preedefined) menggunakan metode k-NN (k-nearest neighbour). Untuk mempercepat penyampaian hasil pencarian kepada pengguna maka pada aplikasi ini digunakan teknik caching terhadapdokumen-dokumen yang pernah dikembalikan sebelumnya kepada pengguna. Teknik ini dimaksudkan untuk meningkatkan transfer dokumen dengan menyimpan dokumen yang pernah diakses pada cache tersebut, sehingga apabila ada dokumen yang ingin diakses adalah dokumen yang sama maka akses akan dapat dilakukan lebih cepat. Hasil pengujian memperlihatkan bahwa akurasi klasifikasi k-NN untuk dokumen teks berita mampu mencapai 95% saat dokumen diwakili oleh judul dan paragraf pertama (k=20, 25 dan 45) tetapi hanya maksimal 40% saat dokumen diwakili oleh judul dan isi lengkap. Adanya klasifikasi terbukti meningkatkan presisi hasil pencarian dan mempersingkat proes pencarian tersebut. Kehadiran cachemenjadikan waktu pemrosesan query yang telah ada sebelumnya menjadi jauh lebih cepat, rata-rata hanya memerlukan 7 mili detik.\r\n\r\nKata kunci : k-Nearest Neighbour,cosine similaity, cache.\r\n', 'rohmi nur hidayah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100144'),
(97, '070411100145', 'SISTEM PENDUKUNG KEPUTUSAN PENERIMAAN SISWA BARU BERBASIS WEB MENGGUNAKAN METODE ID3 DI SMA HIDAYATUN NAJAH PAMEKASAN', 'Bain Khusnul Khotimah, ST, M.Kom. ', 'Achmad Jauhari, ST, M.Kom.', '\r\nPenyeleksian siswa baru adalah suatu hal yang perlu ditentukan secara tepat dan tepat. Dalam hal penentuan calon siswa baru diperlukan beberapa pertimbangan yang cukup banyak dan rumit yaitu standarisasi nilai, persyaratan masuk sekolah serta kebijakan-kebijakan dari pemerintah lembaga pendidikan  yang sering berubah tiap tahunnya. Maka dari itu perlu untuk merancang sebuah aplikasi untuk membantu panitia penerimaan siswa baru dalam menyeleksi siswa baru. Sehingga nantinya memperoleh siswa yang unggul, berprestasi, dan berkualitas. Decision Tree Learning merupakan satu metode learning yang sangat populer dan banyak digunakan secara praktis. Algoritma Iterative Dychotomizer 3 (ID3) yaitu salah satu metode yang dapat membangun pohon keputusan secara top-down dengan menggunakan information gain sebagai alat ukur efektivitas suatu atribut dalam mengklasifikasikan kumpulan sampel data yang kurang lengkap. Pembuatan tugas akhir ini menghasilkan system pendukung keputusan penerimaan siswa baru yang membantu para panitia dalam menyeleksi para peserta siswa baru. Sistem Pendukung Keputusan Penerimaan Siswa Baru di SMA Hidayatun Najah Pamekasan dapat menentukan calon siswa yang unggul dan berkualitas dalam bidang pendidikan dengan hasil yang lebih baik, cepat dan akurat.\r\n\r\nKata Kunci : Decision Tree Learning,Information Gain , Algoritma Iterative Dychotomizer 3 (ID3)', 'Rudi Sutrisno', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100145'),
(98, '070411100148', 'Sistem Pakar Diagnosa Penyakit Gagal Jantung Menggunakan Metode Radial Basis Function', 'Mulaab, S.Si., M.Kom.', 'Firli Irhamni, ST., M.Kom', 'Penyakit gagal jantung merupakan salah satu darimacam-macam penyakit jantung, pada penderita gagal jantung, detakanjantungnya tidak berjalan secara normal, dalam melakukan aktivitas normal penderita cenderung mudah lelah, Penyebabnya adalah rusaknya otot jantung serta karena adanya beban jantung yang berlebihan, pada saat ini penderita penyakit gagal jantung tiap tahunnya semakin meningkat, dan lebih cenderung mengenai laki-laki daripada perempuan. Oleh karena itu, perkembangan teknologi informasi dan komunikasi menjadi media utama untuk menjembatani permasalahan tersebut. Di bidang medis, peranan teknologi informasi dan komunikasi dikemas dalam suatu wadah informatika medis, sehingga dibuatlah sebuah sistem pakar penyakit gagal jantung yang nantinya diharapkan bisa bermanfaat untuk mengetahui lebih dini penyakit gagal jantung, sehingga dapat ditangani lebih cepat dan mengurangi resiko meninggal dunia, dalam hal ini aplikasi untuk mendiagnosa penyakit gagal jantung menggunakan metode Radial Basis Function, dengan penentuan hidden node menggunakan K-Means Cluster, metode K-Means digunakan karena ketepatan penentuan nilai centroid yang akurat, fungsi aktivasi yang digunakan pada penelitian ini hanya menggunakan fungsi aktivasigaussian, inputan terdiri dari 16 variabel, berdasarkan keluhan dan gejala-gejala yang dialami oleh pasien, data training dan data testing yang digunakan berasal dari rekammedik Rumah Sakit Umum DaerahSidoarjo. Kata Kunci : Radial Basis Function, K-Means, Gaussian', 'Shofiyan Yulis Ekasaputra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100148'),
(99, '070411100152', 'PENGENALAN POLA SENYUMAN BERBASIS EKSTRAKSI FITUR PRINCIPAL COMPONENT ANALYSIS (PCA) DAN LINIER DESCRIMINANT ANALYSIS (LDA)', 'RIMA TRI WAHYUNINGRUM, S.T., M.T', 'HARYANTO, S.T., M.T', 'Citra senyum merupakan salah satu fitur biometrik yang dapat dijadikan sebagai bukti autentik dari seseorang. Sistem pengenalan pola (pattern recognition) secara komputerisasi, akan mengetahui identitas atau ciri diri seseorang. Pengenalan senyum telah banyak diteliti oleh banyak kalangan. Salah satu bentuk penerapan pengenalan pola senyum ini adalah mengetahui senyum seseorang sehingga nantinya senyum tersebut dapat dikenali oleh komputer dan disimpan dalam database. Terdapat dua cara untuk menentukan pola senyuman yaitu secara manual dan otomatis. Secara manual dapat dilakukan dengan kasat mata, sedangkan secara otomatis dapat di tentukan dengan menggunakan suatu sistem. Pada  Tugas Akhir ini, mengidentifikasi senyuman secara otomatis digunakan metode Principal Component Analysis (PCA) dan Linier Descriminant Analysis (LDA), dimana jenis senyuman pada tugas akhir ini dibagi menjadi lima bagian, yaitu senyum manis, senyum mengejek, senyum yang dipaksakan, senyum tertutup dan senyum terbuka. Penggunaan metode ekstraksi fitur  yang tepat dan efisien  sangat menentukan keberhasilan dari sistem pengenalan pola secara keseluruhan. Untuk metode klasifikasi pengenalan pola menggunakan Euclidean Distance atau Manhattan Distance. Dari hasil uji coba menggunakan 175 gambar data pelatihan didapatkan tingkat akurasi PCA adalah 89.8% pada ordered3. Sedangkan hasil uji coba menggunakan PCA & LDA didapatkan tingkat akurasi 100% pada ordered3.', 'SITI KHOLILAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100152'),
(100, '070411100155', 'Pengenalan Tipe Huruf Aksara di Indonesia Menggunakan Edge Direction Matrix (Batak Toba, Kaganga, Carakan, Had Lampung)', 'Bain Khusnul khotimah, S.T.,M.Kom', 'Rima Tri Wahyuningrum, S.T.,M.T', 'Optical Font Recognition (OFR) merupakan  teknik analisa tipe tulisan pada teks atau dokumen yang sangat diminati. Penelitian ini menguji keefektifan penggunaan analisa ekstraksi fitur global berdasarkan analisa statistik pada perilaku piksel tepi citra biner OFR. Salah satu metode OFR berdasarkan pendekatan global adalah Edge Direction Matrix (EDM).  EDM merupakan sebuah metode baru pada ekstraksi fitur untuk citra biner dimana perilaku piksel tepi antara background putih dan pola hitam diambil sebagai fitur pola. Kemudian nilai tersebut disimpan pada matrik EDM1 dan EDM2  sesuai dengan delapan arah sudut. Dari nilai matrik yang terbentuk kemudian akan dihitung berdasarkan enam persamaan EDM sehingga membentuk 22 nilai fitur. Dalam hal ini dataset yang digunakan untuk pengujian berjumlah 1200 data citra yang berasal dari empat aksara kuno yang ada di Indonesia yaitu Aksara Carakan, Aksara Batak Toba, Aksara Had Lampung dan Aksara Kaganga. Setiap aksara mempunyai empat style font yaitu Bold, Bold-Italic, Italic dan Regular. Penelitian ini menggunakan metode Euclidean Distance dalam proses klasifikasi dan pengenalan tipe tulisan sehingga mendapatkan hasil akurasi pengenalan tertinggi mencapai 83,7% pada skenario ke 5 dengan jumlah data ujicoba sebanyak 208 data. ', 'Sulayhah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100155'),
(101, '070411100158', 'AUTO LEVELING BERBASIS FINITE STATE MACHINE (FSM) PADA GAME PEMBELAJARAN BAHASA INGGRIS', 'Arik Kurniawati, S.Kom.,M.T.', 'Ari Kusumaningsih, S.T., M.T.', 'Pengetahuan tentang bahasa Inggris pada jaman globalisasi saat ini sangatlah penting dan menjadi salah satu sarana untuk berkompetisi di segala bidang. Namun demikian, seringkali proses pembelajaran tidak dapat berjalan dengan lancar dikarenakan kurangnya metode pembelajaran yang kurang interaktif. Berangkat dari permasalahan tersebut maka dibangunlah sebuah game yang berunsur edukasi. Game berunsur edukasi harusnya menyenangkan dan tidak terlalu mudah atau terlalu sulit dimainkan  salah satunya dengan penerapan Artifical Intelegent (kecerdasan buatan). Dalam penelitian ini adalah bagaimana pemain mendapatkan tantangan (soal) sesuai dengan kemampuannya (pelevelan mandiri/auto leveling). Sehingga pemain tidak merasa frustasi (jika soalnya terlalu sulit) atau bosan (jika soalnya terlalu mudah). Metode yang dapat digunakan untuk membuat game yang mempunyai pelevelan mandiri adalah metode Finite State Machine (FSM) dan seluruhnya akan diimplementasikan kedalam game engine XNA. Dalam game pembelajaran bahasa Inggris ini terdapat speaking dan reading yang akan memanfaatkan teknologi speech recognition yang terdapat didalam XNA game studio. Dengan melakukan uji coba sistem kepada responden menghasilkan beberapa hal menjadikan game sebagai salah satu media pembelajaran, terciptanya game yang menarik dan menjadi game yang adaptif dengan penerapan perlevelan mandiri. Penggunaan speech recognition dapat meningkatkan kemampuan berbicara dalam bahasa Inggris. \r\n\r\nKata Kunci : Education Game, Automatic Leveling, FSM (Finite State Machine), XNA game engine, Speech Recognition.\r\n', 'Syafrial Nur Maulana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100158'),
(102, '070411100164', 'Implementasi Peramalan Penjualan Produk STARFOOD Menggunakan Metode Moving Average (MA) Dan Single Exponential Smoothing (SES) (Studi Kasus : CV. Wira Usaha Bugar, Kec. Tragah, Kab. Bangkalan)', 'Achmad Jauhari, S.T., M.Kom.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Salah satu komponen penting yang menunjang operasi perusahaan adalah kegiatan memprediksi jumlah penjualan untuk periode selanjutnya. Dengan prediksi yang baik dapat dibuat rencana kerja perusahaan lebih efektif dan efisien. Sehingga dapat meminimalisir terjadinya kelebihan stok barang di gudang yang menyebabkan kerugian bagi perusahaan. Penelitian ini mengidentifikasi pola data penjualan produk STARFOOD di C.V. Wira Usaha Bugar Kecamatan Tragah, Kabupaten Bangkalan. agar mendapatkan metode peramalan yang terbaik berdasarkan pola data penjualan penjualan produk. Oleh karena itu dibutuhkan implementasi yang dapat memprediksi jumlah penjualan tiap minggunya agar perusahaan mendapatkan keuntungan yang maksimal. Dari beberapa hasil tes perhitungan peramalan yang telah dilakukan dapat diambil kesimpulan bahwa proses peramalan penjualan produk STARFOOD menggunakan metodeMoving Average (MA) lebih baik dari pada metode Single Exponential Smoothing (SES), dengan rata-rata bergerak m=12 dan menghasilkan MAPE 12,51%  dari semua produk untukstudikasusdi CV. Wira Usaha Bugar Kec. Tragah, Kab. Bangkalan.', 'Uhdi Sony Pudiardana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100164'),
(103, '070411100166', 'PERANCANGAN ZUCARA SEBAGAI MEDIA PEMBELAJARAN CAPOEIRA BERBASIS ANDROID', 'Cucun Very Angkoso, S.T., M.T', 'Bain Khusnul Khotimah, S.T., M.Kom', 'Pembelajaran/Tutorial pada perangkat selular lebih praktis dibandingkan dengan pembelajaran konvensional tatap muka, karena pengguna dapat belajar dengan fleksibel dimana saja tanpa adanya batasan ruang dan waktu. Pembelajaran mobile dapat memberikan kemudahan dalam memahami sesuatu tanpa mengganggu hal-hal yang berhubungan dengan manusia .\r\nCapoeira sebagai salah satu kebudayaan populer di dunia telah merebut hati penggemarnya dari berbagai kalangan usia, gender, kultur dan lain sebagainya. Karena Capoeira terdapat nilai universal yang mampu menjadikan satu dalam perbedaan, terlebih Capoeira dianggap efektif sebagai salah satu gaya hidup sehat dalam unsur sportnya.\r\nMadura sebuah pulau Indah yang juga tak kalah dalam Capoeira. Disini terdapat suatu kelompok yang fokus dan eksis dalam mempelajari dan mengembangkan Capoeira. Adalah Zungu Capoeira Madura nama dari kelompok ini yang berafiliasi dengan Induknya di Brasil membuat inovasi Zucara sebagai media pembelajarannya. \r\nPenulis menggunakan Android sebagai platform media aplikasi ini karena android berbasis open source. Kebutuhan akan media pembelajaran ini diimplementasikan pada perangkat selular yang menggunakan sistem operasi Android versi 2.3 Gingerbread. Harapan dari aplikasi ini adalah pengguna dapat meningkatkan skill Capoeira dengan mengakses langsung dari perangkat selular mereka.\r\n', 'Wahyu Hakim Fiddin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100166'),
(104, '070411100168', 'Implementasi Algoritma Enkripsi RSA Untuk Aplikasi Komunikasi Berbasis Teks Menggunakan Bluetooth Pada OS Android', 'Cucun Very Angkoso S.T, M.T.', 'Ari Kusumaningsih S.T, M.T', 'Perkembangan teknologi komunikasi yang begitu cepat memicu perkembangan teknologi telpon seluler sebagai salah satu alat komunikasi modern. Komunikasi data yang diimplementasikan juga beragam, teks, gambar bahkan suara. Medium yang digunakan-pun kini beragam baik itu internet, local connection hingga bluetooth. Bluetooth dapat dipilih sebagai alternatif medium untuk menghubungkan satu perangkat dengan perangkat lain. Ditambah lagi dengan perkembangan android yang belakangan ini juga semakin pesat semakin memberi kemudahan untuk betukar data melalui bluetooth. Bluetooth mampu menghubungkan perangkat yang satu dengan perangkat lainnya. Ini kemudian memungkinkan antar perangkat dapat saling bertukar atau berkirim data. Namun, dalam proses pengiriman data tersebut tidak ada yang dapat menjamin keamanannya. Hal ini yang kemudian membuat proses enkripsi menjadi hal yang penting. Data yang dikirim terlebih dahulu dikodekan sedemikian rupa hingga hanya dengan kunci tertentu kode tersebut dapat dibaca. RSA kemudian muncul sebagai salah satu alternatif algoritma yang dapat digunakan menangani proses enkripsi tersebut. RSA memiliki teknik pemfaktoran yang cukup rumit, hal ini membuat tingkat keamanannya cukup tinggi. Selain itu, RSA juga cocok diaplikasikan dalam platform mobile karena memiliki struktur yang asimetris sehingga tidak terlalu membebani sistem yang dimiliki oleh perangkat mobile tersebut. Pengujian aplikasi ini sudah teruji melalui perhitungan manual dan dari pengambilan dua device yang berbeda. ', 'Wahyu Tri Suseno', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100168'),
(105, '070411100169', 'Implementasi Jena dan SPARQL untuk Optimalisasi Pencarian pada Semantik Web', 'Fika Hastarita R, ST., M.Eng', 'Iwan Santosa, ST., MT', 'Search engine saat ini menggunakan mekanisme temu balik informasi dengan hasil yang belum optimal, dikarenakan proses pencarian dilakukan dengan mencocokkan query dengan kata pada konten, serta pembobotan tanpa memperhitungkan relasinya, juga proses pencarian klasik memakai acuan dokumen hypertext yang tidak terstruktur dan masih berupa bahasa alami. Beberapa permasalahan tersebut menyebabkan proses pencarian tidak akurat sesuai dengan kata kunci yang dimasukkan. Untuk menjawab permasalahan tersebut telah dikembangkan sebuah sistem yang disebut web semantik. Pada mekanisme web semantik, proses pencariannya menggunakan dokumen yang sudah terstruktur dan memiliki kemampuan untuk memberikan pengetahuan kepada mesin yaitu Resource Description Framework (RDF). Pada penelitian ini telah dibuat sebuah prototype mesin pencari berbasis web semantik. Teknologi web semantik yang digunakan pada penelitian ini berfokus pada pembuatan dokumen RDF untuk mendeskripsikan metadata menjadi sebuah resource yang memiliki susunan semantik (subjek-predikat-objek) dan menggunakan SPARQL yang mengambil modul ARQ pada Jena Library untuk mekanisme pencariannya. Penelitian ini telah menghasilkan dokumen RDF dari domain detikinet.com sebagai sumber pencarian yang valid sesuai struktur RDF dan standarisasi dokumen RDF dari W3C, juga menghasilkan prototype mesin pencari dengan optimalisasi Jena dan SPARQL yang menghasilkan nilai rata-rata precission 0.52, recall 0.63, f-measure 0.53.', 'Yanuari Dwi Prianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100169'),
(106, '070411100170', 'Segmentasi Parasit Malaria Dalam Sel Darah Menggunakan Operasi Morfologi Dan Transformasi Watershed', 'Rima Tri Wahyuningrum, S.T.,M.T.', 'Fitri Damayanti, S.Kom., M.Kom', 'Malaria disebabkan oleh intraseluler parasit bersel tunggal yang dimiliki genus Plasmodium yang menginfeksi manusia dengan memasuki aliran darah. Dampak malaria secara geografis memiliki tingkat  transmisi tertinggi di daerah tropis dan subtropics, yaitu di negara-negara yang memiliki tingkat pertumbuhan penduduk yang besar (termasuk Indonesia). Pendeteksian parasit malaria dapat dilakukan mencari titik kromatin. Bila tidak ada titik kromatin pada sel darah merah  maka sel darah merah tersebut di anggap sebagai sel darah merah sehat. Pendeteksian titik kromatin secara manual akan memerlukan waktu yang lama. Proses segmentasi diharapkan sebagai langkah pertama untuk memudahkan pendeteksian titik kromatin karena segmentasi merupakan  salah  satu  faktor yang sangat penting dalam analisis suatu gambar. Penelitian ini melakukan segmentasi sel darah merah dengan menggunakan operasi Morfologi, deteksi tepi Canny, dan transformasi Watershed. Data yang digunakan sebanyak 15 data citra dan setiap citra akan diuji dengan empat macam operasi Morfologi kemudian citra hasil Morfologi akan diuji sebanyak 16 kali percobaan dengan parameter masking, sigma, high threshold (HT), dan low threshold (LT) dari deteksi tepi Canny. Hasil pengujian kemudian disegmentasi dengan menggunakan transformasi Watershed. Perhitungan tingkat akurasi dilakukan dengan membandingkan koordinat tiap piksel citra hasil segmentasi dengan citra ground truth  dan menghasilkan nilai rata-rata akurasi sebesar 39.3 %.', 'Yenni Rahmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100170'),
(107, '070411100176', 'IMPLEMENTASI PERAMALAN PENJUALAN MENGGUNAKAN \r\nMETODE EXPONENTIAL SMOOTHING \r\n(Studi Kasus : Penjualan Produk Aksesoris Olahraga di Toko Trend Soccer) ', 'Achmad Jauhari, S.T., M.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Peramalan memperkirakan sesuatu pada waktu-waktu yang akan datang berdasarkan data masa \r\nlampau yang dianalisa secara ilmiah, khususnya menggunakan metode perhitungan statistika. \r\nSemakin banyak jumlah permintaan konsumen terhadap aksesoris olahraga maka secara \r\notomatis penjualanya akan meningkat pula.hal ini akan tergantung terhadap banyaknya  \r\npenjualan aksesoris olahraga kepada konsumen.  Selama ini  toko trend soccer  tidak pernah \r\nmenggunakan sistem peramalan.  Tidak adanya peramalan mengakibatkan kurang efisien \r\nterhadap keuntungan toko tersebut karena tidak ada peramalan penjualan tiap mingguannya. \r\noleh karena itu dibutuhkan implementasi peramalan yang bisa memprediksi jumlah penjualan \r\ntiap minggunya agar mengetahui besarnya penjualan tiap minggunya Maka untuk meramalkan \r\nmenggunakan metode Single Exponential Smoothing, dan Double Exponential Smoothing dan \r\nditerapkan pada tools winqsb, Program WinQSB merupakan program komputer yang dapat \r\nmelakukan peramalan berkaitan dengan data-data berpola konstan, trend atau musiman, dengan \r\nmasing-masing dari pola data tersebut menggunakan metode dalam WinQSB yang berbeda. \r\nDalam pola-pola tersebut juga terdapat metode-metode yang ada.Dari hasil peramalan yang \r\ndilakukan  menggunakan metode  single exponential smoothing dan double exponential \r\nsmoothing  dengan nilai  ? 0,1,  ? 0,3, ? 0,5.  diperoleh hasil terbaik dengan nilai MSE dan \r\nMAPE terkecil dengan nilai rata-rata MSE sebesar 62.64  dan nilai MAPE sebesar 12.64%. \r\nKata kunci : Peramalan,  Single Exponential Smooting (SES), Double Exponential Smooting \r\n(DES), Mean Square Error (MSE). \r\n ', 'Zayn Firdausi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100176'),
(108, '070411100177', 'IMPLEMENTASI ALGORITMA ENKRIPSI DES UNTUK APLIKASI MOBILE CHAT PADA OS ANDROID', 'Cucun Very Angkoso S.T. M.T', 'Ari Kusumaningsih S.T. M.T.', 'Pengiriman informasi melalui jaringan elektronik dalam permasalahan ini adalah chatting dengan media server memiliki kerentanan dalam keamanan data yang dikirimkan . Layanan tersebut diketahui memiliki beberapa kelemahan, yaitu kelemahan terhadap masalah keamanan sistem. Kelemahan itu dikarenakan data yang dikirim kedalam server menggunakan koneksi dengan jaringan global sehingga lebih rentan terhadap serangan hacker.Pada penelitian ini untuk menjamin keamanan dan kerahasiaan informasi pada komunikasi yang menggunakan jaringan IP mobile, dilakukan proses enkripsi dan dekripsi terhadap informasi yang akan dikirimkan. Enkripsi dilakukan pada saat pengiriman dengan cara mengkonversi informasi asli menjadi informasi yang terenkripsi sedangkan dekripsi dilakukan pada saat penerimaan dengan cara mengkonversi informasi terenkripsi menjadi informasi asli. Jadi informasi yang dikirimkan selama proses pengiriman adalah data informasi yang terenkripsi, sehingga informasi asli tidak dapat diketahui oleh pihak yang tidak berhak. Informasi asli hanya dapat diketahui oleh penerima dengan menggunakan kunci rahasia.Penggunaan algoritma enkripsi Data Encryption Standard (DES) merupakan upaya untuk mencegah kebocoran data chat ke pihak lain. Sehingga dalam menggunakan aplikasi chat tidak dikhawatirkan terjadinya kebocoran informasi pribadi. Karena berdasarkan hasil uji coba terbukti bahwa cipherteks yang dihasilkan telah sesuai dengan hasil perhitungan menggunakan algoritma enkripsi DES. dan telah diuji menggunakan beberapa aplikasi DES test vector. ', 'Zhomi Fero Anista', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100177'),
(109, '070411100178', 'Segmentasi Citra Untuk Menentukan Ukuran Pakaian dengan Menggunakan Metode Naive bayes', 'Eza Rahmanita, S. T., M. T.', 'Meidya Koeshardianto, S. Si., M. T.', 'Unsur estetika dalam berpakaian terkadang menjadi salah satu permasalahan tersendiri bagi sebagian besar orang. Termasuk salah satunya permasalahan menentukan ukuran pakaian agar terlihat sesuai dengan ukuran tubuhnya. Dahulu untuk mendapatkan ukuran pakaian yang sesuai harus dilakukan secara manual menggunakan alat bantu berupa meteran, dengan pemanfaatan teknologi ini dapat menentukan ukuran pakaian yang sesuai dengan mudah.\r\nPenelitian ini terdiri dari dua tahap yaitu proses segmentasi citra dan pengklasifikasi sesuai ukuran pakaian dengan menggunakan Metode Naïve Bayes. Pada proses segmentasi terdiri dari beberapa langkah, yaitu mengubah citra RGB menjadi Grayscale, dari citra Grayscale ke Biner dengan tresholding menggunakan Otsu, dan dihitung tinggi dan lebar objek, kemudian proses klasifikasi menggunakan metode Naïve Bayes. Metode Naïve Bayes ini digunakan untuk proses pengklasifikasian ukuran pakaian berdasarkan hasil ukur objek. Sehingga pada hasil akhir dapat diketahui hasil ukuran yang sesuai.\r\nCitra didapat dari 2 cara yaitu, dari webcam/ kamera secara realtime dan file berformat .bmp. Berdasarkan uji coba proses segmentasi konversi dari citra grayscale ke biner dengan menggunakan tresholding otsu lebih memudahkan dalam memisahkan antara objek dengan latar belakang berdasarkan nilai ambang yang telah ditentukan. Setelah didapatkan ukuran objek maka diklasifikasikan dengan menggunakan metode Naïve Bayes. Dengan demikian, penelitian ini dapat dikembangkan lagi dengan metode pembelajaran lainya.\r\nKata kunci: Grayscale, Biner, Tresholding, Otsu, Naïve Bayes', 'Septian Yudha Adi Perwira', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/070411100178'),
(110, '080411100001', 'SISTEM PERAMALAN PENJUALAN JANGKA PENDEK SPARE PART SEPEDA MOTOR MENGGUNAKAN NEURAL NETWORK\r\n(Studi Kasus : Suzuki Kemayoran Bangkalan)', 'Mula’ab, S.Si, M.Kom', 'Fika Hastarita R.,ST, M.Eng', 'Spare part merupakan salah satu bagian penting dalam pengoperasian mesin pada sepeda motor. Peningkatan jumlah penjualan spare part yang tidak terduga saat proses tune-up menyebabkan kesulitan dalam pelayanan yang terbaik kepada konsumen. Demikian juga sebaliknya, apabila terjadi penurunan jumlah penjualan spare part, maka akan menyebabkan penumpukan spare part di gudang. Oleh karena itu diperlukan sistem peramalan yang mampu meramalkan penjualan spare part pada periode berikutnya. Sistem peramalan ini menggunakan metode Jaringan Syaraf Tiruan algoritma Propagasi Balik dengan momentum untuk meramalkan jumlah penjualan spare part  pada bulan berikutnya. Data yang telah tersimpan dihitung menggunakan epoh dan learning rate yang berbeda. Dari hasil uji coba system, maka dapat disimpulkan bahwa  dengan menggunakan semua data sebagai data training dan menggunakan learning rate 3.5 dan dengan epoh 200 akan menghasilkan tingkat kesalahan 0.0622716.', 'Ana Qaimah L.M.D.R', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100001'),
(111, '080411100002', 'RANCANG BANGUN APLIKASI SEARCH ENGINE DAN SISTEM PENDETEKSI PLAGIARISME MENGGUNAKAN METODE LSA-SOM', 'Hermawan, ST., M.Kom', 'Dr. Indah Agustien S, S.Kom, M.Kom.', 'Plagiarisme adalah mencuri gagasan, kata-kata, kalimat atau hasil penelitian orang lain dan menyajikannya seolah-olah sebagai karya sendiri. Metode LSA merupakan salah satu metode dari beberapa metode untuk pendeteksian plagiarisme. Metode Latent Semantic Analysis (LSA) adalah sebuah teori dan metode untuk menggali dan mempresentasikan konteks yang digunakan sebagai sebuah arti kata dengan memanfaatkan komputasi statistik untuk sejumlah corpus yang besar. Penggunaan LSA konvensional bersifat sekuensial dikarenakan masih belum adanya klasterisasi sehingga proses analisa akan dilakukan secara global pada keseluruhan dokumen yang tentunya memerlukan waktu komputasi yang besar. Untuk itu dapat digunakan teknik klasifikasi tak terawasi seperti penggunaan Self Organizing Map (SOM) dan pengujian similaritas secara global hanya dilakukan pada centroid masing-masing kluster untuk kemudian dilakukan pengujian similaritas secara lokal pada klaster yang terpilih yang menjadi bagian dari klaster tersebut. Pada hasil penelitian  LSA-SOM memiliki rata-rata precision 94.4% dan recall 64.04%. \r\nKata kunci : Cosine Similarity, Latent Semantic Analysis, plagiarisme Self Organizing Map, Singular Value Decomposition\r\n', 'ARIS PRAMA AULIA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100002'),
(112, '080411100003', 'Rancang Bangun Sistem Pendukung Keputusan Penentuan Pemberian Bantuan RASKIN Menggunakan Metode SMARTER\r\n(Studi Kasus : Kecamatan Batuan Kabupaten Sumenep)\r\n', 'Andharini Dwi Cahyani, S.Kom, M.Kom', 'Fika Hastarita Rachman, ST, M.Eng', 'Seiring dengan perubahan dalam paradigma pembangunan ekonomi yang tidak berfokus dalam penanggulangan masalah kemiskinan, maka sudah sepantasnya apabila pemerintah dituntut untuk dapat mengentaskan masalah kemiskinan melalui program-program pengentasan kemiskinan. Salah satu dari banyak program pengentasan kemiskinan yang dilaksanakan oleh pemerintah yaitu program RASKIN. Metode yang dipakai dalam penelitian ini adalah SMARTER (Simple Multi Attribute Rating Technique Exploiting Ranks). Metode SMARTER merupakan bagian dari metode Multiple Criteria Decision Making (MCDM). Metode ini dipilih karena metode SMARTER merupakan suatu bentuk model pendukung keputusan yang digunakan dalam pengambilan keputusan dengan kriteria yang beragam yang nantinya dapat digunakan untuk memecahkan masalah pengambilan keputusan. Penelitian yang dilakukan di Kecamatan Batuan, Kabupaten Sumenep ini menggunakan parameter kemiskinan yaitu sumber air minum, berapa kali makan per hari, kemampuan membeli daging, Ayam, susu per minggu, bahan bakar masak, jumlah pakaian baru, sumber penerangan, aset minimal, lapangan pekerjaan, tempat buang air besar, jenis lantai rumah, jenis dinding rumah, luas lantai rumah, kemampuan berobat jika sakit dan ijazah terakhir.  Pada penelitian ini, sistem pendukung keputusan menggunakan metode SMARTER mampu menganalisa kriteria yang nantinya dapat menentukan penduduk mana yang layak menerima bantuan RASKIN. Sistem ini memiliki tingkat akurasi 80,5% jika dibandingkan dengan data rill pada tahun 2012.\r\n   \r\nKata Kunci : RASKIN, Sistem Pendukung Keputusan. SMARTER\r\n', 'Ayu Winda Istara', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100003'),
(113, '080411100007', 'IMPLEMENTASI QUESTION ANSWERING SYSTEM (QAS) MENGGUNAKAN METODE RULE BASED PADA TERJEMAHAN ALQUR’AN BAHASA INDONESIA', 'Fika Hastarita Rachman, ST, M.Eng.', 'Firdaus Solihin, S.Kom., M.Kom.', 'Al Qur’an memiliki dasar pengetahuan yang lengkap dan merupakan sumber hukum bagi umat islam. Kendala yang banyak dihadapi oleh orang islam dalam memahami Al Qur’an adalah masalah bahasa, karena banyak umat islam yang tidak memahami bahasa arab. Untuk membantu permasalahan tersebut akan dibuat sistem implementasi question answering system (QAS) menggunakan metode rule based pada terjemahan Al Qur’an bahasa Indonesia. Data yang digunakan dalam pembuatan sistem ini adalah ayat Al Qur’an dalam terjemah bahasa Indonesia. Rule based system adalah suatu sistem yang memproses informasi dengan sekumpulan aturan yang terdapat di dalam basis pengetahuan untuk menghasilkan informasi baru. Question answering system adalah sistem yang digunakan untuk menemukan informasi yang mungkin sesuai dengan pertanyaan yang diajukan oleh user. Sistem ini sebelum masuk ke rule based akan di proses terlebih dahulu dalam wordmatch scoring, yakni pencocokan kata yang ada dalam pertanyaan dan jawaban. Question answering system ini memungkinkan user menggunakan bahasa alami dalam memberikan pertanyaan pada sistem. Dari hasil uji coba penelitian ini dapat disimpulkan bahwa nilai recall sudah bagus, tetapi nilai precision masih sangat jelek, dikarenakan masih banyak data yang kurang relevan ditampilkan. Hal ini dikarenakan sistem yang masih belum menentukan inti dari pertanyaan.', 'Hasan Sulthoni', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100007'),
(114, '080411100008', 'Sistem Informasi Akademik Berbasis Web Di Sekolah Tinggi Ilmu Administrasi Dan Manajemen Kepelabuhanan (STIAMAK) Barunawati Surabaya', 'Sigit Susanto Putro S.Kom,. M.Kom', 'Yoga Dwitya Pramudita S.Kom., M.Cs', 'Sekolah  Tinggi  Ilmu  Administrasi  dan  Manajemen Kepelabuhan  (STIAMAK) Barunawati  Surabaya  saat  ini  proses pengolahan data akademiknya masih belum terintegrasi. Aplikasi yang digunakan untuk penyimpanan dan pengolahan data saat ini adalah  aplikasi  kantor  standart.  Banyak  kendala  yang  dihadapi oleh  staf  akademik  maupun  staf  pengajar  dalam  urusan administrasi  akademiknya  seperti  pengolahan  data  mahasiswa, pencarian dokumen-dokumen atau berkas yang memakan waktu cukup  lama  dan  sering  ditemukan  data  yang  tidak  konsisten karena media  penyimpanannya  yang  belum  tersentralisasi. Dari berbagai masalah  tersebut maka muncul kebutuhan akan  sebuah sistem  yang  mampu  terintegrasi  dan  mampu  memproses  data akademik,  yang  sering  disebut  dengan  SIAKAD  atau  sistem informasi akademik. Sistem Informasi Akademik Sekolah Tinggi Ilmu Administrasi dan Manajemen Kepelabuhanan  (STIAMAK) Barunawati  Surabaya  ini  dapat  mengintegrasi  seluruh  data akademik  yaitu  data  mahasiswa,  data  dosen,  data  mata  kuliah, data nilai akademik berupa Kartu Hasil Studi (KHS) dan transkip nilai, data absensi, penyusunan Kartu Rencana Studi  (KRS) dan data tugas akhir. Dengan adanya Sistem Informasi Akademik ini dapat  membantu  staf  akademik  dalam  pengelolaan  data-data akademik sehingga dapat terintegrasi. ', 'Muhammad Mizwar Mallufi Faruq', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100008'),
(115, '080411100009', 'SISTEM PENDUKUNG KEPUTUSAN PEMINATAN SISWA BARU SMA MENGGUNAKAN METODE ORESTE', 'ANDHARINI DWI CAHYANI,S.KOM.,M.KOM', 'FIKA HASTARITA RACHMAN,ST.,M.ENG', 'Berkembang pesatnya kemajuan teknologi saat ini sangat berpengaruh juga dalam dunia pendidikan. Karena perkembangan teknologi tersebut, maka dibutuhkan para generasi muda yang mampu untuk bekerja sesuai tuntutan jaman. Demi meningkatkan mutu pendidikan, Kemendikbud saat ini mengeluarkan kurikulum baru yaitu kurikulum 2013. Sehingga di periode tahun ajaran 2013/2014 sudah mulai diterapkan kurikulum 2013. Dimana peminatan program studi sudah ditentukan saat awal masuk kelas X (sepuluh). Salah satu SMA yang telah menerapkan kurikulum tersebut adalah SMA Negeri 1 Kamal. Di kurikulum 2013 ini, peminatan siswa dalam menentukan program studi berdasarkan parameter-parameter yang digunakan. Beberapa parameter tersebut diantaranya yaitu angket peminatan siswa, nilai UN, Psikotest, Placement Test dan Nilai Raport SMP. Dalam hal ini, maka dibuatkanlah sebuah aplikasi sistem pendukung keputusan peminatan siswa baru di SMA Negeri 1 Kamal sebagai alat bantu atau bahan rekomendasi dalam menentukan peminatan siswa di SMA Negeri 1 Kamal. Metode perhitungan yang digunakan yaitu menggunakan metode Oreste. Oreste merupakan teknik analisa dalam pengambilan keputusan dari beberapa alternatif pilihan. Melalui uji coba dan perbandingan data hasil menghasilkan prosentase keakuratan 89,9%, yaitu dari 317 data yang diuji, terdapat 285 kesamaan hasil peminatan oleh sistem. Sehingga sistem ini dapat menjadi bahan rekomendasi bagi sekolah dalam menentukan peminatan.', 'RIO RENDY BATUBARA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100009'),
(116, '080411100010', 'KLASIFIKASI STATUS GIZI BALITA MENGGUNAKAN KOHONEN SELF ORGANIZING MAP\r\n', 'Bain Khusnul Khotimah, S.T., M.Kom.', 'Aeri Rachmad, S.T., M.T.', 'Aplikasi klasifikasi status gizi balita ini dibuat untuk mempermudah dilakukannya kontrol terhadap perkembangan status gizi balita terutama di tempat penelitian ini dilakukan yaitu Kecamatan Arosbaya, tepatnya di Puskesmas Arosbaya. Aplikasi ini juga dapat digunakan sebagai media informasi karena dapat diisi dengan informasi yang berkaitan dengan Puskesmas Arosbaya sendiri. Untuk menentukan status gizi balita di aplikasi ini, digunakan metode Kohonen Self Organizing Map, dengan mengambil data dari Puskesmas Arosbaya. Parameter yang digunakan ada empat, yaitu: usia, jenis kelamin, tinggi badan, dan berat badan. Karena metode K-SOM hanya dapat digunakan untuk menentukan cluster maka dibuatlah sebuah rule untuk menentukan klasifikasi data pada kelas tertentu.Umumnya untuk mengetahui status gizi balita hanya menggunakan tiga parameter, namun pada penelitian ini akan menggunakan empat parameter. Hasil klasifikasi akan dibagi menjadi 3 kelas, yaitu: kelas 1 (status gizi kurang), kelas 2 (status gizi normal), dan kelas 3 (status gizi normal). Hasil penelitian menunjukkan bahwa sebanyak 88,17% (82 balita) balita berstatus gizi kurang, 8,6% (delapan balita) balita berstatus gizi normal, dan 3,23% (tiga balita) balita berstatus gizi lebih dengan nilai learning rate dan MSE akhir masing-masing 0,09436 dan 0,000792353. Sedangkan nilai akurasi, sencitivity, dan specificity masing adalah 100%.\r\n\r\nKata Kunci: Kohonen Self Organizing Map, status gizi balita, Puskesmas Arosbaya\r\n', 'Uhty Zunairoh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100010'),
(117, '080411100011', 'PENERAPAN METODE RADIAL BASIS FUNCTION NETWORK DENGAN K-MEANS CLUSTER UNTUK PERAMALAN KEBUTUHAN STRAW', 'Fika Hastarita Rachman, S.T, M.Eng', 'Budi Dwi Satoto, ST, M.Kom', 'Berawal dari permintaan akan Straw (sperma beku) sapi yang tinggi untuk menghasilkan bibit unggul. Bidang Peternakan Dinas Kelautan, Perikanan dan Peternakan (DKPP) Sampang masih belum dapat menentukan berapa banyaknya Straw yang dibutuhkan pada saat permintaan itu datang. Sering terjadi stok Straw yang tersedia kurang memenuhi permintaan para peternak sapi, atau malah sebaliknya persediaan Straw yang ada masih banyak. Data yang digunakan adalah data penggunaan Straw di Kabupaten Sampang bulan Januari 2008 sampai Desember 2011. Peramalan kebutuhan Straw merupakan proses untuk memperkirakan jumlah kebutuhan Straw di masa datang. Metode peramalan yang digunakan dalam sistem ini adalah metode Radial Basis Function Network (RBFN) dengan penentuan hidden node menggunakan K-Means Cluster. Metode K-Means digunakan karena ketepatan penentuan nilai centroid yang akurat, mudah dan penentuannya awalnya secara random. Sedangkan dalam penentuan nilai error menggunakan MAPE (Mean Absolute Percentage Error) dan MSE (Mean Square Error). Dalam uji coba sistem diketahui bahwa sistem mampu memprediksi kebutuhan Straw satu bulan kedepan. Dari evaluasi kinerja sistem diketahui bahwa nilai MAPE dan MSE terkecil diperoleh pada jumlah cluster=3 yang mempunyai Nilai MAPE 10.12%  dan MSE 0.0081.', 'Dwi Nuzulul Heriyanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100011'),
(118, '080411100012', 'APLIKASI DAN DESAIN MODEL DECISION AID PELANGGAN\r\nPADA E-COMMERCE TOKO BATIK TULIS MADURA\r\n', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Yeni Kustiyah Ningsih, S.Kom., M.Kom.', 'Toko Batik Tulis Madura merupakan salah satu toko yang telah beroperasi sejak tahun 2011 dengan\r\nmenggunakan website e-commerce. Walau telah menggunakan model e-commerce, website tersebut memiliki\r\nkekurangan yaitu belum ada fitur rekomndasi untuk memudahkan konsumen mencari barang yang ingin\r\ndibelinya. Penelitian ini bertujuan membuat rekomendasi dengan decision aid untuk membantu pelanggan\r\ndalam memilih produk di website Toko Batik Tulis Madura. Teknik pengumpulan analis data terdiri dari\r\nStudi Literatur yang berhubungan dengan decision aid dan multi criteria, Observasi dilakukan terhadap\r\nwebsite Toko Batik Tulis Madura dan Interview dilakukan kepada pemilik website Toko Batik Tulis Madura.\r\nPembuatan implementasi pada Penelitian ini menggunakan model waterfall. Jenis decision aid yang akan\r\ndiimplementasikan adalah Multi Criteria Filtering. Metode pembobotan yang digunakan pada Multi Criteria\r\nFiltering yaitu Decision Matrix. Hasil ujicoba dengan jumlah sample percobaan sebanyak 50 kali data\r\nperconbaan pencarian, presentase akurasi adalah 94% dan error adalah 6%. Hasil uji kelayakan dari beberapa\r\nkuisoner dihasilkan bahwa performa yang dimiliki tool ini cukup baik dan tool ini layak untuk diintegrasikan\r\nserta digunakan dalam website e-commerce.\r\n\r\nKata Kunci: Decision, Aid, Multi, Criteria, Filtering', 'Ardiyanto Setiawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100012'),
(119, '080411100013', 'EKSTRAKSI PENAMBAHAN STOPLIST DARI KATA UMUM DOKUMEN HASIL KLASIFIKASI PRETOPOLOGY', 'Fika Hastarita Rachman, ST.,MEng.', 'Firdaus Solihin, SKom.,Mkom.', 'Dokumen teks bahasa Indonesia sangat melimpah dan setiap waktu bertambah. Dalam proses pencarian, banyak dokumen yang dihasilkan menjadi kurang relevan jika tidak sesuai dengan keinginan pengguna. Stopword merupakan kata yang “tidak relevan”, namun sering muncul dalam dokumen. Kumpulan stopword disebut stoplist. Pada sistem temu balik informasi, asumsi yang ada adalah dengan menghapus stoplist, maka mengurangi jumlah kata yang akan diproses. Sedangkan kata umum juga sering digunakan pada bidang tertentu. Sehingga perlu dilakukan ekstraksi kata umum dari dokumen hasil klasifikasi dan melakukan perbandingan efektifitas antara aplikasi pencarian-1 menggunakan penghapusan stoplist dengan aplikasi pencarian-2 menggunakan penghapusan stoplist dan kata umum untuk meningkatkan relevansi dan waktu proses pencarian dokumen. Hasil uji coba klasifikasi pretopology dengan 25 dokumen teknik, 25 ekonomi dan 25 pertanian diperoleh nilai rata-rata recall dan precision sebesar 90% dan 76%. Uji coba pencarian dengan 6 query terhadap 285 dokumen teknik, 193 ekonomi dan 268 pertanian pada aplikasi pencarian-1 diperoleh nilai rata-rata recall, precision, f-measure dan waktu proses adalah 96.7%, 22.5%, 30.6% dan 0.239 detik. Sedangkan aplikasi pencarian-2 dengan threshold kata umum 1% adalah 96%, 67%, 76.5% dan 0.098 detik. Sehingga dapat dikatakan bahwa aplikasi pencarian-2 lebih efektif dari pada aplikasi pencarian-1.\r\nKata kunci: Sistem temu balik informasi, Stoplist, Klasifikasi Pretopology, Kata Umum.', 'Mohammad Mastur', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100013');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(120, '080411100014', 'PENERAPAN METODE ANALYTICAL HIERARCHY PROCESS DAN FUZZY MULTI-OBJECTIVE PROGRAMMINGUNTUK PEMILIHAN SUPPLIER', 'Bain Khusnul K, S.T.,M.Kom', 'Andharini Dwi C, S.Kom.,M.Kom', 'Pemilihan  supplier merupakan salah satu isu penting, karena  pemilihan supplier menjadi bagian dari sebuah  supply chain maka hubungan tersebut akan memiliki pengaruh yang sangat besar terhadap kelangsungan produksi.Pada tugas akhir ini dianalisa mengenai  Analytic Hierarchy Process (AHP) dan Fuzzy Multi-Objective Programming (FMOP) untuk pemilihan supplier di Industri Batik Podhek Pemekasan. Perhitungan AHP akan diperoleh nilai bobot tiap kriteria pemilihan supplier yang nantinya akan jadi nilai masukan pada FMOP. FMOP memberikan solusi memaksimalkan dan meminimalkan tujuan.Setelah dilakukan proses perhitungan faktor kriteria yang paling memberikan kontribusi terhadap pemilihan supplier adalah kriteria harga (0.52), kualitas (0.2) dan tingkat cacat (0.2), dan keterlambatan pengiriman (0.08). Dari hasil penelitian diperoleh bahwa supplier paling optimum adalah  Toko Utara. Untuk bahan baku kain dengan batasan pembelian 0 - 500 lembar didapatkan hasil z1 = 380, z2 = 415, z3 = 85, z4 = 250. Untuk bahan baku pewarna dan malan dengan batasan pembelian 0 - 250 kg didapatkan hasil z1 = 0, z2 = 220, z3 = 30, z4 = 125, dan z1 = 147.5, z2 = 225, z3 = 25, z4 = 125.\r\n\r\nKata kunci  :Supply Chain Management (SCM), pemilihan supplier, Analytical Hierarchy Process, Fuzzy, Multi-Objective Programming.', 'Helyatin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100014'),
(121, '080411100016', 'SISTEM PEROLEHAN CITRA BERBASIS ISI MENGGUNAKAN FITUR COLOR AUTOCORRELOGRAM PADA HSV COLOR SPACE UNTUK CITRA BATIK', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Sistem Perolehan Citra Berbasis Isi (SPCI) adalah sebuah teknik pencarian citra menggunakan isi visual, untuk mencari citra pada basis data citra sesuai dengan permintaan pengguna dalam suatu bentuk citra query. Fitur yang terkait isi visual seperti bentuk, warna, dan tekstur adalah fitur utama sebuah citra. Dalam penelitian ini sistem dibangun dengan memanfaatkan fitur warna. Fitur berdasarkan warna merupakan atribut yang paling dominan dalam sebuah citra terutama citra batik. Warna adalah fitur visual yang paling melekat pada indera manusia. Color Autocorrelogram digunakan sebagai ekstraksi fitur warna dari komponen hue dari citra dalam ruang warna HSV. Setelah didapat fitur vektor Autocorrelogram, selanjutnya dilakukan proses pencocokan citra antara citra query dan citra basis data dengan menggunakan Histogram Intersection Distance. Data yang digunakan dalam penelitian ini adalah citra batik dari delapan kelas yang berbeda, yaitu batik Bali, batik Bangkalan, batik Cirebon, batik Jogja, batik Pamekasan, batik Pekalongan, batik Solo, dan batik Sumenep. Setiap kelas terdapat sebanyak 25 citra. Hasil eksperimen dari tiga skenario adalah precision tertinggi pada skenario ke tiga dengan akurasi perolehan sebesar 70%. Hal ini dikarenakan semakin besar rentang nilai kemiripan yang ditampilkan maka semakin banyak citra relevan yang ter-retrieve.', 'Widiastuti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100016'),
(122, '080411100021', 'Sistem FAQ Konsultasi Dokter Gigi Menggunakan Algoritma Winnowing dan Synonym Replacement', 'Fika Hastarita R. S.T.,M.Eng.', 'Firdaus Solihin, S.Kom.,M.Kom.', 'Kesehatan gigi amat penting bagi manusia, namun tidak semua orang masa kini memiliki waktu untuk pergi ke dokter gigi dalam rangka pencegahan penyakit gigi yang lebih kronis, akibatnya banyak orang mendatangi dokter gigi ketika keadaan giginya sudah rusak parah. Untuk menangani permasalahan ini, sangatlah tidak efisien untuk membangun aplikasi konsultasi konvensional. Mengingat jumlah pasien yang tidak sedikit dan kemungkinan terus bertambah kedepannya. Metode yang digunakan dalam penelitian ini adalah deteksi kemiripan dengan bantuan metode Winnowing dan didukung oleh Synonym Replacement. Dengan penyusunan FAQ dalam penerapannya menjadikan konsultasi akan semakin mudah. Uji coba dilakukan dengan menguji beberapa jenis Synonym Replacement dan diketahui melalui ujicoba Synonym Replacement Versi 4 yang terbaik untuk membantu pendeteksian dengan peningkatan angka deteksi sebesar 40% dibandingkan tanpa Synonym Replacement, serta dengan merubah konstanta algoritma Winnowing dan diketahui pula bahwa konstanta prime = 7, n-gram dan n-window = 3 adalah yang terbaik untuk deteksi kalimat, dengan angka deteksi mencapai 58%.', 'Wildan Faizzani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100021'),
(123, '080411100025', 'Perbandingan Metode Transformasi Kekre dan Segmentasi Warna HSV untuk Sistem Perolehan Citra Berbasis Isi', 'Rima Tri Wahyuningrum, ST., MT', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom', 'Sistem Perolehan Citra Berbasis Isi (SPCI) merupakan teknik pencarian berdasarkan konten visual untuk mencari citra yang sesuai dengan keinginan pengguna.Secara umum, SPCI memiliki dua tahapan utama, yaitu ekstraksi fitur dan pengukuran kemiripan. Fitur yang digunakan dalam penelitian ini adalah fitur warna karena fitur warna merupakan fitur yang umum digunakan, dan dapat merepresentasikan warna sesuai dengan visual mata manusia. Ekstraksi fitur warna dilakukan dengan menggunakan metode Transformasi Kekre, dan Segmentasi Warna HSV. Hasil dari ekstraksi fitur warna digunakan untuk pengukuran kemiripan antara citra query dengan basis data citra. Pengukuran ini menggunakan metode Euclidean Distance.Metode Transformasi Kekre dan Segmentasi Warna HSV diaplikasikan pada 170 citra bunga dari 17 kelas yang berbeda. Uji coba dilakukan terhadap 15 citra query dan diperoleh hasil yang lebih baik pada Segmentasi Warna HSV dengan precision sebesar 75% dan recall sebesar37%. Sedangkan precision dan recall pada Transformasi Kekre adalah 49% dan 25%. Hal ini dikarenakan proses awal Segmentasi Warna HSV yang melakukan konversi citra ke ruang warna HSV dianggap lebih baik dalam membedakan warna dibandingkan  dengan Transformasi Kekre yang juga melakukan konversi citra, tetapi ke dalam format grayscale.', 'Rika Awalul Awalida', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100025'),
(124, '080411100026', 'Penerapan Metode Collaborative Filtering untuk Menentukan Keterkaitan Topik Tugas Akhir', 'Firdaus Solihin,S.Kom.,M.Kom', 'Fika Hastarita R, S.T.,M.Eng', '       Seiring dengan perkembangan teknologi informasi banyak aktifitas manusia yang dapat dipermudah dan dikomputerisasi. Dalam tugas akhir ini memberikan alternatif untuk mempermudah mendapatkan rekomendasi topik tugas akhir. Ketika user mengakses sebuah topik tugas akhir maka output yang diperlukan tidak hanya menampilkan satu dokumen saja,melainkan dokumen-dokumen terkait dengan topik itu hendaknya juga ditampilkan, sehingga hal ini dapat mempermudah terhadap user yang melakukan pencarian refrensi topik tugas akhir. Collaborative filtering merupakan salah satu metode yang saya pakai untuk mendapatkan rekomendasi itu. Data yang dipakai menggunakan pilihan topik secara personal sehingga didapatkan rekomendasi topik tugas akhir yang berbeda-beda untuk setiap user. Collaborative Filtering, sebuah metode yang menganalisa teks yang biasa diakses oleh orang lain. Sebelum metode collaborative filtering diterapkan sebelumnya dilakukan proses pencarian biasa / VSM Vektor Space Model. \r\n     Besarnya jumlah kesamaan kata yang dimiliki oleh setiap dokumen terhadap data baru, ditambah dengan besar kecilnya nilai perkalian bobot kata antara dokumen baru dengan dokumen representasi, serta besar kecilnya perkalian nilai vector antara dokumen baru dan dokumen representasi, sangat mempengaruhi kedalam kategori mana suatu dokumen tugas akhir akan ditempatkan.\r\n\r\nKata kunci: collaborative filtering, vector space model (VSM)', 'Ach. Suryadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100026'),
(125, '080411100027', 'Penerapan Exponential Smoothing Berbasis Ordinary Least Square Berdasarkan Ordered Weighted Aggregation  Untuk Peramalan Persediaan Ikan Teri\r\nDi  PT. Madura Prima Interna\r\n', 'Bain Khusnul Khotimah ST.,M.Kom', 'Budi Dwi Satoto St.,M.Kom', 'Peramalan sangat penting bagi sebuah perusahaan untuk merumuskan srategi di masa yang akan datang. PT. Madura Prima Interna adalah perusahaan yang bergerak di bidang eksportir ikan teri. Setiap harinya dibutuhkan ikan teri dari beberapa supplier. Untuk mengetahui kebutuhan persediaan terhadap ikan teri maka dibutuhkan sistem peramalan agar permintaan pasar dapat terpenuhi. Penggunaan Exponential Smoothing berbasis Ordinary Least Square (OLS) dan berdasarkan Ordered Weighted Aggregation (OWA) karena memberikan prioritas tinggi terhadap observasi baru dan  diharapkan akan mendapatkan hasil ramalan yang lebih bagus dengan nilai error kecil. Hasil ujicoba menggunakan data pembelian  periode 2010 dengan parameter bebas 0.1 sampai dengan 0.9 . Hasil parameter optimal adalah 0.45 dengan tingkat kesalahan 0.067. Dari hasil analisa yang paling bagus yaitu menggunakan parameter alpha 0.45, karena nilai errornya lebih kecil, \r\n\r\n', 'Moh.Laili', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100027'),
(126, '080411100028', 'PREDIKSI KETEPATAN KELULUSAN MAHASISWA MENGGUNAKAN ALGORITMA C5.0', 'Mula’ab, S.Si, M.Kom', 'Fika Hastarita R.,S.T, M.Eng', 'Selama ini prediksi ketepatan kelulusan mahasiswa belum pernah dilakukan di jurusan Teknik Informatika, Universitas Trunojoyo, Madura. Prediksi ketepatan kelulusan mahasiswa perlu dilakukan untuk mengetahui ketepatan kelulusan seorang mahasiswa. Mahasiswa dinyatakan lulus tepat waktu apabila menempuh jenjang pendidikan strata 1 selama 8 semester atau 4 tahun. Salah satu teknik data mining yang dapat digunakan untuk melakukan prediksi adalah dengan menggunakan metode decision tree. Metode ini akan menghasilkan pohon dan rule keputusan yang nantinya akan dijadikan sebagai acuan dalam proses prediksi. Sistem prediksi ini menggunakan algoritma C5.0 yang merupakan salah satu metode decision tree. Data mahasiswa yang terdiri dari 37 atribut dan 1 kelas, dihitung menggunakan rumus information gain untuk menghasilkan pohon dan rule keputusan. Dari uji coba yang telah dilakukan, terbentuk pohon keputusan yang berbeda-beda. Perbedaan ini disebabkan oleh jumlah data training yang digunakan pada setiap partisi data jumlahnya berbeda. Pohon keputusan partisi A menggunakan teknik postpruning dengan jumlah data training lebih besar daripada data testing mempunyai nilai akurasi tertinggi sebesar 90.32 %, sehingga pohon keputusan ini dipilih sebagai acuan dalam proses prediksi. Kata kunci : Decision tree, rule, algoritma C5.0, information gain, postpruning', 'Lindung Budiyantoro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100028'),
(127, '080411100029', 'Implementasi Sistem Pakar Pada Pengambilan Keputusan Penentuan Tindakan Medis di Poli Mata Berbasis Web', 'Fika Hastarita Rachman S.T., M.Eng', 'Firli Irhamni S.T., M.Kom', 'Diagnosa penyakit mata dengan sistem informasi yang baik merupakan inti permasalahan pada penelitian ini. Diketahui pada studi kasus ini, dokter sebagai seorang pakar memiliki keterbatasan waktu dalam melayani pasien selama 24 jam, bahkan pada hari-hari selanjutnya. Dokter hanya bekerja tiga hari dalam satu minggu, dan 6 jam pada tiap kali melakukan pelayanan. Adanya asisten dokter juga belum dapat membantu pelayanan ini bekerja denga maksimal. Hal ini lah yang menjadi kurang maksimalnya peranan dokter bagi pasien. Terbatasnya keberadaaan dokter sebagai pakar dan minimnya waktu pelayanan dari dokter pada pasien nya serta minimnya pengetahuan seseorang terhadap gejala atas sakit yang dirasakan, sangat mendukung terdapatnya sistem yang mampu memberikan diagnosa dan solusi mengenai gejala yang diketahui. Berdasarkan hal tersebut, penelitian ini bertujuan untuk membuat aplikasi sistem pakar  berbasis web, yang  dapat mendiagnosa gejala penyakit pada mata. Metode yang digunakan dalam pengembangan aplikasi adalah Fuzzy Mamdani dengan Inferensi Forward Chainning. Input yang dibutuhkan pada sistem ini adalah data jenis gejala dan gejala umum yang diketahui, sedangkan output adalah nilai tingkat keparahan penyakit yang nantinya mengarah pada solusi dari tiap kasus. Dari hasil uji coba sistem yang dilakukan oleh dokter diperoleh nilai keakuratan sebesar 80% dari 10 kasus yang dilakukan. \r\n\r\nKata kunci : Metode Fuzzy Mamdani, forward chaining , diagnosa penyakit mata.\r\n', 'Rizky Maulidya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100029'),
(128, '080411100030', 'PREDIKSI KEPUASAN KONSUMEN HOTEL MENGGUNAKAN SIGMOID BIPOLAR \r\n(STUDI KASUS : WETA INTERNATIONAL HOTEL SURABAYA)\r\n', 'Andharini Dwi Cahyani. S.Kom., M.Kom', 'Moch. Kautsar Sophan. S.Kom., M.MT', 'Di era globalisasi seperti saat ini, bisnis perhotelan layaknya jamur di musim hujan. Hal ini terjadi karena meningkatnya perkembangan dunia pariwisata yang menuntut adanya bisnis perhotelan yang mendukung kegiatan kepariwisataan. Baik di Indonesia maupun di negara manapun, bisnis perhotelan bukanlah hal yang asing bagi warga negaranya. Namun semakin berkembangnya bisnis perhotelan, hal ini tidak sebanding dengan sistem pemrosesan data yang ada, masih banyak bisnis yang melakukan proses pengolahan datanya yang bersifat manual dkarenakan lebih memudahkan dalam perhitungan data hingga menjadi arsip. Dalam system ini akan dibangun sebuah system yang akan mem-prediksi kepuasan konsumen Weta Internasional Hotel Surabaya dengan fungsi aktivasi sigmoid bipolar. Neural Network berguna untuk menghubungkan system ke dalam perilaku seperti manusia dan dengan adanya fungsi aktivasi sigmoid bipolar akan menghasilkan output dengan range [-1,1]. Dengan menggunakan metode ini, tingkat akurasi data yang paling besar dipengaruhi oleh fitur fitur yang dimiliki dalam metode ini. Tingkat akurasi terbesar diperoleh dengan Hidden layer 6, Maks epoh 1500, Learning rate 1 dan toleransi error sebesar 10-3dengan akurasi 87,20%. Aplikasi ini bertujuan untuk dapat memprediksikan tingkat  kepuasan  para konsumen kepada pihak management Weta International Hotel Surabaya dalam segi peningkatan kualitas perusahaan.\r\n', 'Gilang Adetiandini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100030'),
(129, '080411100031', 'RANCANG BANGUN APLIKASI MEDIA PEMBELAJARAN HURUF ALFABET UNTUK PERANGKAT MOBILE ANDROID', 'Cucun Very Angkoso S.T. M.T', 'Ari Kusumaningsih S.T. M.T.', 'Media pembelajaran merupakan salah satu solusi untuk mempermudah penyampaian pesan yang dimaksud dalam sebuah materi pembelajaran karena akan mempercepat anak didik untuk memahami pelajaran atau materi yang dimaksud. Penggunaan perangkat mobile berbasis sistem operasi Android sebagai media pembelajaran sudah banyak dikembangkan karena aplikasinya memiliki tampilan yang user friendly dengan interaksi layar sentuh yang  menarik untuk selalu digunakan terutama oleh anak-anak.\r\nDalam media pembelajaran yang dikembangkan, terdapat pengenalan pola dari karakter alfabet yang berfungsi untuk menguji pemahaman karakter dari pengguna setelah mempelajari bentuknya lewat tutorial. Pengujian dilakukan secara langsung dengan menuliskan bentuk dari huruf kapital. Dengan menggunakan mesin pengenalan pola yang telah dikembangkan oleh Tesseract, mesin open source yang umum digunakan sebagai Optical Character Recognition (OCR) akan dilakukan koreksi dari huruf kapital yang ditulis.\r\nAplikasi media pembelajaran berfungsi dengan baik pada perangkat dengan berfungsinya semua tombol dan atribut aplikasi. Mesin Tesseract yang digunakan memiliki tingkat akurasi pengenalan 100% pada huruf kapital dengan jenis Arial, Calibri dan Times New Roman. Selain itu aplikasi tersebut juga memiliki respon postif dari anak-anak yang telah menggunakannya. 100% dari sampel uji coba menyatakan bahwa aplikasi tersebut menarik dan membantu dalam mengenal huruf alfabet.\r\n\r\n', 'Heru Prayogo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100031'),
(130, '080411100033', 'GAME EDUKASI SIMULASI UMRAH BERBASIS MOBILE ANDROID', 'Arik Kurniawati, S.Kom., M.Kom', 'Dr. Arif Muntasa, S.Si., M.T.', 'ABSTRAK \r\n Game Edukasi Simulasi Manasik Umrah Berbasis Android merupakan program pembelajaran dalam dunia game seluler. Game android ini memberikan gambaran ibadah umrah yang disertai dengan gerakan-gerakan dan suara dalam dunia 2 Dimensi dengan menggunakan bahasa pemorograman actionscript 3.   Pada Tugas Akhir yang dibuat ini mempelajari gerakan- gerakan Manasik Umrah yang diadaptasikan menjadi sebuah game dalam dunia Android. Perancangan game aplikasi ini mengunakan beberapa kegiatan sesuai dengan rukun dan sunnah Umrah sebenarnya. Setiap kegiatan memiliki aksi sendiri-sendiri sesuai dengan kegiatan tersebut. Jika aksi yang dilakukan benar mendapatkan nilai sebagai hadiahnya dan jika salah dalam melakukan aksi mendapat kejutan dari masing-masing aksi yang salah.  Aplikasi ini ditujukan untuk kebutuhan pendidikan bagi orang- orang yang ingin melakukan Manasik Umrah supaya saat melakukan ibadah Umrah sudah mengetahui terlebih dahulu apa yang harus dilakukan saat melaksanakan salah satu dari rukun atau sunnah Umrah. Dari hasil kuisioner yang disebar pada sepuluh responden, sebanyak 80% mengatakan tampilan game menarik dan menyenangkan.   \r\nKata Kunci: Manasik Umrah, Game Android, Flash, Game selular', 'aqil lubby', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100033'),
(131, '080411100035', 'PENGENALAN WAJAH MENGGUNAKAN KERNEL PRINCIPAL COMPONENT ANALYSIS (KPCA)', 'Rima Tri Wahyuningrum, S.T., M.T', 'Fitri Damayanti, S.Kom., M.Kom.', 'Permasalahan machine learning dan pattern recognition bukanlah hal yang baru. Hal ini dapat dilihat dari aplikasi yang digunakan masyarakat sekarang ini. Seiring dengan perkembangan teknologi komunikasi, semakin berkembang pula teknik dan algoritma yang digunakan untuk menyelesaikan permasalahan machine learning dan pattern recognition. Permasalahan yang paling umum adalah pengenalan obyek. Dalam hal ini adalah wajah. Pengenalan wajah ini di adopsi dari kemampuan manusia membedakan wajah antar satu orang dengan yang lain. Pada penelitian ini akan dibuat sistem pengenalan wajah. Pada proses awal akan dilakukan ekstraksi fitur menggunakan Kernel Principal Component Analysis (KPCA) untuk menentukan karakteristik dari wajah. Kemudian dilanjutkan dengan proses klasifikasi menggunakan Mahalanobis Distance. Hasil yang dicapai pada penelitian ini sesuai uji coba yang telah dilakukan pada basis data ORL adalah : 96,23%, pada basis data YALE adalah: 95,46%, dan pada basis data BERN adalah: 95,15%. Ketiganya berada pada acak 5 dengan masing-masing kombinasi data pelatihan pose ke 3,5,7,8,10 pada ORL, 3,5,7,8,10 pada YALE, dan 3,5,7,9,10 pada BERN. Sehingga dapat disimpulkan bahwa metode ekstraksi fitur KPCA yang dikombinasikan dengan metode klasifikasi Mahalanobis Distance cukup baik digunakan sebagai pengenalan wajah.', 'YULIA FATMAWATI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100035'),
(132, '080411100037', 'RANCANG BANGUN GAME IQRA’ SEBAGAI GAME EDUKASI MENGENAL HURUF HIJAIYAH ', 'Dr. Indah Agustien S., S. Kom, M. Kom', 'Rima Tri Wahyuningrum, S. T., M. T', 'Teknologi saat ini mengalami banyak perubahan yang sangat pesat, terutama dibidang multimedia, sebab perkembangan tekhnologi yang semakin pesat akhir- akhir ini akan berdampak kepada aspek yang lainnya. Diera teknologi yang sudah modern multimedia terutama game tidak hanya dibuat untuk sekedar bermain saja, tetapi digunakan dalam pembuatan media pembelajaran yang sangat menyenangkan dengan memanfaatkan beberapa software.\r\nSaat ini pembuatan game edukasi sangat berkembang banyak di tengah- tengah masyarakat terutama dikalangan anak-anak telah banyak memainkan berbagai jenis game, game yang dibuat dalam Tugas Akhir (TA) ini adalah game Iqra’ yang berbasis game edukasi.\r\nGame Iqra’ ini merupakan sebuah permainan yang bertujuan untuk memperkenalkan huruf hijaiyah, mulai cara membacanya sampai memberi harokat. Dalam game ini pengguna selain belajar,  juga menikmati beberapa permainan yang ada seperti menebak huruf hijaiyah yang sudah dipelajari pada menu sebelumnya, sehingga dapat melatih logika serta imajinasi pada anak. Baca tulis Al-qur’an hanya digunakan ketika anak anak berada di dalam kelas TPQ dan TPA dan dalam waktu terbatas dengan metode belajar yang sangat membosankan dan kurang menarik. Maka dari itu, game ini dirancang menjadi game yang menarik serta menyenangkan dan dapat meningkatkan kemampuan anak anak dalam mengenal dan membaca huruf hijaiyah. Berdasarkan hasil ujicoba kepada pengguna bahwa geme ini user friendly. 60% responden menyatakan game ini masih sulit dimainkan, 70%responden menyatakan game ini menarik. Sisi materi 90% responden sangat membantu dalam permainan game Iqra’ ini.\r\nKata kunci : game Iqra’, edukasi, huruf hijaiyah, anak\r\n', 'achmad vicky faisal', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100037'),
(133, '080411100039', 'PENGENALAN KARAKTER PLAT NOMOR SEPEDA MOTOR MENGGUNAKAN METODE CONNECTED COMPONENT ANALYSIS DAN EUCLIDEAN DISTANCE', 'Rima Tri Wahyuningrum,S.T,M.T.', 'Bain Khusnul Khotimah S.T, M.Kom', 'Dalam suatu area parkir sebuah gedung instansi atau pertokoan, selalu ditemukan petugas pintu masuk parkir yang bertugas mencatat plat nomor kendaraan pada karcis yang berfungsi sebagai karcis masuk yang biasanya dilakukan secara manual (dilihat dan dicatat), sehingga rentan kesalahan. Maka diperlukan adanya suatu sistem pencatat plat nomor kendaraan secara otomatis, sehingga memudahkan dan membantu meningkatkan kecepatan dalam  mencatat plat nomor kendaraan di area parkir supaya lebih efektif dan efisien. Pada penelitian ini dibuat sistem pengenalan karakter plat nomor kendaraan. Pada proses awal dilakukan segmentasi menggunakan metode Connected Component Analysis, setelah itu dilakukan pengenalan menggunakan Euclidean Distance untuk mengukur kemiripan antara data pelatihan (training) dan data ujicoba (testing). Melalui proses testing citra plat nomor ini dapat diketahui. Dari ujicoba yang telah dilakukan menggunakan metode segmentasi Connected Component Analysis berhasil melakukan segmentasi huruf dan angka dengan persentase rata – rata 85.25%. sedangkan pada pengenalan metode Euclidean Distance dapat mengenali karakter dengan tingkat akurasi 58.2%\r\nKata kunci : Connected Component Analysis, Plat Nomor, Pengenalan Karakter, Euclidean Distance.', 'Rusmiati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100039'),
(134, '080411100041', 'Model Penjualan Produk Unggulan Batik Khas Pamekasan Berbasis Electronic Commerce', ' Moch. Kautsar Sophan, S.Kom, M.MT', 'Bain Khusnul Khotimah, S.T., M.Kom      ', 'Kabupaten Pamekasan merupakan salah satu pusat industri dan perdagangan batik tulis yang dapat diandalkan sebagai salah satu sumber pendapatan daerah. Batik tulis Madura, khususnya batik tulis Pamekasan memiliki corak dan design yang khas. Penulis meneliti tentang pembuatan Model Penjualan Produk Unggulan Batik khas Pamekasan berbasis Electronic Commerce. Tujuan penelitian ini adalah Membangun model e-commerce yang interaktif untuk mendukung potensi perindustrian dan perdagangan kabupaten Pamekasan serta mempermudah transaksi penjualan produk unggulan batik tulis khas Pamekasan. Model e-commerce yang diterapkan adalah business to customer (B2C). Metodologi dalam mengerjakan penelitian ini adalah metode SDLC (Software Development Life Cycle), dengan menggunakan SDLC waterfall. Berdasarkan hasil analisis kuisioner yang dibagikan kepada pelanggan dan umum yaitu sebanyak 50 responden, yang mencakup beberapa pertanyaan mengenai fitur-fitur pada website. Simpulan yang dapat diambil yaitu pemodelan yang dibuat cukup baik untuk diimplementasikan menjadi website e-commerce. Hal ini dibuktikan dari hasil kuisoner menunjukkan rata-rata persentase responden yang menjawab setuju mencapai 53%. \r\n\r\nKata kunci : Batik, E-Commerce, B2C, Model\r\n', 'Murni Rotifah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100041'),
(135, '080411100044', 'RANCANG BANGUN SISTEM PENCARIAN DAN HIRARKI PASAL-PASAL TENTANG LALU LINTAS DAN ANGKUTAN JALAN DENGAN MENGGUNAKAN VECTOR SPACE MODEL\r\n', ' Firdaus Solihin, S.Kom.,M.Kom', 'Hermawan, S.T.,M.Kom', 'Sosialisasi UU nomor 22 tahun 2009 merupakan hal yang penting, namun kompleksitas dan banyaknya aturan yang terkandung membuat masyarakat kesulitan dalam memahaminya. Berbagai sosialisasi dan kampanye safety riding telah dilakukan, namun masih banyaknya penyimpangan yang dilakukan para pengguna jalan mengindikasikan akan diperlukannya suatu alternatif media yang tepat dan akurat sebagai sarana untuk sosialisasi. Konsep sistem pencarian berbasis information retrieval (IR), dapat digunakan untuk proses sosialisasi melalui media internet. Pembangunan IR pada penelitian ini menggunakan konsep vector space model (VSM). VSM merupakan proses penghitungan kemiripan antar pasal yang direpresentasikan dalam suatu model ruang vektor. Selanjutnya dibentuk hirarki pada pasal-pasal hasil dari proses retrieve-nya. Berdasarkan hasil pengujian sistem, didapatkan nilai minimal cosine similarity terbaik dengan treshold 0,1. Dengan presentase rata-rata precision 58,6 %, presentase rata-rata recall nya mencapai 92,4 % dan rata-rata presentase f-measure nya 65,5 %. Hasil dari pengujian efektifitas sistem pada masyarakat, dapat dikatakan bahwa aplikasi ini sangat membantu dan memiliki penerimaan yang baik disisi pengguna, dengan presentase sangat baik 20 % , baik 72 %, cukup baik 24,7 % dan  buruk 3,4 %.', 'Azizi Fahmi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100044'),
(136, '080411100045', 'Rancang Bangun Aplikasi SCM disertai peramalan Bahan Produksi menggunakan Metode Radial Basis Function Network', 'Fika Hastarita R, S.T., M.Eng.', 'Firli Irhamni, S.T, M.Kom.', 'Kebutuhan bahan garam oleh PT. Elitestar Primajaya adalah hal yang utama, karena selama ini Perusahaan hanya mengandalkan inventori atau stok gudang untuk memenuhi kebutuhan produksinya. Maka dibuatlah aplikasi berupa SMS Gateway untuk memberi informasi kebutuhan produksi garam ke petani, untuk itu dengan adanya SMS Gateway ke Petani garam atau Pemasok diharapkan mampu meningkatkan kebutuhan garam yang masuk. Untuk Penjualannya, Perusahaan tetap menggunakan SMS Gateway untuk memberikan info mengenai ketersediaannya garam jadi ke Pelanggan. SMS ke Pemasok disertai dengan Peramalan. Metode peramalan yang digunakan adalah metode Radial Basis Function (RBF) dengan penentuan hidden node menggunakan K-Means Cluster. Metode ini merupakan salah satu metode pembelajaran baru dari jaringan syaraf tiruan yang memiliki tingkat akurasi yang baik dibandingkan dengan metode konvensional lainnya. Hal ini yang akan mempengaruhi performa dari desain yang dibuat dan dengan pemanfaatan metode ini, didapat keakuratan berdasarkan nilai MAPE (Mean Absolute Percentage Error) dan MSE (Mean Square Error). Sedangkan metode K-Means digunakan karena ketepatan penentuan nilai centroid yang akurat, mudah dan penentuannya awalnya secara random. Dari hasil pengujian sistem menghasilkan 4 cluster dengan nilai MAPE 13.042%  dan MSE 0.004 dan hasil peramalan periode berikutnya sebesar 3853.039 ton.\r\n', 'Nurhadi Kusdianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100045'),
(137, '080411100046', 'Manajemen Workflow Layanan Akademik Berbasis Business Process Management System (BPMS)', 'Hermawan S.T., M.Kom', 'Yeni Kustiyahningsih, S.Kom., M.Kom', 'Layanan akademik merupakan usaha yang dilakukan oleh perguruan tinggi untuk memberikan kemudahan pada pemenuhan kebutuhan mahasiswa dalam hal yang berkaitan dengan kegiatan akademik. Untuk mendapatkan suatu layanan akademik yang efektif dan efisien diperlukan pemodelan dengan menggunakan BPMS. BPMS menyediakan visualisasi model proses bisnis dengan berbagai fasilitas pendukung runtime service, yang mampu menjembatani antara kebutuhan strategi bisnis dan teknologi informasi. Melalui penggunaan BPMS yang didukung pemodelan yang praktis mampu mengoptimalkan efisiensi penggunaan waktu, tenaga dan biaya baik selama proses pembangunan maupun implementasinya. Dari model dan desain yang digunakan pada penelitian ini didapatkan implementasi sistem yang handal untuk transaksi real time yang memenuhi kebutuhan proses bisnis yang kompleks, yaitu pada layanan akademik perguruan tinggi.', 'Didik Mawardi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100046'),
(138, '080411100047', 'KLASIFIKASI DATA MEDIS DENGAN MENGGUNAKAN ALGORITMA CART', 'Bain Khusnul Hotimah,S.Kom.,M.Kom', 'Yeni Kustiyahningsih,S.Kom.,M.Kom', 'Konsep pohon merupakan salah satu konsep teori graf yang paling penting. Pemanfaatan pohon dalam kehidupan sehari-hari adalah untuk menggambarkan hierarki dan pemodelan persoalan, contohnya algoritma pohon keputusan  CART. Pohon keputusan adalah model prediksi menggunakan struktur pohon atau struktur berhirarki. Pohon keputusan merupakan salah satu metode klasifikasi yang paling populer karena mudah untuk dipahami. CART merupakan algoritma pohon keputusan yang sering digunakan untuk membuat suatu pohon keputusan karena memiliki tingkat akurasi yang tinggi dalam menentukan keputusan. Pada penelitian ini dibangun aplikasi untuk mengklasifikasi data medis. Aplikasi data medis ini menggunakan algoritma CART yang merupakan algoritma pohon keputusan yang sering digunakan karena memiliki tingkat akurasi yang tinggi dalam menentukan keputusan. Dari hasil ujicoba pengukuran kinerja algoritma menggunkanan 2 skenario yang telah dilakukan, dapat disimpulkan bahwa pada skenario 1 Breast Cancer merupakan ujicoba paling efektif karena akurasi yang dihasilkan sama-sama mencapai 92% pada algoritma CART 150:50 dan 100:100 sebesar 92%. Sedangkan algoritma CART memiliki kinerja (precision, recall, dan  accuracy) yang lebih tinggi. dibandingkan algoritma CART Diabetes. Ini terlihat dari nilai akurasi CART 150:50 sebesar 70% sedangkan untuk CART Diabetes 100:100 sebesar  68%.\r\n\r\nKata kunci : Pohon Keputusan, CART, Klasifikasi Data Medis, Breast Canser, Diabetes.\r\n\r\n', 'Mega Septi Yolanda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100047'),
(139, '080411100048', 'APLIKASI PENENTUAN KELAYAKAN PEMBANGUNAN INSTALASI BARUDENGAN METODE SIMPLE ADDITIVE WEIGHTING (SAW) (Studi kasus : KONSUIL Bangkalan)\r\n', 'Achmad Jauhari, S.T.,M.Kom', ' Sigit Susanto Putro, S.Kom. M.Kom', 'Konsuil merupakan lembaga non profit yang bergerak dibidang keselamatan instalasi listrik. Proses penentuan kelayakan instalasi ini berdasarkan beberapa kriteria yakni resistansi pembumian, tataletak titik beba, gambar perkawatan, denah bangunan, dan simbol pelengkap. Untuk memudahkan dalam penentian sebuah instalasi itu layak pakai maka di butuhkan sistem pendukung keputusan . metode yang di pakai dalam sistem ini yaitu SAW\r\nMetode SAW (simple additive weighting) merupakan salah satu metode tang dapat di gunakan dalam sistem pendukung keputusan. Konsep dasar metode SAW adalah mencari penjumlaan terbobot dari ranting kinerja pada setiap alternatif pada suatu atribut.\r\nDari hasil uji coba yang dilakukan, tingkat kecocokan hasil seleksi metode SAW yaitu 90% sehingga sistem ini dapat dijadikan bahan pertimbangan dalam penentuan kelulusan instalasi listrik.\r\n', 'Fathul Bahruli', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100048'),
(140, '080411100049', 'SISTEM PENGAMBILAN KEPUTUSAN PENGAJUAN \r\nKREDIT BANK MENGGUNAKAN \r\nMETODE REGRESI LOGISTIK ORDINAL \r\n', 'Mula\'ab S.T., M. Kom', 'fika hastarita, S.T.,M. Eng', 'Untuk mengantisipasi penyelesaian kredit macet yang dapat mempengaruhi kesehatan bank sehingga perlu untuk analisis kelayakan  pemberian pada calon debitur.Pada penelitian ini akan di buat sistem untuk mengetahui debitur termasuk pada kategori kredit lancar, dalam perhatian khusus, kurang lancar, dan macet. Metode yang digunakan adalah metode regresi logistik untuk menentukannya, variabel yang di gunakan dalam penelitian ini adalah penghasilan perbulan, jumlah pinjaman, jaminan, jangka waktu, biaya hidup perbulan, tabungan, margin, usia, jenis kelamin, pekerjaan, pendidikan terakhir. Objek pada penelitian ini adalah kredit yang terdapat di Bank BPRS. Sistem pendukung keputusan menggunakan metode Regresi Logistik Ordinal sangat cocok  digunakan   untuk   penentuan Kelayakan kredit  berdasarkan  kriteria   yang  sudah ditentukan. Karena hasil output mendekati keakuratan dengan nilai akurasi mencapai 98%.\r\n\r\nKata kunci : regresi logistik, kredit, ordinal.\r\n', 'Mohammad Syaiful Hakim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100049'),
(141, '080411100050', 'PENGENALAN WAJAH MENGGUNAKAN EKSTRAKSI FITUR DIAGONAL PRINCIPAL COMPONENT ANALYSIS (DIAPCA)', 'Rima Tri Wahyuningrum,S.T.,M.T.', 'Fitri Damayanti,S.Kom.,M.Kom.', 'Pada umumnya kemajuan teknologi untuk mendeteksi wajah bukanlah hal yang baru lagi. Pengenalan wajah merupakan bagian dari pattern recognition. Salah satu bentuk penerapan pengenalan wajah ini yaitu membedakan wajah antar satu orang dengan yang lain.Pada penelitian ini akan dibuat sistem pengenalan wajah menggunakan ekstraksi fitur Diagonal Principal Component Analysis (DiaPCA) untuk menentukan karakteristik dari wajah. Setelah itu dilakukan pengukuran kemiripan antara data pelatihan (training) dan data uji coba (testing) menggunakan metode klasifikasi Euclidean Distance. Melalui proses citra wajah ini dapat diketahui identitas dari seseorang. Alasan menggunakan ekstraksi fitur DiaPCA pada tugas akhir ini karena DiaPCA mengubah citra wajah asli menjadi  citra wajah diagonal dengan memadukan informasi dari baris dan kolom pada citra asli untuk menemukan beberapa blok yang berguna atau struktur informasi yang diakui oleh citra asli, misalnya struktur daerah mata, hidung dan lain-lain. Dari ujicoba aplikasi menggunakan klasifikasi Euclidean Distance diperoleh akurasi pengenalan terbaik pada basis data ORL, YALE dan BERN masing-masing 94,16%, 92%, dan 94,06%. Ketiganya berada pada skenario Terurut D.\r\nKata kunci : Diagonal Principal Component Analysis (DiaPCA), pengenalan wajah, Euclidean Distance.\r\n', 'Maulidiah Purnamasari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100050'),
(142, '080411100052', 'PENGELOMPOKAN KUALITAS KELAS PADA SISWA MENGGUNAKAN INDEKS DAVIES-BOULDIN SOM (SELF ORGANIZING MAP)', 'Bain Khusnul K,ST.,M.Kom', 'Firli Irhamni, ST, M. Kom', 'ABSTRAK\r\nData yang terdapat pada SMA Wachid Hasyim 2 Taman-Sepanjang merupakan data siswa yang masih mentah sehingga data tersebut perlu diolah. Pengolahan data dengan mengelompokan (Clustering) data-data tersebut memiliki beragam metode salah satunya adalah SOM (Self Organizing Map). Untuk menvalidasi data setelah Penggunaan distance matrix digunakan IDB (Indeks Davies-Bouldin). IDB dalam SOM bertujuan untuk meningkatkan akurasi validasi hasil analisa data. Pada akhirnya penganalisaan data dengan studi kasus SMA Wachid Hasyim 2 Taman-Sepanjang ini bertujuan untuk mengetahui tingkat kemiripan siswa dalam satu kelompok (per kelas). Metode SOM mampu mengelompokan data yang berdekatan untuk dicari kemiripannya berdasarkan pola. Kemiripan data pada pengelompokan siswa yang dijadikan tiga cluster dengan learning rate 0.6 serta epoch 10, 20, 30  dengan MSE terkecil = 41.42 di epoch 30 pada 245 data training. Sedangkan yang dijadikan tiga sampai dengan sembilan Cluster dengan learning rate 0.6 serta epoch 10, 20, 30 dengan MSE terkecil = 25.04 di epoch 20 pada cluster  ke-4 dengan  245 data training. Nilai terkecil pada pemvalidasian Cluster dengan IDB menggunakan tiga sampai dengan sembilan Cluster pada 245 data training berada pada  cluster ke-9 dengan nilai IDB = 37.44  dan hasilnya  kurang akurat karena kelas yang terbentuk hanya dua kelompok.\r\n\r\n\r\nKata kunci:  Clustering, SOM, Eucledian Distance, IDB, SMA Wachid Hasyim 2 Taman-Sepanjang\r\n', 'Hamiyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100052'),
(143, '080411100053', 'PERBANDINGAN METODE PRINCIPAL COMPONENT ANALYSIS (PCA) DAN METODE TWO DIMENSIONAL PRINCIPAL COMPONENT ANALYSIS (2DPCA) DALAM PENGENALAN JENIS KELAMIN BERDASARKAN CITRA WAJAH ', 'Rima Tri Wahyuningrum, S.T., M.T', 'Cucun Very Angkoso, S.T., M.T', 'Seiring dengan berkembangnya teknologi, teknik biometrika juga semakin berkembang, seperti pengenalan pola iris mata, pengenalan pola senyum, pengenalan ekspresi wajah dan lain sebagainya. Teknik ini digunakan untuk identifikasi wajah manusia, salah satu contohnya yaitu pengenalan jenis kelamin (gender recognition). Sebelum berkembangnya penelitian dalam teknik biometrika,  pengenalan identitas seseorang masih menggunakan kartu identitas dan password. Berbagai macam metode sudah banyak digunakan dalam pengenalan jenis kelamin. Pada penelitian ini membandingkan metode Principal Component Analysis (PCA) dan Two-Dimensional Principal Component Analysis (2DPCA). Metode ini adalah metode yang digunakan dalam proses ekstraksi fitur untuk menentukan ciri dari wajah. Untuk proses klasifikasi jenis kelaminnya menggunakan metode Canberra Distance. Uji coba dilakukan pada 200 data yaitu 100 citra wajah laki-laki dan 100 citra wajah perempuan dengan 7 skenario uji coba. Berdasarkan hasil uji coba pada sistem ini menunjukkan bahwa metode Principal Component Analysis (PCA) dapat mengenali jenis kelamin dengan akurasi terbaik yaitu 82.5% pada skenario 6 dengan 15 eigen (160 data training dan 40 data testing) sedangkan metode Two Dimensional Principal Component Analysis (2DPCA)  dapat mengenali jenis kelamin dengan akurasi terbaik yaitu 87.5% pada skenario 7 dengan 15 eigen (160 data training dan 40 data testing).', 'Malika Balqis', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100053'),
(144, '080411100055', 'Rancang Bangun Game Pengenalan Huruf, Angka, dan Nyanyian Anak- Anak Sebagai Game Edukasi Pembelajaran Bagi Anak PAUD', 'Dr. Indah Agustien S., S. Kom, M. Kom', 'Rima Tri Wahyuningrum, S. T., M. T', 'Saat ini penggunaan teknologi banyak mengalami perubahan yang sangatlah besar di bidang Multimedia, oleh karena itu perkembangan teknologi yang semakin pesat akhir-akhir ini akan berdampak pada aspek yang ada. Pada era teknologi yang sudah modern, multimedia terutama game tidak sekadar dibuat hanya untuk bermain saja, akan tetapi dapat dimanfaatkan dalam media pembelajaran yang sangat menyenangkan dengan menggunakan beberapa software yang sudah ada.\r\nSaat ini pembuatan game edukasi berkembang sangat pesat di kalangan masyarakat terutama  anak-anak, banyak memainkan game di gadget-nya. Salah satu game yang akan dibuat dalam Tugas Akhir (TA) ini adalah game “Pengenalan Huruf, Angka, dan Bernyanyi”.\r\nGame Pengenalan Huruf, Angka, dan Bernyanyi ini merupakan sebuah permainan yang bertujuan untuk memperkenalkan huruf, angka dan nyanyian agar tidak hilang begitu saja dimakan zaman seperti saat ini. Game ini kebanyakan dimainkan oleh kalangan anak-anak. Dalam game ini nantinya para pengguna akan diberikan sajian game untuk menebak huruf dan angka agar dapat melatih imajinasi dan daya ingat anak, game ini sifatnya user friendly sehingga mudah dimainkan. Dari 100% responden menyatakan masih sulit dimainkan. Sedangkan sisanya yakni 70% responden menyatakan game ini menarik. Sedangkan sisi materi 95% responden sangat membantu dalam permainan, sisanya yakni 5% belum terbantu.\r\nKata kunci : game pengenalan huruf, edukasi, huruf angka, dan benyanyi. \r\n', 'EKO WAHYU SANYOTO', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100055'),
(145, '080411100058', 'PERANCANGAN  DAN IMPLEMENTASI \r\nSISTEM PENDUKUNG KEPUTUSAN PENENTUAN PENERIMA BANTUAN PROGRAM KELUARGA HARAPAN (PKH) BAGI RUMAH TANGGA \r\nSANGAT MISKIN (RTSM)\r\n', 'RIKA YUNITARINI, ST, MT', 'YENI KUSTIYAHNINGSIH, S.Kom,. M.Kom', 'Seiring dengan perubahan dalam paradigma pembangunan ekonomi yang tidak berfokus dalam pertumbuhan ekonomi saja namun juga dalam penanggulangan masalah kemiskinan, maka sudah sepantasnya apabila pemerintah dituntut untuk dapat mengentaskan masalah kemiskinan dengan pengadaan paket-paket kebijakan yang memberikan perlindungan pada penduduk miskin melalui program-program pengentasan kemiskinan. Salah satu dari program pengentasan kemiskinan yang dilaksanakan oleh pemerintah yaitu program Kelurga Harapan. Metode yang dipakai dalam pengambilan keputusan pemilihan penerima bantuan Program Keluarga Harapan ini adalah menggunakan pembobotan. Pada tugas akhir ini, sistem pendukung keputusan menggunakan pembobotan mampu menganalisa kriteria yang nantinya dapat menentukan penduduk mana yang layak menerima bantuan PKH. Pada hasil penelitian, data manual memiliki tingkat akurasi 87,9%.\r\n   \r\nKata Kunci : Kemiskinan, Program Keluarga Harapan, Sistem Pendukung Keputusan. \r\n\r\n', 'ERVINA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100058'),
(146, '080411100059', 'ANALISA CROSS MARKET BASKET (CMB) DALAM MENENTUKAN POLA KEDEKATAN KONSUMEN DENGAN MENGGUNAKAN ALGORITMA  CT-PRO', 'Bain Khusnul Khotimah, S.T.,M.Kom ', 'Firli Irhamni,ST.,M.Kom', 'Pertumbuhan data yang semakin cepat dan sulit dikontrol hanya akan menjadikan sebuah tumpuka data yang tidak berguna, untuk mengatasi permasalahan tersebut data mining adalah solusinya. Data mining dapat mengubah tumpukan data yang tidak berguna tersebut menjadi sebuah informasi yang berharga. Penelitian ini akan memberikan informasi pola konsumen mini market dengan menggunakan algoritma CT-Pro, salah satu algoritma pada teknik data mining, Association rule, Algoritma CT-Pro merupakan salah satu algoritma pengembangan dari FP-Growth, perbedaannya terdapat pada langkah kedua dimana FP-Growth membuat FP-Tree sedangkan CT-Pro menggunakan compressed FP-Tree. Hasil dari analisa diketahui semakin besar transaksi yang diproses maka semakin banyak kombinasi juga semakin lama waktu prosesnya. Dari hasil kombinasi tersebut dapat diketahui pola-pola atau rules tentang kebiasaan konsumen dalam berbelanja setelah dihitung support dan confidence dari setiap kombinasi. Semakin besar jumlah transaksi juga semakin besar subset (kombinasi) yang dihasilkan juga membuat waktu proses akan semakin lama. Informasi tersebut dapat menjadi bahan pertimbangan dalam menentukan kebijakan perusahaan.', 'Zaitun', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100059'),
(147, '080411100060', 'Rancang Bangun Perangkat Lunak Pencarian Jalur Terpendek Untuk Perjalanan Wisata Dengan Metode Algoritma Dijkstra\r\n(Studi Kasus : Kota Surabaya)\r\n', 'Fika Hastarita Rachman S.T., M.Eng', 'Riza Alfita S.T., M.T', 'Berwisata merupakan cara seseorang untuk menghilangkan kejenuhan terhadap rutinitas sehari-hari serta dapat menambah pengetahuan. Namun banyaknya jalan raya pada saat ini terkadang menyulitkan seseorang untuk memilih jalan yang mempunyai jarak yang paling minimum sehingga mempengaruhi besarnya biaya yang dikeluarkan. Untuk itu diperlukan suatu sistem informasi yang mampu menemukan jalur minimum untuk menghemat waktu dengan memperhitungkan antara jarak dan kecepatan berkendara. Sistem ini dibuat dengan menggunakan metode algoritma dijkstra dan berbasis Web. Untuk penggambaran jalur yang dilalui menggunakan google maps sehingga hasilnya lebih akurat. Agar tujuan yang ingin di capai berhasil dan sesuai dengan yang di inginkan maka aplikasi ini di bandingkan dengan jalur yang biasa dilalui oleh Biro Perjalanan Wisata atau Travel dengan cara mengisi kuesioner pengujian sistem. Dari hasil uji coba yang dilakukan dapat diambil kesimpulan bahwa metode Algoritma Dijkstra dapat digunakan untuk proses pencarian jalur minimum lebih dari satu tujuan. Dari lima skenario uji coba yang di ujikan untuk dua travel, hanya ada satu rute yang berbeda di setiap travel.', 'Muliyati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100060'),
(148, '080411100061', 'ANALISIS PENGARUH KENAIKAN HARGA BBM TERHADAP PENDAPATAN MASYARAKAT NELAYAN DENGAN MENGGUNAKAN AHP DAN FUZZY TSUKAMOTO', 'Bain Khusnul K., S.T., M.Kom.', 'Rika Yunitarini, S.T.,M.T.', 'Salah satu kelompok masyarakat yang memperoleh dampak langsung dari kenaikan harga BBM adalah masyarakat nelayan pesisir. Nelayan adalah komunitas dengan tingkat pendapatan terendah dibandingkan sektor usaha lain. Bagi Nelayan, BBM merupakan komponen  penting dalam kegiatan operasional mereka yang pada akhirnya berpengaruh pada harga jual hasil laut. Di sisi lain, kenaikan biaya operasional tidak diimbangi oleh peningkatan daya beli konsumen ikan. Oleh karena itu diperlukan sebuah penelitian pengaruh harga BBM terhadap pendapatan Nelayan pesisir di Kecamatan Camplong Kabupaten Sampang. Penelitian ini hasil akhir adalah hasil yang akan disarankan akan diberi bantuan dengan keterangan Rendah. Dari hasil 5 sampel data yang dilakukan, nilai akhir sebelum kenaikan harga BBM dengan hasil = 0,104033094 mengalami penurunan setelah kenaikan harga BBM naik dengan hasil = 0,071810804. Untuk membantu masyarakat nelayan karena dampak kenaikan harga BBM masyarakat nelayan pesisir agar disarankan mendapat bantuan yang ada pada program pemerintah. Seperti BLT atau BLSM, dengan keterangan berpenghasilan Rendah. \r\n\r\nKata Kunci: Nelayan Pesisir, AHP , Fuzzy Tsukamoto.\r\n', 'Bagus Adi Putranto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100061'),
(149, '080411100062', 'Rancang Bangun CRM Berbasis SMS Gateway disertai Peramalan Pergudangan dengan Metode Fuzzy Time Series', 'Fika Hastarita R, S.T., M.Eng.', 'Firli Irhamni, ST. M. Kom.', 'KUB Rumput Laut Mitra Bahari adalah suatu perusahaan yang bergerak di bidang produksi rumput laut. Selama ini sistem produksi yang dilakukan didasarkan pada inventori atau stok gudang. Produksi terus berlangsung tanpa melihat permintaan penjualan. Sebagai akibatnya sering terjadi permintaan atau penjualan yang melebihi stok sehingga KUB Rumput Laut Mitra Bahari tidak dapat memenuhi permintaan tersebut. Sering juga terjadi permintaan penjualan jumlahnya lebih sedikit dari hasil produksi sehingga terdapat banyak sisa produk yang tidak terjual. Selain itu, pihak perusahaan juga masih belum memanfaatkan hubungan CRM antara pelanggan dengan perusahaan berbasis SMS Gateway, yang dapat mempercepat dan mempermudah hubungan antara pelanggan dengan perusahaan.\r\nOleh karena itu, untuk mengatasi beberapa masalah tersebut, pada tugas akhir ini dibuat aplikasi CRM berbasis SMS Gateway disertai peramalan pergudangan dengan metode Fuzzy Time Series. Hubungan CRM berbasis SMS Gateway antara pelanggan dan perusahaan dapat mempermudah dan mempercepat hubungan antara pelanggan dengan perusahaan. Perusahaan akan mengetahui apa yang diharapkan dan diperlukan pelanggannya. Disamping itu dalam penelitian ini juga dibuat aplikasi peramalan pergudangan yang nantinya akan ditindak lanjuti menjadi informasi peluang memasok bahan mentah kepada pemasok berbasis SMS Gateway. Dengan adanya hasil peramalan tersebut, pihak perusahaan dapat memperkirakan jumlah stok data produksi yang dibutuhkan pada periode berikutnya.\r\n\r\nKata Kunci: CRM, pergudangan, Fuzzy Time Series, SMS Gateway.\r\n', 'Akhmad Tajuddin Tholaby MS.', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100062'),
(150, '080411100063', 'SISTEM INFORMASI EVALUASI PEMBELAJARAN \r\nStudy Kasus di MTs  RAUDLATUL MUTA’ALLIMIN\r\nBABAT LAMONGAN', 'Bain Khusnul Khotimah, S.T, M.Kom', 'Sigit Putro Susanto, S.Kom, M.kom', 'Perkembangan teknologi yang semakin pesat dewasa ini, telah memberikan banyak kemudahan manusia untuk dapat melaksanakan tugas dan kepentingannya, salah satu contohnya adalah dengan adanya sistem informasi yang dapat membantu dan menggantikan sistem manual yang telah ada. MTs Raudlatul Muta’allimin adalah suatu yayasan pendidikan agama Islam yang dalam proses dokumentasinya masih menggunakan sistem manual dan belum terintegrasi sehingga banyak informasi yang belum bisa diakses oleh siswa dan wali siswa. Dengan adanya sistem informasi ini, diharapkan kedepannya nanti bisa memberikan kemudahan untuk beberapa pihak, yaitu pihak siswa dan guru karena dalam melihat nilai akhir (raport), informasi guru, informasi mata pelajaran, informasi kelas dan informasi jadwal pelajaran bisa dilakukan dengan media elektronik secara langsung. ', 'Rizka Khoirina Lisa', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100063');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(151, '080411100068', 'SISTEM PENGENALAN POLA SUARA UNTUK HURUF ALFABET DENGAN MENGGUNAKAN CROSS CORRELATION DAN FAST FOURIER TRANSFORM', 'Dr. Arif Muntasa, S.Si.,M.T.', 'Cucun Very Angkoso, S.T.,M.T.', 'Pengenalan suara merupakan gagasan teknologi yang bertujuan sehingga komputer bisa mengenali suara manusia. Pengenalan suara untuk huruf alfabet merupakan pengucapan suara yang berasal dari suara manusia dan diproses melalui komputer. Dalam penelitian ini menggunakan metode Cross Correlation yang berfungsi untuk menentukan tingkat hubungan kedekatan antara dua buah sinyal yang berbeda. Cara kerja metode Cross Correlation adalah membandingkan kedua sinyal suara untuk menghasilkan beberapa nilai maksimum dan dari beberapa nilai maksimum diperoleh nilai maksimum terbesar yang dikenali sebagai data sinyal suara ketiga. Metode ini digunakan karena proses perhitungannya mudah untuk dipahami. Sedangkan untuk proses ekstraksi fitur suara menggunakan metode Fast Fourier Transform yang berfungsi untuk mentransformasi sinyal frekuensi. Hasil uji coba dengan menggunakan Cross Correlation menunjukkan bahwa sistem ini kurang efisien apabila menggunakan banyak orang yang dijadikan sampel data suara, hal ini terbukti karena pada pengujian skenario lima setelah data dinormalisasi mendapatkan akurasi 38% dengan sampel data lima orang dua kali pengucapan dan akurasi 89% dengan sampel data satu orang lima kali pengucapan. Sedangkan untuk hasil uji coba menggunakan Fast Fourier Transform didapatkan akurasi 65% pada skenario dua dengan sampel data dua orang lima kali pengucapan dan akurasi 6% pada skenario tiga dengan sampel data tiga orang tiga kali pengucapan. ', 'Budi Agung Yuwono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100068'),
(152, '080411100069', 'CLUSTERING PENGELOMPOKAN TINGKATAN KELAS DENGAN METODE SOM (SELF ORGANIZING MAP) MAHALANOBIS', 'Bain Khusnul Khotimah.,ST.M.Kom. ', 'Firli Irhamni,ST.,M.Kom. ', 'Dalam penyelenggaraan pendidikan formal untuk lebih mengarahkan siswa berdasarkan kemampuan akademiknya membutuhkan data real, Data yang sudah ada terkadang tidak digunakan secara optimal karena keterbatasan ilmu dan waktu maka dari itu disini dilakukan penelitian pengolahan data dengan mengimplementasikan Algoritma SOM (Self Organizing Map) dengan menggunakan Mahalanobis Distance sebagai pengukuran jarak antar cluster dan Indeks Dunn digunakan untuk memvalidasi hasil analisa data dari SOM (Self Organizing Map), sehingga didapat nilai yang lebih akurat. Data yang digunakan adalah rata-rata nilai NEM, Semester 1 dan Semester 2 dari Mata Pelajaran Bahasa Indonesia, Bahasa Inggris, Matematika, Biologi, Fisika, Kimia, Ekonomi, Geografi, Sosiologi, PPkn, TIK, Agama, Conversation, Penjaskes dan Seni. Dari data tersebut memetakkan dataset kedalam  tiga Cluster yaitu Intensif, Reguler Advanced, dan Reguler Menengah ke bawah. Nilai terkecil pada pemvalidasian cluster dengan Index Dunn menggunakan tiga Cluster pada 153 data training berada pada  penetapan nilai Distance = 10 Learning 1 dan MSE = 1 dengan nilai Indeks Dunn = -0.38376688860749 dengan hasil akurasi 47,05% sedangkan hasil akurasi terbaik sebesar 60,78% dengan Learning Rate 0,3.', 'Ira agustin Sasintorini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100069'),
(153, '080411100071', 'Aplikasi Multimedia Pengenalan Sandi Bendera Semaphore Pramuka Berbasis Game Android', 'CUCUN VERY ANGKOSO', 'ARIK KURNIAWATI', 'Visualisasi animasi meberikan informasi yang lebih interaktif dan menarik. Dalam penelitian ini telah dilakukan pemanfaatan teknologi mobile smartphone android untuk pengenalan materi gerakan pramuka khususnya pada gerakan kode bendera semaphore yang dikemas dalam animasi mobile android, pada penelitian ini dimanfaatkan adobe AIR macromedia flash yang mampu menjalankan aplikasinya di platform android. Aplikasi multimedia pengenalan semaphore flag signaling pramuka berbasis OS android ini memberikan kemudahan dalam penggunaan dan pemahaman tentang materi sandi semaphore. Terdapat step by step pengenalan sandi semaphore yang bisa dilihat secara berurutan, serta terdapat bagian praktek, dimana user hanya mengetikkan kata dalam textbox maka secara otomatis animasi akan bergerak menunjukkan sandi – sandi semaphore yang telah diketikkan dalam textbox tersebut. Dan aplikasi ini juga dilengkapi fitur pertanyaan atau tes, dimana setelah memahami pengenalan sandi semaphore, user juga disuguhi materi tes pertanyaan dari gerakan – gerakan animasi tersebut, sehingga bisa diketahui bagaimana pemahaman mereka tentang materi yang telah disajikan dalam bentuk mobile android  ini. Dengan demikian, aplikasi ini dapat memudahkan anggota pramuka dalam dalam memahami materi kode bendera semaphore pramuka.\r\n\r\nKata kunci: Aplikasi Multimedia, Semaphore Flag, Pramuka, OS Android\r\n', 'ARDHANI ALFARISI AHMAD', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100071'),
(154, '080411100072', 'SISTEM MONITORING PEMAKAIAN MOBIL DINAS BERBASIS GPS PADA\r\nPLATFORM ANDROID (STUDI KASUS : PT YANG ANDALAN UTAMA\r\nSIDOARJO)”', 'Hermawan ST.M.Kom', 'Kautsar Sophan ST MT', 'Penggunaan mobil dinas yang tidak semestinya dapat menyebabkan pembengkakan biaya\r\ntransportasi. Penelitian terdahulu telah membuktikan bahwa perangkat GPS Android dan Google Maps\r\nmampu untuk melacak keberadaan perangkat bergerak namun hasilnya sangat dipengaruhi oleh trafik dari\r\njaringan selular, semakin tinggi trafiknya performa aplikasi semakin menurun atau bahkan mungkin tidak\r\nberfungsi sama sekali. Dalam tugas akhir ini dikembangkkan Aplikasi GPS Tracking berbasis Location\r\nBased Service (LBS). Perangkat GPS pada smartphone android digunakan untuk menentukan koordinat\r\ndisisi client, data yang diperoleh akan diproyeksikan menggunakan Google maps pada server yang dibangun\r\nmenggunakan pemrograman ANDROID, PHP MYSQL sehingga akan diperoleh aplikasi yang mampu\r\nmemonitoring posisi kendaraan.', 'Musa Paradisia', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100072'),
(155, '080411100073', 'Sistem Informasi Evaluasi Mutu Akademik Dan Proses Pembelajaran Studi Kasus: Program Studi Teknik Informatika Universitas Trunojoyo Madura Menggunakan Metode Enhanced Cumulative Voting', 'Achmad Jauhari, S.T., M.Kom', 'Rika Yunitarini, S.T., M.T.', 'Untuk meningkatkan kualitas pembelajaran pada Universitas Trunojoyo Madura jurusan teknik informatika diperlukan adanya evaluasi pembelajaran. Salah satu cara adalah membuat survei. Peserta survei adalah mahasiswa dan hasilnya menjadi masukan tim penjamin mutu. Kondisi pengisian survei dan rekapitulasi hasil saat ini dilakukan dengan cara penulisan pada kertas sehingga akan dibuatkan sebuah sistem secara elektronik mulai dari pengisian hingga rekapitulasi. Metode yang digunakan saat ini adalah cumulative voting. Metode tersebut  mudah dan cepat di implementasikan. Namun hasilnya kurang dapat diandalkan. Dikarenakan metode Cumulative Voting tidak melihat latar belakang obyek yang berkontribusi dalam mutu akademik dalam hal ini adalah mahasiswa. Maka dari itu dalam pembahasan ini akan menggunakan metode Enhanced Cumulative Voting selanjutnya disingkat (ECV). Dimana metode ini meningkatkan kualitas hasil dari Cumulative Voting dengan cara mengelompokan obyek mahasiswa ke dalam beberapa kriteria, yakni tahun angkatan, jumlah kehadiran, status mata kuliah yang diambil dan lama waktu pengisian form. Setelah mahasiswa di kelompokan, maka akan dilakukan pembobotan menggunakan metode Analytical Hierarchy Process skala 1-9. Dengan menggunakan metode ECV maka hasil dari evaluasi diharapkan akan mendekati kenyataan dikarenakan melihat dari pengelompokan berdasar kriteria.\r\n\r\nKata Kunci: AHP, Cumulative Voting, weights, method of ranking.', 'Aris Eko Priyanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100073'),
(156, '080411100074', 'SISTEM INFORMASI EVALUASI MUTU AKADEMIK DAN PROSES PEMBELAJARAN STUDI KASUS : PROGRAM STUDI TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO MADURA MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHT (SAW)', 'Achmad Jauhari, S.T., M.Kom', 'Rika Yunitarini, S.T., M.T.', 'Universitas Trunojoyo Madura (UTM) merupakan salah satu perguruan tinggi negeri di madura jawa timur. Setiap instansi sekolah bahkan perguruan tinggi tidak terlepas dengan adanya evaluasi dalam pembelajaran agar dapat terciptanya efektifitas dan kualitas pada Stake Holder itu sendiri. Pihak-pihak yang disebut Stake Holder, yang terdiri dari Dosen. Oleh karena itu, tim jaminan mutu mengambil studi kasus : program studi teknik informatika universitas trunojoyo madura karena masih adanya ketidakpuasan mahasiswa pada saat proses belajar mengajar, sehingga setiap 1 semester/periodenya dituangkan dalam bentuk kuisioner yang masih manual yaitu dalam bentuk kertas sehingga dibuatlah sistem. Salah satu metode yang dapat digunakan yaitu metode Simple Additive Weight(SAW). Tujuan adanya sistem evaluasi proses pembelajarn ini, untuk menghasilkan nilai IPD per matakuliah dan per dosen serta meningkatkan pendidikan dalam proses belajar mengajar yang efektif.\r\nHasil dari pengujian sistem menggunakan Simple Additive Weight (SAW) mencapai tingkat akurasi 90% untuk jumlah data latih 50 user dan data uji 10 user. Sedangkan untuk metode Simple Additive Weight(SAW) yang digunakan pada beberapa evaluasi matakuliah mencapai tingkat akurasi tertinggi sebesar 97,5%.\r\n', 'Andy Erwan Febrianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100074'),
(157, '080411100075', 'PENGEMBANGAN APLIKASI PEMBELAJARAN ANAK USIA DINI MENGGUNAKAN QUALITY FUNCTION DEPLOYMENT', 'Andharini Dwi Cahyani, S.kom.,M.kom', 'Yeni Kustiyahningsih, S.Kom.,M.Kom', 'Pesatnya perkembangan teknologi saat ini telah berpengaruh dan berdampak positif bagi kehidupan manusia. Dengan pemanfaatan teknologi pula, pengembangan pengetahuan menjadi menarik khususnya bagi dunia pendidikan. Saat ini sistem pendidikan tidak terlepas dari sistem informasi dan komunikasi yang berkembang dengan pesat serta mempengaruhi kehidupan masyarakat, terutama pada dunia pendidikan. Sudah banyak sistem pembelajaran yang dibangun untuk menunjang proses belajar mengajar didunia pendidikan dengan tujuan meningkatkan mutu pendidikan selangkah lebih maju seiring dengan kemajuan teknologi. Multimedia interaktif merupakan suatu aplikasi pembelajaran yang digunakan untuk menyalurkan pesan pembelajaran berupa pengetahuan, keterampilan dan sikap yang dirancang agar siswa dapat belajar aktif dan terkendali. Adanya multimedia pembelajaran interaktif dapat membantu guru untuk mendesain pembelajaran secara kreatif. Dengan desain pembelajaran yang kreatif  maka proses pembelajaran menjadi inovatif, menarik, efektif dan lebih interaktif. Pengembang aplikasi pembelajaran  menggunakan Quality Function Deployment merupakan pengembangan aplikasi pembelajaran yang digunakan dalam mendesain konten pembelajaran berupa media interaktif yang sesuai dengan keinginan dari guru pengajar. Digunakan pengisian matriks Quality Function Deployment (QFD) untuk mengkorelasikan antara keinginan guru terhadap elemen desain. Dari hasil pengisian matriks QFD diperoleh model perancangan aplikasi pembelajaran untuk anak usia dini berdasarkan keinginan guru. Dari hasil uji coba dilakukan kesesuaian hasil aplikasi dengan Quality Function Deployment kepada guru pengajar dan didapatkan hasil prosentase sangat sesuai 46,353%, sesuai 47,112%, cukup sesuai 6,383%, kurang sesuai 0,152%, dan tidak sesuai 0%.', 'Rebby Joenanta', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100075'),
(158, '080411100076', 'Segmentasi Citra Berbasis Lokal Entropi Thresholding', 'Dr. Arif Muntasa, S.Si, M.T.', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Segmentasi Citra merupakan salah satu tahap operasi pada proses analisis dalam bidang pengolahan citra digital. Yaitu proses untuk memisahkan sebuah obyek citra dengan latar belakangnya. Penelitian ini mengimplementasikan metode Segmentasi Citra yang berbasis ambang batas obyek yaitu Metode Lokal Entropi Thresholding. Ada lima tahap dalam sistem ini. Pertama, Pre-processing yaitu mengubah citra RGB menjadi citra Grayscale. Kedua, melakukan Segmentasi Citra menggunakan Metode Lokal Entropi Thresholding untuk mencari nilai Threshold. Nilai Threshold ini yang digunakan untuk mengubah citra Grayscale menjadi citra Biner. Ketiga, proses Invert citra yaitu proses mengubah warna hitam menjadi putih dan warna putih menjadi hitam. Keempat, menghapus Noise pada citra hasil segmentasi. Proses terakhir yaitu menghitung akurasi hasil segmentasi dengan menggunakan metode Regionprops. Kemudian dibandingkan dengan citra Ground Truth berdasarkan hasil pengamatan langsung dari user. Berdasarkan hasil uji coba yang telah dilakukan pada 30 citra, metode ini berhasil mendeteksi obyek dengan prosentase 70%.', 'Stevian Yudha Nugraha', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100076'),
(159, '080411100078', 'IMPLEMENTASI  METODE N-GRAM PADA PEMBUATAN GAME FIGHTING MADURA BERBASIS ANDROID OS MOBILE', 'Arik Kurniawati S.Kom., M.T', 'Cucun Very Angkoso, S.T., M.T', 'Teknologi mobile  game  berkembang  dengan  sangat  pesat. mobile  game memiliki  banyak  peminat  dari berbagai kalangan karena keragaman variasinya. Hal inilah yang menjadi dasar bagi para pengembang untuk terus  mengembangkan mobile  game. Pada  penelitian  ini  dibuat sebuah Game  Fighting dengan  platform Android. Game  Fighting adalah  salah  satu  genre  video  game  dimana  seorang  player  mengontrol  seorang karakter di layar permainan dan  melakukan pertarungan jarak dekat (close combat) dengan  seorang lawan. Game  fighting  dibuat  dengan  mengimplementasikan  Metode  N-gram.  Metode  N-gram  diterapkan  pada pembuatan  pergerakan  NPC  (Non  Playable  Character)  dalam  bertarung. NPC  dapat  memprediksi  gerakan lawan  selanjutnya  dengan  menggunakan  metode  N-gram.  Dari  30  gerakan  pertama  player  NPC  dapat memprediksi 9 gerakan dengan tepat. Prediksi akan menjadi semakin akurat dengan semakin banyaknya key yang tercipta. 6 dari 9 prediksi gerakan yang tepat terjadi antara pada gerakan ke-20 sampai gerakan ke-30. Metode ini akan cenderung membuat NPC bertahan jika player bergerak agresif menyerang. Hasil pengujian Game  Fighting  dapat  berjalan  dengan  baik  pada  emulator  dan  smartphone  android  yang  memiliki  resolusi screen 320 x 480 pixels. Aplikasi game ini masih dapat berjalan lancar pada tipe smartphone Android yang memiliki  resolusi  screen  lebih  besar  atau  lebih  kecil  dari 320  x  480  pixels  akan  tetapi  tampilannya  tidak sempurna. ', 'Farizal Arifin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100078'),
(160, '080411100080', 'RANCANG BANGUN MEDIA PEMBELAJARAN INTERAKTIF UNTUK MATA KULIAH BASIS DATA\r\n(Studi Kasus : Teknik Informatika Universitas Trunojoyo Madura)', 'AndhariniDwiCahyani, S.Kom.,M.Kom.', 'SigitSusantoPutro, S.Kom, M.Kom', 'E-Learning(electronic learning) adalah kegiatan belajar menggunakan media elektronik yang memafaatkan teknologi komputer, jaringan komputer atau internet. Media pembelajaran interktif pada tugas akhir ini berupa multimedia interaktif adalah salah satu contoh dari pemanfaatan e-learning.  Tujuan dari tugas akhir ini adalah untuk membuat sebuah media pembelajaran yang interaktif agar dapat membimbing mahasiswa untuk lebih mempermudah untuk mempelajari basis data.\r\nDalam media pembelajaran ini terdapat beberapa bab dan sub bab yang akan dibahas berupa tombol sehingga memudahkan user untuk memilih bab yang akan dipelajari. Selain itu juga terdapat tombol navigasi mempermudah user dalam penggunaan. Dalam media pembelajaran ini  juga ada konten latihan soal di setiap bab sebagai sarana mengukur sejauh mana pemahaman user di setiap bab-nya.\r\nHasil pengujian penelitian ini pada kuisioner dapat disimpulkan dari 15 responden.Aplikasi ini dapat mempermudah pemahaman pada mata kuliah basis data. Sebanyak 6 responden menyatakan setuju, 6 responden menyatakan cukup setuju dan 3 responden menyatakan sangat setuju. Sebanyak 7 responden menyatakan aplikasi ini penting, 4 responden menyatakan sangat penting dan sebanyak 4 responden menyatakan cukup penting.\r\n\r\nKata kunci : Media PembelajaranInteraktif, Basis Data\r\n', 'Kharisma Alam', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100080'),
(161, '080411100082', 'KLASIFIKASI EFEKTIVITAS MENGHAFAL ASMAUL HUSNA MELALUI PEMBELAJARAN HANIFIDA MENGGUNAKAN \r\nGAME EDUKASI DENGAN METODE FUZZY\r\n', 'Arik Kurniawati, S.Kom., M.T.', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Game sudah merambah dalam berbagai bidang kehidupan, tidak terkecuali bidang pendidikan. Manusia mempunyai sifat dasar lebih cepat mempelajari segala sesuatu secara visual – verbal, sehingga game juga baik jika dilibatkan dalam proses pendidikan. Salah satu materi yang dapat dimasukkan dalam game edukasi adalah pembelajaran menghafal Asmaul Husna. Metode pembelajaran juga sangat penting digunakan untuk media pembelajaran. Salah satu metode yang digunakan adalah metode Hanifida. Game yang dibuat menggunakan metode Hanifida terdiri dari 4 level. Tiap-tiap level merepresentasikan tahapan-tahapan dalam pembelajaran metode Hanifida. Pada penelitian ini, penulis mengukur tingkat keefektifan metode Hanifida sebagai media pembelajaran dengan mengklasifikasi hasil uji coba game. Uji coba game yang digunakan adalah pada game level 4 yang diuji coba pada 30 siswa-siswi Sekolah Dasar. Hasil uji coba kemudian diklasifikasi menggunakan metode Fuzzy. Terdapat 3 input variabel dari hasil uji coba game level 4, yaitu nilai, waktu, dan langkah. Variabel-variabel tersebut digunakan untuk proses klasifikasi. Selain input variabel, juga terdapat output variabel, yaitu hasil keefektifan. Hasil keefektifan dari klasifikasi Fuzzy yang dilakukan pada hasil uji coba game level 4, yaitu metode Hanifida efektif dijadikan sebagai media pembelajaran dalam menghafal Asmaul Husna sebesar 73.3% dengan rincian persentase untuk hasil sangat efektif 23.3% dan hasil efektif sebesar 50%.', 'Yunita Indriana Putri Lestari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100082'),
(162, '080411100083', 'IMPLEMENTASI  ALGORITMA PRIM  DAN DEPTH FIRST SEARCH PADA PEMBUATAN MAZE GAME BERBASIS ANDROID OS MOBILE', 'Cucun Very Angkoso, S.T., M.T.', 'Arik Kurniawati S. Kom., M.T.', 'Teknologi mobile game beroperating system open source berkembang dengan sangat pesat. Karena keragaman variasinya, mobile game memiliki banyak peminat dari berbagai kalangan. Hal inilah yang menjadi dasar bagi para pengembang untuk terus mengembangkan mobile game. \r\nPada penelitian ini, sebuah mobile game untuk mengasah kemampuan berfikir telah dikembangkan dengan mengimplementasikan algoritma Prim dan Depth First Search. Dalam pembuatannya, algoritma Prim diterapkan pada saat pembuatan lintasan dari maze sedangkan algoritma Depth First Search diterapkan pada saat melakukan proses pencarian solusinya.\r\nDari hasil pengujian dapat disimpulkan bahwa algoritma Prim dan Depth First Search dapat berfungsi dengan baik pada resolusi screen 320 x 480 pixels dalam pembentukan lintasan dan pencarian solusi dari maze.\r\nKata kunci : Mobile Game, Android, Algoritma Prim, Algoritma Depth First Search.\r\n', 'M Khoiril Anwar', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100083'),
(163, '080411100084', 'Sistem Pendukung Keputusan Penilaian Kinerja SPG Menggunakan Metode TOPSIS', 'Bain Khusnul Khotimah.ST,M.Kom', 'Sigit Susanto P. S.Kom., M.Kom', 'Seiring perkembangan teknologi yang semakin pesat,kebutuhan akan komputerisasi disegala bidang pun terus meningkat.Tak terkecuali dalam hal pengambilan keputusan.Salah satu contohnya di perusahaan PT.Haka TriPutra Jaya Perkasa merupakan sebuah perusahaan yang bergerak dibidang penjualan minuman yang berada dikota Surabaya.Penilaian kinerja SPG menjadi hal yang sangat penting bagi manajemen untuk melakukan evaluasi terhadap kinerja perusahaan dan perencanaan tujuan dimasa mendatang.Sesuai dengan peraturan yang sudah ditentukan oleh pihak perusahaan untuk memperoleh SPG yang kinerjanya baik maka di butuhkan sebuah system pendukung keputusan dengan menggunakan Metode Technique for Order Performance by Similarity to Ideal Solution (TOPSIS). Metode ini dipilih karena metode TOPSIS merupakan suatu bentuk model pendukung keputusan yang digunakan untuk pengambilan keputusan dengan criteria beragam dan dapat digunakan untuk memecahkan masalah pengambilan keputusan.  \r\n 	Pada Tugas Ahkir ini,system pendukung keputusan menggunakan metode TOPSIS mampu menganalisa criteria yang nantinya dapat menentukan  SPG mana yang layak dipromosikan pengangkatan jabatannya.Pada hasil penelitian ini Sistem memiliki tingkat akurat 85%.\r\n\r\nKata Kunci: Sistem Pendukung Keputusan,Penilaian Kinerja SPG, TOPSIS\r\n', 'Mufarrohah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100084'),
(164, '080411100086', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN KARYAWAN BERPRESTASI DENGAN INTEGRASI FAHP dan ELECTRE II', 'Mula\'ab,S.Si.,M.Kom', 'Riza Alfita, S.T., M.T', 'Sumber daya manusia mutlak dibutuhkan untuk kemajuan suatu perusahaan guna menjadikan perusahaan itu menjadi perusahaan yang maju dan tidak kalah bersaing dengan perusahaan lainnya. Dalam hal ini maka dibuatlah Sistem Pendukung keputusan (SPK) pemilihan karyawan berprestasi untuk mencari karyawan berprestasi. Sistem Pendukung keputusan (SPK) ini menggunakan FAHP dan ELECTRE II. Metode FAHP merupakan metode yang cukup obyektif untuk proses penilaian berdasarkan hirarki kriteria yang digabungkan dengan konsep fuzzy sesuai kriteria penilaian kinerja karyawan perusahaan. Setelah mendapat bobot dilakukan proses selanjutnya dengan menggunakan metode ELECTRE II hingga mendapat karyawan berprestasi. Untuk menjaga bahwa penilaian ini tidak berpihak kepada salah satu karyawan dan bebas intervensi dari karyawan maka perusahaan menggunakan pihak luar yang independen dan profesional untuk melakukan penilaian terhadap karyawan. Hasil penilaian dari pihak luar yang berupa angka-angka kemudian oleh departemen sdm dilakukan penjumlahan nilai komulatif kriteria untuk mendapat karyawan terbaik tanpa ada prioritas kriteria yang lebih penting. Dengan menggunakan metode FAHP dan ELECTREII hasil keluaran mendekati keakuratan dengan hasil yang diperoleh dari areal manager di banding dengan hitung manual perusahaan tanpa memperhatikan bobot kepentingan.', 'Catur Ngesti Waluyo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100086'),
(165, '080411100087', 'Pengaturan Lampu Lalu Lintas Menggunakan Metode Fuzzy Logic', 'Eza Rahmanita', 'Meidya Koeshardianto', 'Masalah kemacetan yang terjadi di persimpangan lampu lalu lintas kerap terjadi di kota-kota besar. Pada satu kondisi lampu lalu lintas dapat menjadi pengontrol arus lalu lintas, tapi di lain kondisi terkadang dapat pula menjadi penyebab kemacetan. Hal ini terjadi karena pengaturan waktu pada lampu lalu lintas yang masih menggunakan waktu statis (waktu tetap) tanpa mempertimbangkan kondisi kepadatan kendaraan pada tiap jalur perempatan. Oleh karena itu diperlukan sistem kendali adaptif pada lampu lalu lintas yang didasarkan pada tingkat kepadatan kendaraan yang melewati jalan tersebut. Pada penelitian ini, akan digunakan Fuzzy Logic dengan metode Sugeno untuk menentukan lamanya waktu lampu merah dan hijau untuk menyala dengan variabel input yaitu panjang antrian kendaraan pada sebuah jalur perempatan dan variabel input panjang antrian kendaraan dari jalur yang berlawanan sedangkan outputnya adalah lama lampu merah dan hijau untuk menyala pada jalur yang ditentukan. Ada 25 rule fuzzy yang digunakan untuk menentukan waktu pada tiap masing-masing dua jalur yang berlawanan. Basis pengetahuan dibangun dengan menggunakan kaidah produksi (IF - THEN). Penelitian ini menggunakan bahasa pemrograman Borland Delphi dalam pengerjaannya. Hasil dari penelitian ini ialah pengaturan lampu lalu lintas secara adaptif sesuai dengan panjang antrian kendaraan pada suatu perempatan. \r\n\r\nKata Kunci: Fuzzy Logic, Metode Sugeno, Lampu Lalu Lintas\r\n', 'Kurniawati Meilina Putri Kapitan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100087'),
(166, '080411100088', 'RANCANG BANGUN MANAJEMEN KONTEN PADA PENERAPAN JARINGAN KOMPUTER', 'Sigit Susanto Putro S.Kom, M.Kom.', 'Arik Kurniawati, S.Kom, M.T.', 'Semakin berkembangnya pengetahuan memungkinkan siswa untuk belajar dari berbagai media. Pada saat ini, pembelajaran masih menggunakan buku sebagai bahan ajar utama. Dalam proses pembelajaran, ilmu jaringan sulit jika dipelajari dengan hanya bersumber dari buku. Karena sebagai ilmu terapan, mengharuskan siswa lebih aktif dalam praktik menggunakan komputer. Penyediaan materi dan evaluasi materi masih bersifat konvensional, menimbulkan kendala yaitu penggunaan kertas dan waktu yang tidak efisien. Dengan adanya masalah tersebut, dibuatlah sebuah aplikasi media pembelajran. Aplikasi ini memungkinkan siswa dan guru lebih mudah untuk memberikan dan menerima materi. Karena berbasis web dan dibuka menggunakan browser yang dapat diakses dengan internet dari manapun. Evaluasi dilakukan jauh lebih mudah, karena perekapan nilai sudah dilakukan oleh sistem. Salah satu aplikasi yang dapat mendukung pembuatan media pembelajaran adalah CMS Drupal. Aplikasi Open Source ini dapat diberi modul yang cocok diterapkan sebagai konten pembelajaran. Tujuan dari tugas akhir ini adalah membuat siswa maupun orang yang mencari pengetahuan jaringan dapat belajar menggunakan media yang lebih interaktif. Berdasarkan hasil pengujian yaitu presentase guru 77,8% dan siswa 85%, program ini mencapai hasil yang diinginkan yaitu meningkatkan kemampuan siswa dan memberikan pengetahuan baru pada pelajar maupun non-pelajar dalam pembelajaran Jaringan Komputer.\r\n\r\nKata Kunci: Manajemen konten, CMS, Drupal, Jaringan', 'Haertanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100088'),
(167, '080411100089', 'Sistem Rekomendasi Produk Pada M-Commerce Berbasis Android Menggunakan Metode Collaborative Filtering', 'Bain Khusnul Khotimah, ST., M.Kom.', 'Muhammad Fuad, S.Kom., MT.', 'ABSTRAK\r\nPertumbuhan bisnis di Indonesia terutama bisnis online semakin berkembang pesat. Perkembangan ini dikarenakan semakin mudahnya cara akses internet oleh masyarakat. Dari tahun ke tahun jumlah pengguna internet di Indonesia semakin meningkat, peningkatan ini merupakan peluang untuk berbisnis. Dalam penelitian ini saya membuat aplikasi m-commerce berbasis android, dimana dalam aplikasi ini bisa digunakan untuk melakukan pemesanan aksesoris handphone ataupun memberikan informasi produk secara update dan juga memberikan rekomendasi produk  yang tepat pada konsumen yang diterapkan pada perangkat mobile phone karena dengan aplikasi ini konsumen tidak lagi harus membuka website untuk melihat ketersediaan barang di Cullen Store, aplikasi ini dapat memberikan kemudahan bagi konsumen dalam mengakses kebutuhan informasi tersebut dalam melakukan pemesanan aksesoris handphone ataupun yang sekedar ingin mengetahui ketersediaan stok dan juga untuk memperoleh informasi produk terbaru, aplikasi ini juga dapat membantu meningkatkan penjualan.\r\nAplikasi yang telah dibuat telah dilakukan uji coba dengan diambil beberapa data yaitu dengan 20 data konsumen dan 20 data produk melalui proses perhitungan metode collaborative filtering, dimana dalam uji coba ini berhasil memberikan rekomendasi produk Sandisk 64gb kepada pengguna yang bernama Afrizar.\r\n\r\nKata kunci : Aksesoris handphone,  m-commerce, android, collaborative filtering\r\n', 'Adytiya Dwi Putra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100089'),
(168, '080411100092', 'Sistem Informasi Manajemen Keuangan Berbasis Web Di Sekolah Tinggi Ilmu Administrasi Dan Manajemen Kepelabuhanan (STIAMAK) Barunawati Surabaya', 'Sigit Susanto Putro S.Kom,. M.Kom', 'Yoga Dwitya Pramudita S.Kom., M.Cs', 'Dalam mengelola data keuangan, Sekolah Tinggi Ilmu Administrasi dan Manajemen Kepelabuhanan (STIAMAK) Barunawati Surabaya masih menggunakan cara manual dalam mengolah data keuangannya yaitu dengan mencatatkan pada sebuah buku besar dan hanya dibantu aplikasi Ms.Excel. Petugas yang berwenang juga harus menuliskan ke dalam buku transaksi pembayaran serta bukti pembayaran berupa kuitansi yang ditulis secara manual. Sering pula terjadi kehilangan data keuangan sehingga menimbulkan kesalahan pada proses pembuatan laporan karena pencatatan yang dilakukan secara manual. Pembuatan sistem informasi manajemen keuangan ini bertujuan mempermudah pihak yang berwenang dalam hal ini bendahara untuk mengolah seluruh kegiatan yang berhubungan dengan transaksi keuangan antara lain pembayaran SPP, uang gedung, pembayaran tugas akhir dan KKN, penggajian, pengelolaan kas kecil dan laporan pemasukan dan pengeluaran. Sistem informasi manajemen keuangan ini juga dapat melakukan pencetakan kuitansi dan membantu bendahara dalam menyusun laporan harian maupun bulanan.\r\n\r\nKata kunci: sistem informasi manajemen, Sekolah Tinggi Ilmu Administrasi dan Kepelabuhanan (STIAMAK) Barunawati Surabaya\r\n', 'Arini Roselina', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100092'),
(169, '080411100093', 'SISTEM PENDUKUNG KEPUTUSAN PEMBERIAN TANDA PENGHARGAAN GERAKAN PRAMUKA (TPGP) MENGGUNAKAN METODE SMARTER\r\n(Studi Kasus Kwartir Daerah Gerakan Pramuka Jawa Timur)', 'Andharini Dwi C., S.Kom., M.Kom.', 'Rika Yunitarini, ST., MT.', 'Pemberian Tanda Penghargaan Gerakan Pramuka (TPGP) merupakan program tahunan yang dilaksanakan oleh Kwartir Nasional Gerakan Pramuka. Salah satu bentuk penghargaan tersebut adalah Lencana Darma Bakti. Proses penyeleksian calon penerima TPGP Lencana Darma Bakti dilakukan bertahap dan secara manual. Pada penelitian ini dirancang sebuah sistem pedukung keputusan untuk membantu mempermudah melakukan seleksi calon penerima TPGP Lencana Darma Bakti. Metode Simple Multi-Atribute Rating Technique Exploiting Ranks (SMARTER) dipilih karena mampu menyeleksi alternatif terbaik dari sejumlah alternatif. Alternatif yang dimaksudkan yaitu orang yang berhak menerima penghargaan berdasarkan empat kriteria yang digunakan yakni Tingkatan Pancawarsa, Prestasi dalam Pramuka, Riwayat Jabatan di Pramuka, dan Pendidikan Kepramukaan. Dari hasil pengujian sistem, diperoleh prosentase hasil penilaian kelayakan sebesar ? 70% (prosentase total respon super admin sebesar 95%, admin kwarda sebesar 85.71%, dan admin kwarcab sebesar 87.18%). Sehingga bisa disimpulkan mampu memberikan hasil yang optimal dan layak digunakan dilingkungan Kwartir Daerah Gerakan Pramuka Jawa Timur. \r\nKata Kunci : Gerakan Pramuka, TPGP, Lencana Darma Bakti, SMARTER.', 'Rifan Zulkifli', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100093'),
(170, '080411100096', 'ANALISA KESESUAIAN PENEMPATAN PEGAWAI NEGERI SIPIL TENAGA PENDIDIKAN BERBASIS GIS MENGGUNAKAN METODE NAÏVE BAYESIAN', 'Hermawan, S.T.,M.Kom', 'Cucun Very Angkoso, S.T.,M.T', 'Kesesuaian penempatan merupakan hal yang sangat penting dalam penyediaan tenaga pendidik suatu instansi sekolah. Penempatan tenaga pendidik yang tepat pada jabatan/posisi yang tepat akan membentuk kepuasan secara psikologis kepada tenaga pendidik, akhirnya akan melahirkan motivasi dan kreatifitas kerja yang tinggi. Penelitian ini membahas tentang sistem yang dapat menganalisa kesesuaian penempatan Pegawai Negeri Sipil(PNS) Tenaga Pendidik berbasis Geographic Information System (GIS), sehingga penempatan PNS tenaga pendidik dapat dianalisa kesesuaian penempatannya serta dipetakan menurut instansi sekolah masing-masing guna mengetahui jarak antara instansi dengan alamat rumah PNS. Sistem ini dibangun menggunakan google map untuk pemetaanya dan metode Naïve Bayes untuk menganalisa kesesuaian penempatan PNS tenaga pendidik, yang memprediksi probabilitas di masa depan berdasarkan pengalaman dimasa sebelumnya. Atribut yang digunakan adalah Jenis Kelamin, Golongan, Tingkat Pendidikan, Jarak Rumah. Output dari sistem ini berupa analisa kesesuaian penempatan PNS. Untuk menghitung keakurasian menggunakan 150 data dengan ujicoba sebanyak 3 kali. Dari ujicoba tersebut menghasilkan akurasi tertinggi 93% dengan data training sebnyak 120 dan data ujicoba 40. Hasil dari penelitian ini adalah metode Naïve Bayes dapat diaplikasikan untuk menentukan status kesesuaian penempatan PNS tenaga pendidik. Dengan dibuatnya aplikasi analisa ini data pegawai negeri sipil tenaga pendidik dapat dipetakan menurut instansi sekolah masing-masing untuk kemudian dapat di analisa efektifitas penempatannya dengan metode Naïve Bayes.\r\n', 'Zaka Dwidian', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100096'),
(171, '080411100097', 'PENGELOMPOKAN TINGKAT KESEHATAN MASYARAKAT JAWA TIMUR MENGGUNAKAN SOM DENGAN CLUSTER VALIDATION IDB DAN I-DUNN\r\n', 'Bain Khusnul Khotima,S.T, M.Kom', 'Budi Dwi Satoto, S.T, M.Kom', 'Data hasil RISKEDAS JAWA TIMUR merupakan data yang tidak teratur. Hal ini disebabkan karena data tersebut merupakan data riil atau data nyata yang didapatkan dari dari survei lapangan secara langsung. Salah satu metode pengolahan data dengan cara pengelompokan (Clustering) adalah SOM (Self Organizing Map). Sedangkan penggunaan Cluster validation dalam SOM bertujuan untuk meningkatkan akurasi hasil analisa data. Cluster Validation terdiri dari IDB dan Index DUNN. Pada proses awal akan dilakukan Clustering menggunakan SOM untuk menentukan Cluster-Cluster dari data yang sudah ada. Kemudian dilanjutkan dengan proses Validation menggunakan IDB dan I-DUNN. Hasil yang dicapai pada penelitian ini sesuai uji coba yang telah dilakukan pada modul data penyakit mata dengan record kabupaten di jawa timur  di hasilkan nilai IDB dengan hasil nilai terbesar ada pada tiga Cluster dengan nilai 32,8657368103193, dan nilai terkecil ada pada sepuluh cluster dengan Nilai 9,85972104309579  sedangkan nilai I-DUNN nya dengan hasil terkecil ada pada tiga Cluster dengan nilai 0,666666666666667 dan nilai terbesar terdapat pada sepuluh Cluster dengan nilai 0,9. Sehingga dapat disimpulkan bahwa metode Cluster SOM mengunakan Cluster validation IDB semakin kecil nilai yang dihasilkan maka semakin bagus hasilnya sedangkan mengunakan Cluster validation I-DUNN semakin besar nilai yang dihasilkan maka semakin bagus hasil yang di dapat.', 'Adam Muhammad', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100097'),
(172, '080411100099', 'RANCANG BANGUN GAME SEBAGAI MEDIA AJAR UNTUK ANAK', 'Arif Muntasa, S.Si., MT', 'Cucun Very Angkoso, ST., MT', 'Seiring perkembangan teknologi yang semakin pesat terutama di bidang multimedia, manusia dituntut untuk memiliki kemampuan bahasa yang bagus. Bahasa Inggris memiliki peranan penting dan menjadi salah satu bahasa yang amat sangat penting untuk dipelajari, karena banyak teknologi maju dalam bidang multimedia menggunakan bahasa Inggris sebagai bahasa mendasar untuk saling berkomunikasi.\r\nSaat ini pembuatan game edukasi tengah berkembang pesat ditengah-tengah masyarakat, dan banyak anak kecil yang bosan untuk belajar bahasa Inggris namun gemar bermain game, maka perancangan game edukasi ini perlu untuk dilakukan sebagai media pembelajaran yang interaktif dan menarik minat anak-anak untuk belajar.\r\nDalam game Bahasa Inggris ini, pengguna selain belajar cara pengucapan kata yang benar, pengenalan warna dan nama-nama hari pengguna juga dapat menikmati beberapa permainan yang disediakan seperti menebak gambar. Berdasarkan hasil uji coba pada pengguna bahwa game ini user friendly. 85% responden menyatakan game menarik, 40% responden menyatakan game masih sulit, sisi materi 90% responden sangat membantu dalam permainan, sisanya 10% belum terbantu.\r\n\r\nKata Kunci: game Bahasa Inggris, edukasi, anak.\r\n', 'Yoga Ryandita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100099'),
(173, '080411100100', 'RANCANG BANGUN PERMAINAN ULAR TANGGA BERBASIS AUGMENTED REALITY', 'ARIK KURNIAWATI, S.Kom, M.T.', 'ARI KUSUMANINGSIH, S.T., M.T.', 'Permainan Ular Tangga sangat tenar dikalangan anak kecil zaman dahulu. Kini permainan ini, meski telah dikemas lebih modern menggunakan berbagai petak dengan ukuran berbeda serta bidak dengan tambahan magnet, namun keberadaannya sudah semakin menghilang. Oleh karena itu, perlu implementasi Augmented Reality dalam permainan ular tangga sehingga permainan menjadi lebih menarik dan interaktif.	 Augmented Reality merupakan teknologi yang menggabungkan benda maya dua dimensi dan atau pun tiga dimensi ke dalam sebuah lingkungan nyata tiga dimensi lalu memproyeksikan benda-benda maya tersebut dalam waktu nyata. 	Pada Penelitian ini dilakukan penelitian tentang teknologi Augmented Reality yang diterapkan kedalam permainan Ular Tangga. Diharapkan penelitian ini, Augmented Reality dapat  memberikan pengalaman bermain Ular Tangga yang lebih menyenangkan. Dari sepuluh pengguna sistem dengan pertanyaan seputar permainan ular tangga ini, maka diperoleh hasil 80% menjawab bagus, 10% menjawab sedang dan 10 % lagi menjawab tidak bagus.\r\n', 'AGUNG SATRIO UTOMO', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100100'),
(174, '080411100101', 'Pengelompokan Siswa Menggunakan Felder Silvermen Learning Sistem Model (FSLSM) dan Fuzzy C-Means', 'Andarini Dwi C., S.Kom., M.Kom', 'Bain Khusnul K., S.T., M.Kom', 'Pengelompokan Siswa Menggunakan Felder Silvermen Learning Sistem Model (FSLSM) dan Fuzzy C-Means', 'Saharotus Sakbania', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100101'),
(175, '080411100102', 'Aplikasi Penilaian Kinerja dengan Metodologi Customer Realtionship Management (CRM)', 'Moch. Kautsar Sophan, S.Kom., M.MT', 'Dr. Rachmad Hidayat, ST., MT', 'Setiap perusahaan mengharapkan adanya hubungan baik dengan pelanggan, begitupun dengan PT. X sebagai perusahaan yang bergerak di bidang minyak dan gas bumi Negara. Pengelolaan hubungan yang baik akan berdampak pada peningkatan citra perusahaan dimata pelanggan. Penilaian kinerja perusahaan dapat diukur dengan menggunakan kriteria dari CRM Scorecard. CRM Scorecard diambil dari Balanced Scorecard (BSC) dengan berfokus pada pelanggan. Adanya penilaian kinerja dengan metode Analytic Network Process (ANP) untuk pembobotan, PT. X dapat  menilai kinerja perusahaan dengan ditunjukkan oleh Traffic Light System sebagai hasilnya. Hasil scoring KPI menunjukkan bahwa terdapat 2 KPI yang berada pada level buruk, yaitu Ekuitas Pelanggan dan Sistem Penghargaan. Kedua KPI ini diperlukan perhatian yang lebih. Indikator yang berada pada level cukup ada 3 KPI, yaitu yaitu Perluasan Pelanggan, Teknologi Informasi, dan Struktur Organisasi. Perusahaan harus berhati-hati dengan berbagai macam kemungkinan yang dapat terjadi. Indikator yang berada pada level baik ada 9 KPI, yaitu Profitabilitas, Kesetiaan Pelanggan, Kepuasan Pelanggan, Nilai Hubungan dengan Pelanggan, Perolehan Pelanggan, Mempertahankan Pelanggan, Peranan Manajemen, Pelatihan, dan Kerjasama.\r\n\r\nKata Kunci:  Sistem Penilaian Kinerja, CRM Scorecard,  Analytic Network Process (ANP), Key     Performance Indicator (KPI)\r\n', 'Luthfi Zahro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100102'),
(176, '080411100103', 'RANCANG BANGUN SISTEM PENDUKUNG KEPUTUSAN UNTUK RENCANA ANGGARAN BIAYA TENDER KONTRUKSI MENGGUNAKAN METODE VIKOR (Studi Kasus : PT. Gramulia Utama)', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Firli Irhamni, S.T., M.Kom.', 'PT. Gramulia Utama adalah salah satu perusahaan jasa yang bergerak dibidang konstruksi bangunan. PT Gramulia Utama mengerjakan proyek bangunan sipil atau fasilitas umum seperti perumahan, gedung, perkantoran, bendungan, jalan, jembatan, waduk, pelabuhan, dan fasilitas umum lainnya. Untuk penawar suatu tender, perusahaan harus membuat rencana anggaran biaya yang memiliki rincian pekerjaan dan biaya yang dibutuhkan dalam mengerjakan suatu proyek tender. Saat ini PT Gramulia Utama masih menghitung secara manual dengan menggunakan Microsoft Excel untuk proses pembuatan rencana anggaran biaya dan membutuhkan waktu yang lama untuk memilih harga bahan tender. Hal ini menyebabkan perusahaan hanya dapat melakukan penawaran untuk beberapa tender saja ketika banyak tender yang harus dieksekusi. Dengan menganalisa hal tersebut, maka perlu adanya solusi untuk membangun sistem pendukung keputusan yang mampu membantu proses pembuatan rencana anggaran biaya dan pemilihan alternatif bahan tender dengan estimasi waktu yang lebih cepat. Salah satu metode yang dianggap mampu dalam membantu kasus ini adalah metode Vikor dimana dugaan dari dominasi kriteria yang digunakan adalah penggunaan nilai dalam hubungan perankingan.', 'Zendi Kusuma Putra Widodo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100103'),
(177, '080411100105', 'Market Basket Analysis dengan Metode Algoritma Apriori Association Rules', 'Moch.Kautsar Sophan,S.Kom.,M.MT', 'Bain Khusnul K,S.T.,M.Kom', 'Marked Basket Analisis (MBA) adalah salah satu konsep dalam data mining yang bertujuan untuk menganalisis perilaku konsumen, yaitu dengan menganalisis produk yang biasanya dibeli bersamaan dengan produk lain berdasarkan data transaksi yang diambil dari data historis dari pembelian di toko atau supermarket. Dengan MBA, Data historis tersebut dapat diubah  menjadi sebuah informasi yang berharga sehingga dapat mencapai strategi bisnis yang baik. MBA dapat diterapkan dengan berbagai macam algoritma, salah satunya adalah Algoritma apriori. Dalam proses Algoritma Apriori akan dilakukan perhitungan support  dan confidence dari tiap-tiap kombinasi barang yang memungkinkan. Kemudian, dibutuhkan juga adanya minimum support dan minimum confidence untuk menyeleksi kombinasi-kombinasi yang memenuhi syarat. Dari hasil ujicoba data yang telah dipartisi dapat diketahui bahwa dari beberapa partisi data  yang telah di ujicoba ,mulai data 50 sampai 550 di dapatkan hasil, Semakin besar data maka akan banyak kombinasi barang yang tereliminasi, sehingga menghasilkan data kombinasi yang lebih efisien dan akurat, yaitu data 550 dengan rata-rata waktu proses  2-4 detik.', 'Rana Drajat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100105'),
(178, '080411100108', 'PERAMALAN STOK OBAT MENGGUNAKAN JST ALGORITMA BACKPROPAGATION', 'Moch. Kautsar Sophan, S.Kom., M.MT', 'Fika Hastarita Rachman, ST., M.Eng', 'Obat merupakan salah satu bagian penting untuk seseorang yang sakit dan yang membutuhkan perawatan. Peningkatan jumlah pasien yang tidak terduga di Rumah Sakit menyebabkan kebutuhan obat yang tidak teratur. Oleh karena itu diperlukan sistem peramalan yang mampu meramalkan pembelian obat pada periode berikutnya. Peramalan ini menggunakan metode Jaringan Syaraf Tiruan dengan algoritma Backpropagation untuk meramalkan jumlah pemesanan periode berikutnya. Data obat dihitung menggunakan ROP atau Re-order Point untuk ditentukan tingkat levelnya, apakah aman atau tidak aman dengan berdasarkan variabel yang mendukung seperti, stok terkini, safety stok dan lead time beserta data transaksi yang ada. Untuk proses perhitungan ROP nya yang mempengaruhi lebih besar atau lebih kecil dari stok obat terkini yaitu safety stok dan lead time. Jika obat tersebut ada pada lebel tidak aman, maka akan dilanjutkan ke proses peramalan. Data yang digunakan adalah data penjualan  yang terdiri dari 12 bulan dan masing-masing bulan ada 4 minggu. Dengan MSE sebesar 0,1 dibutuhkan waktu sekitar 64 detik dengan momentum 0,1 learning rate 0,1 dan epoch 5000 dari skenario ujicoba sistem.', 'Taufik Ramadhani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100108'),
(179, '080411100109', 'SEGMENTASI OBYEK PADA CITRA DIGITAL MENGGUNAKAN METODE OTSU THRESHOLDING', 'Dr. Arif Muntasa, S.Si., M.T.', 'Rima Tri Wahyuningrum, S.T., MT.', 'Citra digital memiliki ukuran dan obyek berupa foreground dan background. Untuk memisahkannya, perlu dilakukan sebuah proses segmentasi citra. Salah satu metode dalam proses segmentasi citra adalah menggunakan Metode Otsu thresholding. Penelitian ini dibagi menjadi lima proses, yaitu input data citra, pre-processing, segmentasi, cleaning, dan perhitungan akurasi. Tahap pertama adalah input data citra digital RGB yang di dalamnya terdiri dari beberapa obyek. Tahap kedua adalah konversi dari citra RGB ke citra grayscale. Tahap ketiga adalah mencari nilai ambang secara otomatis menggunakan Metode Otsu thresholding, kemudian dikonversi ke citra biner. Tahap keempat adalah proses invert image, noise removal dengan nilai ambang 150, dan morphology. Tahap terakhir adalah proses  perhitungan akurasi dilakukan untuk mengukur kinerja dari metode segmentasi yang selanjutnya hasil dari proses tersebut dibandingkan dengan citra Ground Truth hasil pengamatan user secara langsung untuk menghitung tingkat akurasi. Pengujian dilakukan pada Weizmann Segmentation Database sebanyak 30 citra digital RGB. Akurasi yang didapat dari pengujian tersebut sebesar 93,33%.', 'Slamet Imam Syafi\'i', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100109'),
(180, '080411100111', 'Analisis Dampak Penerapan Metode Diskretisasi Data terhadap Performa Diagnosis Penyakit Liver Berbasis K-Nearest Neighbor', 'Mula\'ab, S.Si., M.Kom.', 'Iwan Santosa, S.T., M.T.', 'Akurasi adalah faktor terpenting yang harus dipertimbangkan dalam memilih metode klasifikasi data. Semakin tinggi akurasi suatu metode klasifikasi data, semakin layak metode tersebut diterapkan. Pada kasus diagnosis penyakit liver, metode k-Nearest Neighbor (KNN) menunjukkan akurasi yang tinggi. Di sisi lain, beberapa penelitian menunjukkan bahwa penerapan diskretisasi berbasis entropy sebagai metode preprocessing mampu meningkatkan akurasi klasifikasi data. Karenanya, dibangun sebuah hipotesis bahwa penerapan diskretisasi berbasis entropy juga mampu meningkatkan akurasi klasifikasi data pada kasus diagnosis penyakit liver. Dalam penelitian ini, diskretisasi berbasis entropy diterapkan sebagai metode preprocessing, sedangkan KNN digunakan sebagai metode klasifikasi. Klasifikasi dilakukan terhadap data set awal dan data set yang telah melalui proses diskretisasi berbasis entropy. Kemudian, akurasi yang dihasilkan oleh klasifikasi terhadap data set awal dibandingkan dengan akurasi yang dihasilkan oleh klasifikasi terhadap data set terdiskretisasi. Dari seluruh skenario uji coba yang telah dilakukan, terlihat bahwa akurasi klasifikasi pada data set terdiskretisasi lebih tinggi daripada akurasi klasifikasi pada data set awal. Hal ini terjadi pada seluruh nilai k yang diuji. Oleh karena itu, disimpulkan bahwa penerapan diskretisasi berbasis entropy dapat meningkatkan akurasi diagnosis penyakit liver berbasis KNN. Peningkatan akurasi yang diperoleh berkisar antara 1,03% hingga 4,8%.', 'Candra Utomo Alatas', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100111'),
(181, '080411100112', 'Rancang Bangun Sistem Pemilihan Supplier Menggunakan Metode Fuzzy - Data Envelopment Analysis (F-DEA)', 'Fika Hastarita Rachman, S.T., M.Eng.', 'Dr. Rahmat Hidayat, M.T.', 'Memberikan pelayanan terbaik merupakan hasil akhir yang dapat mengukur tingkat keberhasilan suatu perusahaan. Distribusi memiliki peran penting mendukung keberhasilan perusahaan untuk menghasilkan performansi terbaik.  Pemilihan  supplier   dengan  mengukur performansi supplier adalah hal penting yang harus dilakukan oleh perusahaan untuk mengoptimalkan biaya dan waktu produksi. Penelitian ini dilakukan pada PT. PAL Indonesia dengan mengambil objek Kapal Patroli Cepat (KPC). Permasalahan dalam penelitian ini adalah akan ditentukan supplier terbaik berdasarkan banyak kriteria. Metode Fuzzy digunakan untuk melakukan penilaian terhadap kriteria yang dimiliki supplier, sedangkan untuk penilaian efisiensi digunakan metode Data Envelopment Analysis (DEA). Fuzzy – Data Envelopment Analysis merupakan pengembangan dari metode DEA standar. Dari hasil pengolahan dan analisa data disimpulkan bahwa supplier yang efisien menurut kriteria untuk Copper pipe adalah Myeong S. untuk elektroda adalah PT. Thermadine, supplier untuk kayu adalah PT. Gotong Royong, dan supplier untuk kabel adalah JS. Cable.\r\n', 'Gilar Singgih Sutandi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100112');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(182, '080411100113', 'SISTEM PEROLEHAN CITRA BERBASIS ISI MENGGUNAKAN WAVELET HAAR DAN EUCLIDEAN DISTANCE', 'BAIN KHUSNUL KHOTIMAH, S.T., M.Kom.', 'ABDULLAH BASUKI RAHMAT, S.Si., M.T.', 'Batik merupakan seni yang paling penting dalam kehidupan masyarakat Indonesia. Keanekaragaman batik berasal dari beberapa wilayah diseluruh indonesia sehingga menyimbolkan karakteristik ciri pola batik yang berbeda-beda dari masing-masing daerah tempat batik tumbuh dan berkembang. Tugas Akhir ini telah berhasil membuat suatu Sistem Perolehan Citra berbasis Isi (SPCI) dengan ciri tekstur yang bertujuan untuk mengetahui ciri dari pola batik tersebut. SPCI merupakan metode atau teknik pencarian gambar citra yang mirip (similar) dengan melakukan perbandingan antara citra query dengan citra yang ada dalam basis data. Pada Penelitian  ini menggunakan ciri tekstur sebagai proses pencarian kemiripan dari delapan wilayah citra batik yang  berbeda yaitu: Cirebon, Bali, Bangkalan, Pamekasan, Sumenep, Yogyakarta, Solo, dan Pekalongan sebagai obyek perolehan citra berbasis isi. Metode yang digunakan pada penelitian ini berbasis tekstur kasar atau lembut yaitu metode Wavelet Haar. Wavelet Haar merupakan metode dimana pada setiap citra didekomposisi menjadi 4 bagian yaitu LL, LH, HL, dan HH. Pada masing-masing bagian tersebut ditentukan nilainya. Sehingga dari hasil ekstraksi fitur akan dilakukan pengukuran kemiripan dengan citra basis data dengan menggunakan metode Euclidean Distance. Citra query dan citra basis data yang dipergunakan sebanyak 200 citra dengan delapan kelas citra didalamnya. Citra tertinggi dari hasil uji coba skenario-skenario pada penelitian ini dapat diambil kesimpulan bahwa akurasi tertinggi ada pada kelas bangkalan, cirebon, pamekasan dan solo. Jumlah citra yang dihasilkan dari perhitungan akurasi adalah 8 citra yang mirip dari 10 citra terbaik yang ditampilkan berdasarkan fitur citra Roughness, yaitu fitur untuk mengetahui apakah sebuah tekstur tersebut kasar atau lembut. Dengan hasil nilai akurasi tertinggi sebesar 80 %.', 'VEMBRI PRATAMA PRISTYONO', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100113'),
(183, '080411100115', 'SISTEM AUGMENTED REALITY ANIMASI BENDA BERGERAK MENGGUNAKAN FLARTOOLKIT', 'Arik Kurniawati, S.Kom., M.T.', 'Haryanto, S.T., M.T.', 'Seiring perkembangan teknologi yang ada didunia, muncul teknologi yang disebut augmented reality. Augmented Reality (AR) merupakan upaya untuk menggabungkan dunia maya dan dunia virtual yang dibuat melalui komputer sehingga batas antara keduanya menjadi sangat tipis. Head-Mounted Display (HMD) merupakan contoh hasil dari penelitian tentang Augmented Reality, ini merupakan satu-satunya peralatan dasar dalam teknologi-teknologi terbaru. Seiring berjalannya waktu, augmented reality berkembang pesat sehingga memungkinkan pengembangan aplikasi ini di berbagai bidang.\r\n\r\nUntuk mengembangkan AR banyak sekali library pendukung yang dapat digunakan. FlarToolKit adalah salah satunya. FlarToolKit merupakan library pendukung augmented reality pada platform flash.\r\n\r\nBerdasarkan sistem AR animasi benda bergerak yang dibuat adalah animasi bergerak permainan pingpong dimana telah dikolaborasikan dengan augmented reality untuk menggerakkan setiap langkah dari playernya. Interaksi antar obyek tersebut dapat dilihat dari gerak bola yang dapat dipukul dengan obyek virtual yang ditampilkan melalui augmented reality.\r\n', 'Septian Rahman Hakim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100115'),
(184, '080411100116', 'IMPLEMENTASI ALGORITMA BREADTH FIRST SEARCH PADA PEMBUATAN GAME BOB THE ROB BERBASIS ANDROID OS', 'Cucun Very Angkoso S.T. M.T', 'Arik Kurniawati S.Kom, M.T.', 'Saat ini game telah berkembang pesat, perkembangan game didukung juga dengan angka penjualan device yang semakin tinggi dan terjangkau masyarakat, banyak device yang dapat digunakan bermain game salah satunya adalah Smartphone, jenis game yang populer dan sering dimainkan adalah Brain & Puzzle, game ini menggunakan logika sederhana untuk memainkannya. Tujuan dari penelitian ini adalah untuk menghasilkan game yang dapat dijadikan sebagai media hiburan serta untuk meningkatkan game-game lokal hasil kreatifitas anak bangsa, selain itu Game Bob The Rob juga dapat mengasah ketajaman berfikir dan memecahkan masalah, karena untuk menyelesaikan game tersebut membutuhkan konsentrasi dan cara berfikir yang baik. Salah satu aspek yang menjadi daya tarik game Bob The Rob adalah kecerdasan buatan (Artificial Intelligence), agar game tersebut dapat berjalan dengan baik maka digunakan Algoritma Breadth First Search (BFS). Algoritma BFS digunakan sebagai dasar pemilihan jalan agen cerdas untuk mencari jalan yang dapat dilalui dan penentuan jalur paling optimal. Setelah dijalankan pada smartphone dengan resolusi 320x480 dan 480x800 pixels serta hasil kuesioner yang diedarkan tanggal 15 juli 2013 game Bob The Rob mempunyai animasi yang menarik, mudah dimainkan dan berjalan sesuai dengan harapan.', 'Didin Yustisianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100116'),
(185, '080411100117', 'PENGEMBANGAN MEDIA PEMBELAJARAN INTERAKTIF MEMASANG INSTALASI PENERANGAN LISTRIK BANGUNAN SEDERHANA BERBASIS WEB DENGAN CMS', 'Sigit Susanto P., S.Kom, M.Kom', 'Arik K., S.kom., M.T.', 'Dalam proses belajar mengajar banyak faktor yang mempengaruhi siswa dalam menerima pemahaman dan penjelasan informasi yang di sampaikan oleh tenaga pengajar. Faktor tersebut antara lain adalah kurangnya siswa dalam mencerna atau sulit konsentrasi untuk menerima dan memahami bahan ajar yang di sampaikan oleh tenaga pengajar. Oleh karena itu di butuhkan bahan ajar yang cukup menarik dan dapat mudah di mengerti oleh siswa. Salah satu perangkat yang mendukung terciptanya pengembangan media pembelajaran adalah media pembelajaran berbasis web. Permasalahan yang saya hadapi adalah dalam penerapan materi pelajaran yang disampaikan dalam mata pelajaran “Instalasi Penerangan Listrik Ke Dalam Media Pembelajaran Berbasis Web dengan CMS”, apakah layak sebagai media interaktif yang sesuai standart kompetensi di SMK 1 KRIAN. Tujuan dari tugas akhir ini adalah membantu siswa dalam penyajian dan penyampaian materi mata pelajaran “Teknik Instalasi Pemanfaatan Tenaga Listrik” pada program keahlian instalasi penerangan listrik, untuk menghasilkan media pembelajaran multimedia interaktif untuk siswa dalam proses pembelajaran pemasangan instalasi listrik bangunan sederhana. Untuk lebih mudah, efisien, efektif dan dapat di gunakan semua orang. Dan dalam memproses penilaian lebih baik. Respon dari guru dan siswa terhadap sistem ini menunjukan respons yang positif dengan presentase total respons guru adalah sebesar 70% yang dinyatakan dalam tabel baik dan siswa adalah sebesar 91% sangat baik.', 'Bagus Arifina Firnata', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100117'),
(186, '080411100118', 'Pemetaan Kesesuaian Lahan Untuk Budidaya Tanaman Pangan Menggunakan Naive Bayes Berbasis GIS', 'Mula\'ab, S.Si.,M.Kom', 'Fika Hastarita Rachman, S.T.,M.Eng', 'Ketahanan Pangan Nasional diartikan sebagai kemampuan Negara untuk memenuhi kecukupan pangan seluruh penduduknya. Oleh karena itu upaya peningkatan ketahanan pangan merupakan salah satu program pokok dengan prioritas pencapaian produksi untuk memenuhi kebutuhan nasional. Kesesuaian lahan untuk tanaman pertanian pada dasarnya merupakan pencerminan kesesuaian kondisi fisik lahan terhadap penggunaan yang bersangkutan. Diketahui data kesesuaian lahan dan data produksi serta produktivitas pertanian daerah dapat menemukenali keselarasan antara kondisi lahan dengan kemampuan berproduksinya. Dalam hal ini maka, dibuatkanlah Sistem Pendukung Keputusan (SPK) untuk mendapatkan tanaman yang sesuai dengan keadaan lahan setiap daerah. SPK ini menggunakan Naïve Bayes. Hasil dari tiap - tiap lahan tersebut akan melalui proses Naïve Bayes yang sebelumnya melalui proses pembelajaran terlebih dahulu sebelum program dapat digunakan untuk melakukan klasifikasi. Melalui pengujian dan perbandingan data hasil menghasilkan prosentase keakuratan 97,07%, yaitu dari 205 data yang diprediksi, terdapat 199 kesamaan nama tanaman oleh sistem. Kemudian dari proses dapat diidentifikasi lokasi lahan yang kemudian dapat direpresentasikan menjadi Geografic Information System yang mengambil peta dari google maps.', 'Eka Zuhdi Putra Natari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100118'),
(187, '080411100122', 'OPTIMALISASI WAKTU KUNJUNGAN TERBAIK WISATA KULINER DI KOTA BANGKALAN MENGGUNAKAN ANT COLONY OPTIMIZATION', 'Bain Khusnul Khotimah, S.T,M.Kom', 'Andharini Dwi C.,S.kom., M.Kom', 'Bangkalan adalah suatu kota di Jawa Timur yang tengah berkembang, setelah adanya jembatan Suramadu, dengan mudahnya akses ke kota bangkalan wisatawan dari luar kota yang datang berkunjung ke Bangkalan. Terbatasnya informasi tentang lokasi wisata di Bangkalan menimbulkan keterbatasan bagi wisatawan, maka karena hal ini di buatlah software optimalisasi waktu kunjungan terbaik wisata kuliner di kota Bangkalan dengan metode ant colony. Dengan di buatnya software ini wisatawan dapat mengetahui daftar rumah makan di kota bangkalan sekaligus mendapatkan rekomendasi waktu kunjung terbaik dan dapat sekaligus membantu pertumbuhan kota Bangkalan. Dari hasil percobaan yang dilakukan program dapat memberikan saran waktu dan urutan kunjung bagi wisatawan yang akan melakukan wisata kuliner tetapi juga terdapat beberapa hal dimana program memberikan saran kunjung pada satu waktu yang sama, dimana hal ini adalah kekurangan dalam program optimasi ini. ', 'moh sofyan tri sutrisno', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100122'),
(188, '080411100123', 'PERBANDINGAN METODE COLOR CO-OCURRENCE MATRIX & MODIFIED COLOR CO-OCCURRENCE MATRIX PADA SISTEM PEROLEHAN CITRA BERBASIS ISI UNTUK CITRA BATIK', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Sistem Perolehan Citra berbasis Isi (SPCI) merupakan sistem pencarian citra menggunakan isi visual, untuk mencari citra relevan pada database citra sesuai dengan citra inputan yang diinginkan oleh pengguna. Fitur yang terkait isi visual terdiri dari bentuk, warna dan tekstur adalah fitur utama sebuah citra. Warna adalah salah satu fitur visual yang paling banyak digunakan dalam CBIR karena warna dapat dikenali langsung oleh indra manusia. Oleh karena itu, Fitur warna digunakan dalam  penelitian ini sebagai proses ekstraksi fitur dari delapan kelas citra batik yaitu: citra batik Cirebon, batik Bali, batik Pamekasan, batik Solo, batik Jogja, batik Sumenep, batik Pekalongan, dan batik Bangkalan sebagai objek perolehan citra berbasis isi. Terdapat dua tahapan yaitu tahapan pertama ekstraksi fitur warna dengan menggunakan metode Color Co-occurrence Matrix, tahap ke dua dilakukan pencocokan antara citra database dan citra query menggunakan Similarity. Pada proses similarity dilakukan modifikasi yang disebut Modified Color Co-occurrence Matrix. Dari tiga skenario yang telah di uji coba pada 200 citra batik, dengan percobaan 10 citra query di dapatkan bahwa tingkat presicion MCCM lebih tinggi dibanding dengan CCM, masing masing tingkat akurasi presicion 66% untuk CCM dan 73% untuk MCCM. ', 'Endang Rustiyana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100123'),
(189, '080411100124', 'SISTEM INFORMASI PENJADWALAN MATA PELAJARAN MENGGUNAKAN METODE ALGORITMA GENETIKA DAN CONSTRAINT SATISFACTION', 'Fika Hastarita, S.T.,M.Eng', 'Andharini Dwi Cahyani, S.Kom.,M.Kom', 'Sekolah Menengah Kejuruan atau yang sering disebut SMK merupakan bentuk satuan pendidikan formal yang memiliki banyak sekali program keahlian.  Di SMKN 2 Bangkalan terdapat banyak program keahlian, yang tentunya memiliki banyak sekali mata pelajaran namun masih memiliki ruang yang terbatas. Selain itu, terdapat berbagai aspek yang berkaitan dalam penjadwalan tersebut yang harus dilibatkan antara lain kelas, hari, waktu, guru pengajar, pelajaran dan penjadwalan mata pelajaran yang diharapkan dapat  merata setiap harinya untuk setiap kelas. Untuk mengatasi permasalahan ini diperlukan sistem informasi penjadwalan mata pelajaran untuk membantu pembuatan penjadwalan agar lebih mudah dan cepat dan menghasilkan jadwal mata pelajaran yang optimal. Metode yang dapat digunakan untuk menyelesaikan permasalahan tersebut adalah dengan menggunakan pendekatan Algoritma Genetika yang dipadukan dengan metode Constraint Satisfaction Problem. Dalam metode Algoritma Genetika terlebih dahulu akan dilakukan pembuatan kromosom, perhitungan nilai fitness, reproduksi sampai dihasilkan jadwal. Jadwal yang dihasilkan tersebut selanjutnya akan diproses dengan menggunakan metode Constraint Satisfaction Problem  sehingga didapatkan jadwal dengan tingkat error yang lebih kecil. Dari hasil uji coba yang dilakukan dalam penelitian ini, diperoleh tingkat error sebesar 0,005 dengan jumlah generasi sebanyak 250 dan iterasi sebanyak 500 dengan Pc 0,01 dan Pm 0,5.\r\n\r\nKata Kunci:  Penjadwalan, Algoritma Genetika, Constraint Satisfaction Problem\r\n', 'Arini Warandeka', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100124'),
(190, '080411100125', 'PENGENALAN TELAPAK TANGAN MENGGUNAKAN METODE NAÏVE BAYES BERBASIS REDUKSI DIMENSI  PRINCIPAL COMPONENT ANALYSIS (PCA)', 'Mulaab, S.Si., M.Kom.', 'Rima Tri Wahyuningrum, ST.,MT.', 'Teknologi biometrik saat ini mengalami perkembangan sangat pesat dan sudah lazim diterapkan pada berbagai bidang aplikasi. Proses pengenalan telapak tangan telah diteliti selama lebih dari 10 tahun.  Telapak tangan merupakan biometrika yang masih relatif baru. Telapak tangan memiliki beberapa karakteristik yang unik berupa garis telapak tangan dan bersifat stabil. Setiap orang mempunyai garis telapak tangan yang berbeda meskipun orang itu kembar. Keunikan dan kestabilan dari garis telapak tangan pada telapak tangan merupakan fitur handal setiap telapak tangan untuk digunakan pada sistem pengenalan. Dalam penelitian ini, proses pengenalan telapak tangan menggunakan metode Naive Bayes sebagai proses classifier dan  reduksi dimensinya menggunakan Principal Component Analysis (PCA). Sistem diuji coba menggunakan 100 citra telapak tangan dari 10 orang, setiap orang terdiri dari 10 sampel telapak tangan. Hasil pengujian rata-rata memperoleh persentase keberhasilan sebesar 51,45%.', 'Daril Ulumiyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100125'),
(191, '080411100126', '\r\nPERANCANGAN DAN PEMBUATAN APLIKASI PENCARIAN INFORMASI BEASISWA DENGAN MENGGUNAKAN COSINE SIMILARITY\r\n', 'Firdaus Solihin, S.Kom., M.Kom.', 'Fika Hastarita Rachman, S.T., M.Eng.', 'Banyak informasi beasiswa yang ada di internet, di satu sisi memunculkan kesulitan bagi para pencari beasiswa untuk mendapatkan informasi beasiswa. Konsep sistem pencarian berbasis information retrieval (IR), dapat digunakan untuk proses mencari informasi beasiswa melalui media internet. Pembangunan IR pada penelitian ini menggunakan konsep vector space model (VSM). Untuk pengumpulkan data informasi beasiswa menggunakan Web Crawler, hasil dari proses crawling akan disimpan ke dalam basis data. Aplikasi Web Crawler yang digunakan adalah Web Crawler Vietspider. Kesamaan data beasiswa yang akan diintegrasikan oleh cosine similarity. Dengan menggunakan cosine similarity untuk membentuk data beasiswa yang relevan satu sama lain yang dibutuhkan oleh user berdasarkan query yang dimasukkan. Berdasarkan hasil dari pengujian sistem, didapatkan nilai minimal cosine similarity paling baik adalah threshold 0,1. Dengan rata-rata presentase nilai f-measure atau tingkat efisiensi kinerja sistem ini mencapai    19,9 %.', 'Andry Kurniawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100126'),
(192, '080411100128', 'RANCANG BANGUN E-LEARNING PENGENALAN KOMPONEN ELEKTRONIKA DASAR', 'Sigit Susanto Putro, S.Kom, M.Kom', 'Arik Kurniawati, S.kom., M.T.', 'Sekolah Menengah Kejuruan Teknik Elektronika adalah sekolah yang khusus mempelajari segala macam tentang ilmu elektronika yang terdiri dari komponen dasar, rangkaian sederhana, hingga rangkaian elektronika seperti televisi, radio, DVD, dan lain lain. Bagi siswa tahun petama, para siswa dikenalkan dengan macam macam komponen komponen dasar seperti Resistor, Dioda, Kapasitor, Transistor. Pengenalan komponen selalu diajarkan oleh guru dengan buku. Cara mengajar seperti itu membuat para siswa bosan, dan kurang paham dengan penyampaian guru di kelas. Berdasarkan hal tersebut, penulis bermaksud membuat suatu program pembelajaran interaktif yaitu Rancang Bangun E-learning Pengenalan Komponen Elektronika Dasar menggunakan moodle. Moodle adalah salah satu software opensource dan dapat digunakan secara bebas dan gratis untuk menunjang sistem pembelajaran e-learning. E-learning ini berisi tentang pengenalan macam komponen elektronika, pengenalan komponen dimulai dari bentuk fisik komponen, lambang komponen, cara membaca komponen, dan fungsi dari komponen tersebut. Dan juga terdapat latihan soal yang bertujuan untuk melihat sejauh mana pemahaman siswa terhadap materi yang disampaikan. Berdasarkan hasil pengujian persentase guru 70% dan siswa 91% program ini mencapai hasil yang diinginkan yaitu untuk meningkatkan kemampuan siswa dan memberikan pengetehuan baru pada pelajar maupun pada non-pelajar dalam penerapan pengenalan komponen dasar elektronika.', 'Gunawan Dhimas Permana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100128'),
(193, '080411100129', 'SISTEM REKOMENDASI MATERI PEMBELAJARAN\r\nMENGGUNAKAN KOLB’S LEARNING STYLE\r\nPADA MATA PELAJARAN FISIKA\r\n', 'Andarini Dwi Cahyani', 'Firli Irhamni', 'ABSTRAK\r\nDi dalam proses pembelajaran konvensional, setiap peserta didik dianggap mempunyai gaya belajar yang sama atau homogen. Sedangkan pada dasarnya tiap peserta didik mempunyai gaya belajar yang berbeda dalam proses pembelajaran. Untuk mengatasi masalah keanekaragaman gaya belajar tersebut, maka dikembangkan Adaptive E-Learning System. Penelitian ini bertujuan untuk membuat sistem rekomendasi materi pembelajaran dimana konten pembelajarannya diadaptasikan dengan gaya belajar berdasarkan Kolb’s learning style dan knowledge level siswa. Kolb’s learning style mempunyai empat gaya belajar yaitu divergen, assimilasi, convergen, dan  akomodasi. Knowledge level mempunyai empat atribut yaitu apprentice, beginner, intermediate, dan expert. Sistem rekomendasi materi pembelajaran ini diuji cobakan kepada 116 siswa kelas sepuluh Madrasah Aliyah Negeri Tuban menggunakan kuisioner Kolb’s learning style dengan empat puluh pertanyaan, dengan membandingkan nilai rata-rata pretest dan nilai rata-rata postest. Hasil dari siswa yang menggunakan sistem rekomendasi materi pembelajaran e-learning adaptif ini, diperoleh peningkatan nilai sebesar 2,11% dari saat siswa melakukan pretest kemudian siswa melakukan latihan postest.\r\n\r\nKata kunci: Adaptive E-Learning System, Kolb’s learning style, sistem rekomendasi materi pembelajaran\r\n', 'Rohmatul Islamiyah Safitri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100129'),
(194, '080411100130', 'Aplikasi Pengenalan Sidik Jari Menggunakan Algoritma Phase Only Correlation', 'Eza Rahmanita, ST., MT.,', 'Meidya Koeshardianto, S.Si., MT', 'Sistem pengenalan sidik jari bertujuan untuk mengindentifikasi seseorang, namun salah satu kendala dalam pengenalan sidik jari seseorang adalah adanya distorsi pada citra sidik jari, pada penelitian sebelumnya distorsi citra sidik jari diklasifikasikan ke dalam lima kategori, yaitu: berminyak, kering, kotor, terpotong sebagian dan rotasi. Penelitian ini membahas tentang pengenalan sidik jari menggunakan spectrum fase citra sidik jari. tujuan dari penelitian ini adalah mencari besar perbedaan sudut antara citra sidik jari masukan dengan citra sidik jari pelatihan, metode yang digunakan adalah phase-only Correlation (POC), yaitu sebuah metode yang menghitung korelasi phase atau sudut dari citra sidik jari masukan dengan citra sidik jari pelatihan.\r\n\r\nKata kunci : Phase Only Correlation (POC), sidik jari, spectrum fase\r\n', 'Aqiyas A.P', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100130'),
(195, '080411100131', 'ERANCANGAN DAN PEMBUATAN\r\nMESIN PENCARI LOWONGAN PEKERJAAN\r\nMENGGUNAKAN METODE COSINE SIMILARITY', 'Firdaus Solihin, S.Kom., M.Kom.', 'Iwan Santosa S.T., M.T.', 'Saat ini data dan informasi lowongan pekerjaan di internet jumlahnya\r\nsangat banyak dan terus bertambah dari waktu ke waktu. Untuk\r\nmengantisipasi membludaknya informasi lowongan pekerjaan maka\r\nberkembanglah teknologi mesin pencari. Mesin pencari dalam penelitian\r\nini menggunakan konsep information retrieval. Perancangan dan\r\npembuatan mesin pencari ini memanfaatkan web crawler untuk\r\npengumpulan data informasi lowongan pekerjaan. Data informasi\r\nlowongan pekerjaan diambil dari internet, hasil dari proses crawling\r\nakan disimpan ke dalam database. Aplikasi web crawler yang\r\ndigunakan adalah vietspider. Metode cosine similarity digunakan untuk\r\nmengukur kemiripan antar dokumen yang terkait dengan query yang\r\ndiberikan oleh user. Untuk menggunakan aplikasi ini user harus\r\nmemasukkan query, sehingga akan didapatkan hasil pencarian lowongan\r\npekerjaan menurut query user. Dalam uji coba pertama user\r\nmemasukkan 3 query yang mengandung kata “lowongan kerja”, yaitu\r\n“lowongan kerja”, “lowongan kerja bumn”, dan “lowongan kerja bumn\r\npertamina”. Hasil yang dikembalikan ke user berjumlah sama yaitu 260\r\ndokumen, dengan nilai dari cosine similarity berbeda. Dalam uji coba\r\nkedua user memasukkan 3 query yang berbeda sama sekali, yaitu\r\n“lowongan bumn”, “jasa raharja persero”, dan “staff railindo global\r\nkarya”. Hasil yang dikembalikan ke user berjumlah berbeda, yaitu\r\nmasing masing 246, 72, dan 49. Nilai dari cosine similarity-nya juga\r\nberbeda.', 'Denny Setyo Raharjo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100131'),
(196, '080411100132', 'SISTEM INFORMASI PENDATAAN ALUMNI BERBASIS WEB PADA SEKOLAH\r\n(Studi Kasus : SMKN 1,Sampang)', 'Bain Khusnul K. ST.M.Kom.', 'Rika Yunitarini, ST.M.T.', 'Sekolah menengah kejurusan (SMKN 1) adalah salah satu sekolah negeri yang  ada  di sampang.  Program  studi  yang  ada  di SMKN 1  meliputi program  studi Teknik Gambar Bangunan, Teknik Elektronika Industri, Teknik Komputer Jaringan, Multimedia, Farmasi, Akuntansi, dan Pemasaran.  Tujuan  di  buat  sistem  informasi  ini adalah  untuk menyajikan  informasi  yang  bermanfaat  bagi  kepentingan  evaluasi hasil  pendidikan  tinggi  dan  selanjutnya  dapat  digunakan  untuk  penyempurnaan dan  penjaminan  kualitas  SMKN 1,Sampang.\r\n	Tahapan yang dilakukan dalam penelitian adalah pengumpulan data dilakukan berdasarkan peninjauan secara langsung ke sekolah SMKN 1,Sampang.pengembangan sistem menggunakan berbasi sWeb yang dilanjutkan dengan perancangan yang meliputi perancangan proses,perancangan basis data.\r\n	Hasilnya berupa aplikasi sistem informasi alumni berbasis web pada sekolah yang dapat di implementasikan melalui internet dan PHP sebagai bahasa skrip (scrip language) dan MySQL untuk pengolahan database server dan tool PHPMyAdmin\r\n\r\n\r\nKata Kunci : Sistem Informasi, Alumni, SMKN 1.\r\n', 'Tri Kartika Mega', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100132'),
(197, '080411100133', 'RANCANG BANGUN PORTAL BERITA EVALUASI MUTU AKADEMIK DAN PROSES PEMBELAJARAN STUDI KASUS: PROGRAM STUDI TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO MADURA', 'Achmad Jauhari, S.T., M.Kom', 'Rika Yunitarini, ST., M.T.', 'Internet adalah salah satu teknologi yang berperan penting dalam berkomunikasi di zaman yang sudah modern seperti saat ini. Web adalah halaman informasi yang disediakan melalui jalur internet sehingga bisa diakses di seluruh dunia selama terkoneksi dengan jaringan internet. Portal web yaitu website yang menjadi pintu gerbang, starting point bagi pengunjung untuk memulai aktifitasnya di internet. Portal Akademik merupakan sebuah sistem informasi yang berfungsi sebagai integrator informasi akademik yang ada di berbagai unit akademik (program studi/fakultas) sekaligus sebagai sarana komunikasi antar civitas akademika kampus. Sistem  ini dibangun dari kondisi eksistensi informasi akademik di kampus yang sangat beragam dan bervariasi bentuknya, sehingga membutuhkan sebuah “portal” yang akan mengintegrasikan informasi-informasi tersebut sehingga mempermudah akses publik. Termasuk proses evaluasi yang biasanya dilakukan oleh mahasiswa Teknik Informatika Universitas Trunojoyo yang diadakan setiap semester. Biasanya evaluasi ini dilakukan secara manual dengan mengisi form evaluasi berupa lembaran kertas. Hal tersebut dinilai kurang efektif. Oleh sebab itu dibuatlah rancang bangun portal yang diharapkan memudahkan mahasiswa dalam melakukan pengisian evaluasi dan informasi terkait mutu akademik dan proses pembelajaran di prodi Teknik Informatika Universitas Trunojoyo.', 'Syamsudin Arifin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100133'),
(198, '080411100137', 'RANCANG BANGUN GAME EDUKASI BELAJAR ANGKA dan HURUF HIJAIYAH BERBASIS WEB dengan UNITY', 'Arik Kurniawati, S.Kom., M.T', 'Ari Kusumaningsih, S.T., M.T.', 'Dunia pendidikan mulai masuk kedalam dunia teknologi informasi. Banyak sekali kegiatan positif yang dapat membantu dalam pelaksanaan kegiatan belajar-mengajar di lingkungan pendidikan. Tidak terkecuali dalam dunia pendidikan agama, khususnya agama Islam. Sekarang cukup banyak aplikasi-aplikasi seperti Al-Qur’an digital dan jadwal shalat yang terpasang di komputer maupun laptop. Namun, untuk aplikasi kategori gameedukasi masih sedikit tersedia. Melihat perkembangan media dan teknologi maka dibuat proyek yang mengangkat judul tentang aplikasi pembelajran angka dan huruf Hijaiyah berbasis Unity2D, yaitu bagaimana membuat suatu aplikasi game 2D yang dibuat dengan UnityEngine berbasis web. Game edukasi ini bergenre shooter, dimana pemain diarahkan untuk mendengarkan lafadz soal dan menembak angka dan huruf Hijaiyah sesuai dengan soal yang dibacakan. Dengan sering bermain game ini maka player dapat lebih mengenal angka dan huruf Hijaiyah berserta lafadznya, sehingga bisa dijadikan media pembelajaran dasar Islami pada anak-anak. Menurut hasil pengamatan dari hasil uji game pada anak-anak dan juga berbagai pengalaman dalam beragam game. Dapat disimpulkan bahwa genre shootergame edukasi yang menyenangkan memiliki potensi besar untuk game edukasi yang menarik minat anak-anak untuk belajar.', 'ERI ALBAR FIRDAUS', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/080411100137'),
(199, '090411100001', 'PEMANFAATAN MADM ( MULTIPLE ATTRIBUTE DECISSION MAKING ) PADA PEMILIHAN MAHASISWA BERPRESTASI MENGGUNAKAN ALGORITMA DIA (THE DISTANCE TO THE IDEAL ALTERNATIVE)', 'Mula’ab,S.Si,M.Kom', 'Bain Khusnul Khotimah,S.T.,M.Kom', 'Proses pemilihan mahasiswa berprestasi melibatkan banyak atribut/kriteria (multikriteria) dan pengambil keputusan yakni para dewan juri dari tiap kriteria, dalam proses pemilihan manual rentan akan dimanfaatkan oleh pihak yang berkepentingan sehingga dibutuhkan sebuah sistem yang dapat memudahkan para pengguna baik user maupun pemegang keputusan. Untuk memenuhi sistem penilaian tersebut dibutuhkan suatu motode yang memiliki kemampuan multikriteria yaitu MADM (Multiple Attribute Decission Making). Algoritma DIA pada prinsipnya menganut pada metode TOPSIS perbedaanya terletak pada penentuan jarak yang menggunakan manhattan distance, penentuan Positif Ideal Alternatif (PIA) yang memiliki minimal Dj+ , dan maksimal Dj- serta formula dalam urutan nilai pada Ri sebagai penentu perangkingan alternatif. Hasil dari penelitian ini adalah sistem pendukung keputusan yang dibangun dengan metode MADM menggunakan Algoritma DIA dalam menentukan urutan alternatif pemilihan mahasiswa berprestasi yang tepat dari beberapa alternatif dan kriteria. Dari hasil uji coba didapatkan nilai ketepatan 0 yang didapatkan oleh mahasiswa. Hasil uji coba perbandingan antara perhitungan manual dengan perhitungan menggunakan Algoritma DIA adalah berbanding terbalik, jika pada perhitungan manual mahasiswa terpilih adalah yang memiliki nilai maksimum maka pada Algoritma DIA mahasiswa terpilih adalah yang memiliki nilai 0 dalam arti lain nilai minimum diantara peserta lainnya.', 'EKA NANDA sEPTIYA HINDRIYANA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100001'),
(200, '090411100002', 'PERBANDINGAN METODE SELF ORGANIZING MAPS (SOM) DENGAN PEMBOBOTAN BERBASIS RADIAL BASIS FUNCTION (RBF)', 'Andharini Dwi Cahyani,S.Kom.,M.Kom', 'Bain Khusnul Khotimah,ST.,M.Kom', '	Pada sistem clustering banyak metode yang digunakan untuk cluter-isasi, salah satunya adalah SOM (Self Organizing Maps). Dalam penelitian kami menggunakan 2 pendekatan. Pendekatan yang pertama adalah peng-cluster-an menggunakan SOM-RBF yang digunakan pada pelatihan data dan diduga dapat menghasilkan cluster yang lebih baik. Dan pendekatan kedua peng-cluster-an menggunakan SOM.\r\n	Perbandingan kedua metode didasarkan pada penerapan pada data yang berasal dari dataset situs movielens.org. Penilaian perbandingan menggunakan 3 skenario, yaitu MSE sebagai kondisi stop terhadap running time, MSE  sebagai kondisi stop terhadap epoch dan learning rate, dan MSE  sebagai kondisi stop terhadap nilai MSE  yang sebenarnya. Dimana dengan running time tersebut terdeteksi pendekatan manakah yang lebih cepat rentang waktunya untuk mengekstraksi data latih.\r\n	Berdasarkan hasil uji coba yang dilakukan menggunakan 500 data, yang diterapkan pada 3 dan 4 cluster menghasilkan kesimpulan bahwa pendekatan pertama mempunyai nilai MSE sebenarnya yang lebih mendekati nilai absolut MSE dibandingkan dengan pendekatan kedua.', 'Rafil Tania Rizkillah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100002'),
(201, '090411100003', 'Implementasi Game Edukasi untuk Media Pembelajaran Matematika Berbasis HTML5 pada Web Browser', 'Arik Kurniawati, S.Kom M.T.', 'Yonathan Ferry H, S.T. M.IT.', 'Game adalah kata dari  Bahasa Inggris yang berarti permainan atau pertandingan. Game bisa diartikan sebagai aktivitas terstruktur atau semi struktur, yang biasanya dilakukan untuk bersenang-senang dan kadang digunakan sebagai alat pembelajaran. Game sebenarnya penting untuk perkembangan otak, untuk meningkatkan konsentrasi dan melatih untuk memecahkan masalah dengan tepat dan cepat karena dalam  game terdapat berbagai konflik atau masalah yang menuntut kita untuk menyelesaikannya dengan cepat dan tepat. Game sebagai media pembelajaran adalah suatu permainan yang dapat menghibur dan mengandung unsur-unsur pendidikan, yang bertujuan untuk bisa menjadi alat pembelajaran. \r\nTugas Akhir ini bertujuan untuk mengimplementasikan HTML5 dalam pembuatan game edukasi pembelajaran matematika tentang operasi aritmatika yang diimplementasikan pada web browser. Penggunaan HTML5 diterapkan karena teknologi ini menunjang dalam pengembangan web game. Dalam pengimplementasian HTML5 penulis menggunakan game engine Construct 2. Hasil dari game engine Construct 2 adalah  game dengan format html yang dapat dimainkan di browser sesuai tujuan tugas akhir ini. Sasaran pengguna game ini adalah anak-anak usia 7 sampai dengan 13 tahun.\r\nDari uji coba aplikasi game ini, diperoleh hasil yang menunjukkan bahwa aplikasi tidak dapat berjalan pada semua web browser. Aplikasi ini hanya dapat berjalan pada browser yang mendukung HTML5. Mayoritas anak-anak menyukai metode pembelajaran dengan bermain game seperti ini, namun hal ini belum bisa membuat anak sepenuhnya suka akan pelajaran matematika. \r\n', 'Mukhammad Bagus Muslim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100003'),
(202, '090411100004', 'PENGEMBANGAN ARAH SUDUT COLOR CO-OCCURRENCE MATRIX  UNTUK IMAGE RETRIEVAL CITRA BATIK', 'Dr. Arif Muntasa, S.Si., MT.', 'Dr. Indah Agustien S, S.Kom., M.Kom.', 'Content Based Image Retrieval (CBIR) merupakan sistem pencarian citra menggunakan citra sebagai query yang di cocokan melalui proses similarity dengan citra yang ada di database. Fitur utama yang dimanfaatkan pada image retrieval sebagai query meliputi fitur warna, tekstur, dan shape. Ketiga fitur tersebut dapat digunakan untuk mencari citra yang diinginkan.\r\n Dalam penelitian Tugas Akhir ini, similarity atau kemiripan suatu citra query dibandingkan dengan citra  pada database yang telah di-training  sebelumnya menggunakan fitur warna. Hal ini dikarenakan fitur warna lebih mudah untuk diidentifikasi terhadap suatu citra.  Pada penelitian ini menggunakan metode ekstraksi fitur Color Co-occurrence Matrix (CCM) dan similarity Modified Color Co-occurrence Matrix (MCCM) untuk menentukan kemiripan suatu citra batik.\r\nPengujian dilakukan dengan menggunakan lima skenario yang berbeda dengan mengubah nilai kuantisasi hue dari citra. Kuantisasi yang dilakukan pada penelitian ini menggunakan kuantisasi hue 6, kuantisasi hue 12, kuantisasi hue 18, kuantisasi hue 24, dan kuantisasi hue 30. Dari lima skenario yang dilakukan akurasi tertinggi terdapat pada skenario ke lima yaitu menggunakan kuantisasi hue 30 dengan hasil akurasi 62% untuk Color Co-occurrence Matrix,  dan 65% untuk Modified Color Co-occurrence Matrix.\r\n', 'AGUS SETIAWAN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100004'),
(203, '090411100005', 'APLIKASI TEXT TO SPEECH DALAM SISTEM PENERJEMAH BAHASA INDONESIA-MADURA MENGGUNAKAN METODE FSA\r\n(FINITE STATE AUTOMATA)\r\n', 'Fika Hastarita Rachman S.T., M.Eng', 'Firdaus Solihin S.Kom., M.Kom', 'Kurangnya penggunaan bahasa dan minimnya pelestarian Bahasa Madura menyebabkan Bahasa Madura mulai terancam punah. Bahasa Madura merupakan bahasa yang sulit untuk dipelajari, karena perbedaan dialek yang berbeda-beda dalam Bahasa Madura, sehingga banyak ditemukan perbedaan antara penulisan dan cara pengucapan.\r\nDalam rangka upaya pelestarian diperlukan pengembangan dan pemanfaatan teknologi. Usaha pelestarian Bahasa Madura salah satunya menggunakan aplikasi Text to Speech pada sistem penerjemah Bahasa Indonesia ke Bahasa Madura. Untuk mempermudah pengkonversian dari teks menjadi suara, proses pemenggalan kata menggunakan metode Finite State Automata dua tingkatan dimana hasil pemenggalan di tingkat pertama menjadi inputan di tingkat kedua.\r\nPenerapan Finite State Automata pada aplikasi Text to Speech efektif digunakan dengan prosentase keberhasilan 90%. Output suara yang dihasilkan sesuai dengan hasil pemenggalan suku kata, namun pengucapan beberapa kalimat belum memiliki pola intonasi yang benar dengan prosentase keberhasilan 85%, sehingga pola intonasi hasil pengucapan suara belum sesuai dengan pengucapan aslinya.\r\n', 'Qutsiyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100005'),
(204, '090411100006', 'JALUR OPTIMUM PENGIRIMAN BARANG DI KANTOR POS GRESIK DENGAN METODE SIMULATED ANNEALING', 'Moch. Kautsar Sophan, S.Kom, M.MT', 'Vivi Tri Widyaningrum, S.Kom, M.T', 'Kantor pos memberikan suatu jasa pelayanan yaitu jasa pelayanan pengiriman barang. Dalam hal ini petugas pos harus mengirimkan banyak barang ke alamat-alamat pelanggan. Namun banyaknya jalan raya pada jaman sekarang terkadang menyulitkan petugas pos untuk memilih jalan mana yang dalam segi waktu tempuhnya lebih optimal. Oleh karena itu, diperlukan suatu sistem informasi yang dapat menemukan jalur optimum untuk menghemat waktu dengan memperhitungkan antara panjang jalan dan kecepatan berkendara pada tiap ruas jalan. Sistem informasi untuk pencarian jalur optimum dibuat dengan menggunakan metode Simulated Annealing dan berbasis Web. Dengan memanfaatkan web untuk pengaksesannya, sistem ini mampu memberikan informasi yang cukup berguna bagi petugas pos mengenai jalur optimum dengan nilai total waktu tempuh yang optimal sehingga dalam mengantarkan barang dari kantor pos menuju alamat tujuan pelanggannya dapat menghemat waktu. Jalur optimum divisualisasikan dalam bentuk graf. Dari hasil uji coba yang dilakukan dapat diambil kesimpulan bahwa metode Simulated Annealing dapat digunakan untuk proses pencarian jalur optimal dengan alamat tujuan lebih dari satu.', 'Santhi Yulia Retnani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100006'),
(205, '090411100007', 'Aplikasi Personalisasi Hints Soal Ujian dengan Menggunakan Frequents Pattern Growth', 'Andharini Dwi Cahyani, S.Kom., M.Kom.', 'Bain Khusnul K., S.T., M.Kom.', 'Perkembangan e-learning pada saat ini sudah terbilang pesat, hampir semua pihak telah mengerti e-learning. SMPN 2 Larangan adalah contoh sekolah yang sempat menggunakan elearning dalam suatu mata pelajaran. Namun, pengajar hanya memanfaatkan untuk mengambil nilai dari ujian yang diberikan. Oleh karenanya, dalam penelitian ini akan menggunakan data-data yang dianggap tidak penting untuk membantu para pengajar dalam mengukur perkembangan dan membantu siswa dalam mengerjakan soal yang dianggap sulit. Mata pelajaran yang digunakan dalam e-learning ini adalah matematika. Matematika merupakan salah satu mata pelajaran yang dianggap sulit oleh sebagian siswa, karenanya dengan aplikasi ini akan sedikit membantu siswa dalam mengerjakan soal. Algoritma yang digunakan dalam aplikasi ini adalah frequent pattern growth, yaitu algoritma dalam association rules untuk mencari hubungan kombinasi dari setiap data.  Data yang digunakan adalah jawaban salah dari 120 siswa. Soal terdiri dari 200 nomor dari 20 materi yang ada. Dalam penelitian ini, data dipecah menjadi 5, yaitu data dari 5 murid, 25, 50, 75, 100 dan 120 murid. Hasil penelitian dari pembagian data tersebut, diketahui bahwa semakin banyak data, maka kombinasi itemset yang terbentuk juga akan semakin banyak, dan waktu proses juga akan semakin lama. Namun, semakin besar minimum support yang diinputkan, maka kombinasi yang terbentuk akan semakin sedikit. ', 'Agus Fendiyanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100007'),
(206, '090411100008', 'KLASIFIKASI KOMPLEKSITAS VISUAL CITRA BERDASARKAN STRUCTURE, NOISE, DAN DIVERSITY MENGGUNAKAN SISTEM INFERENSI FUZZY MAMDANI', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom.', 'Rima Tri Wahyuningrum, S.T.,M.T.', 'Kompleksitas visual citra merupakan representasi dari persepsi penglihatan manusia terhadap suatu citra. Pada penelitian ini, kompleksitas visual citra digunakan untuk mengkategorikan citra antara lain Very Simple, Simple, Medium, Complex, dan Very Complex. Kompleksitas visual citra direpresentasikan dengan tiga fitur, diantranya adalah fitur Structure, Noise, dan Diversity. Fitur Structure diekstraksi dengan menghitung rasio antara piksel tepi dengan total jumlah piksel pada citra, tepi dari citra dideteksi dengan tiga deteksi tepi yaitu Sobel, Prewitt dan Laplacian of Gaussian. Fitur Noise diekstraksi dengan menghitung Standard Deviasi dari citra yang dikonvolusi dengan kernel Laplacian. Sedangkan fitur Diversity diekstraksi dengan membagi antara piksel sudut dengan jumlah baris pada citra, sudut dari citra dideteksi menggunakan FAST Algorithm. Sistem Inferensi Fuzzy tipe Mamdani digunakan untuk memberi label pada citra berdasarkan fitur yang sudah diekstraksi. Hasil uji coba menunjukkan bahwa semakin banyak objek dan pola pada citra, maka semakin tinggi pula kompleksitas visual dari citra. Sebaliknya, semakin sedikit objek dan pola pada citra, maka semakin rendah pula kompleksitas visual dari citra. Disamping itu, tiga jenis deteksi tepi yang digunakan untuk mengekstraksi fitur Structure tidak begitu berpengaruh terhadap sistem.\r\n\r\n', 'Fathor Rasyid', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100008'),
(207, '090411100009', 'Pengenalan Ekspresi Wajah Menggunakan Local Binary Pattern Dan Gray Level Co-occurrence Matrix.', 'Dr. Arif Muntasa, S.Si.,MT.', 'Cucun Very Angkoso, ST., MT.', 'Pengenalan wajah sudah berkembang sehingga perkembangan penelitian menjadi lebih canggih untuk membuat aplikasi untuk pengenalan yang dikembangkan dari wajah. Dengan hal yang seperti ini pengenalan, bukan hanya pengenalan wajah namum lebih mengedepankan pengenalan dari bagian wajah misal ekspresi wajah. Wajah merupakan bagian tubuh yang sangat unik yang mampu membuat ekspresi yang bermacam – macam. Meskipun nama filenya telah dirubah, namun tidaklah membuat citra yang ingin dicari kemiripan menjadi rancu karena hal ini tidak didasarkan atas nama dari sebuah file melainkan berdasarkan ciri baik bentuk, warna maupun tekstur. Sistem dibangun dengan proses utamanya yaitu deksriptor tekstur dengan menggunakan metode Local Binary Pattern (LBP) dan ekstraksi fitur tekstur dengan menggunakan Gray Level Co-occurrence Matrix (GLCM). Kemudian hasil dari ekstraksi fitur akan dilakukan pengukuran kemiripan dengan menggunakan metode Euclidean Distance (ED) sehingga ekspresi akan dikenali. Citra training dan citra testing yang dipergunakan sebanyak 203 citra dengan tujuh kelas citra didalamnya. Dari uji coba aplikasi pengenalan ekspresi wajah menggunakan pengukuran kemiripan Euclidean Distance diperoleh akurasi sebesar  45,8 % pada 70 training dan 133 testing serta akurasi tertinggi 81,6 % pada data 154 trainig dan data 49 testing menggunakan citra JAFFE Database dengan ekspresi  marah, jijik, takut, bahagia, netral, sedih dan terkejut sebagai objek ekspresi citra.', 'Wakhid Prasetya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100009'),
(208, '090411100010', 'RANCANG BANGUN ERP (ENTERPRISE RESOURCE PLANNING) PADA MODUL PROCUREMENT MENGGUNAKAN ZACHMAN FRAMEWORK', 'Hermawan, S.T., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Enterprice Resource Planning (ERP) merupakan bentuk enterprise system dengan beberapa modul yang terdiri dari komponen perusahaan untuk memungkinkan semua sumber daya dapat dikelola secara terintegrasi untuk mewujudkan manajemen perusahaan yang lebih efisien. Salah satu bagian ERP yang menangani proses pengadaan barang/jasa yakni modul Procurement. Penelitian ini telah menghasilkan perancangan sistem proses pengadaan barang/jasa dengan kerangka pemodelan Zachman Framework (ZF). Dalam pemodelannya, ZF digambarkan dalam notasi grafik konseptual matriks 6x6 dari perspektif Planner, Owner, Designer, Builder, Implementer dan Participant untuk mendeskripsikan abstraksi objek What, How, Where, Who, When dan Why. Untuk meningkatkan pendeskripsian ZF menjadi standar Model Driven Architecture  maka dilakukan pendekatan dengan Unified Modeling Language (UML 2.0). Untuk mengimplementasikan rancangan yang dibuat telah dikembangkan solusi perangkat lunak ERP Modul Procurement yang berkualitas dengan menerapkan Model Driven Design.  Pengujian sistem dilakukan secara kualitatif dan kuantitatif. Dimana hasil pengujian sistem secara kualitatif oleh koresponden di PT. IGLAS (Persero) didapatkan penilaian kepuasan rata-rata yaitu 87,39. Sedangkan pengujian secara kuantitatif dengan penilaian cakupan fitur, sistem yang telah dikembangkan jauh lebih kompleks dengan presentase ketersediaan fitur mencapai 70,37% jika dibandingkan OpenERP 7.0 yang hanya 40,74%.', 'Reiza Judis Pradana Verryanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100010'),
(209, '090411100011', 'PENERAPAN MODIFIKASI METODE ENHANCED CONFIX STRIPPING STEMMER PADA TEKS BERBAHASA MADURA', 'Firdaus Solihin, S.Kom.,M.Kom.', 'Fika Hastarita Rachman, S.T., M.Eng', 'Stemming adalah teknik untuk menemukan kata dasar dari sebuah kata yang telah mengalami imbuhan dengan cara menghilangkan atau menghapus imbuhan-imbuhan tersebut. Algoritma Enhanced Confix Stripping Stemmer adalah algoritma stemming yang akurat untuk mencari bentuk dasar dari suatu kata dalam Bahasa Indonesia. Bahasa Madura memiliki struktur morfologi yang mirip dengan Bahasa Indonesia. Bahasa Madura memiliki kata yang dapat dibentuk dari awalan (ter-ater), akhiran (panoteng) dan sisipan (sesselan) dan Kata Ulang (Rangkebbhan). Modifikasi algoritma Enhanced Confix Stripping Stemmer dilakukan pada tabel aturan pemenggalan, langkah-langkah algoritma dan penambahan langkah algoritma sesuai dengan morfologi Bahasa Madura. Dengan demikian dapat dihasilkan sebuah algoritma baru yang dikembangkan dari algoritma Enhanced Confix Stripping Stemmer. Setelah melakukan beberapa analisa dan pengujian dengan menggunakan sistem yang telah dibangun maka diperoleh hasil dari modifikasi algoritma Enhanced Confix Stripping Stemmer pada teks berbahasa Madura. Persentase kata Bahasa Madura yang berhasil distemming adalah 95,75 %  dari 400 kata yang diuji. Dengan demikian modifikasi Enhanced Confix Stripping Stemmer pada teks berbahasa Madura dinilai efektif untuk diterapkan.', 'Andi Sholihin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100011'),
(210, '090411100012', 'IDENTIFIKASI GAYA KOGNITIF\r\nBERBASIS MYERS BRIGGS TYPE INDICATOR (MBTI) \r\nDENGAN MENGAMATI PERILAKU BROWSING SISWA\r\n', 'Andharini Dwi C., S.Kom.,M.Kom.', 'Bain Khusnul K., S.T.,M.Kom', 'E-learning merupakan pengaruh proses transformasi pendidikan konvensional ke dalam bentuk digital, baik secara isi dan sistemnya. Pengguna sistem tersebut adalah siswa. Konsep belajar setiap siswa berbeda antara satu dengan yang lainnya baik dari segi tingkat pemahaman dan cara memproses pengetahuan mereka. Oleh karena itu, diperlukannya mengidentifikasi gaya kognitif berbasis Myers Briggs Type Indicator (MBTI) dengan mengamati perilaku browsing siswa melalui metode Neural Network (NN). Metode ini diadopsi karena mampu mengorganisasi dirinya sendiri dalam mengklasifikasi data yang diberikan selama masa training dan data yang dihasilkan bersifat akurat walaupun dalam proses lama. Pengumpulan data yang digunakan dengan melakukan pengamatan perilaku browsing siswa yang nantinya akan diproses menggunakan algoritma Backpropagation. Kemudian data akan dibandingkan dengan hasil kuisioner MBTI yang telah dikumpulkan sebelumnya. Data yang digunakan adalah 250 data siswa. Hasil yang diperoleh tergantung dari penggunaan batas MSE dan iterasi. Semakin rendah penggunaan batas MSE, maka semakin tinggi pula nilai akurasi yang diperoleh. Semakin tinggi batas iterasi yang digunakan, maka nilai akurasi yang diperoleh stabil atau tetap. Hasil akurasi terbaik diperoleh ketika MSE 0.001 dengan batas iterasi berkisar 500-1000 iterasi menghasilkan akurasi 90%. Hasil gaya kognitif yang diperoleh tersebut akan menjadi suatu acuan bagi guru untuk strategi pembelajaran berikutnya sesuai gaya kognitif siswa.\r\n\r\nKata kunci : Gaya Kognitif, MBTI, Backpropagation', 'Megawati Pratiwi Rifai', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100012'),
(211, '090411100013', 'PERENCANAAN ARSITEKTUR ENTERPRISE BIDANG PETERNAKAN DI DINAS PERTANIAN DAN PETERNAKAN KABUPATEN BANGKALAN', 'M. Kautsar Sophan, S.Kom, M.MT', 'Yeni Kustiyahningsih, S.Kom, M.Kom', 'Dinas Pertanian dan Peternakan Kabupaten Bangkalan merupakan instansi pemerintahan yang tidak luput dari berbagai persoalan, khususnya dalam proses integrasi data. Di Dinas Pertanian dan Peternakan Kabupaten Bangkalan telah tersedia beberapa aplikasi sebagai penunjang proses bisnis instansi. Namun, belum adanya akses jaringan di lingkungan Dinas Pertanian dan Peternakan Kabupaten Bangkalan mengakibatkan proses transfer data masih dilakuakan secara manual. Disamping itu belum adanya apikasi penunjang khususnya di bidang peternakan maupun pertanian sehingga diperlukan adanya perencanaan arsitektur enterprise yang sesuai dengan fungsi bisnis khususnya di bidang peternakan maupun pertanian. Perencanaan arsitektur enterprise (EAP) adalah sebuah proses yang dihasilkan untuk membantu pimpinan dalam memahami fungsi bisnis di setiap bagian organisasi. EAP juga merupakan produk bagi pengembang aplikasi sehingga lebih mudah dalam memperbaiki kesalahan sistem yang sudah ada. Untuk membangun sebuah perencanaan arsitektur enterprise diperlukan framework atau langkah kerja. Dalam penelitian ini digunakan framework FEA sebagai panduan untuk perencanaan arsitektur enterprise. Hingga tahun 2012, FEA framework (FEAF) telah berkembang menjadi FEAF versi 2.0. Pada akhir penelitian ini dihasilkan desain arsitektur enterprise bidang peternakan di Dinas Pertanian dan Peternakan Kabupaten Bangkalan dengan tingkat kesesuaian sebesar  85,71%. ', 'Idealetika Yunia Fitri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100013');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(212, '090411100014', '“KLASIFIKASI PENDAPAT MASYARAKAT DUNIA MAYA TERHADAP PARTAI POLITIK DENGAN METODE\r\nEXPECTATION MAXIMIZATION”', 'Mula’ab S.Si., M.Kom', 'Fika Hastarita R. S.T.,M.Eng', 'Meningkatnya teknologi informasi semakin memudahkan masyarakat dalam berkomunikasi. Termasuk di antaranya melalui media jejaring sosial. Media jejaring sosial sekaligus menjadi tempat masyarakat dalam menyampaikan pendapatnya. Adanya fasilitas web service memungkinkan dilakukannya crawling untuk mengumpulkan pendapat masyarakat yang tersebar di dunia jejaring sosial Twitter. Sementara metode Expectation Maximization mengklasifikasikan sebuah pendapat berdasarkan kelas yang sudah ditentukan, yakni positif, negatif, dan netral. Selanjutnya pendapat yang telah dikumpulkan ditampilkan dalam bentuk persebaran dalam sebuah peta digital. Persebaran pendapat-pendapat tersebut didasarkan pada daerahnya.Maka dari itu dibutuhkan sebuah aplikasi yang dapat menghimpun pendapat masyarakat, mengklasifikasikannya, kemudian menampilkannya dalam bentuk persebaran dalam peta secara realtime. Diharapkan dengan adanya aplikasi ini menjadikannya salah satu referensi dalam mengetahui persebaran pendapat masyarakat. Hasil uji coba menunjukkan bahwa data training dalam waktu yang jauh berbeda terhadap data testing memeberikan hasil yang tidak maksimal dengan nilai precision 0 %. Sementara hasil maksimal yang dicapai dengan menggunakan 40 data training masih memiliki nilai akurasi 64, 58 % untuk data training dan testing pada waktu yang sama atau berdekatan. Hal ini karena twitter bertema partai bersifat sangat dinamis setiap waktunya. Kemudian untuk hasil visualisasi pada peta hanya memperoleh satu tweet yang dapat ditampilkan karena minimnya user dalam memberikan akses garis lintang dan bujurnya.', 'Habiburrahman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100014'),
(213, '090411100015', 'SISTEM REKOMENDASI PEMBELAJARAN PADA E-LEARNING MENGGUNAKAN ALGORITMA CT-PRO', 'ANDHARINI DWI CAHYANI, S.Kom., M.Kom', 'YENI KUSTIYAHNINGSIH, S.Kom., M.Kom', 'Perkembangan teknologi informasi dalam dunia pendidikan khususnya penggunaan e-learning di lembaga pendidikan berkembang cukup pesat. SMAN 2 Pamekasan adalah contoh sekolah yang menggunakan e-learning. Namun, sampai saat ini penggunaan e-learning hanya digunakan untuk melakukan ujian online, pemberian nilai oleh guru dan mengakses materi pelajaran. \r\nOleh karenanya, dalam penelitian ini telah menggunakan data-data yang ada untuk membantu para pengajar dalam mengukur perkembangan dan membantu siswa dalam mengerjakan soal yang dianggap sulit. Mata pelajaran yang digunakan dalam e-learning ini adalah Kimia. Dengan aplikasi ini akan membantu siswa dalam mengerjakan soal dan membantu guru dalam melihat perkembangan siswa. \r\nAlgoritma yang digunakan dalam aplikasi ini adalah ct-pro, yaitu algoritma dalam association rules untuk mencari hubungan kombinasi dari setiap data.  Data yang digunakan adalah jawaban salah dari 150 siswa. Soal terdiri dari 400 nomor dari 20 materi yang ada. Dalam penelitian ini, data dipecah menjadi 6, yaitu data dari 5 siswa,30, 60, 90, 120, dan 150 siswa. Hasil penelitian dari pembagian data tersebut, diketahui bahwa semakin banyak data, maka kombinasi itemset yang terbentuk juga akan semakin banyak, dan waktu proses juga akan semakin lama. Namun, semakin besar minimum support yang diinputkan, maka kombinasi yang terbentuk akan semakin sedikit\r\n', 'KHOIRUL UMMAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100015'),
(214, '090411100016', 'PENGENALAN ALFABET SIBI MENGGUNAKAN KAMERA DEPTH', 'CUCUN VERY ANGKOSO, S.T., M.T.', 'MUHAMMAD FUAD, S.Kom., M.T.', 'Dalam kehidupan sehari-hari, masyarakat berinteraksi secara umum menggunakan bahasa verbal. Namun, penyandang disabilitas tidak dapat berkomunikasi secara verbal, melainkan menggunakan bahasa isyarat yang sulit dimengerti oleh khalayak umum. Sehingga untuk berkomunikasi perlu adanya translator. Namun translator memiliki kekurangan, yaitu tidak adanya privasi dan kurang efisien. Untuk mengatasi hal tersebut dibutuhkan sistem pengenalan isyarat..\r\nPada penelitian ini, digunakan kamera depth dari Microsoft Kinect untuk menangkap citra isyarat. Penggunaan kamera depth karena menghasilkan citra 3D dan dapat menangkap obyek dalam keadaan kurang cahaya maupun gelap. Citra 3D digunakan pada proses segmentasi citra berdasarkan jarak untuk menghilangkan latarbelakang agar obyek yang ditangkap hanya tangan. Kemudian proses binerisasi dengan Otsu Thresholding. Selanjutnya cropping citra untuk mengambil obyek diperlukan dan me-resize citra agar mempermudah dan mempercepat proses selanjutnya. Terakhir, proses pengenalan menggunakan metode Euclidean Distance berdasarkan nilai jarak terkecil antar dua citra, yaitu citra masukan dan citra template.\r\nPengujian antar template menghasilkan akurasi sebesar 96.538462%. Sedangkan pengujian sistem real-time menghasilkan akurasi yang cukup baik dengan metode Euclidean Distance. Hasil pengujian sistem real-time bergantung pada lingkungan uji coba dan postur tangan pengguna sesuai dengan aturan SIBI atau mirip dengan template karena metode tersebut mencari nilai perbedaan yang terkecil.\r\n', 'DIAN RUSYDI HADIWINEKA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100016'),
(215, '090411100017', 'SISTEM REKOMENDASI BUKU ONLINE DENGAN METODE COLLABORATIVE FILTERING', 'Andharini Dwi C, S.Kom., M.Kom', 'Fika Hastarita R., S.T., M.Eng.', 'Buku merupakan sumber informasi semua aspek kehidupan khususnya pendidikan. Namun rendahnya minat baca dikalangan masyarakat menjadi persoalan penting di dunia pendidikan saat ini. Sistem rekomendasi dapat membantu merekomendasikan para pembaca agar lebih mudah mendapatkan informasi mengenai buku yang akan dibaca. Oleh karena itu, pada penelitian ini dibuat sistem rekomendasi buku online menggunakan metode Collaborative Filtering. Collaborative Filtering adalah salah satu metode yang dapat digunakan dalam membuat sistem rekomendasi. Hasil dari penelitian ini menunjukkan bahwa rata-rata nilai MAE (Mean Absolute Error) pada uji coba 1 (1,064) lebih kecil daripada uji coba 2 (1,21), uji coba 4 (2,474) dan ujicoba 5 (3,526). Hal ini menunjukkan bahwa semakin banyak jumlah data yang digunakan dan jika terdapat user yang belum pernah merating, maka sistem yang dihasilkan relatif tidak akurat dan menghasilkan rekomendasi yang buruk jika menggunakan Collaborative Filtering.\r\n\r\nKata Kunci : Sistem Rekomendasi, Collaborative Filtering, Buku Online', 'Moh. Irfan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100017'),
(216, '090411100018', 'PENGENALAN HURUF ABJAD BAHASA ISYARAT PADA SISTEM ISYARAT BAHASA INDONESIA (SIBI) BERBASIS EKSTRAKSI FITUR LINEAR DISCRIMINANT ANALYSIS (LDA)', 'Cucun Very Angkoso,S.T.,M.Kom', 'Rima Tri Wahyuningrum,S.T.,M.T', 'Manusia sebagai makhluk sosial tidak terlepas dari interaksi. Komunikasi merupakan bentuk nyata dari interaksi tersebut. Tujuan utama dari penelitian ini adalah agar terjadi harmoni sosial yang baik antara tuna rungu dengan orang normal. Pada penelitian ini, pengenalan yang dilakukan terfokus pada pengenalan isyarat huruf “A”-“Z”, masing-masing huruf terdiri dari tiga citra, hal ini dikarenakan adanya huruf yang bergerak yaitu huruf “J” dan “Z”. Ada tiga tahapan dalam penelitian ini, yaitu proses preprocessing, ekstraksi fitur, dan klasifikasi citra. Proses preprocessing citra melalui proses background removal yaitu dengan thresholding untuk memisahkan wilayah objek yang akan diteliti (yaitu tangan) dengan background citra, kemudian citra hasil tersebut dirubah dalam mode grayscale, selanjutnya dilakukan ekstraksi fitur dengan menggunakan algoritma Linear Discriminant Analysis (LDA) dan klasifikasi pola dengan Euclidean Distance. Pada penelitian ini data yang digunakan adalah 1092 citra yang digunakan sebagai data training dan data testing terdiri dari 7 orang laki-laki dan 7 orang perempuan. Terdapat tiga huruf dengan akurasi tertinggi sebesar 100% yaitu huruf “J”, “Q” dan “Z”, dikarenakan huruf tersebut sequence dan kualitas citra yang sempurna. Beberapa citra uji yang memiliki tingkat akurasi yang rendah cenderung karena memiliki bentuk yang hampir sama dengan huruf lainnya.', 'Novia Resha Dwinitasari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100018'),
(217, '090411100019', 'ANALISA PRIORITAS RESIKO PADA PROJECT RISK MANAGEMENT MENGGUNAKAN SMARTER (SIMPLE MULTI-ATTRIBUTE RATING TECHNIQUE EXPLOITING RANKS)', 'Hermawan, S.T., M.Kom.', 'M. Kautsar S, S.Kom., M.MT.', 'Resiko berpengaruh pada keberhasilan sebuah proyek. Dalam implementasi proyek banyak organisasi/perusahaan yang tidak melakukan manajemen resiko tetapi lebih mengedepankan manajemen krisis (fire fighting). Penelitian ini mengimplementasikan manajemen proyek berbasiskan Project Management Body of Knowledge (PMBOK) yang merupakan salah satu standarisasi internasional manajemen proyek yang dibuat oleh Project Management Institute (PMI). Di dalam PMBOK terdapat 9 domain, salah satu domain dalam PMBOK adalah Project Risk Management atau manajemen risiko proyek. Fokus penelitian ini tertuju pada Project Risk Management. PMBOK mendefinisikan Project Risk Management merupakan proses sistematis dalam mengidentifikasi, menganalisis dan merespon resiko proyek. Tujuan utama manajemen resiko adalah meningkatkan kemungkinan hasil dan manfaat yang positif proyek, dan mengurangi kemungkinan hasil dan dampak negatif proyek. Dalam penelitian ini telah menggunakan metode SMARTER (Simple Multi-Attribute Rating Technique Exploiting Ranks) untuk menentukan prioritas risiko pada kategori Cost, Time, Scope, Quality. Dari hasil ujicoba aplikasi Project Risk Management pemenuhan PMBOK telah memenuhi 72,73%. Sedangkan berdasarkan penilaian pengguna studi kasus proyek SAP PT Semen Gresik Tbk didapatkan tingkat kepuasan  81,82%.', 'MOHAMMAD SHOLIKIN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100019'),
(218, '090411100021', 'SISTEM PENDUKUNG KEPUTUSAN PENERIMAAN MAHASISWA BARU MENGGUNAKAN METODE LOGIKA FUZZY MODEL SUGENO', 'Bain Khusnul Khotimah', 'Rika Yunitarini', 'Dalam rangka memilih calon mahasiswa baru yang mempunyai kemampuan akademik untuk mengikuti dan menyelesaikan studi di perguruan tinggi dengan baik dan sesuai batas waktu yang ditentukan, maka perlu adanya proses seleksi. Universitas Trunojoyo menyelengarakan program untuk penerimaan calon mahasiswa baru. Salah satunya jalur Seleksi Mandiri Masuk Universitas Trunojoyo Madura. Untuk penerimaan mahasiswa baru program S1 dan Diploma yang dilaksanakan melalui ujian tes tulis. Kriteria jalur seleksi mandiri ini antara lain Tes Potensi Akademik (TPA ), Tes Pengetahuan Dasar (TPD), Indeks Sekolah dan Akreditasi Sekolah. Setelah calon mahasiswa melakukan pendaftaran dengan memenuhi syarat yang telah ditentukan, maka mereka wajib melakukan ujian tes online. Hasil ujian dan data sekolah digunakan sebagai bahan pertimbangan untuk uji kriteria dan seleksi penerimaan mahasiswa baru. Metodologi yang digunakan dalam pengembangan sistem pendukung keputusan ini menggunakan metode logika fuzzy model sugeno. Logika Fuzzy merupakan salah satu ilmu yang digunakan untuk menyelesaikan masalah mengenai menganalisa ketidakpastian. Dalam penelitian ini logika fuzzy model sugeno digunakan untuk menentukan nilai rata - rata kriteria dengan menggunakan aturan (rule). Dengan ini Peneliti mencoba menawarkan sebuah solusi sistem yang dapat menerima data mahasiswa secara online serta merekapitulasi data calon mahasiswa dan mempermudah menganalisis data untuk membantu memberikan informasi sebagai hasil pengambilan keputusan.', 'M.Habibur Rohman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100021'),
(219, '090411100022', 'SISTEM INFORMASI BEASISWA DENGAN INTEGRASI METODE FUZZY ANALYTICAL HIERARCHY PROCESS (FAHP) DAN METODE ELECTRE\r\n(STUDI KASUS : UNIVERSITAS TRUNOJOYO MADURA)', 'BAIN KHUSNUL KHOTIMAH, S.T., M.KOM', 'RIKA YUNITARINI, S.T., M.T', 'Universitas Trunojoyo Madura mempunyai program beasiswa. Program beasiswa ini diperuntukkan bagi seluruh mahasiswa. Jenis beasiswanya antara lain PPA (Peningkatan Prestasi Akademik) dan BBM (Bantuan Belajar Mahasiswa). Bidang ilmu informatika mempunyai berbagai solusi yang dapat diterapkan dalam proses seleksi beasiswa. Salah satunya sistem informasi yang di dalamnya termasuk sistem pendukung keputusan. Sistem informasi ini selain sebagai media penyampaian informasi dan pengolahan data, juga berfungsi sebagai sistem pendukung keputusan proses seleksi beasiswa. Sistem pendukung keputusan dalam sistem informasi ini menggunakan konsep fuzzy yang diterapkan dalam metode Analytical Hierarchy Process atau AHP yang disebut FAHP. Tetapi FAHP yang digunakan sistem informasi ini menggunakan pendekatan Synthetic Extent Analysis. FAHP digunakan untuk menghitung bobot kriteria berdasarkan syarat dan ketentuan yang dikeluarkan Universitas Trunojoyo Madura. Sistem informasi ini juga menggunakan Electre untuk merangking alternatif terbaik. Bobot dari FAHP digunakan pada Electre untuk pengambilan keputusan alternatif terbaik penerima beasiswa. Dengan menggunakan FAHP dan Electre sistem dapat membobotkan kriteria dan merangking alternatif penerima beasiswa. Setelah dilakukan uji coba dengan 871 data alternatif calon penerima beasiswa, didapatkan akurasi sistem sebesar 66,77% untuk beasiswa PPA dan 73,01% untuk beasiswa BBM. Jika dirata-rata akurasinya mencapai 69,89 %.\r\nKata Kunci : Sistem Informasi, Beasiswa, Fuzzy Analytical Hierarchy Process, Synthetic Extent Analysis, Electre.', 'M. ALHAN ASRORI NUGRAHA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100022'),
(220, '090411100023', 'SISTEM INFORMASI GEOGRAFIS (SIG) PENENTUAN JALUR TERPENDEK UNTUK MENGHINDARI DAERAH RAWAN BANJIR\r\n(STUDI KASUS PROPINSI JAWA TIMUR)', 'Mula’ab, S.Si., M.Kom.', 'Rika Yunitarini, ST., MT', 'Pada musim hujan sering terjadi banjir pada beberapa daerah yang berada di Kota Surabaya. Sistem informasi geografis (SIG) mampu menyajikan informasi fisik suatu daerah yang berpengaruh dalam menentukan daerah rawan banjir serta menentukan jalur terpendek yang terjadi pada wilayah jawa timur. Pengguna juga dapat menentukan jalur terpendek dengan menggunakan metode Breadth First Search (BFS) yang menggunakan fungsi heuristic guna mengarahkan pencarian pada peta yang direpresentasikan dalam konsep graph, yang berguna untuk menghindari daerah mana yang seringkali terjadinya bencana banjir serta dapat meminimalkan kerugian serta kemacetan yang terjadi propinsi jawa timur. Penelitian ini dilakukan untuk pencarian rute terpendek antara perumahan sampai dengan tempat perumahan yang akan menjadi tujuan.', 'Laylul Musabbichin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100023'),
(221, '090411100024', 'Pengenalan Wajah Berbasis Diagonal LDA\r\nLinear Discriminant Analysis\r\n', 'Dr. Indah Agustien, S.Kom., M.Kom.', 'Dr. Arif Muntasa, S.Si., M.T', 'Pengenalan wajah merupakan bagian dari pattern recognition. Pengenalan wajah yang telah banyak diterapkan dimasyarakat, diaplikasikan pada sistem keamaan penerbangan, kepolisian dan pelayanan kependudukan. Penelitian ini menggunakan citra sebanyak 400 citra wajah, proses pengenalan wajah pada sistem ini dilakukan 4 tahap. Tahap pertama adalah data citra diproses dengan menjadikan citra wajah menjadi citra diagonal. Tahap kedua citra wajah diproses ekstraksi fitur menggunakan metode Principle Component Analysis (PCA). Tahap ketiga ekstraksi fitur citra wajah menggunakan metode Linear Discriminant Analysis (LDA). Tahap keempat hasil nilai matrik bobot dari masing - masing proses ekstraksi fitur. Tahap selanjutnya tahap pengklasifikasian dengan menggunakan jarak kemiripannya dengan menggunakan metode Manhattan Distance dan Naive Bayes Classifier, dalam skenario ujicoba sistem dari 4 skenario menggunakan Manhattan Distance menghasilkan rata - rata akurasi 93.75%. Sedangkan menggunakan Naive Bayes Classifier menghasilan rata - rata 88.15% Hasil analisa tersebut menyimpulkan bahwa input citra diagonal  metode Diagonal LDA Linear Discriminant Analysis bisa diterapkan dalam pengenalan wajah.\r\n\r\nKata Kunci: Pengenalan wajah, Diagonal LDA Linear Discriminant Analysis, Manhattan Distance, Naive Bayes Classifier.', 'Itsnain Maulana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100024'),
(222, '090411100025', 'IDENTIFIKASI MODEL GAYA BELAJAR FELDER SILVERMAN BERDASARKAN KARAKTERISTIK BROWSING SISWA DENGAN METODE NAÏVE BAYES CLASSIFIER', 'Andharini Dwi Cahyani, S.Kom, M.Kom', 'Firli Irhamni, ST.,M.Kom.', 'E-Learning merupakan usaha untuk membuat sebuah transformasi proses belajar mengajar di sekolah dalam bentuk digital yang dijembatani oleh teknologi internet. Sudah banyak pembelajaran saat ini yang telah didukung oleh e-learning. Namun, dalam  proses pembelajaran, setiap peserta didik  mempunyai gaya belajar yang berbeda satu sama lain. Gaya pembelajaran yang berbeda tersebut dapat dikelompokkan dengan cara menggunakan tool kuisioner dan secara otomatis. Penelitian ini akan  membahas bagaimana menganalisis gaya belajar peserta didik dan mengelompokkannya dengan  menggunakan  tool  kuisioner serta mengklasifikasi gaya belajar peserta didik menggunkan naïve bayes classifier. Dimensi untuk model gaya belajar yang digunakan adalah Felder Silvermen Learning Style Model (FSLSM).Dengan penelitian ini diharapkan agar dapat mengatasi permasalahan keragaman gaya belajar peserta didik sehingga dapat meningkatkan efektivitas pembelajaran e-learning.\r\n', 'Ine Ramadani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100025'),
(223, '090411100026', 'Aplikasi Penerjemah Bahasa Madura-Indonesia Dan Indonesia-Madura Menggunakan Free Contex Parsing Algorithm', 'Firdaus Solihin, S.Kom.,M.Kom', 'Fika Hastarita Rachman,S.T.,M.Eng', 'Bahasa Madura sebagai salah satu bahasa daerah di Indonesia sudah mulai kehilangan identitas. Hal ini disebabkan minimnya pengetahuan dan sedikitnya pola pelestarian terhadap Bahasa Madura. Oleh karena itu, perlu adanya pola pembelajaran yang lebih efektif agar transformasi pengetahuan terus berjalan. Salah satunya dengan membuat aplikasi penerjemah Bahasa Madura-Indonesia dan juga sebaliknya. Untuk dapat menerjemahkan kata ataupun kalimat tersebut, dalam penelitian ini digunakan metode Free Context Parsing Algorithm. Dengan adanya aplikasi ini dapat menjadi referensi dalam mempelajari dan meningkatkan kemampuan berbahasa, mulai dari tingkatan Bahasa Madura yang paling umum (Enje’-Iyeh) hingga ke tingkatan Bahasa Madura yang paling halus (Engghi-Bunten), sehingga Bahasa Madura dapat bertahan dan lebih dikenal oleh masyarakat Madura maupun masyarakat luar Madura. Karena aplikasi yang berbasis web ini mampu menerjemahkan bahasa mulai dari Bahasa Madura ke Bahasa Indonesia dan dari Bahasa Indonesia ke Bahasa Madura. Dari hasil pengujian yang dilakukan terhadap beberapa kalimat dan dokumen, sistem ini sudah dapat dimengerti dan hasilnya cukup baik. Hal ini dibuktikan dengan  rata-rata nilai presisi yang diperoleh sebesar 90%. Namun, masih terdapat kekurangan pada hasil terjemahan yang belum sempurna dari segi tata Bahasa Madura.\r\n\r\nKata kunci: Aplikasi Penerjemah Bahasa, Free Contex Parsing Algorithm.\r\n', 'Rahilah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100026'),
(224, '090411100027', 'Sistem Pendukung Keputusan Penentuan Biaya Uang Kuliah Tunggal (UKT) dengan Metode ID3 ', 'Rika Yunitarini,S.T,M.T', 'Andharini Dwi Cahyani,S.Kom,M.Kom', 'Sistem Uang Kuliah Tunggal (UKT) merupakan suatu upaya untuk mewujudkan biaya kuliah yang murah di perguruan tinggi seluruh negeri. Dengan sistem ini, mahasiswa sudah tidak akan dikenakan biaya gedung, praktikum, atau biaya tambahan lainnya. Ini berbeda dengan yang terjadi di tahun-tahun sebelumnya. Besaran UKT ditentukan dengan menghitung unit cost mahasiswa dalam satu semester. Analisis unit cost memberi dasar formula untuk menghitung biaya pendidikan seorang mahasiswa selama mengikuti studi yang mencakup biaya langsung (biaya tenaga kerja langsung (gaji dosen); bahan habis pakai pembelajaran; sarana dan prasarana pembelajaran langsung) dan biaya tidak langsung (biaya SDM manajerial dan non dosen, sarana dan prasarana non pembelajaran; pemeliharaan; serta kegiatan pengembangan institusi (penelitian, kemahasiswaan, dan pengembangan program)Besaran Unit Cost tersebut kemudian digabungkan dengan subsidi pemerintah, sumbangan masyarakat, serta pendapatan lain-lain lembaga. Untuk menghitung besaran UKT tiap mahasiswa baru tersebut menggunakan decision tree yaitu dengan algoritma ID3 dengan menghitung kriteria-kriteria yang telah di tentukan yaitu besar gaji orang tua, jumlah tanggungan keluarga dan daya listrik. Dipilihnya kriteria-kriteria tersebut agar pemberian UKT pada mahasiswa baru lebih tepat sasaran.', 'Muhammad Ilham Azmi Al Haris', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100027'),
(225, '090411100028', 'Perancangan media pengenalan huruf mengunakan konsep phonics games berbasis Microsoft Speech API', 'Cucun Very Angkoso, S.T., M.T', 'Arik Kurniawati, S.Kom.,M.T', 'Speech Application Programming Interface (SAPI) merupakan program pengenal suara yang dikembangkan oleh Microsoft. Speech Application ProgrammingInterface (SAPI) sendiri mempunyai dua tipe dasar yaitu sistem teks ke suara (Text to Speech) dan juga pengenalan suara ke teks (Speech Recognition). \r\n	Pada tugas akhir yang dibuat ini mengunakan 130 data gambar serta 130 data suara yang sebelumnya telah diformat sesuai kebutuhan yaitu GIF untuk data gambar dan WAV untuk data suara. Pengenalan dalam aplikasi game ini dibagi menjadi dua level,level pertama pengenalan huruf dengan  mengucapkan sebuah huruf dengan output berupa gambar dan suara dari gambar tersebut. Level kedua anak/user menebak gambar yang telah muncul pada layar. Jika tebakan benar akan muncul teks dengan nama gambar tersebut dan jika salah akan ada teks “jawaban salah”.\r\n	 Aplikasi ini ditujukan untuk kebutuhan pendidikan anak khususnya usia 5-15 tahun yang sudah mempunyai sedikit kefasihan dalam mengucapkan suara dalam bahasa inggris.\r\n', 'm hasyim asrori', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100028'),
(226, '090411100029', 'Sistem Deteksi Wajah Menggunakan Haar-Like Feature Pada Nokia Lumia Windows Phone', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Teknologi pendeteksian obyek menggunakan kamera telah semakin banyak digunakan antara lain untuk sistem pendeteksian organ biometric  seperti wajah, mata, hidung, tangan dan lain-lain. Selain pada organ  biometric, pendeteksian  obyek juga banyak dilakukan pada obyek-obyek yang lain seperti obyek mobil dan sepeda motor. Deteksi obyek banyak dimanfaatkan pada bidang security dan authorization.\r\n\r\nDalam Tugas Akhir ini hanya akan difokuskan pada masalah pendeteksian obyek wajah,  deteksi wajah  (face detection)  adalah salah satu pra proses  yang sangat penting didalam sistem pengenalan wajah(face recoginiton)    untuk mengetahui letak posisi wajah dalam sebuah citra yang nantinya  akan  dilakukan  untuk proses  pengenalan (recognition), sistem  pendeteksian wajah ini diimplementasi pada handphone nokia lumia 920 dengan sistem operasi windows phone. \r\n\r\nMetode yang digunakan dalam penelitian ini adalah Haar Cascade Classifier  dengan mengacu pada  Haar Rectangular Feature  (fitur kotak haar) yang merupakan fitur hasil ekstraksi dari penelition  viola jones, dalam penelitian ini terdapat 12876 citra yang digunakan untuk training yang terdiri dari 4916 citra wajah dan  7960 citra non wajah, kemudian terdapat 45 citra yang digunakan untuk testing yang terdir i dari 15 citra yang mengandung  single face, 15 citra yang terdapat  multiple face  dan 15 citra yang tidak terdapat wajah sama sekali. ', 'Asadullohil Ghalib Kubat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100029'),
(227, '090411100030', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN JURUSAN SEKOLAH MENENGAH ATAS (SMA) BERBASIS WEB MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)\r\n(Studi Kasus : SMA Negeri  1 Kamal)\r\n', 'Bain Khusnul Khotimah, S.T., M.Kom', 'Achmad Jauhari, S.T., M.Kom.', 'Banyak siswa lulusan SMP yang mengikuti ujian masuk ke SMA. Namun hal yang patut disayangkan adalah kurang matangnya mereka memilih jurusan yang ada di Sekolah Menengah Atas yang dituju. Situasi semacam ini berdampak pada biaya pendidikan yang terlanjur dikeluarkan, baik pada orang tua siswa maupun pemerintah yang mensubsidi sekolah menjadi tidak bermanfaat karena siswa tersebut tidak memiliki kemampuan yang memadai untuk jurusan yang sudah dipilihnya. Berdasarkan informasi yang diperoleh dari tim panitia penjurusan, jumlah jurusan yang ada di SMA Negeri 1 Kamal terdiri dari dua jurusan yaitu jurusan Ilmu Pengetahuan Alam (IPA) dan Ilmu Pengetahuan Sosial (IPS). Penjurusan didasarkan pada pilihan siswa saat melakukan pendaftaran dengan mencatumkan minat untuk jurusan 1 dan jurusan 2 selain itu penjurusan ditentukan oleh nilai yang disyaratkan pada masing-masing jurusan. Sistem pendukung keputusan pemilihan jurusan dengan metode Simple Additive Weighting (SAW) ini diharapkan dapat membantu tim panitia penjurusan siswa baru dalam menentukan jurusan bagi tiap siswa. sehingga dapat dengan mudah menentukan jurusan yang cocok untuk siswa-siswi menggunkan nilai yang sudah ada dan dapat diketahui perangkingan dari setiap lokasi, kemudian data akan diolah untuk menentukan jurusan yang tepat untuk masing-masing siswa.\r\nKata Kunci : Jurusan, Sistem Pendukkung Keputusan, Simple Additive Weighting\r\n', 'Mi\'rajul Mu\'minin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100030'),
(228, '090411100031', 'Analisa Pencarian Frequent Itemset pada Basisdata Retail Menggunakan Metode Association Rule Berbasis Multiple Minimum Support', 'Bain Khusnul Khotimah, ST., M.Kom', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Association Rule merupakan salah satu metode dalam data mining yang bertugas untuk menemukan hubungan antar item dalam suatu dataset (sekumpulan data) yang telah ditentukan yang kemudian dapat diambil kesimpulan dari hubungan yang terbentuk dan disajikan dalam bentuk aturan asosiasi. Dalam tahap pencarian frequent itemset, minimum support (minsup) yang digunakan bersifat multiple. Sehingga setiap item mempunyai nilai minsup-nya sendiri, yang bisa diberikan secara fleksibel oleh user. Tujuan dasar penggunaan Multiple Minimum Support adalah untuk merefleksikan sifat dasar dan frekuensi yang berbeda untuk setiap item dan untuk mengurangi jumlah rule yang kurang bermakna pada penggunaan single minsup. Dimana multiple minsup diperoleh dari perhitungan antara frekuensi item dengan parameter beta. Setelah dilakukan uji coba terhadap data transaksi El Malik Swalayan Kabupaten Sumenep, penggunaan Multiple Minimum Support berhasil mengurangi jumlah rule yang dihasilkan. Hal ini dibuktikan dengan semakin menurunnya jumlah frequent itemsets yang dihasilkan seiring dengan meningkatnya parameter beta yang diberikan.  Ketika parameter beta yang diberikan adalah nol maka ini menunjukkan minsup yang digunakan sama untuk semua item, seperti halnya penggunaan single minsup. Sedangkan untuk parameter beta diatas nol menunjukkan minsup yang digunakan berbeda untuk setiap item.', 'Ita Firdianti Wahyuningsih', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100031'),
(229, '090411100032', 'ANALISA FORECASTING PROJECT COST MANAGEMENT MENGGUNAKAN METODE EXPONENTIAL SMOOTHING ', 'Hermawan, ST., M.Kom', 'Yeni Kustiyahningsih, S.Kom., M.Kom', 'Penerapan  ERP (Enterprise Resource Planning) dalam sebuah perusahaan merupakan salah satu solusi untuk Project Management Plan. Enterprise Resource Planning memungkinkan adanya peningkatan kinerja dengan cara menyesuaikan integrasi data dan mengelola sumber daya perusahaan secara keseluruhan. Sesuai dengan metodologi Project Management Body of Knowledge, ERP terbagi dalam beberapa modul, salah satunya adalah Project cost management yaitu perencanaan anggaran biaya yang diperlukan sebuah perusahaan untuk meningkatkan pelayanan sehingga dapat memperoleh keuntungan yang maksimal. Untuk meningkatkan kualitas dalam perencanaan anggaran biaya dibutuhkan sebuah peramalan (forecasting) yang akan menjadi acuan untuk estimasi anggaran (Cost Management Plan). Dalam penelitian ini dilakukan forecasting dengan menggunakan metode double exponential smoothing sesuai dengan data trend actual cost. Pada prosedur ini dilakukan perbaikan terus-menerus dengan mengganti nilai alfa dan beta pada forecasting terhadap objek pengamatan terbaru dengan membandingkan hasil forecasting dengan actual cost di lapangan. Dari sistem ini dihasilkan sebuah aplikasi Project Management Plan yang telah diuji coba dengan data proyek SAP PT. Semen Gresik (Persero) Tbk. Dari hasil pengujian dengan data keseluruhan, didapatkan nilai akurasi sebesar 95,74% dengan rata-rata nilai kesalahan peramalan 4,26%.', 'Alifah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100032'),
(230, '090411100033', 'RANCANG BANGUN APLIKASI SISTEM INFORMASI PERIJINAN ONLINE PADA BADAN PERIJINAN KABUPATEN BOJONEGORO', 'Achmad Jauhari, S.T., M.Kom.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Perkembangan teknologi informasi yang pesat belakangan ini sangat mendukung kegiatan komunikasi dan mendongkrak laju keluar masuk informasi. Karena hal ini terjadi banyaknya persaingan baik di bidang perekonomian dan perdagangan. Hal ini menjadi pemicu tumbuhnya pelaku wirausaha baik kecil maupun menengah.\nMeningkatnya pelaku wirausaha mempunyai kendala tersendiri seperti rumitnya birokrasi dalam mengurus surat ijin usaha perdagangan (SIUP) maupun ijin — ijin lainnya. Pada kasus ini kebanyakan di karenakan buruknya pelayanan untuk memperoleh ijin usaha dari lembaga perijinan terutama di daerah — daerah.\nDalam upaya peningkatan kualitas pelayanan untuk pengajuan perijinan maka di butuhkan suatu sarana menggunakan teknologi informasi untuk menunjang proses pengajuan perijinan usaha, maka untuk itu dalam penelitian tugas akhir ini akan di buatkan system informasi perijinan online yang mana system ini akan di terapkan pada Badan Perijinan Kabupaten Bojonegoro guna mempermudah pelaku usaha untuk mengajukan ijin usaha tanpa harus datang ke lembaga perijinan yang menerbitkan ijin usaha.', 'Muhammad Salman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100033'),
(231, '090411100034', 'Sistem Pendukung Keputusan Penentuan Penerima Kartu Indonesia Pintar dengan Metode Naive Bayes (Studi Kasus : SMP Negeri 1 Torjun)', 'Achmad Jauhari,ST.,M.Kom', 'Bain Kusnul Khotimah, ST., M.Kom', 'Kartu Indonesia Pintar adalah salah satu program pemerintah dalam mengatasi masalah pendidikan di Indonesia, khusunya bagi keluarga miskin atau rentan miskin yang tidak dapat menyekolahkan anak-anak mereka sehingga dapat menikmati dan mengenyam kembali pendidikan secara gratis. Data yang digunakan dalam pembagian Kartu Indonesia Pintar (KIP) menggunakan data Bantuan Siswa Miskin (BSM).SMP Negeri 1 Torjunmerupakan salah satu contoh sekolah yang telah menjalalankan program BSM tersebut.Namun dalam pengolahan data BSM di sekolah tersebut dilakakukan secara manual sehingga banyak penerima BSM tersebut tidak tepat sasaran.Oleh karena itupeneliti mencoba untuk membangun sebuah sistem pendukung keputusan penerima Kartu Indonesia Pintar (KIP) dengan menggunakan metode Naïve Bayes.Pada penelitian ini metode yang digunakan adalahNaïve Bayes, karena merupakan metode sederhana yang mudah diimplementasikan, mempunyai waktu komputasi yang cepat serta tingkat akurasinya tinggi.Dalam penentuan Penentuan Penerima Kartu Indonesia Pintar inidigunakan  metode pengolahan data berbentuk Kategori. Dan data yang digunakan  sebanyak 100  untuk data  training dan data testing  sebanayak 100 data siswa Hasil pengujian dapat   disimpulkan bahwa perhitungan presentase tingkat akurasi pada model pengolahan data mencapai nilai presentase  akurasi sebesar 95% dan error rate yang didapat sebesar 5%.\r\nKata Kunci: Bantuan Siswa Miskin (BSM), Kartu Indonesia Pintar (KIP), Naïve Bayes, SMP Negeri 1 Torjun, Sistem PendukungKeputusan (SPK).\r\n', 'Gerry Kuswanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100034'),
(232, '090411100035', 'SISTEM PENILAIAN ESAI OTOMATIS PADA E-LEARNING DENGAN ALGORITMA WINNOWING', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Mochammad Kautsar Sophan, S.Kom., M.MT', 'Ujian esai merupakan evaluasi pembelajaran dalam bentuk soal esai yang mempunyai jawaban lebih bervariasi dibandingkan soal pilihan ganda. Variasi jawaban tersebut memberikan kesulitan tersendiri bagi guru dalam menilai jawaban. Sistem penilaian esai dibangun untuk menjadi salah satu solusi yang dapat mempercepat dan mempermudah proses penilaian. Sistem penilaian esai pada penelitian ini dilakukan dengan mengukur kesamaan jawaban siswa dan kunci jawaban guru. Penelitian ini menggunakan algoritma winnowing. Algoritma winnowingadalah algoritma untuk mengukur kemiripan teks. Algoritma winnowing menghasilkan fingerprint yang akan mewakili teks jawaban pada perhitungan kemiripan dengan persamaan jaccard coeficient. Pengujian dilakukan untuk mengetahui kemampuan algoritma winnowing dalam memberikan penilaian esai dengan menggunakan perubahan nilai n-gram dan window dari algoritma winnowing. Hasil pengujian menunjukkanpenggunaan nilai n-gram dan window pada metode winnowing berpengaruh pada kesamaan fingerprint yang ditemukan. Semakin banyak kesamaan fingerprint yang ditemukan, maka semakin tinggi nilai yang dihasilkan sistem. Akurasi penilaian sistem menunjukkan hasil yang lebih baik pada teks jawaban yang memiliki struktur kalimat jawaban yang sama dengan kunci jawaban.', 'Sariyanti Astutik', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100035'),
(233, '090411100036', 'Implementasi Efficient-SOM Pada Text Clustering Menggunakan Reduksi Dimensi', 'Dr. Indah Agustien S., M.Kom.', 'Mulaab Mulyo, S.Si., M.Kom.', 'Data berukuran besar yang sudah disimpan jarang digunakan secara optimal karena kemampuan manusia yang terbatas untuk mengelolanya. Salah satu data berskala besar adalah data teks. Data teks memiliki fitur yang sangat besar sehingga untuk mengolahnya memerlukan waktu komputasi yang besar pula. Penelitian ini bertujuan untuk mengurangi waktu komputasi dalam proses clustering sehingga data teks dapat diolah secara efisien. Proses clustering menggunakan metode SOM dengan menerapkan reduksi dimensi pada tahap preprosesing. Metode ini diterapkan untuk mengelompokan data tugas akhir mahasiswa Teknik Informatika Universitas Trunojoyo Madura. Dalam metode yang diusulkan, analisis morfologi dilakukan pada teks abstrak tugas akhir mahasiswa untuk menghasilkan vektor input dengan unsur term dari tugas akhir tersebut. Adanya elemen vektor yang jarang, memungkinkan terjadinya reduksi dimensi. Reduksi dimensi dilakukan dengan  menghilangkan matriks jarang atau kolom yang banyak mengandung nilai 0. Dari percobaan yang dilakukan, diperoleh hasil bahwa optimum cluster untuk data abstrak berada pada scenario 1 yaitu jumlah term setelah direduksi sebanyak 150 term, sehingga menghasilkan nilai rata-rata SSE = 0.01117.  Sedangkan untuk data laporan optimum cluster berada pada scenario 2 yaitu jumlah term setelah direduksi sebanyak 346 term, sehingga mengahasilkan nilai rata-rata SSE = 0.0085 detik.', 'Toyibatu Lailiya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100036'),
(234, '090411100037', 'SISTEM INFORMASI PENGELOLAAN DARAH BERBASIS WEB, STUDI KASUS UNIT TRANSFUSI DARAH PAANG MERAH INDONESIA KABUPATEN BANGKALAN', 'Achmad Jauhari, S.T., M.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Perkembangan Jaringan teknologi saat ini begitu pesat  tidak hanya dari sisi perangkat, tetapi juga dari sisi aplikasi yang digunakan.  WEB merupakan salah satu teknologi yang banyak digunakan dalam kehidupan sehari-hari.  Sekarang ini aplikasi tersebut banyak dipergunakan untuk menunjang pelayanan terhadap suatu penawaran barang, jasa, dan pelayanan publik.\n\nDarah merupakan bagian penting bagi tubuh manusia. Saat ini kebutuhan permintaan darah di masyarakat  sangatlah tinggi. Dikarenakan angka kecelakaan dan penyakit yang penangannya membutuhkan transfusi darah  semakin meningkat.  minimnya persediaan darah  dan pemprosesan darah yang lambat, membuat angka kematian akan semakin tinggi.\n\nBerdasarkan kasus  tersebut maka proyek akhir ini dirancang  sistem informasi donor darah yang dapat diakses melalui web browser  PC atupun web browser handphone. Sistem informasi ini dibuat berbasis data base,  sehingga masyarakat dapat melihat informasi langsung persediaan darah di PMI Kabupaten Bangkalan. Selain itu disediakan juga informasi tentang  jumlah darah yang disumbangkan oleh pendonor setia secara perorangan. Sistem dibuat menggunakan hardware loptap dengan spesifikasi tertentu. Sedangkan software yang digunakan adalah sistem dengan basiss WEB dan dengan penggunaan sistem base sistem manajemen XAMPP\n\nKata kunci : sistem informasi, sistem informasi  donor darah, PHP\n', 'Rudi Praditama Widianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100037'),
(235, '090411100038', 'Sistem Pemilihan Bidang Minat (SPBM) Menggunakan Metode Association Rule ', 'Mula\'ab, S.Si., M.kom', 'Bain Khusnul Khotimah, ST., M.Kom', 'Teknik data mining adalah suatu cara yang digunakan untuk menggali informasi lebih mendalam terhadap suatu data yang umumnya berjumlah besar. Salah satu metode dari beberapa teknik data mining yang dapat digunakan untuk mengolah data mahasiswa Teknik Informatika Universitas Trunojoyo Madura (TI-UTM) adalah Association Rule yang salah satu algoritmanya adalah Algoritma Apriori. Dengan metode dan algoritma ini dapat ditemukan hubungan kedekatan antar Mata Kuliah Prasyarat (MKP) dengan bidang minat yaitu dengan membangkitkan frequent itemset. Rule yang dibangun oleh antecedent dan consequent dari masing-masing k-itemset yang memenuhi minimum support maka akan dilanjutkan pada pembangkitan frequent itemset selanjutnya, hingga terakhir tidak ada lagi item yang memenuhi minimum support dan dapat dikombinasikan. Pada Penelitian ini digunakan skenario ujicoba 100 record data dan didapatkan support minimal sebesar 42%, support maksimal sebesar 62% dengan rule terbaik pada minsup 62% yaitu kombinasi Mata Kuliah Prasyarat (MKP) PTI dan bidang minat SISTER dengan confidence sebesar 87,37%. Support minimal dapat terbentuk apabila jumlah dari tiap-tiap item (atribut)  lebih besar sama dengan minsup yang digunakan, support maksimal dapat terbentuk apabila dari minsup yang digunakan tidak lagi mengahasilkan output yaitu berupa rule. Sedangkan rule yang terbaik adalah rule yang mempunyai nilai support dan confidence yang paling tinggi dan rule tersebut mempunyai nilai kepercayaan yang dapat mewakili dari seluruh kombinasi item yang telah terbentuk. Semakin besar jumlah minsup dan mincof yang digunakan maka rule yang dihasilkan akan semakin sedikit, tetapi rule yang dihasilkan tersebut juga akan semakin kuat karena memiliki nilai kepercayaan yang tinggi.', 'Hofidatur Rofi\'ah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100038'),
(236, '090411100039', 'PERBANDINGAN PRINCIPAL COMPONEN ANALYSIS (PCA) \r\nDAN 2 DIMENSIONAL PRINCIPAL COMPONEN ANALYSIS (2D-PCA) UNTUK PENGENALAN ANGKA PADA SISTEM ISYARAT BAHASA INDONESIA (SIBI)\r\n', 'Cucun Very Angkoso, S.T., M.T.', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Penderita tuna rungu menggunakan bahasa isyarat dalam berkomunikasi. Tujuan utama dari penelitian ini adalah agar terjadi harmoni sosial yang baik antara orang tuna wicara dan tuna rungu dengan orang normal. Pada penelitian ini, pengenalan yang dilakukan terfokus pada pengenalan isyarat angka “0”-“9”. Pengenalan pola isyarat citra tangan statis akan melaui tiga tahapan secara garis besar yaitu, segmentasi citra tangan,  ekstraksi fitur/ciri, dan klasifikasi pola. Pada penelitian ini citra akan melalui proses segmentasi yaitu dengan proses background removing/ skin detection untuk memisahkan wilayah objek yang akan diteliti (yaitu tangan) dengan backgroundcitra. Kemudian citra hasil tersebut akan dirubah dalam mode grayscale untuk selanjutnya dilakukan ekstraksi fitur dan klasifikasi pola dengan menggunakan algoritma PCA dan 2DPCA. Pada penelitian ini data citra yang digunakan 200 data training dan data testing untuk di proses pada sistem yang telah dibuat. Dengan menggunakan metode ekstraksi fitur PCA dan 2DPCA, kemudian dihitung pengenalan jaraknya menggunakan Euclidean Distance, dengan perbandingan tingkat akurasi 87,5% untuk PCA dan 94% untuk 2DPCA. Sehingga disimpulkan bahwa akurasi 2DPCA lebih besar dari PCA.', 'Hanim Kholidah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100039'),
(237, '090411100040', 'Implementasi Pengenalan Bahasa Isyarat Tangan Secara Real Time Menggunakan Metode Two Dimensional Linear Discriminant Analysis', 'Cucun Very Angkoso, S.T., M.T.', 'Ari Kusumaningsih, S.T., M.T.', 'Komunikasi paling efektif untuk para tuna rungu adalah komunikasi non verbal (non lisan). Komunikasi ini menggunakan bahasa isyarat baik itu berupa gerakan isyarat tangan ataupun isyarat tubuh dan  mimik wajah. Tujuan utama penelitian ini adalah agar terjadi harmoni sosial yang baik antara tuna rungu dengan orang normal. Penelitian ini mengimplementasikan sebuah aplikasi pengenalan bahasa isyarat tangan secara Real Time menggunakan metode Two-Dimensional Linear Discriminant Analysis. Aplikasi ini berbasis computer desktop. Tahapan proses yang harus dilalui dalam pengenalan isyarat tangan adalah inisialisasi webcam, deteksi obyek tangan, tahapan pre-processing yang terdiri dari background removal, crop dan resize, ekstraksi fitur 2D-LDA, dan klasifikasi Euclidean distance. Keluaran dari sistem ini adalah pengenalan tangan dan identifikasi huruf abjad “A”-“Z” dan juga dapat berupa teks atau kata. Kelompok pertama pada uji skenario satu, dua dan tiga berdasarkan jumlah citra data training  dan data testing, kedua pada skenario empat, lima dan enam berdasarkan jarak pengambilan citra, dan yang terakhir pada skenario tujuh, delapan dan sembilan berdasarkan kondisi pencahayaan. Kesimpulan akhir dari uji skenario mendapatkan rata-rata akurasi tertinggi pada skenario empat dan lima mencapai 95.38%.', 'Khairun Nurul Anam', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100040'),
(238, '090411100041', 'PERBANDINGAN METODE FISHERFACE DAN PRINCIPAL COMPONENT ANALYSIS PADA EKSTRAKSI FITUR UNTUK PENGENALAN WAJAH ', 'Dr. Arif Muntasa., S.Si., M.T', 'Dr. Indah Agustien., S.Kom., M.Kom', 'ASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGHASDJNLM,LKBGXDFXGVVN,M,.MJKGHJBNBNJBHBKJNHHGHGHJGFHGHGVHGVHKBHJGHJGHJGH', 'Fawaidul Badri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100041'),
(239, '090411100042', 'RANCANG BANGUN ERP (ENTERPRISE RESOURCE PLANNING) PADA MODUL MANUFACTURING\r\n MENGGUNAKAN  ZACHMAN FRAMEWORK\r\n', 'Hermawan S.T., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Manufaktur merupakan salah satu  elemen penting dalam sebuah perusahaan manufaktur. Apabila sistem manufaktur sebuah perusahaan tidak teratur dengan baik maka akan sangat merugikan. ERP  merupakan sebuah solusi cerdas yang dapat membantu sebuah perusahaan seperti PT. IGLAS (Persero) untuk management sistem manufaktur. Zachman Framework merupakan pemodelan enterprise system yang bisa digunakan untuk ERP agar bisa mendefinisikan proses manufaktur secara kompleks dalam sistem manufaktur yang akan dibangun. Dalam satu Modul Manufacturing banyak hal yang sangat mempengaruhi kinerjanya. Di antaranya adalah besar permintaan pasar, desain produk yang sesuai serta penjadwalan produksi yang tepat.  Pemodelan arsitektur data dengan menggunakan pendekatan UML 2.0 yang disajikan ke dalam Zachman Framework  yang telah diterapkan pada ERP Modul Manufacturing pada penelititan ini, akan memberikan masukan yang signifikan dalam pengembangan system skala enterprise. Dengan analisa fungsionalitas sistem yang dibangun dengan Model Driven Design, diperoleh kualitas aplikasi dengan bobot rata-rata 88,00 penilaian dari Stakeholder uji coba sistem di PT. IGLAS (Persero) dan bobot dari perbandingan sistem dengan OpenERP 7.0 adalah sistem memiliki bobot fitur 93,75% dan OpenERP 7.0 memiliki bobot fitur 56,25%.\r\n\r\nKata Kunci : ERP, Manufacturing, Zachman Framework, UML 2.0, Model Driven Design.', 'Ja\'par', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100042'),
(240, '090411100043', 'RANCANG BANGUN E-DOCUMENT DI KANTOR PELAYANAN PERIJINAN TERPADU \r\nKABUPATEN BANGKALAN MENGGUNAKAN \r\nNAÏVE BAYES CLASSIFIER \r\n', 'Moch.Kautsar S,S.Kom,M.MT', 'Yeni Kustiyah N, S.Kom.,M.Kom', 'Dokumen adalah suatu asset instansi yang menyimpan berbagai informasi penting dan merupakan pertanggungjawaban kerja yang harus selalu dipelihara, dirawat dan dilindungi keberadaannya. Dalam tugas akhir ini dibangun sebuah rancangan sistem E-Document berbasis web. Aplikasi ini akan diterapkan di lingkungan kantor pelayanan perizinan terpadu  Bangkalan untuk membantu pengelolahan dokumen. semakin  banyaknya dokumen yang dimiliki maka semakin sulit pula untuk mencari dokumen-dokumen tersebut. Hal ini juga dipersulit karena kebiasaan penyimpanan dokumen yang tidak terkelompokan sesuai isinya. Teknik yang dapat digunakan untuk memecahkan masalah tersebut salah satunya yaitu dengan teknik klasifikasi dokumen yang menggunakan metode Naïve Bayes Classifier dengan melakukan preprossing terlebih dahulu yaitu proses tokenizing , membuang stopword dan stemming sehingga didapatkan kata dasar yang nantinya akan dilakukan pengolahan klasifikasi. Dokumen-dokumen tersebut  dikelompokkan menjadi 5 kategori yang berdasarkan seksi bidang dokumen tersebut yaitu kepala kantor, sub bagian tata usaha, seksi ekonomi dan sosial, seksi fisik dan pembangunan dan seksi informasi dan pengaduan. Untuk pengujian menggunakan 250 dokumen yang dibagi menjadi 2 yaitu 200 dokumen sebagai data training dan 50 dokumen sebagai data testing. Dari hasil uji coba tersebut menghasilkan nilai akurasi keberhasilan tertinggi adalah  82 %.', 'Hidayatul Mustafidah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100043'),
(241, '090411100044', 'PENERAPAN FUZZY DECISION TREE\r\nPADA SELEKSI PENERIMAAN BEASISWA DIPA \r\nDENGAN ALGORITMA ITERATIVE DICHOTOMIZER 3', 'Bain Khusnul K., S.T., M.Kom', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Beasiswa DIPA merupakan pemberian berupa bantuan keuangan yang diberikan kepada perorangan yang bertujuan untuk digunakan demi keberlangsungan pendidikan yang ditempuh. Mengingat besarnya dana dan tujuan utama berupa 3T (Tepat Sasaran,Tepat Jumlah,dan tepat Waktu) dibutuhkan sebuah sistem untuk menetapkan penerima beasiswa. Penelitian ini menerapkan pemodelan Fuzzy Decision Tree (FDT) pada seleksi penerimaan beasiswa DIPA dengan algoritma ID3. Metode ini dipilih memberikan data yang lengkap karena pada proses perhitungan dilakukan pencarian secara menyeluruh untuk semua kemungkinan yang. Penelitian ini melakukan pemodelan penerima beasiswa sebanyak 200 data mahasiswa yaitu PPA dan BBM. Pada data PPA yang menggunakan 50 data training dengan threshold 70%, 80% dan 90% menghasilkan akurasi yang baik yaitu 86%.Ketika menggunakan 70 data training, memperoleh hasil akurasi  70%.Sedangkan untuk data BBM, dengan 50 data training menggunakan trheshold 70%, 80% dan 90% menghasilkan akurasi yang baik yaitu 97%.Ketika 70 data training, menghasilkan akurasi 73%. Hasil yang diperoleh bergantung pada data dan threshold yang digunakan. Semakin tinggi threshold yang digunakan maka semakin banyak rule yang dihasilkan. Namun semakin banyak data yang digunakan maka semakin rendah hasil akurasi  yang diperoleh. Akurasi terbaik terdapat pada penggunaan 50 data dan threshold 90% yang menghasilkan akurasi sebesar 90% untuk PPA dan 97% untuk BBM.\r\n\r\nKata Kunci: Rule, Threshold, Fuzzy Decision Tree ID3', 'Ayu Noer Aisyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100044');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(242, '090411100045', 'ANALISA EKSPEKTASI STAKEHOLDER PROJECT COMMUNICATION MANAGEMENT MENGGUNAKAN FUZZY MULTI CRITERIA DECISION MAKING', 'Hermawan, S.T.,M.Kom.', 'Yeni Kustiyahningsih,S.Kom.,M.Kom.', 'Manajemen proyek merupakan upaya untuk merencanakan, mengatur dan melaksanakan proyek secara optimal untuk mencapai sasaran yang ditentukan. Pelaksanaan proyek yang sesuai dengan standar prosedur akan menghasilkan hasil yang optimal. Berdasarkan hal tersebut, Untuk memenuhi standar proyek, penelitian ini mengimplementasikan framework standar manajemen proyek berdasarkan Project Management Body Of Knowledge(PMBOK) yang difokuskan pada domain Project Communication Management. Penelitian ini ditujukan untuk mengintegrasikan domain PMBOK sehingga mampu menganalisa ekspektasi stakeholder dengan menggunakan Fuzzy Multi Criteria Decision Makaing (FMCDM). Uji coba sistem dilakukan menggunakan data proyek implementasi SAP PT. Semen Gresik Tbk. Dari penelitian ini berhasil membangun sistem informasi sesuai dengan fungsional project management di dalam PMBOK dengan tingkat kesesuaian sebesar 72%, sedangkan berdasarkan pengujian oleh user SAP PT. Semen Gresik Tbk, diperoleh tingkat kesesuaian penggunaan sebesar 68%. Sesuai framework project manager PMBOK 4 ditentukan bahwa kriteria yang mempengaruhi kualitas project sesuai dengan ekspektasi stakeholder adalah cost, time, scope, dan quality. Melalui peringkatan bobot di dalam FMCDM dapat ditentukan penentuan kualifikasi sebuah proyek, dimana kesesuaian hasil analisa dengan penilaian real berbanding dengan menurut penilaian nyata di lapangan, didapatkan kesesuaian menurut analisa 93.75%.', 'ASTRIE NOVA ISLAMY', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100045'),
(243, '090411100046', 'RANCANG  BANGUN APLIKASI MOBILE-LEARNING DENGAN MENGINTEGRASIKAN LEARNING MANAGEMENT SYSTEM (LMS) CLAROLINE PADA SMARTPHONE BERBASIS ANDROID\r\n(studi kasus Elite Course - Kamal)', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Bain Khusnul Khotimah, ST., M.Kom', 'Saat ini pelajar harus meluangkan waktu untuk menambah pengetahuan bahasa Inggrisnya di luar sekolah seperti ke tempat kursus. Tetapi, masalah yang sering dihadapi adalah jadwal yang tersedia ditempat kursus tidak dapat menyesuaikan dengan jadwal yang kita inginkan. Terlebih lagi jika kita sakit atau ada kesibukan lain, tentu saja akan melewatkan pertemuan atau bahkan melewatkan jadwal ujian. Hasil akhir dari penelitian ini akan memberi jalan supaya pelajar tidak harus datang ke kelas tetapi tetap dapat berkomunikasi dengan tutor, mendapatkan semua materinya seperti yang di dapatkan di kelas konvensional, mengerjakan ujian, serta tetap mendapatkan sertifikat. Untuk komunikasi chat dan nilai ujian murid dapat dilihat dan di nilai oleh tutor dengan mengakses Learning Management System (LMS) milik Elite-Course yang dibangun menggunakan LMS Claroline. Hal ini karena gadget Android terintegrasi langsung dengan database LMS milik Elite-Course. Berdasarkan hasil ujicoba kelayakan aplikasi menggunakan kuisioner, didapat 48,57 % koresponden merasa teknologi mobile learning ini sangat penting dan 31,43 % merasa penting. Dari hasil prosentase yang ada, dapat disimpukan bahwa teknologi mobile learning sudah dirasa penting dan dapat diterapkan pada lembaga kursus sehingga murid mendapatkan kemudahan dalam kegiatan belajarnya.', 'Saifudin Yahya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100046'),
(244, '090411100047', 'Analisa Jalur Critical Path Pada Project Time Management', 'Hermawan, S.T.,M.Kom.', 'Bain Khusnul Khotimah,S.T.,M.Kom.', 'ERP (Enterprise Resource Planing) merupakan standar teknologi informasi yang digunakan perusahaan besar saat ini untuk mengelola keseluruhan sumber dayanya sehingga dapat meningkatkan keuntungan dan efisiensi kinerja. Salah satu terobosan untuk mengimplementasikan project management pada ERP adalah menggunakan standar Internasional yakni ANSI (American Standart Institute) yang merujuk pada metodologi PMBOK. ERP sendiri memiliki banyak modul. Salah satunya adalah PTM (Project Time Management). PTM memiliki 2 tahap yaitu tahap planning dan controlling. Tahap planning memiliki 5 proses yaitu define activity, sequence activity, estimate activity resource, estimate activity duration, dan develop schedule sedangkan tahap controlling digunakan untuk mengontrol penjadwalan selama proyek sedang dieksekusi. PTM merupakan aspek penting manajemen sebuah proyek karena ketepatan waktu dalam penyelesaian proyek merupakan tantangan besar bagi seorang manajer proyek. Maka dari itu analisa jalur critical path menjadi sebuah solusi didalam PTM untuk menghindari delay dalam sebuah proyek. Hasil ujicoba sistem PTM menggunakan data proyek SAP PT.Semen Gresik tbk diperoleh aktivitas-aktivitas yang ada pada jalur critical path dengan total waktu 281 hari. Ketepatan hasil perhitungan total waktu pada proyek SAP mencapai 97%. PTM disajikan dalam sebuah gantt chart dimana diagram tersebut mewakili semua kegiatan proyek, tanggal awal dan akhir aktivitas, resource requirement, kompleksitas aktivitas, serta durasi aktivitas. Gantt chart ini relatif mudah dibaca dan sering digunakan dalam PTM.', 'Aldrin Pratama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100047'),
(245, '090411100048', 'Gender Recognition Menggunakan metode Principal Component Analysis dikombinasikan dengan Local Binary Pattern', 'Dr. Arif Muntasa., S.Si,. M.T', 'Dr. Indah Agustien S., S.Kom,. M.Kom', 'Gender Recognition merupakan sistem untuk mengidentifikasi jenis kelamin seseorang berdasarkan citra wajah, karena di dalam citra wajah terdapat fitur yang merepresentasikan karakteristik seseorang. Gender Recognition dapat digunakan dalam berbagai macam applikasi, seperti interaksi manusia dan komputer, sistem kamera, dan sistem temu kembali citra. Pengklasifikasian jenis kelamin diperoleh dari tiga tahap antara lain preprocessing, ekstraksi fitur, dan pengklasifikasian citra. Tahap pertama, yaitu Preprocessing yang bertujuan untuk menghilangkan variasi pencahayaan pada citra dengan menggunakan metode Local Binary Pattern (LBP). Tahap kedua, ekstraksi fitur menggunakan metode Principal Component Analysis (PCA) sehingga menghasilkan susunan matrik proyeksi dan matrik bobot yang akan digunakan pada tahap klasifikasi. Tahap ketiga,  pengklasifikasian citra menggunakan pengukuran kemiripan Euclidean Distance, dengan cara membandingkan matrik bobot citra training dengan matrik bobot testing yang diperoleh dari proses perkalian citra testing dengan matrik proyeksi. Dari hasil uji coba sistem, kombinasi metode Principal Component Analysis (PCA) dan Local Binary Pattern (LBP) dengan menggunakan pengukuran kemiripan Euclidean Distance tingkat akurasi rata-rata mencapai 80%. Klasifikasi jenis kelamin yang salah dikarenakan oleh miripnya bentuk rambut, bentuk kepala serta ekspresi antara citra perempuan dan citra pria. ', 'Ahmad Ferdiansah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100048'),
(246, '090411100049', 'APLIKASI BELAJAR MENULIS ALPHANUMERIK UNTUK ANAK USIA PRA-SEKOLAH BERBASIS ANDROID', 'Yonathan Ferry Hendrawan, S.T., M.I.T', 'Muhammad Fuad, S.Kom., M.T', 'Kemampuan menulis Alphanumerik  merupakan bekal utama bagi anak untuk dapat memahami mata pelajaran yang diberikan di sekolah. Salah satu alternatif untuk  membantu meningkatkan minat dan kemampuan anak dalam belajar menulis Alphanumerik adalah dengan menggunakan media pembelajaran berupa perangkat  lunak (software). Penelitian tugas akhir ini adalah membuat sebuah aplikasi yang menyajikan pembelajaran menulis Alphanumerik  yang sengaja dikemas dalam bentuk permainan supaya dapat meningkatkan minat belajar anak usia pra-sekolah. Aplikasi pembelajaran ini dibagi menjadi dua, yaitu pengenalan pola dan  pengenalan karakter. Untuk pengenalan pola dibuat dengan mengikuti jalur yang ada pada gambar yang diwakili oleh gambar bola sebagai dasar dari tiap sudut Alphanumerik. Garis dibuat dengan menggeser jari pada layar handphone dari satu titik ke titik yang lain yang menghubungkan setiap sudut Alphanumerik. Cara menulis ini dibuat sesuai dengan kaedah penulisan Alphanumerik yang ada di pendidikan menulis usia dini. Sedangkan dalam pengenalan karakter, aplikasi merekam tulisan tangan Alphanumerik yang telah dibuat oleh pengguna pada tempat yang disediakan. Dari tulisan tangan tersebut kemudian akan diproses pada tahapan pengolahan citra. Citra gambar tersebut dibandingkan dengan database yang ada pada aplikasi dengan bantuan Library Tesseract sebagai mesin perbandingannya. Dari hasil uji coba, anak-anak pra-sekolah mudah mengoprasikan aplikasi ini.', 'Darmawan Aditama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100049'),
(247, '090411100050', 'Rancang Bangun ERP ( Enterprise Resource Planning ) Pada Modul Inventory\r\nManagement Menggunakan Zachman Framework', 'Hermawan.,ST., M.Kom', 'Rika Yunitarini., ST., MT', 'Dalam perancangan  Enterprise Resource Planning (ERP), dibutuhkan perencanaan terorganisir, dikarenakan ERP ditujukan untuk mengintegrasikan seluruh proses yang ada dalam berbagai domain fungsional perusahaan, antar departemen, maupun antar lokasi yang berbeda. Penelitian ini bertujuan merancang sebuah desain aplikasi untuk mendapatkan blueprint aplikasi pada modul Inventory Managemnt (IM).Zachman Framework(ZF) merupakan salah satu kerangka kerja yang dapat  memetakan artifak arsitektur informasi di sebuah organisasi. Dalam penerapanya, ZF mampu mendeskripsikan level prespektif arsitektur IT(Planner Perspective, Owner Perspective, Designer Perspective, Builder Perspective, Implementer Perspective, Participant Perspective) sesuai abstraksi objek (What, How, Where, Who, When, Why).Untuk standarisasi artifak arsitektur informasi digunakan pendekatan standart pemodelan UML 2.0, sehingga mampu meningkatkan deskripsi ZF menjadi standart Model Driven Architecture.Untuk pengujian hasil desain perancangan telah dikembangkan perangkat lunak ERP IM  yang menerapkan Model Driven Design yang mampu mengkonversi artifak model menjadi aplikasi yang berkualitas. Dimana dari hasil penilaian Stakeholder dari pengujian sistem di PT. IGLAS(Persero), didapatkan tingkat kepuasan rata-rata 90%. Sedangkan untuk penilaian availability sistem secara kuantitatif dengan dibandingkan Openerp 7.0 sistem yang dikembangkan jauh lebih kompleks dengan ketersediaan fitur 88,8% berbanding dengan Openerp 7.0 yang hanya memiliki keterbatasan fitur 77,7%.', 'Rhiyananta Catur Yudowicitro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100050'),
(248, '090411100051', 'Sistem Pengenalan Angka pada Sistem Isyarat Bahasa Indonesia (SIBI) dengan Metode LDA dan 2D-LDA', 'Cucun Very Angkoso,S.T.,MT', 'Ari Kusumaningsih,S.T.,M.T', 'Tujuan utama dari penelitian pengenalan angka pada sistem isyarat bahasa Indonesia (SIBI) menggunakan metode LDA dan 2D-LDA adalah melakukan pengenalan pola angka isyarat tangan dalam bahasa Indonesia. Pengenalan pola angka isyarat tangan secara garis besar dilakukan dalam tiga tahapan yaitu segmentasi citra tangan, ekstraksi ciri, dan klasifikasi pola. Pada penelitian kali ini citra pola akan melalui proses segmentasi dengan menggunakan proses background removing atau skin detection, untuk pemisahan wilayah pola tangan dengan background citra, kemudian hasil citra tersebut akan diubah dalam mode grayscale untuk selanjutnya dilakukan ekstraksi ciri menggunakan metode LDA dan 2D-LDA, dan klasifikasi pola dengan menggunakan metode Euclidean Distance. Penelitian ini menggunakan 200 data citra yang akan digunakan sebagai data training  dan data testing, untuk proses uji coba pada sistem. Penelitian pengenalan angka pada sistem isyarat bahasa Indonesia (SIBI) dengan menggunakan metode LDA dan 2D-LDA menunjukkan tingkat akurasi pengenalan citra angka isyarat pada skenario 1 menggunakan LDA dan Euclidean Distance sebesar 89%, sedangkan menggunakan 2D-LDA dan Euclidean Distance adalah 94%. Skenario 2 menggunakan LDA dan Euclidean Distance sebesar 77,78%, sedangkan menggunakan 2D-LDA dan Euclidean Distance adalah 82,2%, dan sekenario 3 hasil akurasi menggunakan LDA dan Euclidean Distance sebesar 71,25%, sedangkan menggunakan 2D-LDA dan Euclidean Distance adalah 80%.\r\n\r\nKata Kunci : SIBI Segmentasi, Skin Detection, Grayscale, LDA dan 2D-LDA, Euclidean  Distance.\r\n', 'Desy Ratnasari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100051'),
(249, '090411100052', 'KLASIFIKASI DOKUMEN MENGGUNAKAN METODE EXPECTATION MAXIMIZATION ', 'Mula\'ab S.Si., M.Kom', 'Fika hastarita Rachman S.T., M.Eng', 'Banyaknya informasi dan dokumen yang ada mendorong manusia untuk mencari bagaimana untuk mendapatkan informasi dan dokumen yang diinginkan dalam waktu yang singkat. Klasifikasi dokumen tugas akhir dapat membantu program studi Teknik Informatika dalam proses pencarian sebuah dokumen dengan cepat dan tepat. Klasifikasi dokumen tugas akhir mengelompokkan dokumen yang sesuai dengan bidang minat masing-masing di dalam jurusan Teknik Informatika Universitas Trunojoyo Madura diantaranya adalah bidang minat sistem informasi dan rekayasa perangkat lunak , multimedia , sistem terdistribusi, komputasi dan kecerdasan buatan dengan menggunakan PCA (Principle Component Analisis) sebagai pereduksi dimensi dokumen proposal seminar tugas akhir, dimana PCA ini akan mengestraksi fitur dari dokumen sehingga hanya mengambil ciri penting dari dokumen untuk diklasifikasikan menggunakan metode Expectation Maximization, dimana metode Expectation Maximization merupakan salah satu metode dalam pengklasifikasian. Pengujian akan memakai 30 dokumen proposal seminar tugas akhir yang dibagi menjadi dua bagian yaitu dokumen training dan dokumen testing.  yaitu 17 dokumen untuk data training dan 13 dokumen untuk dokumen test. Pengujian klasifikasi dengan Expectation Maximization menghasilkan nilai rata-rata untuk precision sebesar 0,81 dan recall sebesar 0,87 yang memiliki tingkat akurasi sebesar 85% dan tingkat error rate sebesar 15%.\r\nKata Kunci : Klasifikasi, PCA, Expectation maximization.\r\n', 'Veki Nurkholis', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100052'),
(250, '090411100053', 'RANCANG BANGUN ERP (ENTERPRISE RESOURCE PLANNING) PADA MODUL DISTRIBUSI\r\nMENGGUNAKAN ZACHMAN FRAMEWORK\r\n', 'Hermawan, S.T., M.Kom.,', 'Rika Yunitarini., ST., MT.', 'Sistem informasi ERP mengintegrasikan proses bisnis  disemua  fungsional  perusahaan untuk  meningkatkan  sumber  daya yang dimiliki sebuah perusahaan. Penelitian ini bertujuan untuk merancang sebuah desain aplikasi untuk mendapatkan sebuah blueprint pada modul distribusi. Zachman Framework (ZF) merupakan salah satu kerangka kerja untuk memetakan artifak sebuah arsitektur informasi dalam sebuah organisasi. ZF mendeskripsikan level perspektif arsitektur IT. Terdiri dari 6 level perspektif yaitu: Scope (Planner Perspective), Enterprise Model (Owner Perspective), System Model (Designer Perspective), Technology Model (Builder Perspective), Detailed Representation (Sub-Contractor/Implementer Perspective) dan Functioning Enterprise (Participant Perspective). Perspektif tersebut sesuai dengan abstraksi objek (what, how, why, when, where, who). Untuk standarisasi artifak informasi digunakan pendekatan UML 2.0, sehingga mampu meningkatkan deskripsi ZF menjadi standart Model Driven Design. Untuk pengujian hasil dari desain perancangan sistem telah dikembangkan perangkat lunak ERP pada modul distribusi yang telah menerapkan konsep Model Driven Design untuk menjadi aplikasi yang berkualitas. Berdasarkan hasil pengujian sistem dari PT.IGLAS persero, didapatkan tingkat kepuasan rata-rata 85.6. Sedangkan untuk penilaian availability sistem secara kuantitatif telah dilakukan komparasi sistem dengan OpenERP 7.0. sistem ERP yang dikembangkan lebih kompleks dan mudah untuk dijalankan dengan ketersediaan fitur 85.7% berbanding dengan OpenERP 7.0 yang memiliki ketersediaan fitur 80.9%. ', 'Farid Ilham Al-Qorni', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100053'),
(251, '090411100056', 'Analisa Perbandingan SAW dan TOPSIS untuk Open Recruitment Warga Laboratorium Teknik Informatika di Universitas Trunojoyo Madura', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Rika Yunitarini, S.T., M.T.', 'Laboratorium berfungsi untuk menunjang kegiatan perkuliahan. Dalam hal ini, admin bertanggungjawab atas semua kegiatan akademik yang dilaksanakan di laboratorium. Namun banyaknya kegiatan akademik tersebut tidak sebanding dengan sumber daya manusia, sehingga admin kesulitan menangani semua kegiatan akademik tersebut. Open recruitment dibutuhkan untuk menjaring mahasiswa-mahasiswa berprestasi guna menjadi warga laboratorium. Kriteria-kriteria yang ditentukan pada open recruitment warga laboratorium, meliputi : online test, live coding, interview, presentasi, IPK, dan semester.\nPenilaian open recruitment selama ini dilakukan secara manual dengan menggunakan Microsoft Excel, sehingga proses pengolahan data lama dalam pengambilan keputusan, maka sistem ini dibuat dengan menggunakan metode Simple Additive Weighting (SAW) dan Technique for Order Preference by Similarity to Ideal Solution (TOPSIS) sebagai solusi alternatif serta berbasis web.\nBerdasarkan hasil uji coba menggunakan metode Simple Additive Weighting (SAW) menunjukkan nilai kecocokan urutan alternatif dengan hasil real sebesar 33,33% dan nilai kecocokan jumlah alternatif dengan hasil real sebesar 93,33%. Sedangkan, hasil uji coba menggunakan metode Technique for Order Preference by Similarity to Ideal Solution (TOPSIS) menunjukkan nilai kecocokan urutan alternatif dengan hasil real sebesar 46,67% dan nilai kecocokan jumlah alternatif dengan hasil real sebesar 100%.', 'Merlien N. Febriyati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100056'),
(252, '090411100057', 'RANCANG BANGUN SISTEM INFORMASI PEMBAYARAN SPP BERBASIS WEB  (STUDI KASUS di SMKN 1 SAMPANG)\r\n', 'Bain Khusnul Khotimah, ST., M.Kom', 'Rika Yunitarini, ST., MT', 'Sistem informasi pembayaran SPP sekolah adalah suatu sistem yang dirancang untuk kebutuhan pengelolaan data pembayaran SPP dengan penerapan teknologi komputer yang bertujuan untuk mempermudah pekerjaan petugas Bank mini. SMKN 1 Sampang  merupakan salah satu sekolah negeri di Sampang yang belum memiliki sistem yang sudah terancang untuk pengelolaan data pembayaran SPP. Saat ini pengelolaan data pembeyaran SPP di SMKN 1 Sampang masih menggunkan buku besar dalam melakukan pencatatan . Dengan pengelolaan dengan sistem manual SMKN 1 Sampang mengalami beberapa pengerjaan yang kurang efektif dan efisien seperti sekolah harus mencari satu persatu dari arsip yang tersimpan dalam jumlah yang banyak, pengawasan pembayaran SPP sekolah yang belum maksimal sehingga pihak sekolah terkadang telat mengetahui siapa saja siswa-siswi yang belum melakukan pembayaran SPP.\r\nDalam penelitian ini, peneliti akan merancang dan membuat sebuah sistem informasi pembayaran SPP sekolah berbasis web. Studi kasus dari sistem tersebut dilaksanakan pada SMKN 1 Sampang  dengan beberapa permasalahan yang ada.\r\nDengan adanya penelitian ini diharapkan dapat membantu pihak sekolah dalam melakukan pengelolaan data-data akademik secara efektif dan efisien.\r\n\r\n', 'Nor Eka Muliana AK', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100057'),
(253, '090411100058', '“KLASIFIKASI PENDAPAT MASYARAKAT JEJARING SOSIAL DENGAN MENGGUNAKAN METODE NAIVE BAYES”\r\n(Study Kasus : Jejaring Sosial Twitter, Keyword : Jokowi)', 'Firdaus Solihin,S.Kom.,M.Kom', 'Sigit Susanto Putro,S.Kom.,M.Kom', 'Setelah terpilihnya Presiden Republik Indonesia tahun 2014, banyak kebijakan yang telah dilakukannya, namun di saat bersamaan berbagai pro dan kontra bermunculan dikalangan masyarakat. Beberapa pendapat muncul baik dalam konteks yang positif, negatif dan ada beberapa pendapat yang bersifat netral. Dalam proses mengumpulkan pendapat masyarakat yang tersebar di dunia jejaring sosial Twitter ini dengan proses Crawling. Data yang berhasil di-crawl selanjutnya dilakukan beberapa proses menggunakan metode NB. Dengan menggunakan metode ini, maka semua pendapat yang ada nantinya akan dikelompokkan berdasarkan kelas yang sudah ditentukan, yakni positif, dan negatif. Selanjutnya akan ditampilkan dalam bentuk persebaran dalam sebuah peta digital. Sebaran pendapat-pendapat tersebut didasarkan pada daerahnya. Maka dari itu dibutuhkan sebuah aplikasi yang dapat menghimpun pendapat masyarakat. Setelah itu akan dilakukan penghitungan menggunakan metode Naïve Bayes. Tujuannya untuk mengetahui tingkat keakuratan pengklasifikasian data yang didapat kemudian menampilkan hasilnya dalam bentuk sebaran dalam peta digital. Diharapkan dengan adanya aplikasi ini menjadikannya salah satu referensi dalam mengetahui sebaran pendapat.\r\nKata Kunci : Crawling, Twitter, Klasifikasi, Naïve Bayes, Peta Digital.', 'Annika Alfiani Zaita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100058'),
(254, '090411100059', 'SISTEM INFORMASI PENERIMAAN DAN PENYELEKSIAN SISWA BARU JALUR PMDK PRESTASI BERBASIS WEB DENGAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)\r\n(STUDI KASUS: SMPN 01 Kamal)\r\n', 'Bain Khusnul Khotimah, ST, M.Kom', 'Rika Yunitarini.ST.MT', 'Penerimaan siswa baru adalah salah satu proses yang dilakukan pihak sekolah untuk menjaring calon siswa baru. Proses penerimaan siswa baru memiliki berbagai jalur pendaftaran yaitu PMDK Prestasi (Akademik dan non-Akademik) dan jalur nilai Ujian Nasional (UN). Sistem Informasi berbasis web ini akan memberikan kemudahan kepada panitia penerimaan siswa baru yaitu berupa pengolahan data serta nilai yang memenuhi kriteria untuk dapat masuk ke SMP Negeri 1 Kamal. Dengan efisiensi waktu yang terjamin maka akan meningkatkan mutu pada SMP Negeri 1 Kamal. Untuk calon siswa baru yang mendaftar melalui jalur PMDK Prestasi baik Akademik maupun non-Akademik, maka perlu adanya proses seleksi. Metodologi yang digunakan dalam pengembangan sistem informasi ini menggunakan metode Simple Additive Weighting (SAW). Metode ini sangat tepat digunakan untuk penerimaan dan penyeleksian siswa baru berdasarkan kriteria- kriteria yang telah ditentukan dengan menggunakan metode SAW\r\nKata kunci: Sistem Informasi, Penerimaan siswa baru, Penyeleksian, Metode Simple Additive Weighting (SAW', 'iradatul izzaty', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100059'),
(255, '090411100061', 'EKSTRAKSI FITUR PRINCIPAL COMPONENT ANALYSIS (PCA) UNTUK PENGENALAN HURUF ABJAD BAHASA ISYARAT PADA SISTEM ISYARAT BAHASA INDONESIA (SIBI)', 'Cucun Very Angkoso, S.T., M.T.', 'Ari Kusumaningsih, S.T., M.T.', 'Komunikasi merupakan hal yang sangat penting dalam kehidupan bermasyarakat, dan semua orang pasti membutuhkan komunikasi sebagai sarana bersosialisasi dengan orang lainnya, tak terkecuali mereka yang memiliki keterbatasan fisik, tuna rungu dan tuna wicara misalnya. SIBI menupakan suatu bahasa yang menggunakan gerakan tangan dan ekspresi wajah, yang merupakan suatu alat komunikasi bagi penderita tuna rungu dan tuna wicara.Dengan latar belakang tersebutlah penelitian ini dilakukan. Penelitian ini bertujuan untuk dapat membuat sistem pengenalan abjad jari pada SIBI, mulai dari abjad “A” hingga “Z”. Metode yang digunakan dalam penelitian ini adalah metode ekstraksi fitur Principal Component Analysis dan pengukuran jarak kedekatan menggunakan Euclidean Distance. Penelitian ini menggunakan 1092 data citra yang akan digunakan sebagai data training dan testing untuk proses uji coba pada sistem yang telah dibuat. Dengan menggunakan metode ekstraksi fitur PCA dan penghitungan jarak dengan Euclidean Distance, dari tiga skenario pengujian yang telah dilakukan pada penelitian ini, menghasilkan tingkat akurasi sebesar 77.11% untuk uji coba dengan memisahkan data training menjadi dua, yaitu data training untuk semua huruf kecuali “J” dan “Z” dan data training huruf “J” dan “Z” saja.', 'Adelia Kusuma Wardani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100061'),
(256, '090411100062', 'DETEKSI LOKASI PLAT NOMOR BERBASIS OPERASI MORFOLOGI PADA KENDARAAN RODA DUA', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M. Kom', 'Sistem  parkir  yang  berlaku  saat  ini  kebanyakan  masih  bersifat  pencatat  manual  untuk  memasuki  area \r\nperparkiran, dengan menggunakan karcis parkir sebagai tanda bukti. Dengan sistem tersebut masih memiliki \r\nkekurangan  dalam  tingkat  kebenaran  pencatat  nomor  kendaraan  (human  error)  dan  hal  ini  mempengaruhi \r\nlamanya proses pelayanan dari sistem perparkiran yang ada. Dalam penelitian ini sistem dibuat untuk bi sa \r\nmendeteksi  lokasi  plat  nomor.  Operasi  morfologi  merupakan  salah  satu  metode  yang  memfokuskan \r\npengolahan bentuk atau segmen pada suatu citra. Berdasarkan hal tersebut maka dalam penelitian Tugas \r\nAkhir ini dibuat suatu sistem pendeteksi lokasi plat nomor dengan menggunnakan operasi morfologi. Dengan \r\nmengunakan  fungsi  dari   dilasi  untuk  menebalkan  citra,  erosi  untuk  menipiskan  citra,  opening  untuk \r\ndigunakan  membuang  obyek  yang  dianggap  sebagai  noise.  Untuk  langkah    pertama  dalam  menjalankan \r\nsistem  yaitu  input  citra   kemudian  diproses   melalui  tiga  tahapan  yaitu  preprocessing,  seleksi  obyek  plat \r\nnomor  dan  selanjutnya  verifikasi  posisi  plat  nomor.  Output  yang  ditampilkan  yaitu  lokasi  dari  posisi  plat \r\nnomor pada suatu kendaraan yang mana ditandai dangan area persegi pada  input  citra.   Berdasarkan hasil uji coba  dari  empat  skenario  didapat  hasil  yang  terbaik  dari  skenario  ketiga  yaitu  label  8  disk  1  yang menghasilkan pendeteksian posisi plat nomor dengan 90 % sukses sedangkan yang error atau tidak terdeteksi sebanyak 10%.', 'Nurani Mauludah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100062'),
(257, '090411100063', 'ANALISA FAKTOR PADA FELDER-SILVERMAN LEARNING STYLE DIMENSIONS (FSLSM) MENGGUNAKAN METODE PCA ', 'Andharini Dwi Cahyani. S.Kom., M.Kom.', 'Rima Tri Wahyuningrum. S.T., M.T.', 'Dalam dunia pendidikan dan pengajaran di kelas maupun melalui e-learning, hal utama yang menjadi fokus adalah peserta didik. Bila dikaji dengan cermat, setiap individu mempunyai kemahiran yang berbeda ketika memproses suatu maksud dari sebuah pembelajaran. Oleh sebab itu, perlu dikembangkan konsep adaptivitas gaya pembelajaran yang sesuai. Karena, hal tersebut merupakan faktor penting terhadap prestasi belajar para peserta didik. Dalam tugas akhir ini, membahas tentang analisa gaya belajar siswa Felder-Silverman Learning Style Model (FSLSM) melalui pengambilan data kuisioner ILS. FSLSM merupakan salah satu model gaya belajar yang mengelompokkan menjadi empat dimensi yaitu active atau reflective, sensing atau intuitive, visual atau verbal, dan sequential atau global. ILS merepresentasikan ciri dari dimensi gaya belajar dalam 44 item soal kuisioner. Banyaknya pertanyaan yang mewakili tiap-tiap dimensi sebagai variabel komponen untuk proses pendeteksian, menyebabkan tingkat akurasi dan kecepatan deteksi karakteristik menjadi rendah. Sehingga diperlukan adanya reduksi ciri terhadap pertanyaan-pertanyaan tersebut berdasarkan analisa faktor utama melalui penerapan metode Principal Component Analysis (PCA). Sistem yang telah dibangun dengan penerapan metode PCA mampu mereduksi soal-soal kuisioner dari 44 soal menjadi 16 soal dengan akurasi keberhasilan tertinggi sebesar 71.7%. Pengujian dilakukan pada 400 data kuisioner sebagai data testing sekaligus data training.', 'Ika Nofita Sari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100063'),
(258, '090411100066', 'MODEL ENROLLMENT PENERIMAAN SISWA BARU SEKOLAH MENENGAH PERTAMA NEGERI MENGGUNAKAN METODE AHP & SAW\r\n(Studi Kasus : Dinas Pendidikan Kab Bangkalan)\r\n', 'M. Kautsar Sophan, S.Kom, M.MT', 'Yeni Kustiyahningsih, S.Kom, M.Kom', 'Penerimaan Siswa Baru (PSB) merupakan kegiatan tahunan yang dilaksanakan oleh semua sekolah di setiap jenjang. Di Kabupaten Bangkalan proses ini masih menggunakan cara manual dalam pelaksanaannya. Selama ini, calon siswa harus datang ke sekolah untuk melakukan pendaftaran. Setiap hari calon siswa harus mengecek apakah namanya tercantum dalam kuota penerimaan atau tidak. Apabila nama mereka tidak tercantum dalam kuota penerimaan, maka mereka harus memilih sekolah baru dan melakukan proses yang sama hingga batas waktu yang ditetapkan. Sistem enrollment merupakan salah satu solusi permasalahan di atas. Enrollment dimulai dari proses pendaftaran online, proses penyeleksian hingga pengumaman hasil seleksi secara online. Pada penelitian ini, proses penyeleksian menggunakan metode Analytical Hierarchy Process (AHP) dan Simple Additive Weighting (SAW). AHP digunakan untuk menentukan bobot dari kriteria calon siswa yaitu nilai UAN, prestasi individu, dan usia, sedangkan SAW digunakan sebagai langkah akhir penjumlahan bobot kriteria  hingga menghasilkan peringkat nilai tertinggi ke terendah calon siswa berdasarkan kriteria tersebut. Calon siswa yang tersisih dari kuota penerimaan diberikan rekomendasi sekolah baru berdasarkan jarak terdekat tempat domosili siswa ke sekolah baru. Data yang digunakan sebagai uji coba adalah data pendaftar siswa baru tahun pelajaran 2012-2013 SMP Negeri 2 Bangkalan dan menghasilkan tingkat akurasi sebesar 91.5%.\r\n', 'Novia Sulviatin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100066'),
(259, '090411100068', 'EKSTRAKSI FITUR BERBASIS TWO DIMENSIONAL PRINCIPAL COMPONENT ANALYSIS (2DPCA) PADA SISTEM PENGENALAN WAJAH\r\nFEATURE EXTRACTION BASED ON TWO DIMENSIONAL PRINCIPAL COMPONENT ANALYSIS (2DPCA) FOR FACE RE', 'Dr. Arif Muntasa, S.Si., M.T.', 'Cucun Very Angkoso.S.T., M.T.', 'Pengenalan wajah merupakan salah satu teknologi biometric yang telah banyak dikembangkan oleh peneliti dibidang Computer Vision. Hasil penelitian dibidang ini juga sudah banyak digunakan dalam sistem keamanan seperti lingkungan intelijen dalam kepolisian serta dalam sistem keamanan ataupun verifikasi di berbagai perusahaan-perusahaan besar di Negara maju khususnya. Riset Tugas Akhir face recognition ini menggunakan citra ORL dan citra buatan. Dimana jumlah citra untuk ORL sebanyak 400 citra yang terdiri dari 40 kelas dan 10 pose, masing-masing citra mempunyai dimensi 112 x 92 piksel. Sedangkan, untuk citra buatan sebanyak 150 citra yang terdiri dari 15 kelas dan 10 pose, masing-masing citra mempunyai dimensi 180 x 150 piksel. Di skenario uji coba sistem ini terdapat 2 skenario pada masing-masing database uji coba, yaitu skenario 1 (7 pose citra training dan 3 pose citra testing) dan untuk skenario 2 (5 pose citra training dan 5 pose citra testing). Dalam proses uji coba, sistem ini membandingkan hasil akurasi antara penggunaan Histogram Equalization, Local Binary Pattern (LBP) dan tanpa proses Preprocessing, serta membandingkan hasil akurasi penggunaan jumlah fitur dalam proses klasifikasinya. Dalam proses klasifikasi menggunakan metode Canberra Distance dan Manhattan Distance dengan pendekatan penampilan (Appearance based). Hasil uji coba yang diperoleh membuktikan akurasi tertinggi terdapat pada citra ORL skenario 1 dengan histogram equalization yaitu 96,67%, sedangkan hasil terburuk pada citra ORL skenario 2 dengan LBP yaitu 33%.', 'Ach. Choirur Rosyid', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100068'),
(260, '090411100069', 'Penyatuan Feature Principle Component Analysis dan Linear Discriminant Analysis Untuk Pengenalan Wajah', 'Dr. ARIF MUNTASA.,S.Si, M.T', 'Dr. INDAH AGUSTIEN S.,M.Kom', 'Pengenalan wajah merupakan salah satu bidang yang banyak diteliti dan dikembangkan oleh\r\npara  pakar  pengenalan  pola. Hal  ini  disebabkan  semakin meluasnya  penggunaan  teknik\r\nidentifikasi wajah  dalam  aplikasi  yang  digunakan  oleh  masyarakat. Wajah dijadikan sebagai\r\nobyek pengenalan karena wajah memiliki informasi yang lebih mudah didapat dari pada sidik\r\njari atau iris mata. Pada penelitian ini proses pengenalan wajah dilakukan dalam 3 tahap. Tahap\r\npertama  yaitu  citra  di  ekstraksi  fitur  menggunakan  metode Principle  Component Analysis\r\n(PCA)  dan  metode Linear  Discriminant  Analysis (LDA).  Nilai  matrik  bobot  dihasilkan  dari\r\nmasing-masing proses ekstraksi fitur. Tahap selanjutnya proses penyatuan fitur, matrik bobot\r\nPCA dan LDA disatukan (fusion), sehingga menghasilkan susunan matrik baru yang disebut\r\nmatrik fusion.  Kemudian  tahap  pengklasifikasian  citra  menggunakan  metode Manhattan\r\nDistance dengan  cara  mencari  nilai  minimum  antara  matrik fusion dan  matrik fusion-test.\r\nBerdasarkan hasil uji coba sistem menggunakan 4 skenario diperoleh rata-rata akurasi 94,8%.\r\nDengan menggunakan skenario yang sama metode PCA menghasilkan rata-rata akurasi 88,4%\r\ndan metode LDA menghasilkan rata-rata akurasi 94,6%. Hasil analisa tersebut menyimpulkan\r\nbahwa metode penyatuan fitur PCA dan LDA memiliki rata-rata lebih baik dari metode PCA\r\ndan LDA untuk pengenalan wajah', 'CAHYA DWI PRASETYA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100069'),
(261, '090411100070', 'Pengenalan Jenis Kelamin Berdasarkan Citra Wajah Menggunakan Metode Local Binary Pattern (LBP) dan Fisherface', 'Rima Tri Wahyuningrum, S.T., M.T.', 'Fitri Damayanti, S.Kom., M.Kom.', 'Wajah merupakan salah satu bagian dari tubuh manusia yang mempunyai karakteristik khusus sehingga sering digunakan untuk membedakan identitas individu yang satu dan yang lainnya. Pengenalan wajah menjadi sangat penting untuk dikembangkan sejak aplikasi ini diterapkan dalam sistem keamanan. Pegenalan jenis kelamin merupakan salah satu bagian dari pengenalan wajah. Tujuan dari penelitian ini adalah membuat implementasi dari sistem pengenalan jenis kelamin pada citra wajah atau Gender Recognition dengan masukan berupa citra wajah yang mampu mengenali jenis kelamin pada citra wajah seseorang secara cepat dan tepat serta berjalan dengan baik. Dalam penelitian ini terdapat 3 tahap utama yaitu preprocessing dengan menggunakan Local Binary Pattern (LBP), ekstraksi fitur dengan Fisherface (PCA - LDA) dan  tahap terakhir adalah pengklasifikasian citra menggunakan Euclidean Distance. Dari hasil uji coba sistem dengan menggunakan metode LBP dikombinasikan dengan Fisherface didapat tingkat akurasi rata – rata 62%. Klasifikasi yang salah pada uji sistem disebabkan oleh miripnya bentuk kepala, bentuk rambut dan ekspresi antara kedua citra perempuan dan laki-laki.', 'Nafin Fenanda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100070'),
(262, '090411100073', 'PENERAPAN APLIKASI STEGANOGRAFI DENGAN METODE\r\nLSB MENGGUNAKAN FILE AUDIO', 'Dwi Kuswanto,S.Pd., M.T', 'Mula’ab, S.Si., M.Kom', 'Pertukaran informasi merupakan suatu yang dianggap biasa dan mudah untuk saat ini, terlebih\r\nlagi semakin berkembangnya internet yang mendukung singkatnya waktu untuk saling bertukar\r\npesan. Setiap individu di dunia ini pasti memiliki informasi rahasia baik itu bersifat pribadi\r\natau organisasi. Salah satu teknik penyembunyian pesan rahasia adalah steganografi, yang\r\nmerupakan seni dan ilmu menulis pesan tersembunyi atau menyembunyikan pesan dalam suatu\r\nmedia sehingga selain si pengirim dan si penerima, tidak ada seorangpun yang mengetahui atau\r\nmenyadari bahwa ada suatu pesan rahasia. Metode steganografi yang digunakan dalam\r\npengamanan pesan ini adalah LSB (Least Significant Bit) metode penyembunyian pesan\r\ndengan memodifikasi bit terakhir dari file carrier dengan bit-bit pesan dan hanya menyebabkan\r\nperubahan nilai bit satu lebih tinggi atau satu lebih rendah. Dengan menggunakan audio\r\nsebagai media penyisipannya. Untuk pengujian stego-wav penulis menggunakan metode SNR\r\n(Signal to Noise Ratio), jika hasil pengujian di atas 30dB, maka stego-wav dianggap layak\r\nuntuk didengarkan. Hasil dari pengaplikasian tugas akhir ini akan berupa file stego audio yaitu\r\nfile audio yang sudah berisi pesan rahasia yang telah tersisip di dalamnya. Dari total sampel\r\naudio wav sebanyak 30 sampel yang dilakukan uji coba penyisipan dan ekstraksi pesan,\r\nseluruhnya dapat tersisip dan terekstraksi sempurna atau dengan kata lain tingkat akurasinya\r\nmencapai 100%, sedangkan untuk hasil pengujian SNR dari sebanyak 20 sampel uji coba , 15\r\nsampel berhasil dan 5 sampel mengalami error dengan kata lain tingkat akurasi mencapai 75%.\r\n\r\nKata kunci : LSB, steganografi, audio.', 'Septy Handika Nurjannah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100073'),
(263, '090411100075', 'SISTEM PENGENALAN EKSPRESI WAJAH MENGGUNAKAN METODE MODIFIKASI TWO DIMENSIONAL LINIER DISCRIMINANT ANALYSIS (2DLDA)', 'DR. ARIF MUNTASA, S.SI., M.T', 'FITRI DAMAYANTI, S.KOM., M.KOM', 'Pengenalan ekspresi wajah merupakan pengembangan dari pengenalan wajah dalam lingkungan pengenalan pola (feature recognition). Penelitian tentang pengenalan ekspresi wajah sangat bermanfaat pada berbagai bidang, contohnya pada bidang interaksi manusia dan komputer, dalam hal ini komputer mengenali ekspresi wajah pengguna, kemudian komputer secara terprogram dan melakukan intruksi yang sesuai dengan ekspresi wajah pengguna. Pada penelitian ini menggunakan database JAFFE (Japanese Female Facial Expression) dengan 7 macam ekspresi dari 10 wanita Jepang  dan masing-masing ekspresi ada 30 pose dengan ukuran dimensi citra 256 x 256 piksel.  Penelitian ini bertujuan untuk membangun sistem pengenalan ekspresi wajah menggunakan metode  ekstraksi fitur Two Dimensional Linear Discriminant Analysis Modification (Modifikasi 2DLDA), yang merupakan hasil pengembangan dari metode Two Dimensional Linear Discriminant Analysis (2DLDA) sedangkan 2DLDA adalah pengembangan dari metode Linear Discriminant Analysis (LDA). Sedangkan untuk pengukuran kemiripan menggunakan metode Two Dimensional Correlation Coefficient yaitu dengan cara mengalikan bobot training dengan bobot testing dan membaginya dengan hasil akar dari bobot training yang dikalikan dengan bobot testing. Hasil uji coba dengan tingkat akurasi tertinggi adalah sebesar 90,48% pada skenario 5 sedangkan tingkat akurasi terendah 52,08% pada skenario 4.', 'IMAM SAFII', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100075'),
(264, '090411100076', 'ANALISIS JEJARING SOSIAL DALAM PENENTUAN CENTRALITY PADA MEDIA SOSIAL DENGAN VISUALISASI GRAF TAK BERARAH(UNDIRECTED GRAPH)', 'MULA\'AB M,S.Si.,M.Kom.,', '', 'Perkembangan internet yang pesat membuat semakin bertambah pula jumlah pengguna internet, khususnya pengguna jejaring sosial facebook. Selain digunakan untuk bertukar informasi, facebook digunakan sebagai media untuk menawarkan barang dagangan(jual-beli online). Online shop yang berkembang saat ini memanfaatkan facebook untuk melakukan promosi sehingga dapat mempermudah pembeli melihat katalog barang dan melakukan penawaran. Pencarian tokoh sentral dalam facebook dapat membantu online shop sehingga promosi lebih merata. Penelitian ini menganalisis aktor sentral pada facebook dengan menggunakan teori sosial network analysis(SNA) dan centrality. Penentuan aktor sentral dilakukan dengan menghitung sentralitas kedekatan(closeness) dan sentralitas keantaraan (betweenness).Aktor dengan sentralitas kedekatan tertinggi lebih cepat menyebarkan informasi karena aktor tersebut memiliki jarak terdekat dengan aktor lainnya. Sedangkan aktor dengan sentralitas keantaraan tertinggi dapat menyebarkan informasi terhadap aktor yang terhubung langsung dengannya atau tidak. Pada penelitian ini dilakukan pencarian aktor sentral pada akun 100005099490481 yang memiliki pertemanan 145. Hasil penelitian menunjukkan nilai closeness tertinggi terdapat pada id 117 dengan nilai 0.823. Nilai betweenness tertinggi pada id 130 dengan nilai 18.898. Dengan menerapkan teori SNA, hasil perhitungan yang divisualisasikan ke dalam graf menunjukkan bahwa id dengan nilai closeness dan betweenness tertinggi sangat berperan penting dalam menghubungkan aktor yang satu dengan yang lain dalam cluster jaringan.', 'NUR ISLAMI SYABANIYAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100076'),
(265, '090411100077', 'TUGAS AKHIR\r\nSISTEM INFORMASI MANAJEMEN ASET PADA UPT DINAS PENDIDIKAN\r\nKEC. BABAT. KAB. LAMONGAN\r\n', 'Andharini Dwi C, S.Kom., M.Kom', 'Rika Yunitarini, S.T., M.T.', 'Dalam era globalisasi dan teknologi ini, setiap kantor Instansi\r\nDinas pendidikan membutuhkan informasi yang cepat, tepat dan akurat\r\nsehingga dapat memberikan kemudahan dalam pemecahan masalah\r\nyang semakin kompleks didalam Dinas Pendidikan Salah satu informasi\r\nyang dibutuhkan adalah informasi mengenai aset yang dimiliki. Jumlah\r\naset yang besar dan tersebar di berbagai unit membutuhkan manajemen\r\nyang baik yang biasa disebut Manajemen aset. Untuk mengatasi hal ini\r\nDinas Pendidikan membutuhkan suatu sistem informasi yang dapat\r\ndigunakan untuk mengelola aset yang dimiliki, meliputi pengadaaan\r\naset, penerimaan aset, penggantian aset, peminjaman aset, pemeliharaan\r\naset.\r\nHasil dari uji coba sistem ini adalah sebuah produk berupa sistem\r\ninformasi manajemen aset kantor UPT Dinas pendidikan pendidikan\r\nyang berbasis web. Sistem informasi ini memiliki menu berupa input\r\ndata aset, pemeliharaan aset dan pelaporan aset.\r\nKata kunci: Sitem informasi, Manajemen aset, UPT Dinas Pendidikan\r\nKecamatan Babat - Kabupaten Lamongan.', 'Denny Dwi Setyo Budi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100077'),
(266, '090411100078', 'RANCANG BANGUN APLIKASI\r\nNETWORK ADMISSION CONTROL (NAC) BERBASIS SHORT MESSAGE SERVICE (SMS)\r\n', 'Dwi Kuswanto S.Pd. ,M.T.', 'Iwan Santosa S.T.,M.T.', 'Network Access Control (NAC) merupakan teknologi keamanan jaringan yang melakukan otentikasi terlebih dahulu sebelum diperbolehkan. Otentikasi adalah proses dimana validasi user terlebih dahulu saat memasuki sistem. Firewall merupakan lalu lintas jaringan yang berusaha masuk ke komputer. Firewall tidak mengijinkan komputer tersebut masuk apabila tidak bisa memenuhi otentikasi yang telah ditetapkan. Nama dan password dicek oleh sistem bahwa user tersebut adalah autentik atau asli. Firewall salah satunya menggunakan username dan password yang statis atau selalu sama sangat rentan terhadap penyalahguanaan terhadap pihak yang tidak bertanggung jawab. Dengan adanya tantangan tersebut maka diperlukan suatu hal diluar nama dan password user, yaitu otentikasi password tambahan berupa token. Otentikasi password tambahan atau token ini berubah-ubah sesuai dengan waktu login.Token di generate memakai enkripsi md5 yang ditambahkan dengan time stamp. Kompter user terlebih dulu memasuki firewall, apabila user mendapat ijin oleh firewall maka user akan memasuki sistem dengan memasukkan username dan password dan ditambahkan token yang telah ditentukan oleh sistem. Metode token ini dikenal dengan One Time Password (OTP), merupakan sebuah password yang berubah-ubah dalam waktu tertentu.Token ini dikirim melalui short message service (SMS) gateway.Rancang bangun NAC dengan tambahan One Time Password(OTP) ini diharapkan membantu administrator membangun keamanan server jaringan.', 'Achmad Hasan Al Banna', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100078'),
(267, '090411100079', 'SISTEM INFORMASI PEMETAAN KETAHANAN DAN KERENTANAN PANGAN (Studi Kasus : Kab. Bangkalan)', 'Mulaab, S.Si.,M.Kom', 'Moch. Kautsar Sophan, S.Kom.,M.MT', 'Food Security and Vulnerability (FSVA) merupakan sebuah peta Ketahanan dan Kerawanan Pangan di Indonesia yang merupakan peta pembaharuan dari peta sebelumnya yaitu Food Insecurity Atlas (FIA). Dalam FSVA terjadi perubahan pada beberapa indikator yang digunakan. Pemetaan dalam menentukan wilayah yang rentan dan rawan terhadap pangan sangat penting dilakukan agar dapat membantu Pemerintah dalam menentukan daerah dan alokasi sumber daya untuk menanggulangi kerawanan pangan di daerah yang termasuk rentan. Dalam penelitian ini akan menggunakan metode Principal Component Analysis (PCA), yang akan mereduksi data awal menjadi data baru yang lebih sedikit tanpa mengurangi variansi data yang ada. Penggunaan PCA dapat membantu dalam mengoptimalkan komponen utama dan hubungan antar variabel. Kemudian data reduksi akan dirotasi dengan menggunakan matrik rotasi Varimax untuk menentukan nilai bobotnya, penggunaan Varimax dapat mempermudah dalam menginterpretasikan hasil dari PCA sehingga membuatnya lebih mudah untuk dimengerti. Hasil akhir kemudian akan dipetakan dengan Sistem Informasi Geografis menggunakan Google Maps API dengan variansi warna berdasarkan nilai Composite Food Security Index (CFSI) yang diperoleh. Dengan adanya penelitian dapat menyediakan sarana bagi para Pemerintah setempat untuk menentukan sasaran dan memberikan rekomendasi daerah mana saja yang merupakan daerah rawan yang perlu diprioritaskan terlebih dahulu untuk ditanggulangi.\r\n\r\nKata Kunci : Ketahanan dan Kerentanan Pangan , Principal Component Analysis (PCA), Matrik Rotasi Varimax, Sistem Informasi Geografis, CFSI.\r\n', 'Ervika Viona', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100079'),
(268, '090411100082', 'IMPLEMENTASI DAN ANALISA HIDS (HOST BASED INTRUSION DETECTION SYSTEM) DENGAN SNORT UNTUK MENCEGAH DDOS (DISTRIBUTED DENIAL OF SERVICE)', 'Dwi Kuswanto, S.Pd.,M.T.', 'Iwan Santosa, S.T, M.T.', 'HIDS (Host based Intrusion Detection System) adalah salah satu jenis IDS (Intrusion Detection System) yang berjalan pada host yang berdiri sendiri atau perlengkapan dalam sebuah jaringan. Sebuah HIDS melakukan pengawasan terhadap paket-paket yang berasal dari dalam maupun dari luar hanya pada satu alat saja dan kemudian memberi peringatan kepada user atau administrator sistem jaringan akan adanya kegiatan-kegiatan yang mencurigakan yang terdeteksi oleh HIDS. DDOS menggunakan banyak host penyerang, untuk menyerang satu host target. Perbedaan dengan serangan DOS biasa, apabila serangan DOS bersifat \"satu lawan satu\", maka untuk DDOS ini menjadi \"satu lawan Banyak\", sehingga pertahanan host target akan lebih mudah dijebol dan dibanjiri traffic sehingga membuat server host menjadi down dan tidak bisa diakses penggunanya. Dengan HIDS, administrator jaringan akan semakin mudah mencegah serangan DDOS. Pada functionality HIDS mampu mendeteksi beberapa variasi serangan yaitu ICMP flood, TCP flood, dan UDP flood. Berdasarkan percobaan yang telah dilakukan rules snort dapat dibuat dengan melakukan perbandingan antara data dari client dan data dari penyerang. Berdasarkan percobaan yang telah dilakukan terjadi kenaikan response time atau lambatnya response time ketika paket data yang dikirim lebih kecil. Ini disebabkan rules snort harus menganalisa paket data yang masuk dalam jangka waktu tertentu agar tidak terjadi false alarm.', 'Masdian', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100082'),
(269, '090411100083', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PRODUK UNGGULAN DAERAH MENGGUNAKAN METODE ENTROPY DAN ELECTRE II\r\n(STUDI KASUS: DINAS KOPERASI, INDUSTRI \r\nDAN PERDAGANGAN KABUPATEN LAMONGAN)', 'Andharini Dwi Cahyani S.Kom, M.Kom,', 'Rika Yunitarini, S.T., M.T.', 'Kompetisi produk unggulan daerah semakin kedepannya menjadi semakin ketat dengan meningkatnya laju perkembangan ekonomi, pertumbuhan industri dan kemajuan teknologi. Persaingan ini ini membuat setiap industri harus lebih jeli dalam merumuskan rumusan stratgi kebijakan. Pengambilan keputusan untuk mendapatkan produk unggulan yang sesuai dengan kebutuhan dan kemampuan diperlukan suatu keputusan yang akurat dan efektif agar tidak salah dan meminimalisir kerugian dalam dalam segi biaya dan waktu. Penelitian ini menggunakan metode entropy dan electre II. Penelitian dengan metode ini mendapatkan hasil perangkingan berdasarkan jumlah dominasi menghasilkan perangkingan yang lebih parsial dan sensitif dibandingkan perangkingan berdasarkan level. Kriteria dalam sitem ini adalah omset, tenaga kerja, nilai investasi, target pasar, jumlah bahan baku dan jumlah perusahan dalam satu produk unggulan. Penelitian ini mendapatkan hasil akurasi sistem yang mencapai 30%.', 'Eko Handoyo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100083'),
(270, '090411100084', 'SISTEM PENDUKUNG KEPUTUSAN PENILAIAN KINERJA PEGAWAI PADA RUMAH SAKIT SYARIFAH AMBAMI RATO EBU BANGKALAN MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)', 'Achmad Jauhari,ST., M.Kom', 'Sigit Susanto Putro,S.Kom., M.Kom', 'Pengukuran untuk melakukan penilaian suatu kinerja sangatlah penting guna melakukan evaluasi perancangan dan untuk meningkatkan pelayanan di Rumah Sakit SYAMRABU Bangkalan .penilaian prestasi karyawan mutlak harus dilakukan untuk mengetahui prestasi yang hendak dicapai karyawan. Untuk melakukan kinerja yang lebih baik harus dibutuhkan sebuah sistem keputusan penilaian kinerja. Dalam menelakukan penilaian kinerja karyawan tentunya membutuhkan metode untuk mendapatkan hasil pembobotan setiap alternatif ,pada penelitian ini akan diangkat kasus yaitu mencari alternatif terbaik berdasarkan kriteria-kriteria yang telah ditentukan dengan menggunakan metode Simple Additive weighting (SAW). Penelitian dilakukan dengan mencari nilai bobot untuk setiap atribut ,kemudian dilakukan proses perankingan yang menentukan alternatif yang optimal.\r\nKeyword: Sistem pendukung keputusan, kinerja karyawan ,SAW', 'Ardiyanto Dwi Setiawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100084');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(271, '090411100085', 'SISTEM IMPLEMENTASI WEB FRAMEWORK DALAM SISTEM MANAJEMEN PERGUDANGAN\r\n(STUDI KASUS : PT. AKA JAYA)\r\n', 'Achmad Jauhari,ST.,M.Kom.', 'Bain Khusnul Khotimah,ST.,M.Kom.', 'Abstrak\r\nSaat ini, dalam system manajemen pergudangan PT. Aka Jaya belum ada penanganan integritas dalam masalah penerimaan barang masuk dan barang keluar. Dalam hal ini PT.Aka Jaya masih dengan cara system yang manual. Dengan kemajuan teknologi yang sangat amat pesat disayangkan jika PT.Aka Jaya secara terus menerus menggunakan system manual. Pemaparan tersebut melatar belakangi peneliti untuk mengembangkan sytem yang ada.\r\n', 'HAFIL ULUM', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100085'),
(272, '090411100087', 'PERANCANGAN DAN PEMBUATAN SISTEM PENDUKUNG KEPUTUSAN PENENTUAN PEMBERIAN BEASISWA MENGGUNAKAN METODE FUZZY ANALYTICAL HIERARCHY PROCESS (FAHP) DAN ORESTE\r\n', 'RIKA YUNITARINI.ST.MT ', 'ANDHARINI DWI C, S.KOM., M.KOM ', 'Pada lembaga pendidikan khususnya Universitas banyak sekali menawarkan beasiswa kepada mahasiswa, terutama bagi mahasiswa yang sedang aktif kuliah, beasiswa yang diberikan diantaranya beasiswa PPA dan BBM. Beberapa masalah yang terjadi dalam sistem beasiswa diantaranya rekapitulasi, penyeleksian, perangkingan dan publikasi hasil masih dalam cara manual sehingga perlu adanya sistem pendukung keputusan yang dapat membantu kegiatan terkait beasiswa. Sistem pendukung keputusan ini dapat difungsikan sebagai media informasi dan publikasi hasil seleksi beasiswa, serta proses perangkingan dan seleksi secara otomatis oleh panitia seleksi beasiswa di Universitas Trunojoyo Madura. Penyeleksian beasiswa ini menggunakan metode FAHP untuk pembobotan dan metode Oreste sebagai perangkingannya. Sistem pendukung keputusan ini nantinya dapat membantu panitia penyeleksi beasiswa dalam memilih mahasiswa yang memang berhak mendapatkan beasiswa.', 'AYU WULANDARI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100087'),
(273, '090411100088', 'PENERAPAN EKSTRAKSI INFOMASI SIMPLE TREE MATCHING (STM) PADA WEB CRAWLER BAHASA INDONESIA\r\n', 'Firdaus Solihin', 'Iwan Santosa', 'Web crawler adalah salah satu bagian penting dari search engine. Web crawler bertugas mengambil informasi dari laman web yang dikunjunginya. Untuk mendapatkan konten khusus bahasa indonesia telah di desain dan diimplementasikan pada penelitan sebelumnya oleh Arifin. Dari hasil penelitian ini diperoleh web crawler yang mampu menghimpun website bahasa indonesia dengan data uji coba 1000 URL, diantaranya 500 website bahasa indonesia dan 500 website bahasa asing. Namun data yang tersimpan dari web crawler tersebut belum optimal, karena di dalam konten yang tersimpan masih terdapat beberapa bagian yang bukan sebuah informasi. Kekurangan pada pengambilan konten tersebut dicoba untuk diperbaiki dalam penelitian ini dengan menggunakan ekstraksi informasi(web data extraction) berbasis pencocokan pohon dengan menggunakan metode Simple Tree Matching(STM). Ekstraksi informasi adalah sebuah cara komputer dalam mengambil informasi pada suatu website. Simple Tree Matching adalah sebuah metode ekstraksi informasi yang melakukan pencocokan dua tree website pada proses ekstraksinya. Web crawler dengan metode STM dilakukan ujicoba kembali pada 50 website dari data penelitian sebelumnya dan didapatkan hasil konten yang lebih bersih dari implementasi sebelumnya. Dapat disimpulkan bahwa simple tree matching mampu dengan sempurna melakukan ekstraksi informasi pada web crawler. Dengan rata-rata nilai precision 100% dan recall 89.31365%.', 'Alfian Qomaruddin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100088'),
(274, '090411100089', 'Aplikasi Telemonitoring Obyek Wisata Menggunakan Augmented Reality Berbasis Lokasi', 'cucun very angkoso, S.T., M.T.', 'Ari Kusumaningsih, S.T., M.T.', 'Pariwisata merupakan salah satu sektor penting untuk memajukan suatu daerah. Sehingga banyak orang yang berupaya untuk memajukan pariwisata daerahnya. Upaya untuk memajukan pariwisata tersebut yaitu dengan memanfaatkan kemajuan teknologi. Salah satunya dengan memanfaatkan teknologi Augmented Reality (AR) dan sensor-sensor yang ada pada device android yaitu Global Positioning System (GPS), kompas, dan akselerometer. Teknologi Augmented Reality (AR) digunakan untuk memvisualisasikan obyek wisata dalam bentuk marker ikon wisata dengan bantuan kamera pada device, sensor Global Positioning System (GPS) digunakan untuk mengetahui posisi pengguna yang kemudian sistem dapat menampilkan obyek wisata terdekat dengan pengguna melalui marker ikon wisata, sensor kompas digunakan sebagai petunjuk arah yang nantinya sistem dapat memunculkan marker ikon wisata yang ada pada arah tertentu, dan akselerometer digunakan untuk menstabilkan posisi marker ikon wisata agar tetap berada di depan pengguna meskipun orientasi device berubah-ubah. Penelitian ini bertujuan untuk menghasilkan suatu simulasi aplikasi yang menunjang dan mempermudah pengguna untuk mendapatkan detail informasi-informasi yang hanya didapat pengguna jika pengguna mengunjungi lokasi dengan memanfaatkan teknologi Augmented Reality (AR) dan sensor-sensor yang ada pada device android. Aplikasi ini dirancang menggunakan sistem client server dimana database MySQL sebagai server yang menyediakan informasi-informasi obyek wisata dan device android sebagai client yang melakukan permintaan untuk mengakses data. Berdasarkan implementasi yang dilakukan dapat disimpulkan bahwa aplikasi ini berjalan dengan baik dan dapat memberikan informasi yang akurat.', 'Ilfin ardini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100089'),
(275, '090411100090', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN BANTUAN STIMULAN PERUMAHAN SWADAYA MENGGUNAKAN METODE SMARTER', 'MULAAB, S.Si.,M.Kom', 'FIKA HASTARITA R, ST,M,Eng', 'Perkembangan di zaman era globalisasi ini ternyata tidak dapat melepaskan sebagian besar masyarakat di Indonesia untuk lepas dari masalah kemiskinan dan berkaitan dengan perumahan dan permukiman yang merupakan hak dasar bagi setiap Warga negara Indonesia. Untuk mendukung pemenuhan kebutuhan RTLH, Kemenpera melalui Deputi Bidang Perumahan memiliki program BANTUAN STIMULAN PERUMAHAN SWADAYA (BSPS) bagi masyarakat berpenghasilan rendah. Pada tugas akhir ini, diperlukan suatu sistem yang dapat membantu dalam menentukan bantuan RTLH untuk masyarakat  yang benar-benar tidak mampu, dalam system pendukung keputusan menggunakan metode SMARTER mampu menganalisa kriteria yang pada akhirnya dapat menentukan penduduk mana yang lebih layak menerima BSPS. Akan tetapi dalam metode SMARTER mempunyai sebuah kelemahan untuk penentuan bobot criteria tidak dapat dirubah. Dan hasil dari perhitungan yang berupa perangkingan dari metode SMARTER tersebut kemudian akan dipetakan dengan menggunakan Sistem Informasi Geografis (SIG). Penyajian data penduduk menggunakan Google Maps dapat membantu menentukan letak posisi rumah penduduk dari hasil perangkingan yang layak menerima BSPS. Hasil pemetaan akan tampak masing-masing dari prioritas perangkingan tersebut. Pada hasil penelitian yang telah dilakukan dalam penentuan BSPS, system memiliki tingkat kesesuaian sebesar 78% jika dibandingkan dengan data real tahun 2013.\r\n\r\nKata Kunci:BSPS, Kemiskinan, Sistem Pendukung Keputusan (SPK), SMARTER, Sistem Informasi Geografis (SIG).\r\n', 'RYNA SELVIA PUTRI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100090'),
(276, '090411100092', 'IMPLEMENTASI ALGORITMA RECURSIVE DFS  UNTUK AGEN CERDAS PADA GAME EDUKASI MATEMATIKA DASAR BERBASIS ANDROID ACCELEROMETER', 'Arik Kurniawati, S.Kom., M.T', 'Cucun Very Angkoso, S.T., M.T', 'Game edukasi merupakan salah satu jenis aplikasi permainan interaktif yang digunakan sebagai media pendukung pembelajaran. Dalam game edukasi juga terdapat berbagai tantangan dan konflik yang harus diselesaikan untuk memenangkan permainan. Penyelesaian konflik adalah salah satu aspek dalam edukasi keilmuan yang bertujuan meningkatkan perkembangan kecerdasan dan melatih otak dalam penyelesaian suatu masalah.\r\nPada penelitian ini, penulis mengimplementasikan game edukasi matematika dasar yang diintegrasikan pada aplikasi maze pada perangkat mobile berbasis android. Android merupakan salah satu platform pada perangkat mobile yang sudah memasukkan banyak fitur multimedia. Game ini memanfaatkan teknologi accelerometer, yaitu teknologi yang mampu mengukur pergerakan fisik suatu obyek. Selain itu game ini juga mengimplementasikan algoritma Rekursive Depth First Search (DFS) untuk menentukan jarak tercepat bagi agen cerdas untuk menemukan karakter player sebagai penghambat pemain dalam permainan.\r\nDengan implementasi tersebut, diketahui algoritma Recursive DFS, dapat dimanfaatkan sebagai agen cerdas dalam game edukasi. Dibutuhkan perangkat smartphone dengan kinerja dan sensor accelerometer yang baik agar game ini berjalan optimal.', 'Candra Dwi Putro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100092'),
(277, '090411100093', 'IMPLEMENTASI SEGMENTASI PEMBULUH DARAH RETINA PADA CITRA FUNDUS MATA BERBASIS HISTOGRAM EQUALIZATION DAN 2D-GABOR FILTER', 'Dr. Arif Muntasa, S.Si.,MT.', 'Dr. Indah Agustien S, S.Kom.,M.Kom.', 'Dengan berkembangnya jaman semakin berkembang juga teknologi kedokteran. Pendeteksian penyakit yang diderita manusia dapat dideteksi secara dini dengan melakukan peninjauan gejala yang muncul dari penderitanya. Peninjauan gejala dapat dilakukan pada organ-organ tubuh yang mungkin mengalami perubahan struktur karena suatu penyakit contohnya yaitu pada retina mata. Perubahan struktur yang dapat dilihat yaitu perubahan dari pembuluh darah yang semakin membesar atau kelainan dari pembuluh darah dari retina mata. Untuk mendeteksi penyakit tersebut, tahap awal yang dilakukan adalah dengan melakukan segmentasi pada pembuluh darah. Pada penelitian ini menggunakan metode 2D-Gabor Filter untuk mensegmentasi citra. Penelitian ini dibagi menjadi 2 tahap, yaitu preprocessing dan segmentasi. Pada tahap awal preprocessing terdiri dari mengambil citra green channel, dan memperbaiki kontras citra dengan Histogram Equalization. Dan tahap kedua yaitu segmentasi dengan metode 2D-Gabor Filter, thresholding citra, membersihkan citra dari noise, dan field of view. Kemudian hasil dari proses tersebut dibandingkan dengan citra groundtruth untuk menghitung tingkat akurasi.Pengujian dilakukan pada database Digital Retinal Images for Vessel Extraction (DRIVE) sebanyak 20 citra. Hasil Akurasi yang didapat dari pengujian tersebut sebesar 81,11%. Citra hasil dari segmentasi cukup baik, sehingga 2D-Gabor Filter bisa mensegmentasi dengan baik.', 'Fahmi Arya Wicaksono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100093'),
(278, '090411100094', 'Sistem Informasi Geografis Pengelolaan Manajemen Distribusi Air PDAM Kecamatan Rejoso Kabupaten Nganjuk', 'Mula’ab, S.Si.,M.Kom', 'Fika Hastarita R, S.T,.M.Eng', 'PDAM adalah perusahaan yang mengelola kebutuhan air masyarakat. Tugas utamanya adalah menghasilkan air yang layak baik secara kualitas maupun kuantitas. Namun dalam perancanaan kebutuhan air bersih, PDAM dihadapkan dengan beberapa permasalahan. Permasalahan tersebuat misalnya ketidakmampuan mengimbangi kebutuhan air bersih masyarakat, tingginya angka kehilangan air dan kendala perbaikan jaringan pipa. Salah satu upaya untuk mengatasi permasalahan tersebut yaitu dengan memanfaatkan Sistem Informasi Geografis. Di dalam sistem terdapat visualisasi peta jaringan pipa dan kelengkapannya, modul perawatan gate valve dan lapor bulan sistem distribusi diatur dan dikerjakan dalam suatu sistem. Dengan ini sistem akan mempermudah pengerjaan sistem distribusi air PDAM.', 'Astoko Yoga Saputro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100094'),
(279, '090411100095', 'POS (POINT OF SALE) DENGAN MENGGUNAKAN QR-CODE PADA TOKO MAHKOTA BATIK TULIS MADURA', 'Mochammad Kautsar Sophan, S.Kom., M. MT.', 'Muhammad Fuad, S.Kom., M.T.', 'POS (point of sale) adalah salah satu bagian yang sangat penting dalam serangkaian proses bisnis sebuah toko penjualan barang atau jasa. Proses POS yang ada pada toko Mahkota masih sangatlah sederhana, yaitu dengan melakukan pencatatan manual sehingga sangat besar kemungkinan terjadinya kecurangan atau kesalahan.\r\nDalam artikel ini telah dibangun sebuah aplikasi sistem POS berbasis web yang sudah memanfaatkan QR-code (Quick Response Code) sebagai penanda pada barang dan nantinya akan diterapkan pada toko Mahkota. QR-code adalah salah satu metode baru dalam pengkodean informasi berbasis 2 dimensi yang dikembangkan oleh perusahaan Denso pada tahun 1994 dan mempunyai banyak kelebihan dibandingkan barcode. Dengan adanya beberapa fitur yang telah dibuat dalam sistem, beberapa kelebihan yang ada pada QR-code serta pemanfaatan device android membuat aplikasi sistem ini telah dianggap mampu meningkatkan kecepatan proses POS yang sudah ada berdasarkan hasil pengujian pembacaan QR-code oleh device android. Pengujian dilakukan berdasarkan kondisi cahaya lingkungan dan jarak objek sehingga didapatkan kecepatan maksimum sebesar 0,92 detik.\r\n', 'Abdul Basith', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100095'),
(280, '090411100096', 'SISTEM PENGENALAN WAJAH BERBASIS WINDOWS PHONE MENGGUNAKAN METODE PRINCIPAL COMPONENT ANALYSIS DAN EUCLIDEAN DISTANCE', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Perkembangan mobile phone akhir-akhir ini semakin meningkat. Handphone saat ini tidak hanya menjadi alat komunikasi saja, namun telah menjadi sebuah perangkat cerdas yang mampu menangani berbagai kebutuhan manusia secara cepat dan tepat. Salah satunya adalah untuk pengenalan wajah. \r\nFace Recognition adalah teknik untuk mengenali seseorang berdasarkan citra dari wajah seseorang. Dalam perkembangan teknologi saat ini, face recognition merupakan salah satu  penelitian yang sangat popular pada saat ini  terutama dalam bidang computer vision dan biometrik. Hasil dari penelitian ini sudah banyak dimanfaatkan dalam bidang keamanan maupun dalam bidang pemerintahan seperti pelacakan kriminal maupun teroris. Tugas Akhir ini bertujuan untuk mengimplementasikan metode PCA yang diintegrasikan klasifikasi berbasis Similarity Measure dengan metode Euclidean Distance. Sistem dibangun pada device Windows Phone.\r\nPenelitian ini menggunakan 30 data citra yang akan digunakan sebagai data training dan testing untuk proses uji coba pada sistem yang telah dibuat. Dengan menggunakan metode ekstraksi fitur PCA dan penghitungan jarak dengan Euclidean Distance, dari tiga skenario pengujian yang telah dilakukan pada penelitian ini, menghasilkan tingkat akurasi sebesar 62.75% dengan kecepatan komputasi rata-rata 1.5 detik.\r\n', 'Miftah Alfian Syah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100096'),
(281, '090411100097', 'IMPLEMENTASI LATENT SEMANTIC ANALYSIS UNTUK SISTEM PENILAIAN ESAI OTOMATIS MATA PELAJARAN BIOLOGI', 'Mula\'ab Mulyo, S.Si., M.Kom.', 'Fika Hastarita Rachman, S.T., M.Eng.', 'Tes merupakan prosedur yang digunakan untuk penilaian. Pada tespilihan ganda, jawaban telah tersedia. Peserta tes dapat memperkirakan jawaban apabila belum menguasai bahan yang diteskan. Kelemahan ini dapat diatasi dengan menggunakan tes esai. Tes esai juga mempunyai kelemahan yaitu sulit dinilai secara objektif dan membutuhkan waktu yang lama.Dalam penelitian ini dibuat sebuah sistem penilaian esai otomatis untuk mata pelajaran biologi pada SMAN Ploso. Sistem ini menggunakan metode latent semantic analysis (LSA). Pada preprocessing, dilakukan pengecekan sinonim, penghapusan stopword, stemming ECSP dan pembobotan tf*idf. Penilaian dilakukan dengan mengukur nilai similarity antara jawaban siswa dan kunci jawaban dari guru. Deteksi kemungkinan mencontek pada sepasang siswa yaitu apabila 90% dari soal yang mempunyai nilai similarity lebih dari 0,9. Pengujian keakuratan sistem dilakukan dengan cara membandigkan hasil penilaian dari sistem dengan hasil penilaian yang dilakukan guru secara manual. Sistem ini dapat membantu guru SMAN Ploso Jombang untuk mengoreksi jawaban dari soal esai mata pelajaran biologi. Sistem ini mempunyai nilai RMSE sebesar 5,5. Nilai RMSE paling tinggi adalah pada soal yang membutuhkan jawaban urutan. Kemungkinan mencontek siswa SMAN Ploso pada ujian tulang sebesar 3,85%.\r\nKata Kunci:Penilaian esai, latent semantic analysis, ECSP, tf*idf, RMSE', 'Aulia Aprilyana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100097'),
(282, '090411100099', 'Pengembangan Aplikasi Pengelolaan Kuisioner Berbasis WEB', 'Andharini dwi c, S.Kom., M.Kom', 'Fika Hastarita Rachman,S.T.,M.Eng', 'ABSTRAK\r\n\r\nTeknologi informasi tidak hanya mempengaruhi sebuah sistem informasi namun memiliki pengaruh dalam kehidupan sehari-hari, gaya hidup mulai berubah seiring dengan produk-produk teknologi informasi yang semakin menjamur setiap saat. Media informasi dan komunikasi yang sangat berkembang pesat dan tiada henti adalah perkembangan informasi melalui jaringan internet salah satunya adalah tentang pengisian kuisioner. Oleh karena itu untuk memudahkan dalam pengambilan keputusan maka peneliti ingin membuat pengembangan kuisioner berbasis web.\r\nDalam penelitian ini peneliti akan mengembangan kuisioner. Peneliti akan menggunakan bahasa pemrograman PHP dan database MySQl. Dalam pembuatan aplikasi ini langkah pertama yang dilakukan peneliti adalah merancang aplikasi dengan membuat Conceptual Data Modelling (CDM) dan Physical Data Modelling (PDM). Selanjutnya menuangkan dalam bahasa pemrograman dengan editor Notepad ++. \r\nPengambilan keputusan peminatan bidang dengan aplikasi kuisioner berbasis web memiliki tingkat keakuratan lebih tinggi dibandingkan dengan kuisioner secara manual. Dengan menggunakan sistem ini, proses pengambilan keputusan bisa dilakukan dengan cepat karena data dengan jumlah yang besar dapat segara ditangani oleh sistem\r\n\r\nKata kunci: kuisoner, berbasis web, manual\r\n', 'Arif Rahmadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100099'),
(283, '090411100100', 'Simulasi Internet of Things Untuk Aplikasi Smarthome Pada Jaringan Wifi', 'Hermawan, S.T., M.Kom.', 'Koko Joni, S.T., M.Eng.', 'Perkembangan teknologi informasi sekarang semakin cepat terutama teknologi jaringan nirkabel, IoT ( Internet of Things ) merupakan suatu konsep yang terdiri dari perangkat kontrol yang dapat mengontrol alat atau mesin secara jarak jauh dengan memanfaatkan teknologi internet, penulis mencoba membuat suatu perancangan sistem yang dapat mengontrol peralatan rumah tangga secara jarak jauh, dalam hal ini menyalakan atau memadamkan lampu secara jarak jauh dengan menggunakan jaringan internet wifi lokal dan menggunakan arduino. Pengontrolan lampu dilakukan dengan menggunakan relay yang dikontrol  oleh mikrokontroler arduino yang terhubung pada jaringan wifi lokal dengan menggunakan modul ESP8266EX. Perintah untuk menyalakan atau memadamkan lampu dikirim secara langsung dari mobile device android melalui jaringan wifi lokal. Melalui aplikasi android mampu menyalakan atau memadamkan lampu secara jarak jauh. Dengan perancangan dan pengimplementasian internet of thing untuk aplikasi smarthome pengontrolan peralatan rumah tangga dapat dilakukan secara jarak jauh. Hasil pengujian sistem menggunakan FURPS (functionality, usability, reliability, performance, supportability) pada proses menyalakan atau memadamkan lampu pada jaringan wifi lokal dengan rata-rata waktu 2,5 detik, sehingga user dapat dengan mudah mengontrol peralatan rumah tangga secara jarak jauh.\n\nKata kunci : Android, Arduino, ESP8266EX, Internet of Things (IoT), Smarthome.\n', 'Fesari Candra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100100'),
(284, '090411100102', 'CONTENT BASED IMAGE RETRIEVAL USING COLOR HISTOGRAM', 'Dr.Indah Agustien, S.Kom., M.Kom', 'Dr.Arif Muntasa, S.Si., M.T', 'Seiring berkembangnya jaman, koleksi gambar – gambar digital semakin banyak. Metadata seperti caption atau keywords yang biasa digunakan untuk mencari koleksi gambar – gambar tersebut dirasa kurang efektif dari sisi penggunaan maupun keakuratan hasil karena bersifat subjektf dalam mengartikan gambar. Berdasarkan dari hal itu, para ahli mengembangkan beragam cara untuk melakukan pencarian gambar yang didasarkan pada image content dari suatu gambar yang berupa warna, bentuk dan tekstur yang lebih dikenal dengan istilah CBIR (Content Based Image Retrieval). Content Based Image Retrieval berbasis konten warna banyak digunakan untuk pencarian informasi. Pada jenis ini yang dilihat adalah sebaran warna pada citra yang dperbandingkan. Informasi mengenai isi (content) citra dilihat melalui Color Histogram, yaitu grafik yang menggambarkan penyebaran nilai – nilai instensitas pixel dari suatu citra. Dalam penelitian ini, dibahas mengenai Content Based Image Retrieval berdasarkan Color Histogram tersebut. Pengukuran kemiripan sebaran warna antara citra query dan citra dalam database melalui perhitungan Eulidean Distance. Database yang dipakai berasal dari Wang dataset yang terdiri dari 10 kategori. Setiap kategori berisi 100 citra berformat *.jpg. Berdasarkan hasil uji coba sistem pada penelitian ini, hasil retrieve citra berdasakan ekstraksi fitur menggunakan kuantisasi citra dengan 8 nilai skala keabuan lebih baik daripada citra dengan 4 nilai skala keabuan dalam menemukan citra yang relevan dengan query.\n\nKata Kunci: Content Based Image Retrieval, Color Histogram, Eulidean Distance-.\n', 'Zainal Arifin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100102'),
(285, '090411100104', 'RANCANG BANGUN ENTERPRISE ASSET MANAGEMENT MENGGUNAKAN ZACHMAN FRAMEWORK', 'Hermawan ST.,M.Kom', 'Rika Yunitarini ST.,MT.', 'Enterprise Asset Management (EAM) merupakan suatu bagian dari Enterprise Resource Planning yang terkait dengan pengelolaan asset tetap perusahaan. Dalam penelitian kali ini bertujuan untuk merancang sebuah desain aplikasi untuk mendapatkan blueprint aplikasi pada modul  fixed asset management yakni modul yang terkait dengan pengelolaan asset tetap perusahaan. Salah satu metode arsitektur IT yang dapat digunakan untuk menentukan kerangka kerja dari blueprint tersebut yakni menggunakan metode Zachman Framework (ZF).  ZF merupakan salah satu kerangka kerja yang dapat memetakan artifak arsitektur informasi yang paling banyak diadaptasi dan digunakan para arsitek data enterprise. Dalam penerapanya, Zachman Framework mampu mendeskripsikan level prespektif arsitektur IT yang terdiri dari Planner, Owner, Designer, Builder, Implementer dan  Participant. Sedangkan dari sisi abstraksi objek ditentukan What, How, Where, Who, When, Why untuk memperjelas keenam perspektif tersebut. Untuk standarisasi artifak arsitektur informasi digunakan pendekatan standart pemodelan UML 2.0, sehingga mampu meningkatkan deskripsi Zachman Framework menjadi standart Model Driven Architecture yang berkualitas. Dimana dari hasil penilaian Stakeholder dari pengujian sistem di PT. IGLAS, didapatkan tingkat kepuasan rata-rata 87,43. Sedangkan untuk penilaian availability sistem secara kuantitatif yang dibandingkan dengan SunfishERP, salah satu ERP system dengan modul fixed asset diperoleh ketersediaan fitur dengan prosentase sebesar 75% pada EAM dan 56,25% fitur pada sunfishERP. ', 'Zainal Arifin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100104'),
(286, '090411100105', 'IMPLEMENTASI ACCELEROMETER DALAM PEMBUATAN GAME EDUKASI MATEMATIKA BERBASIS ANDROID', 'Yonathan Ferry Hendrawan, S.T., M.I.T.', 'Arik Kurniawati, S.Kom., M.T.', 'Perkembangan game saat ini sebanding dengan perkembangan teknologi, karena secara tidak langsung semakin berkembang macam-macam teknologi juga menciptakan banyak variasi dan jenis game, mulai dari game pc, console, maupun mobile. Perkembangan lainya adalah dalam bidang software yaitu operating system Android yang kini sudah sudah banyak digunakan sebagai operating system untuk mobile phone. \r\nBerdasarkan keadaan inilah maka penelitian ini dilakukan, penelitian ini menitik beratkan pada game edukasi karena di dalam game edukasi terdapat banyak hal yang menarik dan variatif tentang sekolah serta dapat membantu para siswa dalam belajar. Game edukasi ini diimplementasikan di mobile phone yang menggunakan operating system Android dengan edukasi yang diangkat adalah tentang matematika (penambahan, pengurangan, dan perkalian). Untuk menambah tingkat fun dari game ini maka ditambahkan genre game race dan accelerometer sebagai kontrol game.\r\nDari pembuatan game ini diketahui bahwa game dapat mempermudah user (siswa SD kelas satu dan dua) dalam belajar matematika dasar (penambahan, pengurangan, dan perkalian), akan  tetapi user masih kesulitan dalam menggunakan accelerometer sebagai kontrol game. \r\n', 'Muhammad Agus Priantoro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100105'),
(287, '090411100106', 'ANALISA KINERJA KARYAWAN INDUSTRI KREATIF MENGGUNAKAN METODE BINARY LOGISTIK (STUDI KASUS : BATIK TRESNA)', 'Bain Khusnul Khotimah, S.T., M.Kom.', 'Firli Irhamni, S.T., M.Kom.', 'Dari sudut pandang  dunia, sudah diakui bahwa usaha kecil dan menengah atau biasa di singkat dengan UKM memainkan suatu  peran yang sangat vital di dalam  pembangunan dan pertumbuhan  ekonomi negara. Dalam peningkatan  daya saing di dunia usaha kinerja karyawan merupakan faktor penting agar produksi dan jaringan  terus meningkat dan  karyawan patut mendapat perhatian lebih dari para pengembang usaha agar produksi dan elabilitas terus meningkat. Di era modern ini sangat di butuhkan karyawan dengan pengetahuan teknologi agar promosi produk menjaring kesemua daerah dan proses administrasi menjadi cepat. Apa lagi untuk media jual beli Online sekarang sudah ada E-Commerce. Ini merupakan suatu tindakan melakukan transaksi bisnis secara elektronik dengan menggunakan internet sebagai media komunikasi  yang paling utama (Robert E. Johnson). \nSehingga perusahaan membutuhkan klustering khusus untuk menyoroti kinerja karyawan agar semua aktifitas dan kemampuan dapat terkontrol dan termonitor dengan baik. Untuk melakukan itu butuh sebuah sistem statistika bernama Regresi Binary Logistic. \nBerdasarkan analisis dari hasil uji ekspektasi B atau Exp (B) diketahui bahwa kontribusi dari kinerja dari Batik Trisna Art baik. Hal ini ditunjukkan dari besarnya nilai Logit dalam 5 tahun terakhir selalu menyentuh nilai = 0.731058579. Peluang yang kinerja karyawan baik yang bekerja di Batik Trisna Art diambil contoh di tahun 2015 yaitu 0.731058 untuk karyawan akan bekerja tidak baik sebesar 0.268941 sehingga tahun berikutnya kemungkinan besar kalau dapat mempertahankan kinerja maka akan dapat baik.', 'Muhammad Nurhudha Toha', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100106'),
(288, '090411100109', 'IMPLEMENTASI SEGMENTASI PEMBULUH DARAH RETINA PADA CITRA FUNDUS MATA MENGGUNAKAN\r\nLAPLACIAN OF GAUSSIAN', 'Dr. Arif Muntasa, S. Si., M.T.', 'Dr. Indah Agustien S., S. Kom, M.Kom', 'Teknologi di dunia kedokteran semakin berkembang. Hal tersebut memudahkan untuk mendeteksi penyakit pada manusia termasuk penyakit diabetes. Penyakit diabetes menyebabkan permasalahan pada mata yang disebut juga dengan  Diabetic Retinopathy. Untuk mendeteksi penyakit tersebut, tahap awal yang dilakukan adalah dengan melakukan segmentasi pada pembuluh darah. Penelitian ini menerapkan Laplacian of Gaussian sebagai metode segmentasi. Terbagi tiga proses utama antara lain preprocessing, segmentasi, dan perbaikan citra setelah proses segmentasi. Tahap pertama adalah preprocessing, yaitu mengambil citra green channel, dan memperbaiki kontras citra dengan Contrast Limited Adaptive Histogram Equalization (CLAHE). Tahap kedua adalah segmentasi dengan Laplacian of Gaussian. Laplacian of Gaussian mempunyai dua parameter, yaitu koordinat (x,y) dan variansi. Hasil dari Laplacian of Gaussian adalah matrik mask yang digunakan untuk mengkonvolusi citra. Tahap ketiga  dilakukan proses noise removal, overlapping mask, operasi morfologi dilasi dan field of view removal. Hasilnya dibandingkan dengan citra groundtruth untuk menghitung tingkat akurasi. Pengujian dilakukan pada database Digital Retinal Images for Vessel Extraction (DRIVE) sebanyak 20 citra. Hasil citra segmentasi dibandingkan dengan citra groundtruth. Akurasi dengan hasil terbaik sebesar 88,88 % dan 79,29 % untuk akurasi terendah. Rata-rata akurasi sebesar 85,53 %. Citra yang dihasilkan dari segmentasi cukup baik sehingga metode Laplacian of Gaussian mampu melakukan segmentasi dengan baik.', 'Nurdiah Okvitasari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100109'),
(289, '090411100110', 'SISTEM PENDUKUNG KEPUTUSAN UNTUK MENILAI KELAYAKAN PENGAJUAN KREDIT DENGAN \r\nMETODE NAIVE BAYES', 'Bain Khusnul Khotimah, S.T., M.Kom', 'Achmad Jauhari. S.T., M.Kom', 'Semakin banyaknya calon nasabah yang mengajukan kredit dengan kondisi ekonomi yang berbeda-beda, menuntut kejelian pihak bank sebagai pemberi kredit dalam pengambilan keputusan pemberian kredit. Oleh karena itu, dalam penentuan kelayakan kredit kepada nasabah, setiap Bank, dalam hal ini Bank Tabungan Negara (BTN) cabangBangkalanperlu memperhatikan beberapa prinsip faktor-faktor yang ada. Adapun faktor-faktor yang menjadi dasar pengambilan keputusan oleh pihak bank dalam menentukan calon penerima kredit dari pekerjaan, penghasilan per bulan, jumlah tanggungan, status ttempat tinggal. \r\nDengan permasalahan tersebut maka, perlu adanya solusi pemecahan masalah yang ada dengan membuat suatu sistem pendukung keputusan yang bertujuan membantu proses pengambilan keputusan untuk meningkatkan kemampuan dalam memutuskan masalah tersebut. Metode yang digunakan dalam sistem pendukung keputusan ini adalah naïve bayes.\r\nNaïve bayes memegangasumsiakan hubungan antarfitur atau atributnya yang independen sehingga menjadikannya sederhana dan efisien. Penerapan Naive bayes ini diharapkan dapat menilai akurasi dalam menentukan nilai kelayakan kredit. Penerapan metode naive bayes kedalam sistem pendukung keputusan pengajuan kredit baru di Bank BTN memperoleh akurasi 90% dan error sekitar 10%.Dengan sistem ini metodenaive bayes mampu menentukan memberikan keputusan kepada pemohon dengan akurasi 90%', 'Mohammad Purnama Sidik', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100110'),
(290, '090411100111', 'IMPLEMENTASI SEGMENTASI PEMBULUH DARAH CITRA FUNDUS MATA MENGGUNAKAN FIRST-ORDER DERIVATIVE GAUSSIAN DAN MORFOLOGI', 'Dr. Arif Muntasa, S.Si.,MT.', 'Dr. Indah Agustien, S. S.Kom.,M.Kom', 'Mata adalah salah satu panca indera manusia yang kurang mendapat perhatian meskipun fungsinya yang sangat vital bagi manusia. hal ini menyebabkan banyak penyakit dan gangguan yang menyerang mata kita. Bahkan, beberapa penyakit dapat dilihat dari mata antara lain tekanan darah tinggi, kanker dan diabetes. Salah satu gejala diabetes adalah perdarahan ringan pada retina, adalah gejala Diabetic Retinopathy (DR). Jika tidak diobati, kondisi itu dapat berakhir dengan kebutaan. Segmentasi pembuluh darah pada citra fundus mata dapat membantu analisa terhadap perubahan pembuluh darah di retina.\r\nPada penelitian Tugas Akhir ini, segmentasi pembuluh darah retina dimulai dengan tahap preprocessing, dan segmentasi. Tahap pertama adalah preprocessing, yaitu mengambil citra green channel,dan memperbaiki kontras citra dengan Contrast Limited Adaptive Histogram Equalization (CLAHE). Tahap kedua adalah segmentasi dengan First-Order  Derivative  of  Gaussian, dilanjutkan dengan Morfologi Top Hat. Dilakukan perbaikan dengan proses noise removal, overlapping mask, operasi morfologi dilasi dan field of view removal. Hasil dari proses tersebut dibandingkan dengan citra groundtruth untuk menghitung tingkat akurasi. \r\nPengujian dilakukan pada database DRIVE sebanyak 20 citra. Citra hasil segmentasi dibandingkan dengan citra groundtruth. Akurasi yang didapat dari pengujian tersebut sebesar 88,79%. Citra hasil segmentasi kurang baik sehingga metode First-Order Derivative of Gaussian mampu melakukan segmentasi dengan cukup baik\r\nKata kunci : Segmentasi, First-Order Derivative of Gaussian, Morfologi Tophat, Fundus Mata.\r\n', 'Imam Baihaqi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100111'),
(291, '090411100112', 'SISTEM PENDATAAN INVENTARIS PERUSAHAAN MENGGUNAKAN FRAMEWORK CODEIGNITER\r\n(Studi Kasus : Benua Cokelat)', 'Achmad Jauhari, S.T., M.Kom', 'Bain Khusnul Khotimah,ST.,M.Kom.', 'Perusahaan yang bergerak di olahan cokelat mulai merabah dikalangan pengusaha kecil. Hal ini semakin memudahkan para konsumen untuk mendapatkan rasa yang berfariasi sesuai dengan selera para konsumen.akantetapi dengan jumlah pesaing yang sangat banyak hal ini juga dapat meningkatkan resiko kegagalan dalam persaingan perdagangan. Hasil dari pengamatan menunjukkan bahwasanya mayoritas pengusaha kecil kurang memperhatikan seberapa kuat perusahaan yang mereka miliki. Salah satu cara utuk melihat seberapa sehat suatu perusahaan yakni dengan merujuk pada pendataan inventaris yang mereka miliki. Penelitian ini bertujuan untuk membuat suatu sistem informasi yang memudahkan para usahawan olahan cokelat yang berkembang untuk memudahhan mereka dalam mendata inventaris yang mereka miliki. Sistem ini akan memberikan kemudahan pencatataan dengan cara memberikan pengelompokan pada setiap barang yang dicatat berdasarkan kategori, nama barang, keterangan, satuan barang dan jumlah barang yang tersedia. Kategori dan barang akan memiliki keterangan tersendiri yang memudahkan Admin untuk mengatur pendataan inventaris. Hasil penelitian ini akan membantu pendataan inventaris, yang terbukti dari hasil ujicoba yang dilakukan oleh Admin dan Pimpinan Perusahaan Benua Cokelat memberikan penilayan yang sangat memuaskan.\r\n\r\nKata Kunci : Inventaris, mayoritas, Admin, sistem informasi', 'Eko Khairul Nurrahmat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100112'),
(292, '090411100113', 'ANALISA BALANCED SCORECARD PROJECT PERFORMANCE PADA PROJECT INTEGRATION AND SCOPE MANAGEMENT MENGGUNAKAN FUZZY ANALYTIC NETWORK PROCESS', 'Hermawan,S.T., M.Kom', 'M. Kautsar S, Skom., M. MT', 'Manajemen proyek merupakan upaya untuk merencanakan, mengatur dan melaksanakan proyek secara optimal untuk mencapai sasaran yang ditentukan. Pelaksanaan proyek yang sesuai dengan standar prosedur akan menghasilkan hasil yang optimal. Berdasarkan hal tersebut, Untuk memenuhi standar proyek, penelitian ini mengimplementasikan framework standar manajemen proyek berdasarkan Project Management Body Of Knowledge(PMBOK) yang difokuskan pada domain Project Integration dan Scope Management. Penelitian ini ditujukan untuk mengintegrasikan domain PMBOK sehingga mampu menganalisa performa proyek dengan menggunakan Balanced ScoreCard(BSC). Key Performance Indicator(KPI) pada perspektif BSC diperoleh dari pengukuran kinerja masing- masing domain fungsional. Pembobotan KPI dilakukan menggunakan Fuzzy Analytic Network Process(FANP). Hasil BSC akan dijadikan sebagai acuan untuk mengetahui performa proyek. Uji coba sistem dilakukan menggunakan data proyek implementasi SAP PT. Semen Gresik Tbk. Hasil uji coba fungsionalitas sistem berdasarkan PMBOK adalah 81,25% sedangkan berdasarkan user adalah sebesar 75%. Nilai perspektif BSC pada keempat kuadran adalah sebagai berikut ,  finance: 66, 22%, Internal process: 23 ,00%, learning and growth:11% dan customer:0%.\r\n\r\nKata Kunci  : ERP, Project Integration and Scope Management, Balanced Scorecard(BSC), Fuzzy Analytic Network Process (FANP).', 'ACHMAD FAUZI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100113'),
(293, '090411100114', 'Rancang Bangun ERP (Enterprise Resource Planning) Pada Modul Financial Accounting Menggunakan Zachman Framework', 'Hermawan S.T.,M.Kom', 'Rika Yunitarini S.T.,M.T', 'Dalam rancang bangun Enterprise Resource Planning (ERP), dibutuhkan perencanaan terorganisir, dikarenakan ERP ditujukan untuk mengintegrasikan seluruh proses yang ada dalam berbagai domain fungsional perusahaan, antar departemen, maupun antar lokasi yang berbeda. Penelitian ini bertujuan merancang sebuah desain aplikasi untuk mendapatkan blueprint aplikasi ERP pada modul Financial Accounting (FA). Zachman Framework (ZF)  merupakan salah satu kerangka kerja yang dapat  memetakan artifak arsitektur informasi di sebuah organisasi. Dalam penerapanya, ZF mampu mendeskripsikan level prespektif arsitektur IT (Planner, Owner, Designer, Builder, Implementer, Participant) sesuai abstraksi objek (What, How, Where, Who, When, Why). Untuk standarisasi artifak arsitektur informasi digunakan pendekatan standart pemodelan UML 2.0, sehingga mampu meningkatkan deskripsi ZF menjadi standart Model Driven Architecture. Untuk pengujian hasil desain perancangan telah dikembangkan perangkat lunak ERP FA yang menerapkan Model Driven Design yang mampu mengkonversi artifak model menjadi aplikasi yang berkualitas. Dimana dari hasil penilaian Stakeholder dari pengujian sistem di PT. IGLAS, didapatkan tingkat kepuasan rata-rata 86,33. Sedangkan untuk penilaian availability sistem secara kuantitatif dengan dibandingkan Openerp 7.0 sistem yang dikembangkan jauh lebih kompleks dengan ketersediaan fitur 91,17% berbanding dengan Openerp 7.0 yang hanya memiliki keterbatasan fitur 74,4%.', 'Achmad Afiffudin Nurzein', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100114'),
(294, '090411100115', 'Sistem analisis sentimen produk telkomsel dari opini twitter berbahasa Indonesia menggunakan metode naive bayes classifier', 'Mulaab,S.Si.,M.Kom', 'Firdaus Solihin,S.Kom.,M.Kom', 'Analisis sentimen otomatis berdasarkan opini masyarakatterhadap produk TELKOMSEL berbahasa Indonesia. Opini masyarakat diambil dari sebuah situs microblogging twitter dengan melakukan crawling data opini dengan keyword produk-produk dari sebuah provider di Indonesia yaitu Telkomsel. Sistem akan melakukan pengklasifikasian tweet menjadi sebuah kategori yaitu positif,negatif atau netral. Sebelum data training dan data testing didapatkan dari pemisahan data hasil crawling menjadi 75% untuk training dan 25% untuk data testing.Metode yang digunakan untuk mengklasifikasikan adalah metode naïve bayes classifier. Hasil akhir atau output dari aplikasi ini berupa peta yang menunjukkan pada daerah mana user yang menyatakan opini positif, negatif atau netral. Dengan aplikasi ini sebuah perusahaan dapat menganalisa kepuasan pelanggan terhadap produk yang dimilikinya dan dapat mengetahui daerah mana saja user menyatakan kepuasan atau ketidakpuasan. Hasil ujicoba pada sistem klasifikasi teks dengan menggunakan data hasil crawling diperoleh akurasi sebesar 63% dan error rate sebesar 37%, hasil ini mungkin kurang memuaskan itu dikarenakan data teks yang ditulis oleh user pada twitter lebih banyak menggunakan kata yang mengandung singkatan.', 'Muhamad Roni Firdaus', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100115'),
(295, '090411100118', 'RANCANG BANGUN AUGMENTED REALITY MENGGUNAKAN FRAME MARKERS PADA PERMAINAN SUSUN KATA BERBASIS ANDROID', 'Arik Kurniawati, S.Kom., M.T.', 'Cucun Very Angkoso, S.T., M.T.', 'Di Indonesia banyak sekali mengenal bermacam-macam pemainan kata, salah satu permainan kata yang sering dimainkan melalui jejaring sosial saat ini adalah  jenis alfagram. Alfagram adalah permainan menyusun ulang huruf dari sebuah kata agar sesuai alfabetis, misal alfagram “cinta” adalah “tinca”. Sementara ini permainan kata alfagram hanya dimainkan secara tradisional seperti menyusun kata dengan mengetik, permainan ini akan dikembangkan dengan teknologi Augmented Reality. Augmented Reality merupakan konsep penggabungan antara obyek virtual 2D atau 3D pada dunia maya dengan dunia nyata, Augmented Reality digunakan untuk menampilkan obyek 3D perhuruf. \r\nPada Tugas Akhir ini dibangun rancangan tentang teknologi Augmented Reality dengan menggunakan Frame Markers, Frame markers digunakan untuk penanda suatu obyek huruf yang berbeda-beda, ciri tersebut digunakan untuk permainan susun kata. Setiap obyek yang telah terdeteksi oleh kamera mendapatkan sebuah id, dan disimpan ke sistem digunakan untuk proses inti permainan kata. Teknologi Augmented Reality ini telah diimplementasikan kedalam permainan susun kata dan dapat disimpulkan dari hasil uji kuantitatif yang didapatkan dari pengguna aplikasi bahwa 50% puas, 41% lumayan puas, dan 9% tidak puas.\r\n', 'Andhika Septiono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100118'),
(296, '090411100119', 'PENGENALAN JENIS KELAMIN BERBASIS KERNEL PRINCIPAL COMPONENT ANALYSIS', 'Dr. Arif Muntasa, S.Si .,M.T', 'Rima Tri Wahyuningrum, S.T ., M.T', 'Gender Recognition  adalah salah satu penelitian di bidang biometrik dan computer vision yang cukup popular. Gender Recognition adalah pengembangan dari Face Recognition, Gender Recognition dapat mengklasifikasikan citra menjadi 2 kelas yaitu perempuan dan laki-laki. Tugas Akhir ini menggunakan 400 citra, 200 citra perempuan dan 200 citra laki-laki dan memakai database JAVE yang telah teruji sebelumnya. Ada 2 tahapan penting dalam penelitian ini, tahap pertama ektraksi fitur menggunakan metode Kernel Principal Component Analysis. Metode kernel dapat membuat representasi data pada ruang kernel dengan menggunakan fungsi non-linear dan kernel yang digunakan adalah linier kernel. Tahap kedua adalah pengukuran jarak kemiripan citra testing terhadap citra training menggunakan metode 2D Correlation Coefficient yang bekerja dengan cara mengalikan data training dan data testing kemudian membagi dengan hasil akar kuadratnya. Metode kernel berjalan cukup baik karena memperoleh akurasi lebih tinggi dari metode dari penelitian sebelumnya yang telah digunakan. Akurasi tertinggi yang dihasilkan pada penelitian ini mencapai 92%.', 'Achmad Rizal', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100119'),
(297, '090411100120', 'SEGMENTASI DAN PENGENALAN OBYEK KARAKTER BERBASIS 2-D CORRELATION COEFFICIENT PADA PLAT NOMOR KENDARAAN ', 'Dr. Arif Muntasa, S.Si., MT.', 'Dr. Indah Agustien S, S.Kom., M.Kom.', 'Sistem pengenalan karakter plat nomor kendaraan saat ini sudah banyak diciptakan dengan berbagai metode oleh peneliti-peneliti sebelumnya. Dalam penelitian ini dilakukan pengenalan obyek karakter plat nomor kendaraan dengan metode 2d-Correlation Coefficient. Metode ini membutuhkan data training terdiri dari citra angka 0-9 dan huruf a-z dengan ukuran dimensi 42x24. Ada empat tahap yang dilakukan, pertama pre-processing, yaitu menghilangkan noise dengan menggunakan metode Median Filter dan Adaptive Wiener Filter. Kedua, segmentasi  karakter berdasarkan topologi citra. Ketiga, resizing supaya ukuran dimensi masing-masing citra karakter sama dengan ukuran citra karakter pada data training. Keempat, pengenalan karakter yaitu pengukuran similarity menggunakan metode 2-d Correlation Coefficient. Eksperimen dilakukan terhadap 50 citra plat nomor. Dari hasil eksperimen dengan filtering median filter diperoleh akurasi sebesar 82.00 %. Dan hasil eksperimen dengan filtering Adaptive Wiener Filter diperoleh akurasi sebesar 84.79 %.  ', 'Laurencius H Simanjuntak', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100120'),
(298, '090411100121', 'SISTEM MANEJEMEN KEANGGOTAAN ORGANISASI BERBASIS Framework\r\nSTUDI KASUS : UKM (Unit Kreatif Mahasiswa ) Creative Computer Club\r\n', 'Achmad Jauhari,ST.,M.Kom.', 'Bain Khusnul Khotimah,ST.,M.Kom', 'Organisasi merupakan sekumpulan orang yang terdiri dari 2 orang atau lebih yang terkumpul dalam sebuah wadah yang mempunyai visi dan misi yang sama. Tercapainya visi dan misi sebuah organisasi tergantung pada dari pada anggota – anggotanya. Salah satu organisasi kemahasiswaan adalah UKM (Unit Kegiatan Mahasiswa) yang berada setiap perguruan tinggi baik negeri maupun swasta. Permasalahan dalam system keanggotaan kerap menjadi salah satuf actor kerancuan informasi dalam sebuah organisasi. Salah satu contoh bagaimana cara proses manajemen keanggotaan dari sebuah organisasi UKM yang anggotanya berasal dari jurusan yang berbeda dan semester yang berbeda. Oleh karena itu untuk mengatasi masalah diatas, suatu organisasi harus cermat bagaimana cara memanajemen keanggotaan dari UKM agar proses manajemen tersebut bias berjalan efektif dan efisisen. Dalam penelitian ini penelitiakan merancang sebuah sistem yang mengatur manajemen keangotaan organisasi khususnya UKM (Unit Kegiatan Mahasiswa) Creative Computer Club .hasil respon aplikasi sistem informasi pendataan anggota berbasis web berupa kuisioner kepada Admin dan anggota mendapatkan respon positif dengan presentasi total respons admin adalah sebesar 83,33%  dan anggota adalah sebesar 100%.', 'moh. seli', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100121'),
(299, '090411100123', 'PENGENALAN CITRA KARAKTER TULISAN MULTI LINE BERBASIS TEMPLATE MATCHING CORRELATION', 'Dr. Indah Agustien S.,S.Kom, M.Kom', 'Dr. Arif Muntasa, S.Si., MT.', 'Teknologi pengenalan karakter merupakan salah satu teknologi yang sangat bermanfaat untuk membantu manusia dalam hal pekerjaan dan proses digitalisasi. Maka dari itu banyak dilakukan penelitian mengenai pengenalan citra karakter. Penelitian Tugas Akhir ini menerapkan metode Template Matching Correlation untuk pengenalan karakter lebih dari satu baris (Multi Line). Terdapat tiga tahapan utama yang digunakan, yaitu tahap pre-processing, segmentasi dan pengenalan karakter. Tahap pre-processing ialah tahap merubah citra menjadi biner dan menghilangkan noise. Tahap kedua ialah segmentasi dengan Profil Proyeksi. Pada segmentasi Profil Proyeksi dilakukan proses pemotongan menurut baris dan kolom untuk mendapatkan citra karakter. Hasil citra karakter uji dan template harus disamakan ukuran agar dapat diproses pada tahap selanjutnya. Tahap ketiga yaitu pengenalan karakter digunakan Metode Template Matching Correlation untuk menghitung kedekatan antara karakter citra template dan citra uji. Cara kerja metode Template Matching Correlation ialah mencocokkan setiap piksel pada matrik citra uji dengan citra yang menjadi template acuan untuk mendapatkan nilai maksimum. Nilai maksimum tersebut yang dijadikan hasil dari pengenalan karakter tulisan. Pengujian dilakukan terhadap 40 citra dengan variasi dua hingga empat baris kalimat. Akurasi yang didapatkan dari pengujian tersebut cukup baik, yaitu sebesar 71% karakter dapat dikenali dengan  menggunakan metode Template Matching Correlation.', 'Okie Maria Amul Husnah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100123'),
(300, '090411100125', 'PERANCANGAN SISTEM INFORMASI GEOGRAFIS KESESUAIAN LAHAN SAWAH TAMBAK \r\n(STUDI KASUS : KECAMATAN DEKET, KABUPATEN LAMONGAN)\r\n', 'MULAAB, S.Si., M.Kom', 'RIKA YUNITARINI, S.T., M.T.', 'Sawah merupakan lahan usaha pertanian yang secara fisik berpermukaan rata, dibatasi oleh pematang, serta dapat ditanami padi, palawija atau tanaman budidaya lainnya. Tambak merupakan lahan yang dipergunakan sebagai tempat untuk kegiatan budidaya air, baik digunakan untuk tambak budidaya ikan dan udang ataupun digunakan untuk tambak garam. Sedangkan sawah tambak sendiri merupakan lahan pertanian yang juga bisa digunakan untuk keduanya. . Tersedianya data dan informasi  sumberdaya lahan yang lengkap sangat diperlukan untuk menunjang program pembangunan pertanian yang berkelanjutan. Dalam hal ini dibutuhkan suatu sistem untuk menemukan potensi dari lahan untuk  mencari kualitas pengguaan lahan yang cocok untuk penggunaan tertentu. Sistem yang dipakai adalah sistem kesesuaian lahan. Kesesuaian lahana adalah tingkat kecocokan sebidang lahan untuk penggunaan tertentu. Dalam sistem informasi yang terkait dalam kawasan lingkungan pertambakan ataupun persawahan dibutuhkan suatu Sistem Informasi Geografi (SIG). Dimana didalam sistem ini akan meimplementasikan kesesuaian lahan yang divisualisasikan berupa peta lahan pertanian sawah tambak serta peta pencarian lahan. Dengan adanya sistem ini dapat mempermudah bagi masyarakat umum dan dinas terkait untuk melihat potensi lahan yang akan dikelola berdasarkan atribut – atribut didalamnya.  \r\n\r\nKata kunci : sawah tambak,  sistem informasi geografi, kesesuaian lahan,', 'FITRIANSYAH PERDANA PUTRA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100125'),
(301, '090411100126', 'Interaksi MArkerless Augmented Reality Sebagai Media Buku Menu pada SONNEN Cafe Berbasis OS Android', 'Arik Kurniawati, S.Kom., M.T.', 'Ari Kusumaningsih, S.T., M.T.', 'Dalam perkembangannya semakin banyak café menggunakan media 2D sebagai media promosi dan tampilan produk dalam penggunaan buku menu. Augmented reality (AR) yang merupakan konsep penggabungan antara obyek virtual 2D atau 3D pada dunia maya ke dunia nyata, penerapan Augmented reality dalam buku menu juga akan membuat promosi produk lebih menarik dan menjadi hal baru di bidang advertising. Dengan menggunakan metode markerless pada aplikasi Augmented reality akan membuat aplikasi lebih bervariasi.\r\nUntuk mengembangkan Augmented reality banyak sekali library pendukung yang dapat di gunakan. Vuforia SDK adalah salah satunya. Dimana Vuforia SDK merupakan library pendukung Augmented reality yang dapat berintegrasi dengan Unity \r\nBerdasarkan sistem AR pada Virtual menu’s Sonnen Cafe, obyek animasi dapat berinteraksi dan menimbulkan animasi gerak, perubahan texture serta audio dengan uji lapangan responden memilih 80% aplikasi dapat di terapkan pada Sonnen café, Dengan tingkat waktu proses rendering obyek aplikasi terbaik berkisar 2,31 detik pada uji device Android yang di terapkan pada sistem secara Augmented reality.\r\n', 'Mochahmad Dannish Koosrivanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100126');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(302, '090411100127', 'Sistem Monitoring Tanaman Berbasis Jaringan Sensor Nirkabel Menggunakan Arduino', 'Ari Kusumaningsih S.T., M.T', 'Koko Joni S.T.,M.Eng', 'Tanah merupakan merupakan lapisan permukaan bumi sebagai tempat tumbuh tanaman dan salah satu faktor penting untuk menunjang pertumbuhan dan perkembangan tanaman adalah kelembaban tanah. Seiring berkembangnya ilmu pengetahuan dan teknologi sekarang  penulis mencoba untuk membuat suatu perancangan sistem yang dapat mengontrol atau memantau tanaman dengan menggunakan kelembaban tanah sebagai indikator keadaan tanah berbasis jaringan sensor nirkabel menggunakan arduino. Pengukuran kelembaban tanah pada tanaman dilakukan dengan memanfaatkan satu sensor kelembaban tanah ber-tipe YL-69 dan dua sensor ber-tipe FC-28. Nilai yang terukur dari sensor akan diolah oleh mikrokontroler arduino yang terhubung dengan Ethernet Shield. Hasil pengukuran sensor kemudian dikirim melalui jaringan internet yang langsung terhubung dengan database server  dan hasil pengukuran selanjutnya akan di tampilkan melalui web server. Melalui aplikasi web  dapat memberikan informasi secara detail dan akurat. Dengan perancangan dan pengimplementasian sistem monitoring tanaman berbasis jaringan sensor nirkabel pemantuan dan pengolahan tanaman dapat dilakukan secara otomatis dan terkontrol. Hasil pengujian menunjukkan bahwa pengujian saat dilakukan pada ruang outdoor dan indoor berbeda nilai kelembaban tanah pada ruang indoor lebih stabil  dibuktikan dengan menghitung simpangan baku pada tiap tanaman di ruang indoor dan outdoor. Perbedaan nilai simpangan baku tanaman I sebesar 1,33%, pada tanaman II sebesar 0,14%, sedangkan pada tanaman III sebesar 0,15%.\r\n\r\nKata kunci: Jaringan Sensor Nirkabel, Web Server, Arduino, Jaringan Internet, Kelembaban Tanah.  \r\n', 'Ahmad Muflih S', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100127'),
(303, '090411100128', 'Pengenalan Pola Karakter PadaTulisan Multi Line\r\nBerbasis Learning Vector Quantization', 'Dr. Indah Agustien S.,S.Kom, M.Kom', 'Dr. Arif Muntasa, S.Si., MT.', 'Pengenalan karakter merupakan pengenalan pola yang berbentuk karakter seperti huruf dan angka. Permasalahan yang muncul dalam melakukan proses pengenalan karakter pada tulisan adalah bagaimana sebuah metode pengenalan dapat mengenali berbagai karakter pada tulisan.Citra tulisan yang telah disimpan sebagai citra yang diolah agar dapat mengenali karakter huruf dan angka yang ada dalam citra tulisan. Penelitian ini, bertujuan untuk mengimplementasikan metode Learning Vector Quantization pada pengenalan teks multi line. proses yang dilakukan dalam mengenali teks multi line ada beberapa tahap, yaitu preprocessing, pelatihan dan pengenalan menggunakan metode Learning Vector  Quantization. Tahap preprocessing dimulai dari binerisasi, penghapusan noise, segmentasi menggunakan Profile Projection, dan normalisasi. Tahap preprocessing dilakukan agar memudahkan pelatihan citra tulisan, hasil setelah dilakukan tahap preprocessing adalah citra tiap karakter pada citra tulisan. Tahap selanjutnya adalah tahap pelatihan dan pengenalan. Pada tahap ini, metode Learning Vector Quantization digunakan untuk mengelompokkan karakter berdasarkan kelas masing-masing sehingga diperoleh bobot akhir. Untuk pengenalan karakter, data uji dihitung jarak minimum terhadap bobot akhir menggunakan Euclidean Distance dan data uji tiap karakter dimasukkan ke dalam masing-masing kelas berdasarkan jarak minimum tersebut. Percobaan yang dilakukan pada pengenalan karakter menggunakan metode Learning Vector Quantization mampu mengenali citra yang berisi citra yang belum dilatih dengan rata-rata 55.11%.', 'Umy Fatmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100128'),
(304, '090411100129', 'SEGMENTASI PEMBULUH DARAH PADA CITRA FUNDUS BERBASIS MORPHOLOGY OPERATOR', 'Dr. Arif Muntasa, S.Si, M.T', 'Dr. Indah Agustien S., S.Kom, M.Kom', 'Mata merupakan organ penting bagi manusia untuk melihat. Suatu penyakit bisa juga dideteksi melalui mata. Bagian pada mata yang dapat diidentifikasi adalah pembuluh darah. Pendeteksian awal dapat dilakukan dengan melihat pembuluh darah yang membesar, percabangan yang tidak normal pada pembuluh darah, dan sebagainya melalui proses segmentasi. Sehingga diperlukan suatu sistem yang cepat dan akurat dalam mensegmentasi pembuluh darah. Pada Tugas Akhir ini, segmentasi pembuluh darah menggunakan metode Morphology Operator. Segmentasi pembuluh darah ini terdapat dua tahap, yaitu preprocessing dan segmentasi. Langkah pertama adalah tahap preprocessing citra. Tahap preprocessing citra menggunakan beberapa langkah yaitu merubah citra RGB menjadi green channel, lalu memperbaiki citra dengan CLAHE, dan menegasikan citra dengan complement. Langkah kedua adalah tahap segmentasi citra yang terdiri dari morfologi tophat, kemudian melakukan penebalan dan pemutaran sudut menggunakan metode Morphology Operator, membinerkan citra dengan local thresholding, menghapus noise pada citra, dan menghilangkan tepi menggunakan field of view. Metode ini telah diujikan pada database DRIVE yang terdiri dari 20 citra fundus. Dengan database ini, didapatkan rata-rata akurasi sebesar 96,31%. Metode ini terbukti mampu mensegmentasi pembuluh darah pada citra fundus dengan baik.', 'Nararya Wahyu Dewa', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100129'),
(305, '090411100130', 'PENGEMBANGAN SISTEM PENDUKUNG KEPUTUSAN PENEMPATAN DAN PENILAIAN KINERJA KARYAWAN MENGGUNAKAN ALGORITMA C4.5', 'Rika Yunitarini, ST., MT.', 'Moch. Kautsar Sophan, S.Kom, M.MT', 'Semakin berkembang perusahaan, semakin dibutuhkan juga kebutuhan tenaga manusiayang produktif. Perusahaan umumnya ingin memberikan kinerja yang terbaik dalam berinteraksi dengan pihak yang terkait, salah satunya yaitu konsumen. Untuk mewujudkan itu, suatu perusahaan akan mencari sumber daya manusia yang melaksanakan pekerjaannya dengan baik. Selama ini penyeleksian pada penilaian kerja masih dilakukan secara manual dengan memberikan kriteria tertentu oleh Human Resource Development. Banyaknya kriteria dan karyawan yang dipekerjakan cukup menyulitkan divisi HRD dalam penyeleksian karyawan terbaik. Selain itu, seringkali pengambil keputusan dinilai secara subyektif  karena suatu hubungan tertentu antara pelamar dan pengambil keputusan.  Kualitas kerja karyawan juga seringkali berubah-ubah. Ini sangat berpengaruh pada prospek perusahaan kedepannya. Kesibukan seorang manager membuat tatap muka dengan karyawan kurang. Tentu saja ini membuat pengawasan pada kinerja karyawan sulit dilakukan. Untuk itu dibuat suatu sisstem pendukung keputusan dalam melakukan penilaian kinerja karyawan. Sistem ini menggunakan algoritma C4.5 yang menggunakan teknik data mining untuk membuat pohon keputusan, algoritma ini dimulai dengan memasukkan data training ke dalam simpul akar pada  pohon  keputusan.  Data training  adalah  sampel  yang  digunakan  untuk membangun  model  classifier dalam  hal  ini  pohon  keputusan.  Pada proses monitoring karyawan akan dipantau untuk penentuan kenaikan gaji atau promosi jabatan.', 'Windy Julianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100130'),
(306, '090411100131', 'RANCANG BANGUN APLIKASI SISTEM PELAPORAN DAN INFORMASI KONDISI JALAN BERBASIS MOBILE ANDROID', 'Firdaus Solihin, S.Kom., M.Kom', 'Hermawan, S.T., M.Kom', 'Jalan raya merupakan prasarana transportasi yang sangat vital di setiap daerah. Baik wilayah perkotaan maupun pedesaan, jalan raya menjadi prasarana penunjang yang utama bagi keberlangsungan aktivitas masyarakat. Sebagai usaha untuk tetap menjaga stabilitas prasarana masyarakat ini diperlukan proses pengelolaan data kondisi jalan yang baik. Namun, saat ini proses pencatatan dan pemetaan kondisi jalan masih dilakukan secara manual. Proses tersebut menyebabkan hasil survey memiliki keakuratan data maupun hasil pemetaan yang kurang baik. Demi melakukan perbaikan terkait proses pengelolaan data kondisi jalan telah dikembangkan sebuah aplikasi yang mampu membantu dalam proses pengelolaan data kondisi jalan. Aplikasi ini memiliki dua fungsi utama yaitu untuk membantu dalam melakukan proses survey kondisi jalan dan pemetaan kondisi jalan. Proses pencatatan dilakukan dengan menandai titik awal dan akhir ruas jalan kemudian menentukan kondisi ruas jalan tersebut. Dalam melakukan proses pemetaan kondisi jalan, aplikasi ini dilengkapi dengan peta Google sebagai peta dasar, sehingga dapat memberikan hasil pemetaan kondisi jalan dengan tingkat akurasi yang baik. Dengan menggunakan aplikasi Android dan Google Maps pemetaan kondisi jalan di Kabupaten Bangkalan dapat diimplementasikan dengan baik dengan tingkat akurasi posisi dalam peta Google yang bervariasi dengan nilai akurasi terburuk 11 meter dan akurasi terbaik 1 meter.', 'Sugeng Bagus Raharja', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100131'),
(307, '090411100132', 'Penerapan Penghapusan Pola Kata dalam Rekonstruksi Stemming Bahasa Indonesia', 'Firdaus Solihin, S.Kom., M.Kom.', 'Iwan Santosa, S.T., M.T.', 'Stemming adalah penghapusan imbuhan untuk menentukan kata dasarnya. Penelitian mengenai stemming telah memunculkan beberapa algoritma stemming bahasa Indonesia. Di antara beberapa algoritma tersebut, penelitian ini mencoba menerapkan algoritma stemming bahasa Indonesia yang telah mengalami rekonstruksi. Algoritma tersebut adalah Indonesian Stemmer Reconstruction (ISR). Rekonstruksi yang diterapkan pada algoritma ini dapat dilihat pada cara penghapusannya. Jika algoritma lain menghapus imbuhan secara tidak bersamaan antara awalan dan akhiran, algoritma ini melakukan penghapusan secara bersamaan pada awalan dan akhirannya. Rumus penghapusan tersebut didapatkan dari penyusunan formula Reguler Ekspression yang lebih singkat dan tidak menghabiskan waktu dalam prosesnya. Formula tersebut disusun berdasarkan acuan penggunaan imbuhan dalam bahasa Indonesia. Hal ini tentunya menunjang untuk mendapatkan hasil stemming yang lebih baik. Penelitian ini melakukan uji coba pada 300 dokumen yang sebelumnya telah diuji coba pada penelitian Fadhila Tala dan 50 konten dari dokumen hasil Crawler RISE. Penelitian ini memberikan hasil yang cukup baik yaitu perhitungan kebenaran kata mencapai 72% dan kecepatan 0,0243 detik pada 300 dokumen Fadhila Tala. Sedangkan pada 50 konten/dokumen hasil Crawler RISE didapatkan kecepatan sebesar 0,0052 detik dengan persentase kebenaran kata sebesar 50%.', 'Ana Tsalitsatun Ni\'mah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100132'),
(308, '090411100134', 'Analisa Klasifikasi Vendor Project Procurement Management Menggunakan Naive Bayes Classifier\r\n', 'Hermawan,S.Kom.,M.Kom', 'Yeni Kustiyah Ningsih,S.Kom.,M.Kom', 'PPM (Project Procurement Management) sangat diperlukan dalam meningkatkan daya saing perusahaan.\r\nPerformance vendor dalam PPM dibutuhkan untuk dapat mengukur kinerja vendor yang terlibat dalam PPM\r\natau menejemen pengadaan proyek. Berjalan atau tidaknya sebuah proyek dapat dilihat dari menejemen\r\npengadaan atau tim procurement dalam memenuhi kebutuhan proyek yang direncanakan. Pada penelitian kali\r\nini akan diusulkan penggunaan metode naïve bayes classifier untuk mengklasifikasikan performance vendor\r\ndalam PPM berbasis PMBOK (Project Management Body Of Knowledge). NBC (Naïve bayesian classifier)\r\nadalah salah satu metode sederhana yang dapat membentuk suatu pengklasifikasian standar dengan\r\nmenggunakan teori probabilitas sebagai dasar teori. Terdapat beberapa kriteria yang digunakan berdasarkan\r\nPMdoc (Project Management doc). Dari sistem ini akan dapat mengetahui kinerja vendor dalam 3 kategori\r\nyaitu memuaskan, cukup memuaskan, tidak memuaskan.', 'Winda Sarifati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100134'),
(309, '090411100135', 'Rancang Bangun ERP (Enterprise Resource Planning) pada Modul (Human Resource Management) Menggunakan Zachman Framework', 'Hermawan.,ST., M.Kom', 'Rika Yunitarini., ST., MT', 'ABSTRAK\r\nDalam rancang bangun Enterprise Resource Planning (ERP), dibutuhkan perencanaan terorganisir, dikarenakan ERP ditujukan untuk mengintegrasikan seluruh proses yang ada dalam berbagai domain fungsional perusahaan, antar departemen, maupun antar lokasi yang berbeda. Penelitian ini bertujuan merancang sebuah desain aplikasi untuk mendapatkan blueprint  aplikasi  ERP  pada  modul  Human Resource management (HRM). Zachman Framework (ZF)  merupakan salah satu kerangka kerja yang dapat  memetakan artifak arsitektur informasi di sebuah organisasi. Dalam penerapanya, ZF mampu mendeskripsikan level prespektif arsitektur IT (Planner, Owner, Designer, Builder, Implementer, Participant) sesuai abstraksi objek (What, How, Where, Who, When, Why). Untuk standarisasi artifak arsitektur informasi digunakan pendekatan standart pemodelan UML 2.0, sehingga mampu meningkatkan deskripsi ZF menjadi standart Model Driven Architecture. Untuk pengujian hasil desain perancangan telah dikembangkan perangkat lunak ERP HRM  yang menerapkan Model Driven Design yang mampu mengkonversi artifak model menjadi aplikasi yang berkualitas. Dimana dari hasil penilaian Stakeholder dari pengujian sistem di PT. IGLAS, didapatkan tingkat kepuasan rata-rata 88,33. Sedangkan untuk penilaian availability sistem secara kuantitatif dengan dibandingkan Openerp 7.0 sistem yang dikembangkan jauh lebih kompleks dengan ketersediaan fitur 88,89% berbanding dengan Openerp 7.0 yang hanya memiliki keterbatasan fitur 77,78%.\r\nKata Kunci : Enterprise Resource Planning, Financial Accounting, Zachman Framework, UML 2.0, Model Driven Design, Openerp 7.0\r\n', 'Fery Febriyan Syah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100135'),
(310, '090411100137', 'PENGELOMPOKAN KECAMATAN BERDASARKAN INDIKATOR PEMERATAAN PENDIDIKAN MENGGUNAKAN PARTITION AROUND MEDOIDS (PAM)', 'Bain Khusnul K, ST, M.Kom', 'Budi Dwi Satoto, ST.,M.Kom', 'Pemerataan pendidikan di Indonesia telah menjadi perhatian pemerintah sejak lama. Namun hingga saat ini, pendidikan di Indonesia masih belum merata. Hal tersebut dapat dilihat dari rendahnya nilai APK dan APM di daerah-daerah tertentu serta belum meratanya sarana dan prasarana pendidikan di seluruh daerah. Pemerintah membutuhkan informasi mengenai kondisi pemerataan pendidikan untuk menghasilkan kebijakan yang tepat. Salah satu cara untuk memperoleh informasi tersebut adalah dengan cara mengelompokkan kecamatan berdasarakan indikator pemerataan pendidikan. Pengelompokan (clustering) adalah metode data mining yang membagi data kedalam kelompok-kelompok yang mempunyai objek yang karakteristiknya sama. Penelitian ini menggunakan metode clustering Partition Around  Medoids (PAM) dengan 3 distance measure: Manhattan, Euclidean dan Canberra distance. Untuk mengukur kualitas hasil clustering, digunakan nilai Adjusted Rand Index (ARI). Semakin besar nilai ARI, semakin baik kualitas cluster. Dari 3 kali ujicoba diperoleh rata-rata nilai ARI untuk Euclidean distance sebesar 0.799, Manhattan distance dengan rata-rata sebesar 0.738 dan Canberra distance sebesar 0.163. Sedangkan pengelompokan terbaik diperoleh saat ujicoba 1 menggunakan Euclidean distance dengan nilai ARI sebesar 0.825 dan kecocokan dengan label asli sebesar 83.33 %. Dari pengelompokan terbaik menghasilkan kelompok pemerataan tinggi terdiri dari 11 kecamatan, kelompok pemerataan sedang  terdiri dari 15 kecamatan dan kelompok pemerataan rendah terdiri dari 46 kecamatan.\r\n\r\nKata kunci:indikator pemerataan pendidikan, clustering, PAM, distance measure\r\n', 'Iswati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100137'),
(311, '090411100138', 'PENGELOMPOKAN KECAMATAN DI PULAU MADURABERDASARKANINDIKATOR PEMERATAAN PENDIDIKAN MENGGUNAKAN METODE K-MEANS CLUSTERING BERBASIS SMARTER (SIMPLE MULTY ATTRIBUTE RATING TECHNIQUE EXPLOITING RANKS METHO', 'Bain Khusnul K, ST, M.Kom', 'Budi Dwi Satoto, ST.,M.Kom', 'Pemerintah daerah Kabupaten/Kota selaku pengelola pendidikan dasar, memerlukan informasi mengenai kondisi pendidikan di wilayahnya untuk membuat perencanaan dan kebijakan yang sesuai mengenai perluasan dan pemerataan pendidikan. Untuk mengetahui informasi pemerataan pendidikan diperlukan pengelompokan kecamatan berdasarkan indikator pemerataan pendidikan. Pengelompokan (clustering) merupakan salah satu metode data mining membagi data ke dalam kelompok – kelompok yang mempunyai objek yang karakteristiknya sama. Metode clustering yang umum digunakan adalah k-means clustering. Pada penelitian ini, akan mengelompokkan kecamatan yang ada di Pulau Madura menjadi 3 kelompok dengan 18 variabel indikator pemerataan menggunakan metode k-means clustering berbasis smarter. Smarter dikenal sebagai metode yang menghasilkan bobot bagus karena sebelumnya dilakukan perangkingan. Pada uji coba yang telah dilakukan menggunakan iterasi 10, 50 dan 100, kinerja k-means berbasis smarter jauh lebih baik dibandingkan dengan k-means biasa. Metode k-means berbasis smarter memiliki nilai SSE (error) terkecil yaitu 658.61yang terletak pada cluster 3 di 50 iterasi. Hal ini menunjukkan semakin kecil nilai SSEnya berarti semakin baik suatu metode.\r\n\r\nKata kunci:indikator pemerataan pendidikan, clustering, k-means, smarter.\r\n', 'Windy Wulandari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100138'),
(312, '090411100139', 'PENGELOMPOKAN LAHAN MENGGUNAKAN \r\nMETODE HYBRID K-MEANS CLUSTERING \r\nDENGAN DAVIES BOULDIN INDEX (DBI)\r\n', 'Bain Khusnul K, ST.,M.Kom', 'Firli Irhamni, ST, M.Kom', 'Meningkatnya jumlah penduduk menyebabkan kepentingan dan ketergantungan manusia pada lahan pertanian semakin meningkat. Namun, dibeberapa daerah terdapat lahan yang belum terkelompok berdasarkan kriteria lahan pertanian. Oleh karena itu, diperlukan pengelompokan lahan berdasarkan kriteria lahan pertanian. Pengolahan data dengan  pengelompokan (clustering) data yang umum digunakan adalah K-Means clustering, yang termasuk metode partition clustering, yakni mempartisi data kedalam bentuk satu atau lebih kelompok. Untuk memvalidasi data setelah proses clustering digunakan Davies Bouldin Index (DBI) untuk meningkatkan akurasi validasi hasil analisis data. Pada penelitian ini, pengelompokan lahan tanaman pangan pada skenario yang dijadikan tiga cluster dengan 10, 20 dan 30 iterasi diperoleh di iterasi ke-10 kecocokan dengan label asli sebesar 73.61 % pada 72 data lahan tanaman padi. Pada data tanaman jagung kecocokan dengan label asli sebesar 72.22 %  di iterasi ke-30, data tanaman kacang hijau dengan SSE terkecil = 0 di ke-30 dengan prosentase kecocokan 72,22 %, data tanaman kacang tanah dengan SSE terkecil = 0  di iterasi ke-10 kecocokan dengan label asli sebesar 77.78 %, data tanaman ubi kayu dengan SSE terkecil = 0  pada iterasi ke-20 dengan prosentase 63,89 %.   Nilai terkecil pada pemvalidasian cluster dengan DBI menggunakan tiga sampai sebelas cluster pada 72 data lahan untuk tanaman padi berada pada cluster ke-6, tanaman jagung berada pada cluster ke-9, tanaman kacang hijau berada pada cluster ke-11, tanaman kacang tanah berada pada cluster ke-11, dan tanaman ubi kayu berada pada cluster ke-9. Hasilnya cukup akurat karena ada tiga kelompok yang terbentuk.\r\n\r\nKata kunci:  K-Means, Davies Bouldin Index, Lahan, Clustering\r\n', 'Dita Rahmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100139'),
(313, '090411100140', 'IDENTIFIKASI UNTUK PENENTUAN TINGKAT KESESUAIAN LAHAN TERHADAP PADI SAWAH MENGGUNAKAN METODE LEARNING VECTOR QUANTIZATION DENGAN VISUALISASI GOOGLE MAPS API', 'Bain Khusnul K, ST, M.Kom', 'Budi Dwi Satoto, ST.,M.Kom', 'Padi Sawah merupakan salah satu tanaman pangan yang memiliki tingkat produksi paling tinggi di Kabupaten Lumajang dibandingkan dengan tanaman pangan lainnya seperti Jagung dan Ubi Kayu . Penentuan tingkat kesesuaian lahan untuk penanaman  Padi Sawah sangat perlu untuk dilakukan agar nantinya dapat memberikan informasi kepada para petani dan perencana pengguna lahan  dalam menentukan tindakan selanjutnya untuk dapat tetap meningkatkan produksinya. Dalam penelitian ini menggunakan Jaringan Syaraf Tiruan (JST) dengan metode Learning Vector Quantization  untuk mengklasifikasikan karakteristik-karakteristik lahan kedalam kelas kesesuaian lahannya terhadap Padi Sawah. Karakteristik Lahan yang digunakan adalah 13 dan akan diklasifikasikan kedalam Empat kelas yaitu S1, S2, S3 dan N. Berdasarkan hasil ujicoba yang telah dilakukan dengan menggunakan 50% data Training,Learning Rate 0.08, MaxEpoch 100 dan Error minimum yang diharapkan adalah 0, metode Learning Vector Quantization mampu memberikan tingkat akurasi sebesar 71% dalam  menentukan tingkat kesesuaian lahan untuk Padi Sawah. Hasil ujicoba tersebut selanjutnya divisualisasikan menggunakan Google Maps API.\r\n\r\nKata Kunci: Jaringan Syaraf Tiruan (JST), Learning Vector Quantization (LVQ), Kesesuaian Lahan, Sistem Informasi Geografis(SIG),Google Maps API.\r\n', 'Ainum Mabruroh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100140'),
(314, '090411100141', 'RANCANG BANGUN SISTEM PEMBELAJARAN BAHASA MADURA MENGGUNAKAN PERSONALIZED SYSTEM', 'Andharini Dwi Cahyani Skom., Mkom.', 'Yeni Kustiyahningsih Skom., Mkom.', 'Bahasa Madura merupakan bahasa lokal tradisional warisan nenek moyang asli warga Indonesia. Pelestarian bahasa ini tentunya harus dilakukan dalam kontek akademik yang sistematis agar bisa dipelajari dengan baik oleh siswa sekolah dasar sebagai pondasi dasar untuk memperkenalkan bahasa Madura. Seiring perkembangan jaman tentunya perlu sarana pendukung pendidikan yang bisa menyesuaikan dengan jaman yang semakin modern, dengan pembelajaran yang aktif tidak hanya terpaku kepada kelas yang monotone. Aplikasi E-Lerning bahasa Madura sangatlah tepat untuk mendukung pembelajaran bahasa Madura di sekolah dengan baik, dengan berbagai modul dasar pembelajaran bahasa Madura mulai dari parcakapan, okara samporna ta’ samporna, carakan, dll. dapat dipelajari kapanpun dan dimanapun siswa berada. Aplikasi E-learning dengan metode Personalized E-Learning System merupakan metode pembelajaran modern yang dapat mengetahui kemampuan siswa dengan beberapa soal random dan inputan tingkat kesulitan dari siswa, dengan adanya pembelajaran elektronik siswa dengan mudah dapat mempelajari modul yang ada sesuai tingkat ability masing masing. Dari penelitian yang telah dilakukan mendapatkan kenaikan minat belajar siswa yang sangat siknifikan, tingkat kemampuan siswa terus bertambah dengan hasil ujian pretest dan posttest yang baik. ', 'Faiz Zainol Lutji Afandi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100141'),
(315, '090411100142', 'SISTEM PENDATAAN ALUMNI BERBASIS FRAMEWORK CODEIGNITER\r\n(STUDI KASUS : FAKULTAS TEKNIK UNIVERSITAS TRUNOJOYO MADURA)', 'ach. jauhari,st.,m.kOM.', 'bain khusnul khotimah,st.,m.kOM.', 'Universitas Trunojoyo Madura merupakan salah satu kampus besar yang berada dipulau Madura, memiliki\r\nbeberapa fakultas dan salah satunya Fakultas Teknik. Fakultas teknik memiliki 6 (enam) jurusan yaitu,\r\nTeknik Informatika, Teknik Industri, Manaajemen Informatika, Mekatronika, Multi Media dan Jaringan dan\r\nTeknik Elektro. Dengan banyaknya jurusan yang ada di Teknik akan menimbulkan kesulitan dalam\r\nmelakukan pendataan terhadap mahasiswanya yang telah lulus atau alumni mahasiswa teknik karena\r\ndisebabkan tidak terdapat sebuah sistem yang mendata alumni fakultas teknik. Untuk itu diperlukan sebuah\r\nsistem yang bisa melakukan pendataan terhadap alumni mahasiswa fakultas teknik yang telah lulus agar tetap\r\nterjalin tali silaturrahmi baik antara pihak fakultas teknik dengan mahasiswa yang telah lulus, maupun\r\nsesama mahasiswa. Oleh karena itu, berangkat dari sebuah permasalahan diatas maka peneliti mencoba\r\nmerancang dan membuat sebuah sistem pendataan alumni berbasis framework codeigniter. system pendataan\r\nalumni teknik ini mempunyai beberapa peranan diantaranya mempererat tali silaturrahmi keluarga besar\r\nfakultas teknik Universitas Trunojoyo Madura, berbagi informasi lapangan pekerjaan, informasi yang\r\nberkaitan dengan pendidikan misalnya ingin melanjutkan ke tingkat magister. Setelah sistem dirancang dan\r\ndi implementasikan maka diperoleh kesimpulan hasil respon aplikasi sistem informasi pendataan alumni\r\nberbasis web berupa kuisioner kepada Admin dan alumni mendapatkan respon positif dengan presentasi total\r\nrespons admin adalah sebesar 83,33% dan alumni adalah sebesar 100%.', 'moh. fahat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/090411100142'),
(316, '100411100001', 'MANAJEMEN HOTSPOT USER ACCOUNT DAN ROUTER PADA MIKROTIK \r\nROUTEROS MENGGUNAKAN API MIKROTIK ROUTEROS ', 'Iwan Santosa S.T M.T', 'Dwi Kuswanto S.Pd M.T', 'Maraknya penggunaan internet sebagai salah satu sumber informasi dan sebagai sarana \r\nuntuk  berinteraksi  sosial  pada  saat  ini  mendorong  masyarakat  untuk  mencari  cara  agar \r\ndapat terhubung dengan internet. Karena banyaknya  kebutuhan sebuah koneksi internet \r\nyang  mudah  dan  dapat  diakses  dari  mana  saja  ini  muncul  berbagai  macam  Warung \r\nInternet(warnet)  yang  menyediakan  fasilitas  hotspot  wifi  baik  itu  yang  bersifat  terbuka \r\nuntuk  umum  maupun  yang  berbayar.  MikroTik  sebagai  salah  satu  vendor  jaringan \r\nmenyediakan  sebuah  solusi  hardware  untuk  membuat  mini  ISP  via  Hotspot.  Tujuan \r\nutama dari penelitian ini adalah untuk membuat sebuah manajemen pengguna dan router \r\ndalam  sebuah  perangkat  lunak  secara  bersamaan  yang  dapat  digunakan  baik  secara \r\nremote  maupun  datang.  Perangkat  lunak  ini  dibuat  dengan  berbasis  PHP  dan \r\nmenggunakan  API  MikroTik  RouterOS.  Dengan  harapan  saat  melakukan  pengaturan \r\npengguna dapat lebih dipermudah dengan bantuan adanya GUI berbasis web bukannya \r\nharus  mengandalkan  salah  satu  sistem  operasi  karena  pada  umumnya  pengaturan  ini \r\nmasih sangat mendasar dan meski bisa dijalankan di berbagai sistem operasi pun, untuk \r\nmengubah  tampilannya  juga  akan  dirasakan  lebih  sulit  dan  sangat  rentan  terjadi \r\nkerusakan  perangkat  keras  apabila  dijalankan  oleh  seorang  administrator  yang  kurang \r\nmengenal seluk beluk sebuah jaringan. Dan dengan adanya sistem ini user secara mandiri \r\ndapat  melakukan  pendaftaran  dan  pemesanan  paket  melalui  web  tanpa  perlu  datang \r\nterlebih dahulu', 'Luqman Harris M', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100001'),
(317, '100411100002', 'IMPLEMENTASI DAN ANALISIS QUALITY OF SERVICE JARINGAN LAN DAN VLAN TRUNKING PADA LAB TERPADU UTM', 'DWI KUSWANTO,S.Pd., M.T.', 'ACHMAD UBAIDILLAH MS,S.T.,M.T.', 'VLAN merupakan sebuah cara untuk memecah Jaringan menjadi beberapa Jaringan (segmen) yang lebih kecil. Tujuan VLAN adalah untuk memperkecil jumlah traffic broadcast pada masing-masing subnet. VLAN digunakan untuk mengatasi kekurangan yang ada pada LAN, seperti penggunaan  alat-alat jaringan yang kurang efisien. Ada beberapa mode VLAN salah satunya yaitu mode Trunking dimana mode trunk ini mempunyai kecepatan yang sangat tinggi (100 s.d 1000 Mbps) dan mode trunk ini dapat menghubungkan bebrapa VLAN yang berbeda, sehingga konsep VLAN trunking banyak digunakan oleh masyarakat maupun perusahaan.\r\nDalam tugas akhir ini akan dilakukan analisis Quality of Service pada jaringan LAN dan VLAN Trunking pada Lab terpadu UTM. Dari hasil analisis yang telah dilakukan, diperoleh bahwa jaringan VLAN Trunking lebih unggul dari pada jaringan LAN , dilihat dari paramter delay dan jitter hampir semua nilai delay dan jitternya cenderung lebih kecil jaringan VLAN Trunking, sedangkan dilihat pada trhoughput disini jaringan LAN lebih unggul dari pada jaingan VLAN akan tetapi dalam keadaan jaringan terbebani trafik yang kecil. Hal tersebut dibuktikan ketika  trafik  pada jaringan ditambah maka jaringan VLAN Trunking lebih unggul dari pada LAN. Packet loss disini masih belum bisa didapat karena skala jaringan yang diukur masih dalam skala kecil sehingga paket yang loss masih 0%.\r\n', 'UMAR FARUQ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100002'),
(318, '100411100003', 'PEMBUATAN SISTEM INFORMASI IURAN SEKOLAH DI SMA NEGERI 1 GALIS PAMEKASAN DENGAN METODE FAST\r\n(Framework for Application of System Thinking)', 'Rika Yunitarini, S.T.,M.T', 'Andharini Dwi Cahyani, S.Kom.,M.Kom.', 'SMA Negeri 1 Galis Pamekasan adalah salah satu sekolah negeri di kabupaten pamekasan yang terletak di daerah pedesaan namunsudah mulai mengenal kecanggihan teknologi. Akan tetapi SMA Negeri 1 Galis dalam pengolah keuangan masih menggunakan sistem manual yang kurang efisien dan efektif. Pada satu sisi, SMA Negeri 1 Galis menginginkan suatu sistem yang dapat mempermudah pengolahan data keuangan sekolah.\r\nOleh karena itu pada penyusunan tugas akhir ini akan membuat Sistem Informasi Iuran Sekolah dengan menggunakan metode FAST (Framework for Application of System Thinking) dan menggunakan PHP dan MySQL.\r\nSetelah sistem dirancang, sistem dapat mengakomodasi kebutuhan dalam mempermudah dan mempercepat kinerja staf Tata usaha khususnya bagian keuangan. Dari uji obyektifitas yang dilakukan terhadap 16 responden, mendapatkan hasil±85% responden menyatakan sangat setuju terhadap sistem informasi iuran sekolah yang di bangun.\r\n\r\nKata Kunci :Sistem Informasi Iuran, Sekolah, Metode FAST, SMA Negeri 1 Galis Pamekasan.', 'Faridhatul Jannah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100003'),
(319, '100411100004', 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI MERK DAN TIPE KELAS SEPEDA MOTOR UNTUK CALON PEMBELI MENGGUNAKAN KLASIFIKASI NAÏVE BAYESSIAN', 'Hermawan, S.T., M.Kom', 'Rika Yunitarini S.T., M.T', 'Sepeda motor merupakan salah satu alat transportasi yang di gemari masyarakat karena memiliki ukuran yang kecil, cepat dan harga yang tidak terlalu mahal di bandingkan alat transportasi lainya. Sekarang banyak macam varian sepeda motor lengkap dengan keunggulan dan kelebihannya. Hal ini tentunya akan mempersulit konsumen dalam menentukan pilihan yang tepat, sesuai dengan kriteria yang diinginkan. Untuk memudahkan pembeli dalam memilih sepeda motor yang sesuai dengan keinginannya dirancanglah sebuah sistem pendukung keputusan untuk menentukan sepeda motor yang sesuai. Dimana sistem pendukung keputusan yang dirancang berbasis web sehingga mudah di akses dimanapun dan kapanpun dengan media internet. Dan sistem ini dibangun dengan perhitungan dengan menggunakan klasifikasi NAÏVE BAYESIAN sehingga akurasi perhitungan lebih terjamin. \nDari Penelitian ini dapat dihasilkan akurasi klasifikasi pengambilan keputusan dengan akurasi sebesar 56%.\n', 'Irfan Dzulkarnain Adyaksa', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100004'),
(320, '100411100006', 'RANCANG BANGUN SISTEM INFORMASI GEOGRAFIS PENGIRIMAN SOAL UAN BERBASIS WEB DENGAN MENGGUNAKAN ALGORITMA A* (Studi Kasus: SMAN se-SURABAYA) ', 'Mula\'ab, S.Si., M.Kom', 'Rika Yunitarini, ST., MT', 'Kendaraan merupakan suatu alat transportasi primer yang dibutuhkan oleh manusia yang pada kenyataannya hampir setiap hari kendaraan digunakan untuk aktivitas bekerja maupun aktivitas yang lain. Permasalahan yang diangkat pada tugas akhir ini adalah pengiriman soal Ujian Akhir Nasional (UAN) yang ada di SMAN (Sekolah Menengah Atas Negeri) di Surabaya. Salah satu upaya untuk mengatasi permasalahan tersebut yaitu dengan memanfaatkan Sistem Informasi Geografis, sedangkan untuk mengetahui posisi dan keberadaan kendaraan dapat dilakukan dengan sistem pengiriman melalui aplikasi Gammu berbasis web. Dalam mengimplementasikannya, penelitian ini menggunakan algoritma A* untuk pencarian rute terpendek jalannya demi mencapai tempat tujuan. \r\n\r\nKata kunci : gis, algoritma a*, gammu\r\n', 'Kurnia Candra Wati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100006'),
(321, '100411100007', 'PERANCANGAN APLIKASI PEMBELAJARAN RAGAM BUDAYA INDONESIA', 'ACHMAD JAUHARI, S.T., M.KOM', 'SIGIT SUSANTO PUTRO, S.KOM., M.KOM', 'Memanfaatkan keunikan Indonesia yang memiliki berbagai macam kebudayaan dan juga teknologi untuk mengakses suatu informasi secara cepat,akurat dan fleksibel. Dengan adanya aplikasi ragam budaya ini proses pencarian informasi mengenai kebudayaan tidak lagi hanya dengan membeli buku, namun sudah bisa dikases dengan dukungan internet. Pembuatan aplikasi ragam budaya ini menggunakan bahasa pemrograman PHP dan sebagai aplikasi pendukung lainnya yaitu Flash. Hasil dari penelitian menunjukkan bahwa Aplikasi pembelajaran ini sangat membantu masyarakat dalam memahami keragaman budaya Indonesia sebanyak 72% dan 68% menyatakan bahwa tampilan secara keseluruhan pada aplikasi baik serta memotivasi masyarakat sebanyak 56% untuk mencoba mempelajari tentang ragam budaya Indonesia.\n\nKata kunci :  Indonesia, Budaya, Aplikasi Pembelajaran, PHP\n', 'ANINDHITA REZKI SETAWATI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100007'),
(322, '100411100008', 'Informasi Pesan Dan Alarm Pendeteksi Kecepatan Kepada Pengendara Menggunakan Sistem Inferensi Fuzzy Sugeno Untuk Mengurangi Kecelakaan Lalu Lintas', 'Dr. Indah Agustien Siradjuddin, S.Kom, M.Kom.', 'Moch. Kautsar Sophan, S.Kom, M.T.', 'Seiring dengan perkembangan otomotif, fasilitas jalan dan infrastuktur seperti jalan tol, jembatan layang dan lain-lain, ternyata semakin tinggi pula presentase kecelakaan setiap tahunnya, hal itu disebab kurangnya kewaspadaan dalam berkendara, seperti mengantuk, pelanggaran lalu lintas, mengkonsumsi alkohol dan sebagainya. Kecelakan-kecelakaan yang terjadi tidak hanya merugikan pengendara bahkan membahayakan para pengguna jalan lainnya. Pada penelitian ini, aplikasi warning speed dibangun dengan menggunakan bahasa pemrograman Java.  Sedangkan media implementasi yang dipilih adalah smartphone yang berbasis Android. Pada aplikasi warning speed ini mengimplementasikan sistem inferensi fuzzy (SIF) sebagai kecerdasan buatan (Artificial Intelligence/AI) untuk memetakan suatu ruang input kedalam suatu ruang output. Fuzzy  logic  memiliki  fungsi  keanggotaan  (Membership Function) yang mempresentasikan masalah dan menghasilkan keputusan yang  akurat. Dari penelitian ini diperoleh kesimpulan bahwa sistem inferensi fuzzy dapat diterapkan pada aplikasi warning speed. Dengan menggunakan sistem inferensi fuzzy ini dapat menentukan output peringatan berupa alarm dan pesan.\r\n\r\nKata Kunci: android, sistem inferensi fuzzy, smartphone, AI (Artificial Intelligence).\r\n', 'Bachmid Iqbal', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100008'),
(323, '100411100009', 'Perancangan aplikasi pembakaran kalori\r\n(burn calory) berbasis android \r\n', 'Moch. Kautsar Sophan, S.Kom, M.T.', 'Dr. Indah Agustien Siradjuddin, S.Kom, M.Kom.', 'Olahraga merupakan salah satu aktivitas fisik yang dapat menyehatkan tubuh seseorang, olahraga memberikan banyak sekali keuntungan bagi tubuh, tidak hanya bagi tubuh yang sehat bahkan bagi mereka yang mengidap sebuah penyakit. Banyak sekali faktor yang membuat seseorang malas berolahraga, alasannnya bermacam-macam dikarenakan berpikir akan lelah setelah melakukannya tetapi paling umum adalah tidak punya banyak waktu untuk berolahraga. Membakar kalori itu haruslah berolahraga, namun bagaimana membakar kalori tanpa berolahraga, beberapa aktivitas yang dilakukan sehari-hari atau melakukan hobi dapat menjadi alternatif untuk membakar kalori, banyak diantara kita yang tidak sadar bahwasanya melakukan aktifitas sehari-hari dapat membakar kalori. Aplikasi ini dibangun pada platform Android dengan menggunakan bahasa pemrograman java dan sebagai media penyimpannya menggunakan SQlite. Pada aplikasi Burn Calory terdapat sebuah rumus untuk menghitung pembakaran kalori. Mets adalah pendekatan pengukuran untuk menentukan tingkat aktivitas fisik. Dari penelitian ini dapat diperoleh kesimpulan bahwa rumus untuk menghitung pembakaran kalori dapat diterapkan pada aplikasi Burn Calory. \r\n\r\n\r\nKata Kunci: Burn Calory, android, smartphone, Mets\r\n', 'Fachmi Rosady', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100009'),
(324, '100411100010', 'Rancang Bangun Game Lost Bullrace Menggunakan Metode Finite State Machine (FSM)', 'Arik Kurniawati, S.Kom., M.T.', 'Andharini Dwi Cahyani, S.Kom., M.Kom.', 'Madura pulau di Indonesia lepas pantai timur laut Jawa yang dikenal sebagai pulau yang memiliki kekayaan budaya yang banyak, beragam dan sangat bernilai. Salah satu budaya Madura yang sangat terkenal hingga manca negara adalah Karapan Sapi. Kerapan Sapi  ini merupakan perlombaan pacuan sepasang sapi yang menarik semacam kereta dari kayu tempat joki berdiri dan mengendalikan jalan sapi dengan cepat dengan diiringi lagu Madura yang disebut saronen. Sapi akan berlari dengan energik yang dikendalikan oleh joki dengan memecut sapi karapan. Seiring dengan berkembangnya teknologi maka diciptakan game yang mengangkat budaya Madura yaitu Karapan Sapi. Game ini dibangun menyerupai dengan game Subway Surfers dengan genre arcade and action dengan grafis 2 dimensi dimana pemain sebagai sapi karapan harus dapat menghindari kejaran sakera. Pengembangan ini didukung dengan metode Finite State Machine (FSM) yang digunakan untuk membantu pemilihan keputusan bergerak untuk karakter sapi dan melakukan pemecahan behaviour (kebiasaan aturan main) dari objek berdasarkan state (keadaan) yang memiliki aturan masing-masing, sehingga dapat merubah state satu ke state yang lain. Perancangan game ini bertujuan untuk mengenalkan Karapan Sapi sebagai budaya Madura pada manca negara dengan menggunakan inovasi berupa game. Selain itu bertujuan untuk menghibur pemain dengan berbagai variasi hiburan, diantaranya skenario dan tampilan grafis yang menarik. \r\n\r\nKata kunci: kerapan sapi, game, FSM', 'Retno Wulan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100010'),
(325, '100411100011', 'Rancang Bangun Game Mobile Edukasi Matematika dengan Memanfaatkan Library Android Speech', 'Dr. Arif Muntasa, S.Si., M.T.', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Smartphone saat ini bukan lagi menjadi barang mewah bagi masyarakat Indonesia pada umumnya. Melalui smartphone, seseorang dapat menikmati berbagai macam hiburan, seperti aplikasi, pemutar musik, buku elektronik, internet, dan game (permainan). Aplikasi yang paling populer adalah game. Game merupakan media hiburan yang murah dan menarik terutama bagi anak-anak. Beragam jenis game dengan tampilan dan tingkat kesulitan yang menantang membuat game menjadi aplikasi yang digemari oleh hampir seluruh kalangan pengguna smartphone. Oleh karena itu, pada Tugas Akhir (TA) ini dibangun sebuah game untuk Android mobile. Dalam penelitian ini, diciptakan sebuah game bernama GASING (Gampang, Aisk, Menyenangkan) menggunakan teknologi speech recognition atau pengucapan suara yang bertujuan untuk mempermudah serta memotivasi dalam belajar matematika. Matematika dianggap pelajaran yang sulit, rumit dan membosankan oleh kebanyakan peserta didik. Pemahaman salah ini mengakibatkan anak-anak pun ikut enggan untuk mempelajari matematika. Dalam game ini dibangun dua mode permainan, yaitu single player dan multiplayer (maksimal 2 pemain). Mode single player, pemain melawan sistem yang tersedia 5 level dengan jumlah soal dan kesulitan berbeda-beda. Sedangkan mode multiplayer, pemain melawan pemain lain menggunakan bluetooth sebagai media perantaranya. Inti game ini adalah pemain hanya menjawab soal matematika dengan pengucapan angka dalam bahasa indonesia yang baik dan benar.', 'Habibie Ed Dien', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100011'),
(326, '100411100012', 'PERANCANGAN SISTEM INFORMASI PENERIMAAN SISWA BARU DI SMA NEGERI 2 BANGKALAN MENGGUNAKAN METODE FUZZY ANALYTICAL HIERARCHY PROCESS ( FAHP ) SYNTHETIC EXTEND ANALYSIS (SEA).', 'Rika yunitarini, S.T., M.T.', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'SMA Negeri 2 merupakansalahsatuinstansipendidikan yang berada di kabupatenBangkalan. Selamainipencatatan data siswa SMA Negeri 2 Bangkalanmasihmenggunakansistem manual danbelumefisien, darisistempengolahan data sebelumnyaakanmenjadihambatanbagi yang membutuhkanlayananinformasi. Maka dari itu SMAN 2 Bangkalan membutuhkan suatu sistem yang dapat memprmudah pengolahan data siswa yang akan diterima.\r\nOleh karema itu pada penyusunanan tugas akhir ini akan merancang Sistem Informasi Penerimaan Siswa baru dengan menggunakan metode FAHP. Penyeleksian PSB melalui aplikasi website ini menggunakan bahasa pemrograman PHP dan MYSQL.\r\nSetelah sistem dirancang sistem dapat memenuhi kebutuhan dalam mempermudah dan mempercepat kinerja guru dan staff yang bertugas dalam mengelola data siswa baru yang akan diterima. Dari uji obyektifitas yang silakukan terhadap 16 responden, mendapatkan hasil ±90% responden menyatakan sangat setuju terhadap sistem Sistem Informasi Penerimaan Siswa baru yang dibangun.', 'zulfiyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100012'),
(327, '100411100013', 'RANCANG BANGUN APLIKASI SISTEM INFORMASI MONITORING AKADEMIK SEKOLAH (SIMAS) BERBASIS MULTI PLATFORM MENGGUNAKAN STANDAR KURIKULUM 2013', 'Achmad Jauhari, ST., M.Kom', 'Moch. Kautsar Sophan, S.Kom.,M.MT.', 'Perkembangan teknologi informasi dan telekomunikasi yang sangat pesat pada era sekarang, telah membantu baik dikalangan instansi maupun perusahaan dalam penyebaran informasi. Dengan adanya alat komunikasi seperti internet dan alphanumeric atau yang lebih dikenal dikalangan masyarakat umum dengan SMS (Short Massage Service), telah menjadi konsumsi sehari-hari. Dengan memanfaatkan fitur-fitur yang ada pada SMS di telepon genggam dan fasilitas internet, diharapkan Aplikasi Sistem Informasi Monitoring Akademik Sekolah (SIMAS) dapat membantu untuk memudahkan pihak sekolah yaitu SMKN 1 Sumenep dalam penyebaran informasi baik melalui web mobile maupun SMS Gateway kepada masing-masing siswa dan wali murid, agar menghindari diskomunikasi antara pihak sekolah, siswa, dan walimurid.\r\n', 'Arik Kurniawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100013'),
(328, '100411100014', 'PENGEMBANGAN APLIKASI PENCARIAN SEMANTIK JUDUL TUGAS AKHIR MENGGUNAKAN KONSEP ONTOLOGI', 'FIRDAUS SOLIHIN, S.Kom., M.Kom', 'IWAN SANTOSA, ST., MT', 'Saat ini aplikasi pencarian yang dibuat untuk membantu menemukan informasi terkait tugas akhir yang relevan terkadang masih menemui kendala. Hal ini dikarenakan sistem pencarian yang dibuat untuk menemukan informasi terkait tugas akhir masih menggunakan konsep dan model yang menekankan pada kata kunci. Dengan konsep tersebut, seorang pencari informasi hanya memperoleh informasi yang sesuai dengan kata kunci yang digunakan. Sedangkan informasi yang memungkinkan terkait dengan kata kunci yang digunakan, tidak diperoleh oleh pengguna. Untuk mengatasi kekurangan ini, maka perlu dilakukan pengembangan aplikasi pencarian terkait tugas akhir. Metode yang cocok digunakan untuk mengembangkan aplikasi pencarian tersebut adalah dengan menerapkan metode semantik. Metode Semantik merupakan metode yang menerapkan keterkaitan antar informasi. Dengan digunakannya metode semantik, informasi yang diperoleh oleh pengguna, lebih spesifik dan sesuai dengan persepsi pengguna, karena aplikasi pencarian dengan metode semantik, menggali informasi yang memiliki hubungan keterkaitan dengan kata kunci yang digunakan pengguna. Tingkatan semantik yang digunakan untuk menerapkan kesamaan makna dan kemiripan bahasa disebut Ontologi. Aplikasi Semantik Berbasis Desktop ini dapat memberikan hasil pencarian yang tidak hanya menekankan pada kata kunci pengguna, namun dokumen yang memiliki keterkaitan dengan kata kunci juga ditampilkan.', 'BISMA ALFIAN IMANATA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100014'),
(329, '100411100016', '“RANCANG BANGUN SISTEM INFORMASI UNIT KEGIATAN MAHASISWA”\r\n(Studi Kasus : Universitas Trunojoyo Madura)\r\n', 'Sigit Susanto Putro, S.Kom. M.Kom.', 'Mulaab, S.Si., M.Kom.', 'Semakin berkembangnya sebuah organisasi di Universitas Trunojoyo Madura dibutuhkan sebuah sistem informasi untuk mempermudah aktifitas pelaporan unit kegiatan mahasiswa. Pada awalnya unit kegiatan mahasiswa  melaporkan aktifitas program kerja, proposal kegiatan, laporan pertanggung jawaban kegiatan, prestasi, dan pendaftaran anggota unit ukm melalui cara manual. Hal ini menyebabkan data setiap transaksi rawan terjadi kesalahan dan hilangnya data. Oleh karena itu penulis membuat sebuah solusi untuk meminimalisir kejadian tersebut dengan merancang sebuah sistem informasi unit kegiatan mahasiswa khususnya di fakultas teknik. \r\nDengan adanya sistem informasi unit kegiatan mahasiswa seluruh data transaksi menjadi lebih tertata dalam pengarsipan aktifitas pelaporan. Sehingga kader organisasi selanjutnya dapat memanfaatkan dokumentasi yang telah tesedia. Sedangkan pengujian tugas akhir ini menggunakan data bersumber dari masing-masing unit kegiatan mahasiswa di universitas trunojoyo madura.\r\nKata Kunci : Unit Kegiatan Mahasiswa, Program Kerja, Proposal Kegiatan, Laporan Pertanggungjawaban, Prestasi, Pendaftaran Anggota\r\n', 'Arif Rakhman Hadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100016'),
(330, '100411100017', 'PERBANDINGAN METODE BACKGROUND SUBTRACTION UNTUK MOTION DETECTION', 'Dr. Indah Agustien, S.Kom., M.Kom.', 'Dr. Arif Muntasa, S.Si., M.T.', 'Deteksi gerakan merupakan subjek penting dalam bidang computer  vision. Telah banyak aplikasi yang menggunakan deteksi gerakan, contohnya  sistem   yang  digunakan pada aplikasi video pengawas, kompresi video, monitoring traffic, perhitungan kecepatan, dan lain-lain. Motion detection secara umum dilakukan melalui tiga tahapan. Pertama, di dalam mendeteksi gerakan adalah proses identifikasi komponen background. Kedua, dilakukan proses pengurangan frame terhadap background untuk mengisolasi komponen gerakan pada citra. Ketiga, dilakukan perbandingan hasil pengurangan dengan Threshold  yg telah di tentukan. Proses segmentasi background dilakukan menggunakan beberapa metode. Beberapa metode tersebut adalah metode Background  Subtraction dengan Static Background, Mean Filter, dan Running Average.  Metode-metode tersebut dibandingkan untuk mendapatkan atau menentukan metode terbaik dalam mendeteksi  gerakan. Dari proses  yang telah dilakukan menggunakan Benchmart Dataset terdiri dari 7 data yaitu Bootstrap, Camouflage, MovedObject, ForegroundAperture, TimeOfDay, LightSwitch, dan WavingTrees yang masing-masing telah memiliki GroundTruth. Dapat disimpulkan bahwa proses pengambilan background terbaik adalah metode Background Subtraction dengan Static Background dengan nilai presentasi tertinggi yaitu 88,6%.', 'Fitriyatul Qomariyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100017'),
(331, '100411100018', 'Aplikasi Penerjemah Dari Bahasa Indonesia Ke Bahasa Madura Dengan Menggunakan Metode Rule Based', 'Fika Hastarita Rachman, ST., M.Eng.', 'Firdaus Solihin, S.Kom.,M.Kom.', 'Sedikitnya pengetahuan dan minimnya pola pelestarian tentang bahasa Madura menyebabkan bahasa tersebut kurang terjaga kelestarianya. Hal tersebut dikarenakan proses globalisassi dan urbanisasi yang berpotensi memicu terjadinya asimilasi dan akulturasi budaya, terutama didaerah perkotaan. Keadaan tersebut memicu terbentuknya bahasa baru (bahasa gaul) yang lebih disukai terutama oleh kalangan pemuda. Dan juga munculnya sekolah nasional dan internasional yang mewajibkan siswa untuk berkomunikasi menggunakan bahasa asing. Oleh karena itu, perlu adanya pola pembelajaran yang lebih efektif agar bahasa Madura tetap terjaga kelestariannya. Salah satunya dengan membuat aplikasi penerjemah dari bahasa Indonesia ke bahasa Madura dengan menggunakan metode Rule Based. Aplikasi ini juga dibuat sebagai salah satu penyebaran dan pengenalan bahasa Madura ke masyarakat luar Madura sehingga bahasa Madura akan tetap terjaga kelestariannya karena aplikasi penerjemah ini mampu menerjemahkan dari bahasa Indonesia ke bahasa Madura dengan baik\r\nKata kunci: Kamus Lengkap Bahasa Madura, Enhanced Confix Stripping Stemmer, Rule Based.\r\n', 'Khotijah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100018'),
(332, '100411100020', 'RANCANG BANGUN DATA CENTER UKM (USAHA KECIL MENENGAH) MENGGUNAKAN SISTEM TERDISTRIBUSI DATABASE ORACLE BERBASIS E-COMMERCE', 'Bain Khusnul Khotimah, ST., M.Kom', 'Andharini Dwi Cahyani S.Kom, M.Kom', 'UKM (Usaha Kecil dan Menengah) adalah kegiatan ekonomi yang dilakukan oleh perseorangan atau rumah tangga maupun suatu badan, yang bertujuan untuk memproduksi barang ataupun jasa untuk diperniagakan secara komersial yang berada dibawah pengawasan Dinas Pemerintah. Untuk membantu UKM dalam melakukan pemasaran dan penjualan ialah sebuah sistem penjualan online yang berbasis E-Commerce yang digunakan untuk mencatat transaksi penjualan dan mampu menghasilkan informasi-informasi yang dibutuhkan. Sistem juga dapat diakses kapanpun dan dimanapun serta mampu menghasilkan informasi penjualan secara otomatis. Maka dari itu dibutuhkan pemusatan data atau Data Center sebagai wadah untuk mendukung keefektifan sistem dalam melakukan pengolahaan dan pengadministrasian data. Sehingga Data Center akan menjadi media pemusatan data serta penghubung akses antara UKM dan Dinas Pemerintah dalam pendistribusian data dan informasi. Untuk mendukung pengembangan konsep Data Center akan menggunakan sistem terdistribusi pada Data Center dan masing-masing UKM, karena sistem terdistribusi memiliki keuntungan meliputi pengawasan distribusi, reability, availability, kecepatan dalam pemprosesan query. Dengan dimplementasikan pembangunan Data Center dengan menggunakan sistem terdistribusi pada Dinas Pemerintah selaku yang menaungi UKM akan membantu dalam mengetahui informasi terbaru baik itu informasi perubahan data maupun penjualan produk dari UKM.', 'Andi Hartono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100020');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(333, '100411100021', 'IMPLEMENTASI KRIPTOGRAFI PADA APLIKASI INSTANT MESSAGING ANDROID MENGGUNAKAN MODIFIKASI VIGENERE CIPHER', 'Cucun Very Angkoso, S.T., M. T.', 'Dwi Kuswanto, S. Pd., M. T.', 'Instant messaging merupakan layanan teknologi komunikasi yang banyak digunakan oleh masyarakat. Layanan instant messaging menawarkan pengiriman pesan yang bersifat real-time. Banyak aplikasi yang menawarkan layanan instant messaging tetapi aplikasi tersebut belum tentu menjamin keamanan dari privasi pesan penggunanya. Salah satu solusi dari masalah keamanan privasi pesan aplikasi instant messaging yaitu dengan kriptografi. Algoritma kriptografi akan merahasiakan pesan dengan pengacakan karakter kemudian pesan tersebut dikirim oleh pengirim ke penerima sedemikian rupa sehingga pesan rahasia tersebut tidak bisa dibaca oleh orang yang tidak memiliki keterkaitan dengan pesan tersebut. Implementasi dilakukan pada aplikasi instant messaging di sistem operasi Android menggunakan algoritma vigenere yang dimodifikasi. Modifikasi dengan menggabungkan dua metode yaitu vigenere 95 dan vigenere 256 serta sistem pengolahan kunci khusus. Kemudian proses kriptografi akan dilakukan secara end-to-end di sisi klien sebelum pesan dikirim dan sebelum pesan dibaca oleh penerima. Implementasi kriptografi vigenere cipher yang sudah dimodifikasi pada aplikasi instant messaging di sistem operasi Android menghasilkan pertukaran data pesan yang relatif lebih aman.   ', 'Muhammad Aminur Rosyid', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100021'),
(334, '100411100022', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN UANG KULIAH TUNGGAL (UKT) DENGAN METODE NAIVE BAYES  \r\nDI UNIVERSITAS TRUNOJOYO MADURA\r\n', 'Bain Khusnul Khotimah,ST.,M.Kom.', 'Achmad Jauhari,ST.,M.Kom.', 'Mulai tahun ajaran 2013/2014 terdapat perubahan sistem pembayaran kuliah yang diterapkan kepada seluruh Perguruan Tinggi  Negeri (PTN) yang disebut dengan Uang Kuliah Tunggal (UKT). UKT merupakan besaran biaya yang dibayarkan oleh mahasiswa pada setiap semester berdasarkan kemampuan ekonominya. Sehingga besaran nilai UKT antara mahasiswa berbeda-beda. Besaran nilai UKT dibagi menjadi empat golongan, golongan pertama bernilai Rp.1000000, golongan kedua Rp.1800000, golongan ketiga Rp.2250000 dan golongan keempat bernilai Rp.2500000. Dalam penentuan UKT digunakan beberapa kriteria sebagai pertimbangan, yaitu penghasilan orang tua, PBB, PDAM,  daya listrik dan tanggungan keluarga.  Dengan perubahan sistem pembayaran kuliah yang baru tersebut Universitas Trunojoyo Madura (UTM) masih menentukan UKT secara manual, sehingga mengakibatkan banyak peluang terjadinya kesalahan, tingkat akurasinya rendah serta membutuhkan waktu yang lama, hal tersebut sangat kurang efisien dalam pengolahan data. Pada penelitian ini metode yang digunakan adalah Naïve Bayes, karena merupakan metode sederhana yang mudah diimplementasikan, mempunyai waktu komputasi yang cepat serta tingkat akurasinya tinggi. Dalam penentuan UKT digunakan dua metode pengolahan data, yaitu numerik dan kategorik.Hasil pengujian menunjukkan bahwa penentuan UKTdengan kedua metode pengolahan data tersebut mempunyai tingkat akurasi yang berbeda, penentuan UKT dengan metode pengolahan data numerik memiliki tingkat akurasi 88%,  sedangkan menggunakan metode pengolahan data kategorik memiliki tingkat akurasi 90%.', 'Ani Sholihah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100022'),
(335, '100411100024', 'PENERAPAN METODE GA-KMEANS UNTUK CLUSTERING DATA INDUSTRI KECIL DAN MENENGAH (IKM) DI DISPERINDAG BANGKALAN', 'Bain Khusnul Khotimah,ST.,M.Kom', 'Firli irhamni,ST.,M.Kom', 'Industri Kecil dan Menengah (IKM) merupakan industri berskala kecil dan menengah. IKM juga sebagai sektor industri penggerak perekonomian yang mampu memberikan kontribusi dalam penyerapan tenaga kerja. Perkembangan IKM di wilayah madura sendiri cukup meningkat pesat, seiring dengan perkembangan tersebut perlu perhatian khusus dari pemerintah guna meningkatkan potensi usaha masyarakat agar dapat memicu pertumbuhan IKM dan produktifitas IKM di Bangkalan.\r\nPeningkatan pertumbuhan IKM di Bangkalan diperlukan bantuan dari pemerintah untuk meningkatkan produktifitas suatu IKM. Oleh karena itu, Penelitian ini bertujuan untuk pengelompokan  data IKM berdasarkan karakteristiknya yang berhubungan dengan produktifitas IKM. Metode yang di gunakan untuk clustering data IKM ini adalah metode GA-Kmeans. Metode ini di gunakan karena menghasilkan kinerja yang lebih optimal dibandingkan dengan metode K-means sederhana, melalui proses clustering K-means sederhana yang titik pusatnya dioptimasi dengan Algoritma Genetika. Untuk evaluasi hasil clustering menggunakan SSE (Sum Square Error), Total Within Cluster Variation dan Total between Cluster Variation. Dari 2 uji coba diperoleh nilai Within GA-Kmeans lebih kecil di banding Kmeans , pada uji coba ke 2 nilai Between GA-Kmeans sebesar 0.264 dan K-means sebesar 0.124, jadi GA-Kmeans lebih besar dari K-means karena Cluster yang ideal mempunyai minimum Within dan maksimum Between. Hasil pengelompokan menghasilkan 3 cluster, 1 IKM sangat produktif, 53 IKM produktif dan 46 IKM kurang produktif.\r\n\r\nKata Kunci : IKM, Cluster, K-means, GA-Kmeans', 'Tri Sundarwati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100024'),
(336, '100411100026', '“Virtual Environment(VE) Kampus menggunakan Augmented Reality(AR) dan Geotagging Berbasis Teknologi Mobile Android”', 'Hermawan, S. T., M. Kom', 'Rika Yunitarini, ST., MT', 'Kampus merupakan lingkungan pendidikan perguruan tinggi yang  mempunyai banyak sarana belajar. Namun kurangnya informasi mengenai  lokasi fasilitas dan gambaran yang lebih lengkap, maka dapat digunakan layanan Location Based Service(LBS).Untuk meningkatkan daya tarik, keamanan dan informasi lokasi dapat digunakan Virtual Environment(VE) kampus untuk menggambarkannya. \r\nMelalui VE kampus pengguna dan stakeholder yang berkepentingan mendapatkan informasi fasilitas dengan objek – objek yang di inginkan secara real-time, dengan dukungan teknologi Augmented Reality(AR).\r\nPengembangan teknologi LBS dan AR dalam penelitian ini terdiri dari sistem pemetaan geotagging dan pengontrolan informasi visual. Sistem pemetaan geotagging digunakan sebagai  identifikasi geografis metadata pada media foto berdasarkan koordinat GPS berupa latitude dan longitude yang terekam pada perangkat mobile. \r\nPengontrolan informasi visual merupakan sistem monitoring dan pengontrolan video streaming, objek video dari webcam yang terpasang dilokasi, sistem tersebut diintregasikan pada LBS dan AR menggunakan pemetaan geotagging, informasi visual dikontrol menggunakan mikrokontroler pada perangkat Arduino. Dengan demikian penggunaan beberapa teknologi di atas memudahkan pencarian informasi dan pengontrolan visual pada fasilitas kampus sesuai hasil pegujian antar muka menggunakan FURPS (Functionality, Usability, Reliability, Performance, Supportability) pada koneksi server local dengan hasil rata-rata pemrosesan Fitur Detail Informasi 2.66 menit, sehingga pengguna dapat berinteraksi secara nyata.\r\nKata kunci : Augmented Reality(AR), Android, Arduino, Geotagging,Location Based Service(LBS), Virtual enveronment.\r\n', 'Yusuf Machsar', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100026'),
(337, '100411100027', 'MEDIA PEMBELAJARAN INTERAKTIF MENGENAL MERAKIT DAN MENGINSTAL KOMPUTER UNTUK PELAJARAN KOMPUTER', 'Achmad Jauhari, S.T., ', 'Sigit Susanto Putro, S.Kom., M.Kom ', 'Kebutuhan untuk menarik minat belajar siswa sangatlah perlu untuk mendukung kemudahan siswa dalam memahami sebuah pelajaran disekolah. Dengan adanya media pembelajaran berbasis WEB yang menggunakan bahasa pemroggraman PHP dan aplikasi pendukung lainnya yaitu Flash, akan menimbulkan rasa ketertarikan untuk belajar pelajaran komputer karena dalam  media ini terdapat beberapa animasi yang selama ini tidak siswa dapatkan di media pembelajaran lainnya seperti buku. Hasil survei menunjukkan 95% siswa menyatakan bahwa media pembelajaran ini lebih menarik dari media lain sebelumnya, 70% siswa menyatakan dengan media ini siswa dapat memahami materi dengan lebih mudah dan 75% menyatan mudah untuk digunakan. Selain itu tampilan media ini juga menarik, hanya kesesuaian materi yang masih perlu di sesuaikan lagi karena 55% siswa mengatakan bahwa materi yang ada masih kurang sesuai.\n\nKata kunci :  Media Pembelajaran, Komputer, PHP\n\n', 'MOH. SODIK', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100027'),
(338, '100411100028', 'SISTEM MONITORING SPBU MENGGUNAKAN ARDUINO', 'Cucun Very Angkoso, ST., M.T', 'Koko Joni, ST., M.Eng', 'SPBU merupakan salah satu tempat penyalur BBM yang memiliki peran penting. Namun, sistem pengecekan level BBM di SPBU sampai saat ini masih sangat sederhana. Misalnya alat yang digunakan untuk mendeteksi tangki masih menggunakan besi panjang sehingga sering terjadi kekosongan BBM tanpa terkontrol sebelumnya. Oleh karena itu, pada tugas akhir ini peneliti sudah selesai membuat suatu perancangan simulasi sistem monitoring level BBM dengan menggunakan sensor nirkabel menggunakan arduino.\r\nPenambahan  Augmented Reality (AR) pada Aplikasi monitoring SPBU dapat mempermudah pengendara mesindalam mencari informasi suatu SPBU terdekat.Dengan memanfaatkan teknologi Augmented Reality (AR) melalui penggunaan kamera, GPS, pada perangkat android aplikasi ini dapat memberikan informasi secara detail, akurat dan tampak nyata bagi pengguna.\r\nDalam penelitian ini penggunaan teknologi jaringan sensor nirkabel ini antara lain kita dapat melakukan pengotrolan atau pemantuan dari jarak jauh dan tanpa perantara kabel serta fleksibilitas dalam komunikasi jarak jauh dari titik letak sensor dan peningkatan akurasi secara menyeluruh secara terus menerus (real-time).\r\n', 'Wahedah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100028'),
(339, '100411100029', 'PENCARIAN RUTE TERPENDEK PADA PEMETAAN LOKASI PENDIDIKAN FORMAL DI KOTA BANGKALAN', 'Mula\'ab,S.Si.,M.Kom.', 'Rika Yunitarini,S.T.,M.T.', 'Sistem Informasi Geografis telah banyak dikembangkan, salah satunya digunakan untuk untuk pemetaan pencarian jarak terpendek dengan memanfaatkan PgRouting. Hal ini disebabkan PgRouting menyediakan fitur untuk jarak terpendek, sehingga tidak dapat dipungkiri banyak digunakan. Oleh karena itu, perlu adanya literatur yang lebih untuk pemanfaatan PgRouting salah satunya Algoritma Shooting-Star (Shooting*) berbasis web. \r\nWebGis ini menggunakan bahasa pemrograman PHP, Penanganan data spasial aplikasi tersebut menggunakan MapQuest, untuk data atribut menggunakan PostgreSQL PostGIS, serta QuantumGis untuk digitasi peta. Shooting-Star merupakan salah satu algoritma pencarian untuk rute terpendek pada graf berarah yang berada di dalam pgRouting.\r\nAlgoritma Shooting-Star berbasis Web dapat memberikan solusi untuk menentukan jarak terpendek menuju ke lokasi sekolah formal yang berada di kota Bangkalan dengan jarak tempuh dan waktu yang lebih efisien.\r\n', 'ZAHRATUL AINIYAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100029'),
(340, '100411100031', 'Pemanfaatan Metode Cluster SOM – IDB sebagai Analisa \r\nPengelompokan Penerimaan Beasiswa', 'Andharini Dwi Cahyani', 'Sigit Susanto Putro', 'Kebijakan pemerintah di bidang pendidikan menyangkut pembiayaan pendidikan, salah \r\nsatunya yaitu berkaitan dengan beasiswa. Beasiswa merupakan bantuan pembiayaan pendidikan \r\nyang berhak diterima bagi mahasiswa. Program beasiswa di khususkan untuk mahasiswa yang \r\nmempunyai  kriteria  yang  sudah  ditentukan.  Jenis  beasiswa  yang  diberikan  pada  mahasiswa \r\nyaitu  Peningkatan  Prestasi  Akademik  (PPA)  dan  Bantuan  Belajar  Mahasiswa  (BBM).  \r\nPenelitian  ini  bertujuan  untuk  mengelompokkan  penerimaan  beasiswa  dengan  SOM  (self \r\nOrganizing  Maps)-  Indeks  Davies-Bouldin  (IDB).  Data  penerimaan  beasiswa  dilakukan \r\npengelompokkan  (Clustering) menggunakan metode  SOM  (self Organizing Maps). Dilakukan \r\nValidasi data dengan Menggunakan Indeks Davies-Bouldin (IDB).  Dimana IDB dalam Metode \r\nSOM  bertujuan  untuk  meningkatkan  akurasi  validasi  hasil  analisa  data.  Dari  hasil  uji  coba \r\ndengan metode  SOM mampu mengelompokkan  data  yang  berdekatan  untuk  dicari  kemiripan \r\nberdasarkan pola, Kemiripan  data pada pengelompokan Beasiswa yang Menggunakan Cluster \r\n2,3,4 dan 5 dengan  learning rate awal 0.6. hasil IDB Cluster 2 = 0.5125  , Cluster 3 = 0.340  , \r\nCluster 4 = 0.098 , Cluster 5 = 0.197  dengan data yang digunakan 74. Jadi jumlah Cluster yang \r\npaling Homogen adalah 4 Cluster . Penambahan kriteria-kriteria lain yang berpengaruh terhadap \r\npengelompokan Penerimaan Beasiswa', 'Lilia Rahmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100031'),
(341, '100411100032', 'PEMBUATAN APLIKASI OLAP (ON-LINE ANALYTICAL PROCESSING) TINGKAT KELULUSAN MAHASISWA (STUDI KASUS FAKULTAS TEKNIK PROGRAM STUDI TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO MADURA)', 'SIGIT SUSANTO PUTRO, S.Kom., M.Kom', 'ACHMAD JAUHARI, S.T., M.Kom', 'Tingkat kelulusan mahasiswa merupakan salah satu faktor sangat penting dalam menentukankeberhasilan dari perguruan tinggi, salah satunya di Universitas Trunojoyo Madura. Perguruan tinggi yang bisa mencetak lulusan terbaik maka bisa dikatakan perguruan tinggi yang sukses dan berhasil mencetak sumber daya manusia handal dan berkualitas.Data yang digunakan adalahdata induk dandata kelulusan mahasiswa tahun lulusan 2009-2014. Atribut data induk yang digunakan adalah asal daerah dan proses jalur masuk, sedangkan atribut data kelulusan yang digunakan adalah lama studi dan tahun lulus. Penelitian ini diolah dengan menggunakan rancangan aplikasi OLAP (On-line Analytical Processing)dimulai dari proses pemilihan data, normalisasi tabel, membentuk dimensi tabel dan fakta tabel, proses ETL (Extract, Transform, and Load) dan terakhir hasil tampilan di web broser. Berdasarkan hasil penelitian diperoleh hasil lulusan terbaik dari asal daerah Kabupaten Pamekasan dengan jumlah lulusan 11 mahasiswa di tahun 2013, sedangkan lulusan terbaik berdasarkan jalur masuk dari PMDK dengan jumlah lulusan 37 mahasiswa di tahun 2013. \n\n\nKata kunci :Data Induk Mahasiswa, Data Kelulusan Mahasiswa, OLAP (On-line Analytical Processing).\n', 'DEWI MUZAYYANA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100032'),
(342, '100411100033', 'SISTEM INFORMASI AKADEMIK SEKOLAH BERBASIS WEB FRAMEWORK LARAVEL', 'Andharini Dwi Cahyani, S.Kom. M.Kom', 'Rika Yunitarini, S.T., M.T', 'Sistem Informasi Akademik adalah sistem komputerisasi atau teknik pemanfaatan komputer sebagai alat bantu proses yang dirancang dan dibuat untuk mengolah data-data yang berhubungan dengan informasi akademik. Dalam perkembangannya, kebutuhan akademik menjadi lebih kompleks yang dapat mempersulit dalam penyimpanan data dan memperlambat dalam penyampaian informasi. SMA Negeri 1 Lamongan adalah sekolah yang sedang mengembangkan teknologi komputer dalam berbagai aspek-aspek kegiatan belajar dan mengajar. \r\n	Dalam mengolah data dan penyampaian informasi akademik, SMA Negeri 1 Lamongan masih menggunakan aplikasi sederhana yang mempunyai kelemahan dalam proses penyampaian informasi akademik. Tujuan penelitian ini untuk membangun Sistem Informasi Akademik Sekolah yang dapat diakses secara online dan menggunakan SMS gateway. Pengembangan sistem ini menggunakan bahasa pemrograman PHP dengan web framework Laravel, menggunakan MySQL sebagai database, dan menggunakan Gammu sebagai SMS gateway. \r\n	Berdasarkan hasil respon petugas, kepala sekolah, guru, waka kurikulum dan siswa terhadap Sistem Informasi Akademik Sekolah Berbasis Web Framework Laravel, menunjukan respon yang positif dengan persentase total respon petugas sebesar 92,42% (sangat baik), persentase total respon kepala sekolah sebesar 92,31% (sangat baik), persentase total respon guru sebesar 86,36% (sangat baik), persentase total respon waka kurikulum sebesar 90,48% (sangat baik), dan persentase total respon siswa sebesar 93,33% (sangat baik).\r\n', 'Eky Arifkhi Wardhaya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100033'),
(343, '100411100034', 'SISTEM PENGUKURAN KINERJA UKM DENGAN MENGGUNAKAN METODE BALANCE SCORECARD', 'Bain Khusnul Khotimah, S.T. M.Kom.', 'Andharini Dwi Cahyani, S.Kom.,M.Kom', 'Pada tingkat persaingan global yang sangat kompetitif, setiap UKM memerlukan suatu sistem pengukuran kinerja yang dapat diukur secara periodik dan terarah. Sistem ini digunakan untuk melihat sejauh mana perkembangan dari UKM dan mengukur kinerja UKM yang satu dengan UKM yang lainnya. Dalam metode penilaian kinerja perusahaan umumnya menggunakan financial perspective. Dalam penelitian ini peneliti menggunakan metode Balance Scorecard. Metode ini merupakan pengembangan dari pengukuran kinerja secara tradisional yakni  pengukuran yang hanya di ukur pada perspektif keuangan saja. Metode Balance Scorecard ini, menggunakan empat perspektif, yakni Perspektif Keuangan, Perspektif Pelanggan, Perspektif Proses Bisnis Internal, dan Perspektif Pertumbuhan dan Pembelajaran. Dalam penelitian ini juga menggunakan Analytical Hierarchy Process (AHP) sebagai sistem pendukung keputusan. Metode ini digunakan untuk merepresentasikan suatu permasalahan yang kompleks kedalam struktur multi level hirarki. Dalam penelitian ini perusahaan yang menjadi objek penelitian adalah Usaha Kecil Menengah (UKM) di daerah bangkalan, yaitu UKM Nusa Indah, UKM HMF/HJ.UNYIL, dan UKM Al-Madani. Dari hasil penelitian ini diperoleh tingkat kinerja yang paling dominan adalah UKM Nusa Indah dengan nilai kinerja 3,34 sedangkan tingkat kinerja UKM yang paling lemah adalah UKM Al-Madani dengan nilai kinerja 1,72.\r\n\r\nKata kunci : Sistem Pengukuran Kinerja, Usaha Kecil Menengah (UKM), Balance Scorecard, Analytical Hierarchy Process', 'Moh. Zein Saedi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100034'),
(344, '100411100035', 'SEGMENTASI PEMBULUH DARAH RETINA PADA CITRA FUNDUS MATA BERBASIS SKELETON DAN PRUNNING', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Panca indra pada manusia sangat rentan terhadap penyakit terutama pada indra pengelihatan yaitu mata. Beberapa penyakit yang dapat teridentifikasi pada organ mata salah satunya adalah penyakit mata diabetes atau Diabetic Retinopathy (DR). Indikasi penyakit Diabetic Retinopathy (DR) berupa ketidaknormalan mata yang ditandai dengan gangguan kerusakan pembuluh darah kapiler pada jaringan yang berfungsi sebagai sensor cahaya (retina). Pendeteksian yang dilakukan sejak dini dapat memberikan tindakan perawatan yang sesuai. Oleh sebab itu, identifikasi ketidaknormalan pembuluh darah dapat dilakukan dengan cara segmentasi yang merupakan langkah untuk memudahkan penelitian karakteristik pembuluh darah retina dengan penyediaan pemetaan. Pada penelitian Tugas Akhir ini, segmentasi pembuluh darah retina terdiri dari dua tahap, yaitu preprocessing dan segmentasi. Tahap pertama preprocessing citra dilakukan dengan mengambil citra RGB (Red, Green, Blue) ke Green Channel, memperbaiki kontras citra dengan Contrast limited Histogram Equalization (CLAHE), dan untuk menghilangkan noise dengan median filter. Tahap kedua segmentasi citra dilakukan dengan Morphological Skeleton citra, Pruning citra dan dilasi. Selanjutnya dilakukan perhitungan tingkat akurasi dengan Ground Truth-nya. Pengujian menggunakan database DRIVE (Digital Retinal Image for Vessel Extraction) sebanyak 20 citra. Metode Skeleton dan Prunning mampu mensegmentasi dengan baik yang dibuktikan dengan hasil akurasi segmentasi dibandingkan dengan citra Ground Truth sebesar 86,96%.\r\nKata kunci: Segmentasi pembuluh darah retina, Sekeleton,', 'TRI INDAH KARTIKASARI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100035'),
(345, '100411100036', 'RANCANG BANGUN APLIKASI PEMBELAJARAN BAHASA MADURA', 'Achmad jauhari, S.T., M.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Teknologi informasi yang berkembang dengan cepat, menjadikan kebutuhan akan suatu konsep dan mekanisme belajar mengajar (pendidikan) berbasis TI menjadi sangat dibutuhkan. Hal ini menjadikan pembelajaran e-learning  menjadi salah satu alternatif untuk media pembelajaran. Begitu juga dengan pelajaran bahasa Madura perlu pembelajaran berbasis teknologi . Maka dari itu, peneliti merancang dan membangun aplikasi pembelajaran bahasa Madura untuk meningkatkan minat siswa belajar Bahasa Madura. Aplikasi ini dibangun menggunakan bahasa pemrograman web PHP,database MySQL, dan animasi berbasis flash. Data diperoleh melalui kuisioner. Data dianalisis secara deskriptif menggunakan tabel dan prosentase. Hasil penelitian menunjukkan bahwa Aplikasi ini dapat membanttu siswa dalam belajar Bahasa Madura sebesar 90%. Dan 70% siswa menyatakan aplikasi ini mudah untuk digunakan. Dan  80% tampilan aplikasi ini menarik. Kesesuaian materi diaplikasi ini sebesar 45% , hal ini berarti materi aplikasi ini perlu diseusaikan. Dan 70% aplikasi ini dapat meningkatkan minat siswa dalam belajar Bahasa Madura.\n\nKata Kunci : Media Pembelajaran, Pembelajaran Bahasa Madura, E-Learning\n', 'Faridatul Jannah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100036'),
(346, '100411100037', 'rancang bagun game maze sebagai game edukasi bahasa inggris pada anak', 'Arik Kurniawati, S.Kom, M.Kom', 'Moh Kautsar Sophan,S.Kom,M.MT', 'ABSTRAK\r\nPada era teknologi yang modern, game tidak hanya sekedar dibuat untuk bermain saja tetapi juga digunakan untuk suatu pembelajaran. Anak - anak telah memainkan berbagai jenis game, salah satu jenis game yang akan di buat dalam Tugas Akhir (TA) ini adalah game maze. Game maze merupakan sebuah permainan yang bertujuan menentukan jalur yang tepat untuk menuju tempat yang telah ditetapkan. Game ini memiliki jalur yang rumit dan berliku-liku, sehingga dapat melatih logika dan imajinasi pada anak. Game maze ini akan berisi edukasi pembelajaran berbahasa inggris. Karena, saat ini ketertarikan seorang anak pada pelajaran bahasa inggris masih rendah, selain itu bahasa inggris merupakan bahasa yang sulit diterapkan oleh anak. Bahasa inggris hanya digunakan didalam kelas dan dalam waktu terbatas dengan metode belajar yang membosankan dan kurang menarik. Oleh karena itu, game ini dirancang menjadi game yang menarik, menyenangkan dan dapat meningkatkan kemampuan bahasa inggris anak. \r\n', 'nurul maulida', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100037'),
(347, '100411100039', 'VISUALISASI GAME RPG DENGAN CERITA RAMAYANA BERBASIS WINDOWS PHONE', 'Yonathan Ferry Hendrawan, S.T., MIT.', 'Moh. Kautsar Sophan, S.Kom, M.MT', 'Pada penelitian sebelumnya terdapat sebuah game RPG berlatar cerita Ramayana. Gameplaynya terdiri dari mode jalan – jalan dan mode battle. Pada mode jalan – jalan, terkadang secara tiba – tiba akan ada pemberitahuan yang menyatakan pemain menemukan item atau pemain bertemu musuh. Pada mode battle, untuk  giliran tiap karakter memiliki urutan yang tetap. Namun, game ini masih berbasis text. Penelitian ini melanjutkan penelitian sebelumnya dengan membuat tampilan dari game cerita Ramayana berbasis Windows phone. Pada game ini, juga ada dua mode, yaitu Mode Jalan-jalan dan Mode Battle. Untuk item akan disembunyikan dibalik asset seperti batu, semak dan pohon, sehingga pemain harus mencari item tersebut. Untuk giliran penyerangan menggunakan konsep ATB (Active Time Battle). Tiap karakter memiliki isi waktu yang terus bertambah dan panjang waktu yang telah ditentukan. Karakter akan mendapatkan giliran ketika isi panjang waktunya telah terpenuhi dan setelahnya, isi panjang waktu karakter akan menjadi nol lagi. Proses tersebut akan berulang hingga mode battle berakhir. Hasil pengujian game ini dapat bejalan dengan baik pada emulator dan smartphone windows phone. Untuk hasil pengujian pada pengguna, 80% pengguna mengatakan game ini memiliki tampilan yang menarik. 90% pengguna menyukai memahami cerita Ramayana dengan cara bermain game dan 70%nya ingin untuk melanjutkan bermain game ini hingga akhir.\r\n\r\nKata Kunci: Game, Role Playing Game, ATB (Active Time Battle), Ramayana, Windows Phone.', 'Isma Iffatus Saaihah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100039'),
(348, '100411100041', 'PERANCANGAN DAN PEMBUATAN DIGITAL LIBRARY DENGAN MENGGUNAKAN METODE K-NEAREST NEIGHBOR (KNN)', 'Firdaus Solihin,S.Kom.,M.Kom', 'Rika  Yunitarini, ST., M.T.', 'Seiring perkembangan teknologi dan cepatnya aliran data maka kebutuhan informasi akan meningkat dan menyebabkan peningkatan jumlah dokumen digital yang sangat pesat, dengan fakta tersebut maka seorang pengguna kesulitan dalam pencarian dan penemuan kembali dokumen digital. untuk menangani hal tersebut salah satunya dengan membangun daftar indeks dalam suatu sistem, Sehingga dengan dibangunya digital library diharapkan dapat membantu dan meningkatkan penyampaian informasi tentang electronic book, serta memudahkan user dalam pencarian dokumen yang diinginkan. Information retrieval merupakan salah satu cara untuk memperoleh informasi tentang electronic book  dengan melakukan penelusuran kembali atas electronic book yang tersimpan dalam database. Proses mengumpulkan semua informasi yang ada di dalam  halaman web menggunakan web crawler, web crawler akan berjalan menelusuri halaman web dan mengumpulkan dokumen-dokumen kemudian melakukan proses download data yang telah dikumpulkan oleh web crawler . Dokumen-dokumen tersebut akan diklasifikasikan menggunakan  metode K-Nearest Neighbor (KNN). K-Nearest Neighbor merupakan metode klasifikasi data berdasarkan voting terbanyak antara data training dan data testing dari klasifikasi tersebut didapatkan tingkat akurasi nilai k (ketetanggaan) k.1-k.7 adalah 80%-70% sedangkan akurasi k.8-k.20 antara 60%, 50%, dan 30% dengan demikian semakin banyak nilai k maka semakin berkurang tingkat akurasi pada proses klasifikasi.\r\n\r\nKata Kunci: Digital Library, Information Retrieval, Web Crawler, K-nearest Neighbor', 'Eka Ridho Septiyan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100041'),
(349, '100411100042', 'PENGELOMPOKKAN KECAMATAN BERDASARKAN INDIKATOR PENDIDIKAN MENGGUNAKAN METODE SELF ORGANIZING MAP (SOM) DI KABUPATEN LAMONGAN', 'Bain Khusnul K. ST., M.Kom', 'Firli Irhamni, ST., M.Kom', 'Pemerintah daerah selaku pengelola pendidikan memerlukan informasi mengenai kondisi pendidikan di wilayahnya, untuk membuat perencanaan dan kebijakan yang sesuai mengenai perluasan dan pemerataan pendidikan. Pengetahuan mengenai informasi pemerataan pendidikan diperlukan untuk pengelompokan Kecamatan berdasarkan indikator pemerataan pendidikan. Pengelompokan (clustering) merupakan salah satu metode data mining yang membagi data ke dalam kelompok – kelompok yang mempunyai objek yang karakteristiknya sama. Salah satu metode clustering adalah Self organizing map (SOM). Pada penelitian ini, akan mengelompokkan kecamatan yang ada di Kabupaten Lamongan menjadi 3 cluster dengan 23 variabel indikator pemerataan pendidikan. Pada uji coba yang telah dilakukan menggunakan 10 iterasi dengan masing-masing learning rate sebesar 0.6, 0.8 dari keseluruhan skenario yang telah dilakukan menghasilkan jumlah anggota cluster dan analisis cluster yang berbeda-beda, hal ini dipengaruhi oleh nilai awal iterasi dengan nilai random.\r\n\r\nKata Kunci: clustering, indikator pemerataan pendidikan, Self Organizing Map (SOM).\r\n', 'Mifftachul Afiffaturrohmah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100042'),
(350, '100411100043', 'RANCANG BANGUN MATHEMATICS ADVENTURE GAMES SEBAGAI MEDIA PEMBELAJARAN MATA PELAJARAN MATEMATIKA KELAS II SD', 'Arik Kurniawati, S.Kom., M.T.', ' Moh Kautsar Sophan, S.Kom, M.MT.', 'Media pembelajaran merupakan semua sarana, prasarana dan fasilitas yang digunakan sebagai penyampai pesan atau bahan pelajaran pada peserta didik yang lebih efisien dan efektif dalam memperjelas dan  memperlancar proses belajar. Game edukasi merupakan salah satu media pembelajaran yang cukup efektif dan menyenangkan terlebih terhadap anak. Tugas Akhir ini bertujuan untuk mengaplikasikan materi pelajaran matematika kelas II Sekolah Dasar menjadi Game edukasi berjenis adventure yang akan diterapkan pada web browser. Aplikasi ini menggunakan HTML5 yang diimplementasikan melalui salah satu game engine yaitu Contruct 2. Dari penelitian ini diperoleh kesimpulan bahwa pengimplementasian materi pelajaran matematika kelas II SD pada anak sebagai game adventure mampu meningkatkan minat belajar anak. Dari hasil kuesioner terbukti bahwa mayoritas anak mengatakan senang belajar sambil bermain. Dan game edukasi  pembelajaran seperti aplikasi ini membantu anak untuk memahami pelajaran matematika serta menjadikan anak lebih menyukai pelajaran matematika.', 'SUHROTUL LAILA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100043'),
(351, '100411100044', 'Pemetaan Kesesuaian Lahan Tambak Garam Menggunakan Metode Site Selection Pada Sistem Informasi Geografis Berbasis Web Di Desa Polagan Kabupaten Pamekasan', 'Mula’ab, S.Si., M.Kom.', 'Rika Yunitarini, ST., M.T.', 'Garam merupakan salah satu komoditas strategis nasional di bidang kelautan, Kabupaten Pamekasan merupakan perairan selat Madura yang menghasilkan emas putih atau garam sehingga Madura sejak dulu telah dikenal sebagai pulau garam. Penentuan tingkat kesesuaian lahan untuk Tambak Garam sangat perlu dilakukan agar nantinya dapat memberikan informasi kepada para Petambak dan perencana pengguna lahan dalam menentukan tindakan selanjutnya untuk dapat tetap meningkatkan kuantitas dan kualitas produksi garam. Tujuan penelitian ini adalah untuk mencari wilayah tambak yang sesuai untuk tambak garam sehingga meningkatkan nilai guna lahan tambak secara ekonomis bagi pengembangan usaha melalui pengaturan pola pemanfaatan, tata ruang pemanfaatan, penumbuhan komoditi unggulan, dan pengembangannya. Kategori kriteria kesesuaian lahan untuk tambak garam meliputi kondisi fisik dan kimia. Dalam penelitian ini menggunakan metode site selection untuk mengklasifikasikan karakteristik-karakteristik lahan kedalam kelas kesesuaian lahan terhadap tambak garam. Karakteristik lahan yang digunakan adalah 15 dan akan diklasifikasikan kedalam Tiga kelas yaitu S1, S2, dan N memprediksi tambak yang sesuai, kurang sesuai, dan tidak sesuai untuk tambak garam. Hasil ujicoba tersebut selanjutnya dipetakan kedalam Sistem Informasi Geografis (SIG) menggunakan basis data geospasial dari PostgreSQL/PostGIS dan software open source lainnya antara lain PDO .', 'Nurlisa Febriyana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100044'),
(352, '100411100045', 'MEDIA PEMBELAJARAN INTERAKTIF MEMBACA UNTUK PENDIDIKAN ANAK USIA DINI (PAUD) MENGGUNAKAN TAHAP PRAFONIK ', 'Andharini Dwi Cahyani S.Kom, M.Kom', 'Ari Kusumaningsih, S.T., M.T', 'Membaca adalah unsur penting dan mendasar yang harus dipelajari setiap orang agar dengan mudah melakukan sesuatu di segala bidang. Membaca menjadi salah satu prasyarat memperoleh berbagai ilmu pengetahuan, karena itu membaca harus diajarkan sejak pendidikan anak usia dini. Anak usia dini mencakup umur 2-5 tahun yang masih tergolong sangat belia, dimana anak masih cenderung lebih senang untuk bermain saja. Pendekatan dalam pembelajaran sangat diperlukan sehingga walaupun anak masih dalam usia belia, mereka sudah mampu menyerap pelajaran sedikit demi sedikit. Salah satu pendekatan yang paling menarik saat ini melalui game. Dengan pendekatan ini anak akan senang bermain dan bersemangat untuk belajar.  Model pembelajaran yang akan diterapkan pada penelitian ini yaitu menggunakan metode fonik. Metode fonik adalah model pembelajaran bahasa Indonesia untuk anak usia dini (0-8tahun) berdasarkan pendekatan komunikatif dan tahapan perkembangan anak. Metode fonik mengajarkan pengenalan huruf yang lebih menekankan pada mendengarkan bunyi huruf dan melihat huruf. Terdapat 4 tahap dalam metode fonik, yaitu: tahap prafonik, tahap 1, tahap 2 (Kelas 1 SD), dan tahap 3 (Kelas 2-3 SD). Dalam penelitian ini menggunakan tahap prafonik. Dalam penelitian ini diperoleh kesimpulan bahwa anak usia dini dikatakan sangat berhasil dalam pembelajaran dan menyebutkan bunyi huruf a, i, u, o dan e pada kata, benda, dan gambar.', 'Mimi Aisyah Muyassyarofin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100045'),
(353, '100411100046', 'PENCARIAN JARAK TERPENDEK MENGGUNAKAN PGROUTING BERBASIS WEBGIS UNTUK PEMETAAN PENDIDIKAN LUAR SEKOLAH (PLS)', 'MULA’AB,S.SI.,M.KOM', 'RIKA YUNITARINI,S.T.,M.T', 'Kota Sumenep merupakan salah satu kota yang terletak di daerah ujung paling timur Pulau Madura yang memiliki berbagai tempat Pendidikan Luar Sekolah (PLS) guna meningkatkan kemampuan seseorang selain ilmu yang diterima di pendidikan formal. Banyak masyarakat sumenep yang sadar akan manfaat PLS dan ingin mengikuti programnya namun belum mengetahui letak-letak dan rute terpendek yang akan diambil untuk menuju PLS tersebut. Untuk mengatasi hal tersebut maka dibuatlah sistem pencarian jarak terpendek menuju pendidikan luar sekolah di Kota Sumenep.\r\nPencarian jarak terpendek dapat dipecahkan dengan memanfaatkan fungsi pgRouting. PgRouting merupakan pengembangan basis data geospasial dari PostgreSQL/PostGIS yang menyediakan fungsi routing (perhitungan jarak terpendek) berdasarkan bahasa prosedural PG/PLSQL. Berdasarkan hasil ujicoba yang telah dilakukan metode A* mampu memberikan tingkat akurasi sebesar 75,25 % dalam  menentukan rute jarak terpendek. Hasil ujicoba tersebut selanjutnya divisualisasikan menggunakan Leaflet.', 'HENNY ELVANDARI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100046'),
(354, '100411100047', 'Perancangan dan Pembuatan Sistem Informasi Pondok Pesantren Berbasis Web (Studi Kasus: Pondok Pesantren Al-Hikam Kec. Burneh Kab. Bangkalan )', 'Andharini Dwi Cahyani, S.Kom., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Banyak Sistem informasi yang ada pada Pondok Pesantren Al Hikam Tunjung Burneh Bangkalan masih dilakukan secara manual. Dalam pengolahan data pesantren, masih secara konvensional dengan sistem pendataan yang sekarang dirasakan masih banyak kekurangan yang terjadi, dikarenakan sistem yang ada masih menggunakan lembaran kertas dan arsip sehingga dapat menyebabkan data-data yang ada mudah hilang ataupun rusak. Dalam tugas akhir ini akan dibangun sebuah Sistem Informasi Pesantren yang dapat mengintegrasikan keseluruhan proses-proses yang ada di pesantren dengan data yang terkait. Pengintegrasian tersebut dilakukan untuk meningkatkan efisiensi dalam hal sumber daya yang digunakan oleh pihak pesantren serta menyediakan media penyimpanan data yang terstruktur. Sistem ini dikembangkan dengan bahasa pemograman PHP, Fremwork, Laravel dan SQLyog Sebagai Database Server. Sistem ini diharaapkan dapat mempermudah dan mempercepat proses pengumpulan dan pengolahan data, serta memberikan akurasi dan kecepatan dalam penyampaian informasi.\n\nKata kunci: Sistem informasi Pondok Pesantren berbasis WEB.\n', 'Holili', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100047'),
(355, '100411100048', 'SEGMENTASI PEMBULUH DARAH PADA FUNDUS BERBASIS BOTTOM-HAT DAN 2D-GABOR FILTER', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Mata merupakan indra penglihatan manusia yang rentan terhadap penyakit. Adanya penyakit pada mata perlu diketahui sejak dini, sehingga dapat dicegah terjadinya gangguan pada mata yang mengakibatkan kebutaan. Pada Tugas Akhir ini menggunakan  Bottom-Hat dan 2D-Gabor Filter untuk mensegmentasi pembuluh darah retina pada citra fundus berwarna. Penelitian ini terdapat dua tahap, yaitu preprocessing dan segmentasi. Pada tahap awal preprocessing terdiri dari mengubah citra ke green channel, peningkatan citra dengan Adaptive Histogram Equalization (AHE) dan menghilangkan noise menggunakan Median Filter. Tujuan preprocessing ini untuk mempersiapkan citra sebelum proses segmentasi, sehingga diharapkan menghasilkan segmentasi yang optimal. Dan tahap kedua yaitu segmentasi yang terdiri dari ekstraksi fitur dengan metode Bottom-Hat, 2D-Gabor Filter, binerisasi dengan Otsu Thresholding, membersihkan citra dari noise, kemudian citra diperjelas dengan dilasi. Selanjutnya dilakukan perhitungan tingkat akurasi dari hasil citra segmentasi. Pengujian dilakukan pada database Digital Retinal Images for Vessel Extraction (DRIVE) sebanyak 20 citra. Hasil akurasi yang didapat dari pengujian penelitian ini sebesar 88,93%. Dengan menggabungkan metode Bottom-Hat dengan 2D-Gabor Filter mampu menghasilkan segmentasi yang lebih baik.\r\nKata Kunci : Segmentasi pembuluh darah, Bottom-Hat, 2D-Gabor Filter.', 'Syamsul Arifin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100048'),
(356, '100411100049', 'SISTEM PENGAMBILAN KEPUTUSAN UNTUK PENJURUSAN PADA SMKN 1 LABANG MENGGUNAKAN METODE SMART', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Yoga Dwitya Pramudita, S.Kom., M.Cs', 'SMK NEGERI 1 LABANG selama ini dalam menentukan  jurusan masih menggunakan cara manual (belum terkomputerisasi) dengan parameter (Nilai Ijazah, Nilai UAN dan Minat Siswa) sehingga dalam penentuan jurusan membutuhkan waktu yang relatif lama dikarenakan banyaknya siswa yang mendaftar dan banyaknya parameter yang digunakan sehingga admin juga kesulitan dalam menentukan jurusan pada siswa yang sudah mendaftar yang susuai kriterianya. Oleh karena itu dibutuhkan system pengambilan keputusan yang dapat membantu dalam menentukan penjurusan, Dan sistem ini dibangun dengan perhitungan yang akurat dengan menggunakan metode SMART sehingga akurasi perhitungan lebih terjamin. Dari penelitian ini dapat dihasilkan akurasi pengambilan keputusan dengan akurasi sebesar 60%, sehingga hasil penilitian ini layak untuk di jadikan pilihan rekomendasi untuk  pengambilan keputusan.\nKata Kunci :Aplikasi Penjurusan, metode SMART', 'Hariyanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100049'),
(357, '100411100050', 'RANCANG BANGUN APLIKASI PENGOLAHAN NILAI RAPOR BERBASIS WEB PADA SEKOLAH MENENGAH KEJURUAN', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Yoga Dwitya Pramudita, S.Kom., M.Cs', 'Aplikasi Pengolahan Nilai Rapor merupakan sauatu aplikasi yang memberikan informasi laporan keaktifan siswa yang berupa laporan nilai serta informasi siswa yang bersangkutan dengan berbasiskan komputerisasi, sehingga dapat membantu kecepatan dan kualitas dalam pengolahan nilai. Permasalahan yang terjadi dalam pengolahan nilai rapor di SMK Agung Mulia saat ini masih menggunakan Microsoft Excel, dimana penyimpanan datanya masih tersebar di setiap wali kelas dan guru mata pelajaran yang bersangkutan. Selain itu, untuk memperoleh nilai akhir siswa harus menunggu data nilai yang ada pada guru yang bersangkutan, kemudian di rekap ulang oleh wali kelas. Selain itu tingkat masalah yang ditimbulkan sistem ini sangat banyak. Di antaranya adalah data-data nilai siswa tidak terdokumentasi dengan baik, data nilai yang tersimpan dalam file Excel mudah di serang virus, dan factor lainnya yang menyebabkan file hilang dan rusak. Untuk mengatasi masalah tersebut, dibutuhkan pengembangan aplikasi untuk membantu hal tersebut. Salah satu pengembangannya adalah dengan menggunakan Aplikasi Pengolahan Nilai Rapor Berbasis Web. Dari penelitian ini dapat di hasilkan proses kecepatan pengolahan data nilai sebesar 95.00%, Dengan menerapkan sebuah Aplikasi ini diharap mampu memproses data nilai yang begitu banyak dengan sangat cepat, serta keamanan data nilai siswa terjaga.', 'JAKFAR', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100050'),
(358, '100411100051', 'REKOMENDASI PEMINJAMAN BUKU BERDASARKAN MINAT PENGUNJUNG PERPUSTAKAAN MENGGUNAKAN METODE K-MEANS DAN ASSOCIATION RULE', 'Bain Khusnul K., S.T., M.Kom.', 'Bain Khusnul K., S.T., M.Kom.', 'Banyaknya keragaman buku di perpustakaan, menyebabkan pengguna sulit menemukan buku yang sesuai dengan keinginan mereka. Penelitian ini bertujuan mengimplementasikan sistem rekomendasi peminjaman buku berdasarkan minat pengunjung menggunakan metode k-means dan association rule. Penelitian ini dilakukan pada perpustakaan UTM. Data yang digunakan adalah  data anggota dan transaksi pinjam mahasiswa fakultas teknik. Dengan skenario ujicoba 200 record data. Proses pengelompokan pengunjung berdasarkan total data tiap cluster dan jumlah nilai yang terdapat dalam satu cluster yang paling besar. Kelompok mahasiswa yang aktif melalui proses association rule didapatkan support minimal 30% dan support maksimal 50%. Rule terbaik pada minsup 50% yaitu kombinasi Algoritma & pemrograman dengan borland C++ dan Pemrograman C dan Implementasinya. Dengan nilai support 70% dan nilai confidence 100%. Support minimal terbentuk dari jumlah tiap item yang lebih besar sama dengan minsup. Support maksimal terbentuk dari minsup yang digunakan tidak lagi menghasilkan output berupa rule. Rule terbaik adalah rule yang mempunyai nilai support dan confidence yang paling tinggi. Rule tersebut mempunyai nilai kepercayaan yang mewakili seluruh kombinasi item yang terbentuk. Semakin besar minsup yang digunakan rule yang dihasilkan semakin sedikit, namun rule yang dihasilkan semakin kuat karena memiliki nilai kepercayaan yang tinggi. \r\n\r\nKata kunci: k-means, association rule, apriori, rekomendasi buku.\r\n', 'NAILY NAJIHAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100051'),
(359, '100411100053', 'OPTIMALISASI SEGMENTASI PEMBULUH DARAH RETINA PADA CITRA FUNDUS MATA BERWARNA MENGGUNAKAN MATRIK MASK OVERLAPPING', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Diabetic retinopathy merupakan salah satu gangguan pada mata akibat penyakit diabetes. Tanpa adanya penanganan dini gejala ini dapat mengakibatkan kebutaan. Diabetic retinopathy ditandai dengan kerusakan pembuluh darah retina sehingga mengalami kebocoran yang menimbulkan penumpukan cairan. Untuk mengetahui gejala penyakit ini perlu adanya pengecekkan pada mata yang terdapat penyakit berupa cairan exudates. Untuk mengecek penyakit terlebih dahulu harus melakukan ekstraksi pada pembuluh retina. Pada penelitian ini dilakukan segmentasi pembuluh darah retina dengan metode yang terdiri dari dua tahap pada proses segmentasi fundus mata. Tahap pertama adalah preprocessing untuk menghilangkan noise dengan 2D-Gaussian Low Pass Filtering (2D-GLPF) dan meningkatkan kualitas penajaman citra menggunakan Adaptive Histogram Equalization (AHE). Tahap segmentasi dengan transformasi Bottom-Hat dan menghapus tepi retina dengan Mask Overlapping selanjutnya dilakukan perhitungan tingkat akurasi citra hasil segmentasi dengan citra Ground Thruth. Pengujian dilakukan pada database Digital Retinal Images for Vessel Extraction (DRIVE) sebanyak 20 citra. Metode Matrik Mask Overlapping mampu mensegmentasi dengan baik dibuktikan pada hasil akurasi segmentasi dibandingkan dengan citra Ground Truth sebesar 87,09%.\r\nKata kunci: Segmentasi, Matrik Mask Overlapping dan 2D-Gaussian Low Pass Filtering (2D-GLPF).\r\n', 'NUR ZUHROH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100053'),
(360, '100411100054', 'Pemetaan SMA/SMK/MA Di Kabupaten Lamongan Berdasarkan Indikator Pendidikan Menggunakan Metode SOM (Self Organizing Map)', 'Achmad Jauhari, S.T., M.Kom.', 'Bain Khusnul Khotimah, S.T., M.Kom', 'Sarana dan prasarana yang memadai, jumlah lulusan, APK, APM, dan jumlah pengajar sangat mempengaruhi pemerataan pendidikan suatu daerah. Selain itu, pembuatan perencanaan dan kebijakan pemerintah daerah sangat diperlukan untuk menunjang pemerataan pendidikan. Semakin baik APM, APK suatu daerah maka pendidikan daerah tersebut dikatakan baik. Tujuan penelitian ini adalah untuk mengetahui seberapa maksimal pemerataan pendidikan yang ada di Kabupaten Lamongan. Untuk mengetahui seberapa maksimal pemerataan pendidikan di Kabupaten Lamongan, maka perlu dilakukan pengelompokan setiap sekolah berdasarkan indikator pendidikan. Pengelompokan (clustering) adalah cara mengidentifikasi suatu objek atau individu yang serupa dengan memperhatikan beberapa kriteria. Dalam penelitian ini menggunakan salah satu metode clustering yakni SOM (Self Organizing Map) untuk mengelompokkan SMA/SMK/MA di Kabupaten Lamongan dengan 10 variabel indikator pendidikan SMA/SMK/MA dan hasil perhitungan tersebut akan dibagi menjadi 3 hasil cluster. Berdasarkan 2 hasil ujicoba 10-100 iterasi dengan masing-masing learning rate  sebesar 0.6 dan 0.8, dari keseluruhan skenario ujicoba menghasilkan jumlah anggota cluster dan analisis cluster yang beda-beda. Cluster C1 memiliki nilai pemerataan pendidikan yang maksimal, cluster C2 memiliki nilai pemerataan pendidikan yang cukup maksimal, dan cluster C3 memiliki nilai pemerataan pendidikan yang kurang maksimal. Hasil ujicoba tersebut selanjutnya divisualisasikan menggunakan Google Maps API.\r\n\r\nKata Kunci : Clustering, SOM, Indikator Pendidikan, Google Maps API. \r\n', 'Durorin Khumairoh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100054'),
(361, '100411100055', 'DESAIN DAN IMPLEMENTASI OTENTIKASI PENGGUNA PADA JARINGAN WIRELESS MIKROTIK BERBASIS FREERADIUS DAN DALORADIUS PADA LABORATORIUM COMMON COMPUTING UNIVERSITAS TRUNOJOYO MADURA', 'Dwi Kuswanto, S.Pd., M.T.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Semakin banyak pengguna perangkat mobile dalam menggunakan layanan internet berbasis WiFi membuat semakin besar penggunaan sumber daya terhadap layanan WiFi itu sendiri. Karena itu dibutuhkan pengelolaan sumber daya yang tepat dalam menjalankan layanan WiFi itu sendiri. Karena itu dibutuhkan manajemen otentikasi pengguna pada jaringan wireless.  RADIUS (Remote Authentication Dial In User Service ) adalah suatu protokol yang biasa digunakan untuk melakukan otentikasi, otorisasi, dan akunting terhadap pengguna layanan jaringan. Pada penelitian ini dilakukan terhadap sistem otentikasi pengguna jaringan wireless menggunakan Router Mikrotik sebagai Access Point dan Captive Portal yang terhubung dengan aplikasi FreeRadius sebagai eksternal Radius Server  yang menggunakan backend MySQL sebagai database penyimpanan data pengguna yang dipasang pada sistem operasi Ubuntu. Antarmuka yang digunakan untuk melakukan manajemen pengguna menggunakan aplikasi Daloradius. Sistem otentikasi pengguna berhasil dilakukan dengan menggunakan FreeRadius. Dari hasil uji coba command PING terhadap pengguna yang berhasil terhubung jarak optimal pada jaringan wireless dicapai pada jarak tujuh meter menunjukkan mempunyai koneksi yang relatif stabil.', 'Gunawan Fahmi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100055'),
(362, '100411100056', 'Perancangan user experience dan levelling pada game heroes of surabaya ', 'Cucun Very Angkoso, S.T., M.T.', 'Yonathan Ferry Hendrawan, S.T,. MIT. ', 'Varian game yang ada saat ini memiliki User Experience dan desain Levelling yang menarik sehingga menjadi ciri tersendiri dalam sebuah game. Rancangan User Experiene pada sebuah game memiliki hasil yang maksimal apabila memakai perangkat smartphone Android yang memiliki banyak pengguna. Perlu adanya sebuah riset mengenai kepuasan pengguna agar menjadi indikator seberapa pantas sebuah produk game bisa masuk ke pasaran. Target pasaran adalah jenis Game Action-Platformer. Jenis game tersebut cocok dengan tema sejarah kemerdekaan Indonesia. \r\nTugas akhir ini berisi User Experience dan Levelling dalam game Action-Platformer Heroes of Surabaya. Completionism, Extended play time, Curiousity, Collection, Simplicity, Tempting challenge, dan Integrated theme adalah jenis-jenis User Experience dalam game ini. Teori User Experience juga dipakai dalam survei, seperti attention, importance, arousal, impressed, challenge, dan enjoy. Hasil yang didapat dari survei terhadap 20 orang adalah nilai pengalaman pengguna yang tinggi yaitu sebesar 351 dengan skala Likert. Ditemukan juga 3 pernyataan yang tidak valid dan 5 pernyataan yang tidak reliabel dalam kuisioner. Hasil akhir dari penelitian adalah kuisioner User Experience yang telah dibuat sudah cukup memadai dengan nilai cronbach alpha 0,773 dan banyak dari responden merasa bersemangat dan aktif ketika bermain berdasarkan nilai rata-rata arousal yang lebih tinggi dari indikator lain yaitu sebesar 5,35.', 'Benedictus Manggala', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100056'),
(363, '100411100057', 'IMPLEMENTASI FRAMEWORK LARAVEL PADA APLIKASI ADMINISTRASI DESA KEPUHKEMIRI SIDOARJO JAWA TIMUR', 'Firdaus Solihin, S.Kom., M.Kom.', 'Achmad Jauhari, S.T., M.Kom.', 'Pemerintahan desa (Kelurahan) merupakan salah satu pemerintahan yang bertugas mengelola dan mempunyai kewajiban dalam melayani administrasi penduduk di tingkat desa. Dalam pelayanan tersebut perlu dilakukan dengan tepat dan cepat agar memberikan layanan terbaik bagi penduduk. Proses administrasi penduduk yang memakan waktu cukup lama membuat penduduk harus menunggu beberapa hari. Karena itu dibutuhkan pengembangan aplikasi untuk membantu hal tersebut. Salah satu pengembangannya adalah dengan menggunakan framework laravel. Tergolong framework yang cukup baru, laravel memiliki keamanan yang tinggi serta fitur-fitur yang mudah dimengerti oleh pengembang aplikasi. Berdasarkan hasil respon dari petugas desa terhadap Implementasi Framework Laravel pada Aplikasi Administrasi Desa Kepuhkemiri menunjukan respon yang sangat positif dengan persentase total respon sebesar 98,52% (aplikasi berjalan dengan baik).', 'Fariz Hilman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100057');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(364, '100411100058', 'KLASIFIKASI PENERIMA BEASISWA GAKIN MENGGUNAKAN ALGORITMA C4.5', 'Bain Khusnul K,S.T.,M.Kom', 'Yeni Kustiyahningsih,S.Kom.,M.Kom', 'Selama ini untuk menentukan penerima beasiswa hingga tahap ke tujuh masih dilakukan dengan cara manual oleh Dinas Pendidikan Kabupaten Lamongan.Pemberian beasiswa diperuntukkan untuk mahasiswa yang secara ekonomi kurang mampu untuk membayar biaya studi di perguruan tinggi. Banyaknya kriteria yang digunakan untuk penentuan pemberian beasiswa mengakibatkan sulitnya membuat keputusan pemberian beasiswa. Selain itu waktu yang dibutuhkan juga lama. Tujuan penelitian ini adalah membuat klasifikasi penerima beasiswa dengan menggunakan algoritma C4.5 salah satu metode decision tree.Dengan adanya sistem ini dapat mempermudah dan mempercepat penentuan calon penerima beasiswa. Data yang digunakan 460 data dan untuk setiap atribut dihitung menggunakan rumus gain ratio untuk menghasilkan pohon dan rule keputusan. Dari uji coba yang telah dilakukan,untuk skenario uji coba 1 menghasilkan akurasi sebesar 83,97% tanpa pruning, 84,73 % menggunakan prepruning, dan 85,5% untuk post pruning. Sedangkan skenario uji coba 2 menghasilkan 91,24% tanpa pruning, 93,55% menggunakan prepruning dan 93,90 % untuk postpruning. Untuk skenario uji coba 3 menghasilkan akurasi sebanyak 83,71% tanpa pruning, sedangkan 89,9% untuk prepruning. Dari skenario uji coba yang dilakukan nilai akurasi yang dihasilkan setelah dilakukan pruning lebih baik dari pada tanpa pruning. Proses kalsifikasi menggunakan skenario 2 teknik prepruning digunakan sebagai acuan klasifikasi pendaftar baru, karena memiliki akurasi tertinggi sebesar 93,55%.', 'Tindawati Rahayu', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100058'),
(365, '100411100059', 'RANCANG BANGUN SISTEM INFORMASI AKADEMIK MENGGUNAKAN AGILE MODEL DRIVEN\r\n(STUDI KASUS: SMK NEGERI 2 SURABAYA)\r\n', 'Andharini Dwi Cahyani, S.Kom., M.Kom.', 'Moch. Kautsar Sophan. S.Kom., M.MT.', 'SMK Negeri 2 Surabaya merupakan salah satu SMK teknologi dan industri unggulan di Surabaya, namun pemanfaatan teknologi informasi dan komunikasi (TIK) belum maksimal. Banyak kelemahan yang ditemukan pada sistem lama sehingga menghambat penyebaran arus informasi. Dibutuhkan suatu sistem yang dirancang untuk membantu mengakomodasi pengelolaan informasi akademik sehingga mempermudah pekerjaan guru dan staf yang bertugas mengelola data akademik dan membantu mempercepat penyebaran informasi akademik sekolah. \r\nMetode pengembangan sistem yang digunakan dalam penulisan tugas akhir ini adalah Agile Model Driven dengan UML sebagai pemodelannya. Dengan menerapkan prinsip Agile Model Driven dalam pengembangan sistem dimodelkan menggunakan UML kemudian dilakukan proses membangun aplikasi dari model driven design menggunakan framework django sehingga menghasilkan komponen arsitektur basis data sesuai dengan perancangan  untuk kemudian dikembangkan menjadi sebuah aplikasi.\r\nHasil dari penelitian menunjukkan bahwa sistem informasi akademik sudah layak pakai dan mudah dikembangkan berdasarkan hasil pengujian functionality, usability, portability, reliability dan maintainability.', 'Zaenal Siswanto Aribowo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100059'),
(366, '100411100060', 'Sistem Penjadwalan Sales Manajemen Marketing Berbasis Web Framework Laravel Studi Kasus CV. Natusi', 'Sigit Susanto Putro. S.Kom., M.Kom', 'Yoga Dwitya P. S.Kom.,M.CS', 'Natusi merupakan sebuah Perusahaan swasta yang ada di Mojokerto yang bergerak dibidang Teknologi yang mengembangkan Software dan Aplikasi.dalam pengelolahan  perusahaan perlu dibutuhkan sebuah kegiatan yang meliputi Penjualan produk Sales ,Mempromosikan produk dan Pemasaran produk.Dalam hal Manajemen tersebut perlu dilalukan dengan cepat,tepat dan sistematis agar Perkembangan pengelolahan Perusahaan semakin bertambah pesat Salah satu  pengembangannya adalah dengan menggunakan framework laravel. Tergolong framework yang cukup baru, laravel memiliki keamanan yang tinggi serta fitur-fitur yang mudah dimengerti oleh pengembang aplikasi. Berdasarkan hasil respon dari pegawai dan Admin CV Natusi, Sistem Penjadwalan Sales Manajemen Marketing Berbasis Web Framework Laravel menunjukan respon yang sangat positif dengan persentase total respon sebesar 90% (aplikasi berjalan dengan baik).', 'Andri Irawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100060'),
(367, '100411100061', 'IDENTIFIKASI GAYA KOGNITIF MELALUI POLA BROWSING SISWA DENGAN KUISIONER BERBASIS MBTI MENGGUNAKAN METODE DECISION TREE', 'Andharini Dwi Cahyani,S.Kom.,M.Kom', 'Rika Yunitarini, S.T., M.T', 'E-learning merupakan salah satu dari perkembangan sistem teknologi informasi dalam dunia pembelajaran yang membantu dan memudahkan kegiatan belajar mengajar dalam suatu lingkungan lembaga pendidikan, dimana penggunanya adalah pelajar atau siswa. Dalam suatu pembelajaran, setiap siswa memiliki gaya kognitif yang berbeda-beda. Maka dari itu, diperlukan identifikasi gaya kognitif siswa untuk dijadikan acuan metode pembelajaran yang dapat meningkatkan kinerja dan persepsi belajar siswa. Dalam penelitian ini, identifikasi gaya kognitif siswa dilakukan melalui pengamatan pola browsingnya dengan kuisioner berbasis MBTI (Myers Briggs Type Indicator) menggunakan metode Decision Tree yaitu algoritma C4.5. Dari hasil uji coba yang telah dilakukan pada penelitian ini, terdapat 3 partisi pohon keputusan,  dimana pada tiap partisi memiliki tingkat keakurasian yang berbeda. Pada pohon keputusan partisi 1 menghasilkan akurasi sebesar 74,3%, pohon keputusan partisi 2 menghasilkan akurasi sebesar 60,65%, dan pohon keputusan partisi 3 menghasilkan akurasi sebesar 68,61%. Karena pohon keputusan partisi 1 memiliki nilai akurasi tertinggi sebesar 74,3%, maka rule pada pohon keputusan partisi 1 digunakan sebagai acuan untuk mengklasifikasikan gaya kognitif pada data baru. \r\n\r\nKata Kunci : E-learning, Gaya Kognitif, MBTI, Algoritma C4.5\r\n', 'Riska Hairuni Apriliana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100061'),
(368, '100411100062', 'RANCANG BANGUN SISTEM UJIAN ONLINE DI SEKOLAH MENENGAH ATAS NEGERI 2 LAMONGAN', 'Andharini Dwi Cahyani, S.Kom.,M.Kom', 'Moch. Kautsar Sophan, S.Kom., M.MT', 'Sistem ujian konvensional yang sering digunakan dalam kegiatan akademik sering kali menemui kendala. Faktor penilaian dan kecurangan merupakan kendala yang paling sering ditemui. Namun seiring dengan berkembangnya teknologi informasi, ujian konvensional bergeser menjadi sistem ujian online. Ujian online merupakan ujian yang dilakukan dengan alat bantu komputer. Tujuan dari pembuatan sistem ujian online ini yaitu dapat memudahkan guru untuk mengoreksi ujian serta mengefisiensi waktu dengan hasil ujian yang objektif. Dengan adanya sistem ujian online ini, maka akan memudahkan guru dalam memberikan soal-soal ujian kepada para siswanya dan menghasilkan nilai secara cepat dan mudah. Penilaian ujian juga dapat dilakukan secara efektif dan efisien karena dapat dilakukan oleh sistem secara otomatis. Selain itu dengan sistem ujian online juga dapat mengurangi biaya penyediaan bahan ujian karena dengan sistem ujian online ini dapat membantu mengurangi penggunaan kertas yang digunakan untuk mencetak soal ujian. Dalam sistem ini ada 3 tingkat pengguna yaitu Administrator, Guru dan Siswa. Ada 3 jenis pertanyaan yaitu Pilihan Ganda, Jawaban Ganda dan Benar/Salah. Pada sistem ini soal akan tampil secara acak, hal ini untuk meminimalisir tingkat kecurangan siswa dalam mengerjakan soal ujian. Dengan adanya sistem ujian online ini dapat membantu proses pengolahan data soal ujian dan data nilai siswa.\r\n\r\nKata Kunci : Computer Based Tes , ujian, ujian online.\r\n', 'Erina Adikusuma', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100062'),
(369, '100411100063', 'PENGELOMPOKAN INDUSTRI KECIL MENENGAH DALAM PENGGUNAAN TEKNOLOGI INFORMASI MENGGUNAKAN METODE K-MEDOID\r\n(STUDI KASUS : INDUSTRI KECIL MENENGAH BATIK DAN JAMU KABUPATEN BANGKALAN MADURA)', 'Bain Khusnul Khotimah, ST., M.Kom', 'Andharini Dwi Cahyani S.Kom, M.Kom', 'Industri Kecil Menengah (IKM) merupakan salah satu bentuk usaha Kecil dan Menengah (UKM) yang mampu membantu pertumbuhan ekonomi di dalam nasional dan regional. Ketatnya persaingan pasar dan banyaknya jumlah IKM akan mempengaruhi tingkat pemasaran. Dengan memanfaatkan penggunaan TI pada IKM akan membantu memperluas tingkat pemasaran sehingga penggunaan TI menjadi salah satu akses bagi IKM untuk mengembangkan usahanya. Peran TI pada IKM semakin penting pada saat ini dikarenakan sudah memasuki era informasi. Pemanfaatan penggunaan TI pada IKM di Kabupaten Bangkalan kurang dimanfaatkan karena minimnya pengetahuan dalam penggunaan TI. Dalam penelitian ini dilakukan pengelompokan (clustering) yang merupakan metode data mining yang membagi data kedalam kelompok-kelompok yang mempunyai objek yang karakteristiknya sama. Pada penggunaan tingkat TI di IKM akan dilakukan pengelompokan berdasarkan kriteria TI menggunakan metode k-medoid menggunakan distance measure: Manhattan, Euclidean, dan Canberra distance. Untuk memvalidasi data setelah proses clustering digunakan Davies Bouldin Index (DBI). Semakin kecil nilai DBI maka semakin baik kualitas cluster.', 'Dewi Sylvia Ferdiana P', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100063'),
(370, '100411100065', 'RANCANG BANGUN PLAY WITH CAL SEBAGAI GAME EDUKASI BAHASA INGGRIS DAN MATEMATIKA PADA ANAK', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Arik Kurniawati, S.Kom, M.T', 'Pada era teknologi yang modern, game tidak hanya sekedar dibuat untuk bermain saja tetapi juga digunakan sebagai media pembelajaran. Game sebenarnya penting untuk perkembangan otak, untuk meningkatkan konsentrasi dan melatih untuk memecahkan masalah dengan tepat dan cepat karena dalam game terdapat berbagai konflik atau masalah yang menuntut kita untuk menyelesaikannya dengan cepat dan tepat. Penelitian tugas akhir ini adalah membuat sebuah game yang menyajikan pembelajaran bahasa Inggris dan matematika yang sengaja dikemas dalam bentuk permainan supaya dapat meningkatkan minat belajar anak. Sasaran pengguna game ini adalah anak kelas II dan III sekolah dasar. Game ini memiliki 2 pilihan permainan, yaitu edukasi bahasa Inggris dan edukasi matematika. Edukasi bahasa Inggris bertujuan untuk melengkapi sebuah kata, sedangkan edukasi matematika bertujuan melengkapi sebuah operasi aritmatika sederhana. Game ini dibuat dengan tampilan dan gameplay yang menarik sehingga dapat membuat anak-anak lebih tertarik dan lebih mudah belajar bahasa inggris dan matematika.', 'Ahmad Mujiburahman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100065'),
(371, '100411100067', 'Kontrol Ultrasonic Rangefinder dan Pergerakan Robot Pemadam Api Menggunakan Fuzzy Logic', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Koko Joni, S.T., M.T.', 'Robot merupakan salah satu teknologi yang diminati dalam beberapa tahun terakhir. Pemanfaatan robot yang sering kali ditemukan pada bidang industri telah banyak membantu pekerjaan manusia. Selain itu juga dikembangkan robot-robot yang dapat membantu untuk menyelesaikan misi di medan berbahaya, seperti robot penjinak bom dan robot pemadam api. Robot pemadam api merupakan robot yang mendapat perhatian dari pemerintah Indonesia dalam pengembangannya. Diadakannya Kontes Robot Pemadam Api Indonesia (KRPAI) merupakan dukungan pemerintah terhadap mahasiswa di universitas untuk mengembangkannya. Robot pemadam api yang dirancang pada penelitian ini menggunakan sensor ultrasonic sebagai pengkur jarak, UVTron sebagai pendeteksi api, dan photodioda untuk membedakan warna lantai. Sistem pergerakan robot dalam melakukan pencarian api menggunakan metode fuzzy logic yang terdiri dari dua input dan output. Input dari kontroler fuzzy ini merupakan data dari sensor ultrasonic depan dan kanan, sedangkan outputnya merupakan kecepatan motor kanan dan kiri pada robot. Pada ujicoba terhadap kontroller fuzzy yang dilakukan di 60 kondisi berbeda, robot hanya mengalami error pada motor kanan sebesar 0,10% dan motor kiri sebesar 0,28%. Sedangkan pada pengujian robot dalam mencari dan memadamkan api, didapatkan tingkat prosentase keberhasilan sebesar 100%. Penggunaan fuzzy logic sebagai kontroller mampu membuat robot bergerak stabil, responsif, dan terhindar dari halangan dalam pergerakannya.', 'Mohammad Wasil', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100067'),
(372, '100411100068', 'RANCANG BANGUN GUI INTRUSION PREVENTION SYSTEM (IPS) SURICATA', 'Dwi Kuswanto', 'Iwan Santosa', 'Keamanan  pada  sebuah  jaringan  komputer  merupakan  salah  satu  hal  yang  sangat  penting. \r\nPerkembangan  teknologi  memberikan  dampak  terhadap  keamanan  jaringan  komputer  yaitu \r\ndengan maraknya penyusupan pada jaringan komputer. Hal ini dapat mengancam terhadap data \r\npenting  akibat  dari  ulah  orang  yang  tidak  bertanggung  jawab.  Untuk  menjaga  kerahasiaan \r\nkeaslian  dan  ketersediaan  data  tersebut,  diperlukan  suatu  sistem  untuk  mendeteksi  adanya \r\npenyusupan pada jaringan komputer dan dapat berjalan secara real time.  Intrusion Prevention \r\nSystem (IPS) adalah sebuah sistem yang dapat memonitor jaringan dan dapat memberikan suatu \r\ntindakan  tertentu  pada  jaringan  komputer  tersebut.  IPS  merupakan  perkembangan  dari  IDS \r\ndimana  pada  IPS  ini  menggunakan  Suricata  sebagai  pendeteksi  penyusup  dan  dikoneksikan \r\ndengan  IPTables  sebagai  pencegah  penyusupan.  IPS  ini  dilengkapi  dengan  tampilan  (GUI) \r\nuntuk memudahkan admin dalam memantau jaringan dari tindakan penyusupan kepada server. \r\nSuricata membuat alert ketika terdeteksi adanya penyusupan pada jaringan dan disimpan pada \r\nfile  log  Suricata.  Pada  saat  yang  sama  WebAdmin  menampilkan  dialog  alert  disertai  dengan \r\nbunyi  alarm  dan  memerintahkan  IPTables  untuk  memblokir  alamat  IP  yang  teridentifikasi \r\nsebagai penyusup, sehingga akses penyerang terhadap server terputus. Berdasarkan percobaan \r\nyang telah dilakukan sebanyak 50 kali, Suricata dan IPTables dapat bekerja secara optimal dan \r\nmampu mendeteksi serangan.', 'Arif Rahman Hakim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100068'),
(373, '100411100069', 'SISTEM MONITORING AKADEMIK DAN ADMINISTRASI SISWA DENGAN MENGGUNAKAN SMS GATEWAY\r\n( Studi Kasus MAN Sampang )', 'Rika Yunitarini, S.T., M.T.', 'Achmad Jauhari, ST., M.Kom.', 'Madrasah Aliyah Negeri (MAN) Sampang adalah salah satu sekolah di kabupaten sampang yang memiliki berbagai aktivitas extra kurikuler serta mempunyai berbagai fasilitas lengkap yang dapat  mendukung proses belajar-mengajar di sekolah tersebut. Akan tetapi MAN Sampang dalam pengolahan data akademik dan adminstrasi masih menggunakan sistem manual yang kurang efisien dan efektif. Pada satu sisi, MAN Sampang menginginkan untuk sistem dapat memudahkan monitoring akademik dan administrasi siswa sebagai sarana informasi kepada wali murid.\r\nOleh karena itu pada penyusunan tugas akhir ini akan membangun Sistem Monitoring Akademik Dan Administrasi Siswa-Siswi dengan menggunakan fasilitas SMS Gateway sebagai media monitoring aktivitas serta prestasi akademik dan menggunakan bahasa pemerograman PHP, HTML, dan C#.\r\nSetelah Sistem dirancang, sistem dapat mengakomodasi kebutuhan dalam mempermudah dan mempercepat kinerja guru dan staf yang bertugas dalam mengelola data nilai siswa. Dari uji obyektifitas yang dilakukan terhadap 20 responde, mendapatkan hasil ±75% responden menyatakan sangat setuju terehadap sistem monitoring akademik dan administrasi yang di bangun.\r\n\r\nKata kunci : Sistem informasi, PHP, Mysql, SMS Gateway, MAN SAMPANG', 'ahmad fausi furrohman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100069'),
(374, '100411100070', 'SISTEM PAKAR DIAGNOSA HAMA DAN PENYAKIT PADI DENGAN METODE BAYESIAN BERBASIS CERTAINTY FACTOR (Studi Kasus: UPT Dinas Pertanian dan Kehutanan Kec. Laren Kab. Lamongan)', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Bain Khusnul Khotimah, S.T., M.Kom.', 'Banyak petani yang mendapatkan hasil panen kurang maksimal. Hal itu disebabkan oleh hama maupun penyakit tanaman padi. Hama dan penyakit memiliki jenis dan gejala yang berbeda. Untuk jenis hama dan penyakit diantaranya: penggerek batang, hawar daun bakteri, dan lain-lain. sedangkan gejala dari hama maupun penyakit tanaman padi antara lain: adanya ngengat kupu-kupu, anakan berkurang, daun padi berwarna kuning, dan lain-lain. Untuk mempermudah mendiagnosa jenis hama dan penyakit tanaman padi, dibutuhkan adanya sistem pakar yang cara kerjanya hampir sama dengan seorang pakar dalam bidangnya. Gejala-gejala yang terdapat pada sistem sering mengandung ketidakpastian karena fakta yang didapat di lapangan tidak sesuai dengan panduan seorang pakar. Untuk mengatasi masalah ketidakpastian tersebut, sistem pakar mengadopsi metode Certainty Factor untuk menganalisa berdasarkan gejala-gajala yang terdapat pada masalah yang terjadi. Dengan metode Certainty Factor pada sistem akan didapatkan tingkat kepastian terhadap suatu fakta yang akan menghasilkan sebuah diagnosa. Hasil dari sistem akan mampu melakukan diagnosa berdasarkan gejala-gejala yang ada meskipun terdapat gejala-gejala yang mengandung ketidakpastian. Untuk mengukur derajat kemunculan suatu hama ataupun penyakit berdasarkan gejala-gejala digunakanlah Probabilitas Bayesian.', 'Dwi Puji Raharjo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100070'),
(375, '100411100071', 'Sistem Penjadwalan Sidang Tugas Akhir Menggunakan Algoritma Genetika (Studi Kasus: Teknik Informatika Universitas Trunojoyo Madura)', 'Achmad Jauhari, S.T, M.Kom', 'Fika Hastarita Rahman, S.T, M.Eng', 'Saat ini penjadwalan sidang tugas akhir dilakukan oleh koordinator tugas akhir dengan \ncara manual yaitu dengan mendata mahasiswa yang mendaftar sidang, kemudian \nkoordinator mengecek jadwal mengajar dosen dan bidang minat masing-masing. \nSetelah itu koordinator mencocokkan jadwal dosen dengan jadwal sidang, sehingga \nproses tersebut membutuhkan banyak waktu. \nDalam menentukan penjadwalan sidang, sistem ini memakai metode Algoritma \nGenetika. Pertama sistem akan mengolah data pendaftatr sidang, data dosen dan jadwal \ndosen. Dari data yang sudah terkumpul tersebut kemudian menentukan dosen penguji, \ndan menghitung nilai penalti dari masing  –  masing pendaftar. Setelah itu menjumlah \nnilai penalti dan menghitung nilai  fitness-nya. Tahapan selanjutnya yaitu seleksi, dan \nakan dilanjutkan dengan tahapan  crossover  serta mutasi. Sehingga menghasilkan \njadwal sidang. \nDari percobaan yang telah dilakukan fitness terbaik didapat dari hasil percobaan \ndengan nilai inputan Probabilitas crossover 0.95 probabilitas mutasi 0.04, nilai fitness \nmaksimal 0.3 jumlah generasi maksimal 20, hari Rabu tanggal 03 Agustus 2016 \nsemester ganjil gelombang pertama didapat nilai rata-rata fitness yaitu 2.64389 dengan \nwaktu uji coba 1menit 37 detik.', 'Rizky Isnaini Safitri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100071'),
(376, '100411100072', 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI PEMBERIAN REWARD DAN PUNISHMENT MENGGUNAKAN METODE C4.5', 'Rika Yunitarini, S.T.,M.T.', 'Sigit Susanto P, S.Kom.,M.Kom', 'Abstrak.Semakin berkembang perusahaan, semakin dibutuhkan juga kebutuhan tenaga manusia. Perusahaan umumnya ingin memberikan kinerja yang terbaik dalam berinteraksi dengan pihak yang terkait, salah satunya adalah dengan karyawan yang mana merupakan pemegang peranan dalam perkembangan perusahaan. Untuk mewujudkan itu, suatu perusahaan mencari sumber daya manusia yang melaksanakan pekerjaannya dengan baik. Untuk dapat tetap menjaga agar karyawan tetap pada performa dan kualitas yang baik maka dibutuhkan sebuah pemberian Reward dan Punihsment. dalam kegiatan pemberian Reward dan Punihsment harus dilakukan berdasarkan keriteria dan data lapangan yang akurat agar tepat sasaran dan tidak ada yang merasa dirugikan. Untuk menunjang agar kegiatan pemberian Reward dan Punihsment dapat berjalan sesuai dengan aturan yang ada maka dibuatlah sebuah sistem pendukung keputusan yang mana dapat membantu memberikan rekomendasi pemberian reward dan punishment dengan keriteria yang telah ditentukan untuk mendapatkan Reward dan Punihsment. metode C4.5 diterapkan dalam sistem pendukung keputusan ini. sistem pendukung keputusan membantu HRD dalam memberikan rekomendasi keputusan. Metode C.4.5 merupakan metode pohon keputusan. Metode C4.5 bisa diterapkan jika sebelumnya sudah ada data learning karna dari data Learning itulah pohon keputusan dibentuk. \r\n\r\nKata Kunci: Sistem Pendukung Keputusan, algoritma C4.5, Pemberian Reward dan Punishmen', 'Mohammad Fathul Harib Amrulloh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100072'),
(377, '100411100073', 'PEMANFAATAN DATA MINING UNTUK SISTEM REMEDIAL MENGGUNAKAN METODE FP-Growth BERBASIS WEB', 'Andharini D. C., S.Kom., M.Kom', 'Sigit Susanto P, S.Kom., M.Kom', 'E-learning merupakan suatu sistem belajar mengajar dengan metode baru yaitu menyampaikan materi pembelajaran dan kegiatan belajar yang berlangsung di dalam suatu sistem yang terhubung dengan internet. Kegiatan belajar mengajar hampir sama dengan sekolah, yaitu, mempelajari materi, latihan soal dan ujian akhir atau disebut juga dengan post test. Dalam penelitian ini, peneliti menambah fitur pada sistem remedial pada e-learning yang menampilkan rekomendasi pembelajan terhadap siswa setelah menyelesaikan latihan soal. Jika siswa tidak dapat lulus pada latihan suatu bab, maka siswa mempelajari kembali bab yang direkomendasikan oleh sistem dan juga mengikuti latihan kembali. Untuk memperoleh pola remedial digunakan Algoritma FP-Growth yatu salah satu algoritma pada metode Association Rules. Data yang diolah untuk membentuk pola rekomendasi remedial adalah data ujian harian siswa di sekolah. Hal ini berdasarkan pada Market Basket Analysis yaitu pembentukan suatu pola untuk menentukan letak susunan barang pada atau pasar berdasarkan transaksi belanja yang sudah pernah ada market sebelumnya, dengan melihat besar persentase hubungan antar barang yang dibelanjakan. Pada sistem remedial, sistem akan membentuk pola berdasarkan bab dengan nilai latihan tidak lulus.\r\n\r\nKata kunci : Association Rules, E-learning, FP-Growth, Market Basket Analysis,  Remedial', 'Fevbrina Sylvia Alnora Pakpahan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100073'),
(378, '100411100074', 'PENGEMBANGAN SISTEM MONITORING DISTRIBUSI GURU SEKOLAH DASAR NEGERI DI KABUPATEN GRESIK BERBASIS STANDAR PELAYANAN MINIMAL (SPM)', 'M. Kautsar Sophan, S.Kom., M.MT.', 'Rika Yunitarini, S.T., M.T.', 'Untuk meningkatkan mutu pendidikan setiap sekolah membutuhkan guru berkualitas yang menyebar secara merata di seluruh daerah. Namun hingga saat ini pemerataan guru masih perlu peningkatan karena belum sesuai dengan Standar Nasional Pendidikan (SNP). Mengingat pemenuhan SNP masih dirasakan sulit bagi banyak sekolah, maka Standar Pelayanan Minimal (SPM) dirancang sebagai tahapan awal untuk mencapai SNP. \r\nAplikasi sistem ini dibuat berbasis web yang disajikan dalam bentuk peta dan grafik sehingga mempermudah pengguna dalam memahami informasi distribusi guru SDN di kabupaten Gresik, dengan bahasa pemrograman yang digunakan adalah PHP, HTML, dan CSS. Sistem ini dibangun dengan menggunakan leaflet.js untuk menampilkan peta lokasi SDN di wilayah kabupaten Gresik. Sistem ini dibagi atas 2 user, yaitu : admin (pegawai dinas) dan pengguna umum (guru). Admin dapat menginputkan data sekolah, dan pengguna umum dapat melihat informasi sekolah berdasarkan distribusi guru dan analisis SPM perkecamatan.\r\nPada uji coba sistem yang telah dilakukan di Dinas Pendidikan Kabupaten Gresik menunjukkan bahwa pengguna dapat dengan mudah melakukan monitoring distribusi guru berdasarkan penggunaan sistem serta kelengkapan fitur. Hal itu dapat ditunjukkan dari hasil  quisioner pada 10 orang responden.\r\n\r\nKata kunci : Pendidikan, Monitoring, Distribusi Guru, SPM', 'Ria Ismawati Sholihah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100074'),
(379, '100411100075', 'RANCANG BANGUN GAME RUMAH PERKALIAN', 'ARIK KURNIAWATI, S.Kom., M.T.', 'YONATHAN FERRY HENDRAWAN, S.T., M.IT.', 'Game Rumah perkalian merupakan salah satu game edukasi matematika. Game ini dapat membantu pemain dalam belajar perkalian maupun untuk mengasah kemampuan berhitung. Game Rumah Perkalian ini menyerupai game Tic-Tac-Toe atau yang lebih dikenal dengan XOX. Akan tetapi pada game Rumah Perkalian terdapat fitur tambahan yaitu perhitungan perkalian. Perkembangan teknologi yang semakin pesat telah menghadirkan teknologi smartphone atau ponsel pintar, salah satunya adalah Android. Kehadiran Android dapat digunakan sebagai media game. Baik itu untuk membuat game maupun untuk bermain game. Pada penelitian ini, game Rumah Perkalian dibangun dengan menggunakan bahasa pemrograman Java. Sedangkan media implementasi yang dipilih adalah smartphone yang berbasis Android. Pada penelitian ini, game Rumah Perkalian dibangun dengan menggunakan bahasa pemrograman Java. Sedangkan media implementasi yang dipilih adalah smartphone berbasis Android. Penelitian ini bertujuan untuk mengetahui apakah game Rumah Perkalian dapat berjalan dengan baik pada smartphone Android atau tidak. Dari penelitian ini diperoleh kesimpulan bahwa game Rumah Perkalian dapat berjalan dengan baik pada smartphone Android. Resoulusi game berjalan optimal pada device yang memiliki resolusi 320 x 480 piksel serta untuk semua device yang memiliki perbandingan resolusi 2:3 atau 3:2. Dengan adanya penelitian ini diharapkan dapat membantu pemain dalam memperkuat kemampuan berhitung khususnya perkalian.', 'SUDIYANTO', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100075'),
(380, '100411100076', 'SISTEM INFORMASI EVALUASI PENILAIAN LAYANAN PROGRAM STUDI (Studi Kasus: Teknik Informatika Universitas Trunojoyo Madura) ', 'Achmad Jauhari, ST., M.Kom.', 'Rika Yunitarini, ST., MT. ', 'Dalam peningkatan mutu akademik maupun non-akademik mahasiswa teknik informatika Universitas Trunojoyo Madura (UTM), diperlukan adanya evaluasi penilaian layanan program studi yang meliputi beberapa aspek seperti pengembangan bakat minat, bimbingan dan konseling, serta pembinaan soft skill. Saat ini, penilaian dilakukan dengan menggunakan lembaran kertas yang sangat rentan terjadinya duplikasi data serta beresiko besar mengalami kerusakan atau kehilangan karena tidak adanya pengawasan. Selain itu, jumlah data yang masuk dan harus dihitung mencapai tiga ribu data setiap semester. Dari data sebanyak itu, tim jaminan mutu diharuskan memberikan evaluasi yang cepat dan tepat. Penelitian ini menempatkan key performance indicator sebagai nilai pembanding bagi keseluruhan nilai dari setiap aspek layanan yang telah dihitung dengan metode Cumulative Voting. Sementara untuk penilaian angka kepuasan mahasiswa, penilaian dihitung menggunakan metode SMARTER yang memperhatikan setiap kriteria penilaian dan memberikan pembobotan di setiap aspek maupun jenis layanan program studi Teknik Informatika UTM. Berdasarkan hasil ujicoba yang diterapkan, sistem ini dinilai mampu memberikan kemudahan penilaian serta mengetahui hasil layanan dengan presentase 79% yang masuk kedalam kategori memuaskan.  \r\nKata kunci: Sistem Informasi (SI), layanan prodi, SMARTER Teknik Informatika UTM, Cumulative Voting, Key Performance Indicator (KPI) ', 'Aditya Wahyu Pratama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100076'),
(381, '100411100077', 'ANALISA JARINGAN IPV4 DAN IPV6 PADA LOCAL AREA NETWORK (LAN) DENGAN SISTEM TUNNELING \r\n(Studi Kasus : Teknik Informatika Universitas Trunojoyo Madura)', 'DWI KUSWANTO,S.Pd., M.T.', 'IWAN SANTOSA,S.T., M.T.', 'Penerapan sistem tunneling dalam suatu jaringan merupakan salah satu cara untuk mengintegrasikan jaringan IPv4 dengan jaringan IPv6. Sistem tunnel yang dipakai dan diimplementasikan dalam penelitian ini adalah tunnel IPv4 over IPv6 dan tunnel IPv6 over IPv4, dimana dari keduanya akan dibandingkan nilai Quality Of Service (QOS) dengan parameter pengukur seperti kecepatan upload, download, delay, paket loss, troughput dan juga jitter. Pengambilan data dilakukan pada saat upload file dari client ke server serta download file dari client ke seirver dengan menggunakan aplikasi network analyzer yakni wireshark. Dari penerapan sistem tunneling di Lab Terpadu Teknik Informatika Universitas Trunojoyo Madura didapat beberapa kesimpulan bahwa pada saat upload file QOS jaringan IPv4 Over IPv6 lebih bagus dari jaringan IPv6 over IPv4, ini dibuktikan dari nilai delay, paket loss dan jitter dari IPv6 over IPv4 lebih tinggi sedangkan nilai troughput-nya lebih rendah IPv6 over IPv4. Sementara pada saat download file, QOS jaringan IPv6 over IPv4 lebih bagus dari jaringan IPv4 over IPv6, ini dibuktikan dari nilai delay, paket loss dan jitter dari IPv4 over IPv6 lebih tinggi sedangkan nilai troughput-nya lebih rendah IPv4 over IPv6 ', 'ROBY ASYARI ZULKARNAIN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100077'),
(382, '100411100079', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN PEMINATAN UNTUK SISWA BARU SEKOLAH MENENGAH ATAS\r\n\r\n', 'Mula\'ab,S.Si.,M.Kom.', 'Rika Yunitarini,S.T.,M.T.', 'ABSTRAK \r\n\r\nTahun Ajaran 2013/2014 akan diwarnai dengan perubahan kurikulum. Sebab mulai Juni 2013 kemarin atau persis awal tahun ajaran 2013/2014 seluruh sekolah di Indonesia dari berbagai jenjang pendidikan sudah harus menggunakan Kurikulum 2013 dalam proses KBM (Kegiatan Belajar Mengajar). Pada kurikulum 2013 ini, penjurusan ditiadakan diganti dengan nama peminatan. \r\n\r\nPenentuan peminatan ini langsung ditentukan ketika calon siswa baru melakukan pendaftaran ke Sekolah Menengah Atas. Dasar penentuan peminatan ini berdasarkan dari tujuh kriteria yaitu nilai MIPA rapor (Matematika dan IPA), nilai IPS rapor, nilai MIPA UN (Matematika dan IPA), nilai IPS UN, hasil tes IQ, tes IPA dan tes IPS. Dalam hal ini yang paling berperan penting yaitu Guru BK. Maka dari itu, penelitian ini akan menyajikan suatu Sistem Pendukung Keputusan yang nantinya dapat mempermudah kinerja Guru BK dalam pengambilan keputusan penentuan peminatan untuk siswa baru nantinya. \r\n\r\nSistem Pendukung Keputusan yang menggunakan algoritma C45 ini menghasilkan dua pohon keputusan yang memiliki Precission, Recall, Accuracy dan Eror yang berbeda. Pohon keputusan pada partisi pertama mencapai Precissionnya 53,66% , Recallnya 56,41% ,  Accuracynya 70,25% dan Eror  mencapai 29,75%. Sedangkan pada pohon keputusan partisi kedua Precissionnya 58,54% , Recallnya  60% , Accuracynya 72,95% dan Eror 27,05%. \r\n\r\n \r\n\r\nKata Kunci: C45, Peminatan, Sistem Pendukung Keputusan, dan Siswa Baru\r\n\r\n', 'Atin Hasanah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100079'),
(383, '100411100080', 'Rancang Bangun Game Metamorph Menggunakan Cocos2d-x Framework Berbasis Android', 'Arik Kurniawati, S.Kom., M.Kom.', 'Yonathan Ferry Hendrawan, S.T., MIT.', 'Game pembelajaran metamorfosis selanjutnya disebut Metamorph merupakan salah satu game edukasi biologi. Game ini dapat membantu pemain dalam belajar proses metamorfosis. Game Metamorph ini menyerupai game 2048, penjumlahan antar kotak yang kemunculannya diatur secara acak. Akan tetapi pada game Metamorph terdapat fitur pembeda yaitu pembelajaran metamorfosis. Android dapat digunakan sebagai media game. Baik itu untuk membuat game maupun untuk bermain game. Pada penelitian ini, game Metamorph dibangun menggunakan framework Cocos2d-x dengan bahasa pemrograman C++.  Sedangkan media implementasi yang dipilih adalah smartphone yang berbasis Android. Penelitian ini dilakukan untuk mengetahui hasil implementasi menggunakan framework Cocos2d-x. Cocos2d-x Framework adalah engine yang memiliki banyak class. Pengambilan keputusan nilai kotak dan posisinya diatur oleh class random yang telah disediakan oleh Cocos2d-x Framework. Setelah itu dilakukan runut balik untuk menentukan nilai dan posisi kotak berikutnya. Dari penelitian ini diperoleh kesimpulan bahwa Cocos2d-x Framework dapat digunakan sebagai mesin pembangun game Metamorph.  Game dapat berjalan dengan lancar dan tampilan yang tetap proporsional ketika dilakukan uji coba pada beberapa device.', 'FAHRUR ROZI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100080'),
(384, '100411100081', 'PEMBUATAN MESIN PENCARIAN DAN IDENTIFIKASI TERJEMAHAN HADITS BUKHARI DAN MUSLIM MENGGUNAKAN METODE VECTOR SPACE MODEL', 'Firdaus Solihin,S.Kom.,M.Kom', 'Fika Hastarita Rachman,S.T., M.Eng', 'Pada zaman ini sudah banyak pencarian hadits, namun kebanyakan hanya mengacu pada 1 hadits, sehingga masyarakat kesulitan untuk membandingkan dengan hadits yang lain. Oleh karena itu pada penelitian ini dibuat mesin pencari identifikasi  2 hadits. Mesin pencari identifikasi hadits ini merupakan aplikasi berbasis web dengan menggunakan 2 sumber hadits sahih. Hadits yang digunakan dalam mesin pencari ini bersumber dari 2 kitab, yaitu: hadits Bukhari dan hadits Muslim.  Aplikasi mesin pencari berbasis web ini dapat memudahkan dalam mencari dan mengidentifikasi isi hadits dalam Kitab Terjemahan Bukhari Muslim dan dapat memberikan output yang sesuai dengan Keyword yang dimasukkan oleh user.  Mesin pencari ini menggunakan metode Vector Space Model yaitu untuk proses penghitungan kemiripan antar dokumen hadits yang dikonversi ke dalam suatu model ruang vektor. Berdasarkan hasil dari pengujian sistem, didapatkan nilai minimal cosine similarity paling baik adalah dengan pembatasan threshold 0,1. Dengan rata-rata presentase nilai f-measure atau tingkat efisiensi kinerja sistem ini mencapai 62% untuk hadits Bukhari dan 66% untuk hadits Muslim.\r\n\r\nKata kunci: Hadits, Vector Space Model, Mesin Pencarian\r\n', 'Fitriyah Dwindah Mukhtalifah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100081'),
(385, '100411100082', 'SISTEM PENDUKUNG KEPUTUSAN PENJURUSAN SISWA BARU MENGGUNAKAN METODE ENTROPY dan TOPSIS', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Rika Yunitarini, S.T., M.T.', 'Pendidikan merupakan salah satu kebutuhan yang harus dipenuhi oleh setiap masyarakat, hampir semua orang diwajibkan mengikuti pendidikan dan melaksanakan pendidikan. SMA Negeri 1 Lamongan adalah Sekolah Menengah Atas Negeri di kota Lamongan yang sedang mengembangkan teknologi komputer dalam berbagai aspek-aspek kegiatan belajar dan mengajar. Dalam mengolah data-data penentuan jurusan yang mendukung dalam hal peminatan siswa kelas X, SMAN 1 Lamongan masih menggunakan cara manual yakni menggunakan software microsoft excel. Tujuan penelitian ini untuk membangun sebuah aplikasi sistem pendukung keputusan penjurusan calon siswa baru.  Metodologi yang digunakan adalah metode Entropy dan metode TOPSIS. Berdasarkan hasil respons siswa dan guru terhadap aplikasi Sistem Pendukung Keputusan Penjurusan Siswa Baru Menggunakan Metode Entropy dan TOPSIS  menunjukan respons yang positif dengan persentase total respons siswa adalah sebesar 94,6% (sangat baik) dan persentase total respons guru sebesar 95,84% (sangat baik). Penelitian dengan metode ini mendapatkan hasil rekomendasi siswa yang sesuai dengan peminatannya berdasarkan kriteria yang ada yaitu rata nilai matematika, rata nilai ipa, dan tes akademik berbasis komputer. Penelitian ini mendapatkan hasil akurasi sistem yang mencapai 65,3%. \r\n\r\nKata Kunci :  Sistem Pendukung Keputusan, Metode Entropy, Metode Topsis, Sekolah Menengah Akhir\r\n', 'Satrio Agung Laksono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100082'),
(386, '100411100085', 'EDI (ELECTRONIC DATA INTERCHANGE) PADA PORTAL UKM MENGGUNAKAN METODE REST (REPRESENTATIONAL STATE TRANSFER)', 'HERMAWAN, S.T, M.Kom', 'BAIN KHUSNUL KHOTIMAH, S.T, M.Kom', 'Data elektronik merupakan salah satu jenis data yang saat ini paling populer, karena semua orang mampu mengaksesnya dengan jaringan internet. Apabila data elektronik dan pertukarannya ini dimanfaatkan dengan baik maka akan berdampak positif pula bagi yang memanfaatkannya. Pertukaran Data Elektronik (Electronic Data Interchange (EDI)) tersebut, sangatlah cocok untuk diterapkan pada UKM (Usaha Kecil Menengah) yang perlu mempromosikan dan mencatat seluruh data produknya, yang pastinya untuk meningkatkan kualitas dan popularitas usahanya tersebut.\r\nREST (Representational State Transfer) merupakan salah satu metode yang paling sesuai untuk menerapkan Electronic Data Interchange (EDI) yang memiliki tugas utama, nantinya mampu melakukan pertukaran data dari berbagai server di setiap media promosi pemilik UKM (Usaha Kecil Menengah).\r\nPada akhirnya, penelitian ini menghasilkan media promosi online yang semua Usaha Kecil Menengah (UKM) bisa memanfaatkannya sebagai tempat promosi produk mereka. Sehingga, dengan Media Promosi ini nanti, Usaha Kecil Menengah mampu berkembang dan bersaing dengan Usaha Maju yang sebelumnya sudah mempromosikan produknya pada media promosi online.', 'MUHAMMAD ZAMRONI HAMZAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100085'),
(387, '100411100088', 'PENERAPAN MODEL ONTOLOGI UNTUK SISTEM PENCARIAN SEMANTIK NAMA DAN MANFAAT OBAT', 'FIRDAUS SOLIHIN, S.KOM.,M.KOM', 'IWAN SANTOSA, S.T.,M.T', 'Saat ini sistem pencarian nama dan manfaat obat masih menggunakan pencarian biasa dan hasil dari pencarian tidak dapat memberi informasi mengenai keterkaitan dari suatu obat, misalnya kontra atau pantangan dari obat-obat tertentu. Oleh karena itu dibutuhkan sebuah sistem pencarian yang dapat menangani dari permasalahan diatas, agar dapat memberikan informasi tambahan yang bermanfaat bagi pengguna. Untuk menyelesaikan permasalahan tersebut, pada penelitian ini dibangun sebuah sistem pencarian nama dan manfaat obat dengan menggunakan metode semantik. Metode ini memungkinkan untuk mencari keterkaitan atau persamaan dari kata kunci yang dimasukkan oleh pengguna. Dengan menggunakan ontologi sebagai dasar dari sistem yang dibuat. Metode ini harapannya dapat membantu pengguna untuk mendapatkan informasi yang sesuai dengan kebutuhan dari pengguna. Dalam penelitian ini sistem pencarian dapat mengakses file database yang berbentuk owl dan dapat memberikan informasi berupa kontra / pantangan dari obat tertentu. Dengan menggunakan metode semantik aplikasi pencarian nama dan manfaat obat ini mempunyai tingkat keakuratan yang cukup tinggi yaitu sebesar 82,2%. Hanya saja ada beberapa jenis penyakit yang hanya bisa dicari menggunakan istilah dari bidang kedokteran.', 'TRI CAHYO LUTFINANDA AMRULLOH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100088'),
(388, '100411100090', 'SISTEM TEMU KEMBALI INFORMASI PADA JUDUL JURNAL MENGGUNAKAN \nLATENT SEMANTIC ANALYSIS\n', 'Hermawan, S.T.,M.Kom', 'Rika Yunitarini, S.T.,M.T', 'Ketersediaan informasi dalam jumlah besar di satu sisi merupakan berkah yang patut disyukuri pada zaman ini, karena dengannya kehidupan manusia akan semakin mudah. Namun di sisi lain, melimpahnya informasi ini melahirkan permasalahan baru bagi manusia. Yaitu, perihal bagaimana mendapatkan informasi yang dibutuhkan secara tepat dan akurat diantara kumpulan berbagai informasi. Untuk itu dikembangkanlah cara untuk mengatasi permasalahan ini yaitu sistem temu kembali informasi atau information retrieval. Suatu sistem temu kembali informasi yang baik memiliki tingkat relevansi yang bisa diterima oleh pengguna. Untuk dapat menghasilkan nilai relevansi yang tinggi, maka salah satu caranya, sistem ini perlu menerapkan metode perangkingan yang baik dan teruji. Kemudian yang menjadi pertanyaan, bagaimana menentukan suatu kinerja metode perangkingan. Kinerja metode perangkingan ditentukan oleh relevansinya yang diukur dengan parameter precision dan recall. Latent semantic analysis pada tugas akhir ini akan dikombinasikan dengan cosine similarity, sehingga untuk mengukur kinerjanya perlu diimplementasikan ke dalam perangkat lunak untuk kemudian diuji parameternya.\nDalam suatu pengujian diperlukan metode lain sebagai pembanding untuk mengukur kinerja latent semantic analysis yang dikombinasikan dengan cosine similarity, maka dipilihlah vector space model sebagai pembanding.\nHasil pengujian pada tugas akhir ini menunjukan bahwa latent semantic analysis memiliki nilai similaritas yang lebih baik dari vector space model dengan nilai precision 81,5% dan nilai recall sebesar 80,2% sedangkan nilai f-measurenya 80,8\n\n\n', 'Azir Muhammad Fannani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100090'),
(389, '100411100091', 'EFEKTIFITAS PENERAPAN \nLINEAR CONGRUENT METHOD (LCM) \nUNTUK PENGACAKAN SOAL PADA UJIAN ONLINE \n', 'Achmad Jauhari, S.T., M.Kom.', 'Imamah, S.Kom, M.Kom.', 'kecanggihan teknologi semakin berkembang, maka perlu bagi kita memanfaatkannya dalam segala struktur kehidupan, salah satunya adalah pendidikan. Melihat studi kasus yang banyak terjadi saat ini, dimana pelaksanaan ujian secara konvensional dianggap kurang efektif dan efisien karena membutuhkan biaya yang besar, membutuhkan waktu yang lama dalam pelaksanaannya dan rentan terjadi kecurangan siswa sehingga perlu dilakukan perbaikan dengan mengubah sistem ujian berbasis komputer. \nDalam setiap pelaksanaan ujian perlu memperhatikan tindak kecurangan yang dilakukan siswa berupa mencontek dan kerja sama bertukar jawaban, sehingga ujian bisa lebih efektif.\nMaka dengan permasalahan di atas ini, sangat penting sekali dibuat sebuah sistem ujian yang bisa menghasilkan lulusan yang bermutu dengan mengandalkan kejujuran. Salah satu cara yang bisa ditempuh adalah dengan mengubah system ujian  dengan mengacak soal-soal ujian tersebut  menggunakan metode-metode pengacakan yang tersedia, yaitu Linear Congruent Method (LCM),  untuk mengacak soal ujian  tiap masing-masing peserta sehingga soal yang muncul untuk masing-masing peserta tidak ada yang sama, juga tidak membutuhkan lagi system paket sebagaimana sekarang. Maka dengan system penerapan LCM sebagai metode pengacakan soal pada ujian online seperti ini akan mengurangi kecurangan pada siswa dan lebih efektif bagi siswa dalam melakukan ujian online. \n\nKata Kunci : Metode LCM (Linear Congruent Method), Pengacakan Soal\n', 'Siti Munawaroh ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100091'),
(390, '100411100093', 'RANCANG BANGUN SISTEM PENDUKUNG KEPUTUSAN PENJURUSAN SISWA SMA MENGGUNAKAN METODE VIKOR DAN ENTROPY', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'Rika  Yunitarini, ST., M.T.', 'Perkembangan teknologi pada saat ini telah dirancang untuk dapat mempermudah pekerjaan manusia. Sistem pendukung keputusan merupakan suatu teknologi yang dapat membantu untuk pengambilan suatu keputusan yang pada awalnya hanya dikerjakan secara manual hingga dapat diselesaikan dengan sistem yang telah terkomputerisasi. Penjurusan minat siswa SMA merupakan salah satu permasalahan yang dapat diselesaikan dengan menggunakan Sistem Pendukung Keputusan.\r\nSistem Pendukung Keputusan ini menggunakan metode Vikor dan Entropy. Vikor merupakan salah satu metode pengambilan keputusan yang dapat membantu para pengambil keputusan dalam melakukan perangkingan, dimana Entropy sebagai pembobotan dari setiap kriteria yang bertujuan untuk memberikan objektifitas pembobotan kriteria yang telah ditetapkan oleh panitia penjurusan di SMA Negeri 1 Wonoayu. Sistem ini menggunakan 3 kriteria yakni, hasil rekomendasi tes IQ, nilai placement tes IPA, dan nilai placement tes IPS.\r\nPada penelitian ini, hasil rekomendasi didapatkan dengan merangking semua hasil pengolahan data nilai siswa dan membandingkan dengan minat siswa. Tingkat akurasi penjurusan pada sistem ini terhadap data asli penjurusan mencapai 92%.\r\n', 'Febrianto Dwi Rohandi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100093'),
(391, '100411100094', 'DETEKSI OPTIC NERVE HEAD (ONH) PADA CITRA RETINA MENGGUNAKAN MORFOLOGI MATEMATIS DAN TRANSFORMASI HOUGH', 'Dr. Arif Muntasa, S.Si, M.T', 'Dr. Indah Agustien S, S.Kom, M.Kom.', 'Citra retina telah digunakan secara luas di dalam proses diagnosa gangguan mata, seperti\ndiabetes retinopati dan glukoma. Analisa dan pemrosesan citra retina memiliki peranan yang signifikan\ndi dalam dunia medis. Pada umumnya, citra retina dianalisa secara manual oleh ophthalmologis dalam\njangka waktu yang lama dengan sumber daya yang terbatas. Automasi analisa citra retina memberikan\nkemudahan dan kecepatan analisa dengan tingkat akurasi yang setara dengan hasil analisa secara\nmanual. Penelitian ini menawarkan pengembangan metode deteksi fitur citra retina, yaitu Optic Nerve\nHead (ONH) atau yang dikenal dengan nama Optic Disc (OD) menggunakan Morfologi Matematis dan\nTransformasi Hough. Secara garis besar, metode yang digunakan dalam penelitian ini meliputi beberapa\ntahapan. Tahap pertama adalah perbaikan kontras citra menggunakan metode Local Contrast\nEnhancement (LCE). Dilanjutkan penentuan area Region of Interest (ROI) dengan mengacu pada\nchannel warna yang dipilih. Penelitian ini memanfaatkan dua channel warna (Red dan Green) dalam\nproses pendeteksian area OD. Tahapan kedua, proses segmentasi bentuk OD menggunakan rangkaian\noperasi morfologi matematis (dilasi, erosi, opening, closing, dan rekonstruksi). Bentuk garis tepi OD\nyang terdeteksi akan divoting menggunakan transformasi Hough dalam proses marking lokasi OD.\nMetode yang diajukan dalam penelitian ini diujikan pada basis data citra MESSIDOR dengan\nmengambil sampel citra warna dan citra ground truth 30% dari 1200 citra total. Hasil uji dari penelitian\nmenggunakan morfologi matematis mendapat tingkat akurasi sebesar 93,05% dan nilai akurasi dari\nkombinasi morfologi matematis serta transformasi Hough sebesar 96,84%\n\nKata kunci : optic nerve head, optic disc, region of interest, local contrast enhancement, morfologi\nmatematis, transformasi Hough', 'Naashihuddin Anshor Faraby', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100094'),
(392, '100411100095', 'RANCANG BANGUN ADVANCED SEARCH PENJUALAN MOBIL MENGGUNAKAN METODE WEIGTED TREE SIMILARITY', 'Firdaus Solihin, S.Kom.,M.Kom.', 'Iwan Santosa, ST.,M.T.', 'ABSTRAK\r\nPerkembangan teknologi informasi khususnya teknologi informasi internet sangatlah pesat. Hal ini membuat arus informasi dan pertumbuhan jumlah data penjualan mobil di internet menjadi sangat tinggi, hampir setiap detik muncul data penjualan mobil yang baru. Hal ini akan semakin membingungkan para pengguna internet untuk menemukan data penjualan mobil yang diinginkan. Para konsumen/pelanggan mobil diberikan berbagai pilihan mobil yang melimpah di internet.\r\nPenggunaan advanced search merupakan sebuah solusi untuk pencarian yang lebih spesifik dan tersedia beberapa pilihan menu untuk membedakan spesifikasi yang dicari. Proses mengumpulkan semua informasi yang ada di dalam  halaman web menggunakan web crawler, web crawler akan berjalan menelusuri halaman web dan mengumpulkan data-data kemudian melakukan proses download data yang telah dikumpulkan oleh web crawler.Data-data tersebut akan dibuat tree berdasarkan kategorinya menggunakan  metode weighted tree similarity dengan membandingkan antara 2 tree(tree pemberi informasi dan tree user) dengan bobot yang ditentukan oleh user.Apabila user memasukkan inputan tanpa memberi bobot maupun semua bobot yang bernilai sama maka hasil pencariannya akan sama, apabila user memberikan bobot yang lebih besar  pada menu pilihan tertentu dari menu yang lainnya,maka pilihan tersebut akan menjadi prioritas yang utama dari yang lainnya dikarenakan memiliki tingkat kemiripan yang lebih besar, Semakin tinggi nilai bobot,maka tingkat kemiripan akan lebih besar.\r\n\r\nKata kunci: advanced search, penjualan mobil, weighted tree similarity.\r\n', 'Muhammad Alfa Hesyim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100095'),
(393, '100411100096', 'APLIKASI SISTEM INFORMASI EVALUASI MUTU AKADEMIK DAN PROSES PEMBELAJARAN BERBASIS ANDROID (STUDI KASUS: PROGRAM STUDI TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO MADURA)', 'Achmad Jauhari ,ST., M.Kom.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'ABSTRAK\n\nSetiap semester program studi Teknik Informatika Universitas Trunojoyo melakukan evaluasi mutu akademik. Evaluasi tersebut dilakukan secara manual dengan mengisi formulir evaluasi berupa lembaran kertas. Proses evaluasi ini melibatkan seluruh mahasiswa Teknik Informatika. Namun, proses evaluasi tersebut dinilai kurang efektif. Dikarenakan data-data yang diperoleh kurang akurat disebabkan oleh beberapa kendala seperti, mahasiswa lupa untuk melakukan pengisian form kuesioner, mahasiswa kehilangan form, mahasiswa membuang form, mahasiswa tidak/lupa mengumpulkan form, mahasiswa menyuruh teman lain mengisikan dan lain-lain.\nSalah satu cara untuk meminimalisir kendala-kendala yang mengganggu proses evaluasi tersebut adalah dengan membangun aplikasi sistem informasi evaluasi mutu akademik berbasis mobile. Saat ini teknologi mobile sudah berkembang pesat, salah satunya adalah smartphone dengan sistem operasi Android. Smartphone bersistem operasi Android merupakan jenis smartphone yang paling banyak digunakan disemua kalangan termasuk pelajar. Dibangun dengan menggunakan IDE Android Studio.\nBerdasarkan hasil pengujian, penelitian ini dapat menghasilkan aplikasi mobile berbasis android dengan fitur kuesioner evaluasi dan menampilkan nilai hasil kuesioner dengan persentasi kestabilan 90% pada sinyal bagus dan rata-rata 52% pada sinyal buruk. \n\nKata Kunci: Aplikasi, Akademik, Mobile, Smartphone, Android, Kuesioner.\n', 'Asmul Farsyadani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100096');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(394, '100411100097', 'RANCANG BANGUN GAME PEMBELAJARAN PENGENALAN\nWARNA, BENTUK DAN HURUF MENGGUNAKAN COCOS2DX\nFRAMEWORK', 'Arik Kurniawati,S.Kom.,M.T', 'Yonathan Ferry Hendrawan, ST., M.IT', 'Game Flappy Color merupakan salah satu game edukasi. Game ini dapat membantu pemain dalam\nbelajar mengenal warna, bentuk dan huruf. Game Flappy Color ini menyerupai game flappy bird, akan tetapi\ndalam game flappy color ini terdapat fitur tambahan yaitu pengenalan warna, bentuk dan huruf. Seiring\nperkembangannya game dapat kita jumpai dimana saja salah satu contoh yang popular saat ini adalah\nperangkat bergerak (smartphone) yang berbasis android. Kehadiran android dapat digunakan sebagai media\ngame, baik itu untuk membuat game maupun untuk bermain game. Smartphone ini telah menjadi kebutuhan\npokok bagi masyarakat, juga sangat praktis dan memiliki banyak fitur seperti aplikasi game dan lain-lain.\nPada penelitian ini, game flappy color dibangun dengan Bahasa pemrograman C++ sedangkan media\nimplementasinya adalah smartphone yang berbasis android. Pengembangannya yang open source\nmenjadikan banyak aplikasi dan game baru yang menjawab kebutuhan pengguna hal ini yang memicu\npenulis membuat aplikasi game yaitu “Rancang Bangun Game Pembelajaran Pengenalan Warna, Bentuk\ndan Huruf dengan Cocos2d-x Framework” di perangkat bergerak (smartphone).\nKata Kunci : Game Edukasi, pengenalan warna, peengenalan bentuk, pengenalan huruf, Android, Cocos2dx\nFramework.', 'Zainal Mutaqqin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100097'),
(395, '100411100098', 'Sistem Temu Kembali Citra Berdasarkan Isi Berbasis Kuantisasi Menggunakan Euclidean Distance', 'Dr. Indah Agustien S., S.Kom., M.Kom', 'Mula\'ab, S.Si., M.Kom', 'Citra, salah satu sumber informasi yang paling cepat dipahami oleh mata kita. Hal ini menyebabkan jumlah citra terus bertambah untuk memenuhi kebutuhan informasi. Sistem temu kembali citra merupakan teknik yang dikembangkan untuk mempermudah pencarian citra.\nSistem temu kembali citra merupakan sistem pencarian citra yang berdasarkan fitur utama dari citra. Fitur utama, yaitu warna, tekstur, bentuk, atau informasi yang lain pada citra. Sistem temu kembali citra menerima input berupa citra dan akan mengembalikan beberapa citra yang relevan. Citra input akan diekstraksi fiturnya menggunakan metode sesuai dengan fitur apa yang akan digunakan. Setelah ekstraksi fitur, maka proses selanjutnya merupakan pengukuran jarak kemiripan. \nPada penelitian ini input berupa citra warna RGB. Citra inputan kemudian dikonversi menjadi citra HSV. Tahap selanjutnya kuantisasi warna citra HSV. Tahap terakhir pengukuran jarak kemiripan antara citra query yang telah terkuantisasi dengan citra database menggunakan Euclidean Distance. Pengujian pada sistem akan dilakukan dalam tiga skenario dalam penentuan jumlah data training dan data query. Pada akhir penelitian tingkat akurasi sistem dihitung dengan recall dan precision untuk masing – masing skenario. Tingkat akurasi tertinggi didapatkan pada skenario II dengan  recall 0,42 dan precision 0,5.\n', 'Prafa Inanda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100098'),
(396, '100411100101', 'RANCANG BANGUN GAME ALENA ( AJHER NOLES KANAK) UNTUK PEMBELAJARAN BACA TULIS BERBASIS MOBILE ANDROID DENGAN FITUR DINAMIS LEVEL', 'Dr. Arif Muntasa, S.Si., MT.', 'Hermawan, ST., M.Kom.', 'Anak-anak merupakan penerus bangsa yang harus mendapat pendidikan yang baik sehingga menjadi generasi yang membanggakan karena kemampuan dan segudang prestasi yang diraih. Untuk mencapai itu semua sangat tidaklah mudah, anak-anak harus mendapatkan pembelajaran sedini mungkin. Dengan memanfaatkan teknologi mobile dan ditambah pembelajaran interaktif didalamnya akan sangat menarik minat kepada anak-anak untuk menggunakanya sehingga dapat membangun kemandirian anak untuk belajar. Pembelajaran yang interakif bisa dilakukan dengan pembelajaran berbasis game sehingga anak-anak merasa terhibur dan sekaligus memberikan pengetahuan baru kepada anak-anak. \r\nMelihat perkembangan game pada teknologi mobile maka penelitian ini mengangkat judul tentang Rancang Bangun Game Alena ( Ajher Noles Kanak) Untuk pembelajaran baca tulis berbasis mobile Android. Game Alena merupakan game edukasi pembelajaran menulis huruf latin yang disisipkan konten-konten bahasa lokal (Madura) dan mempunyai beberapa fitur seperti fitur pelatihan, ujian dan dinamis level. \r\nGame Alena dapat membantu pemahaman cara penulisan alfabet bagi anak-anak yang baru belajar menulis alfabet dan dapat dapat menguji kemampuan anak-anak dalam menulis alfabet.', 'Shohib', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100101'),
(397, '100411100102', 'Pengembangan Intrusion Prevention system pada internet server berbasis Suricata dan IPtables', 'Cucun Very Angkoso, S.T., M.T.', 'Dwi Kuswanto, S.Pd., M.T.', 'Keamanan jaringan sangat di perlukan untuk menjaga validitas dan integritas data pada server.Dengan tuntutan tersebut diperlukan sistem yang mampu mengamankan jaringan. Dalam penelitian ini intrusion prevention system yang berbasis suricata & IPTables yang diintegrasikan dengan WebUI(user interface) diimplementasikan pada server. Sebagai salah satu solusi menjaga keamanan jaringan. WebUI ini diharapkan dapat membantu administrator untuk mengawasi aliran jaringan yang menuju pada server. Kinerja dari Suricata dan WebUI, dapat dilihat dengan melakukan uji coba menggunakan tiga tools (Superscan,Nmap,Nikto). Ujicoba dilakukan sebanyak 50 kali percobaan penyusupan. Dimana dari tiga tools (Superscan,Nmap,Nikto)  tersebut di dapat sebuah hasil 890 alert tertinggi. Alert yang di hasilkan oleh serangan/penyusupan dari tools Nikto. Dengan hasil tersebut dapat disimpulkan bahwa 80% sistem Suricata dan WebUI mampu berjalan dengan baik  dengan mendeteksi dan mampu meberikan alert pada administrator.', 'Rahmat Hidayat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100102'),
(398, '100411100103', 'Rancang Bangun Aplikasi Pelacak Perjalanan (Travel Tracker) Pada Smartphone Berbasis Android', 'Moch. Kautsar Sophan, S.Kom, M.T.', 'Dr. Indah Agustien Siradjuddin, S.Kom, M.Kom.', 'Global Positioning System (GPS) merupakan sistem navigasi satelit yang sedang populer dan berkembang pesat pada saat ini. Pemanfaatannya sudah banyak diterapkan diberbagai bidang, salah satunya pemafaatan di bidang. Pada masa sekarang kebanyakan orang menganggap traveling merupakan sebuah hobi untuk membuka wawasan dan memperluas pengetahuan dalam mengunjungi tempat baru. Banyak pula yang menganggap traveling merupakan sesuatu aktifitas yang banyak mengeluarkan biaya, menimbulkan ketakutan karena tidak tahunya arah tujuan yang akan dijangkau dan bingung menentukan arah balik dari perjalanannya. Ada banyak cara menjadikan aktifitas traveling lebih efisien dan menyenangkan, salah satunya memanfaatkan teknologi GPS pada smartphone. Implementasi teknologi GPS berupa aplikasi banyak dikembangkan hampir disemua platform, salah satunya di platform android. Travel Tracker merupakan aplikasi pelacak perjalanan yang dapat merekam dan menampilkan rute/jalur perjalanan dalam bentuk peta (Google Map) sebagai monitoring arah balik dari peralanan yang sudah ditempuh. Perekaman rute/jalur perjalanan tersebut menyimpan data-data lokasi berupa rentetan titik latitude dan longitude dalam database. Aplikasi ini dibangun dengan pemograman java android menggunakan software ADT Bundle yang didalamnya terdapat eclipse. Aplikasi ini dikhususkan untuk perjalanan yang bersifat outdoor seperti traveling dan backpacking.\r\n\r\n\r\nKata Kunci: GPS, Android, Traveling, eclipse.\r\n', 'Sugianto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100103'),
(399, '100411100104', 'IMPLEMENTASI STUDENT LIFECYCLE MANAGEMENT DI SMA NEGERI 1 SEKARAN', 'Rika Yunitarini, S.T., M.T.', 'Sisgit Susanto Putro S.Kom., M.Kom', 'SMA Negeri 1 Sekaran merupakan Sekolah di lingkungan dinas Pendidikan kabupaten Lamongan. Sekolah yang memiliki banyak siswa ini juga merupakan salah satu sekolah Adiwiyata di kabupaten Lamongan. Maka dari itu,  sekolah ini membutuhkan sistem informasi yang terintegrasi dan bisa memantau siswanya maupun alumninya secara realtime. Student Lifecycle Management pada SMA N 1 Sekaran merupakan suatu sistem yang memberikan informasi laporan keaktifan siswa mulai dari pendaftaran sampai menjadi alumni dengan berbasiskan web, sehingga membantu kecepatan dan kualitas dalam penyampaian informasi akademik. Modul yang ada pada sistem ini antara lain yaitu : Student Accounting, Student Administration, Event Planing dan Teaching And Study. Berdasarkan hasil uji fungsionalitas, maka disimpulkan dari 27 deskripsi sebagian besar telah sesuai dengan desain Student Lifecycle Management  yang telah dirancang.', 'AFZAL FARID ALFAHMI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100104'),
(400, '100411100105', 'RANCANG BANGUN SISTEM INFORMASI MANAJEMEN ARSIP (Studi Kasus : SMK NEGERI 2 SURABAYA)', 'Andharini Dwi C, S.Kom., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Pengelolaan surat dalam suatu organisasi memegang peranan penting dalam proses administrasi. Dalam hal ini sistem tata persuratan menjadi salah satu faktor yang berpengaruh dalam pengelolaan surat pada SMK Negeri 2 Surabaya. Dengan adanya sistem ini dapat mengurangi penggunaan waktu yang cukup lama dalam pengarsipan surat dan disposisi, mengurangi penggunaan kertas, memperkecil kemungkinan terjadinya kesalahan dalam pencatatan, mempercepat proses pencarian surat, memudahkan pengontrolan surat disposisi serta mudah dalam penggunaan.Tujuan penelitian ini untuk membantu dan mempermudah user dalam mengelola surat, membuat disposisi ,membuat surat tugas dan memperoleh informasi melalui SMS gateway. Berdasarkan hasil respons tata usaha, waka, guru dan kepala sekolah terhadap aplikasi Sistem Informasi Manajemen Arsip menunjukan respons yang positif dengan persentase total respons tata usaha sebesar 94,1% (sangat baik), persentase total respons waka sebesar 96,4% (sangat baik), persentase total respons guru sebesar 91,7% (sangat baik) dan persentase total respons kepala sekolah sebesar 83,3% (sangat baik).\r\n', 'Muhammad Misbah Subkhi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/100411100105'),
(401, '110411100001', 'Sistem Pendukung Keputusan Pengukuran Produktivitas UKM Batik Menggunakan Metode Objective Matrix', 'Bain Khusnul Khotimah,S.T.,M.Kom 19800325 200312 2 002', 'Yeni Kustiyahningsih,S.Kom.,M.Kom 19770921 200812 2 002', 'Produktivitas merupakan salah satu faktor penting dalam mempengaruhi proses kemajuan dan kemunduran suatu usaha utamanya usaha kecil menengah. Dinas Perindustrian dan Perdagangan sebagai fasilitator Usaha Kecil Menengah dan menganalisis setiap tahun. Namun,sistem yang digunakan masih manual dengan cara observasi langsung ke setiap lokasi di Kabupaten Bangkalan . Oleh karena itu saya ingin mencoba untuk membangun sistem pendukung keputusan yang mampu mengidentifikasi beberapa kriteria yang efektif dan akurat. Metode yang digunakan adalah metode Analytical Hierarchy Process dan Objective Matrix .Metode  Analytical Hierarchy Process digunakan untuk melakukan perhitungan pembobotan , pembobotan dilakukan dengan melakukan pengolahan di Key Performance Indicators, sedangkan metode Objective Matrix digunakan untuk melakukan scoring produktivitas ukm batik . Data yang harus dikumpulkan seperti data produksi batik, data tenaga kerja,data modal yang digunakan dalam memproduksi batik . Dalam penelitian ini yang menjadi objek adalah ukm batik bangkalan ,yaitu ukm peri kecil dan ukm hj.unyil.\r\n Pada ukm peri kecil hasil analisa menunjukkan bahwa pada tahun 2013 ini ada 8 KPI yang masuk pada zona merah dan 1 KPI yang berada di zona kuning . zona merah yaitu pada level 0,1,2,3 dimana ini merupakan  pencapian  berada dibawah target dan harus diperbaiki sedangkan zona kuning yaitu 4,5,6,7 merupakan pencapain sedang namun manajemen harus berhati-hati . sedangkan pada ukm hj unyil Hasil analisa menunjukkan bahwa pada tahun 2013 ini ada 8 KPI yang masuk pada zona merah dan 1 KPI yang berada di zona kuning . zona merah yaitu pada level 0,1,2,3 dimana ini merupakan  pencapian  berada dibawah target dan harus diperbaiki sedangkan zona kuning yaitu 4,5,6,7 merupakan pencapain sedang namun manajemen harus berhati-hati .\r\n\r\nKata Kunci : Analitycal Hierarchy Process, Objective Matrix, Sistem Pendukung Keputusan.\r\n', 'Nila Septikadi 110411100001', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100001'),
(402, '110411100003', 'SISTEM PENGUKURAN KINERJA SUMBER DAYA MANUSIA PADA USAHA KECIL DAN MENENGAH (UKM) BATIK MENGGUNAKAN METODE INTEGRATED PERFORMANCE MEASUREMENT SYSTEM (IPMS)\r\n(STUDI KASUS : DINAS KOPERASI DAN UMKM KABU', 'Bain Khusnul Khotimah, ST., M.Kom', 'Firli Irhamni, ST., M.Kom', 'Usaha kecil dan menengah atau UKM adalah suatu bentuk usaha yang mempunyai peranan penting dalam penyerapan tenaga kerja yang ada di Indonesia. UKM-UKM yang ada di Indonesia diberdayakan oleh Dinas Koperasi dan UMKM. Maka dari itu, diperlukan suatu sistem pengukuran kinerja yang dimiliki oleh Dinas Koperasi dan UMKM untuk mengetahui kondisi dari UKM yang berada di bawah pemberdayaan dari dinas terkait sehingga dapat digunakan untuk meningkatkan kinerja dari UKM tersebut.\r\nMetode pengukuran kinerja yang digunakan dalam penelitian ini adalah metode Integrated Performance Measurement System (IPMS). Metode IPMS adalah metode pengukuran kinerja  yang melibatkan kebutuhan-kebutuhan dari setiap stakeholder (stakeholder requirement), sehingga kinerja UKM dapat terlihat secara menyeluruh berdasar stakeholder yang telah ditetapkan. Sedangkan Pembobotan yang digunakan dalam penelitian ini adalah metode Analytical Hierarchy Process (AHP). \r\nDi dalam penelitian ini mengidentifikasi 4 Stakeholder yang membentuk 10 Key Performance Indicators (KPI). Stakeholder tersebut antara lain stakeholder pelanggan, stakeholder tenaga kerja, stakeholder investor, dan stakeholder masyarakat. Hasil Kinerja UKM Peri Kecil pada bulan Januari sampai Mei tahun 2015 berurut-turut adalah 135,770; 99,580; 128,130; 107,221 dan 148,430. Sedangkan Kinerja UKM HMF/ HJ.Unyil adalah 127,799; 116,963; 124,972; 126,550 dan 131,232.\r\n\r\nKata Kunci : Sistem pengukuran kinerja, UKM, IPMS, KPI, AHP\r\n', 'Dewi Rahmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100003'),
(403, '110411100004', 'Pengenalan Tanda Tangan Menggunakan Metode Moment Invarian Dan Euclidean Distance', 'Fitri Damayanti, S.Kom., M.Kom', 'Dr. Indah Agustien S., S.Kom., M.Kom', 'Selama ini banyak tanda tangan palsu yang digunakan untuk keperluan tertentu. Dalam mengatasi masalah ini, terciptalah suatu penelitian pengenalan tanda tangan secara offline yang melalui banyak proses diantaranya prepocessing, ekstraksi fitur dan klasifikasi. Dalam ekstraksi fitur menggunakan metode Moment Invariant  yang prinsip kerjanya mengelompokkan matrik ke dalam vektor yang dihasilkan. Dari proses ini akan menjadi masukan ke proses pengenalan yang diukur kemiripannya. Pengukuran dilakukan pada setiap titik (piksel) citra, sedangkan citra yang mirip akan mempunyai jarak yang bernilai 0. Konsep jarak yang digunakan pada penelitian ini adalah jarak menggunakan metode Euclidean Distance. Hasil akurasi dalam pengenalan citra tanda tangan ini didapatkan tingkat akurasi tertinggi sebesar 80% dan terendah 41% dari 4 sekenario sehingga diperoleh rata-rata akurasi 63.25%.\n\n\nKata Kunci : prepocessing, Moment Invariant, Euclidean Distance.', 'Fatimatus Sa\'diyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100004'),
(404, '110411100005', 'RANCANG BANGUN GAME EDUKASI UNTUK PEMBELAJARAN BAHASA MADURA \r\nBERBASIS MOBILE ANDROID', 'Cucun Very Angkoso, ST., MT.', 'Ari Kusumaningsih, ST., MT.', 'Salah satu media pembelajaran untuk menunjang belajar siswa dalam memahami materi-materi adalah dengan menggunakan media digital interaktif. Dengan belajar melalui suatu media unik dan menarik mampu menarik siswa untuk lebih secara aktif berfikir kritis sehingga siswa mampu lebih mendalami materi yang ia pelajari. Game Edukasi merupakan media yang menarik dan menyenangkan sehingga dapat menunjang proses belajar mengajar. Penelitian game edukasi “Acak Madura (Ajer Ocak Madura)” ini menggunakan metode LCM (Linear Congruent Method) sebagai pengacakan soal. Pembelajaran membahas mengenai gambar ataupun kata yang kemudian diartikan kedalam bahasa Madura dengan tingkatan bahasa engghi-bhunten. Tujuan dari perancangan permainan ini adalah untuk membuat system belajar yang menarik untuk anak dalam belajar tentang bahasa Madura. Pada hasil uji coba Game Acak Madura sebagai game edukasi dilakukan pengujian terhadap responden orang yang berbahasa Madura dalam keseharian (aktif) dan responden tidak berbahasa Madura dalam keseharian (pasif) dengan hasil untuk kategori game bola tangkap dengan responden orang yang berbahasa Madura dalam keseharian (aktif) meningkatkan kemampuan dengan jumlah 100% dan 31% pada kategori game tebak gambar. Sedangkan untuk responden berbahasa Madura (pasif)  mendapat nilai kemampuan 52% game bola tangkap dan 19% pada kategori game tebak gambar.', 'Sudibyo Adimullah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100005'),
(405, '110411100006', 'PERBANDINGAN SEGMENTASI OPTIC DISC PADA CITRA FUNDUS MATA MENGGUNAKAN METODE OTSU DENGAN METODE MAKSIMUM ENTROPY TRESHOLDING', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom, M.Kom.', 'Penyakit mata diabetes atau yang lebih dikenal dengan istilah Diabetic Retinopathy (DR) merupakan salah satu penyakit komplikasi yang dihasilkan oleh penyakit diabetes berupa kerusakan bagian retina pada mata.Optic Disk (OD) adalah daerah pada mata yang merupakan tempat syaraf mata memasuki  retina dan juga merupakan bagian pusat pertemuan seluruh syaraf yang ada di  mata. OD merupakan salah satu fitur mata yang mudah diamati, sehingga letak  OD menjadi referensi dalam menentukan letak fitur – fitur lain dalam citra suatu fundus. OD mempunyai intensitas yang hampir sama dengan exudate,  yaitu gejala DR yang tampak pada citra fundus yang berupa bercak pada mata. Dalam penelitian ini diawali dengan preprosessing untuk menghilangkan pembuluh darah pada citra (blood vessel) sehingga didapatkan citra yang telah bersih dari blood vesselnya. Kemudian dilakukan proses penentuan letak atau sementasi OD dengan menggunakan metode Otsu Tresholding dan Maksimum Entropy Tresholding. Hasil dari penelitian ini menghasilkan akurasi, sensifitas, dan spesifitas tertinggi dari masing – masing proses segmentasi.Otsu Tresholding dengan akurasi 92%, sensifitas 87%, dan spesifitas 98%. Maksimum Entropy Tresholding dengan akurasi 94%, sensifitas 90%, dan spesifitas 97% \r\n\r\nKata kunci: Segmentasi Optic Disk, OtsuTresholding, Maksimum Entropy Tresholding, Ground Truth,  DatabaseInspire, Median Filtering, CLAHE, Morfologi Opening dan Closing.\r\n', 'Miftahol Arifin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100006'),
(406, '110411100007', 'Sistem Pendukung Keputusan Penentuan Pemain Bertahan Menggunakan Metode Profile Matching', 'Achmad Jauhari S.T., M.Kom', 'Sigit Susanto Putro S.Kom., M.Kom', 'SISTEM PENDUKUNG KEPUTUSAN\nPENENTUAN PEMAIN BERTAHAN \nMENGGUNAKAN METODE PROFILE MATCHING\n\n\nMuhammad Agfarizy Prasetyo\n(110411100007)\n\nPembimbing I : Achmad Jauhari., S.T., M.Kom.\nPembimbing II : Sigit Susanto P., S.Kom., M.Kom.\n\nABSTRAK\n\nPemain bertahan adalah seorang pemain sepak bola yang bertugas untuk menjaga area pertahanan suatu tim dari serangan lawan. Berdasarkan hasil wawancara dengan pelatih Sekolah Sepak Bola El Faza, untuk menjadi seorang pemain bertahan diperlukan beberapa kemampuan yang baik dalam  berbagai hal, diantaranya : kemampuan mengumpan (passing), kemampuan menyundul (heading), tackling dan intercept. Selain itu juga diperlukan penilaian secara periodik untuk memastikan kemampuan pemain. Hal ini yang sering menjadi permasalahan seorang pelatih karena sistem penilaian yang masih manual sehingga data tidak tersimpan dengan baik. Berdasarkan permasalahan tersebut untuk membantu pelatih menentukan posisi pemain dibutuhkan sistem pendukung keputusan rekomendasi pemain bertahan. Sistem ini menerapkan metode Profile Matching, sehingga dapat memberikan rekomendasi kepada pelatih untuk di terapkan pada permainan tim. Dari hasil penelitian ini menunjukkan bahwa metode Profile Matching memiliki tingkat kecocokan mencapai 77%, yang didapatkan dari hasil pencocokan perhitungan sistem dengan sudut pandang pelatih.\n\nKata Kunci : Sepakbola, Pemilihan bek, Profile Matching.\n', 'Muhammad Agfarizy Prasetyo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100007'),
(407, '110411100008', 'Rekomendasi Pemilihan Buku Menggunakan Metode Association Rules Algoritma FP-Growth Pada Perpustakaan Universitas Trunojoyo Madura', 'Achmad Jauhari, S.T., M.Kom.', 'Sigit Susanto p, S.Kom., M.Kom.', 'Rekomendasi merupakan saran atau pemberitahuan tentang sesuatu yang dapat dipercaya dan dianggap benar dalam suatu kondisi. Dimana kondisi ini diperlukan pada sebuah perpustakaan untuk membantu mahasiswa dalam mencari buku atau pendukung yang sesuai dengan kebutuhan. Untuk membantu permasalahan yang dihadapi oleh mahasiswa karenanya, akan dibuat aplikasi dengan memanfaatkan data histori dari transaksi peminjaman buku pada perpustakaan Universitas Trunojoyo Madura periode tahun 2015. Adanya aplikasi ini akan sedikit membantu mahasiswa dalam mencari pendukung belajar yang tepat. Metode yang digunakan dalam aplikasi ini adalah Association Rules untuk mencari hubungan kombinasi yang sering muncul dari suatu item algoritma Frequent Pattern Growth digunakan untuk menentukan himpunan data yang sering muncul (Frequent Itemset) dalam sebuah kumpulan data transaksi peminjaman buku pada perpustakaan. Dari hasil uji coba penelitian ini ditemukan bahwa, semakin banyak data transaksi yang diolah maka akan semakin banyak pula kombinasi itemset yang akan terbentuk sehingga waktu yang diperlukan sistem untuk menghasilkan rekomendasi akan semakin lama. Namun, semakin besar nilai minimum support yang diinputkan, maka kombinasi yang terbentuk akan semakin sedikit dan apabila nilai minimum support yang diinputkan semakin kecil maka kombinasi yang terbentuk akan semakin besar. \r\n\r\nKata kunci : Rekomendasi, Association Rules, Algoritma Fp-Growth\r\n', 'kiki mei nur hanifah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100008'),
(408, '110411100009', 'KLASTERING PENGGUNAAN JARINGAN BERBASIS PROTOKOL\r\n(Studi Kasus : Laboratorium Terpadu Teknik Informatika UTM)\r\n', 'AERI RACHMAD, S.T., M.T.', 'DWI KUSWANTO, S.Pd., M.T.', 'Laboratorium Terpadu Teknik Informatika Universitas Trunojoyo Madura memiliki jaringan komputer yang terhubung dengan internet dan dapat diakses oleh seluruh mahasiswa Teknik Informatika yang ada di laboratorium. Berbagai macam komunikasi data yang memiliki protokol berbeda-beda terjadi setiap harinya pada jaringan komputer tersebut. Tidak adanya kontrol mengenai trafik dari komunikasi data yang berlangsung pada jaringan komputer tersebut akan mempersulit penentuan kontrol atau tindakan apa yang harus dilakukan.  Monitoring trafik jaringan adalah salah satu langkah awal untuk menentukan kontrol apa yang perlu dilakukan pada sebuah jaringan komputer. Penelitian ini menggunakan teknik klastering K-Means dan menghasilkan rekomendasi data penggunaan jaringan yang dapat dijadikan langkah awal untuk menentukan tindak lanjut dari komunikasi data ataupun protokol yang digunakan di dalam Laboratorium Terpadu Teknik Informatika untuk memaksimalkan atau meminimalkan penggunaan jaringan. Komunikasi data di Laboratorium Terpadu Teknik Informatika terbagi menjadi 2 kelompok, yaitu komunikasi data antara jaringan di dalam laboratorium dan jaringan di luar laboratorium menggunakan 8 protokol lapisan aplikasi, dan komunikasi data antar perangkat di dalam jaringan laboratorium menggunakan 1 protokol lapisan aplikasi. Nilai penggunaan tertinggi berada pada Laboratorium Computation and Artificial Intelegence, dan terendah berada pada Laboratorium Teknologi Informasi dan Aplikasi. Dapat disimpulkan bahwa perlu adanya optimalisasi penggunaan jaringan untuk setiap laboratorium agar tidak menyia-nyiakan sumber daya yang ada.', 'NIVI ELSANDY', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100009'),
(409, '110411100010', 'RANCANG BANGUN SISTEM KLASIFIKASI JENIS HADIST MENGGUNAKAN\nALGORITMA NAIVE BAYES', 'Mula’ab, S.Si., M.Kom. ', 'Eza Rahmanita, S.T., M.T', 'Hadist merupakan hal yang sangat diperhitungkan di dalam Islam, karena Hadist merupakan sumber hukum kedua\nsetelah AL qur’an. Namun, sekarang ini banyak sekali beredar hadist palsu yag notabene dapat menimbulkan\npemahman-pemahaman yang tidak sesuai dengan ajaran Islam. Oleh sebab itu, penelitian ini ini mencoba untuk\nmengotimisasi penilaian keabsahan suatu hadist dengan mengimplementasikan kaidah- kaidah yang terdapat\ndalam ulumul al hadist yang kemudian dikombinasikan dengan metode pengklasifisian naive bayes.Sistem ini\ndiharapkan bisa menjadi refernsi awal dalam meneliti keabashan suatu hadist tentang layak tidaknya dijadikan\nhujjah sebelum akhirnya masuk pada penelitian yang lebih jauh mendalam. Dan sistem ini juga\nmengkomparasikan hasil klasifikasi yang dihasilkan oleh sistem dengan hasil klasifikasi sebenarnya', 'Zulfah Lailatin Fajrin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100010'),
(410, '110411100011', 'Pengaruh Penggunaan Preprocessing Pada Tingkat Similaritas Dokumen Menggunakan Algoritma Rabin-Karp (Studi Kasus : Abstrak Karya Ilmiah)', 'Cucun Very Angkoso, ST., MT.', 'Firdaus Solihin, S.Kom., M.Kom', 'Plagiasi merupakan penjiplakan atau pengambilan karangan, pendapat dan sebagainya dari orang lain dan menjadikannya seolah karangan dan pendapat sendiri. Saat ini banyak kasus plagiasi yang terjadi, utamanya untuk karya ilmiah.\r\nUntuk mendeteksi tingkat plagiasi suatu karya jelas dibutuhkan waktu yang tidak sedikit, karenanya dibutuhkan sistem untuk membantu dalam mendeteksi plagiasi. Salah satu algoritma yang bisa digunakan dalam membuat aplikasi pendeteksi plagiasi ini adalah algortima Rabin-Karp. Algoritma ini menggunakan fungsi hashing dan sangat efektif untuk pencarian multiple pattern.\r\nPenelitian ini dilakukan ini merancang dan membuat sebuah sistem untuk mendeteksi tingkat plagiasi suatu karya dengan menggunakan algortima Rabin-Karp. Sistem ini dapat membantu mempercepat dalam melakukan pengecekan tingkat plagiasi suatu karya.\r\nHasil dari penelitian ini menunjukkan treshold untuk penggunaan preprocessing sebesar 70,95% dengan rata-rata waktu komputasi 336,69 detik dan yang tidak menggunakan preprocessing sebesar 79,96% dengan rata-rata waktu komputasi 7,40 detik.', 'Wildan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100011'),
(411, '110411100012', 'Aplikasi Pengelompokan Lahan Menggunakan Self Organizing Map (Som) Di Kabupaten Sumenep', 'Bain Khusnul Khotimah,S.T.,M.Kom.', 'Rika Yunitarini,S.T.,M.T.', 'Pertanian merupakan salah satu sektor utama yang memberikan kontribusi terbesar dalam perkonomian Kabupaten Sumenep. Salah satu prosedur untuk mempertajam kualitas dan mutu hasil pertanian, Dinas Pertanian Kabupaten Sumenep merencanakan program kerja pemberdayaan petani dan organisasi petani dalam meningkatkan produktivitas, pendapatan dan kesejahteraan petani melalui peningkatan aksesibilitas informasi pertanian dan pengembangan potensi pertanian khususnya dalam komoditas palawija serta pemerataan terhadap potensi komoditas palawija. Untuk merealisasikan hal tersebut pemerintah perlu memetakan karakteristik potensi lahan di setiap daerah dengan pengelompokkan kecamatan berdasarkan persamaan ciri potensi lahan sehingga dapat memberikan kebijakan dan peningkatan pelayanan kebutuhan pertanian. Metode Self Organizing Map digunakan sebagai metode dalam tugas akhir ini sebagai metode pengelompokkan unsupervised yang sesuaiuntuk menghasilkan karakteristik potensi lahan dari setiap kluster yang diperoleh dengan indikator potensi lahan sehingga mempermudah klarifikasi kebijakan pemerintah dalam pemerataan potensi pertanian palawija.\n\nKata Kunci : Aplikasi Pengelompokan, Pertanian, ,Clustering, Komoditas Palawija, Palawija, Self Organizing Map, SOM.\n\n', 'Aditami Yoanta', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100012'),
(412, '110411100013', 'RANCANG BANGUN SISTEM INFORMASI DAN FORECASTING KEUANGAN\r\nSEKOLAH MENGGUNAKAN METODE EXPONENTIAL SMOOTHING \r\n(Studi Kasus Lembaga Pendidikan Islam Al Haromain)', 'Hermawan, S.T.,M.Kom.', 'Sigit Susanto P, S.Kom.,M.Kom.', 'Lembaga sekolah pada umumnya melakukan perekapan administrasi keuangan mereka\r\nsecara konvensional, seperti halnya pada Lembaga pendidikan Islam Al Haromain yang\r\nmasih menggunakan excel dalam proses administasi keuangan mereka, kegiatan ini membuat\r\nproses administrasi menjadi kurang efektif dan efisien, karena itu diperlukan sistem informasi\r\nkeuangan sekolah sebagai solusi dalam permasalahan tersebut.\r\nSistem informasi keuangan sekolah ini menangani proses-proses pengolahan keuangan\r\nsekolah yang meliputi transaksi penerimaan dan pengeluaran. Sedangakan untuk membantu\r\ndalam kebijakan keuangan, sistem informasi keuangan sekolah ini dilengkapi fitur\r\nforecasting yang digunakan untuk memprediksi penerimaan, pengeluaran dan saldo Lembaga\r\ndalam waktu mendatang.\r\nMetode yang digunakan dalam proses forecasting adalah metode exponential smoothing.\r\nMetode ini memiliki kemampuan yang cukup baik dalam proses prediksi, dikarenakan\r\nmetode ini memiliki nilai parameter yang mempunyai pengaruh yang besar terhadap hasil\r\nprediksi.\r\nKata kunci : forecasting, exponential smoothing, keuangan sekolah, sistem informasi\r\nkeuangan sekolah', 'Moh. Iwan Purwanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100013'),
(413, '110411100014', 'SEGMENTASI OPTIC DISC PADA CITRA FUNDUS BERBASIS \r\nMORPHOLOGICAL MATHEMATIC\r\n', 'Arif Muntasa, S.Si., M.T.', 'Indah Agustien S., S.Kom., M.Kom.', 'Mata merupakan alat indera yang keberadaannya sangat vital bagi kehidupan manusia. Selain fungsi utama sebagai alat untuk melihat, mata juga merupakan organ yang berhubungan langsung dengan apakah seseorang positif terkena penyakit seperti Diabetic Retinophaty dan Glaucoma. Pendeteksian penyakit tersebut dilakukan dengan melihat informasi yang terdapat pada beberapa bagian, salah satunya yaitu pada bagian pembuluh darah. Oleh sebab itu, segmentasi optic disc penting dilakukan untuk mengetahui sejauh mana pembuluh darah dalam retina tersebut telah banyak mengalami kelainan. \r\nDalam Tugas Akhir ini segmentasi dilakukan pada data image retina dari database citra “INPIRE”. Segmentasi dilakukan dengan menggunakan operasi morfologi hingga menghasilkan citra optic disc yang terpisah dari obyek lainnya. \r\nTerdapat dua langkah penting dalam segmentasi fundus mata ini. Langkah pertama yaitu proses Preprocessing. Tujuan dari langkah ini adalah mengoptimalkan citra retina sebelum diproses segmentasi, tahap ini meliputi proses pemotongan (resized) citra, penghalusan kontur citra dengan metode Gaussian Filter dan perbaikan kontras menggunakan Unsharp Mask Filtering. Langkah kedua adalah proses segmentasi optic disc yang meliputi, Otsu Thresholding, eliminasi cluster, penentuan kandidat optic disc, dan operasi morfologi. \r\nDi akhir proses, pada citra yang sudah tersegmentasi, maka dilakukan juga perhitungan tingkat kebenaran (akurasi) dari keseluruhan hasil segmentasi dengan cara membandingkan terhadap citra Groundtruth-nya. Pengujian dilakukan pada semua database INPIRE sebanyak 40 citra. \r\nHasil akurasi yang didapat dari pengujian penelitian ini yang meliputi parameter Sensitivity, Specificity, Accuracy berturut-turut sebesar 72,39%, 98.33 %, dan 85,36 %. \r\n\r\nKata kunci: Unsharp Mask Filtering, Otsu Thresholding, Dilation And Erosion Morphology.\r\n', 'Ruslan Wahyudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100014'),
(414, '110411100016', 'PENERAPAN METODE PAPRIKA DAN ENTROPY \r\nUNTUK PENDUKUNG KEPUTUSAN SELEKSI MENTOR AGAMA ISLAM \r\nUNIVERSITAS TRUNOJOYO MADURA', 'Achmad Jauhari, ST.,M.Kom', 'Rika Yunitarini,ST.,MT', 'Mentoring agama islam adalah suatu kegiatan pendidikan dan pembinaan dalam bentuk pengajian kelompok kecil yang dilakukan rutin tiap pekan untuk mahasiswa yang menempuh agama islam  didampingi seorang mentor. Sistem pendukung keputusan ini membantu pihak panitia maupun koordinator mentor, menyeleksi mahasiswa yang layak dijadikan mentor atau pembimbing mentoring, yang akhirnya akan memperoleh mentor berkualitas. Pembuatan sistem ini berdasarkan multi kriteria yang telah ditetapkan koordinator mentoring. \r\nTahap awal yang dilakukan yaitu melakukan pembobotan menggunakan metode entropy. Setelah dibobotkan kemudian akan diranking, dengan dimodelkan menggunakan metode Potentially All Pairwise Rangking Of all possible Alternatives (PAPRIKA), merupakan salah satu metode sistem pendukung keputusan yang melibatkan multi kriteria. Sehingga sistem ini menghasilkan mentor-mentor yang berkualitas berdasarkan rekomendasi hasil keputusan dari beberapa kriteria. Hasil pengujian menunjukkan bahwa seleksi mentor dengan kedua metode pengolahan data tersebut mempunyai tingkat akurasi 88 % dari data pembanding manual.\r\n', 'Yunita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100016'),
(415, '110411100017', 'RANCANG BANGUN SISTEM INFORMASI PUSKESMAS BERBASIS FEAF (Studi Kasus : Puskemas Teja, Pamekasan)', 'Bain Khusnul Khotimah, S.T., M. Kom', 'Sigit Susanto Putro, S. Kom. M. Kom', 'Puskesmas Teja merupakan inti pelayanan kesehatan yang berada di Kabupaten Pamekasan. Pengolahan data di puskesmas ini masih bersifat manual. Dengan banyaknya jumlah pasien yang berkunjung, puskesmas ini membutuhkan waktu lama dalam pencarian data pasien. Karena itu, puskesmas ini membutuhkan sistem informasi untuk melakukan pemrosesan data yang terdiri dari data registrasi pasien, data pasien poli gigi, data pasien poli umum, data poli KIA, data pasien LAB, dan data obat.  Pada Penelitian ini akan dibahas mengenai sistem informasi puskesmas yang akan digunakan puskesmas Teja. Untuk membangun sistem informasi ini diperlukan framework atau langkah kerja. Framework adalah kumpulan script yang dapat membantu programmer dalam menangani berbagai masalah-masalah dalam pemograman. Dalam penelitian ini akan digunakan framework FEA. Dimana framework ini menganalisa desain saat ini dan target desain yang ingin dicapai. FEAF memiliki empat komponen utama yaitu : arsitektur bisnis, arsitektur  data, arsitektur aplikasi dan arsitektur teknologi.  Pada akhir penelitian ini dihasilkan sebuah sistem informasi yang nantinya dapat membantu pihak Puskesmas dalam pengolahan data pasien. Berdasarkan hasil uji coba sistem kepada petugas puskesmas diperoleh persentase sebanyak 24% sangat setuju, 73%  setuju, dan 2%  tidak setuju baik dari segi interaksi pengguna dengan sistem, kecepatan dan kemudahan akses informasi serta kepuasan user dalam menggunakan sistem informasi.', 'Dewi Kartika Apriliani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100017'),
(416, '110411100018', 'APLIKASI KELUHAN BERBASIS ANDROID DI DINAS PEKERJAAN UMUM KABUPATEN BANGKALAN MENGGUNAKAN METODE RAPID APPLICATION DEVELOPMENT (RAD)', 'Mula’ab, S.Si., M.Kom', 'Achmad Jauhari, S.T., M.Kom', 'Keluhan yang sedang berjalan pada Dinas Pekerjaan Umum (PU) di Kabupaten Bangkalan masih dilakukan secara manual, yaitu dengan mendatangi kantor secara langsung untuk menyampaikan keluhan. Sehingga pihak dinas membutuhkan waktu yang relatif lama dalam memproses keluhan dari masyarakat. Untuk itu dibangunlah suatu aplikasi keluhan berbasis android untuk memudahkan masyarakat dalam menyampaikan keluhan secara online terhadap Dinas Pekerjaan Umum (PU) Kabupaten Bangkalan. Penelitian ini menggunakan metode Rapid Application Development (RAD), yaitu suatu metode pengembangan perangkat lunak dengan menekankan pada siklus pembangunan pendek, singkat dan cepat. Berdasarkan 10 data evaluator menunjukkan hasil nilai rata-rata sebesar 85,83% sedangkan nilai desain dan tampilan sebesar 81,78% sehingga bisa dikatakan aplikasi sudah mencapai tujuan yang diharapkan.', 'ANIS NOER AISYAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100018'),
(417, '110411100019', 'PEMODELAN DAN SIMULASI SISTEM DINAMIS UNTUK MENINGKATKAN PROFITABILITAS PRODUK PANGAN', 'Achmad Jauhari, S. T.. M. Kom.', 'Sigit Susanto Putro, S.Kom.,M.Kom.', 'Pada produksi pangan seperti produksi keripik pasti akan mengalami pasang surut dalam penjualan produk, hal ini tentu akan berdampak dan berpengaruh terhadap tingkat profitabilitas keripik. Untuk mengetahui nilai profit produk pangan keripik maka dibuat sebuah sistem yang dapat menganalisa. Metode yang digunakan dalam pembuatan sistem adalah metode simulasi sistem dinamis dengan 2 model skenario yaitu kemasan dan harga, dan skenario tambah bahan. Hasil penelitian dari simulasi pada skenario tambah bahan terjadi penurunan profit berkisar antara -1,67 persen sampai -8,35 persen. Skenario kemasan dan harga terjadi kenaikan profit berkisar antara -6,23 persen sampai 18,71 persen. Bagi pelaku usaha untuk mendapat kenaikan profit yang tinggi, pelaku usaha dapat melakukan perubahan kemasan dan menaikan harga. Pada penelitian ini dicari juga produk yang sebaiknya menjadi produk unggulan dengan menggunakan model simulasi sistem dinamik dan diperoleh hasil penelitian dengan keripik jagung menjadi produk unggulan. Selanjutnya untuk mengetahui cara memprediksi keakuratan sistem adalah menggunakan perbandingan rata-rata dan variasi amplitudu dan didapat perbandigan rata-rata hasil 0,96911% lebih kecil dibandingkan 5 %, dan perbandingan variasi amplitudu diperoleh hasil 17,0283% lebih kecil dibandingkan 30%.', 'Didik Tri Haryanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100019'),
(418, '110411100020', 'KLASIFIKASI SENTIMEN TINGKAT KETERTARIKAN PENGUNJUNG\nTERHADAP ONLINE SHOP PADA TWITTER MENGGUNAKAN METODE\nNAIVE BAYES\n(Studi Kasus : @lazada, @tokopedia dan @bukalapak)', 'Firdaus Solihin, S.Kom., M.Kom', 'Achmad Jauhari, S.T.,M.Kom', 'Twitter sebagai sarana untuk memasarkan produk secara online. Bermodalkan foto dan caption yang\nmenarik maka kemungkinan besar konsumen tertarik untuk membeli produk mereka. Oleh karena itu\ndiperlukan review terhadap onlineshop tersebut untuk mengetahui berapa banyak pengunjung yang\ndatang. Penelitian ini menggunakan 3 kategori, yaitu @lazada, @tokopedia dan @bukalapak. Tujuan\npenelitian ini adalah untuk mengetahui tentang (1) jumlah pengunjung yang memberi komentar positif\ndan negatif. (2) hasil klasifikasi tingkat ketertarikan pengunjung menggunakan metode naive bayes dan\n(3) tingkat akurasi metode naive bayes dalam mengklasifikasikan tingkat ketertarikan pengunjung.\nHasil penelitian menunjukkan bahwa tingkat ketertarikan pengunjung pada @bukalapak adalah yang\ntertinggi dengan presentase 53,47% dengan jumlah komentar positif 470 dan negatif 1, @tokopedia\nmemiliki persentase 42,77% dengan jumlah komentar positif 376 dan negatif 0, @lazada memiliki\npersentase 3,75% dengan jumlah komentar positif 33 dan negatif 1. Tingkat akurasi metode naive\nbayes dalam mengklasifikasikan tingkat ketertarikan pengunjung 51,6% dengan eror rate 48,4%.\nKata Kunci : Sentimen, Online shop, Naive Bayes.', 'Utsfani Gardiana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100020'),
(419, '110411100021', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN \r\nPEMBERIAN REWARD BERDASARKAN HASIL KINERJA \r\nPEGAWAI MENGGUNAKAN METODE FUZZY-ANALYTIC \r\nHIERARCHY PROCESS (F-AHP) (STUDI KASUS PADA PDAM \r\nBOJONEGORO)', 'Achmad Jauhari,S.T.,M.Kom.', 'Sigit Susanto Putro.S.Kom.,M.Kom.', 'Sumber Daya Manusia (SDM) merupakan salah satu faktor yang diperhitungkan dalam  perusahaan, penilaian kinerja bertujuan untuk memotivasi kinerja individu. Reward merupakan bentuk penghargaan atau apresiasi kepada suatu prestasi tertentu yang diberikan yang bertujuan untuk menarik dan mempertahankan SDM untuk mencapai sasaran yang telah didtetapkan oleh perusahaan. Pada tugas akhir ini mencari alternatif terbaik berdasarkan kriteria-kriteria yang telah ditentukan menggunakan pendekatan metode Fuzzy-analytic hierarchy Process. Proses perhitungan pada FAHP dalam menentukan  penerima reward terdapat dua kriteria yaitu sasaran kerja pegawai dan perilaku kerja pegawai. Hasil pembobotan dari Metode FAHP dapat mendukung keputusan penentuan penerima reward pada PDAM Bojonegoro. Dengan penelitian ini diharapkan mampu mendorong perusahaan untuk memperhatikan kualitas SDM diperusahaan, salah satunya dengan memberikan reward pada pegawai yang berprestasi. Hasil dari penelitian tugas akhir ini berdasarkan analisis GAP Perbedaan cara penilaian kinerja pada kriteria perilaku kerja pada PDAM Bojonegoro dengan sistem menghasilkan nilai GAP yaitu 10. Maka adanya nilai GAP atau besar kecilnya nilai GAP yang dihasilkan dari perbandingan cara penilaian kinerja antara PDAM dengan sistem dapat mempengaruhi hasil penerima reward.', 'ERMA SURYANI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100021'),
(420, '110411100023', 'APLIKASI KLASIFIKASI DOKUMEN BERDASARKAN BIDANG MINAT MENGGUNAKAN METODE NAIVE BAYES', 'Achmad Jauhari, S.T.,M.Kom.', 'Sigit Susanto Putro, S.Kom.,M.Kom', 'Saat ini bentuk dokumen digital telah mengalami perkembangan yang sangat pesat,  namun kumpulan dokumen yang banyak akan sulit untuk diketahui karakteristik informasinya. Banyak sekali macam-macam karya ilmiah pda portal artikel tugas akhir Universitas Trunojoyo Madura.  Karya ilmiah tentang pendidikan, hukum, ekonomi, dan masih banyak sekali macam karya ilmiah yang lain. Dari berbagai macam karya ilmiah tersebut dapat dengan mudah sekali dilakukan pengkategorian dokumen secara manual oleh manusia. Akan tetapi jika dilakukan secara terkomputerisasi akan sangatlah sulit. Untuk itu penelitian ini menghasilkan sebuah aplikasi yang dapat mengkategorikan suatu dokumen. Dokumen yang digunakan berupa dokumen abstrak karya ilmiah penelitian berdasarkan bidang minat prodi Teknik Informatika yang berada di Universitas Trunojoyo Madura. Yaitu, bidang minat Sistem Informasi, Sistem Terdistribusi, Digital Multimedia dan CAI (Computing Artificial Intelligence). Dari penelitian ini dihasilkan kesimpulan bahwa dalam pembuatan Aplikasi Klasifikasi Dokumen Abstrak Karya Ilmiah  ini telah berhasil mengklasifikasi dokumen sesuai dengan bidang minat yaitu, CAI(Computing Artificial Intelligence), Digital Multimedia, Sistem Terdistribusi dan Sistem Informasi dengan tingkat akurasi mencapai 77%. \n\nKata Kunci : Klasifikasi, Preprocessing, Naive Bayes.\n', 'Makhsusotin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100023'),
(421, '110411100024', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN INDUSTRI KECIL MENENGAH (IKM)  UNGGULAN DI KABUPATEN SUMENEP DENGAN MENGGUNAKAN METODE WEIGHTED PRODUCT (WP)\n\nKata Kunci : Sistem Pendukung Keputusan, Industri Kec', 'Rika Yunitarini, S.T., M.T', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Salah satu program kerja Dinas Perindustrian dan Perdagangan Kabupaten Sumenep adalah Pengembangan Industri Rumah Tangga dan Program Peningkatan Kemampuan Teknologi, nantinya akan menenetukan sebuah IKM unggulan, dan IKM unggulan ini akan dibina dan diberikan bantuan peralatan.  \nSistem ini dibangun untuk mendukung proses perangkingan terhadap IKM, dimana proses ini membutuhkan data dari IKM yang ada. Nantinya data tersebut diolah dengan metode Weighted Produc,t sebelum di olah data diklasifikasikan terlebih dahulu (Industri Kecil, Industri menengah, Industri Atas).  \nPenelitian ini menghasilkan  rangking yang berbeda antara dinas dengan sistem, dikarenakan perbedaan faktor penilaian. Pada dinas mengunakan penilaian dari segi produk (banyaknya pelaku usaha) dan melalui penggolongan (Seperti KIID, OVOP,IK,IA). Sedangkan sistem menggunakan jumlah tenaga kerja, nilai investasi, jumlah produksi, nilai produksi, jumlah bahan baku. ', 'Faris Suriyansyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100024'),
(422, '110411100025', 'Segmentasi Optic Disc Citra Retina Berbasis Algoritma Fuzzy C-Means Clustering', 'Dr. Arif Muntasa, S.Si., MT.', 'Dr. Indah Agustien S, S.Kom., M.Kom.', 'Salah satu komplikasi penyakit mata akibat diabetes mellitus adalah Diabetic Retinopathy (DR). Penyakit ini merusak pembuluh darah mikro (microvascular) pada retina mata. DR merupakan penyebab utama kebutaan pada penderita diabetes. \r\nSegmentasi Optic Disc (OD) merupakan salah satu bagian penting dari pemrosesan citra. Segmentasi bertujuan untuk melakukan pembagian citra menjadi beberapa wilayah homogen berdasarkan kriteria kemiripan tertentu.\r\nPenelitian ini bertujuan untuk mendeteksi lokasi OD pada retina secara otomatis. Proses deteksi OD diawali dengan preprocessing untuk meningkatkan kualitas citra dan menghilangkan pembuluh darah. Dilakukan seleksi Region of Interest. Selanjutnya kontur OD dideteksi dengan menggunakan algoritma Fuzzy C-Means Clustering (FCM). Hasil segmentasi dengan metode FCM dibandingkan dengan hasil deteksi ahli mata. Dengan metode ini diperoleh akurasi  sebesar 96,85%,  sensitivitas  79,24% dan  spesifisitas  97,26%.\r\n\r\nKata kunci: Diabetic Retinopathy, DR, Optic Disc, OD, segmentation, Fuzzy C-Means Clustering, FCM\r\n', 'Achmad Bulyan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100025'),
(423, '110411100027', 'Sistem Pendukung Keputusan Penilaian Resiko Kerugian Usaha Kecil dan Menengah (UKM) dengan Metode Fuzzy – Analytic Network Process (FANP)', 'Bain Khusnul Khotimah, S.T. M.Kom', 'Yeni Kustiyahningsih, S.Kom.,M.Kom', 'Persaingan bisnis merupakan salah satu faktor resiko yang diperhitungkan dalam UKM, untuk mencegah resiko dibutuhkan manajemen yang baik dalam penanganan resiko tersebut. Pada tugas akhir  ini akan mencari kriteria yang mempengaruhi terjadinya  kerugian berdasarkan kriteria-kriteria yang  telah ditentukan oleh Dinas Koperasi dan UMKM Kabupaten Bangkalan dengan pendekatan  metode Fuzzy Analitic Network Process (FANP) sebagai sistem pendukung keputusan. Dalam penelitian ini perusahaan yang menjadi objek penelitian ini adalah Usaha Kecil Menengah (UKM) di daerah bangkalan yaitu UKM Peri Kecil dan UKM HMF/Hj. Unyil. Dari hasil penelitian dengan hasil kuisioner yang telah diisi oleh Dinas Koperasi dan UMKM kabupaten bangkalan diperoleh pada UKM Peri Kecil dan HMF/Hj Unyil  mengindentifikasi Resiko Sedang hingga Resiko Rendah yaitu dengan nilai pada UKM Peri Kecil 2,7246 ,2,7061 ,2,5549 ,1,9672 dan 1,6371 dan pada UKM HMF/Hj Unyil dengan nilai 2,5634 ,2,4751 ,2,4751 , 1,7966 , dan  21,7966. Sedangkan dengan hasil kuisioner yang berbeda yang telah diisi oleh masing – masing UKM diperoleh pada UKM Peri Kecil  mengindentifikasi Resiko Tinggi hingga Resiko Rendah yaitu dengan nilai 2,9647 ,3,0346 ,2,7159 , 2,6887 dan 1,8485 sedangkan pada UKM HMF/Hj Unyil mengindentifikasi Resiko Sedang hingga Resiko Rendah yaitu dengan nilai 2,8772 ,2,49431 ,2,4931 ,2,2114 , dan  2,2114.\r\nKata kunci: Sistem Pendukung Keputusan, Usaha Kecil Menengah (UKM), Resiko, Fuzzy Analytic Network Process ( FANP ).\r\n\r\n', 'Nurul Fadilah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100027'),
(424, '110411100028', 'Sistem Pendukung Keputusan Analisis SWOT Untuk Strategi Kinerja Usaha Kecil dan Menengah (UKM) Batik', 'Bain Khusnul Khotimah,S.T.,M.Kom', 'Firli Irhamni,S.T.,M.Kom', 'Pada tingkat persaingan global yang sangat kompetitif, setiap UKM memerlukan suatu sistem analisis strategi kinerja yang dapat diukur secara periodik dan terarah. Dalam mempermudah suatu pengambilan keputusan strategi kinerja Usaha Kecil dan Menengah (UKM), terdapat 10 KPI (Key Performance Indiators) dalam analisis strategi kinerja UKM. Pada tugas akhir ini untuk mencari posisi strategis UKM berdasarkan KPI yang telah ditentukan oleh Dinas Koperasi dan UMKM Bangkalan menggunakan analisis SWOT dikombinasikan dengan metode AHP sebagai sistem pendukung keputusan. Dalam penelitian ini yang menjadi objek penelitian adalah UKM Batik Bangkalan, yaitu UKM Peri Kecil dan UKM HMF/HJ.Unyil. Dari hasil penelitian diperoleh hasil bahwa UKM Peri Kecil selalu berada pada posisi yang menguntungkan, sehingga dengan kekuatan yang dimiliki dapat memanfaatkan peluang bisnis yang ada. Namun UKM mengalami kelemahan pada jumlah transaksi. Sedangkan pada UKM HMF/HJ.Unyil pada bulan Januari dan Maret 2015 menghadapi ancaman, namun masih dapat memanfaatkan kekuatan yang dimiliki untuk tetap menjaga kestabilan UKM. Namun UKM mengalami kelemahan pada pertumbuhan pendapatan.', 'Linda Andriyana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100028');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(425, '110411100029', 'RANCANG BANGUN SISTEM INFORMASI PENJAMINAN MUTU AKADEMIK TINGKAT FAKULTAS BERBASIS WEB\r\n(STUDI KASUS: FAKULTAS TEKNIK UNIVERSITAS TRUNOJOYO MADURA)', 'Andharini Dwi Cahyani, S.Kom., M.Kom', 'M. Fuad, S.Kom., M.T', 'Penjaminan mutu perguruan tinggi adalah proses perencanaan, pemenuhan, pengendalian, dan pengembangan standar pendidikan tinggi secara konsisten dan berkelanjutan, sehingga pemangku kepentingan internal dan eksternal perguruan tinggi, yaitu mahasiswa, dosen, karyawan, masyarakat, dunia usaha, asosiasi profesi, pemerintah memperoleh kepuasan atas kinerja dan keluaran perguruan tinggi. Pada tugas akhir  ini bertujuan untuk mengetahui tingkat kepuasan mahasiswa berdasarkan kuesioner yang telah ditentukan oleh Tim Penjaminan Mutu Fakultas Teknik Universitas Trunojoyo\r\nDalam mengetahui tingkat kepuasan mahasiswa ini, menggunakan skala deskriptif  yakni skala Likert. Sistem ini memiliki kemampuan untuk mengambil data input kuesioner Pegajaran Dosen, Praktikum, Administratif,Fasilitas, Kuliah Tamu dan Workshop. Pengguna dalam sistem ini adalah mahasiswa dan dosen, dimana mahasiswa disini dapat mengisi kuesioner dan dosen dapat melihat nilai yang telah dhasilkan dari kuesioner yang telah diisi mahasiswa sebelumnya. \r\nDari Dalam penelitian ini yang menjadi objek penelitian adalah Fakultas Teknik Universitas Trunojoyo Madura. Dari hasil uji fungsionalitas yang telah dilakukan didapatkan hasil penilaian bahwa pengujian masuk dalam kriteria Baik. Karena semua  pengujian dalam kuesioner ini yang dilakukan dengan menggunakan sampel 34 responeden dari 4 jurusan dalam fakultas teknik  memiliki nilai diatas 70%.\r\n', 'Dian Ayu Susetiyo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100029'),
(426, '110411100030', 'Klasterisasi Abstraksi Karya Ilmiah Menggunakan Metode K-Means', 'Mula\'ab, S.Si., M.Kom.', 'Iwan Santosa, S.T., M.T.', 'Banyaknya jumlah karya ilmiah yang tersedia menyebabkan dokumen sangat banyak dan beragam sehingga pengelompokkan menjadi sulit. Oleh Karena itu, dibutuhkan suatu metode yang dapat mengelompokkan dokumen sesuai kategori. Klasterisasi merupakan metode data mining untuk mengelompokkan data sesuai dengan karaktersitik, sehingga dapat membantu pengguna dalam proses pencarian dokumen dengan cepat. Metode yang digunakan dalam penelitian ini adalah metode k-means yang merupakan salah satu metode klaster yang bersifat unsupervised learning. Tujuan dari penelitian ini adalah untuk mengetahui tingkat akurasi metode k-means dalam klasterisasi karya ilmiah. Pada proses ini pengelompokkan karya ilmiah abstraksi dibagi tiga kategori yaitu hukum, pertanian dan teknik. Pengujian hasil clustering menggunakan k-means menghasilkan nilai rata-rata precision dan recall masing-masing 55.2 %, 51.1% serta akurasi sebesar 50.3%.', 'Muhammad Nur Ikhwan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100030'),
(427, '110411100031', 'Perangkingan Kinerja Guru SD Menggunakan Kombinasi Metode \nIPMS, SMARTER dan TOPSIS\n(Studi Kasus : UPT Dinas Pendidikan Kec. Talango Kab. Sumenep) ', 'Achmad Jauhari, S.T., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Dunia pendidikan tidak lepas dari peranan guru. Penilaian \nkinerja guru perlu dilakukan agar kinerjanya lebih optimal sehingga\nkualitas pendidikan semakin baik. Selama ini penilaian kinerja guru\ntelah terlaksana dengan baik, tetapi masih menyita banyak waktu dan\ntenaga. Sehingga dibuatlah Sistem Perangkingan Kinerja Guru dengan\nmetode IPMS, SMARTER, dan TOPSIS. IPMS digunakan sebagai\nmetode pengukuran kinerja karena IPMS memperhatikan kebutuhan\nsetiap stakeholder. SMARTER digunakan untuk membobotkan indikator.\nDari hasil penelitian, KPI yang telah teridentifikasi sebanyak 78.\nPembobotan indikator menggunakan SMARTER memungkinkan\npenambahan atau pengurangan alternatif, karena pembobotan dilakukan\ndengan rumus ROC. TOPSIS digunakan untuk merangking nilai kinerja\nguru karena dapat menentukan nilai preferensi untuk setiap alternatif\nsehingga mampu memilih alternatif terbaik. Dari hasil proses sistem,\ndari total 98 orang guru SD, 96 orang memiliki traffic light hijau, yang\nberarti kinerjanya sudah baik. Sedangkan 2 orang memiliki traffic light\nkuning, yang artinya cukup dan perlu ditingkatkan lagi. Untuk uji\nobjektifitas, diperoleh nilai rata-rata sebesar 8.83 yang didapatkan dari\npengolahan data hasil sebaran kuisioner. Hasil ini menunjukkan bahwa\npengguna sistem yakni kepala sekolah, memberikan penilaian yang baik\nterhadap kinerja sistem secara keseluruhan. Hasil uji coba tingkat\nakurasi sistem secara keseluruhan mencapai 74,49%. \n\nKata Kunci : Sistem Perangkingan, Kinerja Guru, IPMS, SMARTER,\nTOPSIS. ', 'Riani Dewi Hariyati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100031'),
(428, '110411100032', 'APLIKASI PENENTUAN PRIORITAS PENGEMBANGAN IKM MENGGUNAKAN VIKOR', 'Achmad Jauhari, S.T.,M.Kom.', 'Rika Yunitarini, S.T., M. T.', 'Sebagai dasar pertumbuhan ekonomi daerah, keberadaan industri kecil menengah sangatlah berpengaruh penting untuk kehidupan masyarakat kota Bangkalan Madura. Akan tetapi sangat jarang dilakukan oleh pihak-pihak terkait untuk mengoptimalkan potensi yang dimiliki oleh industri kecil menengah mengingat banyaknya industri kecil menengah yang dimiliki oleh masyarakat khususnya masyarakat kota Bangkalan Madura.\nSalah satu upaya untuk mengatasi kesulitan dalam pengoptimalan potensi industri kecil menengah maka perlu adanya pembuatan aplikasi penentuan prioritas pengembangan IKM menggunakan metode VIKOR (VIseKriterijumska Optimizacija I Kompromisno Resenje) dengan kriteria Nilai Investasi, Kapasitas Produksi, Nilai Produksi, Nilai Bahan Baku dan Tenaga Kerja. Metode VIKOR ialah metode perankingan dengan menggunakan indeks peringkat multikriteria berdasarkan ukuran tertentu dari kedekatan dengan solusi yang ideal. Sehingga aplikasi ini akan memilihkan ikm-ikm yang layak untuk diberikan bantuan dalam pengembangannya. Hasil pengujian menunjukkan bahwa dari pembuatan aplikasi ini dengan meggunakan metode vikor mempunyai tingkat akurasi 73% dari data pembanding manual.', 'Nuriyana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100032'),
(429, '110411100033', 'ANALISIS SENTIMEN UNTUK MENGETAHUI RESPON PUBLIK MENGENAI KEBIJAKAN PEMERINTAH PADA TWITTER MENGGUNAKAN METODE NAIVE BAYES\n(STUDI KASUS: Rancangan Hukuman Kebiri Bagi Pedofil)\n', 'Mula\'ab, S.Si.,M.Kom.', 'Dwi Kuswanto, S.Pd.,M.T.', 'Perkembangan internet pada saat ini sangat pesat. Dengan didukungnya media sosial yang banyak bermunculan pada masa sekarang.Kemudahan mengakses merupakan salah satu faktor banyaknya masyarakat menggunakan media sosial salah satunya adalah twitter. Dengan media sosial ini juga dapat dimanfaatkan untuk mengetahui opini publik mengenai penilaian terhadap suatu kebijakan atau aturan yang dibuat oleh sebuah instansi atau pemerintahan, contohnya yang sedang dibicarakan saat ini yaitu hukuman kebiri untuk kejahatan seksual terhadap anak-anak. Kebijakan ini masih dalam rancanagn, namun sebagai sebuah pemerintahan harus mengetahui respon masyarakatnya mengenai rancangan tersebut. Karena sebuah peraturan atau kebijakan dapat mempengaruhi kehidupan masyarakat banyak. Maka dari itu pemanfaatan media sosial inilah untuk mengetahui respon masyarakat melalui komentar setuju atau tidaknya pada media sosial  salah satunya adalah twitter.\nPemanfaatan analisa sentimen inilah yang digunakan untuk mengetahui responsif masyarakat, selain itu metode yang digunakan pada pemanfaatan ini yaitu algoritma Naive Bayes . Dengan menggunakan metode ini kita dapat mengklasifikasi opini publik tersebut dan dapat memetakan setiap kategori baik itu opini setuju,tidak setuju dan netral.Akurasi pada sistem ini yaitu mencapai 67%.\n', 'Ainun Chusnul Chotima', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100033'),
(430, '110411100034', 'SISTEM INFORMASI KRITERIA DAN PERANGKAT DATA AKREDITASI UNTUK SMP/MTs.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Achmad Ubaidillah Ms, S.T., M.T.', 'Akreditasi sekolah/madrasah adalah proses penilaian secara komprehensif terhadap kelayakan dan kinerja satuan dan/atau program pendidikan. Dalam proses Akreditasi ini dibutuhkan data-data yang sesuai dengan kebutuhan pada perangkat data atau borang akreditasi yang telah ada. SMP Islam An-Nidhomiyah merupakan sekolah yang masih melakukan pengumpulan data maupun pencarian dalam bentuk dokumen maupun pencatatan sendiri dan belum terkomputerisasi dengan baik. Maka dari itu dibuat sebuah Sistem Informasi Kriteria dan Perangkat Data Akreditasi Sekolah. Dimana data atau dokumen yang sudah ada dimasukkan ke dalam sistem. Sistem juga menyimpan semua data akreditasi yang sudah diinputkan. Data tersebut akan di inputkan sesuai dengan pernyataan pada perangkat akreditasi. Dari hasil inputan data tersebut dihasilkan keceptan waktu 2.24 second untuk proses upload data dengan kapasitas 37 megabyte. Lama proses upload tersebut dilihat dari besar maupun kecilnya ukuran kapasitas data yang diinputkan. Untuk mempercepat kinerja sekolah dalam upload data akreditasi maka ditetapkan kapasitas maksimal untuk upload data adalah 50 megabyte.', 'Nur Kholis Authon', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100034'),
(431, '110411100035', 'SISTEM KOREKSI ESAI MENGGUNAKAN METODE COSINE SIMILARITY', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Rika Yunitarini, ST., MT.', 'ABSTRAK\nDalam setiap sekolah pada proses pembelajaran terdapat beberapa jenis ujian, seperti diantaranya ujian pilahan ganda dan ujian esai. Pada pengkoreksian ujian esai lebih susah dibandingkan pilihan ganda, salah satu kelemahan dari jawaban dalam bentuk esai adalah sulitnya menilai jawaban, dan cenderung memakan waktu. dikarenakan jawaban siswa yang di kembangkan sendiri sehingga guru susah mengkoreksi jawaban siswa dengan mencocokkan dengan kunci jawaban guru.\nMetode yang digunakan salah satunya Metode Cosine Similarity. Metode Cosine Similarity adalah salah satu metode dalam menghitung kesamaan dari dua buah dokumen. Pada hasil dari pengkoreksian menggunakan preprocessing dengan tanpa menggunakan preprocessing maka terlihat perbedaan bahwa penilaian menggunakan preprocessing lebih besar dibandingkan tanpa menggunakan preprocessing. Persentase dari pengkoreksian mengggunakan preproceesing dan tanpa menggunakan preprpocessing  adalah 15-20%. Sehingga sistem penilaian esai ini dapat membantu guru dalam mengoreksi ujian esai.\n\nKata Kunci : Sekolah, Sistem Koreksi Esai, Cosine Similarity, Preprocessing\n', 'Faiz Andy Kusuma', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100035'),
(432, '110411100036', 'RANCANG BANGUN SISTEM INFORMASI PEMANTAUAN PERKEMBANGAN ATLET BULUTANGKIS', 'Sigit Susanto Putro., S.Kom., M.Kom', 'Achmad Jauhari., S.T., M.kom', 'Dalam proses penentuan nilai latihan fisik dan latihan teknik bulutangkis di klub Persada Kabupaten Kota Sumenep pada saat ini masih dilakukan secara manual, sehingga sistem kinerjanya cukup lambat dan terkadang terjadi kesalahan dalam proses penilaian latihan. Untuk mengatasi permasalahan tersebut bisa dibuat sistem informasi dimana dalam proses penilaiannya dapat keluar secara otomatis pada saat hasil latihan selesai diinputkan. Pembuatan sistem ini harus memperhatikan kriteria-kriteria yang telah ditetapkan oleh buku Pusdiklat Bulutangkis Semen Gresik dan klub Persada kabupaten kota Sumenep yang mana penentuan nilai telah ditetapkan oleh manajer dan pelatih klub Persada kabupaten kota Sumenep. Hasil dari pengujian menunjukkan sistem penilaian mempunyai tingkat akurasi yang tinggi jika dibandingkan dengan perhitungan manual.', 'Farid Turmidzi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100036'),
(433, '110411100037', 'Penerapan Fitur Augmented Reality pada Sistem Pemesanan untuk Excelso Kediri Town Square Cafe', 'Ari Kusumaningsih, S.T., M.T.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Cafe merupakan tempat berkumpul dan berinteraksi sosial sambil mengkonsumsi minuman ataupun makanan ringan yang umum dijumpai di berbagai kota besar. Semenjak kemunculannya pada abad ke-15, cafe menjadi pusat pertukaran informasi untuk membahas masalah politik, ekonomi, social, budaya dan teknologi. Seiring perkembangan teknologi saat ini, beberapa cafe seperti Excelso Kediri Town Square Cafe menyediakan fasilitas berupa akses internet gratis (wi-fi) bagi pelanggannya, fasilitas ini banyak digunakan pelanggan untuk mengakses internet menggunakan smartphone dan laptop yang mereka bawa. Namun fasilitas ini kurang dimanfaatkan pihak cafe sendiri untuk menerapkan sistem pemesanan berbasis mobile sebagai pengganti sistem pemesanan konvensional yang ada. Padahal sistem pemesanan ini sangat tepat diterapkan demi menunjang kemudahan pelanggan dan pihak cafe dalam mengelola sistem pemesanan.\nSistem pemesanan berbasis mobile dengan fitur augmented reality pada aplikasi My Menu yang berjalan pada Sistem Operasi Android adalah salah satu upaya pemanfaatan teknologi di bidang marketing yang diterapkan pada sistem pemesanan cafe. Dengan menggunakan Unity sebagai application engine, dan Vuforia dalam penerapan fitur augmented reality, menjadikan My Menu sebagai aplikasi pemesanan yang mampu memberikan kemudahan bagi para pelanggan maupun pihak cafe dalam mengelola sistem pemesanan.\nSetelah dilakukan penelitian tentang user experience terhadap 15 responden, dihasilkan bahwa aplikasi My Menu memiliki tingkat keberhasilan 86% dalam memudahkan proses pemesanan yang ada pada Excelso Kediri Town Square Cafe.', 'M. Brillian Al Akbar', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100037'),
(434, '110411100038', 'SISTEM  INFORMASI LOWONGAN KERJA BERBASIS SMS GATEWAY (Studi Kasus Disnakertrans Kabupaten Pamekasan)\r\n', 'Achmad Jauhari, ST, M.Kom', 'Moch. Kautsar Sophan, S.Kom., M.MT', 'Peningkatan pertumbuhan masyarakat di Kabupaten Pamekasan dari tahun ketahun berbanding lurus dengan jumlah pencari kerja yang terus bertambah. Banyaknya jumlah pencari kerja tidak hanya disebabkan karena minimnya jumlah lowongan kerja, namun juga disebabkan karena kurang cepat dan tepatnya informasi lowongan kerja sampai kepada pihak yang memerlukan (masyarakat yang memerlukan pekerjaan). Disnakertrans selaku lembaga bentukan Pemerintah telah melakukan beberapa upaya untuk memperkecil jumlah pencari kerja, namun sampai saat ini hasil yang didapatkan belum optimal, karena belum adanya sistem yang mampu menampung kebutuhan kedua belah pihak (pemberi dan pencari kerja). Oleh karena itu, Penelitian ini bertujuan untuk membuat website yang menampung data lowongan kerja dan pencari kerja.  Nantinya data tersebut secara otomatis akan melalui proses pembobotan dengan metode Simple Additive Weighting (SAW), metode ini diharapkan akan mengoptimalkan seleksi lowongan kerja berdasarkan pendidikan terakhir, jenis kelamin, dan usia yang telah dicantumkan oleh pencari kerja saat mendaftar. Setelah proses seleksi selesai, maka informasi lowongan kerja tersebut akan dikirim melalui SMS Gateway kepada pencari kerja.  SMS ini akan mengirim informasi lowongan kerja sesuai dengan nomor telepon yang telah dicantumkan pencari kerja pada website.', 'Selia Resita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100038'),
(435, '110411100039', 'RANCANG BANGUN SISTEM PENILAIAN KINERJA PERUSAHAAN DAERAH AIR MINUM (PDAM) KABUPATEN BOJONEGORO MENGGUNAKAN ANALISIS IMPORTANCE AND PERFORMANCE MATRIX  DAN ANALISIS KESENJANGAN/GAP', 'Achmad Jauhari, S.T., M.Kom.', 'Sigit Susanto Putro, S.Kom., M.Kom', 'PDAM Kabupaten Bojonegoro merupakan badan milik pemerintah yang bertugas menyediakan dan menyalurkan air bersih untuk masyarakat. Kelangsungan usaha PDAM bergantung pada kesetiaan pelanggan. Namun masih ditemukan keluhan mengenai pelayanan. Kepuasan pelanggan juga dipengaruhi oleh pemberi pelayanan yaitu karyawan. Pada tugas akhir ini akan menggunakan metode importance and performance matrix untuk mengetahui indikator-indikator yang perlu ditingkatkan. Sedangkan untuk mengetahui nilai dan tingkat kepuasan menggunakan metode gap/kesenjangan. Objek penelitian dalam tugas akhir ini adalah pelanggan dan karyawan PDAM Kabupaten Bojonegoro yaitu menggunakan kuisioner. Secara umum pelanggan merasa ketersediaan air, kelancaran air, respon terhadap keluhan, kesigapan/kecepatan operator dalam perpipaan dan keahlian operator dalam perpipaan perlu ditingkatkan, sedangkan untuk nilai kepuasan adalah kualitas air distribusi yaitu  -0.77, kontinuitas air distribusi yaitu -0.925, kecepatan pemasangan instalasi baru yaitu -0.43, meter air yaitu -0.48, pengaduan perpipaan yaitu -0.463, dan kemudahan pelayanan yaitu -0.38. Untuk karyawan PDAM Kabupaten Bojonegoro indikator yang perlu ditingkatkan adalah jaminan kehidupan, manajemen perusahaan dalam kesempatan berkembang, cara pemimpin menangani bawahan dan penghargaan/sanksi yang diberikan. Kemudian nilai kepuasan adalah apresiasi perusahaan kepada perusahaan  yaitu -0.323, profesionalisme pekerjaan yaitu -0.237, kebijakan organisasi yaitu -0.027, dan tuntutan tugas yaitu -0.15.', 'Shobihatul Mubarokah Ayu Aseptica', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100039'),
(436, '110411100040', 'PEMODELAN DAN ANALISA SIMULASI PROFITABILITAS PERUMAHAN DENGAN PENDEKATAN SISTEM DINAMIS', 'Achmad Jauhari, S. T.. M. Kom.', 'Sigit Susanto Putro, S.Kom.,M.Kom.', 'Bisnis sektor properti perumahan mempunyai dampak yang signifikan terhadap nilai profit, hal ini dibuktikan melalui riset di lapangan yang menunjukkan bahwa biaya yang dibutuhkan dalam membangun perumahan cukup besar serta membutuhkan waktu yang lama. Meningkatnya permintaan konsumen terhadap perumahan juga berdampak pada meningkatnya nilai profit, sehingga mendorong para pengembang menambah tipe perumahan yang diminati oleh konsumen.\nUntuk mengetahui peningkatan nilai profit, maka dibuatlah sistem yang mampu menganalisa tingkat efektifitas dan efisiensi dalam memperkirakan nilai profit yang diperoleh. Metode yang digunakan dalam pembuatan sistem adalah pemodelan dan analisa simulasi dengan pendekatan sistem dinamis melalui beberapa model skenario yaitu skenario struktur dan parameter. Pemodelan digambarkan dalam sebuah diagram kausal kemudian dikembangkan melalui diagram alir. \nBerdasarkan hasil simulasi untuk meningkatkan nilai profit maka dapat dilakukan dengan cara menambah variabel promo furniture yang diterapkan pada skenario struktur, sedangkan skenario parameter terdapat tiga kondisi yang meliputi skenario optimistik terjadi peningkatan 34,6%, skenario most likely menunjukkan peningkatan 14,81% dan skenario pesimistik dengan peningkatan 4,91% dari nilai profit awal. Untuk tipe perumahan yang memiliki nilai profit tinggi ditunjukkan perumahan tipe Cheryl dengan luas bangunan 223 dari ke empat tipe perumahan pada blok Xa dengan profit rata-rata Rp. 24.222.060.000. \n', 'Irawati Ningsih', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100040'),
(437, '110411100041', 'SISTEM PENDUKUNG KEPUTUSAN PENCARIAN TEMPAT WISATA di SUMENEP MENGGUNAKAN METODE AHP', 'Bain Khusnul Khotimah, ST.,M.Kom. ', 'Rika Yunitarini, ST., MT', 'Salah satu pendapatan yang besar untuk suatu daerah adalah dari  sektor pariwisata, sebab pariwisata adalah industri yang akan terus hidup dan terus berkembang setiap tahunnya. Sumenep memiliki begitu banyak  keindahan alam, kekayaan budaya, mempunyai nilai sejarah yang tinggi dari masa penjajahan belanda dan kerajaan Sumenep serta warga sumenep yang  ramah  dan  sangat bersahabat. Semua itu sangat mendukung untuk menjadikan kota sumenep sebagai kota pariwisata bagi wisatawan lokal ,non lokal, maupun manca negara. Namun bagi wisatawan luar daerah Madura akan kesulitan dalam memilih tempat wisata sesuai dengan kriteria yang mereka inginkan. Oleh sebab itu penelitian ini membuat sebuah sistem pendukung keputusan untuk memilih tempat wisata yang ada di sumenep.\nHasil dari penelitian ini adalah perangkingan tempat wisata dilakukan dengan metode Analitical Hierarchy Process (AHP) melakukan perangkingan berdasarkan tingkat kepentingan tertentu. Dengan diterapkannya Sistem Pendukung Keputusan ini diharapkan wisatawan dapat mendapatkan rekomendasi tempat wisata.\n\n', 'Kurratul Aini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100041'),
(438, '110411100042', 'APLIKASI PENENTUAN JENJANG KOMPETENSI BERBASIS E-LEARNING MENGGUNAKAN METODE SIMPLE ADDITIVEWEIGHTING (SAW)', 'Rika Yunitarini,S.T.,M.T.', 'Bain Khusnul K, S.T., M.Kom.', 'Balai Latihan Kerja (BLK) merupakan salah satu instrument pengembangan sumber daya manusia yang diharapkan dapat mentransfer pengetahuan, ketrampilan, dan etos kerja produktif.BLK menjadi salah satu solusi untuk meningkatkan kualitas tenaga kerja, khususnya bagi masyarakat yang hanya memiliki tingkat pendidikan setara dengan SLTP dan SMAyang biasanya memiliki keterampilan rendah dan tidak mampu melanjutkan ke jenjang pendidikan yang lebih tinggi.\nSulitnya menentukan kemampuan yang dimiliki oleh tiap individu menyebabkan peserta pelatihan kerja tidak dapat mengoptimalkan keahliannya. Maka dari itu dibutuhkan suatu sistem untuk membantu mereka dalam menentukan keahlian apa yang sebaiknya mereka tekuni agar tujuan untuk mendapat pekerjaan maupun membuka lapangan kerja baru dapat dicapai. Penggunaan metode Simple Additive Weighting (SAW) merupakan salah satu solusi dalam penentuan jenjang kompetensi peserta pelatihan kerja ini. Dan dengan diterapkannya dalam E-Learning diharapkan peserta pelatihan dapat lebih mudah dalam melakukan transaksi materi dan pelaksanaan ujian. Hasil pengujian sistem menunjukkan bahwa dari pembuatan aplikasi ini dengan menggunakan metode SAW mempunyai tingkat akurasi 93% dari data pembanding manual.\n\nKata Kunci :Aplikasi, E-learning, SAW, Pelatihan Kerja, BLK', 'Nurul Fajriyah Karina', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100042'),
(439, '110411100043', 'RANCANG BANGUN GAME EDUKASI BAHASA\nISYARAT TANGAN ADAPTIF LEVEL', 'Ari Kusumaningsih, S.T.,M.T', 'Arik Kurniawati,S.Kom.,M.T', 'Kemampuan berkomunikasi merupakan bekal utama dalam berinteraksi dengan setiap manusia dalam kehidupan sehari-hari. Mulai dari bahasa verbal ataupun bahasa non verbal. Salah satu alternatif untuk membantu meningkatkan minat dan kemampuan dalam belajar bahasa isyarat adalah dengan menggunakan media belajar berupa game mobile. Bahasa isyarat tangan merupakan bahasa yang digunakan sebagai media penghubung terjalinnya komunikasi antara sesama difabel maupun manuasia normal pada umumnya. Media yang ada masih menggunakan pembelajaran secara objektif dan belum ada yang menggunakan media digital berbasis mobile. Metode adaptif level sangat membantu dalam pengenalan bahasa isyarat. Penelitian ini bertujuan mengukur tingkat kepuasan user experience dan tingkat pemahaman bahasa isyarat tangan pada pengguna aplikasi. Pemerolehan hasil pengukuran user experience dapat diperoleh jumlah  tingkat keberhasilan 96% pengguna puas dengan game edukasi bahasa isyarat tangan menggunakan metode adaptif level sehingga mendekati hasil yang sempurna. Hasil perhitungan dari penelitian angket menggunakan skala likert dapat diperoleh 30 jumlah skor tertinggi dengan pernyataan bahwa responden lebih mudah memahami bahasa isyarat berupa huruf dari pada pengenalan isyarat berupa angka. Dilihat dari  hasil data penelitian jumlah skor permainan dari 10 responden diperoleh skor nilai A  sebanyak 20%, skor nilai B sebanyak 60% dan skor nilai C sebanyak 20%.', 'Mohammad Islah Junaidillah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100043'),
(440, '110411100044', 'RANCANG BANGUN E-LEARNING FISIKA KELAS X DENGAN MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)', 'RIKA YUNITARINI,ST.,MT', 'BAIN KHUSNUOL KHOTIMAH,ST.,M.KOM', 'E-Learning yang akan diterapkan di SMA Negeri 5 Pamekasan adalah E-Learning mata pelajaran Fisika untuk kelas X (sepuluh) hal ini dikarenakan  kelas X perlu pembelajaran sejak dini dengan menggunakan sistem pembelajaran media elektronik, Khususnya pada pelajaran Fisika. 	\r\nE-learning Fisika untuk kelas X akan mengkombinasikan antara pertemuan secara tatap muka dengan pembelajaran elektronik yang dapat meningkatkan kontribusi dan interktif antar siswa. Sistem ini dirancang untuk mencari nilai tertinggi dari masing – masing siswa dibidang fisika. Nilai tertinggi siswa ditentukan dari nilai akademik dari masing – masing siswa dengan menggunakan metode SAW. \r\nMetode SAW adalah metode penjumlahan terbobot yang digunakan dalam proses perengkingan. Pada sistem ini, metode SAW digunakan untuk  melakukan pembobotan terhadap hasil belajar siswa sehingga guru dapat mengetahui Nilai akademik siswa dibidang Fisika. Dan dapat menentukan siswa terbaik di bidang fisika. \r\n\r\nKata Kunci : E-Learning, Fisika, SMA, Kelas X, Berbasis Web, SAW.\r\n', 'LINDA YUNITA SARI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100044'),
(441, '110411100045', 'SISTEM INFORMASI MANAJEMEN KEPEGAWAIAN\n(MARKAS KABUPATEN PMI BANGKALAN)\n', 'Achmad Jauhari, S.T., M.Kom ', 'Eza Rahmanita, S.T., M.T.', 'Sistem Informasi Manajemen merupakan penerapan sistem informasi di dalam Organisasi untuk mendukung informasi – informasi  yang dibutuhkan oleh semua tingkatan manajemen. Sistem informasi manajemen merupakan sistem yang meliputi proses pengumpulan, pengelolaan, penyimpanan hingga proses penyampaian data dan informasi mengenai kepegawaian di suatu unit kerja.\n\nPenyimpanan data pegawai merupakan hal yang pokok dalam masalah kepegawaian terutama dalam mencari atau merubah data pegawai untuk kemudian di sesuaikan dengan kebutuhan.\n\nAplikasi Sistem Informasi Kepegawaian ini dibuat dengan jenis penelitian studi kasus pada PMI, dimana teknik pengumpulan data yang digunakan antara lain observasi, wawancara, dan studi literatur. Untuk metode analisis dan perancangan yang digunakan dalam pembuatan sistem menggunakan ERD sebagai model data dan DFD sebagai model proses. \n\nKata kunci : Sistem Informasi, Kepegawaian, ERD\n', 'Nabila Sani Faddia', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100045'),
(442, '110411100046', 'SISTEM INFORMASI MONITORING PENERIMAAN SISWA BARU SMA MELALUI JALUR NASIONAL', 'Rika Yunitarini. ST, MT.', 'Sigit Susanto Putro, S.Kom. M.Kom', 'Penerimaan siswa baru adalah  hal yang sangat penting dalam semua aspek kalangan di dunia pendidikan. Adanya sistem yang menunjang kinerja penerimaan siswa baru dan mengumpulkan menjadi one gate system adalah cara tepat untuk percepatan kinerja dan memudahkan siswa mendaftar dengan mudah dan nyaman.\nSistem informasi monitoring sangatlah berperan penting dalan hal proses penerimaan siswa oleh karena itu adanya sistem ini sangat dibutuhkan untuk memantau proses penerimaan siswa baru.Penerapan sistem monitoring ini memantau peserta pendidik yang daftar di setiap sekolahan yang dituju.adanya sistem informasi monitoring ini membantu instansi terkait dan adanya sistem ini berdampak positif bagi pendidikan di indonesia.karena dengan adanhya sistem ini pemerataan siswa disetiap sekolah terpenuhi target yang dicanangkan pemerintah.\nDari penelitian yang telah dilakukan dengan sistem informasi monitoring penerimaan siswa baru SMA melalui jalur nasional ini, diketahui bahwa sistem ini sangat membantu pihak dinas pendidikan sebagai pelopor dan mengatur seluruh kegiatan penerimaan siswa baru, sistem ini membantu pihak sekolah dan siswa / siswi dalam melaksanan seleksi penerimaan siswa baru.\n', 'Majas Ardinta', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100046'),
(443, '110411100047', 'PENERAPAN ALGORITME FSA (FINITE STATE AUTOMATA) UNTUK PEMBELAJARAN MEMBACA PERMULAAN BAHASA MADURA', 'Firdaus Solihin, S.Kom., M.Kom', 'Mula’ab, S.Si., M.Kom', 'Salah satu kendala dalam mempelajari bahasa Madura terletak pada perbedaan antara penulisan dan pengucapannya. Maka dari itu, perlu adanya media pembelajaran yang inovatif agar proses belajar menjadi lebih mudah. Dalam penelitian ini telah dirancang dan dibangun sistem pembelajaran membaca permulaan bahasa Madura berbasis web, yang bertujuan untuk membantu masyarakat Madura dalam belajar membaca dan meningkatkan kemampuan berbahasa Madura secara baik dan benar. Sistem pembelajaran ini terdiri dari pengenalan huruf, suku kata, kata, dan kalimat bahasa Madura serta cara pengucapannya. Sistem dibangun menggunakan algoritme FSA (Finite State Automata) dua tingkat pada proses pemenggalan suku kata bahasa Madura, yaitu sebuah algoritme yang mampu mengenali pengklasifikasian suku kata bahasa Madura. Penerapan algoritme FSA pada proses pemenggalan suku kata bahasa Madura cukup efektif digunakan dengan prosentase keberhasilan 100%. Sistem ini juga dibangun untuk memperkenalkan bahasa Madura kepada masyarakat luar pulau Madura agar mudah bagi mereka untuk mengerti dan belajar bahasa Madura.', 'Pyepit Rinekso Andriyanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100047'),
(444, '110411100048', 'PENGENALAN TANDA TANGAN DENGAN METODE MODIFIED DIRECTION FEATURE (MDF) DAN EUCLIDEAN DISTANCE', 'Fitri Damayanti, S.Kom., M.Kom', 'Dr. Indah Agustien S., S.Kom.,M.Kom', 'Tanda tangan adalah sebuah bentuk khusus dari tulisan tangan yang mengandung karakter khusus dan bentuk – bentuk tambahan yang sering digunakan sebagai bukti verifikasi identitas seseorang. Seiring dengan perkembangan teknologi, saat ini sistem pengenalan tanda tangan dapat dilakukan oleh sistem komputer.\nPenelitian ini membangun sistem pengenalan tanda tangan dengan menggunakan metode Euclidean Distance. Sebelum masuk ke dalam metode Euclidean Distance , citra tanda tangan mengalami proses ekstraksi ciri untuk mendapatkan ciri penting dari citra dengan metode Modified Direction Feature (MDF). metode Modified Direction Feature (MDF) adalah metode untuk memperoleh fitur dari semua arah untuk fitur yang lebih spesifik. Vektor ciri hasil dari MDF kemudian akan menjadi data input untuk proses klasifikasi menggunakan metode  Euclidean Distance.\nHasil Akurasi dalam pengenalan citra tanda tangan ini didapatkan tingkat akurasi tertinggi sebesar 76 % dan terendah 41% dari 4 sekenario.\n\nKata Kunci : Modified Direction Feature (MDF), Euclidean Distance, Vektor Fitur.\n', 'Kurniatin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100048'),
(445, '110411100049', 'Sistem Pendukung Keputusan untuk Peminatan bagi Siswa Baru SMA 2 Sumenep dengan menggunakan Metode Simple Additive Weighting (SAW)', 'Achmad Jauhari,  S.T.,M.Kom ', 'Sigit Susanto Putro, S.Kom.,M.kom ', 'Peminatan pada sekolah menengah atas memiliki tujuan antara lain mengelompokkan siswa sesuai kecakapan, kemampuan, bakat dan minat yang relatif sama, membantu mempersiapkan siswa melanjutkan studi dan memilih dunia kerja, membantu memperkokoh keberhasilan dan kecocokan atas prestsasi yang akan membantu di masa mendatang. Di SMA 2 Sumenep terdapat 4 program studi yang dapat dipilih oleh siswa yaitu: Program Studi IPA, IPS, Bahasa, dan Agama. Pemilihan program studi ini dilakukan sejak siswa duduk di kelas X (Sepuluh) dengan melalui beberapa penilaian. Penilaian ini dilakukan dengan beberapa indikator, antara lain rata-rata nilai rapot, hasil uji kompetensi, hasil angket dan hasil ujian sekolah.Hasil proses pemilihan/penetapan peminatan tersebut, akan menunjang kelancaran dan keberhasilan dalam belajar, dan pengembangan karir lebih lanjut. Untuk menghasilkan keputusan yang tepat sasaran maka penulis menggunakan metode Simple Additive Weighting (SAW) dalam proses perhitungannya. Hasil yang diperoleh dari uji coba sistem dengan menggunakan 103 data adalah 79 data sesuai dengan data jurusan siswa saat ini dan 24 data yang berbeda, dengan demikian persentase data yang sesuai mencapai 76,7%\nKeyword : Sistem Pendukung Keputusan, Peminatan, Simple Additive Wighting (SAW).\n', 'Sani Arfian', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100049'),
(446, '110411100050', 'Implementasi Metode Level Set dalam Segmentasi Optic Disc pada Citra Fundus Mata', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien, S.Kom., M.Kom.', 'Identifikasi penyakit dapat dideteksi dengan mengenali optic disc pada citra fundus mata. Dimana fundus adalah permukaan yang ada di dalam mata dan letaknya bertentangan dengan lensa mata. Di dalam fundus terdapat optic disc yang merupakan daerah pada tempat syaraf mata yang memasuki retina. Letak optic disc yang mudah diamati dapat dijadikan acuan untuk menentukan letak fitur-fitur lain dalam citra fundus. Dan segmentasi optic disc menentukan dalam proses penghapusan optic disc itu sendiri. Pada penelitian ini segmentasi optic disc pada citra fundus menggunakan metode level set. Level set adalah metode yang sangat membantu dalam mendeteksi pergerakan kurva pada citra. Kurva dapat berkembang dan berhenti pada batas obyek dalam suatu image. \r\nHasil segmentasi diharapkan dapat dijadikan sebagai referensi oleh dokter spesialis mata, dalam menyediakan alat bantu (tools) medis untuk membantu penerapan mendapatkan optic disc dengan segmentasi citra fundus.\r\nPenelitian ini menggunakan 40 citra fundus mata. Dengan hasil segmentasi level set yang dibandingkan dengan ground truth yang merupakan citra yang sudah didapatkan letak optic discnya dari database Inspire. Hasil penelitian didapatkan dari skenario terbaik dan metode berhasil mendeteksi optic disc dengan nilai akurasi 99,72%, sensitivitas 87,34% dan spesifitas 99,54%.', 'Arif Rahman Shaleh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100050'),
(447, '110411100051', 'PENERAPAN METODE SIMPLE ADDITIVE WEIGHTING (SAW) DALAM PEMBUATAN PERANGKAT LUNAK SISTEM PENDUKUNG KEPUTUSAN UNTUK MENENTUKAN PROGRAM STUDI BAGI SISWA MADRASAH ALIYAH NEGERI (MAN) BANGKALAN', 'Rika Yunitarini,S.T.,M.T.', 'Sri Herawati, S.Kom, M.Kom.', 'Penentuan program studi atau jurusan merupakan masalah yang sangat penting bagi siswa menengah atas karena dapat berpengaruh pada kelancaran proses belajar dan pemilihan perguruan tinggi. Di Madrasah Aliyah Negeri (MAN) Bangkalan terdapat 4 program studi yaitu: Program Studi MIPA, IPS, Bahasa, dan Agama. Saat ini, proses penentuan program studi tersebut masih dilakukan secara manual oleh guru Bimbingan Konseling berdasarkan nilai rapor dan minat siswa saja. Hal ini menyebabkan hasil yang kurang akurat karena penilaian yang bersifat subjektif. Penilaian yang berdasarkan informasi formal berdasarkan kriteria perlu dilakukan untuk mendapatkan hasil yang akurat dan objektif. Penentuan program studi dinilai berdasarkan 4 kriteria, yaitu: nilai akademik atau rapor siswa (nilai rata-rata mata pelajaran kelas X semester 1 dan 2 yang terkait dengan masing-masing program studi), hasil angket penjurusan, tes pengetahuan (yang dilakukan secara online), dan hasil psikotes. Keempat kriteria tersebut diproses menggunakan metode Simple Additive Weighting (SAW). Hasil yang diperoleh dari uji coba sistem dengan menggunakan 102 data adalah 78 data sesuai dengan data jurusan siswa saat ini dan 24 data yang berbeda, dengan demikian persentase data yang sesuai mencapai 76,5%.\n\nKata Kunci : Sistem Pendukung Keputusan, Program Studi, Simple Additive Weighting (SAW).', 'Tsalits Nurul Qomariyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100051'),
(448, '110411100053', 'OPINION MINING TERHADAP KEBIJAKAN PUBLIK DARI TWITTER MENGGUNAKAN PRINCIPAL COMPONENT ANALYSIS DAN EXPECTATION MAXIMIZATION', 'Mula’ab, S.Si., M.Kom.', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Jejaring sosial adalah sebuah tempat yang mudah dituju para pengguna internet dalam menyampaikan pendapatnya. Maka dari itu, media sosial Twitter menjadi salah satu lahan adanya kumpulan informasi dan opini masyarakat seperti halnya tentang peraturan atau kebijakan yang menuai pro dan kontra. Studi kasus yang digunakan adalah tentang masalah penghapusan subsidi listrik oleh Pemerintah. Untuk mengevaluasi respon masyarakat tentang kebijakan tersebut maka perlu adanya pemanfaatan Opinion Mining.  Opinion mining adalah teknik untuk menganalisa opini pada suatu teks. Dalam hal ini,  pengelompokkan opini akan menggunakan metode Expectation Maximization yang mampu mengklasifikasikan sebuah pendapat berdasarkan kelas yang sudah ditentukan, yakni positif dan negatif. Opinion mining ini akan disertai PCA  (Principle  Component  Analysis)  sebagai  pereduksi  dimensi  tweets dengan tujuan untuk penyederhanaan data yang muncul dari data utama dengan tetap mempertahankan ciri khas yang terkandung di dalamnya.  Pengujian  memakai  165 tweets yang akan dibagi menjadi  dua,  yaitu  55  data untuk testing dan 110 data untuk dijadikan  training. Pada hasil skenario terbaik, akurasi dari pengujian  Opinion Mining dengan memanfaatkan metode Principle  Component  Analysis dan  Expectation  Maximization  adalah sebesar 82%.\nKata Kunci : Klasifikasi, Expectation Maximization, Principle  Component  Analysis.', 'Mita Suryaningsih', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100053'),
(449, '110411100054', 'SENTIMENT ANALYSIS TWEETS KEBIJAKAN PUBLIK BERBAHASA INDONESIA DENGAN METODE PRINCIPAL COMPONENT ANALYSIS DAN EXPECTATION MAXIMIZATION', 'Mulaab, S.Si., M.Kom.', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Sentiment analysis dalam penelitian ini merupakan riset komputasional dari opini yang diekspresikan secara tekstual, untuk selanjutnya diklasifikasikan kedalam kelas sentimen positif dan negatif. Dimana data opini diakses dari media sosial twitter berdasarkan query kebijakan publik dalam bahasa Indonesia. Dalam sentiment analysis, tingginya dimensi dari fitur yang digunakan dalam menggambarkan teks, membutuhkan adanya Principal Component Analysis sebagai reduksi dimensi. Principal Component Analysis  merupakan strategi yang bertujuan meningkatkan kinerja komputasi. Sedangkan metode Expectation Maximization adalah metode pengembangan Naive Bayes yang digunakan sebagai classifier. Dalam pengklasifikasiannya, metode Expectation Maximization menentukan opini ke dalam kelas positif dan negatif dengan cara clustering. Expectation Maximization sendiri dapat menangani atribut numerik dan nominal.\r\nPenelitian ini menggunakan 400 tweets tekstual. Dengan hasil klasifikasi Expectation Maximization yang dibandingkan dengan data hasil asli yang merupakan data yang sudah didapatkan kelas sentimennya dari database mySQL. Dalam hasil penelitian didapatkan dari skenario terbaik dan metode berhasil mengklasifikasikan tweets dengan nilai Precission sebanyak 70.8%, Recall sebanyak 100%, dan Accuracy sebanyak 79.4%.\r\nKata Kunci : Sentiment analysis, query, Principal Component Analysis , Expectation Maximization, Naïve Bayes, classifier,clustering.', 'Benik Ucista', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100054'),
(450, '110411100055', 'Rancang Bangun Game Save The Madura Island untuk Pengenalan Budaya Madura Berbasis Mobile Android', 'Cucun Very Angkoso, ST., MT,', 'Ari Kusumaningsih, ST., MT,', 'Abstrak: Pembuatan game Save The Madura Island bertujuan untuk melestarikan budaya lokal, khusunya budaya Madura yang kini telah banyak orang tinggalkan karena perkembangan teknologi yang begitu pesat. Pengenalan budaya yang berbasis game, diharapkan dapat menarik minat masyarakat untuk lebih mengenal lagi budaya-budaya lokal yang merupakan ciri khas bagi suatu bangsa itu sendiri. Game Save The Madura Island merupakan game strategi yang mengangkat tema tentang budaya Madura, yang memungkinkan user mempelajari budaya Madura dengan keadaan senang ketika memainkan game, selain itu game Save The Madura Island menggunakan algoritma greedy sebagai kecerdasan buatan yang terletak pada karakter defense, yang berfungsi untuk membantu karakter defense dalam menentukan enemy yang lebih efektif untuk diserang terlebih dahulu. Game Save The Madura Island dapat dijalankan diberbagai device android dengan beberapa jenis OS yang berbeda-beda. Penggunaan algoritma greedy pada game Save The Madura Island dapat membantu mengurangi jumlah enemy yang lolos dari 41.8% menjadi 30.4%. Dan penggunaan algoritma greedy pada game Save The Madura Island dapat membantu user dalam mempertahankan life dari 82% menjadi 85%.\r\n\r\nKata kunci : Game Madura, Tower Defense, Algoritma Greedy.', 'Nurul Hidayat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100055'),
(451, '110411100056', 'SISTEM PENDUKUNG KEPUTUSAN DALAM PENENTUAN CENTER MIDFILDER MENGGUNAKAN METODE PROFIL MATCHING\nPADA SEKOLAH SEPAK BOLA GALING\n', 'Sigit Susanto P., S.Kom., M.Kom.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs', 'CMF (Center Midfilder) atau yang sering di sebut pemain tengah adalah seorang pemain sepak bola yang bertugas mendominasi permainan dilapangan tengah sehingga lawan tidak mudah membangun serangan. Berdasarkan hasil wawancara dengan pelatih Sekolah Sepak Bola Galing, untuk menjadi seorang Center Midfilder diperlukan beberapa kemampuan yang baik dalam beberapa hal, diantaranya : kemampuan mengumpan (passing), kemampuan menendang (shooting), stamina, control dan menggiring bola (dribling). Selain itu juga diperlukan penilaian secara periodik untuk memastikan kemampuan pemain. Hal ini yang sering menjadi permasalahan seorang pelatih karena sistem penilaian yang masih manual sehingga data tidak tersimpan dengan baik. Berdasarkan permasalahan tersebut untuk membantu pelatih menentukan posisi pemain dibutuhkan sistem pendukung keputusan rekomendasi pemain bertahan. Sistem ini menerapkan metode Profil Matching, sehingga dapat memberikan rekomendasi kepada pelatih untuk di terapkan pada permainan tim. Dari hasil penelitian ini menunjukkan bahwa metode Profile Matching memiliki tingkat kecocokan mencapai 77%, yang didapatkan dari hasil pencocokan perhitungan sistem dengan sudut pandang pelatih.', 'Ade Ari Ainur Fajar', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100056'),
(452, '110411100057', 'SISTEM REKOMENDASI PROGRAM STUDI PADA PERGURUAN TINGGI BAGI SISWA SMA DENGAN LOGIKA FUZZY TSUKAMOTO\r\n(Studi Kasus : SMA NEGERI 1 KAMAL)\r\n', 'Achmad Jauhari, S.T., M.Kom', 'Rika Yunitarini, S.T., M.T', 'Melanjutkan pendidikan ke perguruan tinggi merupakan impian sebagian besar siswa setelah lulus SMA. Namun, tidak semua siswa memilih program studi di perguruan tinggi sesuai dengan kemampuan dan minatnya, sehingga masalah salah masuk program studi terjadi. Oleh karena itu tes psikologi serta melihat nilai mata pelajaran di SMA dapat digunakan untuk menunjang pemilihan program studi. Sehingga sistem rekomendasi untuk pemilihan program studi dengan mempertimbangkan bobot disetiap kriteria yang diberikan.\r\nMetode yang digunakan dalam sistem rekomendasi ini adalah Logika Fuzzy Tsukamoto. Pada penelitian ini kriteria yang digunakan adalah kriteria akademik dan kriteria psikotes minat. Hasil output dari sistem berupa empat rekomendasi program studi. Berdasarkan pengujian akurasi terhadap 59 data  diperoleh 67.8% hasil akurasi.  Dengan adanya sistem rekomendasi pemilihan program studi ini bisa mempermudah siswa untuk memutuskan program studi yang akan diambil.\r\n\r\nKata Kunci : Program studi, Logika Fuzzy Tsukamoto, sistem rekomendasi\r\n', 'Esty Narulita Rahayuningtyas', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100057'),
(453, '110411100058', 'RANCANG BANGUN SISTEM PENGAWASAN PERILAKU USER PADA KOMPUTER BERBASIS MOBILE ANDROID', 'Cucun Very Angkoso, ST., MT.', 'Dwi Kuswanto, S.Pd., MT.', 'Maraknya pengaksesan situs pornografi di Indonesia semakin mengkhawatirkan. Kebutuhan akan akses internet dewasa ini sangat tinggi sekali. Dengan berkembangnya internet pengaksesan situs-situs pornografi semakin mengkhawatirkan, ironisnya pengaksesan situs pornografi sangat memprihatikan di kalangan anak- anak. Untuk itu pengawasan terhadap anak dalam penggunaan internet harus di tingkatkan. Squid adalah sebuah perangkat lunak yang dapat memonitor jaringan dan dapat melakukan tindakan pada jaringan tersebut. Aplikasi ini dapat berjalan dengan realtime dan otomatis. Pada penelitian ini dilakukan perancangan terhadap sistem pengawasan lalu lintas jaringan dan penggunaan komputer dengan menggunakan Squid dan Keylogger yang akan dikombinasikan dengan Agen. Squid akan mencatat seluruh akses internet yang keluar sedangkan Keylogger mencatat pengetikan yang dilakukan di komputer. Dengan bantuan dari Agen informasi yang didapat dari Squid dan Keylogger akan dikirim ke database server. Laporan dari Agen yang dikirim ke database server dapat diakses melalui aplikasi di perangkat mobile yang menggunakan sistem operasi android. Setelah dilakukan uji coba akses koneksi internet dengan melakukan pencarian dan mengunjungi halaman web, aplikasi agen mampu membaca dan mengirimkan informasi kedalam database server dan juga mampu untuk mengkombinasikan perintah pada squid dengan baik.', 'Mochammad Firdias Fasa Dien', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100058'),
(454, '110411100059', 'PERANCANGAN SISTEM MONITORING AKTIF BERBASIS ANDROID PADA INTRUSION PREVENTION SYSTEM (IPS) SURICATA', 'Cucun Very Angkoso, S.T., M.T.', 'Dwi Kuswanto, S.Pd., M.T.', 'Intrusion Prevention System (IPS) merupakan sistem yang dapat diterapkan untuk melakukan pengawasan terhadap jaringan untuk memberikan keamanan pada server. Salah satu sistem IPS yang digunakan adalah IPS Suricata. Namun terkadang seorang administrator jaringan bekerja dengan lebih dari satu IPS Suricata. Hal ini dapat membuat administrator jaringan tersebut mengalami kesulitan dalam melakukan pengawasan. Sehingga dibutuhkan suatu perangkat yang dapat melakukan pengawasan secara realtime, dan akan memberikan alert jika IPS Suricata mendeteksi adanya serangan. Android merupakan sistem operasi berbasis Linux yang dikembangkan untuk perangkat smartphone dan tablet. Dalam penelitian ini, sistem monitoring yang dibangun menggunakan perangkat berbasis Android. Jika terjadi serangan maka Monitoring Agent pada IPS Suricata akan memblokir penyerang dan mengirimkan informasi serangan kepada Web Server, untuk kemudian akan menjadi notification pada perangkat Android. Sistem monitoring yang akan dibangun juga dapat melakukan monitoring lebih dari satu IPS Suricata. Setelah dilakukan uji coba 50 kali serangan menggunakan Port Scanning dengan Nmap dan SuperScan, SQL Injection dengan Havij, dan Vulnerability Web Scanner dengan Nikto. Terbukti aplikasi Monitoring Agent yang mengkombinasikan IPS Suricata dengan IPTables mampu mendeteksi dan memblokir penyerang. Monitoring Agent juga dapat mengirimkan informasi serangan ke Web Server, dan dapat diterima oleh Android Client sebagai notification. ', 'Kholiq', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100059'),
(455, '110411100060', 'Rancang Bangun Game Edukasi Hanifida untuk Menghafal Asmaul Husna Berbasis Mobile Android', 'Cucun Very Angkoso, S.T., M.Kom', 'Arik Kurniawati, S.T., M.Kom', 'Dunia pendidikan mulai masuk kedalam dunia teknologi informasi. Banyak sekali kegiatan positif yang dapat membantu dalam pelaksanaan kegiatan belajar-mengajar di lingkungan pendidikan. Tidak terkecuali dalam dunia pendidikan agama, khususnya agama islam. Sekarang cukup banyak aplikasi-aplikasi seperti Al-Qur’an digital dan jadwal shalat yang terpasang di komputer maupun laptop. Namun, untuk aplikasi kategori game masih belum tersedia.Hanifida merupakan metode baru yang dirasa sangat efektif dalam menghafal 99 asmaul husna. Media-media yang ada masih belum menggunakan media digital, apalagi berbasis game mobile. Seperti kita ketahui, perangkat mobile sangat digemari oleh masyarakat, khususnya mobile android. Belajar menghafal asmaul husna melalui game juga akan lebih menarik, ringkas, dan tidak cepat bosan. Media yang akan digunakan dalam mengimplementasilkan metode hanifida yaitu melalui game edukasi dengan tujuan untuk mempermudahkan pengguna dalam belajar yang menyenangkan. Di dalam game ini terdapat menu materi dan game yang terdiri dari 4 level.Game edukasi Hanifida secara langsung memunculkan hasil penilaian pemain. Pada tiap-tiap level menggunakan metode fuzzy untuk mengkategorikan nilai pemain. Dari 4 level permainan tersebut, masing-masing nilai akan diambil dan diakumulasikan untuk mendapatkan nilai akhir. Diakhir permainan, pemain akan mendapatkan badge digital yang berisikan nilai pemain dari setiap level dengan format .jpeg.\r\nKata kunci : Hanifida, mobile android, game edukasi .', 'Muhammad Anang Setiawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100060'),
(456, '110411100061', 'PENERAPAN LOGIKA FUZZY PADA NON PLAYER CHARACTER (NPC) ENEMY UNTUK GAME HEROES OF SURABAYA', 'CUCUN VERY ANGKOSO, S.T., M.T', 'YONATHAN FERRY HENDRAWAN, S.T., MIT', 'Game action sekarang ini semakin membutuhkan NPC enemy yang memiliki perilaku seperti manusia, termasuk penyesuaian kekuatan enemy, kemunculan enemy, dan behavior boss di setiap level  terhadap kemampuan player. Hal ini membutuhkan rule yang tepat agar enemy dapat mengimbangi kemampuan player.\r\nPenelitian ini bertujuan untuk menerapkan sebuah kecerdasan buatan atau Artificial Intelligence (AI), di dalam game dengan merancang variasi dari kemampuan enemy, kemunculan enemy dan perilaku boss di sesuai level yang ditentukan dan berdasarkan kemampuan player. Metode yang digunakan ialah dengan logika fuzzy Sugeno ordo nol dengan tahapan proses penentuan keanggotaan dan penentuan rule, inferensi, komposisi, dan defuzzyfikasi.\r\nDilakukan tiga pengujian. Pertama mecari persentase umum sebelum player memainkan game. Kedua dilakukan pengujian terhadap 10 player ketika memainkan game. Dan ketiga membandingkan penggunaan fuzzy dengan non-fuzzy dengan hasil untuk fuzzy perilaku boss memiliki pergerakan dinamis yaitu serang ganas, serang bisa, dan bertahan. Untuk fuzzy kemampuan, HP enemy dapat meningkat 2.25 kali lipat/2 kali lipat/1.75 kali lipat/1.5 kali lipat. Untuk fuzzy kemunculan, saat gameplay dapat spawning enemy baru sebanyak 3 enemy 2 boss/6 enemy 2 boss/6 enemy 4 boss. Berdasarkan hasil tersebut maka game HoS dikatakan adaptive bagi player.', 'ABDURROUF', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100061');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(457, '110411100063', 'PENERAPAN AUGMENTED REALITY UNTUK SISTEM IN-APP PURCHASE PADA GAME HEROES OF SURABAYA', 'Cucun Very Angkoso, ST., MT.', 'Ari Kusumaningsih, ST., MT.', 'Pada perkembangan nya, pemain mobile game bertambah banyak, sebagian dari mereka rela membeli premium item di dalam game yang mereka mainkan. Pemain mobile game khususnya di Indonesia banyak yang merasa kesulitan ketika melakukan transaksi pada sistem in-app purchase dalam game, dikarenakan media pembayaran uang digital memiliki banyak keterbatasan, dan media pembayaran dengan pemotongan pulsa hanya dimiliki oleh beberapa operator seluler saja, sedangkan media pembayaran dengan menggunakan ads tidak disukai oleh sebagian besar pengguna mobile game. \r\n Solusi permasalahan tersebut adalah dengan menggabungkan Augmented Reality dengan sistem m-commerce atau bisa juga disebut aCommerce yang mampu menangani transaksi in-app purchase menjadi lebih menarik sehingga pemain mempunyai solusi pembayaran dengan memakai kartu marker untuk pembelian item di dalam game. Aplikasi aCommerce ini mampu mendapatkan 96% kepuasan pengguna dari inovasi penjualan yang menarik, akan tetapi performa kecepatan aplikasi mendapatkan nilai terkecil sebesar 35% dari tingkat kepuasan pengguna, selain itu aplikasi aCommerce masih bergantung dengan cahaya dan jarak ketika mendeteksi marker, marker Vignette, Comic, Glow dan Old Poster mampu mendapatkan nilai 100% keberhasilan pendeteksian pada semua kondisi, marker Black & White, Blur Pixel, serta Old Pastel mempunyai prosentase keberhasilan yang berbeda pada setiap kondisi, sedangkan marker lain tidak terdeteksi karena terlalu berbeda dari marker asli.', 'Ahmad Ubaidillah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100063'),
(458, '110411100064', 'AUGMENTED REALITY SEBAGAI MEDIA PENJUALAN MERCHANDISE GAME JEMIL KINGDOM', 'Ari Kusumaningsih, S.T., M.T.', 'Eza Rahmanita, S.T., M.T.', 'Augmented reality (AR) saat ini banyak digunakan di berbagai bidang, salah satunya di bidang advertising. Augmented Reality (AR) dapat di gunakan sebagai media penjualan Merchandise pada sebuah game, dalam penelitian ini peneliti menggunakan teknologi Augmented Reality (AR) untuk Merchandise Game Jemil Kingdom dalam bentuk Collectable Card yang dapat berfungsi sebagai marker, Collectable Card menjadi media pemilihan karakter yang dapat digunakan untuk bertarung di dalam Game Jemil Kingdom. Game ini mengangkat tentang karakter dari jajanan pasar di Indoesia, sehingga dapat menjadi media pengetahuan tentang kuliner khas Indonesia khususnya tentang jajanan pasar, di pilihnya penggunaan Augmented Reality (AR) dalam penelitian ini adalah untuk memberikan pengetahuan tentang kuliner khas Indonesia khususnya jajanan pasar kepada khalayak luas secara interaktif, naratif dan menyenangkan, sehingga pemain dapat mengetahui berbagai jajanan pasar khas Indonesia dan memainkannya secara interaktif. Game ini juga menggunakan logika Fuzzy sebagai sistem pengaturan dalam menentukan perilaku Boss enemy dengan sistem game shuvit dimana setiap perilaku memiliki keunggulan dan kelemahan dari perilaku lain dalam Game Jemil Kindom. Dari pengujian didapatkan hasil perilaku dari output tersebut adalah Memukul sebesar 34,4%, Menendang sebesar 32,8% dan Menyikut sebesar sebesar 32,8%.', 'Ahmad Zakky Hidayatullah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100064'),
(459, '110411100066', 'Rancang Bangun Sistem Informasi Geografis Lokasi Pariwisata di Kabupaten Sumenep Berbasis Android', 'Mula\'ab, S.Si., M.Kom.', 'Achmad Jauhari, S.T., M.Kom.', 'Informasi terkait geografis dibutuhkan oleh banyak pihak, misalnya informasi jarak, lokasi, fasilitas yang dicari serta informasi lainnya. Sistem Informasi Geografis (SIG) merupakan salah satu solusi untuk mendapatkan informasi geografis suatu daerah. Pariwisata di Kabupaten Sumenep merupakan obyek yang dijadikan bahan untuk penelitian skripsi ini dikarenakan Kabupaten Sumenep memiliki keanekaragaman tempat-tempat wisata bagi para wisatawan. Untuk itulah dibuat sebuah sistem inforamasi pariwisata Kabupaten Sumenep berbasis android yang dapat mempermudah wisatawan dalam mencari informasi wisata yang ada di Kabupaten Sumenep. Dengan menggunakan 10 data evaluator menunjukkan hasil nilai rata-rata berdasarkan nilai penggunaan sistem sebesar 85,83% dan berdasarkan nilai desain dan tampilan sistem sebesar 81,78% atau bisa dikatakan Aplikasi sudah mencapai tujuan yang diharapkan.\n\nKata Kunci : Sistem Informasi Geografis, Mobile, Android, , Pariwisata\n', 'Achmad Hidayat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100066'),
(460, '110411100067', 'RANCANG BANGUN GAME BOMB MATH MENGGUNAKAN METODE PEMBELAJARAN SCRAMBLE', 'Cucun Very Angkoso, ST., MT.', 'Ari Kusumaningsih, ST., MT.', 'Game edukasi merupakan upaya untuk meningkatkan efisiensi media yang mengandung unsur pendidikan sebagai alternatif dan inovasi untuk mempermudah proses pembelajaran. Oleh karena itu perlu dibangun sebuah game yang berjudul Bomb Math untuk mengimplementasikan pelajaran perhitungan matematika. Game Bomb Math ini menggunakan metode pembelajaran scramble. Pembelajaran scramble itu sendiri merupakan metode pengacakan soal dengan jawaban yang telah tersedia. Pada game Bomb Math ini terdapat 4 stage permainan. Stage Bangkalan dengan 6 level mode penjumlahan, stage Sampang dengan 6 level mode pengurangan, stage Pamekasan dengan 6 level mode perkalian dan stage Sumenep dengan 6 level mode kombinasi penjumlahan, pengurangan dan perkalian. Pola pengacakan angka pada gameplay disediakan 10 pola dan metode input dalam permainan menggunakan drag touch. Berdasarkan hasil survey dari 30 responden, implementasi game Bomb Math ini tergolong sangat bermanfaat dan mudah dimainkan dengan persentase 70% dari segi manfaat dan 53% dari segi kemudahan. Dapat ditarik kesimpulan bahwa game ini bermanfaat karena membantu mengasah kemampuan berhitung dan mudah untuk dimainkan. Tampilan game ini sangat baik dengan penilaian dari 30 responden sebanyak 50%, interface tombolnya juga sangat mudah dengan penilaian sebanyak 47%  dan game ini sangat menarik dengan persentase penilaian dari 30 responden sebanyak 57%.\r\n\r\nKata Kunci : Mobile Android, Game, Bomb Math.', 'Faisal Hariyadi Arhamsyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100067'),
(461, '110411100068', 'RANCANG BANGUN SISTEM INFORMASI POSYANDU \r\nDENGAN FEA  FRAMEWORK\r\n', 'Bain Khusnul Khotimah, ST., S.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Posyandu kelurahan kebalandono merupakan salah satu bentuk kesehatan berbasis masyarakat, khususnya kesehatan ibu dan anak, kegiatan ini dilakukan  oleh kader posyandu,  dalam  melakukan pengolahan data posyandu ini masih bersifat manual baik dalam pencatatan dan pelaporan pelayanan. Sistem Informasi posyandu yang awalnya masih bersifat manual, maka perlu dikembangkan menjadi sistem terkomputerisasi. Dalam pembuatan sistem ini diharapkan dapat membantu kinerja petugas posyandu dalam hal administrasi  dan pelaporan Posyandu. Informasi yang dihasilkan Sistem Informasi Posyandu antara lain laporan pelayanan Posyandu meliputi laporan balita, laporan ibu, laporan imunisasi, laporan vitamin A dan laporan status gizi. Dalam Pembuatan Sistem Informasi diperlukan framework atau langkah kerja. Dalam penelitian ini digunakan framework FEA sebagai panduan untuk perencanaan pembuatan sistem informasi. FEA  framework merupakan framework yang menganalisa desain saat ini dan target desain yang ingin dicapai. Pada akhir penelitian ini dihasilkan sistem informasi posyandu di kelurahan kebalandono dengan kepuasaan user mencapai 74%.', 'Roychatul Mualifah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100068'),
(462, '110411100069', 'ANALISA WEB SERVER LOG DALAM MENENTUKAN POLA INTERAKSI PENGUNJUNG PADA SITUS UNIVERSITAS TRUNOJOYO MADURA', 'Mulaab, S.Si., M.Kom.', 'Achmad Jauhari, ST., M.Kom.', 'Sebuah  Log dalam Web  Server  akan  menyimpan  berbagai kegiatan  pengunjung  web site  dalam  sebuah  server. Berbagai interaksi yang dilakukan oleh pengunjung web akan meningkatkan ukuran  rekaman data log yang tersimpan dalam sebuah web server, sehingga pembengkakan volume data tidak dapat dihindari. Sayangnya, kebanyakan web administrator  tidak  mengetahui  bagaimana  manfaat  data  log  yang  tersimpan  tersebut  agar menggali  informasi  yang  bermanfaat  untuk  pengembangan  sebuah  situs  web. Data  mining  merupakan suatu cara untuk menambang data sehingga informasi yang sebelumnya tidak diketahui dapat diperoleh. Informasi  yang  dimasukkan  difokuskan  pada  penemuan  pola pengelompokkan pengunjung yang tersimpan dalam web  server  log  dengan menggunakan teknik K-means Clustering. Analisis web server log yang dilakukan  mampu  memberikan  informasi  mengenai  pola  kunjungan  dan  menemukan  beberapa  aturan clustering  yang  berguna  untuk  peningkatan  efektifitas  sebuah  web  site. Dari uji coba aplikasi menghasilkan 3 pola pengelompokkan yakni berdasarkan IP lokal, public, dan keduanya. Pada IP lokal, pola kunjungan di dominasi oleh IP puskom, rektorat, fakultas Pertanian dan Fisib. Pada IP publik pola kunjungan rata-rata hanya mengakses halaman utama web site atau beranda, begitu juga dengan pola yang diperoleh dari IP lokal ditambah dengan IP public.', 'Ach. Mufti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100069'),
(463, '110411100070', 'PERINGKASAN TEKS OTOMATIS UNTUK BAHASA INDONESIA BERBASIS NATURAL LANGUAGE PROCESSING DAN JARINGAN SYARAF TIRUAN', 'Hermawan,S.T.,M.Kom', 'Firdaus Solihin, S.Kom.,M.Kom', 'Peringkasan Teks Otomatis adalah salah satu bidang Information Retrieval (IR) yang menawarkan solusi untuk mencari informasi penting dalam suatu dokumen, dengan adanya peringkasan teks maka dokumen yang tersimpan didalam database tidak akan overload, waktu retrieval akan semakin cepat. Sejauh ini banyak implementasi tentang Peringkasan Teks Otomatis tetapi hasil nilai akurasinya rendah. Sehingga dalam penelitian ini dikembangkan aplikasi Peringkasan Teks Otomatis Berbahasa Indonesia Berbasis Natural Language Processing dan Jaringan Syaraf Tiruan. Metode Single Layer Perceptron (SLP ) merupakan metode pembelajaran terbimbing pertama dalam JST. SLP ini dipilih karena salah satu bentuk JST yang sederhana. Nilai threshold SLP bisa dilatih sehingga sistem secara otomatis menentukan kalimat penting mana yang akan dijadikan ringkasan. Perhitungan bobot term berdasar prinsip Tf*Idf kemudian dilakukan 6 klasifikasi NLP yakni Bias, Nominal, Verbal, Adjectiv, Adverb dan Numerik. Hasilnya diklasifikasikan menjadi kalimat penting dan tidak penting. Proses evaluasi dihitung berdasarkan teks yang diringkas oleh ahli Tata Bahasa Indonesia menggunakan Majority Opinion. Dari hasil penelitian menunjukkan nilai rata-rata Precision sebesar 70.4 % , nilai rata-rata Recall sebesar 91,5 % , nilai rata-rata F-Measures sebesar 78,8 % dan nilai Accuracy sebesar 68,3 %.', 'Nur Fadhilah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100070'),
(464, '110411100073', 'SMART HOME MONITORING SYSTEM IOT PADA PERANGKAT BERGERAK ANDROID MENGGUNAKAN RASPBERRY PI DAN PIR SENSOR', 'Cucun Very Angkoso, S.T., MT.', 'Koko Joni, S.T., M.Eng.', 'Di Jaman sekarang ini masyarakat lebih mementingkan status derajat ekonomi. Sebagian dari masyarakat menghabiskan waktunya untuk bekerja demi meningkatkan status ekonomi tersebut. Hal ini membuat masyarakat lebih menyukai teknologi yang serba cepat dan otomatis. Melihat tren yang berkembang di masyarakat tersebut, pada penelitian ini sistem yang dikembangkan menggunakan teknologi Internet Of Things. Sistem ini menggunakan raspberry pi sebagai microcontroller, berfungsi untuk pengontrol turn on / off LED pada halaman depan dan belakang. Juga LED dapat menyala dan mati otomatis sesuai dengan waktu yang sudah diatur oleh user. Pada sistem ini juga menggunakan pi camera 5 megapixel, PIR sensor yang digunakan mendeteksi gerak dan mengambil gambar saat terjadi pergerakan. Kedua sistem tersebut berhasil dibuat dan tidak ditemukan adanya error pada sistem dengan menerapkan beberapa proses uji, pada LED Control proses uji dilakukan dengan menjalankan aplikasi LED pada android merk Infinix X551. Pada sistem kedua yaitu capture motion proses uji dilakukan dengan menggunakan bahan uji human dan tumbuhan dalam kondisi pagi, siang, malam dan mengukur kecepatan waktu sending. Dari semua uji coba yang dilakukan dapat disimpulkan bahwa pada sistem kontrol LED, LED dapat menyala ketika button on ditekan dan mati ketika button off ditekan. Pada sistem kedua PIR sensor dapat mendeteksi gerakan manusia dalam semua kondisi dan dapat mengirim gambar ke email dengan waktu sending paling cepat 4 detik dan paling lama 7 detik. \n\nKata kunci : Internet of Things, Raspberry pi, Smart home, PIR sensor\n', 'Dewi Ratih Pascarini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100073'),
(465, '110411100074', 'RANCANG BANGUN SISTEM INFORMASI AKADEMIK SEKOLAH BERBASIS WEB \r\n(Studi Kasus : SMP PAWIYATAN SURABAYA)', 'Bain KhusnulKhotimah, ST., M.Kom.', 'Sigit Susanto P,S.Kom.,M.Kom.', 'Sistem informasi akademik sekolah adalah suatu sistem yang dirancang untuk kebutuhan pengelolaan data akademik dengan penerapan teknologi komputer yang bertujuan untuk memberikan informasi kepada pihak yang berkaitan dengan akademik sekolah. SMP Pawiyatan merupakan salah satu sekolah swasta di Surabaya yang belum memiliki aplikasi terkomputerisasi yang sudah terancang untuk pengelolaan data akademik. Saat ini pengelolaan data akademik di SMP Pawiyatan masih menggunakan excel dan juga terdapat data akademik yang masih dicatat. Dengan pengelolaan dengan sistem manual SMP Pawiyatan Surabaya mengalami beberapa pengerjaan yang kurang efektif dan efisien seperti pencarian data guru dan siswa, nilai akademik siswa dan yang lainnya pihak sekolah harus mencari satu persatu dari arsip yang tersimpan dalam jumlah yang banyak.\r\nDalam penelitian ini, peneliti akan merancang dan membuat sebuah sistem informasi akademik sekolah berbasis web. Studi kasus dari sistem tersebut dilaksanakan pada SMP Pawiyatan Surabaya dengan beberapa permasalahan yang ada.\r\nMetode penelitian yang digunakan dalam mebuat perancangan sistem informasi akademik berbasis web ini adalah metode waterfall yang meliputi analysis, design, coding dan testing.\r\nDengan adanya penelitian ini diharapkan dapat membantu pihak sekolah dalam melakukan pengelolaan data-data akademik secara efektif dan efisien, juga dapat memberikan informasi kepada siswa, guru dan wali kelas yang berkaitan dengan informasi akademik tanpa harus datang langsung ke yang bersangkutan.', 'HANIFAH PUTRI PRIWANDIYANTI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100074'),
(466, '110411100075', 'PERBANDINGAN ALGORITMA WINNOWING DAN RABIN KARP DALAM SISTEM PENDETEKSI PLAGIARISME BERBASIS CHARACTER BASE METHODS', 'Achmad Jauhari, ST, M.Kom.', 'Firmansyah Adiputra, S.T.,M.Cs.', 'Perkembangan teknologi menyebabkan semakin mudahnya mengakses informasi. Hal ini menimbulkan semakin banyak terjadi kasus plagiarisme. Plagiarisme merupakan tindakan mencuri atau mengambil karya orang lain tanpa mencantumkan sumber.\nPlagiarisme tidak hanya terjadi dalam kalangan pelajar saja, tapi juga kalangan pengajar. Pada dasarnya manusia memiliki intuisi untuk melakukan analisa terhadap dokumen dan dapat menentukan plagiarisme pada sebuah dokumen. Namun banyaknya jumlah data menjadi salah satu faktor kendala utama.\nBanyak sistem yang telah dikembangkan, diantaranya yang berbasis character based methods. Penelitian ini bermaksut untuk membandingkan dua buah algoritma dengan basis character based methods, yaitu algoritma winnowing dan rabin karp. Empat buah skenario pengujian dibuat untuk membandingkan akurasi nilai similarity. \nHasil perbandingan similarity keempat skenario diantaranya skenario word for word plagiarism, skenario plagiarisme mosaik, skenario dokumen terbukti plagiasi dan skenario tugas akhir dengan topik yang sama mendapatkan kesimpulan bahwa algoritma rabin karp memiliki nilai rataan similarity yang lebih tinggi dari algoritma winnowing.\n', 'Achmad Fajar Norullah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100075'),
(467, '110411100076', 'SISTEM PENDUKUNG KEPUTUSAN PEMBERIAN PINJAMAN PADA ANGGOTA KPRI KARYA HUSADA PAMEKASAN MENGGUNAKAN METODESAW(SIMPLE ADDITIVE WEIGHTING)', 'Achmad Jauhari, S.T.,M.Kom', 'Sigit Susanto Putro, S.Kom.,M.Kom', 'KPRI Karya Husada merupakan koperasi yang bergerak dalam usaha pengkreditan yang menyediakan pinjaman. Setiap anggota koperasi yang akan melakukan pinjaman (kreditur) harus melalui tahap penilaian untuk menentukan kelayakan penerima pinjaman. Penilaian tersebut dilihat berdasarkan empat kriteria, yaitu pendapatan, angsuran, pinjaman, dan piutang. \nSelama ini pelayanan untuk menentukan siapa saja yang berhak mendapatkan pinjaman masih dilakukan dengan cara manual dengan menggunakan Microsoft Office Excel namun belum menggunakan sistem komputer secara optimal. \nUntuk membantu mengatasi masalah tersebut, maka perlu adanya solusi pemecahan masalah yang ada dengan membuat suatu sistem pendukung keputusan (SPK). Dalam sistem ini penulis memberikan suatu rekomendasi pada ketua koperasi agar mempermudah dalam penentuan pemberian pinjaman pada anggota dengan menggunakan metode SAW (Simple Additive Weighting). Hasil pengujian menunjukkan bahwa dari pembuatan aplikasi ini dengan meggunakan metode SAW mempunyai tingkat akurasi 74% dari data pembanding manual.\n\nKata Kunci :SPK (Sistem Pendukung Keputusan), koperasi, KPRI Karya Husada, SAW (Simple Additive Weighting), pinjaman.\n', 'Herlina Eka Rahmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100076'),
(468, '110411100077', 'SISTEM BISNIS CERDAS (INTELLIGENT E-BUSINESS) INDUSTRI BATIK BANGKALAN dengan MENGGUNAKAN K-MEANS CLUSTERING', 'Bain Khusnul Khotimah, ST.,M.Kom.', 'Achmad Jauhari, ST., M.Kom.', 'Industri batik di Indonesia merupakan industri kecil menengah yang menjadi mata pencaharian sebagaian masyarakat. perkembangan bisnis online di Indonesia berkembang pesat, salah satu Industri Batik yang berada di Indonesia ini adalah industri batik di Bangkalan. Industri Batik di Bangkalan ini sudah cukup banyak yang menggunakan penjualan sistem online, tetapi dalam sistem online yang produsen jalankan masih belum bisa mengolah data lain yang dapat mendukung penjualan para produsen. Saat ini para produsen dapat menggunakan sistem penjualan online tersebut hanya untuk berkomunikasi kepada para konsumen saja. Hal ini mengakibatkan kurang efektifnya sistem online yang produsen miliki dan membuat konsumen menghabiskan banyak waktu untuk memilih produk yang di butuhkan dan cocok.\r\nSalah satu cara mengatasi masalah di atas adalah dengan cara membuat Sistem Bisnis Cerdas (Intelligent E-Businnes) Industri Bangkalan dengan menggunakan Web Mining . Salah satu web mining adalah metode K-Means Clustering. Metode K-Means Clustering ini dapat mengelompokkan produk sesuai dengan kesamaan antar data produk dengan perhitungan jarak perbedaan menggunakan rumus Euclidean serta dapat membantu pembeli untuk membuat keputusan dengan memberikan rekomendasi item-item produk batik terbaik berdasarkan preferensi pembeli.', 'Mukholifatus Sa\'adah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100077'),
(469, '110411100079', 'Pengelompokkan SMA/MA/SMK Di Kabupaten Bangkalan dalam Penggunaan Teknologi Informasi Menggunakan Metode K-Means', 'Mula\'ab, S.Si.,M.Kom', 'Rika Yunitarini, ST.,MT', 'Lembaga pendidikan pada jenjang SMA/MA/SMK merupakan tempat yang paling strategis guna mencetak generasi bangsa yang nantinya akan bersaing guna mengatasi isu globalisasi. Oleh karena itu harus mendapat perhatian dari pemerintah dan masyarakat. Untuk pemerintahnya sendiri berkewajiban untuk mengarahkan, membimbing, melindungi, serta memberi fasilitas kepada lembaga pendidikan tersebut. Dalam hal ini fasilitas yang diperlukan lembaga pendidikan guna menunjang untuk penaklukan isu globalisasi adalah penggunaan Teknologi Informasi (TI). Pengetahuan akan penggunaan teknologi informasi pada pendidikan setingkat SMA/MA/SMK di Kabupaten Bangkalan masih kurang terpenuhi. Dalam penelitian ini akan dilakukan pengelompokkan (clustering) yang merupakan metode dalam data mining yang membagi seluruh data pada kelompok-kelompok sesuai dengan kesamaan karakteristiknya. Pada penggunaan TI di SMA/MA/SMK akan dilakukan pengelompokkan berdasarkan kriteria TI menggunakan metode K-Means dengan funngsi jarak Manhattan Distance dari jumlah cluster = 2 sampai dengan 49. Untuk mendapatkan jumlah cluster terbaik, akan dilakukan perhitungan Sum Sequared of Error (SSE). Jumlah cluster dengan nilai SSE terkecil akan dipilih untuk dijadikan jumlah cluster terbaik untuk pengelompokkan ini. Pada uji coba yang telah dilakukan, didapatkan jumlah cluster terbaik untuk pengelompokkan ini adalah 3 cluster, karena mempunyai nilai SSE paling kecil yaitu 59.91. \r\n\r\nKata Kunci : Cluster, K-Means, Manhattan Distance, Sum Sequared of Error', 'Elvandari Nur Aifah Agha', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100079'),
(470, '110411100080', 'SISTEM INFORMASI PANGKALAN DATA BERBASIS AKREDITASI UNIVERSITAS TRUNOJOYO MADURA', 'Dr. Arif Muntasa, S.Si., MT.', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Akreditasi program studi sarjana adalah sebuah proses evaluasi yang dilakukan secara berkala oleh badan yang memiliki kewenangan yakni BAN-PT. Pelaksanaan proses penyusunan borang akreditasi program studi tidak lepas dari beberapa organisasi yang ikut berperan dalam mengelola dan menyuplai data kebutuhan borang akreditasi. Data yang digunakan oleh program studi guna proses penyusunan borang akreditasi adalah data historis yang dikumpulkan secara berkala dari waktu ke waktu guna memberi gambaran/informasi dari suatu kegiatan. Proses pengumpulan sebaran data-data dari masing-masing organisasi tersebut memerlukan sumber daya yang besar dan waktu yang tidak sebentar. Sistem digunakan program studi pada Universitas Trunojoyo Madura dalam melakukan pengumpulan data historis akreditasi yakni dengan melakukan pencarian, pengumpulan serta pencatatan data dalam daftar sendiri yang terpisah dan belum terkomputerisasi secara maksimal serta belum terpusat secara maksimal pengelolaan dan manajemen datanya. Sehingga dikembangkan sebuah sistem yang dapat menghimpun data tersebut yakni Sistem Informasi Pangkalan Data Berbasis Akreditasi Universitas Trunojoyo Madura.', 'Moch. Nasrul Ulum', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100080'),
(471, '110411100081', 'IMPLEMENTASI ALGORITMA RABIN KARP UNTUK SISTEM PENILAIAN OTOMATIS UJIAN ESAI PPKN', 'Achmad Jauhari, S.T., M.Kom', 'Rika Yunitarini, S.T., M.T.', 'Abstract:Pada proses pembelajaran terdapat beberapa jenis ujian, seperti pilihan ganda, dan juga esai. Pengkoreksian esai lebih susah dibandingkan dengan pilihan ganda. Contohnya pada mata pelajaran PPKN. Biasanya siswa menjawab soal dengan jawaban yang dikembangkan sendiri, sehingga guru susah mengoreksi jawaban siswa dengan mencocokkan kunci secara manual. Dengan ini dilakukan penelitian sehingga didapatkan sistem penilaian ujian otomatis yang dapat membantu guru dalam mencocokan jawaban dengan kunci yang ada.\r\nBerdasarkan pengujian sistem dengan menggunakan metode Rabin Karp, hasil dari perbandingan penilaian manual dan sistem  terlihat bahwa penggunaan stemming mempengaruhi penilaian sistem. Penggunaan stemming menghasilkan nilai yang lebih kecil dibandingkan dengan tidak menggunakan stemming.Nilai perbedaan diperoleh dengan mencari nilai mutlak dari pengurangan antara penilaian manual dan penilaian sistem, kemudian mencari rata-ratanya. Terlihat bahwa perbedaan antara penilaian manual dan penilaian sistem yang menggunakan stemming dan tidak  adalah 15,12% dan 19,81%.  Dari nilai perbedaan yang sangat kecil yaitu berkisar 15-20% penulis dapat menyimpulkan bahwa sistem penilaian esai dapat membantu guru untuk mengkoreksi ulangan siswanya.', 'Ira Cahyaningtias', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100081'),
(472, '110411100082', 'MENILAI KINERJA TEKNIK REDUKSI DIMENSI PCA PADA ANALISIS OPINI MASYARAKAT BERBASIS DATA TWITTER MENGGUNAKAN METODE NAÏVE BAYES CLASIFIER', 'Mula\'ab S.Si., M.Kom', 'Firdaus Solihin S.Kom., M.Kom', 'ABSTRAK\n Twitter merupakan media sosial yang sering digunakan penggunanya untuk menulis hal –hal atau opini  - opini yang membahas isu yang terjadi pada saat ini. Twitter juga menjadi sarana bagi pemerintah sebagai penentuan kepuasan terhadap kebijakan yang telah dibuat. Kebijakan ekonomi adalah topik yang dibahas pada penelitian ini. Maka dari itu pemanfaatan media sosial inilah untuk mengetahui respon masyarakat terhadap kebijakan ekonomi yang dibuat. Sentiment analysis dibuat guna dapat mengklasifikasikan opini positif ataupun negatif secara ceapt dan tepat.\nGuna meningkatkan performa dan mengurangi kinerja komputasi maka digunakanlah reduksi dimensi menggunakan PCA (Principal Component Aalysis) dengan mengurangi dimensi dan tetap mempertahankan variasi data yang ada. Untuk melakukan pengujian menggunakan data sejumlah 135 data tweet  untuk data training dan 136 data tweet sebagai data testing. Pengujian klasifikasi dengan metode Naïve Bayes Clasifier menghasilkan akurasi sebesar 59% .\nKata kunci : Twitter, sentiment analysis, PCA, naïve bayes classifier', 'Fajar April Budiastio', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100082'),
(473, '110411100084', 'Sistem Dinamik Ketersediaan Jagung Di Pamekasan', 'Achmad Jauhari, S.T,. M.Kom', 'Sigit Susanto Putro, S.Kom,.M.Kom', 'Abstract: Jagung di kabupaten Pamekasan digunakan sebagai makanan pokok kedua pengganti beras. Untuk bisa mengetahui jumlah ketersediaan jagung yang ada sudah mencukupi kebutuhan atau belum, dibutuhkan suatu sistem yang dapat menganalisa hal tersebut. Tujuan dari penelitian ini adalah untuk mengetahui ketersediaan jagung di masa yang akan datang, serta untuk mengetahui alternatif kebijakan yang dapat dilakukan untuk meningkatkan ketersediaan jagung. Metode yang digunakan dalam penelitian ini adalah pendekatan sistem dinamik  yang dilanjutkan dengan simulasi berdasarkan beberapa skenario yang telah ditetapkan. Aspek yang dikaji dalam penelitian ini meliputi sub sistem penyediaan dan sub sistem kebutuhan. Pemodelan sistem dinamik dilakukan dengan alat bantu diagram simpal kausal (loops) yang menghasilkan struktur model dinamis dan perilaku sistem dinamis. Berdasarkan hasil simulasi, untuk meningkatkan ketersediaan jagung di Pamekasan dapat dilakukan dengan peningkatan produksi jagung yaitu dengan penggunaan pupuk NPK, penggunaan bibit unggul hibrida, dan gabungan keduanya. Penggunaan pupuk NPK dapat meningkatkan produksi jagung sampai dengan 55,49%, penggunaan bibit unggul hibrida dapat meningkatkan produksi jagung sampai dengan 70%, dan penggunaan bibit hibrida dan pupuk NPK dapat meningkatkan produksi jagung sampai dengan 76% .', 'Ilmiyatus Shalihah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100084'),
(474, '110411100085', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN JURUSAN MADRASAH ALIYAH MIFTAHUL ULUM BETTET MENGGUNAKAN METODE VIŠEKRITERIJUMSKO KOMPROMISNO RANGIRANJE (VIKOR)', 'SIGIT SUSANTO PUTRO, S.KOM., M.KOM', 'ACHMAD JAUHARI, S.T., M.KOM', 'Salah satu peran SPK dibidang pendidikan yaitu pada proses pengambilan keputusan untuk pemilihan jurusan siswa Madrasah Aliyah (MA) Miftahul Ulum Bettet, yang sifatnya dapat membantu mengambil keputusan dalam menentukan jurusan IPA, dan sistem ini dapat membantu memecahkan prmasalahan-permasalahan seperti rangking siswa yang sama, dan jugak dapat membantu sebagai bahan untuk membantu guru dalam mengambil keputusan.\nUntuk mendukung hal tersebut diatas, maka diperlukan suatu metode yang diterapkan dalam sistem pendukung keputusan yang didalamnya menggunakan metode dan  pembobotan disetiap kriteria-kriteria yang ditentukan oleh sekolah.\nMetode yang diterapkan dalam sistem ini yaitu Metode Vikor, metode ini dapat membantu  menentukan siswa dengan perangkingan, semakin kecil nilai indek vikor (Q) siswa, maka semakin bagus peringkat rangkingnya.\nPada penjurusan tahun ajaran 2015/2016 hasil perangkingan metode VIKOR kecocokan 88% \nkata_kunci : SPK, Metode Vikor, MA Miftahul Ulum, Nilai Indek Vikor.\n', 'ABDUR ROZIK', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100085'),
(475, '110411100086', 'ANALISA TINGKAT PENERIMAAN MEDIA PEMBELAJARAN E-LEARNING DENGAN MENGGUNAKAN TECHNOLOGY ACCEPTANCE MODEL (TAM)', 'Andharini Dwi C, S.Kom., M.Kom', 'Rika Yunitarini, S.T., M.T.', 'ANALISA TINGKAT PENERIMAAN MEDIA PEMBELAJARAN E-LEARNING DENGAN MENGGUNAKAN TECHNOLOGY ACCEPTANCE MODEL (TAM)\nVerdina Apriliana Elfa Sari\n(11.04.1.1.1.00086)\n\nPembimbing 1 : Andharini Dwi C, S.Kom., M.Kom\nPembimbing 2 : Rika Yunitarini, S.T., M.T.\n\nABSTRAK\n\nMedia pembelajaran elektronik saat ini semakin banyak digunakan khususnya di dunia pendidikan yaitu e-learning. E-learning merupakan alat bantu proses belajar mengajar dalam bentuk digital, dimana siswa dan guru dapat menggunakannya kapanpun dan dimanapun dengan cara online. Keberhasilan penggunaan metode belajar ini bukan suatu hal yang mudah, sikap dan perilaku penerimaan siswa dan guru terhadap media pembelajaran e-learning ini juga perlu diketahui. \nDengan menggunakan model yang sudah ada yaitu Technology Acceptance Model (TAM) kemudian di kalibrasi untuk mengetahui kebenaran dan seberapa besar nilai pengaruh faktor-faktor yang ada pada model TAM. Penelitian ini melakukan survey kepada siswa dan guru yang sebelumnya menggunakan proses pengajaran tanpa e-learning. Dengan menggunakan metode Delphi untuk mendapatkan faktor-faktor yang berpengaruh dan membuat list kusioner. Pengukuran pada model TAM yang digunakan untuk pengolahan data menggunakan Structural Equation Model (SEM). \nHasil dari pemodelan TAM menunjukkan bahwa tingkat penerimaan terhadap media pembelajaran e-learning adalah signifikan positif. Faktor-faktor konfirmatori yang mempengaruhi tingkat penerimaan e-learning Bahasa Madura adalah valid. Dengan aktualisasi penggunaan yang dapat dijelaskan oleh variabilitas persepsi kemudahan,kegunaan,sikap, dan minat pengguna terhadap e-learning memberikan nilai kontribusi sebesar 33%.\n\nKata Kunci : E-Learning, TAM (Technology Acceptance Model), SEM (Structural Equation Model)\n', 'Verdina Apriliana Elfa Sari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100086'),
(476, '110411100088', 'SISTEM INFORMASI MANAJEMEN SIDANG PENGADILAN BERBASIS FRAMEWORK CODEIGHNITER DAN SMS GATEWAY', 'Achmad Jauhari, S.T, M.Kom', 'Rika Yunitarini, S.T., M.T.', 'Tinggi nya tingkat kejahatan di Indonesia membuat banyak pihak harus bekerja keras untuk menyelesaikan permasalahan demi permasalahan yang ada.Pengadilan adalah salah satu pihak yang memperoleh dampak dari tinggi nya tingkat kejahatan, karena pengadilan harus menangani, memproses kemudian mengadili apakah yang bersangkutan bersalah atau tidak.\n\nMemberitahukan mengenai jadwal persidangan kepada pihak-pihak yang harus hadir dalam sidang secara manual jelas dibutuhkan waktu dan biaya tambahan, maka disini dibuatlah suatu sistem manajemen sidang dan jadwal persidangan agar lebih efektif dan efisien. Penelitan ini menerapkan SMS Gateway dan menggunakan framework Codeigniter dalam pembuatannya, diharap dengan adanya sistem ini dapat membantu pihak pengadilan dalam meminimalisir biaya dan membantu untuk pemberitahuan penjadwalan dan persidangan.\n\nDari hasil penelitian ini menggunakan aplikasi sms gateway bisa menghemat biaya pengiriman Rp 380.000.00 per bulannya. Dan juga lebih mudah dan efisien dalam penggunaannya.\n \nKata kunci: Informasi, SMS, Teknologi, Pengadilan.\n', 'Anggy Septian Mohammad', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100088'),
(477, '110411100089', 'SISTEM DINAMIK UNTUK MENGANALISA EFEKTIVITAS KEBIJAKAN PENDIDIKAN DALAM PENYELARASAN\nDUNIA KERJA KERJA INDUSTRI', 'Achmad Jauhari, ST., M.Kom. ', 'Sigit Susanto P, S. Kom. M. Kom ', 'SISTEM DINAMIK UNTUK MENGANALISA EFEKTIVITAS KEBIJAKAN PENDIDIKAN DALAM PENYELARASAN\nDUNIA KERJA KERJA INDUSTRI\n( Studi Kasus: Sekolah Menengah Kejuruan Negeri 1 Sampang ) \n\nNurul Huriyah \n(11.04.111.00089)\n\nPembimbing I : Achmad Jauhari, ST., M.Kom. Pembimbing II : Sigit Susanto P, S. Kom. M. Kom \n\nABSTRAK\nPendidikan merupakan proses pembelajaran yang dilakukan secara sadar oleh pendidik, dengan tujuan supaya  terbentuknya kepribadiaan yang bukan hanya  pintar secara akademis tapi juga memiliki kualitas kompetensi yang berkualitas. Untuk bisa menciptakan lulusan yang berkualitas, dibutuhkan suatu sistem yang bisa menganalisa hal tersebut.  SDM yang baik dan berkualitas diharapkan dapat mencapai kompetensi yang dapat mengisi atau dapat menciptakan lapangan pekerjaan yang sesuai dengan bidang dan keahliannya. Metode yang digunaan dalam penelitian ini adalah pendekatan sistem dinamik yang dilanjutan dengan simulasi dengan beberapa skenario yang sudah ditetapkan. Pemodelan sistem dinamik dilakukan dengan alat bantu simpal causal (loops) yang menghasilkan struktur model dinamis dan perilaku sistem dinamik.\nBerdasarkan hasil simulasi, kebijakan dalam penyelarasaan sistem pendidikan dengan dunia kerja  untuk meningkatkan siswa diterima kerja yang relevan pada SMKN 1 Sampang dapat dilakukan dengan peningkatan sarana dan prasarana, dan kerja sama dengan dunia industri.  \nPeningkatan sarana dan prasarana dapat meningkatkan siswa diterima kerja yang relevan sampai dengan 47% , dan penambahan kerja sama dengan dunia industri dapat meningkatan siswa diterima kerja yang relevan sampai dengan 43%.\nKata Kunci : Pendidikan, Sistem Dinamik, Simulasi, Keselarasan\n', 'Nurul Huriyah ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100089'),
(478, '110411100090', 'Web Crawler Jejak Pertandingan Bulutangkis Tunggal Putra PBSI\nMenggunakan Teknik Grabbing', 'Sigit Susanto Putro, S.Kom.,M.Kom', 'Achmad Jauhari, S.T.,M.Kom', 'Ketersediaan informasi tentang event bulutangkis yang sudah diikuti oleh para atlit tunggal\nputra PBSI (Persatuan Bulutangkis Seluruh Indonesia) masih susah untuk didapatkan. Dengan\nmemanfaatkan teknologi yang semakin bagus, Web Crawler menjadi solusi untuk mendapatkan\ninformasi tersebut dengan mudah.\nWeb crawler pada sistem ini menggunakan Teknik Grabbing untuk memfilter data-data yang\ndibutuhkan, pada sistem ini data yang diambil yaitu nema event dan tanggal event tunggal putra PBSI\nmulai tahun 2012 sampai dengan tahun 2016 yang terdapat pada website BFW (Badmintoon World\nFederation). Hasil Sistem Web Crawler menggunakan Teknik Grabbing ini telah berhasil\ndimplementasikan dengan presentase 95%.\nKata Kunci : Web Crawler, Teknik Grabbing, Tunggal Putra PBSI, Bulutangkis', 'AFRYAN USWATUS SHALEH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100090'),
(479, '110411100097', 'EKSTRAKSI FITUR BERBASIS PRINCIPAL COMPONENT ANALYSIS (PCA) DAN MORPHOLOGY OPERATOR UNTUK SEGMENTASI OPTIC DISK PADA CITRA FUNDUS', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom, M.Kom.', 'Diabetes merupakan penyakit yang dapat menyerang organ tubuh manusia khususnya fungsi penglihatan. Gangguan fungsi penglihatan yang disebabkan diabetes dikenal sebagai Diabetic Retinopathy (DR). Mata merupakan organ utama fungsi penglihatan, beberapa organ pada mata dapat digunakan untuk menganalisa penyakit termasuk penyakit diabetes retinopathy. Optic disc (OD) merupakan pusat pertemuan syaraf mata. Letak OD pada citra fundus mudah diamati karena OD memiliki kontras lebih tajam dibanding fitur lain yaitu exudate yang merupakan gejala DR yang tampak berupa bercak pada mata. Dalam penelitian ini, untuk menentukan segmentasi OD terdapat  dua tahap yaitu preprocessing dan segmentasi. Pada tahap preprocessing merubah citra RGB menjadi citra grayscale menggunakan ekstraksi fitur berbasis Principal Component Analysis (PCA), nilai grayscale PCA diambil dari nilai eigen vector berdasarkan eigen value yang terbesar. Hasil citra grayscale PCA yang didapat memiliki kontras yang lebih baik dan tajam dalam mempresentasikan objek optic disk. Kemudian dilakukan penghapusan pembulu darah dengan menggunakan Morphology Operator. Pada tahap segmentasi menggunakan metode Otsu Thresholding untuk menentukan nilai ambang segmentasi. Metode ini telah diujikan pada database Messidor yang terdiri dari 100 citra fundus. Dengan database ini, didapatkan rata-rata akurasi sebesar 99,11%, sensitiftas 81,298%, dan spesifitas  99,412%. ', 'Abdul Khafit', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100097'),
(480, '110411100098', 'Sistem Pendukung Keputusan Penerimaan dan Pengalihan Beasiswa Bidikmisi Menggunakan Metode Naive Bayes Classifier dan Profile Matching', 'Achmad Jauhari, S.T., M. Kom', 'Rika Yunitarini', 'Universitas Trunojoyo Madura (UTM) merupakan salah satu perguruan tinggi negeri yang banyak diminati oleh para pendaftar beasiswa Bidikmisi. Penyeleksiannya masih manual, sehingga dibutuhkan suatu sistem yang memiliki waktu komputasi yang cepat dan efisien dalam pengolahan data. Pada penelitian  ini metode Naïve Bayes Classifier dan metode Profile Matching digunakan untuk proses seleksi penerimaan beasiswa di Universitas Trunojoyo Madura (UTM) dengan data yang diolah adalah berupa data kategorikal. Untuk awal seleksi penerimaan beasiswa Bidikmisi di Unversitas Trunojoyo Madura (UTM) kriteria yang digunakan adalah keadaan ekonomi, kondisi rumah, dan aset keluarga seperti kendaraan dan kebun. Sedangkan untuk pengalihan beasiswa yang dilakukan oleh Fakultas kriteria yang digunakan IPK, keadaan ekonomi, dan kondisi rumah. Hasil dari pengujian sistem menggunakan Naive Bayes Classifier mencapai tingkat akurasi 67% untuk jumlah data latih 50 dan data uji 170, sedangakan mencapai tingkat akurasi 72% untuk data latih 70 dan data uji 170. Sedangkan untuk metode Profile Matching yang digunakan pada seleksi di fakultas mencapai tingkat akurasi sebesar 73%.', 'Novi Indrawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100098'),
(481, '110411100099', 'IMPLEMENTASI ALGORITMA HOUGH TRANSFORM UNTUK SEGMENTASI OPTIC DISC PADA CITRA FUNDUS RETINA', 'DR. ARIF MUNTASA S.Si., M.T', 'DR. INDAH AGUSTIEN S, S.Kom, M.Kom', 'Diabetic retinopathy adalah kondisi kerusakan pada pembuluh darah yang menyuplai retina pada penderita diabetes. Semakin lama seseorang menderita diabetes, maka semakin besar kemungkinan terkena diabetic retinopathy. Kelainan ini dapat mengakibatkan kebutaan. Dalam penelitian ini, algoritma hough transform dengan pendeteksian lokasi dan memperoleh fitur yang spesifik diterapkan untuk melakukan segmentasi optic disc. Pada tahap pertama, citra fundus retina akan diperbaiki dengan menggunakan homomorphic filtering untuk memperbaiki kualitas citra dengan menormalkan kecerahan seluruh komponen citra fundus retina. Tahap kedua dengan penghapusan pembuluh darah dan mengubah citra menjadi citra biner. Terakhir dilakukan deteksi tepi dan pendeteksian lokasi dan segmentasi optic disc menggunakan Algoritma hough transform. Pengujian dilakukan pada database INSPIRE (Iowa Normative Set for Processing Images of Retina) sebanyak 40 citra. Hasil segmentasi citra dibandingkan dengan citra ground truth. Setelah dilakukan uji coba diperoleh tingkat akurasi terbesar adalah 78%. Nilai Mean Difference of Diameters (MDD) dari optic disc sebesar 18.68 piksel dan rata-rata waktu komputasi paling cepat sebesar  7.38 seconds. Dari tingkat akurasi tersebut dapat disimpulkan bahwa algoritma hough transform cukup baik untuk segmentasi optic disc pada citra fundus retina.', 'RIA LYZARA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100099'),
(482, '110411100100', 'KEAMANAN CITRA DENGAN WATERMARKING MENGGUNAKAN PENGEMBANGAN ALGORITMA LEAST SIGNIFICANT BIT', 'Dr. Arif Muntasa, S.Si., MT.', 'Dr. Indah Agustien, S.Kom., M.Kom.', 'Image security adalah proses mengamankan data digital yang berbentuk citra. Salah satu metode pengamanan data citra digital adalah watermarking menggunakan algoritma Least Significant Bit atau LSB. Konsep kerja image security menggunakan algoritma LSB adalah dengan mengganti nilai bit citra pada lokasi tertentu sehingga membentuk pola. Pola hasil dari pergantian nilai bit pada citra inilah yang disebut dengan tanda air atau watermark. Pemberian watermark pada citra menggunakan algoritma LSB memiliki konsep sederhana sehingga informasi yang disisipkan akan mudah hilang saat mengalami serangan seperti serangan noise atau kompresi. Sehingga perlu dilakukan modifikasi yaitu pengembangan algoritma LSB. Hal ini dilakukan untuk mengurangi distorsi informasi watermark terhadap serangan yang terjadi. Dalam Tugas Akhir atau TA ini dibagi menjadi 6 proses, yaitu ekstraksi kanal warna citra cover, pencarian area busy, penyisipan watermark, perhitungan akurasi penyisipan, ekstraksi watermark dan perhitungan akurasi ekstraksi. Ekstraksi kanal warna citra cover adalah proses mendapatkan kanal warna biru pada citra cover. Selanjutnya citra watermark disisipkan ke dalam citra cover sehingga menghasilkan citra terwatermark menggunakan algoritma beberapa pengembangan LSB dan mencari akurasinya dengan menghitung nilai Peak Signal to Noise Ratio. Sebelum citra terwatermark diekstraksi, dilakukan pengujian dengan memberi noise dan melakukan kompresi format jpg. Akurasi hasil ekstraksi dicari dengan menghitung nilai Bit Error Rate.', 'Kurniawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/110411100100'),
(483, '120411100001', 'Pengembangan Software Audit Teknologi Informasi\nBerdasarkan COBIT 4.1 Framework pada\nDomain Plan and Organize (PO)\n', 'Wahyudi Agustiono, S.Kom., M.Sc., Ph.D', 'Sigit Susanto Putro, S.Kom., M.Kom ', 'Audit teknologi informasi adalah proses mengumpulkan dan mengevaluasi fakta apakah software komputerisasi sebuah perusahaan/ instansi terlindungi, dan integritas data terpelihara, sesuai dengan tujuan organisasi untuk mencapai efektifitas, dan efisiensi dalam penggunaan sumber daya. Dengan dilakukan audit teknologi informasi diharapkan dapat diperoleh informasi yang relevan dan komperehensif, serta efektif dan efisien bagi auditor guna membantu didalam pengambilan keputusan. Namun didalam implementasinya, proses auditing masih banyak dilakukan secara konvensional (manual) sehingga dibutuhkan sumber daya (waktu dan tenaga) yang cukup besar.\nPada tugas akhir ini dibuatlah suatu aplikasi sistem audit teknologi informasi berbasis web sebagai salah satu solusi dan pengembangan auditing untuk menangani permasalahan proses auditing tersebut. Aplikasi sistem audit yang dibangun menggunakan standar kerangka kerja tata kelola IT COBIT 4.1 dengan mengambil domain plan and organize (PO). Hasil perhitungan maturity level dan bentuk kuesioner yang disajikan lebih terperinci, karena aplikasi yang dibangun menggunakan metode linkert.  Hasil pengujian terhadap aplikasi sistem audit yang dibangun menunjukkan bahwa aplikasi memiliki fitur-fitur yang mudah digunakan oleh pengguna (user friendly). Aplikasi yang dirancang juga memberikan fleksibilitas bagi pengguna didalam memilih butir-butir pertanyaan audit. Hasil penilaian menunjukkan bahwa aplikasi yang dibangun memiliki kualitas sistem yang bagus.\n\nKata Kunci :  Audit teknologi informasi, COBIT 4.1, plan and organize (PO)\n', 'R. Ahmad Hafiduddin Amirullah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100001'),
(484, '120411100002', 'SIMULASI KOMBINASI KRIPTOGRAFI AES DAN\nTURBO CODE UNTUK ENKRIPSI DAN DEKRIPSI\nDALAM PENYIMPANAN DATA CLOUD', 'Dwi Kuswanto S.Pd., M.T.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Cloud computing merupakan model teknologi dimana sumber\ndaya seperti komponen komputer (processor, memory, network,\nstorage) tidak lagi berwujud materi konkret, melainkan abstrak. Salah\nsatu layanan dari cloud adalah Cloud Storage. Dengan fasilitas Cloud\nstorage, pengguna dapat melakukan penyimpanan data digital melalui\njaringan internet. Namun karena setiap data dikirim melewati jalur\nkomunikasi,terdapat hambatan berupa derau (noise), di mana derau\ndapat mengubah dan menurunkan kualitas data yang\nditransmisikan.Untuk mengatasi permasalahan di atas maka dapat\ndilakukan melalui teknik kriptografi yang dikombinasi dengan\nForward Error Correction (FEC) Turbo Code. Hasil simulasi\nmenunjukan bahwa data terenkripsi dan di unggah ke dalam Dropbox\ndan berjalan dengan baik. Kemudian hasil analisa menunjukan\npresentase data berupa text, image dan sound akan kembali 100 %\npada SNR 14 dB. Selain itu terjadi penurun Bit error Rate (BER).\nDalam uji coba avalance effect berdasarkan tipe data yakni pada\nberkas text didapatkan avalance effect tertinggi sebesar 56.6460%\ndengan kondisi berkas sama namun kunci yang dimasukan berbeda.\nUntuk berkas image, avalanche effect tertinggi didapatkan 55.0781%\ndengan kondisi berkas berbeda namun kunci yang dimasukan sama.\nSedangkan untuk berkas sound, avalance effect tertinggi didapatkan\n49.6094% dengan kondisi berkas berbeda namun kunci yang di\nmasukan sama. Dalam pengujian waktu eksekusi data, semakin besar\ndata yang di enkripsi semakin lama waktu yang dibutuhkan untuk\nenkripsi dan dekripsi. Dengan demikian kombinasi enkripsi dengan\nTurbo Code dapat mengatasi permasalahan di atas.\nKata Kunci : AES, Turbo Code, Cloud Storage.', 'Sasetyo Aryono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100002'),
(485, '120411100003', 'Sistem Pendukung Keputusan Penentuan Nomor Perlombaan Cabang Olahraga Atletik Dengan Metode Naive Bayes', 'Achmad Jauhari., S,T, M.Kom', 'Sigit Susanto Putro., S.Kom, M.Kom', 'Dalam suatu cabang olahraga atletik terdapat beberapa nomor yang dilombakan, baik ditingkat regional maupun internasional. Nomor–nomor  perlombaan tersebut diantaranya: lari cepat,  lari menengah, lompat, jalan dan lempar. Cabang olahraga atletik berada dibawah naungan organisasi Persatuan Atletik Seluruh Indonesia atau (PASI). Penilaian yang dilakukan masih secara manual. Sehingga, sering terjadi kesalahan yang dilakukan oleh pelatih dalam menentukan nomor perlombaan bagi peserta didiknya. Oleh karena itu, Persatuan Atletik Seluruh Indonesia (PASI) membutuhkan sebuah sistem yang memiliki waktu komputasi yang cepat dan efisien dalam pengolahan data. Untuk mendukung sistem pendukung tersebut perlu adanya sebuah metode. Salah satunya metode yang akan digunakan pada sistem pendukung keputusan penentuan nomor perlombaan ini yaitu Metode Naive Bayes. Metode Naive Bayes berfungsi dalam pengklasifikasian data pada kelas tertentu. Hasil dari klasifikasi tersebut kemudian digunakan pelatih sebagai bahan pertimbangan bagi peserta didiknya yang akan bergabung. Dengan adanya sistem ini diharapkan pelatih dapat lebih mudah dalam menentukan nomor perlombaan bagi peserta didiknya.\n\nHasil dari pengujian sistem menggunakan metode  Naive Bayes dengan data uji 19 menghasikan tingkat akurasi  89,47%, untuk  data uji 36 menghasilkan akurasi 58,33%, untuk data uji  54 menghasilkan akurasi  40,74%.\n\n', 'Amelia Rita Kartika', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100003'),
(486, '120411100004', 'Sistem Pendukung Keputusan Seleksi Masuk PBSI Menggunakan Metode SMART(Studi Kasus PBSI Kabupaten Sumenep)', 'Achmad Jauhari, S.T, M.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'ABSTRAK\nPembinaan pemain bulutangkis didaerah perlu ditingkatkan karena perlu kita ketahui pada saat ini Indonesia mengalami penurunan yang cukup jauh dari sebelumnya. Banyak pemain muda Indonesia menyamai para pendahulu-pendahulu mereka.\nSalah satu contoh PBSI kabupaten Sumenep tiga tahun terakhir ini mengalami penurunan. Dimana pada tahun 2007 PBSI kabupaten  Sumenep sempat menjadi salah satu kabupaten yang ada di Madura yang sangat produktif menghasilkan pemain bulutangkis yang sangat berkualitas, namun pada saat ini kabupaten Sumenep mengalami penurunan kualiatas pemain, setiap perwakilan yang mengikuti kompetisi diluar daerah pasti mengalami kekalahan dibabak penyisihan.\nMelihat permasalahan yang diatas perlu ada test dan sebuah sistem pendukung keputusan agar dapat menghasilkan pemain dengan kualitas. Dengan mengunakan metode SMART sekiranya dapat membantu  menghasilkan atlit yang diinginkan  sesuai yang diharapkan.\nHasil dari penilaian seleksi menggunakan metode SMART menghasilkan nilai akurasi sebesar 80%, nilai akurasi di dapatkan dari hasil perbandingan antara data hasil perhitungan sistem dengan data rekomendasi dari pelatih.\n \n\nKata kunci : PBSI, Produltif, SMART, Sistem Pendukung Keputusan.\n', 'Mohammad Fauzan Alif', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100004');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(487, '120411100005', 'Perancangan Sistem Informasi Pengelolaan Anggaran Berbasis Web', 'Rika Yunitarini, S.T., M.T', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Proses pengelolaan anggaran di Dinas Komunikasi dan Informatika Kabupaten Sumenep meliputi proses DPA yang sudah disahkan, pembuatan NPD, pembuatan SPP, dan rekap laporan. Pengelolaan anggaran sangat diperlukan dalam mengelolah keuangan dari tiap kegiatan yang direncanakan. Rencana pengelolaan anggaran disusun berdasarkan kegiatan tahunan dengan rencana kegiatan jangka panjang. Masalah yang terjadi pada perhitungan data-data pengeluaran anggaran, dikarenakan tidak ada laporan yang otomatis dicetak, masih dihitung secara manual yang membutuhkan berkas-berkas data pengeluaran sebelumnya. Sistemnya masih manual sehingga hasil kinerjanya cukup lambat dan membutuhkan waktu yang cukup lama terutama dalam laporan pengelolaan anggaran. Dengan menggunakan sistem informasi pengelolaan anggaran berbasis web mampu dan membantu segala kegiatan pembuatan laporan lebih mudah, cepat, efisien, dan tepat waktu dalam melaksanakannya. Untuk membantu pembuatan aplikasi ini dengan menggunakan Framework CodeIgniter versi 3.0.4. Framework CodeIgniter dapat diperoleh secara gratis dengan sistem model MVC (Model, View, Controller) yang dikembangkan aplikasi web berbasis PHP. Hasil dari penelitian perancangan sistem informasi pengelolaan anggaran  ini mampu membantu dan mempermudah pekerjaan para pegawai dalam pembuatan laporan pengelolaan anggaran, sehingga dapat memperoleh informasi yang lebih mudah, akurat, dan cepat.\n\nKata Kunci : Sistem Informasi, Laporan Pengelolaan Anggaran, Framework CodeIgniter.', 'Suharto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100005'),
(488, '120411100006', 'PEMODELAN SISTEM DINAMIK UNTUK MENINGKATKAN PRODUKTIVITAS GARAM DENGAN PENAMBAHAN SALURAN BARU', 'Sigit Susanto Putro', 'Achmad Jauhari', 'Sumenep merupakan salah satu sentra garam dengan luas lahan produktif sebesar 2767 Ha dan lahan potensial sebesar 1214 Ha. Kebutuhan garam nasional cenderung mengalami peningkatan seiring dengan meningkatnya pertambahan penduduk dan permintaan industri. Peningkatan kebutuhan garam tidak seimbang dengan potensi produksi garam yang ada. Solusi yang dapat digunakan adalah melalui pendekatan simulasi sistem dinamik. Metode tersebut sangat cocok untuk variabel yang selalu berubah.\n Berdasarkan hasil simulasi dari pemodelan sistem dinamik, produktivitas garam dapat meningkat sebesar  25%. Pada  pengembangan skenario, pada skenario pembuatan saluran baru kondisi optimistic produktivitas garam dalam bentuk rupiah dapat meningkat sebesar 21,94%, kondisi most likely dapat meningkat sebesar 21% dan pada kondisi pessimistic produktivitas garam dalam bentuk rupiah menurun menjadi 18,58%.', 'Nurul Aisyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100006'),
(489, '120411100007', 'PENERAPAN AUGMENTED REALITY PADA GAME EDUKASI 3D PENGENALAN GIGI', 'Ari Kusumaningsih, S.T., M.T.', 'Arik Kurniawati, S.Kom., M.T. ', 'Gigi merupakan salah satu organ tubuh yang sangat vital. Itu dikarenakan kesehatan gigi dapat berpengaruh terhadap kualitas hidup individu. Gigi sangat rentan terkena gangguan terutama pada masa remaja. Oleh karena itu sangat penting untuk mengenalkan kepada anak tentang tatacara merawat gigi sejak dini agar terhindar dari gangguan dimasa mendatang. Untuk mengatasi masalah tersebut, maka dibuatlah aplikasi game edukasi 3D yang mengenalkan tentang gigi serta tatacara perawatannya. Aplikasi ini menerapkan teknologi Augmented Reality dan dibuat menggunakan game engine Unity3D dengan tambahan library LeanTouch sebagai interaksi antara pengguna dengan objek Augmented Reality yang ditampilkan. Game edukasi ini berjalan di perangkat android. Dengan menggunakan teknologi Augmented Reality dan library LeanTouch menjadikan aplikasi lebih interaktif dan tentunya akan lebih menarik bagi penggunanya terutama anak-anak. Hal itu dibuktikan dengan hasil uji user experience dengan perhitungan skala likert mendapat total skor 570 dari 20 responden yang telah mencoba aplikasi ini. Dalam penelitian ini skala likert digunakan untuk mengukur sikap, pendapat, dan persepsi dari pengguna terhadap aplikasi. Dari total skor tersebut, dapat disimpulkan bahwa pengguna memahami materi yang disampaikan dalam aplikasi serta pengguna merasa sangat puas dengan adanya aplikasi ini dan respon yang sangat positif.', 'Julihaki', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100007'),
(490, '120411100008', 'Survey Online Berbasis Mobile Untuk Pengukuran Indek Kepuasan Kualitas Pelayanan Kesehatan Pada Puskesmas Sukodono', 'Moch.Kautsar Sophan,S.Kom.,M.MT.', 'Dr. Arif Muntasa,S.Si.,M.T.', 'Survey merupakan metode penelitian yang sering kali digunakan untuk mengevaluasi kinerja seseorang atau lembaga. Hasil dari survey digunakan untuk pembuatan rencana dan pengambilan keputusan. Seperti Puskesmas Sukodono di Kabupaten Sidoarjo selama ini menggunakan angket dalam mencari data mengenai indek kepuasan kualitas pelayanan kesehatan pada lembaganya. Proses menganalisis data angket memakan waktu yang cukup lama dan relatif sulit karena masih secara manual. Selain itu, teknik pengumpulan data melalui angket ini jangkauannya kurang luas dan memerlukan biaya yang mahal. Oleh karena itu, dibutuhkannya sebuah aplikasi yang bisa menampilkan informasi mengenai pengukuran indeks kepuasan dalam menentukan kualitas pelayanan kesehatan pada puskesmas sukodono. Dari sedikit permasalahan di atas maka penulis membuat sebuah aplikasi mobile survey online. Penelitian ini menggunakan bahasa pemrograman Apache Cordova di karenakan kemudahan dalam membangun, mengembangkan suatu aplikasi. Selain itu Apache Cordova hanya menggunakan HTML5, CSS3 dan Javascript. Dari hasil Eksperimen yang telah dilakukan dengan metode indek kepuasan masyarakat, dari uji skenario yang telah dilakukan dapat dihasilkan nilai IKM sebesar 77,39 dengan data uji 20 responden, maka dapat disimpulkan bahwa kinerja unit pelayanan terkreditasi BAIK. \n \nKata Kunci: Indeks Kepuasan Masyarakat, Survey Online, Apache Cordova ', 'Maharani Putri Suryani Mulya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100008'),
(491, '120411100009', 'Visualisasi Analisa Pembelajaran (Learning Analytics) pada E-Learning Mata Kuliah Sistem Informasi', 'Rika Yunitarini, S.T.,M.T', 'Andharini Dwi Cahyani,S.Kom.,M.Kom', 'E-Learning menjadi konsep pendidikan masa kini yang memanfaatkan teknologi jaringan komputer untuk melakukan pembelajaran, namun E-Learning di nilai kurang dalam menilai pola perilaku mahasiswa dalam melakukan pembelajaran karena E-Learning belum mampu memberikan fitur belajar yang sesuai dengan karakter mahasiswa dalam melakukan pembelajaran. Agar proses belajar mengajar pada sistem E-Learning mudah di evaluasi baik oleh dosen maupun mahasiswa, maka perlu adanya Visual Learning Analytics pada sistem tersebut. Visual Learning Analytics dilakukan untuk menganalisa pembelajaran dengan hasil akhir dalam bentuk pembelajaran yang berbasis gambar, grafik atau diagram. Sistem ini menggunakan E-Learning mata kuliah Sistem Informasi, sistem diolah dengan cara mengambil log dari E-Learning sebagai sumber untuk mencari pola perilaku pengguna, kemudian data dikelompokkan berdasarkan kriteria yang telah ditentukan. Hasil dari pengelompokan tersebut kemudian di visualisasikan dalam bentuk speedometer. Dengan diimplementasikan sistem ini dosen dapat dengan mudah dalam  mengamati,mengevaluasi dan menilai pola perilaku mahasiswa dalam melakukan pembelajaran serta mahasiswa dapat mengevaluasi pola perilaku dirinya sendiri dalam melakukan pembelajaran. Berdasarkan hasil uji coba yang diterapkan, sistem secara keseluruhan dinilai bisa diterapkan dengan baik oleh mahasiswa maupun dosen dengan nilai rata-rata 7,7 dari mahasiswa dan nilai rata-rata 8 dari dosen yang masuk dalam kategori baik.\nKata kunci : E-Learning, Visual Learning Analytics, Sistem Informasi', 'Elisa Riani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100009'),
(492, '120411100010', 'PENERAPAN FUZZY ANALYTHICAL HIERARCHY PROCESS (F-AHP)  PADA SISTEM PENDUKUNG KEPUTUSAN  PEMILIHAN RAKET  BADMINTON ', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Dalam pemilihan raket badminton pada umumnya terdapat banyak produsen raket yang menawarkan berbagai macam tipe raket dan juga kelebihan kekurangannya. Dan seseorang baik pelatih, atlet, maupun masyarakat umum juga sering mengalami kebingungan dalam pemilihan raket yang sesuai. Dalam pemilihan raket diperlukan data kriteria-kriteria daripada spesifikasi raket memiliki sub kriteria masing-masing. Sebagai penunjang terdapat 2 langkah penting dalam pemilihan raket, Langkah pertama yaitu proses  pengumpulan  data  spesifikasi  raket dengan kriteria sebagai berikut harga raket, fleksibilitas raket, bahan Frame, berat raket, ukuran grip raket, jenis raket, rengangan senar raket, dan warna raket. Langkah kedua proses perangkingan dengan cara mengalikan nilai bobot dari masing-masing kriteria dengan setiap sub kriteria sehingga dapat melakukan penyeleksian kecocokan raket dengan berdasarkan data kriteria yang telah ditentukan. Dalam hal ini, dengan menggunakan metode Fuzzy Analytical Hierarchy Process (F-AHP) memiliki fungsi untuk mencari bobot prioritas kepentingan dari seluruh kriteria dan sub kriteria yang telah ditentukan dan juga sebagai proses dalam perangkingan bobot kriteria pemilihan raket sehingga nanti akan didapatkan rekomendasi raket dari perhitungan yang tertinggi dan sesuai keinginan. Berdasarkan penelitian ini kesesuaian dengan uji coba sistem memiliki tingkat kesesuaian 85% dari 20 responden.\n\nKata Kunci : F-AHP, Sistem Pendukung Keputusan, Raket.', 'Mas Ahsan Sandya Firmansyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100010'),
(493, '120411100011', 'KLASIFIKASI FASE DIABETIC RETINOPATHY PADA FUNDUS MATA MENGGUNAKAN GRAY LEVEL RUN LENGTH MATRIX (GLRLM)', 'Dr. Indah Agustien S, S. Kom., M.Kom', 'Dr. Arif Muntasa, S. Si., M.T', 'Diabetes melitus merupakan suatu kondisi dimana tingginya kadar gula dalam darah yang melebihi kisaran normal. Salah satu penyakit hasil dari komplikasi diabetes melitus yaitu diabetic retinopathy. Penyakit ini dapat menyebabkan kerusakan pada retina mata dan beresiko buta secara permanen pada penderitanya. Mendeteksi penyakit ini bisa dilakukan dengan cara melihat informasi pada citra fundus mata. Maka dari itu diperlukan adanya penelitian klasifikasi fase diabetic retinopathy melalui citra fundus mata. Tugas Akhir ini menggunakan metode gray level run length matrix (GLRLM) sebagai metode ekstraksi fiturnya. Terdapat tiga langkah utama dalam proses klasifikasi dalam penelitian ini. Langkah pertama dengan mengubah citra asli menjadi grayscale, kemudian dilakukan masking overlay yaitu mengeliminasi blood vessel pada citra grayscale dengan hasil proses segmentasi. Langkah kedua adalah ekstraksi fitur dengan menggunakan metode GLRLM. Proses terakhir yaitu klasifikasi fase dengan menggunakan metode manhattan. Pengujian akan dilakukan terhadap database MESSIDOR (Methode to evaluate segmentation and indexing techniques in the field of retinal ophtamology) yang telah terklasifikasi. Berdasarkan hasil penelitian dan pengujian terhadap sistem, maka didapatkan tingkat akurasi tertinggi sebesar 66,67%.\n\nKata kunci: Diabetic Retinopathy, gray level run length matrix, blood vessel, masking overlay, manhattan, MESSIDOR.', 'Abdul Hakim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100011'),
(494, '120411100012', 'Sistem Pendukung Keputusan Penentuan Pegawai Berprestasi dengan Metode Weighted Product (WP) dan TOPSIS', 'Achmad Jauhari, S.T.,M.Kom', 'Rika Yunitarini, S.T.,M.T', 'Dalam proses penentuan pegawai berprestasi di Dinas Komunikasi dan Informatika Kabupaten Sumenep pada saat ini masih dilakukan dengan microsoft excel, sehingga sistem kinerjanya cukup lambat dan kesulitan dalam mengelola data. Terkadang juga menyebabkan terjadinya kesalahan dalam pengambilan keputusan. Untuk mengatasi sistem lama tersebut bisa dibuat sistem pendukung keputusan dimana metode penilaiannya harus objektif.\nPembuatan sistem ini harus memperhatikan kriteria-kriteria yang telah ditetapkan oleh Peraturan Kepala BKN Nomor 1 Tahun 2013 tentang Ketentuan Pelaksanaan Peraturan Pemerintah Nomor 46 Tahun 2011 tentang Penilaian Prestasi kerja PNS. Metodologi yang digunakan dalam proses sistem pendukung keputusan penentuan pegawai berprestasi yaitu metode Weighted Product dan Topsis.\nHasil dari pengujian menunjukkan bahwa penentuan pegawai berprestasi dengan kedua metode pengolahan data tersebut mempunyai tingkat akurasi 80% jika dibandingkan dengan perhitungan manual.', 'Yuli Ratna Sari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100012'),
(495, '120411100013', 'Penetapan harga jual produk dengan simulasi sistem dinamik untuk meningkatkan profitabilitas', 'Achmad Jauhari, S.T.,M.Kom.', 'Sigit Susanto Putro, S.Kom.,M.Kom.', 'Kebijakan penetapan harga jual sebuah produk pada suatu unit usaha merupakan strategi penting dalam proses penjualan yang harus diputuskan secara cepat dan tepat. Tidak terkecuali bagi PT. Dua Putri Kedaton yang  termasuk perusahaan yang cukup besar dalam bidangnya. Salah satu produk yang dihasilkan oleh perusahaan ini adalah aspal hotmix Saat ini penetapan harga aspal hotmix per tonase hingga pemasangannya ditetapkan secara acak dan berpatokan pada harga pasar. Oleh sebab itu, penjualan dan keuntungan yang dihasilkan juga masih belum maksimal. Untuk mengatasi permasalahan  penetapan harga tersebut, perlu di analisis strategi penetapan harga yang tepat.  Sehingga dapat menggambarkan sistem atau keadaan pasar yang nyata. Solusi yang dapat digunakan adalah melalui pendekatan simulasi sistem dinamik. Metode tersebut sangat cocok untuk kasus variabel yang selalu berubah. Sedangkan software yang dapat digunakan adalah aplikasi Vensim. Berdasarkan hasil simulasi, penetapan harga melalui simulasi dapat meningkatkan profit sebesar 11,10 %. Untuk meningkatkan profit, bisa dikembangkan skenario efisiensi biaya. Dimana, pada kondisi optimis skenario ini bisa meningkatkan profit sebesar 7,26 %.  Skenario harga bbm juga bisa dilakukan untuk meramalkan harga pada saat terjadi kenaikan atau penurunan harga BBM.', 'Indrit Cikita Dwi Putri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100013'),
(496, '120411100015', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PEMAIN BOLA VOLI MENGGUNAKAN METODE SMART', 'Sigit Susanto Putro, S.Kom., M.Kom ', 'Achmad Jauhari, S.T., M.Kom', 'Peningkatan Pembinaan permainan bola voli terutama ditingkat daerah sangat diperlukan untuk menghasilkan skor tertinggi. Dalam usaha mencapai prestasi yang baik dalam olahraga permainan bola voli,  Pemilihan pemain secara manual  akan memakan waktu yang cukup lama dan kemungkinan besar akan terjadi kesalahan dalam penilaian bisa berdampak buruk terhadap sebuah tim. Di dalam tim bola voli terdapat seorang pelatih yang memilih pemain bola voli terbaik untuk sebuah tim. Tugas ini yang membuat pelatih bola voli Klub Mutiara Kabupaten Sampang kesulitan memilih pemain bola voli junior (12-14 tahun). Berdasarkan permasalahan tersebut, perlu ada tes dan sebuah sistem pendukung keputusan agar pelatih dapat dengan mudah mendapatkan pemain yang berbakat dan tepat untuk olahraga bola voli. Dengan Sistem Pendukung Keputusan metode SMART dapat menghasil terkait pemilihan pemain bola voli.Berdasarkan penelitian yang telah dilakukan, sistem ini memudahkan bagi pelatih untuk melakukan tes kepada calon pemain voli .Hasil akhir dari pengujian menggunakan system ini telah terpilih 10 pemain yang sesuai standar yang berlaku. Penggunaan metode smart ini memiliki akurasi kesamaan mencapai 70% dengan pemilihan pemain bola voli secara manual. \n\nKeyword : Pemilihan Pemain Bola Voli Junior (12 – 14 Tahun),  Simple Multi Attribute Rating Technique (SMART), Sistem Pendukung Keputusan.\n', 'Abdul Ainur Rofik', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100015'),
(497, '120411100016', 'PEMODELAN SISTEM DINAMIK UNTUK MEMPREDIKSI TINGKAT KEHILANGAN AIR', 'ACHMAD JAUHARI, S.T.,M.Kom', 'SIGIT SUSANTO PUTRO, S.KOM., M.KOM.', 'Tingkat kehilangan air yang terjadi di PDAM pamekasan kecamatan pademawu tiap tahunya semakin meningkat. Minimnya sumber air sebagai bahan baku dan banyaknya kehilangan air sehinggan distribusi air semakin berkurang menjadi pemasalah yang terjadi di PDAM pamekasan kecamatan pademawu. Kehilangan air dapat disebabkan oleh factor fisik dan non fisik /komersial. Kehilangan air secara fisik diakibatkan oleh factor-faktor teknis pada perpipaan. Sedangkan kehilangan air non fisi/komersial disebabkan oleh factor-faktor non teknis seperti kesalahan penanganan data dan kesalahan pembacaan meteran. Untuk memprediksi tingkat kehilangan air (water losses) PDAM pamekasan di kecamatan pademawu maka dilakukanlah analisis pemodelan sistem dinamik untuk memprediksi tingkat kehilangan air. Berdarkan uji coba beberapa skenario, skenario penggantian diameter dapat menekan kehilangan air fisik sebesar 51 % perbulanya. skenario pengurangan debit aliran pada pipa sebesar 3 % dan skenario penggabungan antara skenario 1 dan 2 dapat menekan sampai 57 %. Hasil pemodelan ini dapat dijadikan acuan untuk melakukan kebijakan bagi pihak PDAM.   ', 'NURIYAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100016'),
(498, '120411100018', 'Penerapan Metode Ekstraksi Ciri Color Moments dan Color Co-occurrence Matrix', 'Dr. Arif Muntasa, S.Si., M.T. ', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom.', 'Proses pencarian informasi gambar berdasarkan text tidaklah effisien. Untuk mengefisienkan pencarian gambar dapat menggunakan query gambar (Content Based Image). Penelitian ini menggunakan dua metode ekstrasi ciri warna yaitu metode color moments dan color co-occurrence matrix. Sedangkan untuk perhitungan kemiripan query gambar dengan gambar di database menggunakan Euclidean Distance. Diukur tingkat akurasi menggunakan Precission dan Recall.  Dataset yang digunakan pada penelitian ini yaitu dataset Wang dengan jumlah 1000 citra. Dataset tersebut dibagi menjadi 2 bagian yaitu 30% (300 citra)  sebagai data testing dan 70% (700 citra) sebagai data training. Pada penelitian ini dilakukan 3 kali skenario uji coba, yaitu hanya dengan Color Moments, Color Co-occurrence Matrix  dan penggabungan antara Color Moments dan Color Co-occurrence Matrix. Pada penelitian ini di dapatkan nilai akurasi tertinggi adalah dengan penggabungan ekstraksi ciri dengan menggunakan Color Moments dan Color Co-occurrence Matrix mendapatkan nilai Precision sebesar 48% dan nilai Recall sebesar 21%.\nKata Kunci : Content Based Image Retrieval&#40;CBIR&#41;, Color Moments, Color Co-occurrence Matrix(CCM), Euclidean Distance, Precision, Recall.\n', 'Ibnu Taufiq', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100018'),
(499, '120411100020', 'RANCANG BANGUN APLIKASI PANDUAN TINGKAT PENCAPAIAN PERKEMBANGAN ANAK USIA 4-5 TAHUN PADA PERANGKAT BERGERAK', 'Yonathan Ferry Hendrawan, ST,.MIT ', 'Rika Yunitarini ST,.M.T.', 'Pada saat ini perkembangan teknologi berkembang sangat cepat. Salah satunya teknologi informasi pada dunia pendidikan. Terdapat banyak aplikasi yang beragam dibangun pada perangkat bergerak. Namun, untuk aplikasi panduan tingkat pencapaian perkembangan anak usia 4-5 tahun masih belum tersedia. \nBSNP adalah sebuah badan mandiri dan indepeden yang bertugas untuk mengembangkan, memantau pelakasanaan dan mengevaluasi standar nasional pendidikan. Pencapaian tingkat perkembangan anak usia 4-5 tahun merupakan salah satu kegiatan yang memiliki standard dan ditentukan oleh Badan Standar Nasional Pendidikan (BSNP). Acuan ini berfungsi untuk mengetahui tingkat pencapaian perkembangan dan pertumbuhan anak usia 4-5 tahun. Sejauh ini perkembangan anak hanya dapat diketahui di lingkungan PAUD (Pendidikan Anak Usia Dini) yang terdaftar. Padahal keluarga merupakan salah satu tempat pembinaan pertama anak. Aplikasi pada perangkat bergerak dapat menjadi media yang efektif dan efisien dalam mengawasi perkembangan anak.  Aplikasi panduan pencapaian perkembangan anak usia 4-5 tahun dibangun pada Mobile  Android. Bahasa pemrograman yang digunakan adalah Python dan Kivy. Dari hasil survei kuisioner, dapat diketahui presentase aplikasi sebesar 2,14% responden tidak baik, 45,71% responden cukup baik, 85% responden merasa baik, 18,57% responden sangat baik menggunakan aplikasi panduan perkembangan anak usia 4-5 tahun. Jadi, aplikasi yang sudah dibangun dirasa penting dan dapat digunakan dengan baik oleh masyarakat dalam pengawasan perkembangan anak dan mengevaluasi tingkatan kemampuan perkembangan anak. KATA KUNCI : anak, BSNP, Android, Python, Kivy.', 'Tri Utami', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100020'),
(500, '120411100023', 'RANCANG BANGUN APLIKASI PEMESANAN MAKANAN DENGAN FITUR CHAT MENGGUNAKAN PLATFORM ANDROID DAN WEB SERVICE', 'Cucun Very Angkoso, ST., MT', 'Yoga Dwitya Pramudita, S.Kom. M.Sc', 'Kemajuan teknologi tidak sebanding dengan kebutuhan pelayanan masyarakat yang semakin meningkat, misalnya pelayanan pemesanan makanan.  Hal ini dikarenakan masyarakat belum mampu mengoptimalkan teknologi yang ada. Selama ini pemesanan makanan dan minuman masih menggunakan cara manual yaitu dengan antri menggunakan nomor atau menggunakan kertas untuk memesan.  Kurangnya pelayanan yang baik di suatu restoran membuat pelanggan merasa bosan, apalagi pelanggan harus menulis pesanan makanan dan minuman sendiri dikertas. Permasalahan tersebut dapat diatasi dengan menerapkan aplikasi pemesanan menggunakan fitur chat disebuah restoran,  sehingga pelanggan akan dimudahkan dalam memesan makanan dan minuman. Chat merupakan alat komunikasi dengan media elektronik yang menggunakan internet dimana pesan  dikirim dengan sangat cepat. \nDari data hasil uji coba, penelitian aplikasi ini menggunakan platform android. Pengujian menggunakan kuisioner menunjukkan user pelanggan dan pelayan merasa puas karena hasil presentase menunjukkan di atas 70% dengan alasan karena sistem dapat membantu pelayanan pemesanan, dapat membantu dalam memonitoring pelanggan, membantu dalam melakukan perekapan penghasilan, dan meminimalisir penggunaan kertas serta membantu komunikasi antar pelayan dengan pelanggan dalam pemesanan makanan dengan menggunakan fitur chat.\n\nKata kunci : aplikasi chat, pelayanan, restoran, android.\n', 'Achmad Dany Romadhon', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100023'),
(501, '120411100024', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN SISWA KELAS UNGGULAN MENGGUNAKAN \nMETODE SAW DAN TOPSIS ', 'Rika Yunitarini S.T., M.T', 'Achmad Jauhari. S.T.,M.Kom', 'Sistem Pendukung Keputusan dalam dunia pendidikan dapat membantu  pihak sekolah  dalam \nmenentukan kelas unggulan. Di sekolah menengah saat ini sebagian besar masih menggunakan cara manual \nuntuk menentukan siswa kelas unggulan,yakni dengan memilih siswa unggulan hanya dengan \npertimbangan nilai akhir semester saja, dan pada penelitian ini menggunakan beberapa kriteria sebagai \nbahan pertimbangan untuk masuk kelas unggulan. Penelitian ini akan menggunakan dua metode dalam \nSPK yaitu, metode SAW dan Metode TOPSIS. Dalam studi kasus penentuan siswa kelas unggulan pada \nSMP Negeri 1 Malo, Kedua metode ini digunakan karena konsepnya sederhana, mudah dipahami, \nkomputasinya efisien. Hasil akhir yang diperoleh dari penelitian ini adalah menentukan alternat if terbaik \ndari sejumlah alternatif, yakni calon siswa yang layak masuk kelas unggulan berdasarkan kriteria -kriteria \nyang telah ditentukan.  \nDari penelitian yang telah dilakukan dengan metode  Simple Additive Weight dan TOPSIS, diketahui \nnilai akurasi data sebesar 61%.  \nKata Kunci: Sistem Pendukung Keputusan, Kelas Unggulan, SAW, TOPSIS ', 'Siti Sundari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100024'),
(502, '120411100025', 'PENERAPAN E-LEARNING BERBASIS LEARNING TECHNOLOGY SYSTEM ARCHITECTURE (LTSA)\n(Studi Kasus : Mata Kuliah Basis Data 2)\n', 'Rika Yunitarini, ST., MT.', 'Andharini Dwi C, S.Kom., M.Kom', 'Pada penelitian ini dirancang sebuah sistem pembelajaran digital E-learning (electronic-learning), yang merupakan metode pembelajaran dengan memanfaatkan teknologi berbasis komputer. Metode pembelajaran ini bertujuan sebagai media alternatif dalam menunjang proses belajar peserta didik, khususnya pada mata kuliah Basis Data 2 teknik informatika Universitas Trunojoyo Madura yang saat ini masih menggunakan metode belajar secara konvensional, dimana proses pembelajaran yang masih mengharuskan pengajar dan peserta didik bertemu secara langsung di dalam kelas. Sistem E-learning ini dibangun menggunakan standar Learning Technology System Architecture (LTSA), yaitu sebuah standar sistem pembelajaran internasional yang dikembangkan berdasarkan IEEE 1884. Selain itu sistem ini juga dibangun menggunakan framework PHP berbasis MVC (Model-View-Controller) sehingga membuat sistem lebih terstruktur. Penelitian ini ditekankan pada penyampaian materi kepada peserta didik,  log aktivitas user, dan log materi. Dengan model pembelajaran seperti ini peserta didik dapat membangun pemahaman dan menuntun pola pikir dalam belajar mandiri, sehingga hasil yang diharapkan dari pembelajaran dapat tercapai dengan baik. Dari hasil kuisioner yang telah dibagikan kepada mahasiswa pengguna aplikasi, menunjukkan bahwa sistem E-learning berbasis Learning Technology System Architecture (LTSA) secara keseluruhan adalah baik, dengan nilai rata-rata 7,99.\n\nKata Kunci : E-Learning, MVC,  Learning Technology System Architecture.', 'Lulus Kharisma', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100025'),
(503, '120411100026', 'Sistem Rekomendasi Pengaturan Pola Makan Penderita Diabetes Mellitus Menggunakan Metode K-mean Clustering', 'Rika Yunitarini, S.T,. M.T', 'Achmad Jauhari, S.T., M.Kom', 'Diabetes Mellitus (DM) atau yang umum dikenal dengan Kencing manis adalah penyakit yang ditandai dengan peningkatan kadar gula yang terus-menerus dan bervariasi, terutama setelah makan.Sehingga penderita diabetes sangat dianjurkan untuk mengatur pola makan sesuai banyaknya kalori yang dibutuhkan oleh tubuh penderita diabetes tersebut sebagai cara untuk menjaga kestabilan gula darah. \nUntuk membantu masyarakat dalam memilih makanan penderita diabetes maka dibutuhkan suatu sistem yang mudah diakses oleh masyarakat dan yang mampu memberikan rekomendasi makanan tersebut kepada masyarakat. Dalamsisteminimenggunakanmetode K-Mean Clustering. K-mean Clustering adalah Proses pembentukan kelompok data yang tidak diketahui kelompok-kelompoknya. Hasil yang akan dimunculkan adalah rekomendasi takaran makanan untuk penderita penyakit diabetes sesuai kalori yang dibutuhkan.\nDari penelitian yang telah dilakukan dengan metode k-mean clustering ini, diketahuinilaiakurasi data sebesar 63%.\nKata kunci: Sistem Pendukung Keputusan, Diabetes Mellitus, K-mean Clustering\n', 'Sukma Herli Kristianti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100026'),
(504, '120411100027', 'PNERAPAN METODE RECURSIVE DIVISION DAN METODE DEPTH FIRST SEARCH DALAM PEMBUATAN GAME HELP SAKERA OUT PADA PERANGKAT BERGERAK', 'Yonathan Ferry H, S.T.,MIT', 'Cucun Very Angkoso., S.T.,MT', 'Dalam pembuatan sebuah game terdapat dua cara yang bisa dilakukan. Cara yang pertama adalah dengan cara dinamis, sedangkan cara yang kedua adalah cara statis. Cara dinamis memiliki kelebihan dibandingkan dengan cara yang statis yaitu konten yang ada pada game tidak mudah dihafalkan oleh pemain. Konten tersebut dapat berupa dunia pada game, jalan cerita, aktor, musuh, peluru, serta, aspek lainnya. Cara yang statis memiliki kelemahan yaitu segala aspek yang ada pada game tidak akan pernah mengalami perubahan sehingga pemain dapat dengan mudah memenangkan permainan dengan menghafalkan aspek yang ada pada game. Salah satu cara untuk membuat sebuah game yang dinamis adalah dengan menerapkan metode Recursive Division dan metode Depth First Search(DFS). Metode Recursive Division adalah metode untuk membangun sebuah maze. Sedangkan metode Depth First Search adalah metode untuk mencari jalan keluar pada maze. Pada penelitian ini, kedua metode tersebut diterapkan pada pembuatan game yang berjudul Help Sakera Out. Game ini berjalan pada perangkat bergerak Android.   Hasil penelitian menunjukkan bahwa kecepatan terbaik metode Recursive Division adalah 0.00001 detik pada perangkat bergerak Android sedangkan kecepatan terburuknya adalah 0.008 detik. Kecepatan terbaik dan terburuk metode Recursive Division dipengaruhi oleh jumlah memori yang digunakan untuk menampung jumlah dinding yang disesuaikan berdasarkan ukuran maze yang dibangun.\n\nKata kunci : Metode Recursive Division, Metode Depth First Search, Maze, Android', 'Moh. Supandi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100027'),
(505, '120411100028', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN PESERTA SERTIFIKASI GURU SEKOLAH DASAR MENGGUNAKAN METODE FAHP \n(STUDI KASUS: UPT PENDIDIKAN KECAMATAN KOTA SUMENEP)\n', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Achmad Jauhari, S.T., M.Kom', 'Sertifikasi guru merupakan salah satu program kerja dari Kementerian Pendidikan Kebudayaan (Kemdikbud) Republik Indonesia yang bertujuan untuk memberikan sertifikat pendidik kepada guru yang dianggap layak. Program ini telah dilaksanakan di seluruh wilayah Indonesia dan salah satunya di lingkungan Dinas Pendidikan Kabupaten Sumenep. Agar bisa menjadi peserta Sertifikasi, seorang guru harus melengkapi persyaratan untuk kemudian diverifikasi. Proses verifikasi ini membutuhkan sumber daya yang tidak sedikit. Untuk menekan kebutuhan sumber daya ini dibutuhkan sebuah sistem terkomputerisasi yang dapat membantu pihak terkait dalam menentukan peserta Sertifikasi Guru. \nDi lingkungan Dinas Pendidikan Kabupaten Sumenep tersedia sistem dari Kemdikbud untuk menentukan peserta Sertifikasi Guru yang hanya dapat diakses secara online dan masih banyak  kekurangannya. Untuk memecahkan masalah tersebut peneliti telah merancang SPK (Sistem Pendukung Keputusan) yang diintegerasikan dengan metode FAHP (Fuzzy Analytical Hierarchy Process). Berdasarkan hasil penelitian, diketahui bahwa penerapan SPK yang diintergerasikan dengan metode FAHP ini telah sangat membantu pihak terkait dalam menentukan peserta Sertifikasi Guru. Penerapan metode FAHP juga menunjukkan hasil yang baik. Hal ini dibuktikan dengan hasil uji akurasi yang mencapai 97% persen untuk periode pertama dan 99% di periode kedua penentuan peserta Sertifikasi Guru di tahun 2016.', 'Nur Muhammad Afif Syahbabandi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100028'),
(506, '120411100029', 'KLASIFIKASI DIABETIC RETINOPATHY PADA CITRA RETINA MENGGUNAKAN PRINCIPAL COMPONENT ANALYSIS (PCA)', 'Dr. Arif Muntasa, S.Si., M.T', 'Dr. Indah Agustien S, S.Kom., M.Kom', 'Mata adalah  alat indera dengan berbagai fungsi yang rentan terhadap penyakit. diabetik retinopathy merupakan salah satu penyakit pada mata yang  diakibatkan oleh diabetes mellitus. Resiko penderita akan terus bertambah seiring lamanya mengidap penyakit ini, bahkan mampu mengakibatkan kebutaan. Untuk mengantisipasi kerusakan yang lebih parah, perlu adanya sistem yang mampu mendeteksi fase diabetic retinopathy (DR)  secara dini. Sistem yang dibangun pada penelitian ini  merupakan sistem yang dapat digunakan untuk mendeteksi fase diabetic retinopathy dengan menggunakan metode Principal Component Analysis (PCA) dan metode klasifikasi K-Nearest Neighbor (KNN). Sistem ini dapat menggolongkan citra retina kedalam empat fase DR yaitu, normal, Poliferative Diabetic Retinopathy (PDR), non- Poliferative Diabetic Retinopathy (NPDR) dan Macular Edema (ME). Pengujian dilakukan terhadap citra retina pada database Methode to evaluate segmentation and indexing techniques in the field of retinal ophtamology (MESSIDORE) yang sudah terklasifikasi sesuai tingkatan fasenya. Dari hasil analisis dan pengujian yang dilakukan pada sistem, didapatkan tingkat akurasi tertinggi adalah 85%.\n\nKata kunci : Diabetic Retinopathy, Principal Component Analysis,  K- Nearest Neighbhor, MESSIDORE.\n', 'Suci Darma Wati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100029'),
(507, '120411100030', 'Sistem Pendukung Keputusan Kelayakan Pemberian Kredit Nasabah Dengan Metode Algoritma C4.5', 'Achmad Jauhari, S.T., M.Kom', 'Rika Yunitarini, S.T., M.T', 'Dalam pemberian pinjaman kepada nasabah, banyak faktor yang dipertimbangkan dalam pengambilan keputusan kelayakan nasabah. Terdapat 5 faktor yang menjadi pertimbangan dalam analisa pemberian kredit dikenal dengan istilah 5C yaitu character, capacity, capital, collateral, dan condition of economy. Faktor tersebut yang akan menjadi kriteria sistem pendukung keputusan dalam menentukan penilaian kelayakan kredit. Dalam penyeleksian penentuan penerimaan kelayakan nasabah dibutuhkan suatu sistem pendukung keputusan. Sistem pendukung keputusan merupakan suatu sistem yang menghasilkan alternatif keputusan yang digunakan sebagai alat bantu pengambilan keputusan dalam memberikan alternatif terima atau tidaknya pengajuan kredit oleh pemohon kredit. Harapan dari penelitian ini adalah dapat merancang, serta mengaplikasikan sistem pendukung keputusan mampu memberikan keputusan kelayakan kredit kepada calon nasabah. Metode yang digunakan dalam sistem pendukung  keputusan ini yaitu metode ALGORITMA C4.5 merupakan algoritma pohon keputusan yang sering digunakan untuk membuat suatu pohon keputusan karena memiliki tingkat akurasi yang tinggi dalam menentukan keputusan.\nHasil dari pengujian sistem menggunakan Algoritma C4.5 mencapai tingkat akurasi 88.89% untuk jumlah data latih 51 dan data uji 49 sedangakan untuk data latih 72 dan data uji 28 mencapai tingkat akurasi sebesar 92.59%. \n\n     Kata Kunci : Kredit , sistem pendukung keputusan (SPK), ALGORITMA C4.5 \n', 'Karimatus Sa\'diyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100030'),
(508, '120411100032', 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI PEMILIHAN MUSAHIL ASRAMA DENGAN METODE ENTROPY DAN TOPSIS (STUDI KASUS : ASRAMA UNIVERSITAS TRUNOJOYO MADURA) ', 'Rika Yunitarini, S.T., M.T', 'Achmad Jauhari, S.T., M.Kom', 'Asrama Universitas Trunojoyo Madura (UTM) merupakan salah satu tempat tinggal mahasiswa dengan fasilitas yang lengkap, biaya murah, dan keamanan yang terjamin oleh kampus. Adanya peningkatan pendaftar penghuni asrama setiap tahun, perlu adanya musahil untuk setiap kamar asrama agar menjadi pendamping bagi penghuni asrama dalam jadwal kegiatan sehari-hari dan memantau untuk selalu tertib dan mentaati peraturan serta menjaga etika selama menjadi penghuni asrama. Proses seleksi musahil saat ini masih dilakukan dengan menggunakan software microsoft excel. Untuk mengatasi sistem lama tersebut bisa dibuat sistem rekomendasi pemilihan musahil sesuai dengan kriteria diantaranya keaktifan, mengaji, wawancara, ipk, semester untuk non-fakultas ilmu keislaman (FIK), dan bahasa arab  untuk kriteria tambahan pada fakultas ilmu keislaman (FIK). Metodologi yang digunakan dalam proses sistem pendukung keputusan rekomendasi pemilihan yaitu menggunakan metode Entropy dan Topsis. Hasil dari penerapan metode ini adalah Fakultas Ilmu Keislaman sebanyak 25 puteri sebesar 75% dan 9 putera sebesar 80%. Sedangkan dari Non-Fakultas Ilmu Kesilaman sebanyak 31 putera sebesar 80% dan 54 puteri sebesar 83%.   \n\nKata Kunci : Musahil, Sistem Pendukung Keputusan, Entropy, Topsis   ', 'Try Hastutik', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100032'),
(509, '120411100033', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN SISWA KELAS UNGGULAN MENGGUNAKAN METODE ENTROPY DAN ELIMINATION ET CHOIX TRADUISANT LA REALITE II (ELECTRE II)', 'Rika Yunitarini, S.T.,M.T.', 'Achmad Jauhari, ST.,M.kom.', 'Kelas unggulan merupakan kelas yang berisi siswa pilihan yang dipilih berdasarkan syarat-syarat yang ketat yaitu IQ, potensi akademik, dan prestasi akademik. Di sekolah menengah saat ini sebagian besar masih menggunakan cara manual untuk menentukan siswa kelas unggulan, yaitu dengan memilih siswa kelas unggulan hanya dengan pertimbangan nilai akhir semester, pada penelitian ini akan menggunakan beberapa kriteria sebagai bahan pertimbangan untuk masuk kelas unggulan. Penelitian ini akan menggunakan dua metode yaitu metode Entropy untuk proses pembobotan dan Metode Elimination and Choice Translation Reality II (Electre II) untuk perangkingan. Electre II merupakan metode pengambilan keputusan multikriteria berdasarkan pada konsep outranking dengan menggunakan perbandingan berpasangan dari alternatif-alternatif berdasarkan setiap kriteria yang sesuai.\nPada penggunaan sistem pendukung keputusan dengan metode Electre II ini, pengguna akan memberikan nilai rating kecocokan untuk setiap alternatif terhadap keempat kriteria yaitu nilai pengetahuan, nilai sikap, nilai ketrampilan dan nilai tes akademik. Hasil akhir yang ditampilkan adalah rekomendasi siswa kelas unggulan yang diurutkan sesuai nilai terbaik. Dari hasil eksperimen yang telah dilakukan dengan metode Entropy dan Electre II, dari uji skenario yang telah dilakukan dapat dihasilkan nilai akurasi sebesar 73% dengan data uji 30 data .\n\nKata kunci : Kelas Unggulan, Entropy dan Electre II\n', 'Arum Wisma Dari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100033'),
(510, '120411100034', 'SISTEM PENILAIAN MONITORING KOPERASI PADA DINAS KOPERASI DAN UKM KABUPATEN SAMPANG DENGAN MENGGUNAKAN METODE MAGIQ (MULTI ATTRIBUTE GLOBAL INFERENCE OF QUALITY)', 'RIKA YUNITARINI, S.T., M.T', 'MOCH.KAUTSAR SOPHAN, S.KOM., M.MT', 'Dari setiap koperasi ada penilaian dan dari hasil penilaian dapat dikategorikan menjadi beberapa kategori seperti koperasi sehat, cukup sehat, kurang sehat, tidak sehat bahkan sangat tidak sehat. Tujuan dari penilaian koperasi adalah memberikan penilaian prestasi kinerja dengan mengacu kepada tingkat kesehatan yang menunjukkan kinerja koperasi, memberikan motivasi kepada koperasi agar selalu meningkatkan kualitas kinerja. Namun penilaian tersebut masih dilakukan dengan menggunakan perhitungan di Ms Excel. Maka dari itu penulis membuat sistem yang dapat mempermudah dan lebih cepat Dinas Koperasi dan UKM Kabupaten Sampang untuk penilaian koperasi-koperasi baik perhitungan maupun penyimpanannya. Selain itu dengan dibuatnya sistem ini dapat membandingkan nilai yang telah dihitung dengan menggunakan Ms Excel dengan perhitungan yang menggunakan metode dan untuk memonitoring kinerja koperasi. \nBerdasarkan hasil uji coba sistem yang dilakukan dapat diketahui bahwa menggunakan metode MAGIQ untuk menilai koperasi sebagai monitoring, hasil akhirnya mempunyai kategori yang mendekati sesuai dengan kategori dari perhitungan dinas yaitu dari 51 data koperasi, sebanyak 41 data koperasi mempunyai kategori yang sesuai sehingga mempunyai akurasi sebesar 80.39%.\n\nKata Kunci : koperasi, penilaian, MAGIQ\n', 'YUDA CAHYA PRATIWI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100034'),
(511, '120411100035', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN RAKET BADMINTON MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)', 'SIGIT SUSANTO PUTRO, S.KOM, M.KOM', 'ACHMAD JAUHARI, S.T, M.KOM', 'Dalam pemilihan raket badminton terdapat berbagai macam spesifikasi raket. Oleh karena itu banyak masyarakat yang kesulitan dalam memilih raket badminton yang sesuai dengan kompetensi diri. Untuk menunjang permainan yang bagus, banyak faktor yang perlu diperhatikan, salah satunya adalah pemilihan raket yang sesuai kompetensi pemain. Disaat yang bersamaan banyak produsen raket yang menghadirkan raket yang berkualitas dengan berbagai macam spesifikasi. Oleh karena itu dibutuhkan pendukung keputusan untuk mendapatkan raket sesuai yang di inginkan. Lalu proses metode yang digunakan  untuk penyeleksian kecocokan raket berdasarkan data kriteria yang telah ditentukan user . Dengan begitu proses pemilihan raket akan lebih mudah dan akurat. Penelitian ini adalah untuk membantu proses pemilihan raket dengan metode SAW sehingga mendapatkan hasil rekomendasi yang akurat sesuai keinginan user serta memberikan informasi kepada user terutama pemula tentang spesifikasi raket yang  digunakan dalam pemilihan raket badminton. Kesimpulannya, metode SAW mampu memberikan rekomendasi raket badminton dengan akurasi 89%.\nKata Kunci : Pemilihan  Raket Badminton, Simple Additive Weighting, Sistem Pendukung Keputusan.\n', 'AMZEIN RAMADHAN FIRMANSYAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100035'),
(512, '120411100036', 'KLASIFIKASI PENYAKIT DIABETES RETINOPATI MENGGUNAKAN LINEAR DISC ANALYSIS (LDA) DENGAN METODE EUCLIDEAN DISTANCE', 'Dr. INDAH AGUSTIEN SIRAJUDDIN, S. Kom., M. Kom.', 'Dr. ARIF MUNTASA, S.Si., M.T. ', 'Diabetes Retinopatipenyakit yang terjadi pada mata menyebabkan penglihatan penderita terganggu, pada tingkat lanjut dapat menyebakan kebutaan pada penderita. Pemeriksaan secara medis dilakukan dengan kamera fundus dan menghasilkan citra fundus mata. Untuk mengetahui tingkatan Diabetes Retinopati dilakukan klasifikasi terhadap tingkat keparahan berdasarkan citra fundus. Penelitian ini menggunakan database MESSIDOR(Methods for Evaluating Segmentation and Indexing techniques Dedicated to Retinal Ophthalmology). Pada penelitian ini ada 3 tahapan utama, Tahap pertama menyiapkan citra inputan, inputan menggunakan citra asli yang dirubah jadi grayscale dan citra eliminasi pembuluh darah. Citra eliminasi pembuluh darah didapat dengan overlapping antara citra grayscale dan citra hasil segmentasi. Tahap kedua proses ekstraksi fitur Linear Discriminant Analysis (LDA) yang diawali dengan proses ekstraksi fitur Principal Component Analysis (PCA). Hasil ekstraksi fitur digunakan pada tahap ketiga yaitu proses pengukuran kemiripan dengan Euclidean Distance. Sistem dapat bekerja dengan tingkat akurasi maksimum 40,88% dengan fitur awal (76) dengan inputan citra grayscale dan dengan nilai fitur yang sama menggunakan fitur awal (76) didapat akurasi 40,25% inputan menggunakan eliminasi pembuluh darah.', 'TUTUT DEWI ANGGRAINI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100036'),
(513, '120411100037', 'IMPLEMENTASI AGENT-BASED DUNGEON GROWING  UNTUK PEMBUATAN PETA DAN GENETIC ALGORITHM UNTUK MENEMUKAN SOLUSI TERBAIK PADA GAME ROGUELIKE', 'Yonathan Ferry H., ST., M.IT.', 'Cucun Very Angkoso, ST., MT.', 'Game sekarang ini sudah tidak asing bagi kebanyakan orang dan  telah ada di banyak perangkat mulai dari komputer, console maupun Smartphone. Pada pembuatan game terdapat banyak proses yang dilakukan, salah satunya adalah desain level. Semua asset yang di pakai dalam pembuatan desain level dibuat oleh pengembang game dan semua itu statis, juga membutuhkan waktu dalam proses pembuatannya. Penelitian ini mengimplementasikan sebuah metode Procedural Content Generation (PCG) bernama Agent-based dungeon growing yang akan membuat layout peta dungeon secara dinamis untuk Game Roguelike. Metode agent-based dungeon growing dapat diterapkan pada pembuatan level dungeon dengan spesifikasi ruangan-ruangan terpisah yang dihubungkan dengan koridor. Hasil pengujian dari Behaviour atau perilaku yang diterapkan pada agent dapat menghasilkan level peta dungeon dengan kemungkinan menghasilkan ruangan terisolasi paling tinggi 30% dalam 10 kali percobaan dan jumlah ruangan terisolasi paling tinggi hanya 1 ruangan terisolasi dalam satu level dungeon. Nilai dari jumlah langkah agent yang digunakan mempengaruhi jumlah ruangan yang dibuat. Hasil pengujian game ini dapat berjalan dengan baik pada emulator dan perangkat android smartphone dengan rata-rata kecepatan  0,016262 detik pada perangkat android smartphone.', 'Tanzilal Rizky Mubaroka', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100037'),
(514, '120411100038', 'ANALISIS PERBANDINGAN METODE ENKRIPSI KOMBINASI AES-TURBO CODE TERHADAP TIGA VARIASI KUNCI AES', 'Dwi Kuswanto, S.Pd., M.T.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Komunikasi data merupakan suatu proses pengiriman suatu informasi dari dua titik atau lebih dengan menggunakan suatu kode biner. Di dalam komunikasi data terkadang tidaklah berjalan dengan lancar, adapun kendala dalam proses pengiriman suatu informasi diantara nya adalah pencurian data hingga rusaknya data Informasi terkena suatu noise yang ada di dalam proses tersebut. Oleh karena itu diperlukanlah suatu penerapan yang dapat memberikan keamanan informasi dan sekaligus terhindar dari rusaknya data akibat noise. Salah satu penerapan tersebut ialah dengan mengkombinasikan teknik kriptografi AES dengan dengan teknik forward error correction berupa Turbo code. Penelitian ini bertujuan untuk mengkombinasikan dua teknik tersebut dan menerapkan pada data teks serta menganalisa berdasarkan panjang kunci enkripsi yang dimiliki AES. Hasil analisa menunjukan bahwa dengan algoritma kombinasi kriptografi AES-turbo dapat bekerja optimal dengan presentase data kembali 100%  yaitu pada SNR 15 dB. Dalam pengujian avalance effect juga menunjukkan bahwa panjang kunci 256-bit lebih aman, hal ini dibuktikan dengan uji coba Avalanche Effect sebesar 24,77362 %. Namun dalam pengujian waktu eksekusi data, semakin panjang kunci semakin lama waktu yang dibutuhkan untuk enkripsi dan dekripsi. Dengan demikian untuk pemilihan 3 variasi kunci AES yang lebih efisiensi dan efektifitas yaitu dengan menggunakan kunci 128-bit.', 'Rendra Bayu Adi S.', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100038'),
(515, '120411100039', 'IMPLEMENTASI MODIFIED GRAMMATICAL EVOLUTION UNTUK PEMBUATAN\nLEVEL YANG DINAMIS PADA GAME PLATFORMER SUPER TUX\n', 'Yonathan Ferry H., S.T., M.IT.', 'Cucun Very A., S.T., M.T.', 'Game pada umumnya bervariasi dan memiliki karakteristik yang berbeda – beda. Jenis game yang sering\ndijumpai adalah game bertipe platformer. Level game platformer biasanya dibuat secara langsung dan\nstatis. Pembuatan level yang statis pada game platformer membuat pemain dengan mudah menghafal\ngame yang dimainkan dan pemain akan merasa cepat bosan. Game Super Tux merupakan contoh game\nplatformer yang content dalam level dibangun secara manual oleh programmer. Penelitian ini\nmengimplementasikan sebuah metode Procedural Content Generation (PCG) bernama Grammatical\nEvolution (GE) untuk menjadikan level game Super Tux dinamis. Game Super Tux berjalan pada\nperangkat bergerak Android. Hasil penelitian menunjukan bahwa GE mampu membuat level game\nsecara dinamis disesuaikan berdasarkan parameter yang diinputkan. Parameter tersebut berupa nilai\nfitness place (fp), probabilitas mutasi, µ, dan ?. Dengan menggunakan probabilitas mutasi sebesar 0.8f,\nµ dan ? bernilai 8, dan fp bernilai 10, level game Super Tux dapat terbentuk dengan baik dan variatif.\nPada beberapa contoh kasus dengan penggunaan parameter nilai fp 25 dan 50, tipe chunk yang dibangun\nlebih mengarah ke platform. Jika dibandingkan dengan crossover, hasil dari teknik ES µ + ? pada evolusi\nGE tidak ditemukan adanya level yang rusak.\n', 'Doffy Oktaviano Mutik', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100039'),
(516, '120411100040', 'Aplikasi Survey Online untuk Mendukung Masterplan IT', 'Moch.Kausar Sophan, S.Kom., M.MT.', 'Dr.Arif Muntasa, S.Si.,M.T.', 'Masterplan IT  merupakan panduan untuk membangun sistem dan teknologi informasi pada suatu organisasi yang sesuai dengan tujuan, visi, dan misi organisasi tersebut. Penelitian ini dilakukan di rumah sakit HVA Toeloengredjo yaitu sebuah rumah sakit yang pengelolaan administrasinya sudah menggunakan IT. Status rumah sakit HVA telah terakreditasi sehingga penerapan SIM RS telah menjadi salah satu strategi manajemen bisnis rumah sakitnya. Dari penggunaan IT tersebut perlu adanya dukungan implementasi dari dimensi masterplan IT yaitu meliputi hardware, software, infrastruktur, kualitas sumber daya manusia dan standar operasional prosedur yang diterapkan. Penelitian ini bertujuan untuk mengetahui tingkat implementasi IT pada dimensi masterplan IT RS HVA, oleh karena itu dibutuhkan langkah survey. Metode wawancara atau kertas kuesioner pada pelaksanaan survey dinilai kurang efektif, karena butuh waktu  lama dan biaya lebih mahal. Berdasarkan permasalahan tersebut maka penelitian ini dibangun aplikasi survey online untuk mendukung masterplan IT. Pada hasil pengolahan survey online yang dianalisis menggunakan skala likert dengan rentang skala 1 sampai 5, didapatkan 42 responden RS HVA menyatakan sebesar 84,30% kondisi masterplan IT sangat ideal yang didukung kondisi IT yang baik sebesar 73,40%, sehingga didapatkan hasil dari perbandingan kedua kondisi tersebut sebesar 87,07% tingkat implementasi IT RS HVA sangat baik.\n', 'Annisa Sukma Putri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100040');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(517, '120411100041', 'SISTEM PAKAR UNTUK DIAGNOSA PENYAKIT PULPA DENGAN METODE DEMPSTER\nSHAFER', 'Rika Yunitarini, ST., MT.', 'Achmad Jauhari, ST., M.Kom.', 'Penyakit gigi merupakan penyakit yang paling banyak dikeluhkan oleh masyarakat Indonesia. Penyakit gigi diawali dengan gigi berlubang yang apabila tidak ditangani secara serius akan menyebabkan timbulnya penyakit Pulpa yaitu salah satu bagian penting dalam rongga gigi. Penyakit pulpa bersifat agresif komulatif, artinya daerah yang rusak tidak dapat disembuhkan apabila tidak ditangani dengan cepat dan tepat. Sedangkan, penyakit gigi dan mulut merupakan penyakit keempat yang paling mahal biaya penyembuhannya. \nBerdasarkan data tentang tingginya penderita penyakit Pulpa serta rendahnya jumlah pasien yang mampu berobat ke dokter karena membutuhkan biaya yang mahal, maka dengan mengimplementasikan metode Dempster Shafer dibuatlah suatu alternatif sistem pakar yang dapat membantu penderita penyakit Pulpa agar dapat mengetahui diagnosa penyakitnya serta mengetahui cara perawatannya tanpa harus mengeluarkan biaya yang mahal. \nDari penelitian ini telah dihasilkan sistem pakar untuk mendiagnosa penyakit Pulpa dan setelah dilakukan uji coba 60 kasus data, diperoleh nilai akurasi sebesar 98,3%. \nKata Kunci : Pulpa, Sistem Pakar, Dempster Shafer', 'Irina Kurniawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100041'),
(518, '120411100043', 'SISTEM MONITORING MASTER PLAN TEKNOLOGI INFORMASI PEMERINTAH KOTA\nMOJOKERTO', 'Dr. Arif Muntasa, S.Si., M.T.', 'M. Kautsar Sophan, S.Kom., M.MT.', 'Untuk mendapatkan perencanaan strategis yang baik dibutuhkan evaluasi sebagai tolak ukur keberhasilan dari implementasi Master Plan Teknologi Informasi. Evaluasi biasanya dilakukan dengan melakukan survei secara langsung ke bagian terkait yang ingin diketahui perkembangannya. Hingga saat ini, sistem yang digunakan untuk pengumpulan data evaluasi Master Plan Teknologi Informasi di SKPD (Struktur Kerja Perangkat Daerah) Pemerintah Kota Mojokerto masih menggunakan sistem manual, yakni dengan melakukan survei ke beberapa instansi terkait. Pengumpulan dan pencatatan hasil survei dalam data yang terpisah dan belum terkomputerisasi secara baik, dan dibutuhkan waktu dan tenaga lebih dalam memproses data tersebut.<br />\nTelah dikembangkan sebuah sistem yang dapat melakukan manajemen data yang telah di dapatkan dari survei kepada instansi terkait. Dengan adanya sistem monitoring survei ini, proses survei monitoring per tahun dari perencanaan Master Plan Teknologi Informasi bisa dilakukan dengan lebih mudah, lebih cepat, dan pemerintah bisa memonitor dengan nilai rata-rata 8.12 dan predikat baik pada pengujian usability. Sehingga dapat dihasilkan output dari sistem berupa data rekap untuk diolah menjadi Master Plan Teknologi Informasi yang lebih tepat sasaran.<br />\nKata Kunci : Evaluasi, Sistem, Master Plan Teknologi Informasi, Kota Mojokerto.', 'Dirga Roslukito', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100043'),
(519, '120411100044', 'SISTEM REKOMENDASI PENDUKUNG KEPUTUSAN PEMILIHAN KEPALA SEKOLAH MENGGUNAKAN ALGORITMA C45. (STUDI KASUS: Dinas Pendidikan Kabupaten Madiun).', 'Rika Yunitarini, S.T., M.T.', 'Achmad Jauhari, S.T., M.Kom.', 'Kemajuan setiap sekolah menengah pertama/menengah atas tidak lepas dari pengaruh bagaimana kemampuan kepala sekolah dalam mengelola seluruh sumber daya yang ada pada sekolah tersebut. Oleh karena itu diperlukan sumber daya manusia yang berkualitas, dalam hal ini guru-guru yang memiliki potensi dan prestasi untuk menjadi kepala sekolah agar dapat mewujudkan pendidikan yang berkualitas.\nSaat ini proses seleksi pemilihan kepala sekolah masih dilakukan dengan menggunakan software microsoft excel. Pengambilan keputusan penentuan calon kepala sekolah pada Dinas Pendidikan Kabupaten Madiun merupakan hal yang relatif sulit karena terdapat berbagai kriteria yang mempengaruhi, yang diantaranya yaitu: Pendidikan terakhir, Usia, Lama Mengajar, Sertifikat Pendidikan, Wawancara dan Surat Sehat.  Tugas akhir ini bertujuan untuk membangun sistem pendukung keputusan yang mempunyai kemampuan analisa pemilihan kepala sekolah dengan menggunakan Algoritma C4.5, dimana algoritma C4.5 merupakan pohon keputusan yang memiliki tingkat akurasi yang tinggi dalam menentukan keputusan.\nDari penelitian yang telah dilakukan, diketahui nilai precision dari algoritma C4.5 dengan partisi data 7:3 menghasilkan nilai sebesar 100%. Nilai accuracy algoritma C4.5 partisi data 7:3 dengan nilai sebesar 80%.\n\nKata kunci : Algoritma C4.5, Pemilihan Kepala Sekolah, Sistem Pendukung Keputusan', 'Ristya Mega Pratiwi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100044'),
(520, '120411100045', 'KLASTERISASI GRAPH JEJARING SOSIAL MENGGUNAKAN METODE K – MEDOIDS', 'Mula’ab, S.Si., M. Kom.', 'Husni, S.Kom., M T.  ', 'Selain digunakan untuk berinteraksi dan menjalin pertemanan, jejaring sosial juga bisa digunakan untuk penelitian salah satunya klasterisasi. Klasterisasi merupakan salah satu teknik data mining yang digunakan untuk mendapatkan kelompok-kelompok dari data yang mempunyai kesamaan yang tinggi. Data jejaring sosial yang digunakan untuk klasterisasi berupa data Twitter. Data yang awalnya berbentuk graph  dikonversi ke bentuk matriks adjacency terlebih dahulu kemudian diubah ke bentuk matriks geodesic distance agar dimensi matriksnya  bisa direduksi  menggunakan Multidimensional  Scaling (MDS) selanjutnya akan diklasterisasi menggunakan metode K – Medoids. Metode K – Medoids adalah suatu metode klasterisasi data non hirarki yang berusaha mempartisi data yang ada ke dalam bentuk satu atau lebih cluster. Pada klasterisasi graph jejaring sosial menggunakan metode K – Medoids, suatu cluster bisa terbentuk jika jarak antara pusat cluster dengan vertex saling berdekatan. Hal ini dipengaruhi oleh adanya perhitungan cost (jarak) menggunakan Euclidean distance. Kualitas  klasterisasi menggunakan metode K – Medoids  dapat  diukur  menggunakan metode purity. Hasil dari penelitian ini menunjukkan nilai rata – rata purity 0.9625 serta tingkat akurasi penggunaan metode K-Medoids dalam klasterisasi graph twitter sebanyak 11 cluster sangat baik yaitu mencapai 96,3 % ', 'Annysa Firdaus', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100045'),
(521, '120411100046', 'SISTEM PENCARIAN TEKS TERJEMAHAN AYAT ALQURAN DAN PEMBENTUKAN REKOMENDASI MENGGUNAKAN COSINE SIMILARITY', 'Firdaus Solihin S.Kom., M.Kom.', 'Husni S.Kom., M.T.', 'Alquran merupakan pedoman umat islam dalam menyelesaikan berbagai persoalan, namun proses\npencarian yang berlangsung lama dan ayat disusun terpisah menimbulkan masyarakat kesulitan dalam\nmemahaminya. Upaya yang dilakukan yaitu pencarian secara digital dengan konsep IR (Information\nRetrieval). Pencarian ayat alquran secara digital telah mengalami perkembangan, tetapi masih memiliki\nkekurangan dari segi kecepatan dan akurasi ketepatan ayat yang dihasilkan. Akurasi ketepatan\ndipengaruhi oleh keyword dan nilai threshold. Oleh karena itu, pembangunan sistem pencarian pada\npenelitian ini menerapkan fasilitas pencarian yaitu operasi logika AND pada keyword, konsep cache dan\nnilai threshold untuk meningkatkan kecepatan dan akurasi hasil pencarian. Penelitian ini menggunakan\nmetode cosine similarity untuk menghitung kemiripan query dengan ayat dalam database. Pembentukan\nrekomendasi diperoleh dari perbandingan kemiripan antar ayat untuk mencari keterkaitan ayat.\nBerdasarkan hasil pengujian sistem, didapatkan nilai minimal cosine similarity paling baik adalah 0.1,\ndengan rata-rata presentase f-measure atau tingkat efisiensi kinerja sistem mencapai 98,4 %, nilai\nprecision sebesar 97,2 % dan nilai recallnya 100%. Penggunaan logika AND pada keyword menimbulkan\nakurasi ketepatan tinggi dan waktu cepat. Pembentukan rekomendasi dengan batasan nilai cosine diatas\n0.3. Pemrosesan dengan cache membutuhkan waktu relatif stabil dikisaran 0.026 sampai 0.027 detik.\n\nKata Kunci : Sistem Pencarian, Information Retrieval, Ayat Alquran, Cosine Similarity¸ Pembentukan\nRekomendasi.\n', 'Zahrotul Komariyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100046'),
(522, '120411100049', 'RANCANG BANGUN OPEN LEARNER MODEL (OLM) PADA SISTEM E-LEARNING', 'Rika Yunitarini, ST., MT.', 'Andharini Dwi C., S.Kom, M.Kom', 'E-learning merupakan media pembelajaran berbasis komputer yang mendukung proses belajar yang dilakukan didalam kelas. Penggunaan e-learning saat ini bertujuan untuk mengetahui tingkat kompetensi mahasiswa. Namun dibutuhkan waktu yang cukup lama dan pendekatan yang intensif untuk dapat mengetahui kompetensi yang dimiliki oleh mahasiswa. Permasalahan tersebut dapat diatasi dengan OLM (Open Learner Model) pada sistem E-Learning, dimana sistem tersebut dapat mevisualisasikan mahasiswa dari segi kompetensi dengan sumber yang berasal dari nilai otomatis sistem dan nilai refleksi dari mahasiswa. Nilai otomatis sistem meliputi soal latihan, qiuz, Ujian Tengah Semester (UTS), dan Ujian Akhir Semester (UAS). Setelah sumber data sudah ada maka Open Learner Model (OLM) akan memvisualisasikan kedalam berbagai macam bentuk. Pada penelitan ini menggunakan bentuk visualisasi berupa: Tree Map, Table, Smiley Faces, Word Cloud, Radar Plot, dan Network. Dengan adanya Open Learner Model (OLM) maka informasi tingkat kompetensi akan cepat diperoleh. Bagi mahasiswa diharapkan dapat mengetahui kompetensinya dalam pembelajaran setiap modul. \nBerdasarkan uji coba yang diterapkan, yakni penyebaran kuisioner, sistem ini dinilai mampu memberi kemudahan mahasiswa untuk merefleksi diri sendiri dengan hasil penilaian presentase 76% dan termasuk dalam kategori baik.\n\nKata Kunci: E-Learning, Open Learner Model (OLM), Refleksi', 'Imas Dwikatama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100049'),
(523, '120411100050', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PEMAIN FUTSAL MENGGUNAKAN METODE SMART\n(STUDI KASUS : SEKOLAH FUTSAL SANJAYA) \n', 'Sigit Susanto Putro, S.Kom., M.Kom', ' Aeri Rachmad, S.T., M.T', 'Banyak Sekolah Futsal  melakukan penyeleksian  untuk pemain muda yang  berlatih futsal di sekolah tersebut. Tapi, metode penyeleksian skill dan fisik yang masih konvensional membuat kurang optimalnyapembinaan ini. Salah satu masalah yang muncul adalah pemilihan  pemain yang akan di ikut sertakan kompetisi.Banyak laga yang memerlukan kondisi fisik dan kemampuan dari oemain tersebut tersebut. Maka pelatih harus jitu dalam melihat potensi pemain, sehingga sekolah tersebut dapat menjuarai laga Berdasarkan permasalahan diatas, perlu adanya sistem pendukung keputusan pemilihan pemain futsal.Berdasarkan hasil tes  pemain, sistem ini mendapatkan kemampuan dasar pemain Kemampuan dasar ini akan diproses menggunakan metode SMART untuk mendapatkan hasil  terbaik pemain Sisten ini memiliki akurasi kesamaan mencapai 31,25% dengan pilihan pelatih. Dengan sistem ini diharapkan akan memudahkan pelatih untuk menentukan pemain terbaiknya dan mengoptimalkan kemampuannya dengan baik.', 'adam rizky gumillang', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100050'),
(524, '120411100051', 'SISTEM PENILAIAN JAWABAN ESSAY OTOMATIS MENGGUNAKAN  METODE WINNOWING PADA PEMBELAJARAN TIK ', 'SIGIT SUSANTO PUTRO S.KOM., M.KOM.', 'RIKA YUNITARINI ST., MT.', 'Pada bentuk soal essay atau uraian memberikan kesulitan tersendiri dalam mengoreksi karena jawaban essay bervariasi tergantung pada tingkat pemahaman terhadap suatu materi. Penelitian ini membuat sistem penilaian jawaban essay otomatis pada soal TIK menggunakan algoritma winnowing dan membandingkan dari penelitian sebelumnya yang menggunakan algoritma winnowing. Proses yang membedakan antara penelitian sebelumnya dengan penelitian yang diterapkan yaitu   pada penelitian sebelumnya menggunakan metode winnowing dengan proses menghilangkan stopword removal dan proses stemming. Dari proses tersebut diduga waktu proses yang lebih lama sehingga  proses yang akan diterapkan pada penelitian ini yaitu menghilangkan kata stopword removal dan menghilangkan kata yang dianggap mengulang soal dengan batas yang sudah ditentukan. Perbedaan proses tersebut sebagai dasar pengujian untuk mengetahui proses yang baik dan waktu yang lebih cepat. Hasil dari pengujian sistem menggunakan algoritma winnowig dengan perbedaan proses tersebut dengan hasil pengujian yaitu rata-rata nilai kemiripan 56.67% pada penelitian sebelumnya, sedangkan dengan penambahan proses pada pre-processing data dan penghilangkan proses stemming rata-rata kemiripan 55.504%. Perbedaan proses tersebut dianggap mendapat nilai rata-rata kemiripan yang sama. Sedangkan perbandingan waktu rata-rata berdasarkan proses tanpa stemming didapatkan 0.0077/s sedangkan pada peneliti sebelumnya yang melibatkan proses stemming mendapatkan hasil waktu 0.08/s.   \n\nKata kunci: Pre-processing, Stopword Removal, Stemming, Winnowing.\n', 'YUNINDA MAULANA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100051'),
(525, '120411100052', 'SISTEM INFORMASI PENERAPAN CUSTOMER RELATIONSHIP MANAGEMENT(CRM) PADA USAHA KECIL MENENGAH (UKM) BATIK MADURA', 'Achmad Jauhari , S. T ., M.Kom', 'Iw an Santosa , S.T., M.T', 'Perusahaan  merupakan  tempat  terjadinya  kegiatan  produksi  dan  berkumpulnya  semua \nfaktor produksi. Saat ini hampir seluruh perusahaan tidak terkecuali perusahaan dengan skala \nkecil dan menengah menbutuhkan sistem yang dapat \nmengintegrasikan jalanya usaha dengan \nbaik,  cepat,  dan  mudah  untuk  di  jalankan\n.  Pada  proses  tranksaksi,  pencatatan,  dan  juga \ninformasi stok barang dilakukan secara manual\n, hal tersebut dapat menghambat banyak waktu \nserta  membuat  pelanggan  menunggu  lama,  me\nngakibatkan \nminat  pelanggan  untuk  membeli \nproduk  akan  berkurang.\nBerdasarkan  permasalahan  diatas,  perlu  adanya  sistem \ninformasi \npeneranan \nCustomer Relationship Management \n(CRM) pada \nUsaha Kecil Menengah\n(UKM)\n, \nsistem ini \nberbasis web yang dibuat dengan \nFramework\nCodeIgniter.\nBerdasarkan uji coba sistem dengan \nmemberikan kuisioner maka didapatkan hasil tingkat akurasi 90% untuk petugas gudang dan \n93% untuk Kasir. dengan adanya s\niste\nm\nini\nmemudahkan dalam proses transaksi, pencatatan, \ndan juga informasi ba\nrang yang tersedia didalam gudang. ', 'Ach. Setia Hidayatulloh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100052'),
(526, '120411100053', 'SISTEM PENDUKUNG KEPUTUSAN PEMBERIAN BEASISWA MENGGUNKAN METODE ELIMINATION ET CHOIX TRADUISANT LA REALITE II (ELECTRE II', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Achmad Jauhari, S.T., M.Kom ', 'Beasiswa adalah bantuan keuangan yang diberikan kepada siswa tidak mampu atau yang memiliki prestasi akademik. Dengan adanya beasiswa ini dapat membantu keberlangsungan pendidikan yang ditempuh siswa. Beasiswa juga memiliki arti lain sebagai sebuah penghargaan bagi setiap siswa. Dalam penentuan pemberian beasiswa, pihak sekolah dituntut untuk kolektif dalam proses pengambilan keputusan pemberian beasiswa.\nHarapan dari penelitian ini adalah dapat merancang, mengaplikasikan serta mengembangkan sistem pendukung keputusan yang mampu memberikan keputusan pemberian beasiswa kepada calon siswa penerima beasiswa. Penelitian ini menggunakan metode Electre II untuk membantu perhitungan perankingan dalam proses pengambilan keputusan pemberian beasiswa. Pada penggunaan sistem pendukung keputusan dengan metode Electre II ini terdapat beberapa kriteria untuk setiap alternatif yaitu penghasilan orang tua, jumlah tangunggan, nilai matematika, nilai bahasa indonesia, nilai bahasa inggris dan nilai biologi.\nDari hasil eksperimen yang telah dilakukan dengan metode Electre II, dari uji skenario yang telah dilakukan dapat dihasilkan nilai akurasi sebesar 80% dengan data uji 10 data.\n\nKata Kunci: Beasiswa, Sistem Pendukung Keputusan, Electre II.\n', 'Rizki Novita Sari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100053'),
(527, '120411100054', 'IMPLEMENTASI METODE MULTI-DIMENSIONAL SCALING DAN K-MEANS CLUSTERING UNTUK DETEKSI KOMUNITAS PADA DATA BERBASIS GRAF', 'Mula’ab, S.Si., M. Kom.', 'Husni, S.Kom., M.Kom.', 'Graf merupakan diagram yang terdiri dari node dan edge. Graf\ndapat terbentuk dari sebaran data yang saling berkaitan satu sama lain.\nHubungan antar node yang berdekatan membentuk suatu kelompok\nkecil yang disebut komunitas. Untuk mencari komunitas antar data dapat\ndigunakan beberapa pendekatan, salah satunya adalah Multi-dimensional\nScaling. Metode tersebut bertujuan untuk mencari hubungan antar data\nsecara sparsial. Hasil dari Multi-dimensional Scaling akan dilakukan\nproses K-means clustering untuk mendapatkan komunitas dengan\nmembandingkan jarak yang terdekat antar data. Kualitas dari hasil Kmeans\nclustering dapat dihitung menggunakan metode akurasi purity.\nBerdasarkan hasil uji coba aplikasi deteksi komunitas\nmenghasilkan 8 komunitas data dari 136 data (node). Jumlah komunitas\ndipengaruhi oleh hasil K-Means clustering. Nilai purity yang dihasilkan\ndari proses K- Means clustering sebesar 97%\n', 'ZUHROTUL ULA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100054'),
(528, '120411100055', 'PENERAPAN LEAP MOTION CONTROLLER PADA VIRTUAL REALITY ANATOMI ORGAN JANTUNG DAN PARU-PARU 3D', 'Ari Kusumaningsih, S.T., M.T.', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'ABSTRAK\n Pembelajaran  anatomi menggunakan metode bermacam-macam, mulai dari membedah mayat  hingga teknik pencitraan medis termasuk X-ray, USG dan pencitraan resonansi magnetik. Secara umum metode konvensional dalam mempelajari anatomi ialah membaca dan menghafal. Metode belajar terkini menggunakan teknologi multimedia dengan memanfaatkan objek 3D. Agar objek 3D dapat dieksplorasi secara interaktif maka digunakan sebuah sensor gerak. Salah satu sensor gerak yang ada ialah Leap motion controller. Objek organ 3D yang dapat dieksplorasi menggunakan gesture tangan User sebagai input, merupakan metode pembelajaran yang sederhana namun mendekati nyata. Hal ini merupakan nilai lebih dibanding  metode belajar konvensional dengan cara membaca dan menghafal. Pada penelitian ini menerapkan pembelajaran modern menggunakan objek 3D terintegrasi Leap motion controller dan ditampilkan dengan virtual reality yang dibangun menggunakan Unity3D. Pengembangan Leap Motion Controller dan Unity3D menghasilkan media belajar antomi jantung dan paru-paru pada manusia secara virtual yang interaktif. Dari hasil uji performa, fitur pointing kerberhasilannya 100%. Hasil pengujian User experience menunjukkan poin importance bernilai 88.23% , poin valence bernilai 94.11% , poin control bernilai  97.05% . Kesimpulannya, materi yang disajikan tersampaikan, aplikasi menyenangkan dan tidak membosankan serta User bisa mengendalikan aplikasi dengan leluasa.\n\nKata Kunci :. Leap Motion Controller, Anatomi, Organ, Virtual reality, Unity3D. \n', 'ghorapurla adi pradhana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100055'),
(529, '120411100056', 'Implementasi Algoritma Genetika dan Lindenmayer System untuk Pembuatan Tanaman Cabai pada Game Pemeliharaan Tanaman', 'Yonathan Ferry H., ST., M.IT.', 'Cucun Very Angkoso, ST., MT.', 'Game merupakan aplikasi yang digunakan sebagai media hiburan atau pembelajaran. Dalam membuat suatu permainan diperlukan Asset. Asset merupakan bahan yang dibutuhkan untuk membuat game seperti gambar dan suara. Dalam proses pembuatan game, Asset adalah salah satu hal yang cukup lama pembuatannya. Pada penelitian ini penulis akan membuat suatu game pemeliharaan tanaman. Tanaman yang ada dalam game tersebut akan dibentuk oleh sistem, sehingga tidak perlu lagi membentuk Asset gambar tanaman secara manual dan pola yang terbentuk juga dapat lebih dinamis. Metode yang digunakan adalah Algoritma Genetika dan Lindenmayer System. Kombinasi dua Metode ini digunakan untuk mendapatkan sebuah tanaman yang proporsional. Game pemeliharaan tanaman ini dibuat menggunakan Unity dan berjalan pada platform Android. Penelitian ini menghasilkan game yang bisa mengimplementasikan L-System dan Algoritma genetika untuk menemukan hasil yang dianggap proporsional dengan merubah persentase atau prioritas acuan yang digunakan untuk mencari nilai fitness. Hasilnya didapat bahwa tamanan yang dianggap baik menempatkan f5 pada prioritas tertinggi dan f2 pada prioritas terendah. Dari hasil pengujian juga terlihat bahwa evolusi dengan menggunakan mutasi, elitism, dan crossover dengan memperhatikan bracketed menghasilkan bentuk yang bervariasi.', 'Agus Priyono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100056'),
(530, '120411100057', 'Analytical Hierarchy Process (AHP) Untuk Evaluasi Sistem Monitoring Master Plan Teknologi Informasi Pemerintah Kota Mojokerto', 'Dr. Arif Muntasa, S.Si., M.T.', 'Moh. Kautsar Sophan, S.Kom., M.MT. ', 'IT Master Plan adalah sebuah perencanaan strategis terkait pengembangan sistem dan teknologi informasi yang ada di dalam sebuah organisasi atau perusahaan. Kota Mojokerto menerapkan IT Master Plan menyangkut pengembangan sistem dan teknologi di setiap SKPD (Satuan Kerja Perangkat Daerah) dengan cara manual, sehingga  membutuhkan waktu yang lama dalam mendapatkan hasil capaian kinerja. Berdasarkan hal tersebut diperlukan pengembangan sebuah sistem yang dapat melakukan survei, evaluasi, dan pencapaian kinerja secara terintegrasi ke setiap SKPD. Sebelumnya dan sampai saat ini, sistem yang digunakan dalam melaksanakan implementasi IT Master Plan masih dilakukan dengan manual, yaitu survei, evaluasi, serta hasil capaian kinerja membutuhkan tenaga tambahan yang banyak dan masih belum terkomputerisasi. Pada penelitian ini penulis  mengimplementasikan metode Analytical Hierarchy Process (AHP) untuk menentukan nilai bobot pada tahap evaluasi. Terdapat tiga tahapan utama evaluasi dalam penelitian ini. Tahap pertama menentukan bobot untuk masing-masing kriteria penilaian menggunakan metode AHP. Tahap kedua adalah memperoleh nilai score melalui bobot dan hasil survei. Terakhir adalah implementasi metode Trrafic Light System pada score. Berdasarkan hasil penelitian dan pengujian dengan data monitoring tahun 2015 pada SKPD kelurahan jagalan didapatkan nilai rata-rata score sebanyak 0.509.', 'Sulaiman Wakhid', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100057'),
(531, '120411100058', 'SISTEM MANAJEMEN PEMBELAJARAN JARAK JAUH BERBASIS CSCL (COMPUTER-SUPPORTED COLLABORATIVE LEARNING)', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Andharini Dwi Cahyani, S.Kom., M.Kom.', 'Pendidikan Jarak Jauh (PJJ) adalah pendidikan yang peserta didiknya terpisah dari pendidik dan peserta didik yang lain dan pembelajarannya menggunakan teknologi E-Learning. Proses pembelajaran dalam keadaan terpisah akan berpotensi membuat seluruh peserta didik menjadi belajar secara individual. Permasalahan tersebut dapat diselesaikan dengan sistem manajemen pembelajaran yang mendukung konsep CSCL (Computer Supported Collaborative Learning) guna membangun kebersamaan dalam proses belajar mengajar secara kelompok di kelas virtual. \nTeknik yang digunakan dalam mendukung konsep CSCL adalah salah satunya membuat sebuah forum diskusi khusus di tiap materi dengan melibatkan pendidik dan peserta didik. Kemudian untuk mengunduh materinya peserta didik diwajibkan untuk online bersama dalam satu kelompok kecil yang sudah ditentukan oleh pendidik. Apabila ada salah satu dari anggota kelompok yang belum online, maka materi tersebut tidak bisa di unduh.\nKonsep CSCL ini terbilang cukup efektif untuk membantu siswa membiasakan diri belajar secara kelompok serta berdiskusi langsung dengan pengajar untuk memahami materi. Hal itu dibuktikan dengan hasil uji coba yang menunjukan penilaian rata-rata sebesar 7,34 dari nilai range antara 1 sampai 10 dan masuk dalam kategori cukup efektif.\nKata Kunci :  Pendidikan Jarak Jauh (PJJ), E-Learning, CSCL (Computer- Supported Collaborative Learning)', 'Astu Masrundi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100058'),
(532, '120411100060', 'Sistem Pendukung Keputusan Penentuan Posisi Pemain Sepak Bola dengan Metode SMART dan Profile Matching', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Banyak Sekolah Sepak Bola (SSB) menawarkan pelatihan untuk pemain muda yang ingin berlatih sepakbola. Tapi, metode latihan yang masih konvensional membuat kurang optimalnya pembinaan ini. Salah satu masalah yang muncul adalah pemilihan posisi pemain yang tidak sesuai dengan bakat pemain.\nBeberapa posisi pemain memerlukan kondisi fisik dan kemampuan tertentu untuk mengisi posisi tersebut. Contohnya, seorang pemain penyerang sayap semestinya memiliki kecepatan dan stamina yang lebih baik dari pemain posisi lain sehingga perlu pemain dengan kemampuan tersebut. Beberapa pemain cenderung memaksakan posisi bermainnya tanpa mengetahui kemampuannya sendiri.\nBerdasarkan permasalahan diatas, perlu adanya sistem pendukung keputusan penentuan posisi pemain sepakbola. Berdasarkan hasil latihan pemain, sistem ini mendapatkan kemampuan dasar pemain. Kemampuan dasar ini akan diproses menggunakan metode SMART dan Profile Matching untuk mendapatkan hasil terkait posisi terbaik pemain\nSisten ini memiliki akurasi kesamaan mencapai 75% dengan pilihan pemain. Dengan sistem ini diharapkan akan memudahkan pemain muda untuk menentukan posisi terbaiknya dan mengoptimalkan kemampuannya dengan baik.', 'Radivan Mardhi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100060'),
(533, '120411100061', 'PEMBUATAN GAME EDUKASI MENGGUNAKAN SENSOR LEAP MOTION CONTROLLER SEBAGAI MEDIA PENGENALAN LAGU ANAK-ANAK', 'EZA RAHMANITA,S.T.,M.T.', 'MOCH. KAUTSAR SOPHAN, S.Kom.,M.MT.', 'Perkembangan  musik di Indonesia semakin  pesat namun tidak pada kualitas musik, terlebih lagu anak-anak yang semakin menghilang. Semakin banyak anak-anak yang mendengarkan lagu dewasa yang tidak patut di dengarkan di usianya. Akibatnya, psikologi dan perilaku sosial anak-anak tidak sesuai dengan usianya. Dalam hal ini teknologi dapat turut berperan mengenalkan kembali lagu anak-anak dengan lebih menyenangkan, interaktif, dan modern salah satunya dengan multimedia pembelajaran interaktif berupa game edukasi. \n Penelitian ini membangun game edukasi sebagai media pengenalan lagu anak-anak menggunakan Leap Motion Controller dan Unity3D. Leap motion controller adalah alat sensor perangkat keras komputer yang mendukung gerakan tangan dan jari sebagai masukan.Unity3D merupakan suatu aplikasi yang digunakan untuk mengembangkan game multiplatform yang didesain untuk mudah digunakan. Pada game edukasi ini Leap Motion Controller digunakan sebagai pengganti keyboard. User menggerakkan jari seakan-akan menekan keyboard virtual. \n Hasil kusioner dari pembuatan game edukasi ini didapatkan tingkat kepuasan yang positif pada user usia 8 sampai 9 tahun yaitu sebesar 85,9%. Untuk tingkat kemanfaatan aplikasi game edukasi sebagai media pengenalan lagu anak-anak didapatkan dengan menggunakan indikator importance pada kusioner, dan didapat hasil terbaik untuk user usia 12 tahun. Sedangkan uji performa Leap Motion Controller terhadap aplikasi didapatkan hasil jarak jangkau deteksi tangan user yang ideal yaitu 25cm dengan sudut 90 derajat dengan kondisi pencahayaan yang gelap maupun terang.\nKata Kunci :. Leap Motion Controller, Musik, Multimedia Interaktif, Game, Edukasi, Unity3D.\n', 'ILHAM ISKANDARIANSYAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100061'),
(534, '120411100063', 'APLIKASI MEDIA PEMBELAJARAN MATEMATIKA DASAR INTERAKTIF ANTARA ORANG TUA DAN ANAK BERBASIS MOBILE ANDROID', 'Cucun Very Angkoso, ST., MT.', 'Rika Yunitarini, ST., MT.', 'Di era digital ini sudah banyak teknologi yang bisa digunakan dalam menunjang pembelajaran. Perkembangan pembelajaran di Indonesia khususnya matematika, yang merupakan dasar dari semua ilmu pengetahuan masih sangat rendah. Sedangkan untuk meningkatkannya perlu dibutuhkan suatu media penunjang untuk mendampingi pembelajaran yang sudah ada. Maka dibutuhkan penelitian baru dengan cara merancang sebuah aplikasi media pembelajaran yang dapat mengatasi masalah tersebut. Salah satu caranya dengan menambahkan game matematika sederhana di dalamnya, sehingga tanpa sadar anak-anak akan mempelajari matematika dengan model yang kreatif, aktif, serta menyenangkan. Selain itu peran orang tua juga dibutuhkan agar proses belajar lebih maksimal. Dirancang menggunakan pendekatan pada sistem mobile android yang mudah dijangkau oleh semua elemen masyarakat sehingga lebih efektif pada proses implementasinya.\nDari data hasil uji coba, aplikasi penelitian ini dapat berjalan baik pada device android dengan OS gingerbread (2.3) ke atas, serta dengan random access memory minimal 256 MB. Pengujian menggunakan kuisioner menunjukkan 100% responden yang telah terbiasa menggunakan android menjelaskan aplikasi ini dapat membantu meningkatkan kemampuan literasi matematika anak, sedangkan yang tidak terbiasa menggunakan android 66,66% saja yang setuju dengan pendapat tersebut. Hasil kuisioner menunjukkan bahwa aplikasi ini lebih efektif digunakan pada pengguna yang sudah terbiasa menggunakan device android.\nKata kunci : e-learning, matematika interaktif, e-learning android.', 'Maulana Mukhammad Rizqii', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100063'),
(535, '120411100064', 'Implementasi Enkripsi dan Kompresi Algoritma RSA dan Shannon-fano pada Layanan SMS Android', 'Mulaab, S.Si., M.Kom.', 'Dwi Kuswanto, S.Pd., M.T.', 'Di Indonesia,  SMS masih menjadi pilihan untuk megirimkan sebuah pesan walau masih dibawah instant messenger seperti BBM dan WhatsApp, perbedaan yang terlihat antara SMS dan instant messenger selain cara pembayaran pengiriman pesannya adalah tingkat keamanan. \nPada instant messenger terdapat fitur untuk mengamankan percakapan  dengan metode-metode kriptografi yang beragam, sedangkan SMS tidak memiliki fitur tersebut, oleh karena itu dibuatlah SMS dengan tambahan fitur kriptografi. \nKriptografi yang akan digunakan adalah algoritma RSA, algoritma RSA merupakan kriptografi dengan kunci asimetris yang berarti memiliki dua kunci yang digunakan  untuk proses enkripsi dan dekripsi, algoritma RSA akan menjadikan plaintext menjadi bertambah jumlah karakternya, sehingga akan ditambahkan fitur kompresi untuk menekan pertambahan jumlah karakternya. Algoritma kompresi yang akan diguankan adalah Shannon-fano, merupkan algoritma syimbolwise dimana setiap karakter yang akan dikompresi  akan diubah menjadi kode biner yang baru. \nKompresi ini ditujukan supaya jumlah karakter dari hasil enkripsi tidak begitu banyak. Hasil dari penelitian ini menyatakan bahwa semakin panjang kunci yang digunakan akan semakin lama proses dekripsi pesan, nilai-nilai  avalanche effect  untuk algoritma RSA berkisar antara  8.53%-27.18%, kemudian untuk nilai  brute force masing-masing kunci didapatkan 4.119823716-75603807443 tahun, rata-rata rasio dan space saving dari kompresi adalah 1.42 dan 29.85%, dari pernyataan-pernyataan tersebut pengguna disarankan menggunakan kunci antara 32-56 bit.\n', 'Rachmad Nurhidayat', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100064'),
(536, '120411100065', 'Membangun Aplikasi Pembelajaran Matematika Dasar Bangun Datar Menggunakan Bahasa Pemrograman Python pada Perangkat Bergerak.', 'Moch. Kautsar Sophan, S.Kom, M.MT', 'Yonathan Ferry Hendrawan, S.T, M.IT', 'ABSTRAK\nE-learning merupakan sistem baru yang sudah berkembang dengan baik hingga saat ini. Sudah banyak pembelajaran yang telah didukung oleh e-learning. Dengan e-learning proses belajar tidak hanya di sekolah, namun sudah bisa dilakukan menggunakan Mobile dengan dukungan e-learning.\nPembuatan mobile learning ini menggunakan bahasa pemrograman Python, dikarenakan singkat dan fleksibelnya dalam pembuatan aplikasi apapun. Selain itu Python juga mempunyai tipe data dan operasi tingkat tinggi yaitu kecepatan pembuatan sistem aplikasi menggunakan tipe objek yang telah ada. \nHasil penelitian ini adalah: (1) dalam membangun aplikasi\npembelajaran matematika dasar bangun datar untuk sekolah dasar melalui 4 tahap utama yaitu: pengumpulan informasi, perencanaan, pembuatan, dan uji coba (2) kualitas pembelajaran bangun datar yang dibangun ditinjau dari aspek tampilan, isi, pembelajaran, dan teknologi adalah baik. Dengan menggunakan rentang skor 1 sampai 5, aspek tampilan menunjukkan rata-rata 2,4, aspek isi 3,8, aspek pembelajaran 3, dan pada aspek teknologi 2. (3) penggunaan pembelajaran bangun datar berdampak baik terhadap ketuntasan belajar siswa: pada uji coba\nkelompok besar dari 50 siswa, terdapat 35 siswa (70%) yang tuntas belajar dalam pembelajaran bangun datar.\nKata Kunci: mobile-learning, Android, Python, e-learning.', 'Siti Alifatul Qutsiah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100065'),
(537, '120411100066', 'APLIKASI MANAJEMEN PROYEK BERBASIS WEB MENGGUNAKAN METODE AGILE DENGAN FRAMEWORK SCRUM', 'SIGIT SUSANTO P., S.Kom. M.Kom.', 'YOGA DWITYA P., S.Kom. M.Cs.', 'Proyek merupakan suatu kegiatan usaha yang kompleks, bersifat tidak rutin, memiliki keterbatasan terhadap waktu, anggaran dan sumber daya serta memiliki spesifikasi tersendiri atas produk yang akan dihasilkan. Dalam mengerjakan sebuah proyek, diperlukan adanya landasan metode yang digunakaan dalam me-manajemen proyek. Metode tersebut harus sesuai dengan keadaan yang dihadapi pada sebuah proyek. Permasalahan yang sering terjadi adalah stakeholder cenderung menggunakan metode yang bersifat tradisional, dengan berasumsi bahwa proyek yang dikerjakan akan sesuai dengan kebutuhan yang telah didefinisikan. Padahal, pada kenyataan yang terjadi di lapangan, kemungkinan untuk terjadi perubahan yang berifat teknis pada proyek sangat memungkinkan. Pada metode yang bersifat tradisional, perubahan ini kurang mampu untuk diakomodir. Berdasarkan permasalahan tersebut, diperlukan adanya metode yang mampu menanggulangi perubahan yang terjadi, sehingga hasil atau produk dari sebuah proyek dapat memenuhi keinginan klien. Metode yang mampu mengakomodasi perubahan tersebut adalah metode Agile. Pada penelitian ini, penulis akan membangun aplikasi manajemen proyek dengan metode Agile menggunakan Framework Scrum. Hasil penerlitian menunjukkan efisiensi yang didapat dari pengujian usability dari aplikasi manajemen proyek memiliki nilai 3,89 (77,8 %). Menunjukkan bahwa pengguna merasa puas terhadap efisiensi aplikasi manajemen proyek.', 'FENDI SEPTIAWAN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100066'),
(538, '120411100069', 'Integrasi Kinect Dan Unity3D Menggunakan  Kinect SDK Untuk Pembuatan 3D Runner Game', 'Cucun Very Angkoso, S.T., M.T.', 'Yonathan Ferry Hendrawan, S.T., M.I.T.', 'Game merupakan hiburan multimedia yang dapat dimainkan dengan aturan tertentu dan sering digunakan sebagai sarana refreshing. Dengan menggunakan input sensor gerak, game juga dapat digunakan sebagai sarana olahraga tubuh. Hal ini merupakan nilai lebih dibanding game yang sejenis pada umumnya yang hanya menggunakan input seperti keyboard, mouse, dan touch screen.  Sensor gerak yang populer saat ini adalah Kinect dan salah satu game yang populer saat ini adalah 3D Runner Game. Penelitian ini membuat sebuah 3D Runner Game yang berbasis sensor gerak. Game dibuat dengan menggabungkan Unity3D dan Kinect menggunakan KinectWrapper. Sensor Kinect yang digunakan adalah sensor kinect xbox 360. Model 3D didapat dari penyedia model 3D gratis dan asset store dari game engine Unity. Pengujian dilakukan pada responden usia 6 – 12 tahun dengan hanya menggunakan kaos dan celana, 87,5% user berkeringat dan 12,5% tidak, serta berdasarkan dari konten game yang disuguhkan, menunjukkan bahwa game dapat digunakan untuk olahraga tubuh. Pada saat uji coba, 50% user mencoba 3 kali, 37,5% mencoba 4 kali, 12,5% mencoba 2 kali, namu tidak ada user yang hanya mencoba 1 kali, hal ini menujukkan bahwa game dapat membuat user tertantang untuk mencoba kembali.', 'Moh. Ali', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100069'),
(539, '120411100070', 'PENERAPAN METODE TRIPLE EXPONENTIAL \nSMOOTHING PADA SISTEM PERAMALAN PERSEDIAAN \nOBAT-OBATAN PADA APOTEK ARINI KAMAL ', 'Sigit Susanto Putro, S.Kom. M.Kom', 'Eza Rahmanita, S.T. M.T', 'Peramalan merupakan suatu fungsi penting yang digunakan dalam perencanaan yang efektif dan efisien. Apotek merupakan sarana pelayanan masyarakat bisa memberikan pelayanan yang terbaik bagi  masyarakat. Dalam hal ini membutuhkan produk farmasi sebagai penunjang layanan medis. Pelayanan yang baik dapat meningkatkan tingkat penjualan, maka dibutuhkan perencanaan yang baik untuk membantu pelayanan apotek. \nPenelitian ini bertujuan untuk perencanaan persediaan obat-obatan dengan menggunakan metode peramalan time series yaitu, Triple Exponential Smoothing (TES) dengan menggunakan perhitungan kesalahan Mean Square Error (MSE). Berdasarkan hasil analisis data, metode peramalan time seriesmendapatkan pola data terbaik untuk meramalkan penjualan obat-obatan di Apotek Arini yaitu pola data musiman. Nilai MSE terkecil sebesar 9,86633E-06% pada item obat allupurinol dengan nilai alpha (?) 0.9, betha (?) 0.5 dan gamma (?) 0.3.\n', 'Ryken Librandini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100070'),
(540, '120411100071', 'PENERAPAN AUGMENTED REALITY PADA PEMBUATAN APLIKASI 3D MENU BOOK UNTUK ICHI SUSHI RESTAURANT', 'Ari Kusumaningsih, S.T., M.T.', 'Arik Kurniawati, S.Kom., M.T.', 'Dalam pelayanan restoran banyak ragam cara pelanggan dapat melakukan pemesanan makanan dan minuman. Cara yang paling umum adalah pelanggan memanggil pelayan untuk melakukan pemesanan lalu mengantri di kasir. Yang menjadi masalah yaitu ketika pelanggan dalam jumlah besar saat jam makan menggantri dalam waktu lama hanya untuk melakukan pemesanan, maka harus ada cara lain yang lebih cepat menangani pesanan pelanngan dengan lebih mudah dan interaktif sehingga tak membosankan.\nDengan aplikasi 3D menu book pemesanan berbasis augmented reality yang dibuat dengan menggunakan Unity sebagai komponen utama, Vuforia sebagai Augmented Reality Software Development Kit (SDK) dan dengan Blender sebagai software untuk menhasilkan obyek 3D. Dengan memanfaatkan teknologi augmented reality yang terintegrasi dengan sistem pemesanan yang terhubung dengan kasir, pelanggan mendapatkan pelayanan secara maksimal diantaranya, makanan dan minuman ditampilkan ke pelanggan secara langsung dalam bentuk obyek 3D yang menarik, informasi bahan-bahan dan nilai gizi setiap menu, pemesanan dan pembatalan realtime, pengajuan permintaan tambahan yang lebih mudah dengan fitur chat serta kemudahan pembayaran tanpa perlu mendatangi kasir atau memanggil pelayan hanya dengan fitur proses tagihan. Fitur-fitur diatas diharapkan memberi pengaruh peningkatan kualitas pelayanan dari sisi kecepatan, kemudahan dan lebih bersifat interaktif dengan pelanggan.\nHasil dari aplikasi ini adalah terwujudnya cara pemesanan makanan dan minuman di restoran Ichi Sushi yang lebih cepat, mudah dan interaktif bagi para pelanggan. Berdasarkan hasil pengujian kecepatan dan pengalaman pengguna didapatkan penggunaan aplikasi lebih cepat dibanding pemesanan konvensional dengan selisih waktu 58,89 detik, dan mendapat skor 661 poin dari 840 poin pada pengujian user experience yang berarti mendapat tanggapan positif dari para pelanggan. \n\nKata Kunci : 3D Menu book, Augmented Reality, Unity, Android , Restoran.', 'Fathur Rahman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100071'),
(541, '120411100073', 'Sistem Informasi Geografis Potensi Pertanian Kabupaten Sumenep', 'Mula\'ab, S.Si., M.Kom.', 'Eza Rahmanita,ST.,MT.', 'Sektor pertanian di Kabupaten Sumenep memiliki beragam jenis tanaman unggul seperti padi, jagung, kedelai, kacang tanah, ubi kayu dan berbagai jenis tanaman lainnya. Namun pembangunan pertanian mengalami hambatan karena selain kesuburan tanah rendah sebagian pembangunan pertanian masih tradisional tanpa memperhatikan aspek kesesuaian lahan dan tanaman. Analisa potensi lahan pertanian sangat diperlukan agar mendapatkan rekomendasi pemanfaatan lahan yang sesuai, sehingga pada akhirnya mendapatkan hasil panen yang maksimal. Untuk mengatasi persoalan tersebut perlu dibuat suatu aplikasi yang dapat melakukan pemetaan terhadap daerah-daerah pertanian yang ada di Kabupaten Sumenep. Salah satu metode yang digunakan pada permasalahan tersebut yaitu dengan menggunakan GIS (Geographical Information System). Penerapan aplikasi ini diharapkan dapat memberikan informasi bagi pengguna untuk mengetahui daerah-daerah pertanian yang ada di Kabupaten Sumenep. Sehingga pengguna dapat menganalisis tanaman apa saja yang cocok untuk masing-masing daerah.', 'Moh. Ismail Hakim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100073'),
(542, '120411100074', 'SISTEM PENDUKUNG KEPUTUSAN PEMBERIAN BANTUAN REHABILITASI GEDUNG DAN FASILITAS SEKOLAH DENGAN METODE MULTI ATRIBUTE GLOBAL INFERENCE OF QUALITY (MAGIQ)', 'RIKA YUNITARINI, S.T., M.T.', 'SIGIT SUSANTO PUTRO, S.KOM., M.KOM.', 'Abstrak. Fasilitas dan gedung sekolah merupakan sarana yang mempengaruhi perkembangan pendidikan. Pemerintah setiap tahunnya menganggarkan dana untuk kepentingan sekolah, yaitu untuk menunjang pendidikan agar lebih baik lagi. Dinas Pendidikan merupakan salah satu instansi yang menjalankan program dari pemerintah di bidang pendidikan. Salah satunya, yaitu bantuan rehabilitasi gedung sekolah dan fasilitasnya. Untuk penentuan bantuan tersebut dibutuhkan  data dari setiap sekolah yang mengajukan bantuan. Proses seleksi di Dinas Pendidikan Bangkalan masih menggunakan cara yang manual sehingga proses seleksi kurang tepat pada sasarannya. Penerimaan bantuan tersebut menggunakan beberapa kriteria seperti kondisi gedung, fasilitas dan perlengkapan sekolah. Dimana hasil akhirnya akan diurutkan berdasarkan nilai tertinggi. Pada penelitian ini digunakan sebuah metode Multi Atribute Global Inference of Quality (MAGIQ) yang digunakan untuk proses perangkingan. Dari hasil pengujian sistem pendukung keputusan dengan menggunakan (MAGIQ) diperoleh hasil perbandingan untuk nilai rangking yang sama yaitu 30,43 % sedangkan untuk nilai rangking yang tidak sama yaitu 69,56 %.\nKata kunci :Rehabilitasi, SPK, Multi Atribute Global Inference of Quality (MAGIQ),', 'UUN FATMAWATI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100074'),
(543, '120411100076', 'IDENTIFIKASI ACUTE LYMPHOBLASTIC\nLEUKEMIA (ALL) MENGGUNAKAN KLASIFIKASI\nNAIVE BAYES DAN FITUR GRAY LEVEL COOCCURENCE\n(GLCM)', 'Dr. Aris Muntasa, S.Si.,M.T.', 'Dr. Indah Agustien S.,S.Kom.,M.Kom.', 'Leukemia adalah kanker yang merusak darah dan sumsum tulang di mana sel-sel darah dibuat. Ada empat jenis Leukemia yaitu, Acute Myeloid Leukemia (AML), Acute Lymphoblastic Leukemia (ALL), Chronic Myeloid Leukemia (CML), Chronic Lymphocytic Leukemia (CLL). CML dan AML umumnya terjadi pada orang dewasa sedangkan penyakit ALL umumnya terjadi pada anak-anak dan keganasannya berkembang dengan cepat. Oleh karena keganasan penyakit ALL berkembang sangat cepat sedangkan untuk mendiagnosa dibutuhkan waktu yang lama maka diperlukan sistem yang mampu membantu patologi dalam mengenali jenis sel leukosit secara otomatis. Tujuan awal sistem penelitian ini adalah mengidentifikasi penyakit ALL dengan melakukan segmentasi Otsu Tresholding untuk memisahkan sel darah putih. proses selanjutnya yaitu ekstraksi fitur dengan menggunakan fitur Gray Level Co-Occurance Matrix (GLCM) dan fitur Color Co-Occurrence Matrix (CCM). Sedangkan untuk klasifikasinya menggunakan klasifikasi Naive Bayes. Penelitian difokuskan pada jenis penyakit ALL untuk membantu mengidentifikasi dengan cepat. Akurasi tertinggi terjadi pada skenario berdasarkan fitur GLCM kuantisasi 2bit sebesar 94,1%, sedangkan berdasarkan fitur CCM akurasi tertinggi sebesar 81,5%. Jadi, dalam kasus ini metode GLCM lebih cocok dari pada metode CCM.', 'Cahya Aris Prasetyawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100076'),
(544, '120411100077', 'RANCANG BANGUN AUGMENTED REALITY UNTUK E-COMMERCE BERBASIS ANDROID (ARCOMMERCE)', 'Ari Kusumaningsih, S.T., M.T', 'Arik Kurniawati, S.Kom., M.T', 'Hampir di setiap bangunan pasti memiliki furnitur. Kursi,meja, maupun sofa adalah kebutuhan yang wajib  dipenuhi oleh pengguna furnitur sebagai salah satu perabotan rumah tangga. Internet merupakan kecanggihan teknologi yang dapat dimanfaatkan sebagai alat bantu media penyampaian dalam memberikan informasi kepada pelanggan secara aktual dan akurat. Pelanggan bisa bertemu tanpa adanya tatap muka, tidak terbatas, tidak terikat adanya suatu batas wilayah, serta mendukung adanya jual beli secara online melalui e-commerce. Akan tetapi masih banyak konsumen yang membeli produk furnitur secara manual dengan cara mendatangi toko furnitur tersebut, hal ini dirasa masih kurang efisien dan kurang efektif. Seiring berkembangnya internet dan sitem operasi android maka dewasa ini masyarakat banyak yang membuat aplikasi tentang furnitur dengan menggabungkan teknologi canggih, salah satunya adalah Augmented Reality. Penelitian ini bertujuan untuk mengukur tingkat efektif dan efisiensi pada aplikasi dan website, serta dapat mengukur tingkat kepuasan user experience pada penggunaan aplikasi. Hasil dari perhitungan kuisioner didapat bahwa 85% aplikasi FurnitAR dan E-Commerce ini dapat membantu user menjadi lebih efektif dan efisien dalam pembelian produk furnitur. Pengukuran user experience tercapai dengan cara user mengisi form usability test serta mencoba aplikasi secara langsung. Hasil yang didapat bahwa 77% pengguna puas dengan adanya aplikasi FurnitAR dan E-Commerce ini.\n\nKata Kunci : Furniture, E-Commerce, Augmented Reality, 3D.\n', 'R. Dwi Ade Iswahyudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100077'),
(545, '120411100078', 'RANCANG BANGUN SISTEM INFORMASI MANAJEMEN KERJA PRAKTEK MENGGUNAKAN PEMODELAN MVC (MODEL VIEW CONTROLER)\n (Studi Kasus : Teknik Informatika Universitas Trunojoyo Madura)\n', 'Bain Khusnul K, ST., M.Kom                   ', 'Eza Rahmanita, S.T., M.T.                        ', 'Kerja praktek  merupakan kegiatan yang wajib bagi mahasiswa S1 Teknik Informatika yang bertujuan untuk menguji dan mengaplikasikan teori serta sebagai pembuktian ilmiah dari  mata kuliah yang sudah didapat. Pada proses manajemen kerja praktek masih dilakukan secara manual, hal tersebut akan menyita banyak waktu serta sering terjadinya kesalahan. \nOleh karena itu akan dibangun Sistem Informasi Manajemen Kerja Praktek akan dibangun menggunakan bahasa pemrograman PHP dengan pemodelan mvc (model view controller) dan Codeingniter sebagai  frameworknya. \nHasil yang didapatkan dari penelitian ini adalah sistem manajemen yang dapat mengelola data yang terkait dengan kegiatan kerja praktek. Seperti pengajuan kerja praktek, cetak daftar mahasiswa yang melakukan kerja praktek, informasi nilai kerja praktek, informasi dosen pembimbing, bimbingan online. Serta hal-hal yang terkait dengan kerja praktek dan mendapatkan nilai kepuasan user sebesar 8,0 dan nilai kemudahaan 8,1. \nKata kunci: Sistem Informasi Manajemen, Kerja Praktek,Framework Codeigniter ,Mvc.', 'Bagus Dwi Saputra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100078'),
(546, '120411100079', 'Sistem Pendukung Keputusan untuk Pemilihan Desain Interior dengan Menggunakan Fuzzy Analytical Hierarchy Process (FAHP)', 'Rika Yunitarini, S.T., M.T', 'Achmad Jauhari, S.T., M.Kom', 'Penerapan desain interior pada ruangan perlu mempertimbangkan aspek keindahan, kenyamanan, serta fungsionalitas oleh karena itu dirasa sukar untuk orang awam yang akan menerapkan desain interior pada ruangan. Perancangan sistem pendukung keputusan untuk pemilihan desain interior dilakukan untuk membantu pihak tertentu yang masih bingung dalam menentukan desain interior yang akan diterapkan pada ruangan. Oleh karena itu, diperlukan sebuah sistem yang dapat membantu pemilihan desain interior untuk diterapkan dalam suatu  dengan mempertimbangkan unsur-unsur penting dalam desain interior dimana unsur tersebut memiliki nilai kualitatif. Agar sistem dapat memproses data kualitatif tersebut maka diperlukan metode untuk mengkonversi data kualitatif tersebut yang digunakan untuk menghitung prioritas antar kriteria serta kriteria pada beberapa alternatif desain interior, dalam hal ini digunakan metode Fuzzy Analytical Hierarchy Process (FAHP) sehingga nantinya didapatkan rekomendasi desain interior dari hasil perhitungan yang paling tinggi dan tentunya sesuai dengan keinginan pihak yang akan menerapkan desain interior. \nHasil rekomendasi dari sistem telah melalui proses uji objektifitas dengan menyebarkan kuisioner kepada 50 responden dan mendapatkan hasil rata-rata nilai sebesar 8.28 untuk poin kesesuaian rekomendasi dengan keinginan customer. \n\nKata kunci: desain interior,  fuzzy analytical hierarchy process, sistem pendukung keputusan', 'Audia Vernanda Arif', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100079');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(547, '120411100080', 'PERANCANGAN DAN IMPLEMENTASI APLIKASI ANDROID ALAT BANTU PEMBELAJARAN INTERAKTIF HURUF HIJAIYAH DENGAN METODE WAFA', 'Firdaus Solihin, S.Kom., M.Kom.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Belajar mengenal huruf hijaiyah merupakan hal yang paling pokok dalam membaca al-Quran, sehingga harus diajarkan sejak dini. Namun, saat ini minat anak-anak dalam belajar rendah. Salah satu faktor penyebabnya adalah metode pembelajaran huruf hijaiyah kurang variatif dan menyenangkan. Wafa adalah metode belajar al-Quran dengan pendekatan otak kanan (asosiatif dan imajinatif). Sedangkan perkembangan teknologi informasi saat ini memungkinkan untuk pengembangan media pembelajaran interaktif pengenalan huruf hijaiyah. Sehingga untuk menambah minat anak dalam belajar hijaiyah, dikembangkan aplikasi android pembelajaran interaktif huruf hijaiyah metode Wafa.\nBerdasarkan uji coba terhadap pengguna, baik trainer Wafa maupun guru dan murid SDIT Ulil Albab Kamal mengatakan bahwa 100% aplikasi belajar hijaiyah Wafa Buku Satu dapat membantu proses belajar mengajar dan 80% aplikasi telah sesuai dengan konsep Wafa.\nKata Kunci: Aplikasi Pembelajaran, metode Wafa, Pembelajaran interaktif, Android', 'Astrid Enggar Triasti D.', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100080'),
(548, '120411100081', 'RANCANG BANGUN APLIKASI ANDROID MEDIA PEMBELAJARAN KOSA KATA BAHASA ARAB BERGAMBAR DENGAN MENGGUNAKAN MODEL PENDEKATAN ADDIE   ', 'Moch Kautsar Sophan S.Kom., M.MT.,', 'Rika Yunitarini, S.T., M.T. ', 'Media pembelajaran interaktif, salah satunya yaitu pembelajaran kosa kata bahasa arab. Mengingat seberapa penting bahasa arab untuk seorang muslim sebagai proses awal untuk memahami Al-Qur’an. Sementara siswa terkadang kurang berminat dengan pembelajaran di kelas yang membuat mereka merasa bosan. Disamping itu, smartphone saat ini sudah sangat populer disetiap lapisan masyarakat, begitupun juga anak-anak. Oleh karena itu, agar smartphone dikalangan anak-anak bisa menjadi media yang tepat guna, dirancanglah sebuah aplikasi android media pembelajaran interaktif kosa kata bahasa arab. Model pendekatan yang dilakukan pada proses pembuatan media adalah ADDIE (Analisys, Design, Development, Implementation, Evaluation) yaitu model desain sistem media pembelajaran dengan memperlihatkan tahapan-tahapan dasar media pembelajaran sederhana dan mudah dipelajari. Tampilan aplikasi kosa kata ini dapat tampil sempurna pada perangkat android dengan resolusi 480 x 800 pixels. Berdasarkan Evaluasi yang dilakukan dari sisi siswa yang berupa pertanyaan seputar materi pada aplikasi sebelum siswa menggunakan aplikasi dan setelah menggunakannya, siswa mampu meningkatkan hafalan kosa kata bahasa arab. Sedangkan hasil dari kuisioner yang telah diisi oleh edukator hampir keseluruhan menyatakan bahwa aplikasi ini layak digunakan seterusnya untuk membantu siswa menghafal kosa kata bahasa Arab. Dari responden tim edukator, 78% menyatakan sangat layak, sedangkan 22% menyatakan layak.', 'Ramlah Basyir', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100081'),
(549, '120411100083', 'PENERAPAN ALGORITMA APRIORI DALAM PENCARIAN BUKU \nPADA PERPUSTAKAAN SMA NEGERI 1 PORONG\n', 'Sigit Susanto Putro,S.Kom., M.Kom.', 'Yoga Dwitya Pramudita,S.Kom., M.Cs.', 'Perpustakaan SMA Negeri 1 Porong memiliki berbagai macam koleksi buku sebagai penunjang kegiatan belajar mengajar. Dalam kegiatan meminjam buku, siswa biasanya bertanya kepada teman-teman yang pernah meminjam buku mata pelajaran tertentu untuk mendapatkan referensi buku apa saja yang biasanya dipinjam sehingga mempermudah pencarian buku di perpustakaan.  Penelitian ini dapat mengaplikasikan serta mengembangkan sistem pendukung keputusan yang mampu memberikan informasi kepada pengunjung perpustakaan tentang rekomendasi buku yang dapat dipinjam. Penelitian ini menggunakan algoritma apriori untuk mendapatkan rules yang digunakan sebagai rekomendasi.  Hasil eksperimen yang telah dilakukan dengan algoritma apriori, dari uji skenario yang telah dilakukan disimpulkan semakin besar nilai minimum support dan nilai minimum confident menghasilkan rules yang sedikit dan waktu yang diperlukan untuk mendapatkan rules juga lebih singkat. Hasil tersebut diperoleh  dari hasil pengujian dengan ketentuan nilai suppot 3, 4, 5 dan 6 dengan nilai confident 70% di dapatkan waktu respon 0.0200012 (support 6) detik, waktu respon 0.00330021 detik (support 5), waktu respon 0.00340021 detik (support 4), waktu respon 0.0760038 detik (support 3). ', 'Sherly Fatmawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100083'),
(550, '120411100084', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PERUMAHAN DENGAN  METODE FUZZY ANALYTICAL HIERARCHY PROCESS  (STUDI KASUS : PERUMAHAN DAERAH GRESIK) ', 'Rika Yunitarini, S.T., M.T', 'Achmad Jauhari, S.T., M.Kom', 'Perumahan merupakan tempat tinggal dan merupakan faktor penting sebagai peningkatan harkat dan martabat manusia. Perumahan harus dilengkapi dengan beberapa sarana dan juga prasarana pendukung agar mendapatkan hunian yang nyaman dan sesuai keinginan. Banyaknya developer perumahan yang menawarkan macam-macam perumahan dengan berbagai tipe membuat para kosumen sering merasa bingung dalam memilih perumahan yang diinginkan. Untuk memecahkan permasalahan tersebut di buatlah sebuah sistem pendukung keputusan pemilihan perumahan dengan menggunakan metode Fuzzy Analytical Hierarchy Process dengan beberapa kriteria yang akan dibandingkan. Kriteria yang di bandingkan dalam penelitian ini meliputi harga rumah, luas rumah, luas bangunan, jumlah kamar, dan jumlah lantai. Penelitian ini akan menghasilkan sebuah sistem pendukung keputusan yang dapat memberikan rekomendasi bagi konsumen dalam memilih perumahan. Dalam penelitian ini diharapkan dapat membantu para konsumen dalam pemilihan perumahan hunian yang diinginkan. Dengan penerapan metode Fuzzy Analytical Hierarchy Process pada sistem dan hasil uji coba pengujian sistem menggunakan kuesioner yang telah disebar sebanyak 50 responden, sistem sesuai dengan keinginan customer sebesar 34%, sedangkan customer yang menilai cukup sesuai dengan presentase sebesar 61%.  \n\nKata kunci : Perumahan, Sistem Pendukung Keputusan (SPK), Fuzzy Analytical Hierarchy Process. ', 'Mala Rosa Aprillya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100084'),
(551, '120411100085', 'KONTROL  SENSOR ACCELEROMETER DAN GYRO\nSEBAGAI PERGERAKAN BALANCING ROBOT \nMENGGUNAKAN LOGIKA FUZZY', 'Dr. Indah Agustien, S.Kom., M.Kom.', 'Koko Joni, S.T., M.Eng.', 'ABSTRAK\n\nRobot diciptakan agar dapat membantu manusia untuk melakukan pekerjaan yang memerlukan kecepatan tinggi, pekerjaan manusia yang beresiko, pekerjaan yang kotor (kumuh), dan pekerjaan yang sifatnya berulang-ulang bisa digantikan dengan robot. Robot tidak hanya digunakan dalam dunia industri, oleh karena itu teknologi robotika merupakan teknologi yang diminati dari sekian teknologi dalam dunia pendidikan maupun riset. Misalkan robot sebagai media tranportasi seperti balancing robot.\nBalancing robot merupakan sebuah robot yang yang mampu menjaga keseimbangan robot itu sendiri. Dalam menjaga keseimbangan dalam robot ditanamkan sensor yang bisa memberikan nilai dari sudut kemiringan robot dan kontroler yang akan mengatur pergerakan balancing robot. Logika fuzzy digunakan sebagai kontroler dari robot, pemilihan logika fuzzy sebagai kontroler bertujuan agar robot dapat berjalan setabil dalam menjaga keseimbangan. Dari penelitian ini robot dapat bekerja dengan stabil dalam menjaga keseimbanganya dan waktu rata-rata yang ditempuh robot dalam mencapai posisi seimbang dari sudut maksimal robot yaitu 400 adalah selama 1,01 detik.\n \nKata Kunci : robot, kontrol, logika fuzzy, balancing robot', 'M. Dimas Ali Furqon', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100085'),
(552, '120411100086', 'RANCANG BANGUN APLIKASI POINT OF SALE (POS) PADA TOKO MATERIAL CAHAYA ABADI SURABAYA', 'SIGIT SUSANTO PUTRO, S.KOM., M.KOM.', 'IKA OKTAVIA SUZANTI, S.KOM., M.CS', 'Efisiensi merupakan salah satu masalah vital bagi perusahaan, termasuk Toko Material Cahaya Abadi. Salah satu proses bisnis yang dapat ditingkatkan efisiensinya ialah pada proses transaksi. Peningkatan efisiensi di dalam proses transaksi dapat dilakukan dengan menerapkan sistem Point Of Sale (POS). Sistem POS adalah sistem yang terdiri dari hardware dan software yang didesain sesuai dengan kebutuhan pengguna. Dengan berbagai alat pendukung agar dapat mempercepat proses transaksi. Agar proses perancangan sistem POS ini dapat terstruktur dengan baik maka perlu diterapkan sebuah metodologi yang sesuai dengan kondisi studi kasus. Metode Waterfall Model digunakan karena dianggap sesuai dengan kondisi studi kasus. Waterfall Model digunakan dalam mengembangkan sistem POS karena tahapan pengerjaannya perlu dilakukan secara berurutan, sehingga peneliti dapat bekerja dengan lebih mudah dan terstruktur dalam mengembangkan software. Codeigniter juga digunakan sebagai framework PHP dalam pengembangan sistem POS ini. Penerapan sistem POS di lingkungan Toko Material Cahaya Abadi mampu memberikan dampak signifikan dalam pencatatan transaksi perusahaan sehingga mampu meningkatkan efisiensi dalam proses transaksi seperti yang yang diinginkan perusahaan. Peningkatan efisiensi ini terlihat dari hasil perhitungan kepuasan pengguna menggunakan metode perhitungan dengan Skala Likert. berdasarkan Skala Likert diketahui bahwa nilai kepuasan pengguna terhadap Sistem POS sebesar 302 yang menunjukkan bahwa pengguna sangat puas terhadap kinerja Sistem POS. Selain itu, dengan menggunakan Sistem POS proses transaksi menjadi semakin cepat dan perusahaan mampu menghemat sumber daya untuk kebutuhan proses transaksi dan pencatatan transaksi.', 'DICHY PERMANA AJI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100086'),
(553, '120411100087', 'Sistem Pendukung Keputusan Pemilihan Pemain Bola Voli Menggunakan Metode SMART', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Achmad Jauhari, S.T., M.Kom.', 'Peningkatan Pembinaan pemain bola voli terutama ditingkat daerah sangat diperlukan untuk menghasilkan pemain bola voli berkualitas. Penyeleksian pemain secara subjektifitas akan menghambat regenerasi pemain bola pada masa yang akan datang. Di dalam tim bola voli terdapat seorang pelatih yang memilih pemain bola voli untuk masuk dalam sebuah tim yang dibentuknya. Tugas ini yang membuat pelatih bola voli PBVSI Kabupaten Sumenep kesulitan memilih pemain berkualitas. Berdasarkan permasalahan tersebut, perlu ada tes dan sebuah sistem pendukung keputusan agar pelatih dapat dengan mudah memilih pemain yang tepat. Dengan Sistem Pendukung Keputusan metode SMART diharapkan pelatih khususnya PBVSI Kabupaten Sumenep lebih mudah mendapatkan pemain yang berkualitas baik. Hasil dari penilaian seleksi menggunakan metode SMART menghasilkan nilai akurasi sebesar 62,5%, nilai akurasi di dapatkan dari hasil perbandingan antara data hasil perhitungan sistem dengan data rekomendasi dari pelatih.', 'Moh. Fauzan Anwar', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100087'),
(554, '120411100089', 'Identifikasi Motif Batik Madura Menggunakan 2D-DFT dan Naive Bayes Classifier', 'Mulaab, S.Si., M.Kom', 'Rosida Vivin Nahari, S.Kom., M.T', 'Batik merupakan budaya asli yang berasal dari Indonesia. Setiap daerah di Indonesia memiliki batik dengan khas yang berbeda tiap daerah. Kekhasan batik dapat dilihat dari  motif yang terdapat pada batik itu sendiri. Tiap daerah memiliki motif yang menjadi ciri dan budaya dari daerah tersebut. Cara membedakan motif dari batik sangat sulit bagi orang awam dan hanya menggunakan kemampuan visual saja. Banyak penelitian dalam bidang teknologi dan komputasi yang dilakukan dengan latar belakang permasalahan ini seperti pengenalan pola motif batik, klasifikasi batik berdasarkan asal daerahnya, dan lain-lain. Banyak metode-metode yang digunakan dan dengan hasil akurasi yang berbeda. Pada penelitian ini akan dilakukan identifikasi terhadap citra batik dari empat kabupaten di Madura dengan metode 2D Discrete Fourier Transform (2D-DFT) untuk ekstraksi ciri dan Naïve Bayes untuk proses klasifikasi dan identifikasi. Hasil dari penelitian ini berupa sistem yang dapat mengidentifikasi dan menglasifikasi Batik Madura. Pada penelitian ini akurasi tertinggi batik yang dapat dikenali sistem adalah 51.85%.', 'Arthur Darwanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100089'),
(555, '120411100090', 'PENERAPAN METODE PROFILE MATCHING DALAM MENENTUKAN POSISI STRIKER PADA TIM SEPAK BOLA', 'SIGIT SUSANTO PUTRO, S.Kom., M.Kom.', 'YOGA DWITYA PRAMUDITA, S.Kom., M.Cs.', 'Pemain penyerang atau yang sering di sebut striker merupakan pemain yang bertugas untuk mencetak gol ke gawang lawan. Dalam menempatkan pemain di posisi sebagi penyerang seorang pelatih melakukan penilain secara subyektif sehingga memerlukan waktu yang cukup lama. Oleh karena itu di perlukan sistem yang dapat membantu pelatih dalam menempatkan pemain sebagai penyerang. Di dalam sistem ini menghasilkan pemain penyerang yang berkualitas diperlukan beberapa kriteria - kriteria yang dibutuhkan. Selain itu diperlukan metode dalam menentukan posisi pemain penyerang dan di dalam penelitian ini menerapkan metode profile matching. Metode ini di anggap mampu untuk menghasilkan pemain penyerang yang sesuai dengan kriteria yang dhiarapkan. Perhitungan dalam metode ini membandingkan antara kriteria pemain dengan kriteria target yang diharapkan. Sehingga akan di dapatkan hasil yang sama dengan pemain yang diharapkan. Hasil dari penelitian ini berupa nilai dari perhitungan sistem, yang mana pemain yang memiliki nilai tertinggi dianggap layak menempati posisi tersebut. Dari pengujian sistem yang dilakukan tingkat kecocokan hasil sistem dengan rekomendasi pelatih mencapai 57,14%.', 'ARIF RAHMAN ZEIN', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100090'),
(556, '120411100091', 'Pengenalan Motif Batik Madura Menggunakan 2D Discrete Cosine Transform dan Neural Network Backpropagation', 'Mulaab., S.Si., M.Kom.', 'Rosida Vivin Nahari., S.Kom., M.T.', 'Batik merupakan salah satu budaya yang sudah menjadi identitas bagi  negara Indonesia. Batik indonesia mempunyai banyak keanekaragaman motif dan setiap daerah memiliki  model dan ciri khas yang hampir sama. Masyarakat pada umumnya hanya menggunakan batik tanpa mengenal dari mana asal batik yang mereka gunakan. Mereka tidak bisa membedakan asal motif dan model yang ada di setiap batik. Sehingga diperlukan sistem yang dapat membedakan jenis batik khususnya batik madura. Pada penelitian ini akan melakukan teknik untuk mengklasifikasikan batik dengan menggunakan Jaringan syaraf tiruan Backpropagation. Sedangkan untuk ekstrasi cirinya menggunakan metode 2-D Discreet Cosine Transform (DCT). Dimana data training dan data testing akan di uji secara acak menggunakan metode K-Fold Cross Validation. Hasil dari penelitian ini berupa sistem yang dapat menglasifikasi Batik Madura. Pada penelitian ini akurasi tertinggi batik yang dapat dikenali sistem adalah 46.153%.', 'Ahmad Madani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100091'),
(557, '120411100092', 'VIRTUAL REALITY UNTUK PENGENALAN LINGKUNGAN LABORATORIUM TEKNIK INFORMATIKA UTM', 'Cucun Very Angkoso, ST., MT.', 'Ari Kusumaningsih, ST., MT.', 'Dewasa ini perkembangan teknologi semakin maju, salah satu teknologi yang berkembang pesat pada saat ini yaitu smartphone berbasis android. Namun berkembangnya teknologi tidak sebanding dengan kebutuhan mahasiswa, misalnya dalam pengenalan lingkungan laboratorium. Selama ini pengenalan lingkungan laboratorium masih dilakukan secara manual tanpa melibatkan sebuah teknologi untuk memperkenalkan sebuah lingkungan laboratorium dan hal itu dirasa kurang efektif dan efisien karena membuhkan tenaga dan waktu yang lama. Dari permasalahan tersebut dibuatlah sebuah Virtual Reality (VR) 3D berbasis android yang berjenis visualisasi arsitektur dengan studi area Laboratorium Teknik Informatika (TIF) UTM. Dengan aplikasi ini mahasiswa dapat menjelajah dan mengenal Laboratorium TIF hanya dengan menggunakan smartphone berbasis Android, sehingga mahasiswa tidak perlu datang secara langsung. Dari data hasil uji coba, aplikasi VR Laboratorium TIF dapat berjalan dengan baik di 6 device uji coba namun pada device Andromax R1 gyroscope tidak berfungsi dengan baik. Dari hasil pengujian aplikasi menggunakan kuesioner didapatkan nilai rata-rata dari responden berdasarkan verifikasi user yaitu 89% baik, 11% Kurang baik, dan 0% sangat kurang baik. Sedangkan nilai rata-rata dari keseluruhan pertanyaan yaitu sebesar 95%.', 'Muzammil', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100092'),
(558, '120411100093', 'Klasifikasi Tingkat Diabetic Retinopathy Menggunakan K-Nearest Neighbors dan Moment Invarians Berbasis Fitur', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Salah satu hasil komplikasi dari penyakit Diabetes Mellitus yaitu Retinopati Diabetes. Penyakit ini dapat menyebabkan kebutaan secara permanen jika tidak ditangani sejak dini. Angka penyandang Retinopati Diabetes terus meningkat seiring bertambahnya penyandang Diabetes Mellitus.Untuk itu diperlukan suatu sistem yang dapat mendeteksi penyakit ini sejak gejala awal. Dalam penelitian ini dibuat sebuah perangkat lunak untuk mendeteksi Retinopati Diabetes secara otomatis. Terdapat 3 langkah utama untuk proses deteksi. Langkah pertama dengan menyiapkan citra input. Citra input yang digunakan yaitu citra asli dalam bentuk grayscale serta citra asli yang dieliminasi pembuluh darahnya. Untuk melakukan eliminasi pembuluh darah dengan proses overlapping antara citra hasil segmentasi pembuluh darah dengan citra original database. Langkah kedua dengan ektraksi fitur menggunakan moment invariant method. Hasil dari proses ekstraksi fitur digunakan untuk proses klasifikasi dengan KNN Classifier dan dilakukan pengujian pada data testing untuk mendapatkan grade hasil klasifikasi tingkat keparahan Diabetic Retinopathy. Sistem ini dapat bekerja dengan tingkat akurasi maksimum sebesar 58% berdasarkan perubahan nilai K. Akurasi maksimum dengan perubahan jumlah Training mencapai 95%.', 'Siti Maria Ulfah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100093'),
(559, '120411100094', 'KLASIFIKASI PENYAKIT DIABETIC RETINOPATHY PADA CITRA RETINA MENGGUNAKAN METODE TWO DIMENSIONAL PRINCIPAL COMPONENT ANALYSIS (2DPCA)', 'Dr. Indah Agustien, S.Kom., M.Kom.', 'Dr. Arif Muntasa, S.Si., M.T.', 'Diabetic Retinopathy merupakan sebuah penyakit komplikasi dari penyakit diabetes mellitus yang dapat menyebabkan rusaknya pembuluh darah dan kebutaan permanen. Resiko penyakit Diabetic Retinopathy dapat dilihat dengan kasat mata  namun membutuhkan waktu yang lama untuk mengetahui hasilnya dan metode ini dinilai kurang efektif. Sehingga perlu adanya sistem untuk mendeteksi penyakit Diabetic Retinopathy dengan cepat, tepat, dan efisien.\nPenelitian ini bertujuan untuk mengklasifikasi tingkat keparahan penyakit Diabetic Retinopathy. Proses klasifikasi penyakit Diabetic Retinopathy ini diawali dengan proses segmentasi. Kemudian dilanjutkan dengan proses ekstraksi fitur menggunakan metode Two Dimensional Principal Component Analysis (2DPCA). Tahapan terakhir dari penelitian ini merupakan klasifikasi dengan melakukan pengukuran kemiripan menggunakan metode ecludian distance.\nMetode ini telah diujikan pada citra database MESSIDOR yang terdiri dari 80 citra asli dengan format *.tif . Rata-rata akurasi pengenalan yang didapatkan pada citra yang dilakukan eliminasi optic disk sebesar 33.84% , rata-rata akurasi citra pengenalan tanpa eliminasi optic disk sebesar 29.43%, rata-rata akurasi pengenalan image enhancement dan normalisasi citra sebesar 34.27%, rata-rata akurasi non-image enhancement dan non-normalisasi citra sebesar 33.84%.\n\n\nKata kunci : Klasifikasi , Diabetic Retinopathy, Two dimensional Principal Component Analysis (2DPCA), Akurasi\n', 'R. NURJANNAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100094'),
(560, '120411100096', 'Klasifikasi Penyakit Diabetes Retinopati menggunakan Metode GLRLM ( Gray Level Run Lenght Matrix) LVQ (Learning Vector Equantization)', 'Dr. Indah Agustien S., S. Kom,M .Kom', 'Dr. Arif Muntasa, S. Si., M.T', 'Abstraksi\nDiabetic Retinopathy merupakan penyakit yang diakibatkan oleh komplikasi dari penyakit diabetes mellitus. Diabetic Retinopathy dapat menyebabkan kerusakan mata dan apabila tidak ditangani dengan tepat dapat menyebabkan kerusakan permanen. Penyakit Diabetic retinopathy menyebabkan kerusakan pada retina mata bagian pembuluh darah. Untuk mengetahui penderita mengalami penyakit ini di butuhkan maka dibutuhkan system yang dapat menganalisa informasi pada citra. Maka dari itu diperlukan adanya penelitian klasifikasi diabetic retinopathy untuk analisa citra fundus mata. Tugas Akhir ini menggunakan metode gray level run length matrix (GLRLM) sebagai metode ekstraksi fitur dan metode learning vector quantization (LVQ) sebagai klasifikasinya. Terdapat tiga langkah proses dalam klasifikasi penelitian ini. Proses pertama dengan mengubah citra asli menjadi grayscale, kemudian dilakukan masking overlay yaitu mengeliminasi blood vessel pada citra grayscale dengan hasil proses segmentasi. Langkah kedua adalah ekstraksi fitur dengan menggunakan metode GLRLM. Proses terakhir yaitu klasifikasi fase dengan menggunakan learning vector quantization (LVQ). Pengujian akan dilakukan terhadap database . Berdasarkan hasil penelitian danpengujian terhadap sistem, maka didapatkan tingkat akurasi tertinggi sebesar 48.3333%.\nKata Kunci : diabetic retinopathy, gray level run length matrix, learning vector quantization', 'Intan Fauziah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100096'),
(561, '120411100097', 'CUSTOMER PROFILING MENGGUNAKAN ALGORITMA K-MEAN PADA USAHA KECIL MENENGAH BATIK MADURA', 'Bain Khusnun Khotimah, S.T., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Customer Profiling adalah profil pelanggan. Profiling digunakan untuk mengetahui data pribadi pelanggan saat pembelian. Pembentukan cluster merupakan salah satu teknik yang digunakan dalam mengekstrak pola kecenderungan suatu data. Teknik ini ini digunakan dalam proses Knowledge discovery in database (KDD). Data mining biasanya identik dengan proses penggalian data-data yang cukup besar dan dikelompokkan menjadi data yang tersusun rapi. Prinsip dari customer profiling adalah pengambilan data input berupa kuisoner dari setiap pelanggan melakukan pembelian. Permasalahan yang terjadi saat ini perusahaan tersebut masih melakukan secara manual untuk mengetahui batik yang sering di beli serta stok barang yang ada di gudang. Dari permasalahan tersebut di buat sebuah aplikasi untuk pengelompokan data cutomer dan mengidentifikasi customer lebih tertarik pada model batik yang sering di beli customer dengan menggunakan Algoritma K-Mean. Sehingga akan terlihat kelompok data yang sama dan data yang berbeda untuk  mengoptimalkan persediaan barang yang diminati customer ketika berbelanja. Dari hasil pengujian dengan menggunakan metode K-Mean clustering untuk system profiling toko batik Madura pada cluster1, cluster2, cluster3 dan cluster4 memiliki kecendrungan memilih batik model gejeh se kerreng dan manok.', 'Eka Fitriadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100097'),
(562, '120411100098', 'PERANCANGAN SISTEM INFORMASI LAYANAN KESEHATAN PUSKESMAS PAMOLOKAN KABUPATEN SUMENEP BERBASIS WEB', 'Achmad Jauhari,ST. MT.', 'Eza Rahmanita, ST., MT.', 'ABSTRAK\nPuskesmas Pamolokan Kabupaten Sumenep yang menjadi salah satu pusat pelayanan kesehatandan saat ini masih dalam tahap pengembangan. Namun, di Puskesmas ini sering dijumpai calon pasien yangmerasa jenuh karena terlalu lama menunggu di bagian pendaftaran, hal tersebut disebabkan oleh pelayanan pada bagian pendaftaran masih dilakukan secara manual, yaitu dengan mencatat data pasien pada buku pendaftaran. Dengan sistem pelayanan yang masih manual, menyebabkan masalah dalam mendapatkan informasi tentang data pasien, data obat, dan data poli .Masalah yang terdapat pada sistem pelayanan kesehatan di Puskesmas Pamolokan adalah bagaimana merancang sistem informasi pelayanan pendaftaran dengan baik dan efisien. Membuat sistem pelayanan kesehatan berbasis web yang dapat membantu dan mempermudah pihak Puskesmas serta calon pasien dalam proses pendaftaran sampai melakukan proses selanjutnya. Dari permasalahan yang ada pada Puskesmas Pamolokan Kabupaten Sumenep dirancang sebuah aplikasi berbasis web yaitu “Perancangan Sistem Informasi Layanan Kesehatan Puskesmas Pamolokan Kabupaten Sumenep” yang nantinya diharapkan mampu memberikan solusi dari permasalahan yang ada di Puskesmas Pamolokan.\nKata kunci : Sistem Informasi, layanan kesehatan, puskesmas', 'ADI NUR MUHAMMAD', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100098'),
(563, '120411100099', 'SISTEM INFORMASI REKOMENDASI CUSTOMER BATIK MENGGUNAKAN ASSOSIATION RULE MINING', 'BAIN KHUSNUL KHOTIMAH,S.T.,M.Kom', 'RIKA YUNITARINI,S.T.,M.T', 'Ukm Batik Tresna Art Bangkalan memiliki Sistem Informasi data penjualan yang dapat mempermudah dalam rekapitulasi data keuangan. Namun data transaksi yang tercatat pada database system masih belum mampu diolah kembali secara maksimal. Hal ini dikarenakan belum adanya modul pengolahan kembali data transaksi sehingga hanya akan tertimbun dalam database system dan tidak menghasilkan kembali informasi danpengetahuan yang bermanfaat untuk meningkatkan penjualan.  Salah satu cara untuk memanfatkan data transaksi agar dapat meningkatkan penjualan dengan cara merekomendasikan suatu produkdengan teknik association rule mining dan menggunakan metode apriori.  Penentuan pola dan aturan pada assosiation rule dilakukan dengan menentukan nilai support dan confidence yang dihasilkan dari proses data transaksi, sehingga diketahui kaitan assosiation antar produk yang dibeli dan mempermudah konsumen untuk memilih produk batik yang akan dibeli.', 'ANDIKA PRASETYA PUTRA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100099'),
(564, '120411100100', 'IDENTIFIKASI ACUTE LYMPHOBLASTIC LEUKEMIA (ALL) BERDASARKAN FITUR\nBENTUK MENGGUNAKAN KLASIFIKASI NAIVE BAYES ', 'Dr.Arif Muntasa, S.Si.,M.T', '                       Dr.Indah Agustien, S.Kom., M.Kom', 'Leukimia atau kanker darah merupakan penyakit yang menyebabkan produksi sel darah\nputih berlebih dan tidak terkendali.Hal ini dapat menyebabkan aliran darah menjadi terganggu.\nDiagnosa leukimia melalui pemeriksaan darah lengkap atau dikenal dengan CBC (complete\nblood cell count) untuk mendeteksi sel darah putih yang tidak normal (blast cell). Prosedur\npemeriksaan yang ada saat ini tidak menyediakan catatan penelusuran diagnosa dan\nmembutuhkan waktu yang lama. Perlu adanya upaya dalam mengurangi waktu dan menyedikan\nkeperluan diagnosa medis yaitu dengan melakukan identifikasi leukemia berdasarkan\npengujian citra darah yang disemir yang melalui proses pengambilan gambar menggunakan\nmikroskop dengan teknik pengolahan citra.\nPenelitian ini bertujuan untuk mengklasifikasikan sel darah putih atau WBC (White\nBlood Cell) yang normal dan tidak normal untuk mengidentifikasi penyakit leukemia jenis\nAcute Lymphoblastic Leukemia (ALL) menggunakan metode klasifikasi Naive Bayes\nberdasarkan fitur bentuk. Sedangkan database yang digunakan adalah ALL-IDB2 yang terdiri\ndari 130 citra sel darah putih tidak normal (limfoblastik) dan 130 citra sel darah putih normal.\nHasil pengujian yang dilakukan menggunakan 130 data pelatihan memberikan akurasi paling\nmaksimal sebesar 83,1% .\nKata kunci: Leukemia, complete blood cell count ,Acute Lymphoblastic Leukemia\n(ALL),White Blood Cell, Klasifikasi Naive Bayes , fitur bentuk.', 'Anwar Fuadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100100'),
(565, '120411100101', 'Aplikasi UML Java Code Generator Menerapkan Design Pattern', 'Yonathan Ferry Hendrawan, S.T., M.I.T.', 'Moch. Kautsar Sophan, S.Kom., M.M.T.', 'Sebuah aplikasi “UML Java Code Generator” dapat membantu developer dalam proses menerjemahkan UML ke dalam bentuk tulisan program. Untuk merancang aplikasi dengan baik dan terstruktur sehingga rancangan aplikasi berkualitas dan dapat mudah dimengerti, maka diterapkan design pattern. Design pattern dapat meningkatkan skalabilitas dan maintainabilitas dari aplikasi. Design pattern yang diterapkan adalah composite pattern sebagai desain pola struktural dan command pattern sebagai desain pola behavioral. Hasil penelitian adalah: (1) penerapan command pattern pada aplikasi dapat mendukung fungsionalitas undo dan redo yang dapat memudahkan user dalam menggunakan aplikasi (2) penerapan composite pattern bermanfaat karena kebutuhan terhadap dua atau lebih subclass dapat diwakili oleh satu superclass.', 'Siti Isnaini A K', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100101'),
(566, '120411100102', 'PENGURANGAN DERAU SINYAL SUARA BERBASIS DFT DAN SMOOTHING ALGORITHM', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom.,M.Kom ', 'Suara adalah salah satu bentuk komunikasi untuk mendapatkan informasi. Suara direpresentasikan dalam bentuk gelombang longitudinal yang merambat melalui zat cair, padat, maupun gas. Derau (noise) merupakan sinyal gangguan yang berasal dari suara lain yang tidak diinginkan, menyebabkan  gangguan pada sinyal suara. Informasi yang disampaikan menjadi tidak jelas ataupun mengganggu kenikmatan hiburan yang didengarkan. Maka pengurangan derau (noise reduction) pada gelombang suara penting untuk dilakukan. Pengurangan noise gelombang suara biasanya menggunakan spectral subtraction method. Spectral subtraction method menggunakan discrete fourier transform (DFT) sebagai metode untuk representasi sinyal frekuensi. Untuk itu perlu memperbaikinya dengan windowing,framing dan smoothing algorithm. Perbaikan pada 720 data suara ber-noise UTDALLAS (The University of Texas at Dallas). Dan pengurangan noise gelombang suara menggunakan spectral subtraction. Berdasarkan hasil uji coba yang telah dilakukan DFT dengan teknik smoothing algorithm mampu meningkatkan kualitas SNR dengan rata – rata 3.57 dB.', 'Gabriel Juan Evangeli', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100102'),
(567, '120411100103', 'PEMODELAN SISTEM DINAMIK UNTUK MENINGKATKAN PROFIT PETANI GARAM', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Achmad Jauhari, S.T., M.Kom', ' Keuntungan  pada sebuah industri merupakan salah satu hal yang sangat penting bagi kemajuan industri tersebut. Tidak terkecuali industri garam . Masa panen garam yang  tidak menentu serta kualitas garam  yang tidak stabil merupakan salah satu kendala dalam industri garam Indonesia.  Kedua hal tersebut berpengaruh terhadap harga jual garam yang  juga tidak stabil, hal inI mengakibatkan keuntungan petani garam sebagai produsen garam tidak menentu bahkan cenderung menurun. Faktor-faktor yang mempengauhi keuntungan diantaranya adalah waktu panen, Harga jual garam, jumlah modal, jumlah stok garam, dan kualitas garam yang dihasilkan.Untuk meningkatakan keuntungan petani garam maka dilakukan analisis pemodelan sistem dinamik untuk meningkatkan profit petani garam.Sedangakan software yang digunakan adalah menggunakan aplikasi vensim. Berdasarkan hasil pemodelan sistem dinamik profit petani garam melalui skenario efisiensi biaya dapat meningkatkan profit sebesar 12,9% di dalam skenario optimistic. Sekenario penggunaan teknologi terbaru, yaitu penggunaan geo membrane dapat meningkatkan profit sebesar 199,56% pada skenario optimistic.', 'Rasminawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100103'),
(568, '120411100104', 'Klasifikasi Citra Mata Penderita Diabetic Retinopathy Menggunakan Simplify 2D-LDA', 'Indah Agustien S., S.Kom.,M.Kom.', 'Arif Muntasa, S.Si.,M.T.', 'Pendeteksian penyakit diabetic retinopathy telah dilakukan oleh berbagai peneliti dengan menggunakan machine learning berbasis image processing. Namun dalam prakteknya, citra yang seharusnya dideteksi sebagai ciri normal justru dianggap sebagai ciri penyakit. Sebagai contoh optic disc yang dideteksi sebagai lemak protein (eksudat). Oleh karena itu, peneliti-peneliti sebelumnya telah mengembangkan metode guna menghilangkan optic disc sebelum proses klasifikasi keparahan penyakit diabetic retinopathy agar akurasi yang didapat lebih tinggi. Proses untuk menghilangkan optic disc adalah mengeliminasi optic disc dari citra asli yang  telah ditempelkan dengan citra dari proses sebelumnya (segmentasi). Tahapan selanjutnya melakukan ekstraksi fitur untuk mendapatkan karakteristik citra. Pada penelitian ini, ekstraksi fitur yang digunakan metode simplify 2D-LDA yang merupakan penyederhanaan dari metode LDA. Perhitungan akurasi pada percobaan ini menggunakan similarity measurement ecludian distances. Dengan menggunakan metode ini, hasil yang didapatkan selama percobaan mencapai 50% menggunakan citra tanpa eliminasi optic disc  dengan perbandingan data antara data pelatihan dan pengujian sebesar 2:1.', 'Rahmawati Nurfitria', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100104'),
(569, '120411100105', 'Sistem Rekomendasi Pemilihan Tempat Kost Menggunakan Metode Simple Additive weighting (SAW) Berbasis Web', 'Moch. Kautsar S, S.Kom, M.MT.', 'Eza Eahmanita, S.T, M.T', 'Kemudahan dalam memperoleh informasi mengenai tempat kost sampai saat ini masih dirasa sulit oleh para pendatang misal mahasiswa dan pelajar yang membutuhkan tempat tinggal sementara. Sampai saat ini masih belum ada sistem yang mampu memberikan rekomendasi tempat kost sesuai dengan yang dicari oleh pencari kost. \nBeberapa kriteria dapat menjadi pilihan untuk menentukan tempat kost. Kriteria tersebut antara lain harga, lokasi, fasilitas dan periode pembayaran. Metode yang digunakan dalam penelitian ini adalah Simple Additive Weighting (SAW) sebagai metode pembobotan. Sistem juga teintegrasi dengan peta Google Maps untuk menampilkan lokasi tempat kost. Sistem rekomendasi pemilihan tempat kost ini dibangun dengan bahasa pemrograman berbasis web PHP dan MySQL sebagai databasenya. \nMasukan dari sistem ini berupa pilihan kriteria. Sedangkan hasil dari sistem rekomendasi ini adalah mampu memberikan rekomendasi pemilihan tempat kost yang diurutkan berdasarkan bobot tertinggi pada metode SAW. Pada pengujian fungsional didapatkan hasil sebesar 100%, yang membuktikan bahwa sistem berjalan dengan baik sesuai perancangan. Dan untuk pengujian akurasi didapatkan hasil sebesar 70%. Sehingga dapat disimpulkan bahwa metode Simple Additive Weighting (SAW) dapat digunakan untuk merekomendasikan tempat kost didaerah Telang Kamal Bangkalan\n\nKata kunci : Sistem rekomendasi, kost, Simple Additive Weighting (SAW), Google Maps.\n', 'Nurul Khomariyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100105'),
(570, '120411100106', 'SISTEM INFORMASI MANAJEMEN PRAKTIKUM\n(STUDI KASUS: TEKNIK INFORMATIKA UNIVERSITAS TRUNOJOYO MADURA)', 'Rika Yunitarini, S.T., M.T', 'Moch. Kautsar Sophan, S.Kom., M.MT', 'Praktikum merupakan kegiatan pembelajaran yang wajib bagi mahasiswa S1 Teknik Informatika yang bertujuan untuk menguji dan mengaplikasikan teori serta sebagai pembuktian ilmiah mata kuliah tertentu. Pada proses manajemen praktikum masih dilakukan secara manual, hal tersebut dapat menyita banyak waktu serta sering terjadinya kesalahan dalam penyajian informasinya. Sistem informasi manajemen praktikum dibangun dengan tujuan sebagai sistem yang mengelola pelaksanaan praktikum. Sistem dibangun menggunakan bahasa pemrograman php dengan framework LARAVEL dan postgreSQL sebagai database-nya.  Berdasarkan uji coba sistem dengan menyebarkan kuisioner maka didapatkan hasil bahwa 74.5% dengan adanya sistem informasi manajemen praktikum, membantu dalam merekapan dan mengelola data praktikum serta dalam mendapatkan informasi terkait dengan kegiatan praktikum', 'Iskandar Zulkarnain', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100106'),
(571, '120411100107', 'COMPUTERIZED ADAPTIVE TEST SEBAGAI EVALUASI BELAJAR SISWA ', 'Moch Kautsar sophan', 'Eza Rahmanita', 'Computerized Adaptive Test (CAT) merupakan bentuk pemanfaatan komputer untuk menyelenggarakan tes adaptif dimana soal-soal yang diberikan kepada siswa telah dipilih dari bank soal yang ada. Dalam tes adaptif, siswa yang mempunyai kemampuan tinggi akan diberikan soal-soal yang sulit. Sedangkan siswa yang mempunyai kemampuan rendah akan diberikan soal-soal yang mudah. Sehingga siswa yang pintar akan lebih tertantang, dan siswa yang kurang pintar tidak akan tertekan.\nTes adatif dimulai dari soal dengan tingkat kesulitan sedang. jika siswa bisa menjawab dengan benar, maka tingkat kesulitan soal akan dinaikkan ke tingkat sulit. sebaliknya jika siswa menjawab soal dengan salah, maka tingkat kesulitan siswa akan diturunkan ke tingkat kesulitan mudah.\nTes adaptif ini dapat dikatakan efektif untuk mengetahuai kemampuan siswa. hal ini terbukti dengan uji coba siswa dan hasil kuisioner yang menunjukkan penilaian rata-rata sebesar 4,1 dari nilai range antara 1 samai 5 dan masuk dalam kategori efektif\nKata Kunci : Computerized Adaptive Test (CAT).', 'Zuliati Khusnah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100107'),
(572, '120411100108', 'Rancang Bangun Sistem Informasi Bimbingan Konseling dan Pelanggaran Siswa', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Rika Yunitarini, S.T., M.T.', 'Bimbingan konseling berperan besar dalam proses pembentukan kepribadian dan mengasah kemampuan siswa di bidang akademik. Peran bimbingan konseling di sekolah bisa lebih maksimal apabila didukung dengan sistem pelayanan bimbingan konseling yang baik. Permasalahan yang masih umum ada adalah kurang lengkapnya ketersediaan data konseli yang dibutuhkan konselor dalam kegiatan pelayanan bimbingan konseling. Permasalahan tersebut dapat diminimalisir dengan adanya sebuah sistem yang bisa menampung dan menyediakan data kembali secara lengkap. Sehingga, dengan adanya sistem informasi bimbingan konseling dan pelanggaran siswa, diharapkan bisa memperbaiki kinerja sistem lama menjadi sistem yang terkomputasi, sekaligus meminimalisir kehilangan dan kerancuan data, serta dapat meningkatkan pelayanan bimbingan konseling di sekolah. Berdasarkan hasil uji coba fungsionalitas dan objektifitas sistem, secara keseluruhan dinilai bisa berjalan baik dengan nilai 7,90.\n\nKata kunci: Sistem Informasi, Bimbingan Konseling.', 'Heru Rohmadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100108'),
(573, '120411100109', 'Klasifikasi Diabetic Retinopathy Menggunakan Gray Level Cooccurence Matrix (GLCM)', 'Dr. Indah Agustien S, S.Kom.,M.Kom', 'Dr. Arif Muntasa, S.Si.,M.T', 'ABSTRAK\n\nSalah satu penyakit yang menyerang mata adalah Diabetic Retinopathy (DR), yang merupakan salah satu komplikasi yang disebabkan oleh penyakit diabetes. Gejala yang ditunjukkan dari penyakit ini adalah mikroneurisma, hemorrhages ,excudets dan neovascularos. Pendeteksian penyakit tersebut dilakukan dengan melihat informasi yang terdapat pada citra retina dan selanjutnya dapat diklasifikasi sesuai tingkat keparahan. Penelitian ini bertujuan untuk mengembangkan suatu metode yang dapat digunakan utuk mengklasifikasi Diabetic Retinopathy sesuai dengan tingkat keparahan. Proses klasifikasi terhadap tingkat keparahan dilakukan berdasarkan fiture – fiture pada citra retina yang diperoleh melalui proses ekstrasi fiture menggunakkan metode ekstrasi fiture Gray Level Cooccurence Matrix (GLCM). Fiture ciri tersebut adalah max probability, energy, entropy, autocorrelation, contrast. correlation,dan  homogeneity. Proses selanjutnya dilakukan mengklasifikasi dengan Manhattan  dan didapatkan hasil klasifikasi Diabetic Retinopahty. Hasil dari penelitian ini menghasilkan akurasi maksimal 51,67 %.\n\nKata Kunci : Diabetic Retinopathy, Gray Level Cooccurence Matrix (GLCM), Manhattan.\n', 'Iryani Tiara Arif', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100109'),
(574, '120411100110', 'Penerapan Gamification pada E-Learning Pembelajaran SQL', 'Rika Yunitarini,S.T.,M.T', 'Andharini Dwi C,S.Kom.,M.Kom', 'Penerapan e-learning di perguruan tinggi banyak memberikan manfaat bagi dosen dan mahasiswa. Dengan menerapkan e-learning dosen dapat melakukan pengajaran secara dinamis dan mahasiswa dapat belajar secara fleksibel tanpa tergantung pada tempat dan waktu. Namun, penggunaan e-learning dinilai masih belum efisien karena sistem yang terdapat dalam e-learning belum bisa memberikan hasil yang maksimal bagi mahasiswa karena mahasiswa hanya mengetahui kemampuanya secara personal saja tanpa mengetahui kemampuan mahasiswa lain, dan bagi dosen e-learning belum mampu menampilkan secara global  hasil yang telah dicapai oleh seluruh mahasiswa. Permasalahan tersebut dapat diselesaikan dengan menambah fitur e-learning yang menerapkan konsep gamification. Gamification merupakan konsep pembelajaran yang menerapkan konsep game kedalam proses belajar. Fitur yang ditambahkan pada e-learning berupa quiz, challenge dan latihan tutorial yang diberikan oleh dosen. Sistem dibangun dengan menggunakan LMS (Learning Management System) MOODLE sebagai  sistem e-learning mata kuliah SQL.  Dengan diimplementasikanya sistem ini dosen dapat dengan mudah mengetahui kemampuan seluruh mahasiswa sedangkan mahasiswa dapat mengetahui kemampuanya dibandingkan dengan kemampuan mahasiswa lain. Berdasarkan hasil ujicoba yang diterapkan, sistem secara keseluruhan dinilai bisa diterapkan dengan baik oleh mahasiswa dengan nilai 8,2 yang masuk kedalam kategori baik.', 'Azza Devi Manzilia', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100110'),
(575, '120411100111', 'Deteksi Optic Disc Citra Retina Berbasis Algoritma Differential Morphological Profile &#40;DMP&#41;', 'Dr.Arif Muntasa, S.Si.,M.T', 'Dr.Indah Agustien Siradjuddin, S.Kom.,M.Kom', 'Differential Morphological Profile &#40;DMP&#41; merupakan metode \nyang disarankan untuk proses deteksi Optic Disc (OD) pada citra fundus \nretina. Metode DMP yang digunakan pada penelitian ini adalah DMP \ndilasi. Pada metode ini, terjadi peningkatan ukuran structure element \nsebanyak delta pada proses dilasi disetiap iterasi yang terjadi. Citra yang \ndihasilkan dari metode ini berupa citra tepi daerah yang diduga sebagai \nOptic Disc (OD). Dibutuhkan empat tahap untuk mendapatkan daerah\nOD yang diharapkan. Tahap pertama adalah Gaussian Low Pass \nFiltering dan dilasi untuk preprocessing. Kedua, Differential \nMorphological Profile Dilation untuk mendapatkan tepi daerah OD dan \ndilanjutkan dengan proses perbaikan citra dengan contrast stretching\nserta otsu tresholding untuk proses binerisasi. Tahap ketiga adalah \nproses penghilangan noise dan pengambilan region of interest (ROI). \nKeempat adalah menemukan daerah optic disc dengan membentuk \nlingkaran berdasarkan titik pusat dan jari-jari yang didapatkan dari \nproses sebelumnya. Penelitian ini mengggunakan database INSPIRE-\nAVR yang terdiri dari 40 citra retina fundus berwarna dan 40 citra \ngroundtruth. Akurasi terbesar pada penelitian ini didapatkan pada iterasi \nbernilai 5 saat proses DMP Dilasi. Rata-rata sensitivity, specificity, dan \naccuracy terbaik yang didapatkan adalah 92.0340%, 98.1970%, dan \n95.1155%. Hal ini menunjukan bahwa metode DMP Dilasi sangat baik \ndigunakan untuk deteksi optic disc dibandingkan dengan metode \nMorphology. \nKata Kunci: Differential Morphological Profile &#40;DMP&#41;. Dilasi, Deteksi \nOptic Disc, Sensitivity, Specificity, Accuracy.', 'Siti Nur Avivah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100111'),
(576, '120411100112', 'RANCANG BANGUN APLIKASI PENCATAT STATISTIK PERTANDINGAN BULUTANGKIS SECARA REALTIME DENGAN MENGGUNAKANAJAX JQUERY', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Yoga Dwitya Pramudita, S.Kom., M.CS', 'Data statistik pada pertandingan bulutangkis dapat menunjukkan performa seorang pemain yang bertanding. Data stastistik bulutangkis yang ada pada saat ini hanya menampilkan penghitungan skor saja tanpa dapat menganalisa data statistik mengenai kemampuan performa seorang pemain. Pencatatan pada moment yang terjadi dalam pertandingan tersebut masih dilakukan dengan menggunakan kertas dan pensil. Sehingga tidak bisa menyajikan data statistik secara realtime. Oleh karena itu diperlukan sebuah sistem yang dapat mencatat dan menganalisa performa seorang pemain.  Jenis pukulan yang dicatat adalah servis, smash, lob, dropshot, netting, drive,bachand, return smash dan pukulan akrobatik. Dengan adanya penelitian ini menghasilkan suatu aplikasi yang dapat menampilkan skor pertandingan sekaligus dapat menganalisa efektifitas dan akurasi jenis pukulan secara realtime. Berdasarkan pengujian didapat kecepatan aplikasi dalam merekam jenis pukulan mampu merekam 2 pukulan perdetik. ', 'Ferdian Hermanto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100112'),
(577, '120411100113', 'IDENTIFIKASI ACUTE LYMPHOBLASTIC LEUKEMIA MENGGUNAKAN BACKPROPAGATION BERBASIS FITUR BENTUK', 'Dr. Arif Muntasa, S.Si.,M.T', 'Dr. Indah Agustien, S.Kom., M.Kom', 'Leukemia adalah salah satu jenis kanker yang sangat berbahaya. Kanker ini menyerang sel darah  dan sumsum tulang belakang. Salah satu jenis leukemia adalah Acute Lymphoblastic Leukemia (ALL). ALL biasanya menyerang anak-anak. Saat ini untuk mengidentifikasi penyakit ALL masih dilakukan secara manual. Hal ini membuat kurang effisennya waktu dan hasil yang didapatkan. Oleh karena itu, dibutuhkan suatu sistem dapat melakukan identifikasi penyakit leukemia dengan cepat dan hasil yang baik. Di penelitihan ini dilakukan klasifikasi sel darah putih yang normal dan tidak normal untuk mengidentifikasi penyakit Acute Lymphoblastic Leukemia (ALL). Proses awal adalah melakukan segmentasi berbasis HSV Color Space untuk memisahkan sel darah putih dari latar. Proses selanjutnya adalah ekstraksi fitur berdasarkan Fitur Bentuk sel darah putih. Sedangkan untuk proses klasifikasinya menggunakan Jaringan Saraf Tiruan Backpropagation. Database citra yang digunakan adalah ALL-IDB2 yang berisi 260 citra sel darah putih, dengan 130 kandidat limfoblastik (Positif ALL). Pengujian pada penelitian ini mengahasilkan akurasi terbaik sebesar 66,9% dengan menggunakan 130 data pelatihan.', 'Moh. Abd. Kholiq', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100113'),
(578, '120411100114', 'Klasifikasi Tingkat Diabetic Retinopathy Berbasis Hybrid Method Menggunakan Backpropagation Neural Network', 'Dr. Arif Muntasa, S.Si. M.T.', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom', 'Kencing manis merupakan salah satu penyakit yang menyebabkan sebuah komplikasi penyakit Diabetic Retinopathy (DR) pada pasien. Dalam penelitian ini seorang pasien akan digolongkan kedalam empat tingkatan, yaitu normal atau sehat, Moderate non-proliferative diabetic retinopathy (NPDR), severe non-proliferative diabetic retinopathy (NPDR) dan proliferative diabetic retinopathy (PDR). Penelitian ini diawali dengan tahap prepocessing, dimana sebuah citra input  akan dikenai segmentasi dan eliminasi pada blood vessel dan optic disc, dua objek yang tidak diperlukan dalam proses ekstraksi. Tahapan selanjutnya adalah ekstraksi fitur, citra yang sudah bersih dari dua objek tersebut akan di ekstraksi untuk diambil informasi pentingnya (fitur) menggunakan hybrid method yaitu gabungan fitur dari metode ekstraksi glcm dan glrlm. Dari hasil ekstraksi ini, sebuah citra dapat diklasifikasikan melalui fitur-fiturnya menggunakan algoritma jaringan saraf tiruan kedalam empat tingkatan. Penelitian ini menghasilkan perbandingan rerata akurasi tertinggi terhadap tiga metode ekstraksi fitur. Perbandingan rerata nilai akurasi tertinggi glcm, glrlm dan  hybrid terjadi pada skenario 2 dengan nilai berturut-turur sebesar 39,35%, 54,26% dan 46,86%. Jadi, dalam kasus ini metode glrlm lebih cocok dari pada metode  hybrid.', 'Agus Dian Saputro', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100114'),
(579, '120411100115', 'VIRTUAL REALITY SEBAGAI MEDIA PENGENALAN BENDA BERSEJARAH\n(Studi Kasus: Museum Cakraningrat)', 'ARI KUSUMANINGSIH S.T., M.T.', 'CUCUN VERY ANGKOSO S.T.,M.T.', 'Museum Cakraningrat menyimpan banyak benda peninggalan sejarah dari keajaan-kerajaan yang ada di madura. Gedung yang berdiri sejak 1997 ini kurang menarik perhatian pengunjung dikarenakan terletak dideretan kantor pemerintahan Bangkalan, tepatnya jl. Soekarno-Hatta. Padahal keberadaan museum ini sangat penting untuk menjaga nilai-nilai sejarah madura dan sebagai sarana komunikasi dari dari generasi ke generasi selanjutnya.\nOleh karena itu, penelitian ini mencoba untuk membuat cara baru memperkenalkan Museum Cakraningrat dengan memanfaatkan teknologi Virtual Reality (VR). Dengan adanya VR Museum Cakraningrat ini, masyarakat dapat menjelajahi lingkungan museum untuk melihat koleksi benda peninggalan sejarah didalamnya melalui smartphone berbasis android. \nHasil dari penelitian ini adalah: (1) Aplikasi VR Museum Cakraningrat berhasil dibuat menggunakan Blender untuk model 3D sedangkan implementasi VR interaktif menggunakan Unity 3D game engine. (2) Aplikasi VR Museum cakraningrat dapat digunakan untuk menjelajah museum dan pengguna dapat mengenal nama koleksi benda peninggalan sejarah dengan melihat informasi benda tersebut. (3) Hasil kuesioner juga membuktikan bahwa lebih dari 90% pengguna merasa terbantu untuk mengenal benda sejarah koleksi museum sehingga manfaat dari VR Museum Cakranigrat sebagai media pengenalan terpenuhi.  (4) Secara keseluruhan, 80% total responden menilai baik dari segi tampilan maupun fungsionalitas pada aplikasi VR Museum Cakraningrat.\n', 'ABDUL AZIZ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/120411100115');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(580, '130411100001', 'PENERAPAN METODE LEARNING VECTOR QUANTIZATION UNTUK KLASIFIKASI KONDISI FISIK PADA PEMAIN VOLI', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Bola voli dapat dikatakan sebagai salah satu olahraga yang mempunyai gerakan–gerakan kompleks. Seorang pemain voli harus bekerja keras untuk meningkatkan kemampuannya dengan salah satunya pada kondisi fisik. Dalam menentukan kondisi fisik dapat memanfaatkan komputer sains dalam memberikan solusi dan pendukung keputusan terhadap pemain voli. Dengan menerapkan metode learning vector quzntization dapat mengklasifikasi kondisi fisik seorang pemain voli. Metode learning vector quantization sendiri merupakan metode klasifikasi Supervised Learning. Dengan adanya sistem ini dapat membantu pelatih untuk mengetahui dan memberikan porsi latihan terhadap pemain yang mempunyai kondisi fisik yang dibagi beberapa kategori yaitu baik sekali, baik, cukup, kurang, dan kurang sekali sehingga penentuan kondisi fisik pemain lebih cepat. Hasil akurasi yang diperoleh klasifikasi kondisi fisik pada pemain bola voli menggunakan metode learning vector quantization yaitu 95% dengan alpha 0,1 sampai 0,5 dan epoch 5 sampai 40 yang didapatkan dari hasil perbandingan perhitungan manual dengan hasil klasifikasi sistem.\nKata kunci : Klasifikasi, Kondisi Fisik, Learning Vector Quantization.', 'Moh. Sahiruddin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100001'),
(581, '130411100006', 'Sistem Rekomendasi Ukuran Pakaian pada Aplikasi Ruang Ganti Virtual Berdasarkan Skeleton Tracking dan Rigging', 'Arik Kurniawati, S.Kom.,M.T', 'Ari Kusumaningsih, S.T.,M.T.', 'Bisnis pakaian di era modern ini berkembang seiring dengan perkembangan teknologi, terlihat dari banyaknya pusat perbelanjaan yang dimana di dalamnya terdapat beberapa toko pakaian. Banyaknya toko pakaian yang ada, membuat para pemilik toko bersaing memberikan inovasi yang bisa menarik minat calon pembeli untuk membeli produk mereka misalkan memberikan promo atau potongan harga agar calon pembeli tertarik. Semakin banyak calon pembeli yang tertarik dan berkunjung untuk mencoba pakaian, bisa menyebabkan antrian pada ruang ganti yang biasanya dalam jumlah terbatas. Oleh karena itu, teknologi pada sensor Kinect dan Augmented Reality menjadi salah satu solusi tepat untuk mengatasi permasalahan tersebut. Dengan penggunaan sensor Kinect dapat diukur estimasi ukuran lebar punggung manusia yang dapat dijadikan acuan dalam memilih ukuran baju yang sesuai. Sedangkan melalui teknologi Augmented Reality, pakaian direpresentasikan menjadi obyek virtual yang dapat ditambahkan ke tubuh pengguna tanpa harus mencoba pakaian secara langsung. Dari hasil penelitian ini, akurasi rata-rata dari sistem untuk merekomendasikan pakaian sebesar 75 %, sedangkan sistem akan optimal dalam memberikan rekomendasi sebesar 86 % pada ketinggian Kinect 75 cm dan jarak Kinect dengan user 200 cm, 225 cm dan 250 cm. Survei User Experience dengan Skala Likert berada pada angka 83,9 % yang menunjukkan bahwa pengguna puas dengan hasil dari penelitian ini. ', 'Yanuar Aliffio', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100006'),
(582, '130411100007', 'IDENTIFIKASI ACUTE LYMPHOBLASTIC LEUKEMIA PADA CITRA SEL DARAH MIKROSKOPIS MENGGUNAKAN SEGMENTASI FUZZY C-MEANS DAN KLASIFIKASI NAIVE BAYES', 'Dr.Arif Muntasa, S.Si.,M.T', 'Dr.Indah Agustien Siradjuddin. S.Kom., M.Kom', 'Pada Proses identifikasi Leukemia ada beberapa masalah yang terjadi yaitu lamanya proses atau prosedure dimana memakan waktu yang lama sehingga membuat proses identifikasi tidak efisien. Dengan adanya permasalahan tersebut maka akan diselesaikan menggunakan metode Naive Bayes sebagai proses klasifikasi. Algoritma pengolahan citra yang digunakan adalah contras stretching dengan menggunakan metode Fuzzy c-means (FCM) sebagai proses segmentasi dan ekstraksi ciri menggunakan Gray Level Cooccurence Matrix (GLCM) dengan menggunakan 6 fitur GLCM berdasarkan sudut 0°, 45°, 90° dan 135°. Tujuan dari penelitian ini adalah mengimplementasikan Algoritma Naive Bayes sebagai klasifikasi leukemia apakah termasuk ALL_positif atau ALL_negatif dan mengetahui hasil akurasi dari sistem yang dibuat.\nPada proses pengujian digunakan 260 citra yaitu 130 ALL-Positif dan 130 ALL-Negatif. Hasil penelitian menunjukkan bahwa klasifikasi berdasarkan ekstraksi fitur GLCM mendapat akurasi sebesar 78% dalam mengklasifikasi sel darah putih.\n', 'Dyah Ayu Ekowati Saputri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100007'),
(583, '130411100008', 'Implementasi Arsitektur Model View Controller Pada Sistem Pelayanan Administrasi Kependudukan', 'Iwan Santosa, S.T.,M.T', 'Eza Rahmanita, S.T., M.T', 'Pelayanan administrasi kependudukan di Kantor Kecamatan Kamal saat ini masih menggunakan cara manual. Hal ini menyebabkan proses pelayanan administrasi yang ada di Kantor Kecamatan Kamal belum bisa berjalan secara efisien. Oleh karena itu, dibutuhkan sebuah aplikasi Sistem Pelayanan Administrasi Kependudukan berbasis web yang dibangun dengan arsitektur Model View Controller menggunakan Framework Codeigniter. Dengan menggunakan arsitektur MVC ada beberapa keuntungan diantarannya pengembangan perangkat lunak mudah untuk dilakukan perbaikan. Dengan menggunakan arsitektur MVC dapat membawa perubahan yakni mempermudah pada proses pelayanan kependudukan dikecamatan Kamal, dan juga dapat mempersingkat  waktu proses pelayanan sehingga dapat mengurangi penumpukan antrian selain itu juga dapat mempermudah admin di kantor kecamatan pada proses pencarian data penduduk yang bertempat tinggal di kecamatan Kamal. Hasil penelitian menunjukkan bahwa implementasi MVC pada aplikasi sistem pelayanan administrasi kependudukan dapat mudah digunakan dan dikembangkan kembali.\nKata Kunci : Sistem Informasi, Administrasi Kependudukan, Aplikasi Berbasis Web, MVC, Codeigniter\n', 'Dina Mariyanti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100008'),
(584, '130411100009', 'APLIKASI TATA KELOLA ADMINISTRASI PENDUDUK BERBASIS\nHIRARCHICAL MODEL VIEW CONTROLLER\n(Implementasi Peraturan Menteri Dalam Negeri No 47 Tahun 2016)', 'Mula’ab,S.Si.,M.Kom', 'Wahyudi Agustiono,S.Kom.,M.Sc,.Ph.D', 'Kegiatan pencatatan data administrasi penduduk oleh pemerintahan desa sering dihadapi masalah seperti, hilangnya data, pengisian data yang salah, dan sulitnya proses pencarian data. Hal ini dikarenakan proses pencatatanya dibagi dalam lima buku yaitu, buku Induk Penduduk, buku Mutasi Penduduk Desa, buku Rekapitulasi Jumlah Penduduk, buku Penduduk Sementara; dan buku Kartu Tanda Penduduk dan buku Kartu Keluarga, serta dalam pengelolaanya selama ini, masih menggunakan cara manual. Untuk mengatasi masalah tersebut, diperlukan sebuah aplikasi yang dapat mengatasi permasalahan dan kerumitan dalam proses pencatatan administrasi penduduk. Teknologi/konsep Hierarchical Model View Controller dipilih, karena mempermudah dalam pengembangan aplikasi dan penyatuan dari beberapa buku administrasi penduduk, berdasarkan PERMENDAGRI No. 47 Tahun 2016. Penerapan HMVC tersusun dari beberapa modul MVC. Pada administrasi penduduk konsep Hierarchical diterapakan pada setiap sub buku administrasi penduduk, dimana dalam sub terdapat konsep MVC. Dari ujicoba aplikasi pengelolaan administrasi penduduk, berbasis HMVC didapat kesimpulan, bahwa aplikasi ini, sesuai dengan permendagri no. 47 tahun 2016 dalam penerapan konsep HMVC. Sehingga, mempermudah proses administrasi penduduk dan pengembangan aplikasi kedepannya.', 'Ivan Iswahyudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100009'),
(585, '130411100010', 'PENERAPAN METODE FUZZY  C-MEAN CLUSTERING UNTUK PENGELOMPOKAN DATA USAHA MIKRO', 'Mula\'ab Ssi., M.Kom', 'Eza Rahmaniita S.T.,M.T', 'Di Dinas Koperasi dan UMKM  kabupaten Bangkalan mempunyai banyak data diantaranya data aset, data omset, jumlah tenaga kerja,jenis kegiatan usaha,nama pemilik  usaha, dan tahun berdiri usaha tersebut dengan nilai yang berbeda. Dari permsalahan tersebut untuk memperoleh hasil pengelompokkan data usaha  mikro yang tepat maka di perlukan adanya sebuah clustering dengan menggunakan metode Fuzzy C-Means,tujuan dari penelitian ini adalah mengelompokkan data usaha mikro berdasarkan data aset, omset dan jumlah tenaga kerja.Pada proses pengujian digunakan 300 data usaha mikro. Hasil dari penelitian menunjukkan bahwa clustering berdasarkan metode Fuzzy C-Means mendapatkan 8 cluster dengan nilai sillhoutte 0,4314\nKata kunci :  Clustering , Fuzzy C-Mean Clustering , Usaha Mikro\n', 'Evi Sulistiyana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100010'),
(586, '130411100011', 'IMPLEMENTASI MODIFIKAS KUNCI KRIPTOGRAFI RC6 YANG DIFUNGSIKAN DENGAN BLUM BLUM SHUB PADA DIGITAL IMAGE', 'Dwi Kuswanto, S.Pd., MT', 'Mula’ab, S.Si., M.Kom.', 'Image merupakan suatu media yang memberikan informasi lebih banyak dari pada informasi yang disajikan dalam bentuk tulisan. Oleh karena itu maka diperlukan aplikasi untuk mengamankan sebuah image sehingga image tidak dapat dilihat oleh yang tidak berhak melihat. Salah satu aplikasi pengamanan tersebut yaitu menggunakan kriptografi dengan metode RC6. Inputan berupa digital image, kemudian image dienkripsi dan didekripsi menggunakan algoritma RC6 biasa, dan selanjutnya dilakukan proses enkripsi dan dekripsi sebagai pembanding dengan menggunakan algoritma RC6 dengan kunci yang telah dimodifikasi. Kunci yang dimodifikasi yakni kunci yang difungsikan dengan Blum Blum Shub. Algoritma RC6 dengan menggunakan kunci biasa memiliki performansi yang baik, terlihat dari nilai Avalanche Effect sebesar antara 49.9167 % dan nilai Avalanche Effect dari modifikasi kunci RC6 yaitu 50.0808 %. Rata-rata waktu enkripsi-dekripsi pada kunci biasa RC6 sebesar 0.8086542 dan 0.7348798 detik dan rata-rata waktu enkripsi-dekripsi modifikasi kunci RC6 yaitu 0.695695 detik dan 0.6764988 detik. Sedangkan  rata-rata PSNR kunci biasa RC6 yang dihasilkan yaitu 8.24174 dan PSNR modifikasi kunci RC6 yaitu 8.08961. Secara umum bahwa Avalanche Effect dan waktu enkripsi dan dekripsi pada modifikasi kunci RC6 lebih baik dari RC6 biasa sebesar 0.1641 % dan  enkripsi-dekripsi 0.1129592 detik dan 0.058381 detik .Sedangkan performa PSNR lebih baik menggunakan kunci RC6 biasa.\nKata kunci: Image, kriptografi, RC6, Blum Blum Shub, lama waktu proses, Avalanche Effect, PSNR\n', 'JAUHAR SAFRAINI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100011'),
(587, '130411100014', 'RESTful WEB SERVICE UNTUK APLIKASI PENERJEMAH BAHASA BILINGUAL MADURA DAN INDONESIA PADA PERANGKAT ANDROID', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Aplikasi penerjemah bahasa bilingual Indonesia Madura berbasis web telah tersedia di madura.web.id. Tidak cukup pada web tersebut perlu adanya sebuah sistem penerjemah Bahasa billingual Madura Indonesia yang dapat berjalan pada semua platform dan dapat digunakan oleh pengembang-pengembang aplikasi lain untuk menggunakan sistem terjemahan ini sehingga pembelajaran Bahasa Madura bisa menjadi lebih berkembang.  Salah satunya adalah aplikasi penerjemah pada perangkat android karena paltform android paling banyak digunakan oleh pengguna smartphone. Untuk membangun sistem penerjemah yang bisa digunakan oleh semua platform termasuk android adalah dengan membuat web service. Web service adalah standar dan sebuah metode pemrograman untuk membagikan data antar beberapa aplikasi. Arsitektur yang sangat baik digunakan adalah RESTful Web Service karena lebih ringan dan cepat. Sedangkan untuk format teks yang digunakan untuk pertukaran data adalah format JSON yang lebih mudah di encoding maupun di decoding oleh perangkat mobile. Berdasarkan hasil pengujian, waktu response untuk penerjemah bahasa bilingual Madura dan Indonesia pada perangkat android, penggunaan web service lebih cepat dibandingkan dengan sistem penerjemah  pada website yang telah ada, berdasarkan hasil pengujian pada jaringan 2G rata-rata waktu response web service lebih cepat 31% dibanding dengan website, pada jaringan 3G lebih cepat 77% dan pada jaringan 4G lebih cepat 73%.\nKata Kunci : RESTful API, web service, JSON, Terjemahan Madura Indonesia', 'Rizal Nurman Wahyudi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100014'),
(588, '130411100015', 'PENERAPAN ARSITEKTUR MODEL VIEW CONTROLLER PADA MANAGEMENTINVENTORY LOGISTICRUMAH SAKIT\n( STUDI KASUS : RSUD dr. H. SLAMET MARTODIRDJO PAMEKASAN )\n', 'Iwan Santosa, S.T., M.T ', ', EzaRahmanita, S.T., M.T', '      Sistem pengendalian persediaan barang  (inventory logistic) merupakan suatu sistem untuk mengetahui stock opname persediaan barang pada suatu tempat. Karena terdapat beberapa masalah, yaitu adanya kesulitan dalam mengetahui informasi permintaan, penerimaan, pemakaian, dan stok barang habis pakai (BHP) . Hal ini disebabkan data belum tersimpan dalam file yang baik dan pengelolaan data persediaan BHP masih dilakukan secara manual (kartu persediaan barang), dalam proses persedian barang di gudang menjadi single user dalam melakukan stock opname persediaan BHP tidak dapat digunakan untuk multiusers sehingga bagian pelayanan dan Kepala Logistik tidak dapat langsung bisa mengakses laporan stock opname BHP. Permasalahan seperti ini memerlukan sebuah sistem yang terkomputerisasi dan berbasis web. \n\n     Metodologi pengembangan sistem yang digunakan dalam penelitian ini adalah dengan metode waterfall (Siklus Air Terjun) yang meliputi, analisa dan rekayasa sistem, analisis kebutuhan, perancangan, pemrograman, pengujian dan pemeliharaan. Sistem Manajemen Inventory Logistic telah dirasa tepat hal ini dapat dilihat pada kepuasan pengguna dengan nilai survei rata-rata adalah sebesar 7,88 dan uji coba sistem yang dapat berjalan dengan baik. Aplikasi ini secara signifikan dapat menyederhanakan alur kerja distribusi barang dan pembuatan laporan distribusi barang di lingkungan RSUD. dr. H. Slamet Martodirdjo. \nKata Kunci : Inventory, Stock Opname, BHP (Barang Habis Pakai)\n', 'Firman Kurniawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100015'),
(589, '130411100019', 'PENERAPAN KONSEP MVC (MODEL VIEW CONTROLLER) PADA APLIKASI MONITORING KEGIATAN ASRAMA', 'Firdaus Solihin, S.Kom., M.Kom.', 'Ach. Khozaimi, S.Kom., M.Kom.', 'Proses monitoring kegiatan yang ada di asrama pada saat ini masih manual. Dari proses manual tersebut ketika pengelola meminta data – data  kegiatan yang sudah dilaksanakan di asrama kepada musahhil, maka musahhil harus mencari data sehingga membutuhkan waktu yang cukup lama.  Oleh karena itu dibutuhkan suatu aplikasi yang dapat mengatasi permasalahan - permasalahan tersebut. Aplikasi yang akan digunakan adalah dengan  menerapkan konsep  MVC (Model, View Controller) menggunakan Framework Codeigniter. MVC adalah suatu konsep dimana untuk mengembangkan suatu aplikasi website yang  memisahkan  presentasi logic dengan tampilannya yang diatur  oleh controller. Diharapkan dengan adanya aplikasi monitoring kegiatan asrama dengan konsep MVC (Model, View, Controller)  ini seluruh kegiatan asrama dapat terpantau dengan baik dan mudah. Selain itu berdasarkan hasil kuisioner yang telah dilakukan di asrama  menunjukkan persentase kesesuaian dan penilaian aplikasi sebesar 100% dapat disimpulkan bahwa aplikasi monitoring kegiatan asrama masuk dalam kategori baik dan layak untuk diimplementasikan.  \n\nKata Kunci : Monitoring, Asrama Mahasiswa, Framework Codeigniter MVC (Model, View, Controller).\n', 'Inayatul fadilah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100019'),
(590, '130411100021', 'PENERAPAN KONSEP MODEL VIEW CONTROLLER PADA PEMBUATAN APLIKASI REGISTRASI ASRAMA', 'Firdaus Solihin, S.Kom., M.Kom.', 'Ach. Khozaimi, S.Kom., M.Kom.', 'Proses registrasi Asrama saat ini membutuhkan waktu dan tenaga yang banyak serta proses rekap data yang belum terorganisir dengan baik. Aplikasi registrasi asrama dibuat untuk mengatasi masalah tersebut. Aplikasi ini dibangun dengan menerapkan konsep Model View Controller (MVC) yang memisahkan antara desain, data dan proses. Hasil penelitian ini menunjukkan bahwa  penerapan konsep MVC pada  aplikasi registrasi asrama dapat memudahkan developer dalam pembangunan aplikasi. Selain itu berdasarkan hasil perhitungan kuisioner yang telah dilakukan dari 6 jenis responden, dapat disimpulkan bahwa rata-rata presentase ketercapaian sistem yaitu sebesar 99.57%  menyatakan sesuai dan 0.42%  menyatakan tidak sesuai.', 'Fitria Najatul Laili', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100021'),
(591, '130411100023', 'RANCANG BANGUN APLIKASI RUANG GANTI VIRTUAL MENGGUNAKAN METODE EUCLIDEAN DISTANCE', 'ARIK KURNIAWATI S.KOM.,M.KOM.', 'CUCUN VERY ANGKOSO S.T.,M.T.', 'Fashion merupakan kebutuhan pokok bagi setiap orang. Semakin berkembangnya fashion saat ini dipengaruhi oleh banyaknya inovasi-inovasi yang diberikan toko dalam menjual pakaian untuk menarik minat pelanggan. Salah satunya adalah memberikan fasilitas kamar ganti kepada pelanggan, agar pelanggan dapat mencoba pakaian yang akan dibelinya. Namun, ternyata ada beberapa permasalahan yang terjadi yang dikeluhkan pelanggan, semisal : antrian kamar ganti yang panjang, keterbatasan tempat dan membautuhkan waktu lama jika pelanggan harus mencoba 2 atau 3 baju dengan model baju yang sama hanya untuk menentukan ukuran baju yang pas.\nDari permasalahan tersebut munculah teknologi tentang kamar ganti virtual yang banyak dikembangkan oleh beberapa perusahaan fashion. Dalam penelitian ini membahas tentang salah satu metode untuk mengimplementasikan teknologi kamar ganti virtual yang akan menggunakan hardware kinect dan  teknologi Augmented Reality. Pemanfaatan fitur yang didapat dari kinect (yaitu : data skeleton user) untuk mendapatkan lebar badan pelanggan yang digunakan sebagai penentuan ukuran pakaian. Metode yang digunakan dalam penelitian ini untuk menghitung lebar badan pelanggan adalah menggunakan  Euclidean distance. Hasil eksperimen tehadap 20 pengguna menunjukan bahwa tingkat akurasi sistem mencapai kami 80% dalam memberikan rekomendasi ukuran pakaian yang sesuai dengan ukuran yang sebenarnya dari pelanggan.\n', 'REZKY RIZALDI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100023'),
(592, '130411100024', 'APLIKASI TATA KELOLA ADMINISTRASI UMUM BERBASIS HIRARCHICAL MODEL VIEW CONTROLLER\n (Implementasi Peraturan Menteri Dalam Negeri No 47 Tahun 2016)', 'Mula’ab,S.Si.,M.Kom', 'Eza Rahmanita, S.T., M.T', 'Dalam pengelolaan administrasi umum masih ditemui beberapa masalah seperti hilangnya data, ketika input data, dan sulitnya ketika melakukan pencarian data. Hal ini di karenakan pencatatan datanya masih menggunakan cara manual. Dari masalah-masalah yang ada di administrasi umum, perlu adanya aplikasi agar masalah tersebut dapat teratasi.  Untuk mempermudah pengembangan dan penggabungan buku-buku dalam administrasi umum, aplikasi ini menggunakan konsep Hierarchical Model View Controller. Penerapan HMVC membuat aplikasi menjadi lebih modular karena tersusun dari modul-modul MVC untuk setiap buku. Dari hasil ujicoba aplikasi pengelolaan administrasi umum dengan menggunakan HMVC didapat kesimpulan, bahwa aplikasi ini sesuai dengan standart user dan standart developer. Sehingga, aplikasi ini mempermudah pengelolaan administrasi umum dan dengan HMVC mempermudah pengembangan aplikasi.', 'Abdul Suroso', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100024'),
(593, '130411100029', 'PENERAPAN ALGORITMA CLUSTERING LARGE APPLICATIONS BASED ON RANDOMIZED SEARCH (CLARANS) DENGAN UNWEIGHTED CLUSTER BASED LOCAL OUTLIER FACTOR (UNWEIGHTED -CBLOF) UNTUK DETEKSI OUTLIER PADA DATA CITRA', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom.', 'Dr. Arif Muntasa, S.Si., M.T. ', 'Deteksi outlier merupakan salah satu penelitian yang penting dengan tujuan mencari data yang memiliki karakteristik yang berbeda dengan kebanyakan data lainya. Data outlier yang ada di  dataset akan mempengaruhi terhadap hasil dari proses selanjutnya seperti clustering dan klasifikasi dan terkadang outlier juga menyimpan informasi yang penting. Penelitian ini dimulai dengan pemotongan daerah penting pada citra yang dilakukan secara manual. Setelah mendapatkan citra dari proses sebelumnya, kemudian dilakukan ektraksi fitur warna dengan perhitungan statistik orde pertama yaitu mean, standard deviation, kurtosis dan skewness dan ektraksi fitur tekstur menggunakan algoritma Grey Level Co-Occurrence Matrix (GLCM) dengan jarak 1 dan sudut 0o dengan fitur yang  digunakan yaitu Angular Second Moment, Contras, Inverse Different Moment, Cluster Shade, dan Cluster Prominence. Setelah didapatkan fitur-fitur setiap citra kemudian dilakukan clustering dengan menggunakan Algoritma Clustering Large Applications Based on Randomized Search (CLARANS). Setelah proses clustering kemudian dilakukan deteksi outlier dengan menggunakan Algoritma unweighted-CBLOF. Dataset yang digunakan pada penelitian  ini adalah dataset Supermarket Produce dengan jumlah 2633 citra sebagai data normal dan data outlier sebanyak 50 diambil dari dataset Fruit Images. Hasil dari penelitian ini didapatkan fitur yang terbaik untuk deteksi outlier yaitu menggunakan fitur tekstur Grey Level Co-Occurrence Matrix (GLCM) dengan nilai akurasi sebesar 85,612 % dan penentuan jumlah kelas pada  Clustering Large Applications Based on Randomized Search (CLARANS) yang semakin meningkat belum tentu meningkatkan nilai akurasi, sehingga perlu dilakukan uji coba dengan beberapa jumlah kelas untuk mencari nilai akurasi yang paling tinggi.', 'Mochammad Sodiqin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100029'),
(594, '130411100031', 'SELEKSI FITUR DENGAN PARTICLE SWARM \nOPTIMIZATION PADA TIME AND FREQUENCY\nDOMAIN UNTUK DETEKSI EPILEPSI BERBASIS\nELECTROENCEPHALOGRAM\n', 'Dr.Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S.,S.Kom.', 'Epilepsi atau ayan adalah sebuah penyakit neurologi yaitu penyakit yang menyerang saraf otak. Penyakit ini menyebkan neuron pada otak mengeluarkan listrik yang berlebihan sehingga mengganggu saraf motorik. Dengan memanfaatkan data dari Elektroensefalogram (EEG) yang merupakan teknik untuk mengukur aktivitas kelistrikan pada otak dengan memasang elektoda disekitar kulit kepala, maka dapat membantu dalam mendiagnosa penderita epilepsi.\nPenelitian ini bertujuan untuk mengklasifikasi hasil dari proses perekaman sinyal EEG untuk mendeteksi epilepsi. metode yang digunakan adalah time and frequency domain untuk proses ekstraksi fitur, Particle Swarm Optimization untuk ekstraksi fitur dan mahalonubis untuk klasifikasi. Data yang digunakan didapat dari Bern-Barcelona EEG database dengan jumlah keseluruhan data 3750 percobaan untuk 5 individu. Hasil dari penelitian ini didapatkan akurasi sebesar 78.67% dengan menggunakan 60% data sebagai data pelatihan dan menggunakan metode PSO untuk seleksi fitur.\n', 'Ade Sedayu', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100031'),
(595, '130411100036', 'Pengembangan Aplikasi Manajemen Skripsi', 'Sigit Susanto Putro S.Kom., M.Kom', 'Ach. Khozaimi S.Kom., M.Kom', 'Skripsi merupakan hal yang penting dan selalu ada di sebuah universitas. Skripsi juga sebagai wujud hasil karya tulis ilmiah mahasiswa yang tercatat dan tersusun rapi sesuai dengan kaidah yang ditentukan. Saat ini permasalahan yang timbul dari proses pengajaun skripsi di lingkungan Universitas Trunojoyo Madura secara umum adalah proses pencarian serta penentuan sebuah judul skripsi yang tepat untuk diajukan mahasiswa dan tidak tersedianya data hasil skripsi mahasiswa yang tersusun secara sistematis dan komputerisasi, sehingga dalam pembuatan skripsi terdapat banyak kesamaan baik berupa judul maupun metode yang sering digunakan oleh mahasiswa, hal ini berdampak ketidak beragaman hasil skripsi buatan mahasiswa.\nDengan adanya pengembangan aplikasi manajemen skripsi menggunakan framework codeigniter dan cosine similarity diharapkan bisa mengevaluasi, memonitoring, serta memperbaiki kinerja sistem yang manual menjadi sistem terkomputasi sekaligus meminimalisir kesamaan dan plagiatisme serta dapat meningkatkan pelayanan kepada mahasiswa yang mengajukan skripsi dengan mudah sesuai dengan aturan yang berlaku di lingkungan Universitas Trunojoyo Madura.\n', 'Mujibur Rohman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100036'),
(596, '130411100037', 'PENERAPAN METODE NAIVE BAYES UNTUK KLASIFIKASI KONDISI FISIK PADA PEMAIN BOLA VOLI', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Dalam usaha mencapai prestasi yang baik dalam olahraga permainan bola voli, pemain bukan hanya ditekankan pada penguasaan teknik dan taktik saja, tetapi dituntut kondisi fisik yang baik, karena merupakan syarat-syarat penting dalam penguasaan keterampilan dalam permainan bola voli. Seorang pemain membutuhkan kondisi fisik yang baik untuk meningkatkan kualitas teknik. Dalam hal ini pelatih ingin tahu sejauh mana kondisi fisik pemain dari masing-masing individu, dengan mengoreksi kondisi fisik pemain bola voli yang baik. Untuk mempermudah dalam mengetahui kondisi fisik pemain maka diperlukan sistem pendukung keputusan yang dapat mengklasifikasi kondisi fisik pemain. Metode yang digunakan dalam sistem pendukung keputusan adalah naive bayes. Naive bayes merupakan salah satu metode di dalam data mining untuk mengklasifikasikan data. Metode ini dapat membantu pelatih dalam mengklasifikasi kondisi fisik setiap pemain bola voli dimana terdapat lima kategori yaitu baik sekali, baik, cukup, kurang dan kurang sekali. Dari hasil perhitungan metode naive bayes menghasilkan akurasi sebesar 85,71% dimana nilai yang didapat dari perbandingan antara perhitungan sistem dengan hasil perhitungan manual.\n\nKata Kunci : Kondisi Fisik, Naïve Bayess, Bola Voli', 'Ainul Yaqin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100037'),
(597, '130411100038', 'Identifikasi Penderita Epilepsi Menggunakan Haar Wavelet pada Data Electroencephalogram', 'Dr. Arif Muntasa, S.Si., M.T.', 'Dr. Indah Agustien S., S.Kom., M.Kom', 'Epilepsi adalah penyakit kelainan saraf pada otak. Menyerang manusia tanpa ada tanda – tanda akan terjadinya serangan epilepsi pada penderita. Epilepsi adalah penyakit yang bisa diturunkan oleh gen. factor pembawa epilepsi bisa berasal dari orangtua. Penyebab dari epilepsi masih belum diketahui\n Epilepsi dapat dicegah semenjak dini mulai dari perawatan yang mahal ataupun murah di bidang medis. Jika epilepsi tidak bisa ditangani melalui pengobatan medis, maka operasi atau neurostimulation lah solusi terakhir. Dengan adanya penelitian ini, bertujuan untuk meng-identifikasi seseorang apakah teridentifikasi sebagai penderita atau tidak. Electroencephalogram(EEG) adalah metode untuk merekam informasi aktifitas otak pada manusia. Digunakan 3750 sampel yang akan dilakukan ekstraksi fitur menggunakan Haar Wavelet. Dilakukan proses untuk menguraikan sinyal kedalam 3 level yang disebut Decompose Level. Selanjutnya dilakukan proses klasifikasi dengan menggunakan metode Euclidean Distance untuk mendapatkan klasifikasi data. Proses selanjutnya akan dicari nilai akurasi penelitian menggunakan Haar Wavelet dengan tiap Decompose Level menggunakan Confusion Matrix.\n Penelitian menghasilkan jangkauan nilai akurasi dari 78.80% - 78.97% dan menyimpulkan bahwa pengaruh decompose level terdapat pada waktu komputasi yang diperlukan\n', 'Agri Yudo Pratama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100038'),
(598, '130411100039', 'SELEKSI FITUR MENGGUNAKAN GENETIC ALGORITHM (GA) PADA DATA ELECTROENCEPHALOGRAM (EEG) UNTUK IDENTIFIKASI EPILEPSI', 'Dr. Arif Muntasa, S.Si.,M.T.', 'Dr. Indah Agustien S, S.Kom,M.Kom.', 'Electroencephalogram (EEG) merupakan teknik perekaman gelombang otak manusia melalui elektroda yang dipasang pada kulit kepala manusia. Hasil dari data sinyal yang didapat dapat digunakan sebagai identifikasi penderita epilepsi. Data yang digunakan dalam penelitian ini adalah data The Bern-Barcelona EEG database dengan 2 jenis data yaitu 5 subjek data focal dan 5 subjek data non-focal. Setiap subjek direkam dengan menggunakan 64 channel (penangkap sinyal) dan direkam dengan sampel 1024 Hz. Pada penelitian ini terdapat tiga tahap yang dilakukan. Tahap pertama ekstrasi fitur menggunakan Time and Frequency Distribution. Tahap kedua seleksi fitur menggunakan Genetic Algorithm. Dan tahap ketiga klasifikasi menggunakan Naïve Bayes. Hasil yang didapat dari percobaan adalah seleksi fitur memiliki pengaruh dalam sistem yaitu menambah tingkat akurasi dengan akurasi tertinggi mencapai 87.6 %.', 'Makinul Mujahid Ahmad', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100039'),
(599, '130411100040', 'KLASIFIKASI ALCOHOLIC BERDASARKAN DATA ELECTROENCEPHALOGRAPHY (EEG) MENGGUNAKAN INDEPENDENT COMPONENT ANALYSIS (ICA), WAVELET TRANSFORM, GENETIC ALGORITHM (GA) DAN COUNTER PROPAGATION NETWORK (CPN)', 'Dr. Indah Agustien S., S.Kom., M.Kom.', 'Dr. Arif Muntasa, S.Si., M.T.', 'Alcoholism adalah kondisi seseorang dimana orang tersebut mengkonsumsi dan kecanduan terhadap minuman keras (alkohol). Salah satu cara mengetahui seseorang termasuk alcoholic (pecandu alkohol) atau tidak dengan cara merekam aktifitas yang terjadi di otak dengan cara menempelkan elektroda logam dan media konduktif pada kulit kepala atau bisa disebut dengan Electroencephalography (EEG). Dalam penelitian ini, sinyal EEG akan diklasifikasikan ke dalam dua kategori yaitu pecandu alkohol dan normal. Penelitian ini diawali dengan preprocessing menggunakan Independent Component Analysis (ICA), dimana pada proses preprocessing sinyal – sinyal EEG dibersihkan dari noise. Setelah sinyal bersih dari noise kemudian dilakukan ektraksi fitur menggunakan Discrete Wavelet Transform (DWT). Setelah didapatkan fitur dari sinyal EEG, kemudian dilakukan proses seleksi fitur menggunakan Genetic Algortihm (GA) guna mencari fitur – fitur terbaik dari sinyal EEG. Setelah fitur – fitur terbaik didapatkan barulah dilakukan proses klasifikasi menggunakan jaringan saraf tiruan Counterpropagation Network (CPN). Penelitian ini menghasilkan akurasi tertinggi yaitu 78,7% yang terjadi pada scenario 4. Jadi, dalam kasus ini metode CounterPropagation Network (CPN) kurang cocok digunakan untuk proses klasifikasi sinyal EEG.', 'Saiful Barri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100040'),
(600, '130411100041', 'Penggunaan Metode Kartesius Pada Google Maps API Untuk Merekomendasikan Pencarian Lokasi Kerajinan Batik Berbasis Android\n(Studi Kasus Kabupaten Bangkalan)\n\n', 'Achmad Jauhari, S.T., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Smart city semakin marak diperbincangkan guna menjadi solusi dalam memecahkan permasalahan yang timbul akibat dari dinamika kota yang semakin maju dan modern. Tujuan dari penerapan konsep smart city yakni untuk meningkatkan rasa aman, dan nyaman bagi warganya, membuat kota semakin efektif dan efisien serta meningkatkan daya saing dan pertumbuhan ekonomi serta pemerataan penghasilan. Madura merupakan sebuah pulau yang terletak disebelah utara pulau Jawa.  Pulau yang dijuluki tanah garam ini cukup dikenal dalam bidang kesenian kerapan sapi dan kerajinan batik, khususnya di Kabupaten Bangkalan. Kabupaten Bangkalan merupakan kota berkembang yang tepat untuk penerapan konsep smart city. Salah satu cara yang dapat dilakukan adalah memanfaatkan peluang kebutuhan pasar pecinta batik dengan memberikan kemudahan akses lokasi. Memanfaatkan teknologi pencarian lokasi Google maps dengan Metode Kartesius pada perangkat elektronik smartphone, konsumen akan dipermudah dalam hal pencarian informasi maupun lokasi pengrajin batik yang tersebar diseluruh wilayah Kabupaten Bangkalan.\nKata Kunci : Smart City,  Batik, Google Maps, Metode Kartesius, Smartphone Android.', 'Dewi Arini Yuliarti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100041'),
(601, '130411100042', 'PENENTUAN POSISI PEMAIN SEPAK BOLA MENGGUNAKAN METODE FUZZY DAN SAW (SIMPLE ADDITIVE WEIGHTING)', 'Sigit Susanto Putro,S.Kom.,M.Kom', 'Achmad Jauhari,S.T.,M.Kom', 'Saat memasuki SSB (Sekolah Sepak Bola) seorang pemain berada di posisi yang di inginkan. Setelah menjadi pemain professional pemain tersebut kadang berubah posisi dari yang semestinya. Seorang pelatih akan menentukan posisi pemain yang tepat dalam permainan dengan melihat data pemain. Tugas inilah yang terkadang membuat pelatih kesulitan dalam membuat keputusan yang tepat dengan menilai pemain secara obyektif. Selain itu juga, pada umumnya proses pegambilan keputusan masih mengandalkan insting dari pelatih. Oleh karena itu, kehadiran teknologi sistem pendukung keputusan menentukan posisi pemain sepakbola oleh seorang pelatih tentulah sangat membantu untuk mencapai hasil maksimal dalam setiap pertandingan. Teknologi yang penulis tawarkan adalah membangun sistem pendukung keputusan pemilihan posisi pemain terbaik yang berasal dari data pemain menggunakan metode SAW (Simple Additive Weighting) dan Fuzzy. SAW (Simple Additive Weighting) merupakan metode penjumlahan terbobot. Konsep dasar metode SAW (Simple Additive Weighting) adalah mencari penjumlahan terbobot dari rating kinerja pada setiap alternatif pada semua kriteria. Sedangkan Fuzzy MADM digunakan untuk mencari alternatif dari sejumlah alternatif dengan kriteria tertentu.', 'Mohammad Abdillah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100042'),
(602, '130411100049', 'PENENTUAN STARTING LINE UP DAN FORMASI TIM DALAM OLAHRAGA SEPAKBOLA MENGGUNAKAN FUZZY TSUKAMOTO', 'Achmad Jauhari, S.T, M.Kom ', 'Sigit Susanto Putro S.Kom.,M.Kom', 'Sepak bola merupakan salah satu yang paling popular dalam penonton dan partisipasi dalam olahraga di dunia ini. Angka yang adamenunjukkan bahwa popularitas sepak bola tidak dibatasi oleh geografi, usia, budaya dan jenis kelamin. Dalam olahraga sepak bola, setiap pemain selain kiper dapat dikategorikan ke dalam salah satu dari tiga posisi: bek, gelandang, penyerang. Kombinasi dari gaya permainan yang berbeda dari pemain di lapangan disebut sebagai formasi. Sebuah formasi membutuhkan pemain yang sesuai dengan skema permainan. Pelatih memiliki wewenang tertinggi dalam menentukan pemain dan juga formasi tim. Kesalahan dalam menentukan pemain akan berakibat fatal pada sebuah tim yang tidak memenuhi ekspektasi tim dan juga dalam penentuan pemain yang dipilih oleh pelatih tidak sesuai antara standar yang diinginkan pelatih dengan skill atau kemampuan tiap pemain. Untuk mempermudah dalam menentukan pemain dibutuhkan sistem yang bisa merekemondasikan pemain yang mampu menyeleksi dan memilih pemain yang terbaik dari nilai-nilai tiap pemain dan kemudian pemain yang terpilih dibentuk dengan gaya dan skema permainan yang diinginkan. Dengan menggunakan metode fuzzy tsukamoto sekiranya bisa membantu menghasilkan starting line up sepak bola sesuai harapan. Dari hasil akhir perhitungan metode fuzzy tsukamoto bisa diketahui nilai akhir setiap pemain dan pelatih bisa melihat dan menentukan pemain yang layak untuk starting line up. Hasil dari penilaian metode fuzzy tsukamoto ini menghasilkan akurasi 67%, dimana nilai didapat dari perbandingan antara rekomendasi hasil sistem dan rekomendasi dari line up pelatih saat pertandingan.', 'Dimas Ardi Nugraha', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100049'),
(603, '130411100054', 'PERANGKINGAN KELUARGA MISKIN MENGGUNAKAN METODE SMARTER ', 'Iwan Santoso,S.T., M.T', 'Mula\'ab, S.Si., M.Kom', 'Dalam mengatasi permasalahan kemiskinan, Kabupaten Sampang  melaksanakan program Gerakan Bersama Menuju Sampang Harmonis Dan Bermartabat di mana program ini merupakan komitmen antara bupati sampang dengan gubernur profinsi jawa timur yang di amanatkan dalam rencana pembangunan jangka menengah daerah kabupaten sampang dalam mengentaskan kemiskinan di sampang yang memiliki angka kamiskinan paling tinggi se-jawa timur[1]. Karena tingginya kemiskinan tersebut di butukan sebuah sistem yang dapat merangking keluarga miskin, untuk itu dalam penelitian ini di bangun sebuah sistem pendukung keputusan dengan menggunakan metode Simple Multi-Atribut Ranting Technique Exploitng Ranks  di mana metode tersebut merupakan bagian dari metode Multiple Criteria Decision Making.  Hasil yang di peroleh sistem dapat merangking keluarga miskin dengan efisien (cepat dan mudah), yang kelayakannyadi ukur menggunakan metode descriptive statistical .', 'Dedi Adi Wijaya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100054'),
(604, '130411100061', 'PENERAPAN METODE NAIVE BAYES UNTUK MENDIAGNOSA PENYAKIT GIGI DAN MULUT \n\n', 'Mula\'ab, S.Si., M.Kom.', 'Wahyudi Agustiono, S.Kom., M.Sc., Ph.D. ', 'Kesehatan gigi dan mulut merupakan hal yang sangat penting bagi setiap orang. Terkadang orang tidak terlalu memikirkan masalah terhadap kesehatan giginya sehingga secara tidak langsung mengalami sakit gigi atau terkena penyakit gigi dan mulut. Dengan begitu penanganan dan perawatan yang tepat dapat membantu penyembuhan penyakit gigi lebih cepat, namun sebaliknya jika penanganannya tidak tepat maka kemungkinan menambah permasalahan pada kesehatan giginya, kemampuan analisa yang tepat dan akurat merupakan hal penting yang diperlukan dalam melakukan diagnosa penyakit. Dalam hal ini, untuk mengatasi permasalahan tersebut salah satu solusinya adalah sistem pakar yang dapat mendiagnosa penyakit gigi dan mulut, agar dapat melakukan pencegahan lebih awal. Sistem pakar tersebut mengadopsi pengetahuan para ahli dibidangnya. Sistem pakar yang dibangun menggunakan metode Naive Bayes, metode ini sangat cocok dalam pengambilan keputusan untuk mendiagnosa penyakit gigi dan mulut karena menggunakan konsep yang sederhana dan mudah dipahami. Sistem yang dibangun berbasis web untuk memudahkan dalam penggunaanya, sehingga dapat digunakan oleh masyarakat luas. Pengujian sistem menggunakan 90 data dan dilakukan 3 uji coba atau skenario. Dari hasil uji konsultasi dengan sistem ini menunjukkan bahwa sistem mampu menentukan penyakit dengan presentase tingkat akurasi keberhasil sebesar 70%. \n\n', 'AHMAD MUHTAR', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100061'),
(605, '130411100062', 'PENERAPAN METODE TOPSIS UNTUK PENENTUAN PEMBERIAN BANTUAN RESTRUKTURISASI MESIN ATAU ALAT KE INDUSTRI KECIL MENENGAH (IKM)', 'Mula\'ab, S.Si., M.Kom', 'Eza Rahmanita, S.T., M.T', 'Banyaknya jumlah IKM (Industri Kecil Menengah) yang masuk kedalam data calon penerima bantuan Restrukturisasi Mesin di DISPERINDAG BANGKALAN menyebabkan adanya kesulitan dalam menentukan IKM yang tepat untuk penerimaan bantuan tersebut, dimana proses penyaluran yang dilakukan secara manualpun dirasa belum cukup efektif untuk diterapkan. Oleh sebab itu, perlu adanya suatu metode yang dirancang kedalam sebuah sistem pendukung keputusan  yang dapat mencakup kriteria-kriteria penilaian serta mampu menyimpan data-data yang berkaitan dengan pemilihan Industri Kecil Menengah (IKM) di Bangkalan. Dari sekian banyak metode yang dapat dilandaskan untuk sistem pendukung keputusan terdapat satu metode yang dianggap tepat, yakni Metode TOPSIS (Technique For Order Reference by Similarity to Ideal Solution). TOPSIS memiliki konsep dimana alternatif (kandidat) yang terpilih merupakan alternatif terbaik yang memiliki jarak terpendek dari solusi ideal positif dan jarak terjauh dari solusi ideal negatif. Hasil dari penentuan kriteria pemilihan didapatkan tujuh kriteria yang digunakan yaitu Investasi, Tenaga Kerja, Legalitas Usaha, Izin Industri, Sertifikat SNI, Partisipasi dan Mesin.Penerapan aplikasi ini diharapkan dapat memberikan kontribusi yang besar khususnya kepada pihak DESPERINDAG dalam sisi eferktifitas dan efisiensi waktu. ', 'Ainul Yaqin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100062'),
(606, '130411100063', 'Pemilihan Striker Pemain Sepakbola Dengan Menerapkan Metode WP (Weight Product)', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Achmad Jauhari, S.T., M.Kom', 'Striker adalah pemain yang berada di barisan depan dan berhadapan langsung dengan bek lawan, tugasnya adalah memasukkan bola ke gawang lawan. Seorang striker harus  memiliki akurasi shooting atau tendangan yang baik. Bukan hanya itu saja, seorang striker juga harus bisa membuka ruang tembak dan membuat peluang yang baik  untuk dirinya sendiri sehingga dapat mencetak gol, untuk itu dibutuhkan kejelian yang bagus dari seorang pelatih sepakbola dalam hal memilih striker. Seorang pelatih dalam memilih striker tidak hanya mengandalkan pengamatannya saja, tetapi harus melihat catatan data yang signifikan yang dapat mendukung keputusan tersebut, maka dibutuhkan sistem pendukung keputusan untuk menyelesaikan masalah tersebut. Sistem ini menerapkan metode WP (Weight Product) yang tujuannya memberikan rekomendasi kepada pelatih untuk pemilihan posisi setiap pemain, serta mengetahui kebutuhan team pemain mana yang cocok ditempatkan pada posisi striker. Dari hasil penelitian WP (Weight Product) dapat diimplementasikan dalam sistem pemilihan striker dan memiliki nilai akurasi 55% yang didapatkan dari hasil perbandingan antara hasil perhitungan sistem dengan data rekomendasi pelatih.\nKata kunci : Sepakbola, Pemilihan Striker , WP (Weight Product).\n', 'Alif Wahyu Shodiqin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100063'),
(607, '130411100064', 'Perancangan Digital Guide Untuk Wisata Madura Berbasis Location Based Service', 'Ari Kusumaningsih, S.T., M.T.', 'Eza Rahmanita, S.T., M.T.', 'Madura memiliki berbagai macam tempat wisata yang menarik. Banyaknya pantai yang eksotis, serta tempat wisata lain yang tidak kalah menarik, membuat Madura memiliki potensi pariwisata yang tinggi. Sayangnya dengan berbagai tempat wisata yang menarik tersebut, masih banyak masyarakat luas yang belum mengetahui lokasi – lokasi wisata tersebut berada, tempat wisata di madura juga membutuhkan wadah promosi untuk menunjang kemajuan wisatanya.\nPenelitian ini ditujukan untuk membuat aplikasi Digital Guide dengan menggunakan konsep Location Based Service (LBS), LBS  digunakan untuk mengetahui informasi suatu lokasi sesuai dengan koordinat tersebut sehingga dapat mengetahui jarak lokasi tersebut dari lokasi pengguna. Teknologi Augmented Reality digunakan pengguna menggunakan kamera smartphone untuk mengetahui letak lokasi wisata yang akan dituju.\nDari hasil penelitian yang dilakukan, didapat hasil bahwa pada fitur augmented reality membutuhkan setidaknya 2 kali percobaan untuk bisa mengaksesnya menggunakan koneksi internet. Dan dari hasil ujicoba User Experience yang berbentuk kuisioner kepada responden didapat hasil 1060 dari 1200 skala nilai maksimal yang menunjukkan tingkat kepuasan cukup bagus. \n\nKata Kunci: Location Based Servise, Global Positioning System, Android, Smartphone, Wisata Madura, Augmented Reality.\n', 'Akhmad Mubarok', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100064'),
(608, '130411100065', 'PENERAPAN METODE CERTAINTY FACTOR UNTUK MENDIAGNOSA GEJALA PENYAKIT STROKE ', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Eza Rahmanita, S.T., M.T', 'Penyakit Stroke merupakan penyakit mematikan di Indonesia yang menempati urutan nomer tiga setelah Jantung dan Kanker. Sesuai dengan pengamatan dan peninjauan Yayasan Stroke Indonesia (Yastroki) di rumah sakit maupun yang berada dalam masyarakat, terdapat kecenderungan meningkatnya jumlah penyandang stroke di Indonesia. Untuk mendukung para pakar dalam mendiagnosa penyakit stroke maka dibangunlah suatu sistem pakar. Sistem ini dibangun menggunakan Metode Certainty Factor, yaitu suatu metode untuk membuktikan apakah suatu fakta itu pasti ataukah tidak pasti yang berbentuk matrik yang biasanya digunakan dalam sistem pakar. Hasil dari penelitian ini diharapkan dapat mendukung pakar dalam mendiagnosa penyakit Stroke. Dari penelitian ini telah dihasilkan sistem pakar untuk mendiagnosa penyakit Stroke dan setelah dilakukan pengujian dengan 21 data pasien, diperoleh nilai akurasi sebesar 66,67%. ', 'Muhammad Nashruddin Fadli', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100065'),
(609, '130411100066', 'DETEKSI ACUTE LIMFOBLASTIK LEUKIMIA(ALL) PADA CITRA DARAH PUTIH BERBASIS METODE LEARNING VECTOR QUANTIZATION(LVQ)', 'Dr. Arif Muntasa, S.Si., M.T', 'Dr. Indah Agustien Siraddjudin, S.Kom.,M.Kom', 'Acute Lymphoblastic Leukemia (ALL) adalah salah satu jenis leukemia. Leukemia merupakan jenis kanker yang terjadi pada darah dan sumsum tulang belakang. Penyakit Leukemia yang tidak mengenal usia menjadi momok bagi masyarakat karena sering terjadi keterlambatan penanganan. Hal ini terjadi karena mahalnya biaya identifikasi dengan menggunakan reaksi kimia. Menggunakan reaksi kimia ini juga membutuh tenaga dan waktu yang lama.  Mengatasi hal tersebut, dilakukan identifikasi leukemia pada citra sel darah putih. Citra darah terdiri dari sel darah putih dan background. Pemisahan sel darah putih dengan background, proses ini dinama proses segmentasi. Metode segmentasi yang dipakai metode morfologi matematis. Proses pencarian ciri menggunakan fitur tekstur metode Gray Level Co-Occurence Matrix (GLCM) dan fitur bentuk. Proses klasifikasi menggunakan metode Learning Vector Quantization(LVQ). Database menggunakan ALL-IDB2 sebanyak 260 citra, terdiri dari 130 citra positif ALL dan 130 citra negatif ALL. Klasifikasi ALL menggunakan Learning Vector Quantization(LVQ) memperlihatkan hasil rata-rata akurasi sebesar 74,59 %.', 'Nova Kurniawati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100066'),
(610, '130411100067', 'Sistem Informasi Geografis Pemetaan Potensi Usaha Mikro Kecil dan Menengah (UMKM) di Bangkalan', 'Mula\'ab, S.Si., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Kabupaten Bangkalan merupakan salah satu kabupaten yang mempunyai potensi Usaha Mikro Kecil dan Menengah (UMKM) yang cukup banyak. Tercatat ada 166,768 UMKM yang terdapat di Rekapitulasi Data UMKM Kabupaten Bangkalan pada Dinas Koperasi dan UMKM Bangkalan. Dari sekian banyaknya UMKM tersebut, masalah yang di hadapi adalah kurangnya media informasi secara detail terkait letak lokasi dan jenis-jenis produk UMKM yang dihasilkan di setiap wilayah kepada masyarakat umum Bangkalan maupun kepada masyarakat (asing) luar Bangkalan. Sehingga dibuatlah sebuah aplikasi web berbasis Sistem Informasi Geografis Pemetaan pada Usaha Mikro, Kecil dan Menengah (UMKM) di Bangkalan dengan menggunakan 15 data evaluator menunjukkan hasil nilai rata-rata berdasarkan nilai penggunaan sistem sebesar 86,25% dan berdasarkan nilai desain dan tampilan sistem sebesar 84,5% atau bisa dikatakan Aplikasi sudah mencapai tujuan yang diharapkan.', 'Imam Mulyadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100067'),
(611, '130411100070', 'KLASIFIKASI PENYAKIT ACUTE LYMPHOBLASTIC LEUKEMIA PADA CITRA MIKROSKOPIS SEL DARAH MENGGUNAKAN MAHALANOBIS DISTANCE', 'Dr. Arif Muntasa, S.Si., M.T. ', 'Dr. Indah Agustien Siradjuddin, S.Skom., M.Kom', 'Acute Lymphoblastic Leukemia (ALL) merupakan penyakit kanker yang ditandai dengan pertumbuhan sel darah putih yang sangat cepat dan mematikan. Apabila tidak segera diobati akan menyebabkan kematian dalam hitungan minggu hingga hari, untuk itu perlu penanganan secara cepat. Diagnosa penyakit ALL kebanyakan dilakukan secara manual, membutuhkan tenaga ahli, peralatan laboratorium yang memadai serta waktu yang cukup lama. Untuk mengatasi permasalahan tersebut pada penelitian ini dilakukan identifikasi Acute Lymphoblastic Leukemia menggunakan teknik pengolahan citra. Adapun tahapan-tahapan yang dilakukan adalah preprocessing, segmentasi, ekstraksi fitur dan klasifikasi citra. Metode yang diterapkan pada setiap tahapan adalah sebagai berikut metode contras stretching untuk perbaiakan citra, metode otsu Thresholding berdasarkan warna HSV untuk segmentasi, sedangkan untuk ekstraksi fitur menggunakan fitur hibrid gabungan antara fitur bentuk dan tekstur Gray Level Co-occurrancy Matrix (GLCM), yang kemudian akan di klasifikasikan menggunakana metode Mahalanobis Distance. Database yang digunkan dalam penelitian ini adalah database ALLIDB2, yang terdiri dari 260 gambar yaitu 130 ALL-Positif dan 130 ALL-Negatif. Pada pengujian ini mendapatkan rata-rata akurasi tertinggi sebesar 85.40% dengan sensitivity 85.8 % dan specificity 85.0%.', 'Novia Faizatin Nurikha', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100070'),
(612, '130411100077', 'PEMBANGKITAN 3D MAZE DINAMIS MENGGUNAKAN METODE HUNT AND KILL DALAM PEMBUATAN GAME AUGMENTED REALITY', 'YONATHAN FERRY HENDRAWAN', 'EZA RAHMANITA', 'Banyak aplikasi maze yang telah berada dipasaran saat ini. Akan tetapi kebanyakan game maze tersebut menggunakan maze statis. Hal ini menyebabkan setiap level memiliki tampilan atau solusi yang selalu sama sehingga mengakibatkan player cepat selesai dan akan cepat bosan. Dengan menggunakan maze dinamis, tampilan dan solusi dari maze dengan ukuran dimensi yang sama akan selalu berubah – ubah setiap permainan dijalankan kembali sehingga level permainan yang sama selalu memiliki tampilan maze baru. Untuk menambah daya tarik dari permainan maze dan memberi kesan bahwa player berada didalam maze, digunakan teknologi baru yaitu Augmented reality.\n\nPada penelitian ini, game Maze AR dibuat menjadi dinamis dengan menggunakan generator maze metode Hunt and kill. Metode ini memiliki keunggulan dalam jumlah persentase dead ends yang kecil dan longest path yang tidak terlalu besar. Oleh karena itu metode ini sangat cocok diterapkan dan dikombinasikan dengan teknologi Augmented Reality dimana player harus berjalan secara real di dunia nyata untuk menyelesaikan permainan.\n\nPada hasil uji coba penelitian menunjukkan bahwa 77,44% responden puas terhadap kinerja game Maze. Pada penelitian ini juga telah berhasil dibuat bentuk maze yang dinamis berdasarkan  metode Hunt and kill.\n', 'ARYA PRAZA MUSABBIH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100077');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(613, '130411100081', 'PENERAPAN ALGORITMA K-NEAREST NEIGHBOR BERBASIS COSINE SIMILARITY KLASIFIKASI TEKS KELUHAN MASYARAKAT', 'Achmad Jauhari, S.T., M.Kom', 'Yoga Dwitya Pramudita, S.Kom., M.Cs', 'Kota Bangkalan merupakan salah satu Kabupaten yang ada di Pulau Madura. Kota yang sudah cukup berkembang dengan berbagai kemajuan teknologi dan informasi saat ini, akan tetapi kemajuan tersebut tidak menyeluruh. Seperti halnya pelayanan publik dimana ketika masyarakat ingin menyampaikan keluhan atau ingin tahu informasi terbaru, masyarakat masih harus datang ke Dinas terkait. Diperlukan klasifikasi teks untuk menentukan kelas kategori pada keluhan. Penelitian ini menggunakan data keluhan dari dinas terkait di kabupaten bangkalan dan akan dibangun aplikasi keluhan masyarakat dengan mengimplementasikan algoritma K-Nearest Neighbor (KNN) berbasis Cosine Similarity. Parameter nilai K ditentukan dengan K=4 sampai K=10 sehingga menemukan nilai K optimal. Hasil penelitian menunjukkan bahwa K optimal dengan rata-rata akurasi 97,5% di peroleh ketika nilai K=4. Selain itu, dengan adanya aplikasi keluhan masyarakat ini dapat mempermudah pengguna dalam menyampaikan keluhan, karena keluhan dapat diterima oleh masyarakat lain yang belum mengetahui informasi keluhan yang ada disekitar kabupaten bangkalan dengan cepat dan mudah.', 'Lutfiyah Furaida', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100081'),
(614, '130411100083', 'IDENTIFIKASI ACUTE LYMPHOBLASTIC LEUKEMIA MENGGUNAKAN METODE NAÏVE BAYES DAN MAHALANOBIS BERDASARKAN CITRA MORFOLOGI SEL DARAH PUTIH', 'Dr. Arif Muntasa, S.Si, M.T.', 'Dr. Indah Agustien Siradjuddin, S.Kom, M.Kom.', 'Identifikasi sel darah mikroskopik dilakukan secara manual oleh hematologist melalui identifikasi visual di bawah mikroskop telah menjadi landasan di laboratorium hematologi untuk mendiagnosis dan memantau gangguan hematologi. Namun, Prosedur perhitungan sel darah ini memerlukan tenaga dan waktu yang lama, dan tingkat kesalahan antara 30% sampai dengan 40% tergantung pada subyektifitas pengalaman hematologist, ketelitian dan konsentrasi di laboratorium klinik hematologi. Untuk mengatasi masalah tersebut maka Penelitian ini bertujuan untuk mengidentifikasi penyakit Acute Lymphoblastic Leukemia (ALL) menggunakan metode Mahalanobis dan Naïve Bayes berdasarkan citra morfologi sel darah putih. Agoritma yang digunakan meliputi pra-pengolahan, segmentasi citra, perhitungan fitur dan klasifikasi. Algoritma K-means Clustering digunakan untuk memisahkan citra sel darah menjadi nucleus dan background. Fitur yang digunakan adalah fitur bentuk (area, perimeter, diameter, roundness, compactness), fitur tekstur (local binary pattern) dan Hybrid. Kemudian citra sel darah diklasifikasikan menggunakan metode Mahalanobis dan Naïve Bayes. Pengujian pada Mahalanobis penelitian ini menghasilkan akurasi terbaik sebesar 100% dan pada Naïve Bayes menghasilkan akurasi terbaik sebesar 97.8%. ', 'Girindra Bimantara Putra', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100083'),
(615, '130411100087', 'RANCANG BANGUN APLIKASI TATA KELOLA DATA PENELITIAN MENGGUNAKAN MODEL UNIFIED PROCESS', 'Mula\'ab, S.Si., M.Kom.', 'Ach. Khozaimi, S.Kom., M.Kom.', 'Pengelolaan data penelitian yang ada di LPPM saat ini masih manual. Proses pengambilan form biodata peneliti dan penyetoran berkas penelitian masih dilakukan secara manual. Oleh karena itu dibutuhkan suatu aplikasi yang dapat mengatasi permasalahan tersebut. Aplikasi yang akan dikembangkan adalah dengan model Unified Process menggunakan Framework Codeigniter. Unified Process merupakan salah satu software development process yang dikembangkan oleh Ivar Jacobson, Grady Booch, dan James Rumbaugh. Hasil yang didapat dari dibangunnya aplikasi ini seluruh proses pengelolaan data penelitian dapat dikelola dengan mudah dan cukup efektif.', 'Nailur Rahim', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100087'),
(616, '130411100091', 'Sistem Pendukung Keputusan Pemlihan Anggota TNI Terbaik Dengan Menggunakan Metode Sistem Multi Attribute Rating Technique (SMART)', 'Wahyudi Agustioo, S.Kom.,M.Sc.,Ph.D.', 'Eza Rahmanita, S.T., M.T.', 'Kata Proses penilaian anggota TNI yang ada di Lanal Batuporon pada saat ini masih menggunakan cara manual, yang mana proses penilaian tersebut masih cukup lambat dan kurang modern. Oleh karena itu, dibutuhkan sebuah aplikasi sistem pendukung keputusan penilaian anggota TNI terbaik dengan menggunakan metode Sistem Multi Attribute Rating Technique (SMART). Dengan menggunakan metode tersebut, terdapat beberapa keuntungan yaitu dari pembobotan kriteria dapat diubah sehingga, jika terdapat penambahan kriteria dapat menambah bobot sesuai dengan  tingkatan kriteria untuk diberi bobot. Selain itu, dengan adanya aplikasi  berbasis web ini mempunyai keuntungan yang lain penilaian tanpa harus menunggu lama dikarenakan menggunakan proses manual yang mana pada saat proses perangkingan, tanpa harus mencari nilai yang tertinggi secara manual. Namun, rangking hasil penilaian tersebut dapat langsung meranking sendiri sesuai dengan nilai akhir yang tertinggi, serta dapat mempercepat proses cara manual.\nkunci:  proses penilaian TNI, SMART, aplikasi berbasis web\n', 'MOH SAPUTRO EKA TRISNO', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100091'),
(617, '130411100095', 'Implementasi Rational Unified Process pada Proyek Perangkat Lunak Penjaminan Mutu Program Studi', 'Wahyudi Agustiono, S.Kom.,M.Sc.,Ph.D', 'Achmad Jauhari, S.T., M.Kom.', 'Dokumen borang akreditasi adalah dokumen yang menjadi dasar dalam menentukan standar mutu dan kelayakan program studi pada sebuah perguruan tinggi dari waktu ke waktu. Pendokumentasian serta penilaian pada borang akreditasi menjadi kendala yang dihadapi Pusat Jaminan Mutu saat ini. RUP (Rational Unified Process) adalah pendekatan pengembangan perangkat lunak yang dilakukan berulang-ulang (iterative), fokus pada arsitektur (architecture-centric), lebih diarahkan berdasarkan penggunaan kasus (use case driven). Dengan menggunakan pendekatan RUP pada pembangunan perangkat lunak penjaminan mutu program studi ini menghasilkan sebuah perangkat lunak yang membantu PJM Universitas dalam  mendokumentasikan serta penilaian pada borang akreditasi  Program Studi.', 'Afifatul Badriyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100095'),
(618, '130411100096', 'APLIKASI TATA KELOLA ADMINISTRASI PEMBANGUNAN BERBASIS HIRARCHICAL MODEL VIEW CONTROLLER\n (Implementasi Peraturan Menteri Dalam Negeri No 47 Tahun 2016)\n', 'Mula’ab,S.Si.,M.Kom,', 'Eza Rahmanita, S.T., M.T.', 'Pengembangan aplikasi administrasi desa dilakukan oleh beberapa orang, sehingga muncul kesulitan saat dilakukan penggabungan administrasi satu dan administrasi lainnya. Teknologi/konsep Hierarchical Model View Controller dipilih, karena mempermudah dalam pengembangan aplikasi dan penyatuan dari beberapa buku administrasi pembangunan desa, berdasarkan PERMENDAGRI No. 47 Tahun 2016. Penerapan Hierarchical Model View Controller tersusun dari beberapa modul Model View Controller. Pada administrasi pembangunan konsep Hierarchical diterapakan pada setiap sub buku administrasi pembangunan, dimana dalam setiap sub terdapat konsep Model View Controller. Dari ujicoba aplikasi pengelolaan administrasi pembangunan desa, berbasis Hierarchical Model View Controller didapat kesimpulan, bahwa aplikasi ini sesuai dengan standart user maupun standart developer dan penerapan HMVC (Hierarchical Model View Controller) pada aplikasi ini mempermudah pengembangan aplikasi kedepannya dan proses administrasi pembangunan desa.', 'Indra Dwi Kusuma', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100096'),
(619, '130411100097', 'PERANCANGAN DAN PEMBUATAN APLIKASI PENILAIAN KULIAH KERJA NYATA LPPM UTM MENGGUNAKAN METODE RATING SCALE', 'Firdaus Solihin, S.Kom., M.Kom.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'KKN (Kuliah Kerja Nyata) merupakan salah satu mata kuliah wajib Universitas di Universitas Trunojoyo Madura. Selama ini proses penilaian KKN masih menggunakan cara manual sehingga memiliki beberapa kelemahan antara lain, objektivitas dan dasar penilaian kurang terjaga serta  proses penilaian butuh waktu yang lama. Karena itu, keberadaan sebuah sistem penilalian KKN yang menerapkan teknologi informasi sangat dibutuhkan. Salah satu  metode yang dapat diterapkan yaitu metode Rating Scale karena mudah dan praktis untuk menilai mahasiswa yang mengikuti kegiatan KKN yang jumlahnya banyak. Metode Rating Scale dikenal dengan Skala Bertingkat, yaitu berupa suatu daftar yang berisi tentang sifat atau ciri-ciri tingkah laku yang ingin dinilai yang sudah sesuai dengan kriteria yang mau dinilai dan dicatat secara bertingkat dimulai dari nilai terendah hingga nilai yang tertinggi. Hasil dari penelitian ini yaitu, penggunaan metode Rating Scale pada sistem penilaian Kuliah Kerja Nyata LPPM UTM dapat saja mempengaruhi perubahan nilai, dan perubahan nilai itu disebabkan oleh konversi dari hasil input penilaian manual ke Rating Scale. Selain itu berdasarkan hasil pengujian aplikasi ini layak digunakan.', 'Masdar Wiyono', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100097'),
(620, '130411100098', 'PENERAPAN METODE FORWARD CHAINING UNTUK DIAGNOSIS PENYAKIT KULIT PADA KUCING', 'Mula\'ab, S.Si., M.Kom.', 'Eza Rahmanita, S.T. M.T.', 'Abstrak : Penyakit yang sering diderita oleh kucing salah satunya adalah penyakit kulit, diantaranya mycosis, Otitis Eksterna, Infeksi Ekooparasit (Tungau Notoedress SPP/ Scabies, Infeksi Ekoparasit (Tungau demodex SPP), Dermatitis Alergi, Acne/Komedo. Penyakit ini sangat sering di jumpai oleh para pencinta kucing pada kucing kesayangan mereka, namun kurangnya pemahaman terhadap penyakit kulit pada kucing masih rendah. Sehingga masih banyak masyarakat yang masih mengandalkan keahlian dari seorang pakar secara langsung selain itu biaya yang dikeluarkan juga tidak murah, serta keberdaan dokter hewan yang masih relative sedikit. Maka dari permasalah tersebut di bangunlah sebuah sistem pakar diagnosa penyakit kucing dengan metode forward chaining. Sistem pakar merupakan sistem yang berusaha mengadopsi pengetahuan manusia ke dalam komputer, agar komputer dapat menyelesaikan masalah seperti yang biasa dilakukan oleh para ahli. forward chaining merupakan teknik pencarian yang dimuai dengan fakta-fakta yang di ketahui. Sehingga di harapkan dari penelitian ini dapat mempermudah masyarakat tenteng diagnosa penyakit kulit pada kucing. Serta dari penelitian ini dapat diketahui akurasi dari metode forward chaining yaitu sebesar 100% \nKata kunci : Penyakit Kulit Kucing, Forward Chaining, Sistem Pakar.\n?\n', 'Danu Kusumo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100098'),
(621, '130411100103', 'PEMANFAATAN METODE SMART (Simple Multi-Atribute Rating Technique) UNTUK MENENTUKAN POSISI PEMAIN PADA OLAHRAGA BASKET', 'Sigit Susanto Putro., S.Kom. M.Kom', 'Mula\'ab. S.Si., M.Kom', 'Dalam permainan basket, seorang pemain terkadang memiliki beberapa posisi bermain. Saat memasuki tim basket seorang pemain berada di posisi yang diinginkan. Setelah menjadi pemain professional pemain tersebut kadang berubah posisi dari yang semestinya. Seorang pelatih akan menentukan posisi pemain yang tepat dalam permainan dengan melihat data pemain. Tugas inilah yang terkadang membuat pelatih kesulitan dalam membuat keputusan yang tepat dengan menilai pemain secara obyektif. Selain itu juga, pada umumnya proses pegambilan keputusan masih mengandalkan insting dari pelatih. Oleh karena itu, kehadiran teknologi sistem pendukung keputusan menentukan posisi pemain bola basket oleh seorang pelatih tentulah sangat membantu untuk mencapai hasil maksimal dalam setiap pertandingan. Teknologi yang penulis tawarkan adalah membangun sistem pendukung keputusan pemilihan posisi pemain t yang berasal dari data pemain menggunakan metode SMART. Sistem ini menerapkan metode SMART (Simple Multi-Atribute Rating Technique) yang tujuannya memberikan rekomendasi kepada pelatih untuk pemilihan posisi setiap pemain, serta mengetahui kebutuhan posisi lima pemain yang cocok ditempatkan pada posisi center, point guard, shoting guard, small forward, dan power forward. Dari hasil SMART (Simple Multi-Atribute Rating Technique) dapat diimplementasikan dalam sistem pemilihan posisi pemain dan memiliki akurasi 61% yang didapatkan dari hasil perbandingan antara hasil perhitungan sistem dengan data rekomendasi pelatih.\n\nKata Kunci: Bola Basket, Posisi Pemain, SMART', 'Achmad Roviqi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100103'),
(622, '130411100105', 'IMPLEMENTASI SEO PADA WEB ONLINE', 'Firdaus Solihin, S.Kom., M.Kom', 'Yoga Dwitya Pramudita, S.Kom. M.Cs', 'UKM (Usaha kecil menengah) merupakan sUsaha Kecil dan Menengah disingkat UKM adalah sebuah istilah yang mengacu ke jenis usaha kecil yang memiliki kekayaan bersih paling banyak Rp 200.000.000 tidak termasuk tanah dan bangunan tempat usaha. Dan usaha yang berdiri sendiri.SEO adalah singkatan dari \"search engine optimization\" (pengoptimalan mesin telusur) atau \"search engine optimizer\". Penggunaan jasa SEO adalah keputusan besar yang dapat meningkatkan peringkat situs Anda dan menghemat waktu, tapi juga berisiko tinggi terhadap situs dan reputasi.', 'Huzaini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100105'),
(623, '130411100106', 'PENERAPAN MVC(MODEL VIEW CONTROLLER) PADA PENGELOLAAN DATA PENGUJIAN KENDARAAN BERMOTOR', 'Mula\'ab, S.Si., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Syarat kendaran bermotor untuk bisa beroperasi di kota bangkalan adalah harus lulus uji KIR. Selama ini proses Uji KIR dilakukan menggunakan mesin Uji KIR. Namun pencatatan dari hasil Uji KIR tersebut masih dilakukan secara manual. Sehingga memiliki beberapa kelemahan, diantaranya adalah proses penentuan laik tidaknya kendaraan membutuhkan waktu yang lama dan belum terkomputerisasi. Untuk mengatasi permasalahan tersebut, maka dibuatlah Aplikasi untuk  menentukan kelayakan operasional kendaraan bermotor di DISHUB Bangkalan dengan menerapkan konsep MVC (Model View Controller). Hasil penelitian ini menunjukkan bahwa penerapan konsep MVC pada  aplikasi pengelolaan data pengujian kendaraan dinilai sudah Baik. Hal ini dapat dilihat berdasarkan hasil perhitungan kuisioner yang telah dilakukan dari 3 jenis responden, dapat disimpulkan bahwa rata-rata presentase ketercapaian sistem yaitu sebesar 98,76% menyatakan sesuai dan 1,21% menyatakan tidak sesuai.', 'Abd. Hadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100106'),
(624, '130411100107', 'Penerapan Google Maps API pada Smart City dalam Pencarian Jarak Terdekat Fasilitas Kesehatan di Bangkalan', 'Achmad Jauhari S.T.,M.Kom', 'Yoga Dwitya Pramudita S.Kom., M.Cs', 'Fasilitas Kesehatan merupakan fasilitas yang bergerak dibidang kesehatan dalam upaya untuk menyediakan pelayanan berupa serangkaian kegiatan yang dilakukan oleh pemerintah dan masyarakat dalam hal penyebaran informasi tentang kesehatan, pencegahan terhadap permasalahan kesehatan (penyakit), pengobatan, serta mengembalikan penderita kedalam lingkungan masyarakat. Informasi fasilitas kesehatan yang disediakan oleh Google Maps belum lengkap, sehingga  permasalahan yang muncul  adalah  media yang menampung informasi tentang fasilitas kesehatan masih sedikit, dan masyarakat di Bangkalan tidak bisa mengetahui informasi fasilitas kesehatan secara keseluruhan.\n Masalah tersebut dapat diselesaikan dengan adanya sebuah aplikasi yang dibangun dengan menggunakan Framework Codeigniter dan Google Maps API. Aplikasi tersebut bisa menampung serta menyediakan data fasilitas kesehatan dengan lengkap, sehingga dapat membantu masyarakat di Kabupaten Bangkalan untuk mencari lokasi dengan jarak terdekat dan mengetahui informasi tentang nama fasilitas kesehatan, alamat fasilitas kesehatan, jadwal dokter di rumah sakit serta puskesmas.\n Aplikasi yang telah dibangun  dikatakan efektif untuk membantu masyarakat dalam mengetahui lokasi dan informasi fasilitas kesehatan di Bangkalan. Hal ini terbukti dengan hasil penilaian kualitas aplikasi  kepada 10 responden yang menunjukan hasil 77,3%.\n\nKata kunci : Fasilitas Kesehatan, Google Maps API, Jarak Terdekat', 'Ela Nur Azizah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100107'),
(625, '130411100108', 'Sistem Pakar Pendeteksi Penyakit pada Balita Menggunakan Metode Certainty Factor', 'Wahyudi Agustiono, S.Kom.,M.Sc.,Ph.D', 'Achmad Jauhari, S.T., M.Kom.', 'Kesehatan pada anak yang memiliki usia dibawah lima tahun atau istilahnya disebut balita, merupakan hal yang sangat berharga bagi orang tua. Seorang anak pada usia balita  masih rentan terkena penyakit, kemampuan analisa yang tepat dan akurat merupakan hal penting yang diperlukan dalam melakukan diagnosa penyakit. Dalam hal ini, untuk mengatasi permasalahan tersebut salah satu solusinya adalah sistem pakar yang dapat mendiagnosa penyakit pada balita, agar dapat melakukan pencegahan lebih awal. Sistem pakar tersebut mengadopsi pengetahuan para ahli dibidangnya, kemudian direpresentasikan dalam bentuk aturan. Sistem pakar yang dibangun menggunakan metode certainty factor, metode ini sangat cocok dalam pengambilan keputusan untuk mendiagnosa penyakit pada balita yang mengandung ketidakastian. Sistem yang dibangun berbasis web untuk memudahkan dalam penggunaanya, sehingga dapat digunakan oleh masyarakat luas. Hasil uji konsultasi dengan sistem ini yang melibatkan dua dokter spesialis anak, menunjukkan bahwa sistem mampu menentukan penyakit dengan presentase tingkat akurasi keberhasil sebesar 76% - 84% melalui pengujian dokter dan 80% saat dilakukan uji coba pada pasien .   \nKata Kunci : Penyakit pada Balita, Certainty Factor, Sistem Pakar.', 'Imam Syafiuddin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100108'),
(626, '130411100109', 'PENERAPAN METODE TREND PROJECTION UNTUK PERAMALAN TINDAKAN KEJAHATAN DI KABUPATEN SUMENEP\nTHE IMPLEMENTATION OF TREND PROJECTION METHOD TO FORCEST CRIMINAL ACTIVITY IN SUMENEP DISTRICT', 'Wahyudi Agustiono, S.Kom., M.Sc., Ph.D', 'Eza Rahmanita, S.T., MT.', 'Tindak kejahatan dapat terjadi setiap hari bisa berupa kejahatan ringan dan berat. Berdasarkan penelitian yang telah dilakukan, pihak kepolisian selama ini hanya melakukan proses  pencatatan laporan tindak kejahatan tanpa ada proses pengolahan data lebih lanjut untuk mendapatkan solusi yang bermanfaat dalam penanggulangan tindak kejahatan dan mencegah tindak kejahatan. Salah satu metode peramalan yang dapat digunakan untuk mengolah data tindak kejahatan agar menghasilkan prediksi tindak kejahatan, sehingga bisa digunakan oleh pihak kepolisian untuk sarana penanggulangan kejahatan. Salah satu metode peramalan yang digunakan adalah Metode Trend Projection. Metode ini mencocokkan garis trend ke rangkaian data historis kemudian diproyeksikan ke masa depan dengan periode waktu. Metode ini membutuhkan informasi data tahun-tahun sebelumnya sehingga pada penelitian ini mengambil data 4 tahun sebelumnya. Dengan metode peramalan ini diperoleh hasil peramalan nilai tindakan kejahatan hampir mendekati dengan data sebenarnya meskipun beberapa periode/bulan menunjukkan perbedaan yang sangat jauh. Dari hasil pengujian sistem yang dikenakan pada 5 kecamatan untuk pencurian kendaraan bermotor diperoleh nilai akurasi mencapai 32 % , 5 kecamatan untuk pencurian barang diperoleh nilai akurasi mencapai 16 % , dan 4 kecamatan untuk pencurian hewan diperoleh nilai akurasi mencapai 6 %.\n\nKata Kunci : Peramalan, Trend Projection, Tindak Kejahatan.', 'Luluk Fauziyah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100109'),
(627, '130411100111', 'Sistem Pemeringkatan Kinerja Koperasi Berdasarkan Peraturan Menteri Koperasi dan Usaha Kecil dan Menengah Republik Indonesia Nomor 22/PER/M.KUKM/IV/2007', 'Mula\'ab, S.Si., M.Kom', 'Eza Rahmanita, S.T., M.T', 'Selama ini proses pemeringkatan kinerja koperasi masih menggunakan cara manual sehingga memiliki beberapa kelemahan antara lain, objektivitas dan dasar penilaian kurang terjaga serta proses pemeringkatan kinerja koperasi butuh waktu yang lama. Karena itu keberadaan sebuah sistem pemeringkatan kinerja koperasi yang menerapkan teknologi informasi sangat dibutuhkan. Salah satu pendekatan yang dapat diterapkan yaitu Peraturan Menteri Koperasi dan Usaha Kecil dan Menengah Republik Indonesia Nomor 22/Per/M.KUKM/IV/2007 tentang Pedoman Pemeringkatan Koperasi karena mudah dan praktis untuk menilai koperasi yang mengikuti kegiatan pemeringkatan kinerja koperasi yang jumlahnya banyak. Sehingga Peraturan Menteri Koperasi dan Usaha Kecil dan Menengah Republik Indonesia Nomor 22/Per/M.KUKM/IV/2007 ini cocok untuk diterapkan dalam proses pemeringkatan kinerja koperasi. Penerapan sistem informasi ini diharapkan untuk proses pemeringkatan kinerja koperasi. Dari ujicoba 10 koperasi didapat kesimpulan bahwa sistem informasi untuk proses pemeringkatan kinerja koperasi berdasarkan Peraturan Menteri Koperasi dan Usaha Kecil dan Menengah Republik Indonesia Nomor 22/Per/M.KUKM/IV/2007 dengan framework MVC telah tercapai.\n\n\nKata Kunci : Peraturan Menteri Koperasi dan Usaha Kecil dan Menengah Republik Indonesia Nomor 22/Per/M.KUKM/IV/2007, Pemeringkatan kinerja koperasi, manual.\n', 'Rahman Wafi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100111'),
(628, '130411100112', 'IMPLEMENTASI DYNAMIC SYSTEM DEVELOPMENT METHOD (DSDM) PADA PROYEK PERANGKAT LUNAK PENJAMINAN MUTU TRACER STUDY', 'Wahyudi Agustiono, S.Kom., M.Sc., Ph.D.', 'Achmad Jauhari, S.T., M.Kom.', 'Tracer study adalah studi pelacakan jejak lulusan/alumni yang dilakukan 2 (dua) tahun setelah lulus. Proses Tracer Study di Universitas Trunojoyo Madura selama ini masih dilakukan secara manual yaitu dengan mendownload file kuesioner, mengisi kuesioner, kemudian mengirimkan kembali file kuesioner ke email yang sudah ditentukan. Oleh karenanya dibutuhkan sebuah proyek perangkat lunak Tracer Study berbasis web. Proyek perangkat lunak tersebut dibangun dengan metode Dynamic System Development Method (DSDM). Metode DSDM ini akan diterapkan pada pembangunan proyek perangkat lunak Tracer Study Universitas Trunojoyo Madura untuk menghasilkan perancangan dan pembangunan yang baik dan terstruktur, sehingga mempermudah dalam penyelenggaraan Tracer Study Universitas Trunojoyo Madura. Hasil evalusi selama proses pengembangan menunjukan metode DSDM dapat membantu dalam perancangan dan pembutan perangkat lunak penjaminan mutu Tracer Study secara iteratif dan bertambah pendekatan pengguna yang menekankan keterlibatan pengguna secara terus-menerus. Sementara itu, hasil evaluasi akhir program dengan melibatkan user (admin, alumni, admin fakultas, admin prodi, admin PJM) menunjukkan tingkat kemudahan atau kesesuaian dengan hasil sebesar 78,7%.\n\nKata kunci: Dynamic System Development Method, Penjaminan Mutu, Tracer Study.\n', 'Linnasihati Niswatun Hasana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100112'),
(629, '130411100113', 'CLUSTERING BERITA OLAHRAGA BERBAHASA INDONESIA MENGGUNAKAN METODE K-MEDOID BERSYARAT', 'Sigit Susanto Putro, S.Kom, M.Kom', 'Yoga Dwitya Pramudita, S.Kom, M.Cs', 'Berita merupakan fakta ataupun opini yang membuat banyak orang merasa tertarik untuk mengetahuinya. Berita olahraga merupakan salah satu berita yang memiliki rating pengaksesan cukup tinggi. Berita olahraga memiliki berbagai cabang seperti bola, raket, balap dan lain-lain. Oleh karena itu, berita olahraga memerlukan pengelompokkan berita. Pengelompokan dilakukan dengan tujuan agar berita tersebut terhimpun menjadi suatu kelompok sesuai dengan kesamaan berita. Pengelompokan dapat dilakukan dengan berbagai metode. Salah satu metode yang digunakan adalah k-medoid. K-medoid merupakan metode pengelompokkan yang bekerja secara optimal untuk mengelompokkan berita olahraga dalam jumlah yang sedikit. Setelah semua berita dikelompokkan sesuai dengan kemiripannya, hasil pengelompokkan tersebut perlu diukur nilai akurasinya. Pada saat uji coba dilakukan menghasilkan nilai akurasi sebesar 0,584 dengan jumlah cluster yang dinputkan sebanyak lima cluster. Perbaikan metode k-medoid dengan menambahkan metode cosine similarity mampu meningkatkan nilai akurasi yang semula rata-rata 0,44 bertambah optimal menjadi 0,55.', 'Ach. Yasir Rofiqi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100113'),
(630, '130411100114', 'SISTEM PAKAR DIAGNOSA PENYAKIT DEMAM BERDARAH DAN DEMAM TYPHOID PADA BALITA METODE DEMSPTER SHAFER', 'Mula’ab, S.Si., M.Kom', 'Eza Rahmanita, S.T', 'Demam Berdarah merupakan penyakit  yang di sebabkan oleh virus dengue, yang masuk kedalam tubuh manusia melalui gigitan nyamuk Aedes aegypti. Demam tifus merupakan penyakit yang timbul karena infeksi pada usus halus dan terkadang juga terjadi pada aliran darah yang disebabkan oleh Salmonella Typhil A,B dan C. yang masuk melalui saluran pencernaan. Kurangnya kepekaan orang tua terhadap gejala penyakit ini membuat orang tua mengalami kekahawatiran tersendiri, apabila terjadi gangguan kesehatan terhadap balita. Mereka lebih mempercayakannya kepada pakar, tanpa memperdulikan gangguan tersebut masih dalam tingkat rendah atau kronis. Namun dengan kemudahan adanya pakar terkadang terdapat kelemahan seperti jam praktek yang terbatas dan banyaknya pasien yang menyebabkan antrian. Sehingga dari permasalahan tersebut muncullah penelitian untuk membuat sebuah sistem pakar untuk mendiagnosa penyakit demam berdarah dan demam tifus menggunakan metode Dempster Shafer dimana metode ini merupakan penalaran non monotonis yang digunakan untuk mencari ketidak konsistenan akbiat adanya penambahan maupun pengurangan fakta baru yang akan merubah aturan yang ada, sehingga pada penelitian ini didapatkan kesimpulan akurasi sistem sebesar 93%.', 'Romi Hariyadi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/130411100114'),
(631, '140411100010', 'Sistem Rekomendasi Dengan Menggunakan Metode K-means Clustering dan Item-Based Collaborative Filtering', 'Dr. Noor Ifada, S.T., M.ISD', 'Mula’ab, S.Si.,M.Kom', 'Sistem rekomendasi adalah sistem yang digunakan untuk merekomendasikan sesuatu item, misalnya merekomendasikan film. Banyaknya informasi film di internet membuat kita kesulitan dalam memilih film yang sesuai dengan selera. Untuk itu sistem rekomendasi film ini dibutuhkan oleh masyarakat. Sistem rekomendasi ini membutuhkan data  rating dari movielens. Pemilihan metode sangat mempengaruhi keberhasilan sistem. Semakin akurat sistem yang dibuat maka semakin bagus. Metode yang populer saat ini adalah collaborative filtering khususnya metode collaborative filtering tradisional. Namun metode ini memiliki masalah skalabilitas sehingga untuk mengatasinya perlu ditambahkan metode clustering. Pada penelitian  sebelumnya ada yang menggunakan metode k-means clustering dan user-based collaborative filtering. Collaborative filtering terdiri dari user-based dan item-based collaborative filtering. Pada penelitian lain menyebutkan bahwa metode item-based lebih akurat daripada metode  user-based collaborative filtering. Untuk itu pada penelitian ini menggunakan metode k-means clustering dan item-based collaborative filtering. Hasil dari uji coba yang dilakukan menunjukkan bahwa metode pada penelitin ini lebih akurat daripada user-based dan item-based collaborative filtering. Presentase kenaikan akurasi metode yang diteliti dengan user-based adalah 113% sedangkan bila dibandingkan dengan item-based collaborative filtering kenaikan akurasinya adalah 168%. Metode yang diteliti juga lebih  akurat dibandingkan metode gabungan user clustering dan user-based collaborative filtering dengan kenaikan akurasi sebesar 27%.\nKata kunci: Film, Sistem Rekomendasi, Item Clustering, Item-Based Collaborative Filtering.\n', 'Susi Susanti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100010'),
(632, '140411100011', 'SISTEM REKOMENDASI KENAIKAN JENJANG JABATAN PADA JABATAN FUNGSIONAL PENGAWAS INSPEKTORAT KABUPATEN BANGKALAN MENGGUNAKAN METODE AHP ', 'Achmad Jauhari, S.T., M.Kom', 'Devie Rosa Anamisa, S.Kom., M.Kom', 'Pegawai adalah aset yang sangat penting dalam suatu organisasi. Guna memberi penghargaan dan sebagai motivasi kepada pegawai yang ada, maka dibuatlah sebuah sistem rekomendasi kenaikan jabatan terhadap Jabatan Fungsional Pengawas Dinas Inspektorat Kabupaten Bangkalan. Sistem ini dibuat menggunakan metode perhitungan AHP(Analytical Hierarchy Process). AHP menghasilkan sebuah rangking yang didapat dari membandingkan setiap kriteria dan juga alternatif dalam hal ini bakal calon yang akan diberikan kenaikan jabatan. AHP merupakan suatu metode dengan melakukan perbandingan berpasangan antara kriteria pilihan dan juga perbandingan berpasangan antara pilihan yang ada. Permasalahan pengambilan keputusan dengan AHP umumnya dikomposisikan menjadi kriteria, dan alternative pilihan. Hasil dari implementasi metode AHP dalam memberikan rekomendasi kenaikan jenjang jabatan, setelah dilakukan 4 kali uji rekomendasi maka didapat hasil rata-rata akurasi sebesar 86,25 %. Dengan demikian implementasi metode AHP dalam rekomendasi kenaikan jabatan menunjukkan bahwa hasil rekomendasi adalah “baik”.', 'Amalia Insani R', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100011'),
(633, '140411100013', 'PENGGUNAAN ATRIBUT GENRE DALAM MODEL NAIVE BAYES UNTUK PROBABILISTIC RANKING DALAM SISTEM REKOMENDASI', 'Dr. Noor Ifada, S.T., M.ISD.,', 'Dr. Arif Muntasa, S.Si, M.T., ', 'Sistem rekomendasi merupakan sebuah sistem yang dibuat dengan tujuan memberikan sebuah rekomendasi item kepada user. Salah satu model pendekatan sistem rekomendasi yang sering digunakan adalah Collaborative Filtering (CF), dengan pendekatan item-based. Model ini memberikan hasil rekomendasi yang cukup baik, namun item-based CF tidak memanfaatkan atribut item dalam perhitungan rekomendasinya. Penerapan atribut item dapat dilakukan dengan dua cara, yaitu dengan satu tahap permodelan dan dua tahap permodelan. Satu tahap permodelan menghasilkan kualitas rekomendasi tidak terlalu signifikan (kurang baik). Cara yang kedua adalah dua tahap permodelan, candidate rekomendasi dan tahap re-ordering. Misal, tahap candidate rekomendasi menggunakan pendekatan collaborative filtering, dan re ordering dilakukan content-basedatau naïve bayes. Pada penelitian sebelumnya sudah dilakukan penerapan candidate rekomendasi menggunakan collaborative filtering, dan re ordering dengan naive bayes pada data tagging menghasikan rekomendasi yang baik. Oleh sebab itu pada penelitian ini penulis mencoba menerapkan dua tahap permodelan candidate ranking dengan collaborative filtering, dan re-ordering menggunakan nave bayes. dengan study kasus movie atribut genre pada data explicit (2 dimensi) . Dari hasil percobaan mendapatkan nilai yang cukup baik, dengan kenaikan nilai akurasi yang dihasilkan metode evaluasi NDCG sebesar 40.94486%.\nKata kunci: Sistem Rekomendasi, Item-Based Collaborative Filtering, Naive Bayes, NDCG, Probabilistic Ranking. ', 'Selgy Zahranida Sugiharto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100013'),
(634, '140411100017', 'SISTEM REKOMENDASI RUMAH KOST MENGGUNAKAN METODE K-MEANS CLUSTERING BERBASIS MOBILE  ', 'Achmad Jauhari, S.T.,M.T', 'Yoga Dwitya Pramnudita,S.Kom.,M.Cs', 'Universitas Trunojoyo Madura merupakan salah satu universitas negeri yang banyak diminati mahasiswa untuk melanjutkan studi mereka ke tahap sarjana. Kebanyakan mahasiswa baru berasal dari luar kota, sehingga belum mengenal daerah sekitar Universitas Trunojoyo Madura. Seiring bertambahnya mahasiswa pendatang baru tersebut menyebabkan kebutuhan rumah kost meningkat, oleh karena itu dibutuhkannya sebuah sistem rekomendasi rumah kost untuk mempermudah mahasiswa dalam menentukan pilihan sesuai kebutuhan mereka. Sistem rekomendasi yang akan diusulkan pada penelitian ini ialah menggunakan metode k-means clustering untuk mengelompokkan data menjadi beberapa kelompok yang berbeda. Selain menggunakan metode k-means clustering, sistem rekomendasi menyediakan sistem berbasis mobile yang didukung dengan google maps untuk mempermudah mahasiswa pendatang baru mengetahui lokasi sekitar Universitas Trunojoyo Madura. Penelitan ini diharapkan dapat merekomendasikan beberapa item kepada mahasiswa yaitu item rumah kost dengan beberapa parameter seperti harga kost, jenis kost, kamar mandi dalam, kamar mandi luar, kulkas, dapur, tv, kipas angina, gratis wi-fi, gratis listrik dan jarak kost ke Universitas Trunojoyo Madura. Berdasarkan hasil implementasi metode K-means Clustering untuk rekomendasi rumah kost diperoleh akurasi persentase pengujian system&#40;P&#41; didapatkan 81.67%, sedangkan persentase pengujian akurasi(Q) didapatkan 79.53 %. Dengan begitu metode k-means clustering telah memberikan tingkat akurasi yang cukup tinggi dan layak untuk diaplikasikan.\n\nKata kunci: Rumah Kost, Sistem Rekomendasi, K-means Clustering, Mobile\n \n', 'Emi Elvi Ana Sari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100017'),
(635, '140411100020', 'PENERAPAN METODE ECONOMIC ORDER QUANTITY & SINGLE EXPONENTIAL SMOOTHING PADA SISTEM PERSEDIAAN BAHAN BAKU\n(Studi Kasus UD. Budi Jaya )', 'Wahyudi Agustiono, S.Kom., M.Sc.Phd', 'Eza Rahmanita, ST., M.T.', 'Bahan baku merupakan hal utama didalam perusahaan, terutama perusahaan industri, karena bahan baku merupakan bagian dari suatu proses produksi yang harus ada dan tidak dapat diabaikan keberadaannya. UD. Budi Jaya adalah perusahaan makanan khususnya cemilan yang bahan baku utamanya adalah buah salak. Di lokasi  terdapat perkebunan salak milik perusahaan danmenjadi sumber bahan baku yang dimana pohon berbuah hanya pada musimnya. Tetapi, saat pohon tidak dalam masa panenmenyebabkan  perusahaan harus membeli buah salak pada penyedia lain yang dimana perusahaan mengeluarkan modal  lebih untuk membeli bahan baku. Oleh karena itu, Penelitian ini bertujuan untuk dapat mengendalikan bahan baku, dengan menerapkan metode Economic Order Quantity yang dimana metode tersebut membantu perusahaan untuk memanajemen bahan baku salak. Dan Metode Single Exponential Smoothing untuk mendukung perhitungan Eqonomic Order Qunatity. Berdasarkan hasil penelitian yang dilakukan di UD.Budi Jaya, bahwa dengen menggunakan metode Economic Order Quantity menghasilkan kebutuhan bahan baku yang lebih efisien.Pada tahun 2014, perusahaan bisa meminimalisir bahan baku salak sebesar 662,2 kg, tahun 2015 sebesar 351,6 kg, tahun 2016 sebesar 628,3 kg, dan tahun 2017 sebesar 589,3 kg. biaya pembelian bahan baku dapat diminimalisir Pada tahun 2014 sebesar Rp. 1.409.618, tahun 2015 sebesar Rp. 2.312.449, tahun 2016 sebesar Rp. 2.596.150, dan tahun 2017 sebesar Rp. 2.496.757.', 'Diltsa Wahyu Nugraha', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100020'),
(636, '140411100022', 'Analisis Perbandingan Metode Certainty Factor dan Naive Bayes Dalam Diagnosis Penyakit Demam Berdarah Dengue (DBD) Berbasis Android ', '-', '-', 'Demam Berdarah Dengue (DBD) merupakan penyakit yang dapat membuat suhu tubuh penderita menjadi sangat tinggi dan pada umumnya disertai tanda gejala seperti sakit kepala, nyeri sendi, otot, dan tulang, serta nyeri di bagian belakang mata. Penyakit Demam Berdarah Dengue disebabkan oleh virus dengue yang penyebarannya terjadi melalui gigitan nyamuk Aedes aegypti dan Aedes albopictus. Dalam hal ini, untuk diagnosis dibutuhkan analisa yang akurat untuk meminimalisir kesalahan diagnosis yang membuat keterlambatan penanganan. Pada penelitian ini dibuatkan sistem pakar berbasis android untuk mendiagnosis penyakit DBD yang bertujuan sebagai pencegahan lebih awal. Sistem pakar tersebut akan memberikan pilihan gejala-gejala demam berdarah untuk dipilih oleh pengguna. Gejalagejala yang sudah dipilih oleh pengguna akan dihitung menggunakan metode Certainty Factor dan Naive Bayes. Dengan adanya sistem ini diharapkan dapat membantu masyarakat luas dalam melakukan diagnosis demam berdarah lebih cepat. Pengujian sistem dilakukan menggunakan metode K-fold cross validation dengan nilai k = 3. Berdasarkan uji coba menggunakan metode K-fold cross validation menunjukkan bahwa metode Naive Bayes mampu melakukan diagnosis lebih akurat dibandingkan Certainty Factor dengan hasil pengujian sebesar 76,5625 % dan 70,83333333 %. ', 'Fathur Rachman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100022'),
(637, '140411100024', 'PEMETAAN POTENSI TAMBAK GARAM DI PROVINSI JAWA TIMUR MENGGUNAKAN SINGLE LINKAGE', 'Mula\'ab, S.Si., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Garam merupakan komoditas strategis, Provinsi Jawa Timur salah satu pemasok terbesar garam nasional yang sentra produksinya berada di Madura. Madura adalah daerah yang mempunyai potensi untuk produksi garam sehingga dari dulu madura dikenal sebagai pulau garam. Namun tambak garam sebagai lahan untuk  menghasilkan garam tidak semuanya memiliki potensi yang bagus karena memiliki perbedaan dari aspek teknis yang mempengaruhi produktivitas tambak garam,  Untuk mengetahui kelompok tambak garam yang memiliki kesamaan dari aspek teknis. Dilakukan pengelompokan dengan menggunakan analisis cluster. Analsisis cluster adalah pengelompokan suatu objek kedalam kelompok yang lebih kecil dimana masing-masing kelompok memiliki objek kemiripan satu sama lain. proses pengelompokan dilakukan untuk tambak garam yang ada di Jawa Timur dengan menggunakan metode Single Linkage. Metode Single Linkage adalah suatu metode Hierarki yang mengelompokkan suatu objek yang memiliki jarak terdekat terlebih dahulu atau kemiripan yang paling besar. Hal ini dipengaruhi oleh perhitungan jarak menggunakan Euclidian Distance dan  pemetaan memanfaatkan teknologi Sistem Informasi Geografis pada data spasial tambak garam. Clustering Menggunakan Single Linkage dapat diukur menggunakan metode Silhouette Coefficient. Hasil dari penelitian ini menunjukkan nilai Silhouette Coefficient 0.9361 dalam cluster tambak garam di Provinsi Jawa Timur dengan nilai akurasi  93.61% dan dikategorikan strong structure \n\nKata kunci : Pemetaan,  Tambak Garam, Single Linkage, Provinsi Jawa Timur\n', 'Ahmad Choirul Huda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100024'),
(638, '140411100027', 'Perbandingan Metode Single Exponential Smoothing dan Backpropagation pada Peramalan Produksi Gula', 'Wahyudi Agustiono, S.Kom.,M.Sc,.Ph.D.', 'Eka Mala Sari Rochman, S.Kom., M.Kom.', 'Perusahaan harus mampu menyeimbangan produksi gula sesuai dengan permintaan pasar. Karena, jika produksi gula melebihi permintaan pasar akan menyebabkan penumpukkan dan biaya pengeluaran yang melebihi batas. Namun, jika produksi gula terlalu sedikit perusahaan tidak mampu memenuhi permintaan pasar sehingga dapat mengurangi kesempatan perusahaan untuk mendapatkan keuntungan. Untuk itu diperlukan sebuah sistem yang nantinya dapat mempermudah proses peramalan produksi gula. Sistem yang dibangun menggunakan perbandingan 2 metode, yaitu metode Single Exponential Smoothing dan metode Backpropagation. Tujuan dari penelitian ini untuk mengetahui hasil akurasi terbaik menggunakan metode Single Exponential Smoothing dan metode Backpropagation pada peramalan produksi gula. Metode Single  Exponential Smoothing dan Backpropagation digunakan untuk meramalkan jumlah produksi gula untuk satu bulan kedepan berdasarkan data produksi 5 bulan sebelumnya. Dari hasil pengujian yang telah dilakukan, dapat diketahui bahwa metode Backpropagation menghasilkan MSE dan MAPE terkecil, yaitu sebesar 57187817,49 dan MAPE sebesar 1,019593892% dibandingkan metode Single Exponential Smoothing dengan MSE sebesar 83602989,43 dan MAPE  sebesar 1,46412926%. Sehingga metode yang peling tepat untuk peramalan produksi gula yaitu metode Backpropagation.', 'Nita Eko Suryani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100027'),
(639, '140411100037', 'Pengenalan Obyek Berbasis Deep Learning Dengan Menggunakan Convolutional Neural Network', 'Dr. Arif Muntasa, S.Si,. M.T', 'Dr. Indah Agustien Siradjuddin, S.Kom., M.Kom', 'Bagi manusia, pengenalan obyek pada citra merupakan hal yang sangat mudah. Akan tetapi, untuk pengenalan obyek citra menggunakan mesin, tidaklah mudah. Mesin harus membaca setiap nilai pixel dari citra masukan dan menghasilkan sebuah nilai untuk menentukan kelas citra tersebut. Penelitian ini menggunakan metode Convolutional Neural Network (CNN) untuk pengenalan obyek pada citra. Metode ini tidak memerlukan feature engineering. Pada CNN terdapat beberapa layer seperti, Convolution Layer, Pooling Layer dan Fully Connected.  Dataset yang digunakan untuk pelatihan adalah dataset citra CIFAR10. Dataset CIFAR10 memiliki citra sebanyak 60000 terdiri dari 10 kelas. Untuk mempermudah pembuatan aplikasi menggunakan framework deep learning theano. Penelitian bertujuan untuk mengetahui dampak dari ukuran filter dan kedalaman layer pada CNN. Hasil yang didapat pada penelitian ini adalah dengan ukuran filter lebih besar, dapat menambah tingkat akurasi. Akurasi tertinggi untuk penelitian ini adalah 62.23%.', 'Wirat Moko Hadi Sasmita', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100037'),
(640, '140411100041', 'DETEKSI TEKS PADA SCENE TEXT IMAGE MENGGUNAKAN METODE DISCRETE SINE TRANSFORM', 'Rosida Vivin Nahari, S.Kom., M.T. ', 'Sigit Susanto Putro, S.Kom., M.Kom. ', 'Deteksi teks adalah proses mendeteksi teks yang ada dalam gambar, diikuti dengan mengelilinginya dengan kotak pembatas persegi panjang. Deteksi teks dapat dilakukan menggunakan teknik berbasis gambar atau teknik berbasis frekuensi. Banyak aplikasi membutuhkan deteksi teks pada gambar mulai dari deteksi otomatis rambu-rambu lalu lintas yang membantu dalam system transportasi, membantu orang tunanetra dan lain-lain. Pada penelitian ini data yang digunakan merupakan dataset focused Scene Text dengan gambar yang digunakan ukuran 640 x 480 pixel dengan format .jpg. Metode yang digunakan untuk mendeteksi teks pada gambar adalah Fast Fourier Transform (FFT) penggunaan metode fast fourier transform bertujuan meminimalkan kebutuhan memori pada citra digital, dan sejauh mana tingkat penurunan kualitas sebuah citra digital dan ukuran filenya jika dikenakan sebuah proses kompresi menggunakan metode FFT. Hasil rata-rata penelitian ini adalah precision adalah 0.44, recall 0.95 dan f1 score 0.55.', 'Noval Setiawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100041'),
(641, '140411100044', 'SISTEM PENDUKUNG KEPUTUSAN KELAYAKAN KREDIT DENGAN METODE FUZZY TSUKAMOTO PADA BANK UMKM JAWA TIMUR CABANG PAMEKASAN', 'Eza Rahmanita, S.T., M.T.', 'Devie Rosa Anamisa, S.Kom., M.Kom.', 'Pada saat ini, kredit sangat diminati oleh masyarakat dikarenakan dengan mengajukan permintaan kredit, masyarakat dapat membuka usaha atau untuk mengembangkan usahanya agar lebih maju. Bank BPR UMKM sendiri bergerak dalam bidang perkreditan usaha rakyat yang dimana sistem keputusan pemberian kreditnya masih menggunakan perhitungan manual dimana resiko adanya kredit yang bermasalah masih tinggi. Oleh sebab itu diperlukan sistem pendukung keputusan kelayakan kredit pada Bank BPR UMKM untuk mengetahui seberapa cepat proses yang dilakukan oleh pihak bank untuk melakukan penialaian kelayakan kredit menggunakan sistem ini. Berkaitan dengan tujuan tersebut penelitian ini menerapkan metode logika fuzzy tsukamoto. Dari data uji sebanyak 50 data yang telah dilakukan menghasilkan tingkat akurasi sebesar 90% ', 'Prianuari Afanita Devi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100044'),
(642, '140411100046', 'DIAGNOSA PENYAKIT BUAH BELIMBING MENGGUNAKAN\nMETODE DECISION TREE C4.5 (Studi Kasus: Kebun Belimbing Desa Ngringinrejo Kecamatan\nKalitidu Kabupaten Bojonegoro, Jawa Timur)', 'Mula’ab, S.Si., M.Kom.', 'Eka Mala Sari Rochman, S.Kom., M.Kom.', 'Belimbing manis (Averhoa Carambola L.) merupakan salah satu\npotensi hortikultura yang bersifat komersial dan berpeluang sebagai sumber pendapatan bagi masyarakat. Banyak masyarakat yang ingin membudidayakan buah belimbing, akan tetapi buah belimbing sangat rentan terhadap organisme pengganggu tanaman hal ini dapat membuat petani harus berpikir ulang. Masalah utama yang terdapat pada buah belimbing yaitu serangan hama lalat buah dan ulat buah yang memiliki gejala hampir sama, jika tidak dilakukan penanganan secara benar akan mengakibatkan dampak yang tidak diinginkan seperti kegagalan panen sehingga dapat mengakibatkan produksi buah belimbing berkurang. Dalam penelitian ini menggunakan metode Decision Tree C4.5. Metode Decision Tree C4.5 merupakan metode yang digunakan untuk klasifikasi berdasarkan cabang pohon atau pertanyaan klasifikasi dan daun atau disebut dengan kelas. Akurasi yang diperoleh sistem diagnosa penyakit buah belimbing dengan dilakukan pengujian K-Fold Cross Validation untuk membagi data menjadi 5 bagian yang terdiri dari 160 data training dan 40 data testing diperoleh nilai rata-rata akurasi menggunakan metode Confusion Matrix sebesar 99.5%. Hasil perhitungan rata-rata F-Measure diperoleh nilai akurasi Precision dan Recall lalat buah sebesar 99.62% dan ulat buah sebesar 99.62%. Tingkat kelayakan pemodelan pada sistem diagnosa penyakit buah belimbing diperoleh nilai rata-rata akurasi sebesar 94.57% yang melibatkan 6 responden dengan pertanyaan kuesioner sebanyak 10.', 'Ainur Rofiq', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100046'),
(643, '140411100048', 'IMPLEMENTASI MVC (Model View Controller) PADA APLIKASI LAYANAN ADMINISTRASI DESA DENGAN MEMANFAATKAN API DISDUKCAPIL', 'Achmad Jauhari, S.Kom., M.T. ', 'Yoga Dwitya Pramudita, S.Kom., M.Cs. ', 'ABSTRAK \nPemerintahan Desa (kelurahan) merupakan satu pemerintahan yang bertugas mengelola dan mempunyai kewajiban dalam melayani administrasi penduduk di tingkat desa. Proses adminnistrasi penduduk di Desa Larangan Dalam, Pamekasan, Madura ini sekarang masih berjalan manual yaitu seperti proses pengajuan atau pendaftaran bagi penduduk yang ingin mengajukan surat keterangan dll, masih terbilang cukup sulit, karena penduduk harus mendatangi rumah petugas desa dan masih diproses sehari setelah pengajuan tersebut, dan juga penyediaan berkas yang masih tidak efektif karena sistem penyimpanan berkas saat ini masih terbilang tradisional dengan menyimpan berkas dalam ordner. Penyimpanan berkas digital sebagai Salinan berkas asli masih dikelola secara manual yang kemudian semakin tidak terstruktur sehingga kurang efisien. Dari permasalahan di atas akan mengimplementasikan metode Model View Controller (MVC) untuk proses membangun aplikasi yang berbasis web dan API Disdukcapil untuk mempermudah petugas desa mendapatkan data diri dari penduduk yang melakukan proses administrasi dengan hanya memasukkan NIK. Harapan dari penelitian ini, aplikasi Pelayanan Administrasi Desa yang berbasis web dapat mempermudah petugas desa dalam pemprosesan administras yang diajuakan penduduk desa agar lebih efektif dan efisien serta terstruktur. \n \nKata Kunci : Administrasi Desa, Surat, Metode MVC, Framework Laravel.', 'Chandra Jaka Sukmawan', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100048'),
(644, '140411100051', 'DETEKSI LETAK PLAT NOMOR DAN SEGMENTASI KARAKTER PLAT NOMOR  KENDARAAN MENGGUNAKAN METODE HARRIS CORNER', 'Fitri Damayanti, S.Kom., M.Kom', 'Eza Rahmanita, S.T., M.T.', 'ABSTRAK\nKendaraan bermotor adalah alat transportasi yang cukup digemari terutama kendaraan bermotor roda empat yang semakin meningkat. Kesadaran masyarakat dan kurang efisiennya sistem lalu lintas memberikan dampak waktu empuh dalam melakukan perjalanan, dampak yang lebih parah yakni lumpuhnya lalulintas di kota-kota besar. Dari permasalahan tersebut, penelitian ini melakukan deteksi letak plat nomor menggunakan metode Harris Corner dan segmentasi karakter plat nomor menggunakan Otsu Threshold sebagai salah satu upaya untuk menerapkan sistem lalu lintas cerdas. Dengan menggunakan data uji sebanyak 100 citra kendraan bermotor, hasil deteksi letak plat nomor menggunakan Harris Corner sebesar 90%, sedangkan segmentasi karakter plat nomor menggunakan metode Otsu Threshold mempunyai hasil akurasi sebesar 84,14%. Keduanya memiliki akurasi yang cukup tinggi dan bisa menjadi opsi untuk menghindari lumpuhnya lalu lintas terutama pada pintu masuk tol.\n\nKata Kunci :Deteksi letak plat nomor, Harris corner, Segmentasi karakter, otsu threshold.\n', 'Achmad Munsharif', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100051'),
(645, '140411100052', 'DIAGNOSIS TUBERKULOSIS DENGAN NAÏVE BAYES DAN MENU DIET BAGI PENDERITANYA DENGAN FORWARD CHAINING', 'Wahyudi Agustiono, S.Kom., M.Sc,. PhD.', 'Eka Mala Sari Rochman, S.Kom, M.Kom.', 'Tuberkulosis merupakan penyakit yang disebabkan oleh bakteri, dapat ditularkan melalui dahak ataupun udara. Penyakit ini dapat menyerang semua usia dari berbagai kalangan, namun kebanyakan yang mengidap tuberkulosis adalah usia produktif antara 15 – 55 tahun. Sedangkan banyak masyarakat yang tidak mengetahui bahaya dari penyakit tuberkulosis, masyarakat enggan melakukan pemeriksaan karena membutuhkan serangkaian pengujian laboraturium. Sehingga perlu adanya sistem pakar yang dapat membantu dalam melakukan diagnosis dini pada penyakit tuberkulosis untuk menggurangi penyebaran dan mempercepat penangganan pasien. Sistem pakar diagnosis penyakit tuberkulosis ini menerapkan algoritma Naïve bayes yang menghasilkan keputusan dari konsultasi menjawab beberapa pertanyaan berupa gejala – gejala yang dialami, selain itu agar penderita dapat memiliki status gizi yang baik untuk membantu proses penyembuhan dibutuhkan menu diet yang diimplementasi melalui metode Forward chaining dengan memanfaatkan fakta - fakta yang dimiliki pengguna untuk dicocokkan dengan aturan yang ada pada sistem. Sistem ini memilki tingkat akurasi 97,2% pada diagnosis dengan naive bayes dan 93% pada rekomendasi menu diet dengan metode forward chaining.', 'Lailil Muflihah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100052');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(646, '140411100054', 'PERTANIAN MODERN DENGAN INTERNET OF THINGS\n(IOT) UNTUK MONITORING KONDISI LINGKUNGAN\n(Studi Kasus : UPT Pengembangan Agribisnis Tanaman Pangan\ndan Hortikultura Lebo, Sidoarjo)', 'Mula’ab,S.Si.,M.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Pada pertanian modern sistem pengolahan tumbuh kembang\ntanaman menjadi hal yang lebih diprioritaskan yang bertujuan untuk\nmendapatkan hasil tumbuhan yang berkualitas seperti halnya pengolahan\ntanaman dalam greenhouse. Pengendalian lingkungan dalam greenhouse\npenting dilakukan yang mana disesuaikan dengan kasus yang terjadi di\nUPT pengembangan agribisnis tanaman pangan dan holikultura Lebo\nSidoarjo yang memiliki greenhouse dengan lebar 40 meter, panjang 80\nmeter dan tinggi 16 meter. Selain itu varietas melon yang di tanam dalam\ngreenhouse tersebut memerlukan suhu 25-30°C dan kelembaban berkisar\n70% sampai 80%. Dengan kondisi seperti itu maka suhu dan kelembaban\ndalam ruangan harus di jaga kestabilannya. Masalah-masalah tersebut\ndiselesaikan dengan memanfaatkan Internet of Things (IoT) berbasis\naplikasi android dengan pengambilan data melalui sensor mikrokontroler\nArduino sehingga dapat mempermudah pertani dalam melakukan\nmonitoring suhu dan kelembaban ruangan greenhouse secara realtime\ndari jarak jauh. Dari pengujian yang telah dilakukan dihasilkan Root\nMean Square Error (RMSE) suhu sebesar 2.93 dan kelembaban sebesar\n11.67. Sedangkan pengujian pada tanaman yang belum berbuah diperoleh\nhasil suhu sebesar 2.92 dan kelembaban sebesar 13.17. sedangkan pada\ntanaman yang sudah berbuah dan diperoleh hasil suhu sebesar 2.97 dan\nkelembaban sebesar 8.23. Sedangkan pengujian yang telah dilakukan\npada tanaman pagi hari diperoleh suhu sebesar 3.32 dan kelembaban\nsebesar 12.43. Sedangkan pengujian pada siang hari diperoleh hasil suhu\nsebesar 2.18 dan kelembaban sebesar 10.35. Dari hasil tersebut dapat\ndisimpulkan bahwa Root Mean Square Error (RMSE) yang lebih kecil\ndikatakan lebih akurat dari pada hasil lebih besar.\nKata Kunci: Petanian, Greenhouse, Internet of Things (IoT),\nMikrokontroller Arduino, Root Mean Square Error (RMSE).', 'Muhammad Syaiful Rizal', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100054'),
(647, '140411100056', 'KOMBINASI ANTARA TERM WEIGHTING DENGAN INTEGRATED COLOR AND INTENSITY CO- OCCURENCE MATRIX UNTUK DUA LAPIS TEMU KEMBALI CITRA PADA MEDIA SOSIAL TWITTER', 'Dr. Indah Agustien Siradjuddin, S.Kom, M.Kom.', 'Moch. Kautsar Sophan, S.Kom., M.MT.', 'Content Based Image Retrieval &#40;CBIR&#41; ialah salah satu teknik yang digunakan untuk melakukan pencarian citra berbasis isi. Meskipun hasil pencarian dari CBIR relevan dengan query yang diberikan oleh user, tetapi terkadang hasilnya tidak seperti yang diinginkan oleh user. Sehingga untuk mengatasi permasalahan tersebut dalam penelitian ini akan digunakan dua lapis sistem temu kembali yang mengkombinasikan text retrieval dengan model Vector Space Model (VSM) dan pembobotan menggunakan Term Frequency - Inverse - Document Frequency (TF-IDF) dikombinasikan dengan CBIR yang menggunakan Integrated Color and Intensity Co-Occurence Matrix (ICICM) sebagai metode feature extraction untuk citra. Feature yang digunakan pada ICICM ialah tekstur dan warna yang merupakan 2 feature tingkat rendah yang sering digunakan untuk klasifikasi citra dan retrieval. Tujuan dari penelitian ini ialah mengkombinasikan dua lapis sistem temu kembali yaitu text dan content based untuk mendapatkan hasil retrieval yang lebih baik. Data yang digunakan dalam penelitian ini berasal dari media sosial Twitter dengan query teks berupa “wisata madura”. Hasil yang didapat dari penelitian ini adalah dengan menggunakan kombinasi text based dengan content based dapat meningkatkan precision dan recall hasil retrieval meskipun tanpa melakukan pencarian dalam seluruh dataset. Hasil yang yang didapatkan pada penelitian ini adalah dengan menggunakan kombinasi antara text based dengan content based hasilnya lebih baik dibandingkan dengan menggunakan text based saja yaitu dengan kenaikan sebesar 0,0576 untuk precision dan dengan recall yang sama. Sedangkan dengan menggunakan kombinasi antara text based dengan content based hasilnya lebih baik dibandingkan dengan menggunakan content based saja yaitu dengan kenaikan sebesar 0,0238 untuk precision dan dengan recall sebesar 0,2000.', 'Reza Pahlevi Bahruddin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100056'),
(648, '140411100060', 'PENENTUAN PRIORITAS PERBAIKAN JALAN DENGAN METODE FUZZY C-MEANS DAN SIMPLE MULTI ATTRIBUTE RATING TECHNIQUE (SMART) (Studi Kasus : Dinas Pekerjaan Umum dan Penataan Ruang (PUPR) Kabupaten Bangkalan, Jawa Timur)\n', 'Mula’ab,S.Si.,M.Kom', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Dinas Pekerjaan Umum dan Penataan Ruang (PUPR) Kabupaten Bangkalan bertanggungjawab untuk memperbaiki kerusakan jalan tingkat kabupaten. Dalam penanganannya terdapat beberapa kendala diantaranya keterbatasan jumlah dana dari pusat pemerintah dan banyaknya jumlah jalan yang rusak. Oleh karena itu, perlu dilakukan penelitian untuk menentukan prioritas perbaikan jalan dengan memperhatikan kriteria-kriteria yang ada diantaranya panjang ruas jalan, lebar ruas jalan, panjang tiap kondisi (baik, sedang, rusak ringan dan rusak berat). Dalam penelitian ini dilakukan penggabungan dua metode yaitu Fuzzy C-Means (FCM) dan Metode Simple Multi Attribute Rating Technique (SMART). Metode FCM adalah metode yang mampu mengelompokkan data berdasarkan karakteristik yang dimilikinya dan SMART merupakan metode yang mampu menyelesaikan masalah dengan multikriteria. Dengan penggabungan dua metode pada penentuan prioritas perbaikan jalan menghasilkan tingkat akurasi sebesar 80%. Nilai akurasi ini diperoleh dengan cara menganalisa tingkat persamaan hasil perhitungan yang dilakukan oleh orang ahli di dinas Pekerjaan Umum dan Bina Marga Kota Surabaya terhadap sistem yang kita buat. Pembuatan SPK ini memiliki tingkat kesesuaian seperti apa yang diinginkan oleh user /  pengguna sebesar 73,4% berdasarkan kuesioner terhadap 6 responden.', 'Sutrisno', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100060'),
(649, '140411100061', 'SISTEM PENDUKUNG KEPUTUSAN UNTUK PEMILIHAN OBJEK WISATA DI MADURA MENGGUNAKAN METODE FUZZY', 'Aeri Rachmad, S.T., M.T', 'Eka Mala Sari Rochman, S.Kom.,M.Kom', 'Madura merupakan salah satu pulau yang terletak di provinsi Jawa Timur yang memiliki 4 kabupaten yaitu bangkalan, sampang, pamekasan, sumenep. Di setiap kabupaten/ daerah yang berada di madura memiliki potensi wisata yang dapat dikunjungi. Namun permasalahan yang dihadapi yaitu belum adanya sistem yang mewadahi potensi wisata di Madura. Selain itu, wisatawan kesulitan mendapatkan informasi wisata resmi mengenai objek wisata dalam ruang lingkup Madura. Oleh sebab itu, diperlukan suatu sistem pendukung keputusan untuk pemilihan objek wisata di Madura  sebagai salah satu cara dalam memberikan  kemudahan pada calon wisatawan untuk dapat memilih objek wisata di Madura yang sesuai kriteria dan banyaknya pengunjung.  Berkaitan dengan  tujuan tersebut penelitian ini menerapkan metode logika Fuzzy sebagai model pendukung keputusan dalam pemilihan daftar objek wisata di Madura. Fuzzy digunakan karena metode ini merupakan suatu bentuk model pendukung keputusan dimana peralatan utamanya adalah sebuah hirarki fungsional dengan input utamanya kriteria yang telang ditentukan. Sehingga nantinya hasil yang diharapkan dapat membantu mempermudah calon wisatawan dalam mengambil keputusan untuk memilih objek wisata yang ada di Madura. Berdasarkan hasil penelitian yang dilakukan menghasilkan tingkat akurasi 100%.', 'IFAN PRATAMA PUTRA', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100061'),
(650, '140411100063', 'Sistem Informasi Geografis Berbasis Android Untuk Pemetaan Lokasi Wisata Di Kabupaten Mojokerto Menggunakan Algoritma Greedy', 'Wahyudi Agustiono, S.Kom.,M.Sc.,PhD', 'Yoga Dwitya Pramudita, S.Kom.,M.Cs', 'Mojokerto merupakan salah satu kabupaten di Jawa Timur yang memiliki berbagai macam kebudayaan, tradisi, sejarah hingga wisata yang menarik. Keanekaragaman tersebut berpotensi menjadikan Mojokerto menjadi tempat yang ramai dikunjungi para wisatawan. Waktu yang singkat dan banyaknya destinasi wisata yang ingin dikunjungi, membuat wisatawan harus menjadwalkan perjalanan wisatanya seefektif mungkin. Dengan mengimplemetasikan Traveling Salesman Problem menggunakan algoritma Greedy aplikasi dapat memberikan informasi kepada pengguna tentang rute paling optimum menuju beberapa lokasi wisata, pengguna dapat menentukan jalur yang akan dilalui untuk mengatasi efesiensi waktu. Algoritma Greedy dipilih dalam kasus Traveling Salesman Porblem karena algoritma ini dapat memberikan sebuah solusi terbaik untuk permasalahan optimasi dengan waktu pemrosesan yang cepat. Selain memberikan rute paling optimum, sistem juga memberikan informasi deskripsi mengenai destinasi wisata, tempata makan, dan penginapan yang dibutuhkan oleh wisatawan. Hasil dari implementasi Sistem Informasi Geografis Menggunakan Algoritma Greedy, didapatkan performa yang Baik dimana dapat dilihat dari akurasi ketepatan rekomendasi rute yang diberikan cukup sesuai dengan rekomendasi yang diberikan oleh dinas pariwisata, dan dalam pemroresan Algoritma Greedy cukup singkat dengan kisaran waktu kurang dari 1 detik. Sistem cukup membantu wisatawan dalam memberikan informasi mengenai destinasi wisata dan menunjukan rekomendasi rute yang optimum yang dapat dilihat dari pengujian respon user yang mendapatkan nilai 79,8 %.', 'Aprilia Wahyu Hadi Saputri', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100063'),
(651, '140411100069', 'PENGENALAN PENYAKIT PADA DAUN JAGUNG DENGAN METODE K-NEAREST NEIGHBOUR BERBASIS FITUR GREY LEVEL RUN-LENGTH MATRIX DAN FUZZY COLOR HISTOGRAM', 'Fitri Damayanti, S.Kom., M.Kom.', 'Mohammad Syarief, S.T., M.Cs.', 'Jagung merupakan salah satu tanaman yang cukup penting, karena jagung adalah komoditas pangan terbesar kedua setelah padi. Akan tetapi kebutuhan atas komoditas jagung di Indonesia masih belum tercukupi sehingga harus mengimpor dari negara lain. Di antara salah satu faktornya adalah hama dan penyakit yang menyerang tanaman jagung yang menyebabkan rendahnya hasil panen jagung. Sehingga teknik pemrosesan citra digital perlu diterapkan untuk mendeteksi penyakit tanaman jagung sejak dini. Metode yang akan digunakan adalah Fuzzy Color Histogram (FCH) untuk ekstraksi warna karena keunggulan metode ini yaitu tidak terlalu sensitif dengan noisy dan perbedaan cahaya. Sedangkan untuk ekstraksi fitur tekstur, metode yang akan digunakan adalah metode Gray Level Run-Length Matrix (GLRLM). Dari data uji sebanyak 3.847 citra daun jagung, hasil akurasi tertinggi dari metode FCH adalah 73.95%, untuk metode GLRLM adalah 69.17%, sedangkan untuk penggabungan keduanya menghasilkan akurasi paling tinggi yaitu 81.29%.', 'Nurul Huda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100069'),
(652, '140411100070', 'KLASTERISASI BERITA OLAHRAGA BERBAHASA INDONESIA DENGAN METODE K-MEANS YANG DIMODIFIKASI', 'Sigit Susanto Putro, S.Kom, M.Kom', 'Yoga Dwitya Pramudita, S.Kom, M.Cs', 'Berbagai cabang olahraga seperti sepak bola, tenis meja, bulu tangkis, dan lainnya mengharuskan setiap berita olahraga untuk dikelompokkan sesuai dengan cabangnya. Oleh karena itu diperlukan cara untuk mengelompokkan berita olahraga yang memiliki kesamaan. Pengelompokkan dapat dilakukan dengan banyak metode. Metode yang bisa menangani permasalah ini salah satunya adalah k-means clustering. K-means clustering adalah metode pengelompokan yang bisa bekerja dengan dataset yang besar dengan efisien. Namun metode ini memiliki permasalahan disaat penentuan awal pusat cluster. Hasil akhir cluster dari k-means sangat bergantung pada penentuan awal ini. Metode cosine similairty dapat membantu k-means clustering mendapatkan pusat cluster yang baik. Pada penelitian ini pengelompokan berita olahraga berbahasa Indonesia dilakukan dengan metode k-means clustering yang telah dimodifikasi dengan cosine similarity. Hasil yang didapatkan dari percobaan adalah pusat cluster terbaik yang dihasilkan oleh metode k-means selalu terjadi perubahan, bergantung pada penentuan awal pusat cluster. Setelah dilakukan modifikasi pada penentuan awal, pusat cluster terbaik cenderung konstan, yaitu sebanyak 4 pusat cluster dengan nilai akurasi rata-rata 0.895.', 'Wahit Abdulloh', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100070'),
(653, '140411100071', 'Diagnosis Penyakit Diabetes dengan Fuzzy Logic Metode Sugeno dan Rekomendasi Pola Makan menggunakan Metode Naive Bayes', 'Wahyudi Agustiono, S.Kom., M.Sc,. PhD.', 'Eka Mala Sari Rochman, S.Kom, M.Kom.', 'Diabetes adalah penyakit yang disebabkan karena peningkatan gula darah dalam tubuh. Diabetes termasuk penyakit mematikan yang jumlah penderitanya terus meningkat dari tahun ke tahun. Hal ini disebabkan karena keterlambatan diagnosis dan pola makan yang kurang baik. Penyakit ini ditandai dengan peningkatan kadar gula yang berkelanjutan terutama setelah makan. Sehingga penderita diabetes sangat dianjurkan mengatur pola makan sesuai dengan jumlah kalori yang dibutuhkan. Kurangnya pengetahuan masyarakat tentang gizi menjadi hal sulit bagi mereka dalam menentukan pola makan sehat. Terkadang beberapa orang melakukan diet yang salah dan berakibat memperburuk kesehatan tubuh. Untuk itu diperlukan adanya sebuah aplikasi yang bisa membantu dalam mendiagnosis penyakit diabetes dan memberi rekomendasi pola makan. Aplikasi tersebut dibangun dengan implementasi fuzzy logic metode sugeno dan metode naïve bayes. Fuzzy logic metode sugeno digunakan untuk diagnosis penyakit diabetes sedangkan metode naïve bayes untuk rekomendasi pola makan. Hasil dari implementasi fuzzy logic metode sugeno dalam mendiagnosis penyakit diabetes, didapat nilai akurasi sebesar 76.67%. Dengan demikian hasil konversi akurasi diagnosis menunjukkan bahwa hasil diagnosis adalah “baik”. Sedangkan untuk rekomendasi pola makan, setelah dilakukan 5 kali uji rekomendasi maka didapat hasil rata-rata akurasi sebesar 72%. Dengan demikian implementasi metode naïve bayes dalam rekomendasi pola makan menunjukkan bahwa hasil rekomendasi adalah “baik”.', 'Risa Anggraeni', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100071'),
(654, '140411100074', 'SISTEM REKOMENDASI PENJADWALAN PRODUKSI DENGAN ALGORITMA GENETIKA UNTUK MEMINIMALISASI MAKESPAN PADA ALIRAN FLOW SHOP', 'Wahyudi Agustiono, S.Kom., M.Sc., Ph.D.', 'Eka Mala Sari Rachman, S.Kom., M.Kom.', 'Konveksi Total Sport dalam proses produksinya menggunakan pola aliran yaitu flow shop (job yang akan diproses mengalir pada jalur atau arah produksi yang sama) dan perusahaan menggunakan aturan First Come First Serve(FCFS). Metode FCFS tidak memperhatikan nilai dari makespan, ini tidak menguntungkan bagi pesanan yang membutuhkan waktu proses pendek karena jika pesanan ini berada di belakang pesanan yang mempunyai waktu proses jangka panjang, maka harus menunggu lama dan menyebabkan waktu keseluruhan produksi menjadi lebih panjang. Penelitian bertujuan memberikan rekomendasi penjadwalan pengerjaan pesanan dengan nilai makespan yang minimum. Makespan merupakan total waktu yang diperlukan untuk penyelesaian pekerjaan mulai dari urutan pertama yang dikerjakan pada mesin, atau Work Center pertama hingga terakhir. Pada penelitian ini, diusulkan suatu metode penjadwalan produksi dengan menggunakan algoritma genetika yang digunakan untuk meminimisai makespan dari penjadwalan, kemudian dilakukan perbandingan makespan antara penjadwalan metode FCFS dan metode Algoritma Genetika. Nilai fitness dari individu terbaik dipantau. Pada setiap generasi dengan jumlah populasi yang berbeda dan jumlah generasi tertinggi, nilai dari makespan tinggi, sehingga parameter yang digunakan adalah : jumlah generasi = 40, ukuran populasi = 80, peluang crossover=0,1 dan peluang mutasi = 0,001. Hasil akurasi  dengan Parameter Performansi Penjadwalan diperoleh 8,98% Algoritma Genetika lebih baik dari FCFS dengan minimal makespan dari AG yaitu 67,60 jam, sedangkan makespan dari metode FCFS  yaitu 73,67 jam, terdapat pengurangan makespan sebesar 6,07 jam.\n\n\nKata Kunci : Penjadwalan Produksi, Minimalisasi Makespan, Aliran Flow Shop, Algoritma Genetika.', 'Trimaya', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100074'),
(655, '140411100075', 'ESTIMASI BOBOT KAMBING MENGGUNAKAN BLOB DETECTION', 'Rosida Vivin Nahari,S.Kom.,M.T', 'Sigit Susanto Putro, S.Kom., M.Kom', 'Kambing adalah salah satu hewan ternak yang dimanfaatkan oleh manusia salah satunya adalah untuk dijadikan hewan ternak untuk diambil dagingnya. Penentuan harga kambing pada umumnya berdasarkan kesepakatan tawar menawar antara penjual dan pembeli bukan berdasarkan bobot dan jenis kambing. Harga yang di sepakati biasanya menggunakan perhitungan kasar. Untuk mengukur bobot hewan ternak dapat menggunakan timbangan konvensional. Cara lain dapat menggunakan rumus lambourne untuk mengetahui bobot estimasi hewan ternak. Oleh karena itu, untuk mempermudah dalam mengukur bobot kambing di butuhkan suatu sistem yang mampu mengestimasi bobot kambing yang lebih efisien. Pada penelitian kali ini metode yang digunakan adalah BLOB (Binary Large Object). Jumlah data yang digunakan adalah 40 data kambing dengan 3 jarak pengambilan citra yaitu 50cm, 70cm, dan 90cm. Tujuan dari penelitian ini untuk memberikan manfaat bagi kedua pihak baik penjual maupun pembeli dalam menentukan bobot kambing yang digunakan untuk menentukan perkiraan harga kambing yang sesuai. Hasil pengujian Mann Whitney Test pada skenario I terdapat perbedaan signifikan sebesar 0.012 pada uji panjang badan, dan hasil pengujian akurasi menggunakan RMSE (Root Mean Squere Error) yang terbaik adalah pada skenario III sebesar 45.94, karena nilainya paling rendah diantara 3 skenario uji coba.\'', 'SRI BULAN MEGAWATI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100075'),
(656, '140411100080', 'Implementasi Metode Weighted Product Untuk Sistem Tata Kelola Zakat Maal', 'Mula\'ab, S.Si., M.Kom', 'Eza Rahmanita, S.T.,M.T', 'Badan Amil Zakat Nasional (BAZNAS) Bojonegoro merupakan\nsalah satu lembaga yang bertanggung jawab untuk menerima dan\nmenyalurkan zakat di kabupaten Bojonegoro. Dalam penentuan penerima\nzakat masih dilakukan secara manual sesuai kriteria yang ada. Hal itu\nmembuat pemilihan calon penerima zakat kurang efektif secara waktu.\nOleh karena itu perlu adanya sebuah sistem terkomputerisasi atau Sistem\nPendukung Keputusan untuk penentuan penerima zakat berdasarkan\nkriteria yang ada. Kriteria yang akan digunakan pada penelitian ini ada\nempat yaitu kondisi rumah, kondisi ekonomi, kondisi fisik dan\ntanggungan. Sistem yang akan dibangun pada penelitian ini menggukan\nmetode Weighted Product, metode Weighted Product dipilih karena\nmampu menyeleksi alternatif terbaik dari sejumlah alternatif dan\nkeunggulannya dalam teknik pembobotan. Penelitian dilakukan dengan\nmencari nilai bobot untuk setiap kriteria, kemudian dilakukan\nperangkingan yang akan menghasilkan alternatif terbaik. Dengan sistem\ntersebut diharapkan mampu memudahkan Badan Amil Zakat Nasional\nKabupaten Bojonegoro untuk menentukan prioritas kelayakan penerima\nzakat. Dari hasil pengujian, sistem menghasilkan tingkat akurasi tertinggi\nsebesar 92% jika dibandingkan dengan hasil pengolahan manual oleh\nBadan Amil Zakat Nasional (BAZNAS) Kabupaten Bojonegoro.\nKata Kunci: penerima zakat, Sistem Pendukung Keputusan, Weighted\nProduct.', 'Ahmad Bakhtiar', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100080'),
(657, '140411100081', 'PERBANDINGAN ALGORITMA MAZE GENERATION PADA PERMAINAN ONLINE MAZE SURVIVAL BERBASIS WEBGL DENGAN PENYIMPANAN PADA CLOUD', 'Yonathan Ferry Hendrawan., S.T., M.IT.', 'Ari Kusumaningsih, S.T., M.T.', 'Permainan adalah salah satu media hiburan yang dimainkan oleh semua kalangan baik dari anak-anak hingga dewasa, terutama permainan online. Permainan online merupakan jenis permainan yang banyak diminati, hal ini menjadi alasan permainan online terus dikembangkan. Pada penelitian ini, sebuah permainan online dikembangkan dengan mengimplementasikan algoritma maze generation yang terbaik dan penyimpanan cloud untuk pembuatan permainan maze. Algoritma yang dibandingkan adalah Binary Tree, Aldous-Broder, Hunt-and-Kill, Growing Tree, dan Wilson’s. Algoritma pilihan yang terbaik diterapkan untuk menghasilkan lintasan maze sedangkan penyimpanan cloud digunakan untuk menyimpan akun player, score, dan result games. Selain itu, permainan ini juga dibuat menggunakan WebGL untuk pembuatan objek berbasis web. Hasil pengujian perbandingan maze menunjukkan bahwa algoritma tercepat untuk membuat maze adalah algoritma Binary Tree dengan rata-rata waktu 5,13 miliseconds pada ukuran maze 30x30. Dalam pengujian efisiensi penyimpanan, penyimpanan cloud lebih efisien dibandingkan penyimpanan lokal, dengan rata-rata waktu 21,20 miliseconds.', 'Abdullah Fahmi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100081'),
(658, '140411100084', 'PENCARIAN TEKS MENGGUNAKAN METODE ENHANCED\nCONFIX STRIPPING STEMMER DAN COSINE SIMILARITY\nPADA TERJEMAHAN TAFSIR AL-QUR’AN', 'Achmad Jauhari S.T., M.Kom', 'Yoga Dwitya Pramudita,S.Kom.,M.Cs', 'Al-qur’an merupakan kitab suci yang menjadi pedoman bagi umat\nIslam. Al-qur’an juga telah diterjemahkan ke dalam berbagai bahasa\nuntuk mempermudah memahami makna setiap ayat dalam Al-qur’an.\nNamun, masih banyak yang kurang memahami makna pada terjemahan\nayat al-qur’an, sehingga dibutuhkan suatu tafsir atau penjelasan terperinci.\nSeiring dengan perkembangan teknologi, banyak tafsir al-qur’an digital\nyang telah dilengkapi dengan sistem pencarian. Akan tetapi, masih\nterdapat kesulitan untuk mencari sebuah tafsir al-qur’an yang sesuai\ndengan bahasan atau topik dikarenakan satu surat dengan surat lainnya\nmemiliki persamaan dan perbedaan topik tertentu. Oleh karena itu\ndiusulkan suatu sistem pencarian teks menggunakan Information Retrival\nyang memungkinkan pengguna menemukan informasi yang relevan atau\nsesuai kebutuhan. Penelitian ini menggunakan metode Enhanced Confix\nStripping Stemmer yang digunakan untuk proses pembentukan kata dasar\nyang akurat dan metode Cosine Similarity untuk menghitung kemiripan\nquery dengan keyword query di database. Berdasarkan hasil pengujian\nsistem menggunakan stemming Enhanced Confix Stripping Stemmer\ndidapatkan nilai akurasi (precision) sebesar 71.96% dan tingkat\nkemampuan untuk mengambil semua ayat yang relevan (recall) 98.64%,\nsedangkan tanpa menggunakan stemming didapatkan nilai akurasi\n(precision) sebesar 82.95% dan tingkat kemampuan untuk mengambil\nsemua ayat yang relevan (recall) sebesar 76.70 %.', 'Nourma Pangestika Wulan Diantisari', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100084'),
(659, '140411100085', 'PENERAPAN METODE SITUATED LEARNING DALAM PEMBUATAN APLIKASI VIRTUAL REALITY (Studi Kasus : Candi Penataran, Blitar)', 'Wahyudi Agustiono, S.Kom., M.Sc., Ph.D', 'Ari Kusumaningsih, S.T., M.T.', 'Candi Panataran dikenal sebagai salah satu candi Hindu tertua di Indonesia memiliki sejarah panjang yang dapat dijadikan sebagai media pembelajaran. Minimnya informasi yang bisa didapat di area wisata Candi Panataran membuat pengunjung hanya memanfaatkan waktunya untuk berswafoto tanpa mengerti apa yang ada disana. Oleh karena itu dibutuhkan suatu aplikasi yang dapat memperkenalkan Candi Panataran dari sejarah, fungsi, letak, dan cerita. Pengintegrasian visual candi ke dalam dunia virtual dengan metode Situated Learning menghasilkan suatu aplikasi Virtual Reality yang dapat mensimulasikan keadaan Candi Panataran berbasis Android. Pengguna dapat merasakan sensasi nyata menjelajah Candi Panataran. Metode Situated Learning digunakan sebagai desain informasi apa saja yang ditampilkan dalam penjelajahan candi. Situated Learning dipilih karena efektivitas dalam membangun aplikasi Virtual Reality dengan prosentase 80,7% yang berarti sangat baik. Aplikasi Virtual Reality Candi Panataran juga efektif untuk pembelajaran sejarah Candi Panataran di buktikan dengan prosentase hasil pengujian User Experince sebesar 79,8% yang berarti baik dan pengujian Heuristic secara umum dengan nilai prosentase sebesar 80% berarti sangat baik, serta pada uji Heuristic secara khusus oleh Dinas Pariwisata Budaya Pemuda, dan Olahraga dengan prosentase 72% yang berarti baik dan aplikasi dapat dijadikan sebagai media promosi Candi Panataran.\n\nKata kunci : Virtual Reality, Situated Learning, Candi Panataran', 'ROUDHOTUL JANNAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100085'),
(660, '140411100087', 'KLASIFIKASI BERITA OLAHRAGA BERBAHASA INDONESIA MENGGUNAKAN METODE SUPPORT VECTOR MACHINE', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Berita merupakan suatu informasi berdasarkan fakta atau laporan mengenai suatu kejadian yang sedang, atau telah terjadi. Berita dipublikasikan melalui media cetak, siaran, internet, maupun dari mulut ke mulut. kebutuhan informasi di Indonesia dalam bentuk digital baik berupa teks atau dokumen. Pengklasifikasian berita masih dilakukan secara manual sehingga rentan terjadi kesalahan. Banyaknya berita yang harus diklasifikasikan berdasarkan kategorinya dalam waktu yang singkat akan membuat editor mengalami kesulitan dan dapat menimbulkan kesalahan dalam pengkategoriannya dikarenakan editor harus membaca satu per satu berita-berita yang akan diklasifikasikan. Apabila pengklasifikasian berita dilakukan secara otomatis akan meminimalisir kesalahan pengkategorian dan lebih efisien. Dari implementasi sistem yang telah dilakukan, klasifikasi berita olahraga berbahasa Indonesia mampu diselesaikan dengan menggunakan metode Support Vector Machine dengan tingkat akurasi 95.72%. Berdasarkan nilai evaluasi f1-score, Support Vector Machine menghasilkan nilai evaluasi sebesar 95.72%, nilai Precision menghasilkan nilai evaluasi sebesar 95.72% dan nilai Recall menghasilkan nilai sebesar 95.72%.Hal tersebut menunjukkan bahwa dalam penelitian ini model Support Vector Machine menghasilkan ketepatan klasifikasi berita olahraga berbahasa Indonesia yang lebih baik.\n\nKata kunci: Klasifikasi, Berita Olahraga Berbahasa Indonesia, Support Vector Machine', 'Elmo Bahtiar Rahman', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100087'),
(661, '140411100088', 'SISTEM REKOMENDASI MENU MAKANAN MENGGUNAKAN SVD (SINGULAR VALUE DECOMPOSITION) PADA APLIKASI RESTORAN', 'MOCH. KAUTSAR SOPHAN, S.KOM., M.MT', 'DR. NOOR IFADA, S.T., M.ISD', 'Menu merupakan sebuah daftar makanan yang telah dilengkapi dengan harga masing-masing, yang disediakan dan ditampilkan untuk menarik pelanggan serta memberikan nilai terhadap makanan yang ditawarkan. Pemesanan menu makanan terkadang mengalami kendala dengan kurangnya pelayanan dalam proses pemesanan karena kondisi restoran yang ramai. Selain itu ada lagi permasalahan yang dihadapi pelanggan ketika terkadang malas untuk melihat daftar menu yang telalu banyak sehingga pelanggan hanya memesan menu yang sudah biasa pelanggan dipesan dan sulitnya karyawan dalam mencatat menu pesanan dari pelanggan apabila pesanan pelanggan banyak karena kondisi restoran yang ramai. Maka dari itu dibutuhkan sistem restoran yang dapat menangani permasalahan berkaitan dengan proses pemesanan dan juga rekomendasi pemilihan menu makanan. Hasil dari implementasi metode Singular Value Decomposition untuk rekomendasi menu makanan, menghasilkan nilai akurasi dengan hasil perhitungan F1-Score sebesar 16,66% berdasarkan pengujian data dengan reduksi yang dilakukan sebanyak ¼ dari masing-masing matrik.', 'ZEMMY MUAMAL HUMAIDI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100088'),
(662, '140411100091', 'ESTIMASI BOBOT SAPI MENGGUNAKAN METODE ADAPTIVE THRESHOLDING DAN CONNECTED COMPONENT LABELLING', '-', '-', '         Pengenalan objek pada citra memberi alternatif baru untuk mengetahui bobot sapi dengan Image Processing. Image Processing dapat membantu mempercepat identifikasi bobot seekor sapi. Pada pemrosesan citra, citra yang diperoleh akan di proses sedemikian rupa. Penelitian ini menggunakan metode adaptive thresholding dan Connected Component Labeling (CCL). Hasil segmentasi citra menggunakan thresholding masih terdapat noise sehingga diperlukan metode CCL untuk membuang noise pada citra. Dataset yang digunakan untuk pelatihan adalah dataset citra sapi. Dataset sapi memiliki citra sebanyak 120 terdiri dari 3 jarak. Penelitian bertujuan untuk mengetahui seberapa akurat estimasi bobot sapi menggunakan metode adaptive thresholding dan CCL, kedua metode tersebut cukup baik untuk penelitian ini. Hasil yang didapat pada penelitian ini adalah hasil segmentasi citra yang baik, dapat menambah tingkat akurasi. Pengukuran akurasi menggunakan RMSE yang paling baik pada penelitian ini yaitu sebesar 20,354 pada jarak 150 cm. \n\n\nKata kunci: Bobot, image processing, adaptive thresholding, connected component lableling.\n', 'Novita Subagiarti', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100091'),
(663, '140411100092', 'IDENTIFIKASI ATRIBUT PEJALAN KAKI BERBASIS IDENTIFIKASI BINER MENGGUNAKAN CONVOLUTIONAL NEURAL NETWORKS (CNN)', 'Dr. Indah Agustien S, S.Kom,M.Kom.', 'Dr. Arif Muntasa, S.Si.,M.T.', 'Kemampuan komputer untuk melakukan identifikasi atribut pejalan kaki mendapat perhatian yang besar dalam penelitian computer vision karena penerapannya yang cukup tinggi, salah satunya di bidang sistem pengawasan visual. Metode-metode yang digunakan oleh para peneliti sebelumnya masih menggunakan handmade feature (misalnya color histograms dan local binary patterns) yang memakan waktu karena harus mencari fitur yang cocok dari sekian banyak fitur untuk kasus yang dihadapi. Pada penelitian ini diusulkan metode Convolutional Neural Networks (CNN) yang memiliki kemampuan untuk melakukan pembelajaran fitur secara otomatis (feature learning). CNN memiliki beberapa hyper-parameter yang nilainya mempengaruhi kinerja klasifikasi, salah satu diantaranya adalah jumlah lapisan konvolusi. Pada penelitian ini, dilakukan beberapa skenario percobaan untuk mengetahui pengaruh jumlah lapisan terhadap kinerja CNN. Beberapa arsitektur CNN yang berbeda dilatih dan diuji menggunakan dataset PETA yang berisi gambar jarak jauh pejalalan kaki. Hasil dari uji coba yang dilakukan, tiga model CNN dengan jumlah lapisan konvolusi tiga, lima dan tujuh memperoleh rata-rata f1 score secara berturut-turut sebesar 56.76%, 59.60%, dan 69.00% dari tujuh atribut yang diidentifikasi. Dari hasil ini dapat disimpulkan bahwa semakin banyak jumlah lapisan konvolusi yang digunakan, kinerja CNN menjadi semakin baik.', 'Arif Subroto', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100092'),
(664, '140411100093', 'KLASIFIKASI BERITA PALSU PADA BERITA ONLINE BAHASA INDONESIA MENGGUNAKAN METODE SUPPORT VECTOR MACHINE DAN NAÏVE BAYES', 'Mula\'ab, S.Si., M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Penyebaran berita palsu atau berita hoax saat ini sudah semakin tak terbendung. Pesatnya pertumbuhan website yang tidak terverifikasi, semakin memperburuk masalah ini. Untuk itu, perlu adanya sebuah sistem yang dapat melakukan klasifikasi berita berdasarkan teks, yang dapat menjadi media penyaring berita-berita tersebut. Salah satu metode yang paling sering digunakan, ialah metode Naïve Bayes yang diketahui mampu memberikan hasil terbaik untuk klasifikasi berita palsu secara umum. Namun masih lemah untuk klasifikasi berita dengan topik tertentu. Untuk mengatasi kekurangan tersebut, pada penelitian ini sistem yang dibuat untuk melakukan klasifikasi terhadap topik berita terlebih dahulu menggunakan metode Support Vector Machine. Metode SVM dipilih karena sudah terbukti memiliki akurasi tinggi untuk klasifikasi berita berbahasa Indonesia. Kemudian, untuk menambah akurasi hasil klasifikasi ini, digunakan pula gabungan TF-IDF dan Mutual Information sebagai penyeleksi fitur. Hasil pengukuran performa penggunaan metode SVM dan Naive Bayes untuk klasifikasi berita palsu atau hoax dengan tiga kategori yang telah ditentukan yakni kesehatan dan makanan, politik, serta tokoh, memperoleh nilai rata-rata akurasi=81.33%, precission=75,31%, dan recall=96%.', 'Choirul Anam Nasrudin', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100093'),
(665, '140411100096', 'PERAMALAN JUMLAH PERMINTAAN BATIK MENGGUNAKAN METODE JARINGAN SARAF TIRUAN ALGORITMA BACKPROPAGATION PADA SISTEM KASIR TOKO BATIK', 'MOCH. KAUTSAR SOPHAN, S.KOM., M.MT', 'MULA\'AB, S.SI., M.KOM', 'Batik adalah kerajinan yang menjadi bagian warisan dari budaya Indonesia dan telah diakui oleh UNESCO pada tahun 2009. Batik menjadi daya tarik pembeli yang jumlah peminatnya terus meningkat dari tahun ke tahun. Sehingga banyak bermunculan toko yang memproduksi dan  memperjual belikan batik hasil produksinya. Dari banyaknya toko yang ada tidak semuanya telah mengunakan sistem digital dalam proses bisnis yang berlangsung. Beberapa toko batik masih menggunakan proses transaksi dan entry laporan penjualan secara sederhana sehingga menyita banyak waktu pegawai maupun pemilik toko tersebut. Selain itu pemilik toko tidak dapat pemerkirakan jumlah penyediaan batik untuk beberapa hari kedepan dari hasil entry data laporan yang masuk secara sederhana. Untuk itu diperlukan adanya sebuah aplikasi yang bisa membantu dalam menangani proses bisnis di toko batik dan memberi prediksi jumlah batik yang akan terjual melalui proses peramalan. Aplikasi tersebut dibangun dibangun dan dirancang berbasis mobile dengan implementasi metode jaringan saraf tiruan algoritma backpropagation. Jaringan saraf tiruan algoritma backpropagation digunakan untuk memprediksi jumlah batik yang akan terjual dalam 1 atau 2 hari kedepan. Hasil dari implementasi metode jaringan saraf tiruan algoritma backpropagation dalam memprediksi jumlah permintaan batik, dengan parameter yang digunakan yaitu learning rate 0.3, max iterasi 1000 dan max error 0.008363 menghasilkan nilai rata-rata akurasi sebesar 50.94% dengan nilai MSE terkecil 27.2%.', 'TRI MEIDA RATNAWATI', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100096'),
(666, '140411100097', 'Segmentasi Obyek Dengan Background Dinamis Menggunakan Metode Fuzzy Partitions & Fuzzy Interpolations', 'Eza Rahmanita, ST., MT', 'Fitri Damayanti, S.Kom., M.Kom', 'Segmentasi citra merupakan tahapan terpenting dalam \nmemperbaiki pengenalan pola. Sampai saat ini belum ada metode \nsegmentasi yang optimal untuk citra dengan background dinamis.\nSegmentasi bertujuan untuk membagi prosedur citra menjadi \nbeberapa bagian pokok penyusun citra. Dalam penelitian ini \nsegmentasi hanya akan membagi dua bagian dari pada citra, yakni \nbagian obyek utama dan background. Dataset yang digunakan dalam \npenelitian ini menggunakan dataset Fish. Dilakukan preprocessing\nterlebih dahulu dengan metode histogram equalization. Algoritma \nsegmentasi citra yang akan digunakan pada penelitian ini yakni \ndengan metode Fuzzy Partitions dan fuzzy partitions. Metode Fuzzy \nPartitions digunakan untuk proses segmentasi dengan membagi \npartisi pada citra. Fuzzy Interpolations untuk memperbaiki kualitas \nhasil dari segmentasi obyek utama dari suatu background. Setelah\ndilakukan penelitian, segmentasi obyek dengan background dinamis dalam penelitian ini \nmenunjukkan nilai akurasi 99.60% dengan menggunakan metode \nfuzzy partitions dan fuzzy interpolations.', 'Sri Tisti Mulia Wati', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100097'),
(667, '140411100098', 'IDENTIFIKASI ATRIBUT PEJALAN KAKI BERBASIS FITUR WARNA DAN TEKSTUR MENGGUNAKAN ADAPTIVE BOOSTING', 'Dr. Indah Agustien S, S.Kom,M.Kom.', 'Dr. Arif Muntasa, S.Si.,M.T.', 'Identifikasi atribut pada citra pejalan kaki masih memiliki beberapa kendala mendasar. Sudut penglihatan kamera, pencahayaan, dan beragamnya citra merupakan beberapa kendala yang ditemukan. Dibutuhkan metode ektraksi fitur yang cukup baik. Oleh karena itu penelitian ini menggunakan gabungan dari fitur warna dan tekstur. Metode ekstraksi fitur berbasis warna dan tekstur yang digunakan adalah Color Histogram dan Multi Block Local Binary Pattern (MB-LBP) dengan metode pembelajaran yang digunakan adalah Adaptive Boosting (Adaboost). Dataset yang digunakan adalah dataset PEdesTrian Attribute (PETA) yang memiliki jumlah data mencapai 19000. Penelitian ini bertujuan untuk mengetahui pengaruh ketika memakai fitur warna atau tekstur saja dengan gabungan fitur warna dan tekstur. Hasilnya adalah gabungan dari fitur warna dan tekstur dapat meningkatkan akurasi pada beberapa atribut. Akurasi tertinggi didapatkan oleh atribut sandal, dengan akurasi mencapai 76%.', 'Helmi Agil Achmani', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100098'),
(668, '140411100100', 'PENAMBAHAN FITUR ENKRIPSI RIVEST CODE 6 WEBSOCKET UNTUK PENGAMANAN ALIRAN DATA MESSAGING', 'Dwi Kuswanto, S.Pd., M.T.', 'Yoga Dwitya Pramudita, S.Kom., M.Cs.', 'Protokol websocket menyediakan komunikasi realtime dua arah. Namun dengan menerapkan protokol websocket, ancaman keamanan akan lebih banyak. Salah satu serangan yang sering terjadi adalah packet monitoring yang dilakukan oleh pihak-pihak tidak bertanggung jawab. Untuk menjaga kerahasian dan keaslian data dari serangan tersebut. Salah satu teknik yang dapat digunakan untuk pengamanan data yaitu dengan menerapkan metode enkripsi. Pada penelitian ini metode enkripsi yang digunakan adalah Rivest Code 6 (RC6) metode tersebut memiliki performa tinggi dalam prosesnya menggunakan operasi-operasi primitif, sehingga tidak terlalu mempengaruhi kinerja protokol websocket. Hasil dari uji coba avalanche effect didapatkan total perubahan untuk algoritma Rivest Code 6 (RC6) berdasarkan plaintext sebesar 28.29% dan berdasarkan kunci sebesar 52.28%. Sedangkan untuk Transport Layer Security (TLS) didapatkan total perubahan untuk berdasarkan plaintext sebesar 42.50% dan berdasarkan kunci  53.19%. Hasil uji coba performa kecepatan pengiriman pesan didapatkan nilai rata-rata keseluruhan waktu pengiriman pesan sebesar 10673 millisecond untuk Transport Layer Security (TLS) dan 6964 millisecond untuk Rivest Code 6 (RC6). Library websocket hasil modifikasi juga mampu melakukan komunikasi terenkripsi pada kondisi link komunikasi dengan tingkat probabilitas packet loss dibawah 12%.\n\nKata Kunci : Protokol websocket, keamanan data, performa kecepatan, enkripsi RC6.\n', 'Husnul Atho\' Mubarok', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100100'),
(669, '140411100102', 'Analisis Sentimen dari Media Sosial Menggunakan Metode Information Gain dan Naive Bayes', 'Mula\'ab, S.Si., M.Kom.', 'Eka Mala Sari R, S.Kom., M.Kom.', 'Pada media sosial, pengguna dapat dengan bebas mengekspresikan\npendapat atau opini. Media sosial dapat menjadi alternatif solusi untuk\nmelakukan analisis sentimen disamping survei konvensional yang\nmemerlukan biaya mahal dan waktu yang cukup lama. Salah satu metode\nyang banyak digunakan untuk analisis sentimen adalah naïve bayes.\nMetode ini mempunyai akurasi yang baik untuk klasifikasi sentimen dan\nefisien dalam hal komputasi. Proses analisis akan dimulai dengan\npengumpulan data, kemudian melakukan preprocessing, seleksi fitur dan\npembuatan model klasifikasi. Seleksi fitur dilakukan menggunakan\nmetode information gain, dengan menghitung keterkaitan kata terhadap\nkelas dan klasifikasi akan dilakukan dengan naïve bayes, dengan\nmenghitung probabilitas setiap kata terhadap kelas. Penelitian ini\nbertujuan untuk mengetahui bagaimana performa metode information\ngain dan naïve bayes dalam analisis sentimen. Hasil pengukuran dari\nperforma metode antara lain nilai akurasi rata-rata 56,6%, precision 0,33,\ndan recall sebesar 0,39.', 'Muhamad Fahmi Ansori', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100102'),
(670, '140411100103', 'IMPLEMENTASI TEKNOLOGI AUGMENTED REALITY PADA MUSEUM PENATARAN BLITAR SEBAGAI MEDIA EDUKASI DAN TOUR GUIDE', 'Wahyudi Agustiono, S.Kom, M.Sc., Ph.D.', 'Ari Kusumaningsih, S.T., M.T. ', 'Museum Penataran sebelumnya bernama Museum Blitar. Museum Blitar bukan berarti museum dalam arti sebenarnya, namun sebagai balai penyelamatbenda-benda purbakala yang ada di Kabupaten Blitar. Perkembangan Teknologi Informasi pada dunia mempunyai tingkat pertumbuhan yang sangat pesat, sehingga mengakibatkan masyarakat semakin berkurang untuk mengunjungi museum. Dari permasalahan tersebut, dibutuhkan sebuah gagasan terbaru untuk memberikan kesan lain dalam mempelajari sejarah yang ada di Museum. Salah satu teknologi yang sedang meningkat saat ini adalah teknologi Augmented Reality. Teknologi Augmented Realityadalah metode pelacakan AR yang menggunakan marker buatan. Aplikasi Augmented Reality Museum Penataran Blitar sangat efisien dan dapat membantu dalam edukasi dan tour guide. Dilihat dari hasil pengujian indikator dari indikator Match between system and the real world91% dan Visibility of system status85%. Dari hasil rata – rata 2 pengujian yaitu pengujian Heuristic dengan nilai prosentase 86% dan pengujian User Experiencememiliki nilai prosentase 82% yang termasuk dalam kategori sangat baik. ', 'RIO ABRIANTO', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100103'),
(671, '140411100104', 'PENERAPAN WEB SERVICE UNTUK INFORMASI FASILITAS KESEHATAN BERBASIS ANDROID', 'Achmad Jauhari, S.T., M.Kom.', 'Yoga Dwitya P., S.Kom., M.Cs.', 'Tujuan penelitian ini adalah mempermudah masyarakat dalam memperoleh informasi terkait fasilitas kesehatan yang meliputi lokasi dan rute yang terintegrasi dengan google maps melalui penerapan Web Service untuk Informasi Fasilitas Kesehatan Berbasis Android. Metode pengembangan dalam penelitian ini adalah perancangan sistem yang menggunakan web service. Penelitian ini melibatkan studi pendahuluan, pengembangan aplikasi, serta uji lapangan validitas dan reliabilitas untuk menentukan efektifitas aplikasi fasilitas kesehatan yang dibuat. Hasil akhir penelitian yang dikembangkan adalah web service fasilitas kesehatan berbasis android yaitu berupa aplikasi fasilitas kesehatan. Aplikasi fasilitas kesehatan ini merupakan aplikasi yang memberikan informasi terkait lokasi, rute, dan informasi umum mengenai fasilitas kesehatan meliputi rumah sakit, puskesmas, klinik, serta apotek yang berada di Kabupaten Sampang. Hasil uji validitas menunjukkan  nilai r_hitung > r_tabel= 0,374 yang berarti valid dan uji reliabilitas menunjukkan bahwa koefisien reliabilitas (r_11) sebesar 0,826 > 0,6 yang berarti reliabel. Berdasarkan hasil kuisioner, dapat diketahui bahwa aplikasi fasilitas kesehatan yang telah dikembangkan mampu mempermudah masyarakat sampang dalam memperoleh informasi fasilitas kesehatan yang berada di Kabupaten Sampang. ', 'Rizki Anantama', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100104'),
(672, '140411100106', 'PENERAPAN ITEM ATTRIBUTE DAN FUZZY C-MEANS CLUSTERING DALAM MODEL ITEM-BASED COLLABORATIVE FILTERING UNTUK REKOMENDASI FILM', 'Dr. Noor Ifada, S.T., M.ISD.', 'Mula\'ab, S.Si., M.Kom.', 'Collaborative Filtering (CF) adalah model rekomendasi yang paling banyak digunakan dengan menghitung kemiripan antara pengguna dan item. Model ini mengasumsikan bahwa beberapa orang yang menyukai hal-hal yang sama cenderung juga sama-sama menyukai terhadap hal-hal yang lainnya, sehingga rekomendasi yang dihasilkan akan lebih bervariasi. Namun CF memiliki dua masalah utama, yaitu sparsity dan scalability. Untuk mengatasi sparsity, maka akan dilakukan pengisian matriks rating yang kosong dengan menggunakan perhitungan item similarity dan item attribute similarity. Kemudian menyelesaikan masalah scalability dengan menerapkan Fuzzy C-Means clustering sehingga proses perhitungan hanya mengolah item yang benar-benar serupa dalam cluster yang sama. Dari implementasi sistem yang telah dilakukan, permasalahan sparsity mampu diselesaikan dengan perhitungan gabungan similaritas antara item similarity dan item attribute similarity dengan tingkat kepadatan yang awalnya 5,04% menjadi 100%. Sedangkan masalah scalability mampu diselesaikan dengan penerapan Fuzzy C-Means clustering dengan waktu komputasi lebih cepat sekitar 25,74%. Berdasarkan nilai evaluasi f1-score, CF Clustering menghasilkan nilai evaluasi tertinggi sebesar 5,434 dan model CF Tradisional menghasilkan nilai evaluasi tertinggi sebesar 2,307. Hal tersebut menunjukkan bahwa dalam penelitian ini model CF Clustering menghasilkan rekomendasi yang lebih baik daripada model CF Tradisional.', 'Eko Hadi Prasetyo', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100106'),
(673, '140411100109', 'PENERAPAN TEKNOLOGI AUGMENTED REALITY SEBAGAI APLIKASI  PEMBELAJARAN INTERAKTIF MEMBACA PADA ANAK USIA DINI DENGAN METODE FONIK', 'Ari Kusumaningsih, ST., M.T.', 'Sigit Susanto Putro, S.Kom., M.Kom.', 'Lemahnya keterampilan membaca akan menyebabkan minat belajar anak usia dini menjadi rendah. Salah satu cara untuk meningkatkan minat belajar, yaitu menggunakan media pembelajaran yang menarik dan interaktif. Namun, media pembelajaran yang umum digunakan lebih mengarah pada media pembelajaran cetak seperti buku, majalah, dan poster. \nPenerapan teknologi Augmented Reality dipilih karena dapat menggabungkan dunia virtual dan dunia nyata secara real time. Bukan hanya dapat menampilkan objek secara dua dimensi di atas kertas, tetapi juga dapat menampilkan objek tiga dimensi dan mengeluarkan suara. Hal ini dapat memberikan pengalaman baru untuk anak usia dini dalam belajar. \nBerdasarkan hasil dari pengujian user experience yang dilakukan terhadap murid, dihasilkan bahwa aplikasi Augmented Reality Fonik memiliki tingkat keberhasilan 80%. Sedangkan hasil dari pengujian  user experience terhadap guru dan orang tua, dihasilkan bahwa aplikasi Augmented Reality Fonik memiliki tingkat keberhasilan 77%.', 'Choiril Andriana', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100109'),
(674, '140411100111', 'Lokalisasi Teks pada Scene Text Image Menggunakan Directional Discrete Cosine Transform (DDCT)', 'Rosida Vivin Nahari, S.Kom., M.T.', 'Sigit Susanto Putro, S.Kom., M.Kom. ', 'Teks sering dijumpai di berbagai tempat seperti nama jalan, nama toko, spanduk, penunjuk jalan, peringatan, dan lain sebagainya. Deteksi teks terbagi menjadi tiga pendekatan yaitu pendekatan tekstur, pendekatan edge, dan pendekatan connected component. Pendekatan tekstur dapat mendeteksi teks dengan baik, namun membutuhkan data training yang banyak. Lokalisasi teks merupakan langkah dasar dalam banyak aplikasi komputer termasuk video Optical Character Recognition (OCR), untuk memahami konten video, dan lain-lain. Penelitian ini bertujuan untuk melokalisasi teks pada gambar.  Metode yang digunakan dalam penelitian ini adalah Directional Discrete Cosine Transform (DDCT) dan connected component. Dataset yang digunakan adalah dataset Focused Scene Text Robust Reading Competition ICDAR2013 yang memiliki jumlah data sebanyak 233 pada data test. Hasil yang didapatkan dengan nilai rata-rata dari penelitian ini adalah precision 0.36, recall 0.91 dan f1 score 0.45. Nilai precision lebih rendah karena banyak komponen bukan teks ikut terlokalisasi. Sedangkan nilai recall lebih tinggi dan banyak teks yang terlokalisasi. \n\nKata Kunci: Teks, Gambar, Scene Text Image, Directional Discrete Cosine Transform (DDCT)', 'Thuhri Mutya Amalia', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100111'),
(675, '140411100116', 'Penentuan Posisi Pemain Bertahan Pada Sepak Bola Menggunakan Metode MAGIQ (Multi-Attribute Global Inference Quality)', 'Sigit Susanto Putro S.Kom., M.Kom.,', 'Eza Rahmanita S.T., M.T.,', 'Dalam permainan sepak bola seorang pelatih akan menentukan posisi pemain yang tepat dalam permainan dengan melihat data pemain tersebut. Terkadang posisi pemain tidak sesuai dengan kemampuan yang dimilikinya.  Hal seperti inilah yang membuat pelatih kesulitan dalam membuat keputusan yang tepat dengan menilai pemain secara obyektif dan tidak hanya menggunakan insting saja dalam menentukan posisi pemain, terutama pemain bertahan yang menjadi benteng pertahanan bagi sebuah tim. Oleh karena itu, kehadiran teknologi sistem pendukung keputusan menentukan posisi pemain bertahan pada sepak bola bagi seorang pelatih tentulah sangat membantu untuk mencapai hasil maksimal dalam setiap pertandingan. Teknologi yang penulis tawarkan adalah membangun sistem pendukung keputusan pemilihan posisi pemain bertahan yang berasal dari data latihan pemain menggunakan metode MAGIQ. Sistem ini menerapkan metode MAGIQ (Multi-Attribute Global Inference Quality) karena dalam pembobotannya mengurutkan prioritas di setiap faktor dan kriteria serta akan diproses menggunakan konsep ROC (Rank Order centroid). Hasil akhir dari metode MAGIQ sendiri yaiitu menghasilkan akurasi sebesar 65% dari hasil rekomendasi sistem dengan rekomendasi pelatih di lapangan.', 'Moh. Tarmudi Hasan ', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100116');
INSERT INTO `tbpaper` (`DocId`, `Nim`, `Judul`, `Pd1`, `Pd2`, `Abstrak`, `Penulis`, `Prodi`, `Url`) VALUES
(676, '140411100117', 'Aplikasi Tata Kelola Administrasi Desa Berbasis Hierarchical Model View Controller (HMVC) Bagian Surat Menyurat Desa', 'Wahyudi Agustiono,S.Kom.,M.Sc.,Ph.D.', 'Muhammad Syarief,S.T.,M.Cs.', '\nDalam pengelolaan administrasi surat menyurat desa masih dilakukan secara manual yang akan memperlambat kinerja pada instansi. Dari masalah yang ada, perlu adanya aplikasi agar masalah tersebut dapat teratasi. Untuk mempermudah pengembangan surat menyurat dalam administrasi surat menyurat, aplikasi ini menggunakan konsep Hierarchical Model View Controller. Penerapan HMVC dipilih karena memiliki keuntungan yang akan didapat antara lain pengembangan perangkat lunak yang besar mudah untuk dilakukan perbaikan, penambahan atau pengurangan kode serta menggunakan Teknik modularisasi. Aplikasi ini merupakan pengembangan dari Aplikasi Administrasi Pemerintahan yang sudah ada sebelumnya yang menggunakan konsep Hierarchical Model View Controller, yang berdasarkan PERMENDAGRI No. 47 Tahun 2016. Berdasarkan dari hasil uji coba aplikasi pengelolaan administrasi surat menyurat berbasis HMVC setelah dilakukan pengujian terhadap aplikasi didapat kesimpulan, bahwa pembuatan aplikasi ini dalam membantu aparat desa dalam proses pelayanan surat menyurat dalam waktu yang efisien dan efektif kepada masyaratkat. Dan dari hasil pengujian kuesioner yang telah dilakukan yaitu 82,4% untuk aplikasi dan untuk tingkat akurasi diperoleh  81,9%  sehingga cukup akurat, sehingga hasil dari kedua kuisioner memiliki tingkat kepercayaan dan konsistensi yang baik.\n\nKata Kunci : PERMENDAGRI No.47 Tahun 2016, Administrasi Pemerintahan Desa, Hierarchical Model View Controller (HMVC).\n', 'Nuri Islamy Santoso', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100117'),
(677, '140411100118', 'Pengaruh Seleksi Fitur Terhadap Performansi Model Klasifikasi Naïve Bayes pada Diagnosa Arrhythmia', 'Mula’ab,S.Si.,M.Kom.', 'Rosida Vivin Nahari, S.Kom., M.T.', 'Arrhytmia merupakan salah satu kelainan pada jantung ditandai dengan ritme jantung yang tidak normal, menjadi lebih cepat atau lebih lambat. Untuk mendiagnosa Arrhytmia perlu dilakukan prosedur Electroardiograf. Hasil perosedur Electrocardiograf ini Electrodiogram atau yang biasa di kenal sebagai ECG. ECG inilah yang kemudian dijadikan rujukan untuk mendiagnosa Arrhytmia. Data ECG tersebut memiliki ukuran data yang besar sehingga dibutuhkan proses analisa yang tepat. Klasifikasi merupakan salah satu pendekatan yang dapat dilakukan untuk memahami data ECG tersebut. Salah satu algoritma klasifikasi yang dapat menangani data dalam jumlah besar adalah Naïve Bayes. Banyaknya fitur yang dimiliki data ECG menjadi hambatan tersendiri dalam proses klasifikasi. Seleksi fitur dapat digunakan untuk mengurangi fitur yang kurang relevan pada dataset. Penelitian ini memiliki tujuan untuk mengetahui pengaruh seleksi fitur terhadap performansi model klasifikasi Naive Bayes pada diagnose Arrhytmia. Hasil yang didapat dari penelitian ini adalah nilai akurasi, presisi, recall, dan f-measure mengalami peningkatan setelah menerapkan seleksi fitur. Hal ini dibuktikan dengan nilai akurasi yang meningkat sebesar 4%, presisi meningkat sebesar 0.13, nilai recall mengalami kenaikan sebesar 0.13, nilai f-measure mengalami kenaikan sebesar 0.14, dan waktu komputasi yang dibutuhkan 0.03 detik lebih cepat. Performa tertinggi didapatkan pada klasifikasi dengan 80 fitur. Dihasilkan akurasi sebesar 93 %, presisi dan recall sebesar 0.45, f-measure sebesar 0.42, dan waktu komputasi selama 0.10 detik.\n\nKata Kunci: Arrhytmia, Electrocardiogram (ECG), klasifikasi,Naïve Bayes,  seleksi fitur\n', 'Hanin Rana Delilah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100118'),
(678, '140411100124', 'Sistem Pakar Deteksi Hama dan Penyakit Tanaman Jagung Menggunakan Metode Certainty Factor dan Fuzzy Sugeno ', 'Wahyudi Agustiono, S.Kom., M.Sc.,Ph.D.', 'Mohammad Syarief, S.T., M.Cs.', 'Jagung merupakan salah satu hasil tani yang ada di Madura. Sebagian besar petani di Madura hanya mengandalkan hujan sebagai pengairan. Jagung merupakan tanaman yang cocok bagi pertanian di pulau Madura karena budidaya tanaman jagung tidak membutuhkan pengairan yang banyak. Selain pengairan, gagal panen merupakan salah satu faktor yang mempengaruhi kestabilan jumlah panen. Salah satu penyebab gagal panen yaitu munculnya hama dan penyakit. Penanganan yang cepat sangat dibutuhkan untuk meningkatkan produktifitas tanaman jagung, tetapi terbatasnya pengetahuan petani dan sulitnya akses terhadap tenaga pakar juga menjadi faktor yang membuat penangan menjadi lambat. Berdasarkan permasalahan yang dihadapi, diperlukan suatu sistem pakar untuk mendeteksi hama dan penyakit tanaman jagung berbasis android. Tujuannya yaitu memudahkan petani mengetahui apakah tanaman jagung terjangkit hama atau penyakit serta bagaimana cara mengatasinya. Sistem pakar deteksi hama dan penyakit pada tanaman jagung diimplementasikan menggunakan metode Certainty Factor dan Fuzzy Sugeno yang akan menghasilkan solusi dari pertanyaan. Berdasarkan penelitian yang telah dilakukan diperoleh hasil akurasi sebesar 85,16% dan hasil pengujian berdasarkan kuisioner pengguna, rata-rata diperoleh nilai 4 dalam kategori setuju yang artinya kuisioner tersebut efektif.', 'Ainur Rohmah', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100124'),
(679, '140411100126', 'IMPLEMENTASI TEKNOLOGI VIRTUAL REALITY\nPADA OBYEK 3D SEBAGAI SARANA PENGENALAN SISTEM PERNAPASAN MANUSIA', 'Ari Kusumaningsih, S.T., M.T', 'Arik Kurniawati,S.Kom., M.T', ' Virtual Reality adalah pemunculan gambar-gambar tiga dimensi, teks dan suara  yang bangkitkan komputer, yang terlihat nyata yang dibuat sama persis kedalam bentuk virtual menggunakan android. Virtual reality banyak digunakan diberbagai bidang, salah satunya di gunakan dalam bidang pendidikan. Pada bidang pendidikan teknologi virtual Reality digunakan sebagai media pembelajaran yang lebih menarik, kreatif dan inovatif. Tujuan dari peneelitian ini adalah untuk mengembangkan sebuah aplikasi media pembelajaran sistem pernapasan manusia berbasis Virtual reality. Adapun tujuan dari pengembangan aplikasi ini mudah digunakan dalam proses belajar mengajar. Media pembelajaran masih menggunkan gambar-gambar dan melihat patung organ sistem pernapasan manusia yang dimiliki sekolahan MTS MIFTAHUL ULUM, namun organ yang ada dipatung  tersebut masih belum lengkap seperti mekanisme. Jenis sistem pernapasan manusia yang di perkenalkan pada siswa masih bersifat umum. Aplikasi tersebut memiliki fitur yaitu zoom dan simulasi cara kerja dari sistem pernapasan manusia yang terdapat pada mekanisme pembentukan sistem. Pada Aplikasi Virtual reality media pembelajaran sistem pernapasan manusia sesuai dengan materi dan proses belajar mengajar yang diharapkan oleh MTS MIFTAHUL ULUM.  Berdasarkan Indikator user experience dengan nilai rata-rata sebesar 89%. ', 'Boy Sandi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100126'),
(680, '140411100132', 'IMPLEMENTASI SELEKSI FITUR F-SCORE DAN ALGORITMA C4.5 UNTUK DIAGNOSA PENYAKIT DIABETES MELLITUS', 'Mula’ab, S.Si., M.Kom.', 'Rosida Vivin Nahari, S.Kom., M.T.', 'Berdasarkan data Organisasi Kesehatan Dunia (WHO), Indonesia merupakan negara yang memiliki tingkat kematian keempat tertinggi didunia yang disebabkan oleh diabetes mellitus[1]. Diabetes mellitusmerupakan penyakit yang memiliki beberapa gejala yang wajib diwaspadai, misalnya banyaknya kehamilan, konsentrasi glukosa dan lainnya. Dari banyaknya fitur yang ada menimbulkan beberapa masalah salah satunya semakin lama proses diagnosa.Penyeleksian fitur yang kurang relevan dapat digunakan untuk mengurangi proses waktu diagnosa. Seleksi fitur f-score dapat digunakan untuk mengurangi gejala yang kurang relevan sehingga waktu untuk mendiagnosa lebih efektif dan akurasi lebih baik. Selain penyeleksian fitur, pengklasifikasian penyakit dapat dilakukan untuk mengetahui apakah pasien positif diabetes mellitus atau negatif diabetes mellitus. Algoritma C4.5 merupakan algoritma machine learning yang dapat digunakan untuk klasifikasi penyakit serta dapat menemukan pola dari suatu data.Tujuan dari penelitian ini untuk mengukur nilai akurasi yang dihasilkan dari klasifikasi diabetes menggunakan algoritma C4.5 dengan seleksi fitur dan tanpa seleksi fitur.Akurasi menggunakan metode seleksi fitur f-score dan algoritma C4.5 dengan jumlah data training sebanyak 80% menghasilkan nilai akurasi 72,791% dan precision  63, 924% dan recall 51,208 dengan  waktu 12,99s', 'SITI MUNTAFIAH', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100132'),
(681, '140411100141', 'PENDETEKSIAN DAN PENGENALAN KARAKTER PLAT NOMOR  KENDARAAN MENGGUNAKAN BACKGROUND SUBSTRACTION DAN AREA-BASED FEATURES EXTRACTION', 'Fitri Damayanti, S.Kom.,M.Kom.', 'Eza Rahmanita, S.T., M.T.', 'Meningkatnya jumlah kendaraan terutama kendaraan roda empat pada kota-kota besar menimbulkan permasalahan lalu lintas tak terkecuali pada jalan tol. Dengan proses transaksi yang cepat pada gerbang masuk jalan tol, dapat mengurangi antrian kemacetan lalu lintas. Untuk itu dibutuhkan aplikasi pengolahan citra pengenalan karakter plat nomor kendaraan. Pada penelitian ini dilakukan pembuatan aplikasi pengenalan karakter plat nomor  pada citra kendaraan mulai dari proses deteksi lokasi plat menggunakan background substraction. Selanjutnya proses segmentasi tiap karakter dan proses terakhir adalah pengenalan karakter nomor plat menggunakan area-based features extraction. Data yang digunakan dalam penelitian ini adalah 50 citra kendaraan dengan masing-masing memiliki 3 jarak yaitu 50 cm, 75 cm dan 100 cm. Hasil uji coba penelilian ini menunjukkan tingkat akurasi terbaik pada skenario 1 dengan jarak 50 cm dengan akurasi deteksi letak plat nomor sebesar 94%, akurasi segmentasi karakter terbaik sebesar 89,58% dan 82,59% untuk akurasi pengenalan karakter.', 'Wahyu Kusuma Dewi', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100141'),
(682, '140411100145', 'SISTEM INFORMASI PEMETAAN PENYEBARAN PENYAKIT DEMAM BERDARAH DENGUE (DBD)', 'Mula’ab, S.Si., M.Kom.', 'Ika Oktavia Suzanti, S.Kom., M.Cs.', 'Demam Berdarah Dengue (DBD) merupakan salah satu penyakit menular yang bersifat endemik dan sering menimbulkan kejadian luar biasa (KLB) di Indonesia. Di Kabupaten Bangkalan tercatat Incidence Rate(IR) tahun 2016 sebesar 84,55 per 100.000 penduduk dan Case Fatality Rate(CFR) sebesar 1,11%. Angka tersebut masih diatas target nasional Provinsi Jawa Timur 2016 yaitu IR ? 49 per 100.000 penduduk dan CFR < 1%. Oleh karena itu, dibutuhkan sebuah sistem yang dapat memberikan informasi terkait pemetaan penyebaran penyakit demam berdarah dengue. Untuk membantu proses pemetaan persebaran penyakit demam berdarah dengue dibutuhkan sebuah teknologi yaitu dengan menerapkan Sistem Informasi Geografis (SIG) dan metode K-Means clustering. Sistem ini dapat membantu instansi kesehatan untuk melakukan evaluasi dan monitoring penyebaran penyakit demam berdarah dengue dan sebagai media informasi yang mempermudah masyarakat mengetahui daerah persebaran penyakit demam berdarah dengue. Berdasarkan hasil pengujian menggunakan kuesioner rata-rata seluruh pernyataan diperoleh nilai 4 dalam kategori setuju yang artinya penerapan metode K-Means clustering efektif dikembangkan sebagai penunjang kinerja pihak instansi kesehatan dalam mengetahui pemetaan penyebaran penyakit demam berdarah dengue di Kabupaten Bangkalan. Sedangkan hasil pengujian dalam menentukan jumlah cluster menggunakan metode silhouette coefficient menunjukkan hasil terbaik 0.247 pada penggunaan 6 cluster. \n\nKata Kunci : Demam Berdarah Dengue, Sistem Informasi Geografis, K-Means,  Silhouette Coefficient \n', 'Dea Hestina Angraini', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100145'),
(683, '140411100146', 'APLIKASI ANATOMI TUBUH MANUSIA SEBAGAI MEDIA PENGENALAN MENGGUNAKAN TEKNOLOGI VIRTUAL REALITY (Studi kasus : ginjal)', 'Arik Kurniawati, S.Kom.,M.T', 'Ari Kusumaningsih, S.T.,M.T', 'Virtual reality (VR) merupakan teknologi simulasi dari dunia nyata yang dibuat sama persis ke dalam bentuk virtual menggunakan android. Dalam teknologi virtual reality menampilkan obyek 3D, suara, dan teks. Virtual reality banyak digunakan diberbagai bidang, salah satunya digunakan dalam bidang pendidikan. Pada bidang pendidikan teknologi virtual reality digunakan  sebagai media pembelajaran yang lebih menarik, kreatif, dan inovatif. Teknologi Virtual reality (VR) digunakan dalam pembelajaran anatomi tubuh manusia. Pada aplikasi ini terdapat fitur yaitu zoom dan simulasi cara kerja dari ginjal yang terdapat pada mekanisme pembentukan urin. Indikator user experience dengan nilai rata – rata 81%, indikator MGBL dengan nilai rata – rata 74%, dan indikator Evaluation Heuristic dengan nilai rata – rata 83%. Berdasarkan hasil rata – rata dari setiap indikator maka disimpulkan bahwa aplikasi mudah digunakan untuk proses belajar mengajar. \n ', 'Sheila Sisilia Warninda', 10, 'https://pta.trunojoyo.ac.id/welcome/detail/140411100146');
